import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as D,q as f}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},C=["src","alt"],j={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,C)]),i("div",j,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(v,[["render",x],["__scopeId","data-v-46a80621"]]),P=JSON.parse(`[{"page_url":"https://da.wikipedia.org/wiki/P.S._Kr%C3%B8yer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Kr%C3%B8yer_fiskere_tr%C3%A6kker_vod.jpg","page_title":"P.S. Krøyer","context_page_description":"Peder Severin Krøyer var en norsk-dansk maler – og en af Skagensmalerne. Han blev født i Norge, men voksede op hos sin moster i København. Onklen var den danske zoolog Henrik Nikolai Krøyer.\\nInitialerne P.S. stod for Peder Severin; han blev kaldt Søren af sine venner. Krøyers signatur var ofte S K. Hans værker er blandt de dyreste danske malerier på auktion, adskillige har opnået priser over en million kroner."},{"page_url":"https://fr.wikipedia.org/wiki/Euloge_Schneider","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Eulog.jpg","page_title":"Euloge Schneider","context_page_description":"Johann Georg Schneider, dit Euloge Schneider, né à Wipfeld le 20 octobre 1756 et mort guillotiné à Paris le 1ᵉʳ avril 1794, est un moine franciscain, renvoyé pour ses prêches peu orthodoxes, devenu accusateur auprès du tribunal criminel de Strasbourg pendant la Révolution française."},{"page_url":"https://en.wikipedia.org/wiki/Kutno","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/AGAD_Stanislaw_August%2C_krol_polski%2C_zezwala_Andrzejowi_Zamoyskiemu%2C_kanclerzowi_wielkiemu_koronnemu%2C_na_lokacje_Kutna_1.png","page_title":"Kutno","context_page_description":"Kutno is a town located in central Poland with 44,718 inhabitants and an area of 33.6 km². Situated in the Łódź Voivodeship, previously part of Płock Voivodeship, it is the capital of Kutno County.\\nKutno was historically the center of a large Jewish community. In 1900, 10,356 Jews lived there. It was the birthplace of a famed Polish writer Sholem Ash.\\nDuring the invasion of Poland in 1939, Polish armies under General Tadeusz Kutrzeba conducted an offensive in and around Kutno, a battle that was later named the Battle of the Bzura.\\nBased on its central location and the intersection of multiple rail lines, Kutno is one of the most important railroad junctions in Poland. Two main lines cross there. Another connection also starts in Kutno, which connects the town to Płock."},{"page_url":"https://es.wikipedia.org/wiki/Bremen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Bremen_Wappen%28Mittel%29.svg","page_title":"Bremen","context_page_description":"Bremen​ es una ciudad del noroeste de Alemania, que forma junto con el puerto de Bremen o Bremerhaven, a unos 60 km al noroeste, la Ciudad Libre Hanseática de Bremen, o Estado de Bremen. La ciudad alberga unos 550 000 habitantes, mientras que el área urbana tiene unos 900 000 habitantes. El área metropolitana Bremen-Oldenburg tiene alrededor de 2,3 millones de habitantes. Antiguamente se conocía en castellano como «Brema», pero hoy día es un topónimo en desuso."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Apfelsorten/T","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Pom.Mon.Hefte_1861_Tormo-Apfel.jpg","page_title":"Liste von Apfelsorten/T","context_page_description":"Erläuterungen und Quellen: Siehe Hauptartikel!"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8F%89%ED%83%9D%EC%A0%9C%EC%B2%9C%EA%B3%A0%EC%86%8D%EB%8F%84%EB%A1%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Geumgwang_1_Tunnel_20191207_153838.jpg","page_title":"평택제천고속도로","context_page_description":"평택제천고속도로는 경기도 평택시를 기점으로, 충청북도 제천시를 종점으로 하여 동서를 잇는 대한민국의 고속도로이다. 2002년 12월 12일 서평택 분기점에서 서안성 나들목 구간이 개통된 것을 시작으로 구간별로 단계적으로 개통하여 잔여 구간인 동충주 나들목 - 제천 분기점 구간이 2015년 6월 30일에 완공하여 개통됨으로써 127.1km 전 구간이 개통되었다.\\n추후 강원도 영월군, 정선군, 태백시 등을 거쳐 삼척시까지 연장되어 동해고속도로와 연계하는 중장기적인 계획은 있지만, 지형상의 문제와 38번 국도 확장 개통으로 착공이 불투명했으나, 8월 26일 영월연장이 예비타당성 조사에서 통과하였다."},{"page_url":"https://pt.wikipedia.org/wiki/J%C3%B3zef_Pi%C5%82sudski","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/PL_Turek_Pilsudski_Monument_11.jpg","page_title":"Józef Piłsudski","context_page_description":"Józef Piłsudski foi um revolucionário polonês e estadista, marechal de campo, primeiro chefe de estado e ditador da Segunda República Polonesa, bem como o líder de suas forças armadas. Ele foi uma das mais proeminentes figuras políticas polonesas de seu tempo e é considerado o maior responsável pelo ressurgimento da Polônia quase 120 anos após sua partição pela Áustria, Prússia e Rússia em 1772-1795. A partir da metade da Primeira Guerra Mundial, até sua morte, Piłsudski foi o mais influente na política externa e no governo da Polônia. Após o golpe de estado de maio de 1926, ele tornou-se seu ditador de facto.\\nQuando jovem, ele pertenceu a diversas organizações clandestinas e usou vários pseudônimos, dentre eles: Wiktor, Mieczysław e Ziuk. Mais tarde foi afetuosamente chamado de Dziadek ou Marszałek. Seus antigos soldados também o chamavam de Komendant."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%DB%8C%DA%A9%D9%88_%D8%A7%DA%A9%D8%AA%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Psychoactive_Drugs_Legend.jpg","page_title":"سایکو اکتیو","context_page_description":"داروی فعال‌کننده روان یا روان انگیز یا سایکو اکتیو نوعی ترکیب شیمیایی است که عملکرد مغز را تغییر داده و باعث تغییراتی در ادراک، خلق، خودآگاهی یا رفتار می‌شود. این مواد را می‌توان برای مصارف پزشکی یا تفننی برای بهبود عامدانهٔ عملکرد یا تغییر خودآگاهی، برای مقاصد مناسکی، معنوی یا شمن‌باورانه یا برای تحقیقات به کار برد.\\nبرخی از این داروها از سوی پزشک تجویز می‌شوند. نمونه‌های آن داروهای ضدافسردگی، داروهای ضداضطراب، داروهای ضدروان‌پریشی و داروهای محرک هستند.\\nمصرف برخی از آنها کاملاً مجاز است و نیازی به نسخه دارویی ندارد؛ از میان آنها می‌توان به گزانتین‌ها که در قهوه، چای و شکلات یافت می‌شوند اشاره کرد.\\nالبته لفظ «فعال کننده» در توصیف سایکواکتیوها، شاید مخاطب را به این اشتباه بیاندازد که این ترکیبات شیمیایی باعث افزایش عملکرد نورون‌ها می‌شوند، درحالی که در واقعیت دارویی که وارد بدن شود و در نهایت روی روان تأثیر گذار باشد را سایکواکتیو می‌نامند.\\nبا این حال ترکیبات شیمایی ضروری برای بدن مانند اکسیژن و آب که هم کاهش و افزایش بیش‌از حد آنها باعث نقض در عملکرد نورون‌ها می‌شود و در نهایت تأثیر خود را روی روان نمایان می‌کنند سایکواکتیو محسوب نمی‌شوند. زیرا سایکواکتیوها هم نوعی دارو محسوب می‌شوند ولی موارد اشاره شده که نیاز بدن هستند و روی روان نیز تأثیر می‌گذراند دارو محسوب نمی‌شوند."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%98%EB%AF%BC%ED%83%9C%EC%9E%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Prince_Ito_and_Crown_Prince_of_Korea.jpg","page_title":"의민태자","context_page_description":"의민태자는 한국사의 마지막 황태자이자 일본 제국의 군인이다. 휘는 은, 아명은 유길, 자는 광천, 아호는 명휘, 명신재이며, 본관은 전주. 사후에 전주이씨대동종약원에서 문인무장지효명휘의민황태자라는 시호를 올렸으나 정식 시호가 아닌 사시이다. 황태자로 책봉되기 이전의 작호인 영친왕으로도 많이 알려져 있다.\\n대한제국의 초대 황제 고종의 일곱째 아들이며, 어머니는 순헌황귀비 엄씨이다. 순종과 의친왕, 덕혜옹주와는 이복 형제이다. 1897년에 경운궁 숙옹재에서 태어나 의친왕을 제치고 병약하여 아들이 없었던 순종의 황태자로 책봉되었다. 1907년에 이토 히로부미에 의하여 강제로 일본 유학을 떠났다. 1910년에 한일 병합으로 대한제국 황제가 이왕으로 격하되면서 이왕세자로 격하되었으며, 1920년에 일본 황족 나시모토노미야 마사코 내친왕과 정략혼인을 하였다. 1926년에 순종이 승하하자 왕위를 계승하여 제2대 창덕궁 이왕이 되었다. 육군사관학교와 육군대학교를 졸업하였고, 제국 육군에 입대하여 계급이 중장에 이르렀다. 1963년에서야 혼수상태인 채 대한민국에 영구 귀국하여 병상에서 생활하다가 1970년에 창덕궁 낙선재에서 사망하였다. 유해는 경기도 남양주시 금곡동의 홍유릉에 안장되었으며, 원호는 영원이다.\\n이은이 대한제국의 황태자였음에도 불구하고 제국 육군에 복무하였고, 일본 황족과 결혼하였으며, 그에 준하는 대우를 받았다는 것에 대해서 친일 논란이 있다. 2009년에 《친일인명사전》을 발간한 민족문제연구소는 사실상 볼모의 처지였다는 사실을 감안하여 인명사전 명단에서 제외하였다."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%9F%D0%BE%D0%BF%D0%BF%D0%B5%D1%82%D1%80%D0%BE%D0%B2_-_%D0%9F%D0%B0%D1%82%D1%8E_%D0%A7%D0%BE%D1%80%D0%B1%D0%B0%D0%B4%D0%B6%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D1%88%D0%BA%D0%B8%D1%8F%D1%82_%D1%85%D0%B0%D0%BD_%D0%B2_%D0%9E%D1%80%D1%85%D0%B0%D0%BD%D0%B8%D0%B5.jpg","page_title":"Павел Поппетров - Патю Чорбаджи","context_page_description":"Павел Попов Пелович, известен като Патю Чорбаджи е български търговец, ханджия, деец на българското националноосвободително движение и народен представител в Учредителното събрание, I Велико народно събрание, 1 Обикновено народно събрание и 2 Обикновено народно събрание, един от основателите на град Орхание, дн. Ботевград."},{"page_url":"https://sv.wikipedia.org/wiki/Pseudonacaduba_sichela","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Pseudonacaduba_sichela_2017_11_28_0958.jpg","page_title":"Pseudonacaduba sichela","context_page_description":"Pseudonacaduba sichela är en fjärilsart som beskrevs av Hans Daniel Johan Wallengren 1857. Pseudonacaduba sichela ingår i släktet Pseudonacaduba och familjen juvelvingar. Inga underarter finns listade."},{"page_url":"https://de.wikipedia.org/wiki/Frederik_Hendrik_Kaemmerer","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Frederick_Hendrik_Kaemmerer_-_Portrait_of_a_Woman.jpg","page_title":"Frederik Hendrik Kaemmerer","context_page_description":"Frederik Hendrik Kaemmerer war ein niederländischer Genre-, Porträt- und Landschaftsmaler."},{"page_url":"https://en.wikipedia.org/wiki/Erhan_Kartal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Erhan_Kartal.JPG","page_title":"Erhan Kartal","context_page_description":"Erhan Kartal is a Turkish footballer who plays as a right-back for Altay on loan from Samsunspor. He made his Süper Lig debut for Denizlispor against Gençlerbirliği on 2 May 2010."},{"page_url":"https://pt.wikipedia.org/wiki/Ermida_da_M%C3%A3e_de_Deus_(S%C3%A3o_Roque_do_Pico)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Ermida_M%C3%A3e_de_Deus_-_Cais_do_Pico%2C_S%C3%A3o_Roque_do_Pico%2C_na_ilha_do_Pico%2C_nos_A%C3%A7ores.JPG","page_title":"Ermida da Mãe de Deus (São Roque do Pico)","context_page_description":"A Ermida da Mãe de Deus é uma Ermida portuguesa localizada na freguesia de São Roque do Pico, no concelho de São Roque do Pico, ilha do Pico, no arquipélago dos Açores.\\nEste templo cuja data de construção recua a 1792, foi erigido à beira mar, sendo servida pela estrada da Praia da Furna de Santo António. A sua construção deve-se à iniciativa do padre Bernardo Pereira, então cura da Prainha. Como era uma ermida particular esteve nas mãos dos seus donos até ao ano de 1980.\\nCorria o ano de 1997 a Câmara Municipal de São Roque do Pico fez a doação de bancadas para assento de fiéis e de um gavetão para a sacristia. A inauguração destes melhoramentos ocorreu no mês de Outubro de 1998.\\nA imagem da Mãe de Deus que ali se venera é uma peça artística preciosa."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D1%8D%D0%B9_%D0%A6%D1%96%D0%BA%D0%BE%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%D0%A3%D0%B4%D0%B7%D0%B5%D0%BB%D1%8C%D0%BD%D1%96%D0%BA%D1%96_%D0%B1%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_%D0%B3%D1%83%D1%80%D1%82%D0%BA%D0%B0_%D1%9E_%D0%A0%D1%8B%D0%BC%D0%B0-%D0%BA%D0%B0%D1%82%D0%B0%D0%BB%D1%96%D1%86%D0%BA%D0%B0%D0%B9_%D0%B4%D1%83%D1%85%D0%BE%D1%9E%D0%BD%D0%B0%D0%B9_%D0%B0%D0%BA%D0%B0%D0%B4%D1%8D%D0%BC%D1%96%D1%96_%D1%9E_%D0%9F%D0%B5%D1%86%D1%8F%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%83_%D0%BD%D0%B0_%D0%BF%D0%B0%D1%87%D0%B0%D1%82%D0%BA%D1%83_1917_%D0%B3.jpg","page_title":"Андрэй Цікота","context_page_description":"Андрэй Цікота — беларускі рэлігійны і грамадскі дзеяч, каталіцкі святар усходняга абраду. Адзін з творцаў беларускага хрысціянскага руху ХХ ст."},{"page_url":"https://it.wikipedia.org/wiki/Dokken","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Dokken_-_Wacken_Open_Air_2018_02.jpg","page_title":"Dokken","context_page_description":"I Dokken sono un gruppo musicale heavy metal statunitense, formatosi a Los Angeles nel 1977.\\nConsiderati uno dei gruppi più emblematici della scena heavy metal statunitense, i Dokken, fondati dal frontman Don Dokken da cui prendevano il nome, furono un riferimento per uno stile molto raffinato e di buon gusto, composto da lussuose atmosfere di heavy metal contornato di AOR e dal look elegante e curato. In questo senso può essere riconosciuta come una delle più popolari band del fenomeno hair metal di Los Angeles. Nel corso della loro carriera hanno venduto un totale di circa 10 milioni di dischi nel mondo e sono stati nominati per un Grammy.\\nDopo lo scioglimento avvenuto a fine anni ottanta, la band si è riunita e, malgrado i diversi cambi di formazione e di stile, continua tutt'oggi la propria carriera."},{"page_url":"https://en.wikipedia.org/wiki/Enzo_Ferrari","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ilario_Bandini_ed_Enzo_Ferrari.jpg","page_title":"Enzo Ferrari","context_page_description":"Enzo Anselmo Giuseppe Maria Ferrari, Cavaliere di Gran Croce OMRI was an Italian motor racing driver and entrepreneur, the founder of the Scuderia Ferrari Grand Prix motor racing team, and subsequently of the Ferrari automobile marque. He was widely known as \\"il Commendatore\\" or \\"il Drake\\". In his final years he was often referred to as \\"l'Ingegnere\\" or \\"il Grande Vecchio\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%83%A3%E3%82%B8%E3%83%A3%E3%83%B3%E3%83%9F%E3%83%A7%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Jajangmyeon_by_stu_spivack.jpg","page_title":"チャジャンミョン","context_page_description":"チャジャンミョンは、韓国の麺料理である。日本においては、チャジャン麺、韓国風ジャージャー麺と表記することもある。韓国においては中華料理に分類されるが、ザージャンメンと韓国で呼ばれる中華料理のジャージャー麺とは区別される。家庭で作ることは非常にまれであり、中華料理店で調理したものが広く食べられている。"},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Bra%C8%99ov_-_C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/RO_BV_Biserica_evanghelica_din_Cata_%281%29.jpg","page_title":"Lista monumentelor istorice din județul Brașov - C","context_page_description":"Lista monumentelor istorice din județul Brașov - C cuprinde monumentele istorice înscrise în Patrimoniul cultural național al României și aflate în localități ce încep cu litera C din județul Brașov.\\nLista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, prin intermediul Institutului Național al Patrimoniului, ultima versiune datând din 2015. Această listă cuprinde și actualizările ulterioare, realizate prin ordin al ministrului culturii."},{"page_url":"https://eo.wikipedia.org/wiki/M%C3%A9daille_militaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Medaille_Militaire_2e_Empire_France.jpg","page_title":"Médaille militaire","context_page_description":"La médaille militaire estas franca ordeno, fondita la 22-an de januaro 1852 de Ludoviko-Napoleono Bonaparte por rekompenci la militistoj kaj asimilitoj, ne-oficiroj.\\nĜi estas kelkfoje nomata Médaille des braves aŭ bijou de la nation."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E4%BA%AC%E9%83%BD%E9%81%93420%E5%8F%B7%E9%AE%AB%E6%B4%B2%E5%A4%A7%E5%B1%B1%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/IkenoueShotengai.jpg","page_title":"東京都道420号鮫洲大山線","context_page_description":"東京都道420号鮫洲大山線は、東京都品川区八潮橋交差点と板橋区仲宿交差点を結ぶ特例都道である。狭隘区間が多く残るが、おおむね東京都道317号環状六号線と東京都道318号環状七号線の中間を通り、それらを補完する役割を担っている。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82%D0%BF%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D1%88%D0%BA%D0%B8_%D0%B4%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D0%B8_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D0%B7%D0%B8%D1%82%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Saint_Petersburg_University.jpg","page_title":"Санктпетербуршки државни универзитет","context_page_description":"Санктпетербуршки државни универзитет је руски федерални јавни универзитет у Санкт Петербургу. Најстарији је и један од највећих универзтета у целој Русији и спада међу веће и угледније универзитете у целој регији источне и централне Европе. Саставни делови универзитета су 24 факултета и института, факултет војних студија, катедре за физичку културу, медицинског колеџа, Колеџа физичке културе и спорта те економског и технолошког колеџа. Универзитет је организован на два кампуса, једним на Василијевском острву и другим у Петерхофу. У совјетском периоду универзитет је носио назив Лењинградски државни универзитет будући да је и град носио назив Лењинград. У периоду од 1948. до 1989. године лењинградски је универзитет је у пуном називу носио и име Андреја Жданова."},{"page_url":"https://nl.wikipedia.org/wiki/Tanystropheus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Tribelesodon.jpg","page_title":"Tanystropheus","context_page_description":"Tanystropheus is een uitgestorven geslacht der reptielen, behorend tot de Archosauromorpha, dat leefde tijdens het Midden-Trias."},{"page_url":"https://sv.wikipedia.org/wiki/Melampsora","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/SporeMelampsoraLaricisPopulinaP.jpg","page_title":"Melampsora","context_page_description":"Melampsora är ett släkte av svampar. Melampsora ingår i familjen Melampsoraceae, ordningen Pucciniales, klassen Pucciniomycetes, divisionen basidiesvampar och riket svampar."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Napa_County,_California","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/USA-St._Helena-John_Ramos_Sherry_House-Depot_Saloon-1.jpg","page_title":"National Register of Historic Places listings in Napa County, California","context_page_description":"This is a list of the National Register of Historic Places listings in Napa County, California.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Napa County, California, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in an online map.\\nThere are 87 properties and districts listed on the National Register in the county, including 1 National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted May 15, 2020."},{"page_url":"https://es.wikipedia.org/wiki/Ascq","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Jielbeaumadier_mairie_ascq_2005.jpg","page_title":"Ascq","context_page_description":"Ascq es un pueblo en el norte de Francia, situada en el río Marque, a siete kilómetros de la frontera belga. Pueblo agrícola hasta la Revolución Industrial, ahora es una zona residencial que forma parte de la ciudad de Villeneuve-d'Ascq.\\nAscq es conocido por la matanza de Ascq de 1 de abril de 1944, cuando la población fue víctima de abuso y 86 civiles inocentes fueron fusilados. El pueblo fue galardonado con la Croix de guerre 1939-1945 y la Legión de Honor.\\nAscq tiene una iglesia, una estación de tren y un museo memorial. También hay una cervecería, una fábrica de chocolate y un equipo de fútbol."},{"page_url":"https://it.wikipedia.org/wiki/Panoz_Esperante_GTR-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/DPR_Panoz.jpg","page_title":"Panoz Esperante GTR-1","context_page_description":"La Panoz Esperante GTR-1, chiamata anche Panoz GTR-1 e successivamente Panoz GTP, è una vettura sport prototipo da competizione realizzata nel 1997 dalla squadra Panoz Motorsports secondo i regolamenti ACO GT1.\\nÈ stata utilizzata nella American Le Mans Series, United States Road Racing Championship, IMSA GT, FIA GT e 24 ore di Le Mans.\\nDella vettura ne è stato realizzato anche un unico esemplare stradale."},{"page_url":"https://pt.wikipedia.org/wiki/Herman_Van_Springel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Herman-van-springel-1365564215.jpg","page_title":"Herman Van Springel","context_page_description":"Herman Van Springel é um antigo ciclista profissional belga, vencedor de inúmeros prémios e etapas em diferentes provas do ciclismo internacional nos anos 60 e 70.\\nAo longo da sua carreira, ficou como conhecido como Monsieur Bordeaux-Paris, em virtude de ter ganho a clássica prova velocipédica Bordeaux-Paris por sete vezes.\\nEmbora nunca tenha vencido nenhuma das grandes provas por etapas, acabou em 2º lugar no Tour de France em 1968 e também em 2º lugar o Giro d'Italia de 1971."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B1%D9%85%D9%86%DB%8C%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%AC%D9%85%D9%87%D9%88%D8%B1%DB%8C_%D8%A2%D8%B0%D8%B1%D8%A8%D8%A7%DB%8C%D8%AC%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Sabunchi_Railroad_Station_Baku.jpg","page_title":"ارمنی‌های جمهوری آذربایجان","context_page_description":"ارمنی‌های جمهوری آذربایجان، ارمنیان از دوران باستان در منطقه آلبانیای قفقاز سکونت داشتند.\\nجمهوری آذربایجان امروزی یازدهمین استان از پانزده استان پادشاهی ارمنستان بزرگ بوده‌است که نام آن پایتاکاران نام داشت.\\nدر دوران پادشاهان دودمان آرتاشسی این منطقه تحت تسلط تیگران بزرگ قرار داشت.\\nتا قبل از سال ۱۹۸۹ میلادی بیش از ۴۰۰٬۰۰۰ ارمنی در جمهوری آذربایجان زندگی می‌کردند."},{"page_url":"https://ca.wikipedia.org/wiki/Monestir","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Ripoll_1.jpg","page_title":"Monestir","context_page_description":"Un monestir és un tipus d'edificació per a la reclusió dels religiosos, que hi viuen en comú un o varis monjos. Originàriament un monestir era la cel·la d'un sol monjo, dit en aquest cas ermità o anacoreta. Posteriorment la tendència va ser la reunió dels diversos monjos per a establir una vida en comú. En aquest cas els monestirs cristians s'anomenen abadies, o priorats, segons el nombre de monjos. En tots els casos, la característica és la situació isolada del monestir, almenys originàriament, per tal de dur una vida espiritual apartada dels hòmens. En eixe sentit el monestir es contraposa al convent, seu d'una comunitat religiosa que no s'aparta dels hòmens sinó que viu entre ells.\\nEls monestirs poden variar molt en grandària; des d'una xicoteta llar que allotja només a un ermità o, en el cas de les comunitats, des d'un únic edifici d'habitatges per a un superior i dos o tres monjos o monges, als complexos immensos d'habitatges, finques i tallers per a desenes o centenars de monjos o monges.\\nMoltes religions i filosofies tenen tradicions monàstiques, en les quals les persones es comprometen a una vida religiosa al marge de la societat secular vivint en un monestir."},{"page_url":"https://lt.wikipedia.org/wiki/%C4%8Canthaburis","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Chanthaburi_City.jpg","page_title":"Čanthaburis","context_page_description":"Čanthaburis – miestas Tailando rytuose, išsidėstęs prie Čanthaburio upės. Čanthaburio provincijos sostinė ir Mueang Čanthaburio rajono sostinė. Čanthaburyje yra Nekaltojo Prasidėjimo katedra, pagrindinė Romos katalikų vyskupijos bažnyčia šiame regione, kuri yra didžiausia bažnyčia Tailande.\\n2005 m. šiame mieste gyveno 27 602 gyventojų."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%98%D0%B7%D0%B5%D0%BD%D0%B1%D0%B8%D1%82%D0%B5%D0%BB_(%D0%BE%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B0_%D0%B7%D0%B0%D0%B5%D0%B4%D0%BD%D0%B8%D1%86%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Wappen_Samtgemeinde_Isenbuettel.png","page_title":"Изенбител (општинска заедница)","context_page_description":"Изенбител — општинска заедница во округот Гифхорн, во Долна Саксонија, Германија. Нејзиното седиште е во општината Изенбител.\\nОпштинската заедница Изенбител се состои од следниве општини:\\nКалберла\\nИзенбител\\nРибесбител\\nВасбител"},{"page_url":"https://bar.wikipedia.org/wiki/1590","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Heldenbuch.1590.Titel.jpg","page_title":"1590","context_page_description":"Des is a Iwablick iwas Joar 1590."},{"page_url":"https://fr.wikipedia.org/wiki/Grades_des_Forces_arm%C3%A9es_des_%C3%89tats-Unis","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/CWA5.jpg","page_title":"Grades des Forces armées des États-Unis","context_page_description":"Sont énumérés ici les grades des Forces armées des États-Unis avec leur appellation en anglais, et l'indication du grade équivalent le plus proche dans l'Armée française.\\nLes insignes présentés ci-dessous sont ceux des forces armées d'active ; les insignes des candidats et officiers réservistes qui dépendent des Reserve Officers and Training Corps rattachés aux différentes composantes des Forces armées, sont différents et sont présentés dans un autre article.\\nLorsqu'une illustration montre un insigne métallique porté au col, cet insigne est porté par un militaire exerçant des fonctions administratives ou disposant d'une tenue qui n'a pas encore été actualisée.\\nDans les unités opérationnelles, les insignes de grades sont depuis les années 2000 en tissus synthétiques camouflés à dessins « numériques » pour lesquels les grades sont représentés en mode « faible visibilité ». Ces nouveaux insignes numériques sur les uniformes dénommés Army Combat Uniform remplacent progressivement les insignes métalliques et ce dans toutes les composantes des Forces armées."},{"page_url":"https://en.wikipedia.org/wiki/Lanny_Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Ready_for_Hillary-0073_%2815945804046%29.jpg","page_title":"Lanny Davis","context_page_description":"Lanny Jesse Davis is an American political operative, lawyer, consultant, lobbyist, author, and television commentator. He is the co-founder and partner of the law firm of Davis Goldberg & Galper PLLC, and co-founder and partner of the public relations firm Trident DMG. From 1996 to 1998, he served as a special counsel to President Bill Clinton, and was a spokesperson for the President and the White House on matters concerning campaign-finance investigations and other legal issues.\\nIn July 2018, Davis was hired by Michael Cohen, a former personal attorney to Donald Trump, to represent Cohen in his testimony before Congress regarding President Donald Trump. Davis later represented Cohen when he pleaded guilty to tax fraud, bank fraud, and violation of campaign finance laws on August 21, 2018.\\nDavis's clients have included Porton Group, National Women's History Museum, National Black Chamber of Commerce, eHealth, Sofitel Hotels, Trent Lott, Gene Upshaw, Dan Snyder, Martha Stewart and the Office of the President at Penn State University. Davis has been a regular television commentator and political and legal analyst for MSNBC, CNN, CNBC and network television news programs."},{"page_url":"https://hu.wikipedia.org/wiki/Az_USA_115._kongresszusa_k%C3%A9pvisel%C5%91h%C3%A1zi_tagjainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/US_Congress_NS1.jpg","page_title":"Az USA 115. kongresszusa képviselőházi tagjainak listája","context_page_description":"Az Amerikai Egyesült Államok Kongresszusának képviselőháza 435 szavazati joggal rendelkező képviselőből, valamint hat szavazati joggal nem rendelkező delegáltból áll. Az egyes államok képviselőinek számát a tíz évenként lebonyolított népszámlálás adatai, valamint az állam kiterjedése alapján határozzák meg. Ennek megfelelően a 115. kongresszusban Kaliforniának van a legtöbb, 53 képviselője, és mindössze egy képviselővel rendelkezik Alaszka, Delaware, Montana, Dél-Dakota, Észak-Dakota, Vermont, valamint Wyoming állam. A képviselőház tagjait minden páros év novemberében választják meg, mandátumukat a megválasztott képviselők január 3-án kezdik meg. A 115. kongresszus tagjait 2016. november 8-án választották meg, a következő kongresszus tagjainak megválasztására 2018. november 6-án került sor.\\n115. kongresszus 2017. január 3-a 12:00-tól 2019. január 3-án 12:00-ig ülésezik. A képviselőház többségét ebben az időszakban a republikánusok adták. A képviselőház elnöke a republikánus Paul Ryan volt.\\nA legidősebb képviselő az 1929-ben született John Conyers volt, aki egyben a legrégebben, 1965 óta tagja a testületnek. A legfiatalabb az 1984-ben született Elise Stefanik."},{"page_url":"https://en.wikipedia.org/wiki/Kumiho","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/NineTailsFox.JPG","page_title":"Kumiho","context_page_description":"A kumiho is a creature that appears in the tales and legends of Korea. Deriving from ancient Chinese myths and folklores, a fox that lives a thousand years turns into a kumiho, like its Japanese and Chinese counterparts. It can freely transform, among other things, into a beautiful woman often set out to seduce boys, and eat their liver or heart. There are numerous tales in which the kumiho appears, several of which can be found in the encyclopedic Compendium of Korean Oral Literature."},{"page_url":"https://fr.wikipedia.org/wiki/Lee_Falk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/The_Phantom%2C_Australian_Woman%27s_Mirror_2.jpg","page_title":"Lee Falk","context_page_description":"Leon Harrison Gross, dit Lee Falk, né le 28 avril 1911 à Saint-Louis et mort le 13 mars 1999 est un auteur de bande dessinée américain qui fut également écrivain, metteur en scène et producteur de théâtre. Il est surtout connu pour avoir créé les comic strips d'aventure Mandrake le magicien en 1934 et Le Fantôme en 1936."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A2nia_Fernandes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Vania_Fernandes.jpg","page_title":"Vânia Fernandes","context_page_description":"Vânia Fernandes est une artiste portugaise, née à Funchal au Portugal en 1985.\\nElle a représenté le Portugal à l'Eurovision 2008 à Belgrade, avec la chanson Senhora do mar.\\nElle termine 13ème lors de la finale du 24 mai 2008, bien qu'ayant atteint la 2ème place lors de la seconde demi-finale."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%9E%D7%AA_%D7%94%D7%A9%D7%A8%D7%95%D7%9F_(%D7%A9%D7%9B%D7%95%D7%A0%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/25Hachashmal.JPG","page_title":"רמת השרון (שכונה)","context_page_description":"רמת השרון היא שכונה שהוקמה בשנות ה-20 של המאה ה-20 בדרום תל אביב. היא כוללת את הרחובות מקווה ישראל, החשמל, לבונטין וברזילי, וגבולותיה הם הרחובות יהודה הלוי והרכבת מצפון, דרך מנחם בגין מדרום וממזרח, ורחוב אלנבי ממערב.\\nרחובה הראשי של השכונה נקרא בשם: \\"רחוב החשמל\\" לכבוד תחנת הכוח הראשונה בארץ שהוקמה ברחוב זה."},{"page_url":"https://sv.wikipedia.org/wiki/Uracanthus_bivitta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Longicorn_beetle%2C_Uracanthus_%2811434140275%29.jpg","page_title":"Uracanthus bivitta","context_page_description":"Uracanthus bivitta är en skalbaggsart som beskrevs av Newman 1838. Uracanthus bivitta ingår i släktet Uracanthus och familjen långhorningar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%8A%D8%B1%D9%86%D8%A7%D8%BA%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Myrnohrad_gerb_big.png","page_title":"ميرناغرد","context_page_description":"ميرناغرد هي مدينة في أوبلاست دونيتسك في أوكرانيا.\\nيبلغ عدد سكانها حوالي 51672 نسمة."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%83%9E%E3%83%AB%E3%83%8A%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/SmarnaGora.jpg","page_title":"シュマルナ山","context_page_description":"シュマルナ山は、スロベニアにある山。"},{"page_url":"https://nl.wikipedia.org/wiki/Ascq","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Jielbeaumadier_ascq_gare.jpg","page_title":"Ascq","context_page_description":"Ascq is een plaats in het Franse Noorderdepartement. Ascq was een zelfstandig gemeente tot 1970, toen het met Annappes en Flers-lez-Lille fusioneerde tot de nieuwe gemeente en ville nouvelle Villeneuve-d'Ascq. Het voormalig plattelandsdorpje Ascq werd zo een onderdeel van de nieuwe urbanisatie in het oosten van de Rijselse agglomeratie. Ascq ligt in het oosten van de verstedelijking; verder oostwaarts ligt nog een landelijk gebied, op vijf kilometer van de Belgische grens. Ten oosten van Ascq loopt ook de rivier de Marke.\\nTijdens de Tweede Wereldoorlog passeerden talrijke Duitse treinen via het station Ascq, gelegen tussen Rijsel en de Belgische grens. In de nacht van 1 april 1944 was er een sabotage tegen een Duitse goederentrein. Om wraak te nemen werden 86 mannen uit het dorp vermoord door de nazi's. Dit staat bekend als de Bloedbad van Ascq."},{"page_url":"https://en.wikipedia.org/wiki/Pulp_(paper)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Paperfibersar.jpg","page_title":"Pulp (paper)","context_page_description":"Pulp is a lignocellulosic fibrous material prepared by chemically or mechanically separating cellulose fibers from wood, fiber crops, waste paper, or rags. Mixed with water and other chemical or plant-based additives, pulp is the major raw material used in papermaking and the industrial production of other paper products."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_ve_Velk%C3%A9m_T%C3%BDnci","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Sloup_se_sochou_P._Marie_%28Velk%C3%BD_T%C3%BDnec%29%2C_detail.JPG","page_title":"Seznam kulturních památek ve Velkém Týnci","context_page_description":"Tento seznam nemovitých kulturních památek v obci Velký Týnec v okrese Olomouc vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://ca.wikipedia.org/wiki/Carlos_Jim%C3%A9nez_Villarejo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Carlos_Jim%C3%A9nez_Villarejo_%28marzo_2014%29.jpg","page_title":"Carlos Jiménez Villarejo","context_page_description":"Carlos Jiménez Villarejo és un advocat i polític espanyol, ex-fiscal espanyol anticorrupció."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B5%8A%E0%B4%AE%E0%B5%8B%E0%B4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Flag_of_Pomona%2C_California.png","page_title":"പൊമോന","context_page_description":"പൊമോന, അമേരിക്കൻ ഐക്യനാടുകളിലെ കാലിഫോർണിയ സംസ്ഥാനത്ത്, ലോസ് ആഞ്ചെലെസ് കൌണ്ടിയിൽ സ്ഥിതിചെയ്യുന്ന ഒരു നഗരമാണ്. ഈ നഗരം പൊമോന താഴ്‍വരയിൽ, ഇൻലാന്റ് എമ്പയറിനും സാൻ ഗബ്രിയേൽ താഴ്‍വരയ്ക്കുമിടയിലായി സ്ഥിതിചെയ്യുന്നു. 2010-ലെ അമേരിക്കൻ സെൻസസ് പ്രകാരം, നഗരത്തിലെ ആകെ ജനസംഖ്യ 149,058 ആയിരുന്നു."},{"page_url":"https://de.wikipedia.org/wiki/Ratnik-Programm","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Navigation_and_control_system_%282%29.jpg","page_title":"Ratnik-Programm","context_page_description":"Das Ratnik-Programm ist ein Vorhaben des russischen Militärs zur Modernisierung der Ausrüstung und Gefechtsführung der russischen Infanterie."},{"page_url":"https://en.wikipedia.org/wiki/%C3%89cole_nationale_sup%C3%A9rieure_des_Beaux-Arts","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Nicolas_Poussin_ensba_paris_001.jpg","page_title":"École nationale supérieure des Beaux-Arts","context_page_description":"The École nationale supérieure des beaux-arts is a fine arts grand school of PSL Research University in Paris, France.\\nThe École des beaux-arts is made up of a complex of buildings located at 14 rue Bonaparte, between the quai Malaquais and the rue Bonaparte. This is in the heart of Saint-Germain-des-Prés, just across the Seine from the Louvre museum. The school was founded in 1648 by Charles Le Brun as the famed French academy Académie de peinture et de sculpture. In 1793, at the height of the French Revolution, the institutes were suppressed. However, in 1817, following the Bourbon Restoration, it was revived under a changed name after merging with the Académie d'architecture. Held under the King's tutelage until 1863, an imperial decree on November 13, 1863 named the school's director, who serves for a five-year term. Long supervised by the Ministry of Public Instruction, the École des Beaux-Arts is now a public establishment under the Ministry of Culture."},{"page_url":"https://pl.wikipedia.org/wiki/Schmitshausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Schmitshausen-58-Sonnenbergstr_22%2B19%2B21-gje.jpg","page_title":"Schmitshausen","context_page_description":"Schmitshausen – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Südwestpfalz, wchodzi w skład gminy związkowej Thaleischweiler-Wallhalben. Do 30 czerwca 2014 wchodziła w skład gminy związkowej Wallhalben."},{"page_url":"https://ast.wikipedia.org/wiki/Salix_fragilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/381_Salix_fragilis.jpg","page_title":"Salix fragilis","context_page_description":"Salix fragilis, la blimal fráxil, o a cencielles blimal, anque comparte esti nome con otres especies de Salix, ye un sauce nativu d'Europa y del oeste d'Asia, que usualmente espolleta nes riberes fluviales."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Hagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Hohenlimburg%2C_Wesselbachstra%C3%9Fe_51.JPG","page_title":"Liste der Baudenkmäler in Hagen","context_page_description":"Die Liste der Baudenkmäler in Hagen enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Hagen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Hagen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://no.wikipedia.org/wiki/Uglesommerfugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Brassolis_sophorae_MHNT_Male_dos.jpg","page_title":"Uglesommerfugler","context_page_description":"Uglesommerfugler er en gruppe av sommerfugler som hører til underfamilien ringvinger i den store familien flikvinger. De finnes bare i Sør- og Mellom-Amerika. Familien omfatter til dels meget store, brunlige arter. I motsetning til de fleste dagsommerfugler holder de seg helst inne i den mørke regnskogen og kommer sjelden ut i lyset. Uglesommerfuglene ble tidligere ofte regnet som en familie for seg, Brassolidae."},{"page_url":"https://no.wikipedia.org/wiki/Seriemafugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Cariama_cristata.jpg","page_title":"Seriemafugler","context_page_description":"Seriemafugler er en orden med store, langlemmede terrestriske rovfugler. Slektslinjen kan ha eksistert i omkring 60 millioner år. Gruppen regnes som de eneste gjenlevende slektningene etter de nå utdødde «terrorfuglene», som kunne bli opp mot 3 meter høye."},{"page_url":"https://tr.wikipedia.org/wiki/Erica_Wheeler","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Wheeler_20190901.jpg","page_title":"Erica Wheeler","context_page_description":"Erica Wheeler, Amerikan profesyonel basketbolcu. 1,70 m boyundadır ve oyun kurucu pozisyonunda oynamaktadır. Günümüzde Indiana Fever ve İzmit Belediyespor forması giymektedir."},{"page_url":"https://fr.wikipedia.org/wiki/Caldwell_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Caldwell_Ohio_Main_Street.jpg","page_title":"Caldwell (Ohio)","context_page_description":"Caldwell est une petite ville de l'État de l'Ohio, aux États-Unis.\\nElle est le siège du comté de Noble."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BD%D0%B7%D0%B0%D0%B4%D0%B0_%D0%96%D1%83%D0%BC%D0%BE%D0%BD%D0%B3_(%D1%82%D0%B5%D0%BB%D0%B5%D1%85%D0%B8%D0%BA%D0%B0%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Jumong_site_6.jpg","page_title":"Ханзада Жумонг (телехикая)","context_page_description":"Ханзада Жумонг - Оңтүстік Корея телесериалы. Сериал Когуре мемлекетінің негізін қалаушы Тонменсон жайлы оқиғаларды баян етеді. Сериал бүкіл әлемде өте танымал болды. Сериалдың бюджеті 32 млн долларды құрады."},{"page_url":"https://en.wikipedia.org/wiki/Shrenik_Rao","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Shrenik_-_Rao.jpeg","page_title":"Shrenik Rao","context_page_description":"Shrenik Rao is an Indian film-maker, academic, and broadcaster. He is the founder and chief executive of Dolsun Media and 7MB – 7 Media Broadcasting Pvt Ltd. He was a Fellow at the University of Oxford’s Reuters Institute for the Study of Journalism & an alumus of the London School of Economics.\\nHe wrote, directed, and produced the documentary films Denied – This Bit of Truth, Mugabe's Zimbabwe, 7 Notes to Infinity, and The Monsoon Oracle, which have been distributed to 52 countries around the world."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D1%80%D1%96%D0%BD%D0%B3_%D0%A2%D0%B0%D1%83%D0%BD%D1%88%D0%B8%D0%BF_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%A1%D0%BD%D0%B0%D0%B9%D0%B4%D0%B5%D1%80,_%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D1%8C%D0%B2%D0%B0%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/SnyderMiddleswarth.jpg","page_title":"Спрінг Тауншип (округ Снайдер, Пенсильванія)","context_page_description":"Спрінг Тауншип — селище в США, в окрузі Снайдер штату Пенсильванія. Населення — 1616 осіб."},{"page_url":"https://fr.wikipedia.org/wiki/Vielsalm","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Vielsalm_chasse_%C3%A0_courre_07.jpg","page_title":"Vielsalm","context_page_description":"Vielsalm est une commune francophone de Belgique située en Région wallonne dans la province de Luxembourg, ainsi qu’une localité où siège son administration.\\nLa commune fait partie de l'arrondissement administratif de Bastogne."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A4%E3%83%B3%E3%83%90%E3%83%AB%E3%83%8F%E3%82%B0%E3%83%AD%E3%82%BD%E3%82%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Starr_060810-8493_Dicliptera_chinensis.jpg","page_title":"ヤンバルハグロソウ","context_page_description":"ヤンバルハグロソウ Dicliptera chinensis は、キツネノマゴ科の草。ハグロソウによく似ているが、別属である。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B3%D1%83%D0%B0%D1%81%D0%BA%D0%B0%D0%BB%D1%8C%D1%94%D0%BD%D1%82%D0%B5%D1%81_(%D0%BC%D1%96%D1%81%D1%82%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Escudo_aguascalientes.PNG","page_title":"Агуаскальєнтес (місто)","context_page_description":"Аґуаскальєнтес — столиця штату Аґуаскальєнтес на заході центральної Мексики. Назва походить з іспанського «aguas calientes», що значить «гарячі води». Місто отримало свою назву через велику кількість гарячих джерел."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B9%D8%AA%D8%A8%D8%A9_%D8%A7%D9%84%D9%81%D8%A7%D8%B7%D9%85%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Fatimah_Ma%27sumah_Shrine_%D9%82%D9%85%D8%8C_%D8%AD%D8%B1%D9%85_%D9%81%D8%A7%D8%B7%D9%85%D9%87_%D9%85%D8%B9%D8%B5%D9%88%D9%85%D9%87_%D8%AF%D8%AE%D8%AA%D8%B1_%D9%85%D9%88%D8%B3%DB%8C_%D8%A7%D8%A8%D9%86_%D8%AC%D8%B9%D9%81%D8%B1_%D8%A7%D9%85%D8%A7%D9%85_%D9%87%D9%81%D8%AA%D9%85_%D8%B4%DB%8C%D8%B9%DB%8C%D8%A7%D9%86_28.jpg","page_title":"العتبة الفاطمية","context_page_description":"العتبة الفاطمية هو مرقد فاطمة بنت الإمام موسى بن جعفر الكاظم سابع الأئمة الاثنا عشر وأخت الإمام علي بن موسى الرضا. وُلدت في مدينة جدّها النبي محمد في الأول من ذي القعدة عام 173 هـ، وتوفيت في مدينة قم المقدسة بإيران عام 201 هـ، ودُفنت فيها، ومرقدها الآن يتوسط المدينة ويزوره الشيعة."},{"page_url":"https://en.wikipedia.org/wiki/Babe_Ruth","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/RuthMonument.jpg","page_title":"Babe Ruth","context_page_description":"George Herman \\"Babe\\" Ruth Jr. was an American professional baseball player whose career in Major League Baseball spanned 22 seasons, from 1914 through 1935. Nicknamed \\"The Bambino\\" and \\"The Sultan of Swat\\", he began his MLB career as a star left-handed pitcher for the Boston Red Sox, but achieved his greatest fame as a slugging outfielder for the New York Yankees. Ruth established many MLB batting records, including career home runs, runs batted in, bases on balls, slugging percentage, and on-base plus slugging; the last two still stand as of 2019. Ruth is regarded as one of the greatest sports heroes in American culture and is considered by many to be the greatest baseball player of all time. In 1936, Ruth was elected into the Baseball Hall of Fame as one of its \\"first five\\" inaugural members.\\nAt age seven, Ruth was sent to St. Mary's Industrial School for Boys, a reformatory where he was mentored by Brother Matthias Boutlier of the Xaverian Brothers, the school's disciplinarian and a capable baseball player. In 1914, Ruth was signed to play minor-league baseball for the Baltimore Orioles but was soon sold to the Red Sox."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D8%A7%D8%AA%D8%A7_%D9%83%D8%A7%D8%AF%D8%B2%D9%8A%D9%88%D8%A7%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Beata_K%C4%85dzio%C5%82ka_2013.jpg","page_title":"بياتا كادزيواكا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبياتا كادزيواكا لاعبه شطرنج من بولاندا."},{"page_url":"https://en.wikipedia.org/wiki/Izzy_Stradlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Izzy_010.jpg","page_title":"Izzy Stradlin","context_page_description":"Jeffrey Dean Isbell, best known as Izzy Stradlin, is an American guitarist, singer and songwriter. He is best known as the co-founder and former rhythm guitarist of the hard rock band Guns N' Roses, which he left at the height of their fame in 1991, and with whom he recorded four studio albums.\\nFollowing his departure from Guns N' Roses, Stradlin fronted his own rock band Izzy Stradlin and the Ju Ju Hounds, before continuing to record as a solo artist. He was inducted into the Rock and Roll Hall of Fame as a member of Guns N' Roses in 2012."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%A8%D8%AC%D9%88%D8%AE%D8%A7%D9%86%D9%87_%D9%BE%D9%88%D9%84%D9%88%D8%B2_%D9%85%D9%88%DA%A9%D9%88%DA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Old_Gyumri.jpg","page_title":"آبجوخانه پولوز موکوچ","context_page_description":"آبجوخانه پولوز موکوچ یک رستوران و آبجوخانه سرشناس در گیومری دومین شهر پرجمعیت ارمنستان می‌باشد. این آبجوخانه در طی دهه ۱۹۶۰ در جمهوری سوسیالیستی ارمنستان شوروی دایر بود و در ناحیه تاریخی کومایری واقع شده بود. آبجوخانه به نام طنزپرداز ساکن گیومری «مکرتیچ ملکونیان» که با نام «پولوز موکوچ» شناخته می‌شد، نامگذاری شده بود."},{"page_url":"https://es.wikipedia.org/wiki/Inmigraci%C3%B3n_en_Per%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Jos%C3%A9_Antonio_Chang_2.jpg","page_title":"Inmigración en Perú","context_page_description":"La inmigración en Perú es una actividad que se ha producido desde la época del Virreinato, con españoles y africanos, a lo largo de su época republicana y hasta nuestros días, con los movimientos migratorios más importantes de América Latina, Asia y Europa.\\nEn el Perú se encuentran diversas comunidades de ascendencia de diversos países europeos, principalmente debido a que se trató de una migración por lazos familiares, vecinales y de amistad, ocurrido desde mediados del Virreinato del Perú. Los migrantes llegaban como prestadores de servicios, profesionales, comerciantes e inversores al próspero virreinato y, después de la proclamación de independencia, a la república.\\nLos europeos que llegaron al Perú tomaron posiciones importantes en la vida económica peruana aunque sin llegar a penetrar en las élites. Hubo miembros de la burguesía europea que llegaron como empleados de las grandes casas comerciales de Europa, si bien algunos estuvieron de paso, otros tantos formaron familias con mujeres peruanas radicando definitivamente en el Perú.​"},{"page_url":"https://fr.wikipedia.org/wiki/Martin-chasseur_%C3%A0_moustaches","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/ActenoidesBougainvilleiKeulemans.jpg","page_title":"Martin-chasseur à moustaches","context_page_description":"Le Martin-chasseur à moustaches est une espèce d'oiseau de la famille des Alcedinidae."},{"page_url":"https://ro.wikipedia.org/wiki/Horbourg-Wihr","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Map_commune_FR_insee_code_68145.png","page_title":"Horbourg-Wihr","context_page_description":"Horbourg-Wihr este o comună în departamentul Haut-Rhin din estul Franței. În 2009 avea o populație de 4.976 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_gesch%C3%BCtzten_Landschaftsteile_der_Stadt_Salzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Eichenreihe_im_Schlosspark_Hellbrunn.jpg","page_title":"Liste der geschützten Landschaftsteile der Stadt Salzburg","context_page_description":"Nach den rechtlichen Normen des Salzburger Naturschutzgesetzes sind wertvolle Baumbestände, aber auch kleine Moore und Bachläufe samt ihrer unmittelbaren Umgebung dann als geschützte Landschaftsteile auszuweisen, wenn sie wegen ihrer besonderen Tier- und Pflanzenwelt, aber auch ihres besonderen Aussehen, oder etwa ihres hohen Alters Besonderheiten der Natur darstellen.\\nIn der folgenden Liste der geschützten Landschaftsteile der Stadt Salzburg werden all jene vollständig aufgelistet. Genannt werden dabei die jeweilige Flächengröße, die Bezeichnung des jeweiligen Landschaftsteiles und das Datum seiner Unterschutzstellung."},{"page_url":"https://pt.wikipedia.org/wiki/John_Pope_(senador)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/AR_Pope_John.jpg","page_title":"John Pope (senador)","context_page_description":"John Pope foi um político dos Estados Unidos foi senador da república pelo estado de Kentuxky, foi membro da Câmara dos Representantes dos Estados Unidos, foi secretário de estado do Kentucky, e também foi governador do Território do Arkansas.\\nPope João nasceu em no Condado de Prince William, na Virginia em 1770. Ele perdeu um braço durante a sua juventude. Ele estudou Direito e mudou-se para Springfield, no Kentucky. Ele exerceu a advocacia nos condados de Washington, Shelby e Fayette, ambos em Kentucky. Ele foi eleito para a Câmara dos Deputados Kentucky em 1802 e mais tarde entre 1806 e 1807.\\nPope foi eleito como um republicano para o Senado dos Estados Unidos, tendo mandato de 1807 a 1813, e serviu como presidente pro tempore do Senado durante o 6º Congresso. Ele também atuou como membro do Senado de Kentucky entre 1825 a 1829, e foi eleito três vezes como pelo Partido Whig para a Câmara dos Representantes dos Estados Unidos sendo eleito pelo 7º distrito congressional do Kentucky entre 1837 e 1843.\\nDe 1829 a 1835 ele foi Governador do Território Arkansas."},{"page_url":"https://en.wikipedia.org/wiki/Aonghus_M%C3%B3r","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Aonghus_M%C3%B3r_mac_Domhnaill_%28seal%29.png","page_title":"Aonghus Mór","context_page_description":"mor\\nAonghus Mór mac Domhnaill was a leading figure in the thirteenth-century kingdoms of the Isles and Scotland. He was a son of Domhnall mac Raghnaill, the eponym of Clann Domhnaill, a branch of Clann Somhairle. Aonghus Mór appears to have succeeded his father in the mid part of the thirteenth century. At the time, the rulers of the Isles were fiercely independent of the Scottish Crown, and owed nominal allegiance to the distant Norwegian Crown. Aonghus Mór's first certain appearance in the historical record seems to evince his involvement in aiding native Irish kindreds against the consolidation of Anglo-Irish authority in the north-west Ireland. Such cooperation could have been undertaken in the context of overseas kindreds like Clann Domhnaill constructing Irish alliances to gain assistance against Scottish encroachment.\\nScottish aggression against the Isles seems to have precipitated the Norwegian Crown's campaign against the Scots in 1263. Like other leading members of Clann Somhairle, Aonghus Mór supported the Norwegian cause against Alexander III, King of Scotland."},{"page_url":"https://en.wikipedia.org/wiki/Stanislav_Prychynenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Stanislav_Prychynenko.jpg","page_title":"Stanislav Prychynenko","context_page_description":"Stanislav Prychynenko is a Ukrainian football defender. He also holds Russian citizenship as Stanislav Vladimirovich Prichinenko."},{"page_url":"https://nl.wikipedia.org/wiki/Zand","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Sand_from_Marine_d%27Albo%2C_Corsica%2C_France.jpg","page_title":"Zand","context_page_description":"Zand is zacht, hard, los en korrelig materiaal en een van de meest voorkomende natuurlijke stoffen op aarde. Zand bestaat uit zeer kleine stukjes steen, zandkorrels, die in grootte variëren tussen 63 micrometer en 2 millimeter. Als de korrels kleiner dan 63 micrometer zijn heet de grondsoort silt; bij korrels groter dan 2 millimeter spreekt men van grind.\\nZand komt meestal voor als sediment, hetgeen wil zeggen dat het zand is vervoerd door water of wind. Zo zijn van zand duinen, stranden, woestijnen en rivierbeddingen ontstaan. De korrels zijn meestal afbraakmateriaal van gesteenten, maar kunnen ook van organische afkomst zijn."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%85%D5%B8%D6%82%D5%AF%D5%A1%D5%BF%D5%A1%D5%B6%D5%AB_%D5%B6%D5%A5%D5%B2%D5%B8%D6%82%D6%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Cuba.A2002334.1625.250m.jpg","page_title":"Յուկատանի նեղուց","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Յուկատան\\nՅուկատանի նեղուց, ծովային նեղուց Յուկատան թերակղզու և Կուբայի միջև: Այն միացնում է Մեքսիկական ծոցը Կարիբյան ծովի արևմտյան հատվածի ջրերին։\\nՆեղուցի նվազագույն լայնությունը՝ 217 կմ։ Ամենահյուսիսային կետը Յուկատան թերակղզին է, որը պատկանում է Մեքսիկայի Միացյալ Նահանգներին: Ամենամեծ խորությունը կազմում է 2779 մետր:\\nՅուկատանի նեղուցի միջոցով հարավից դեպի հյուսիս է անցնում տաք ծովային հոսանքներ, որոնք շարունակվում են մինչև Կարիբյան ավազանի վերջը՝ 2-9 կմ/ժ արագությամբ։\\nԴրա արդյունքում Մեքսիկական ծոցի առափնյա հատվածներում արձանագրվում է ծովի մակարդակի բարձրացում, որը առավել նկատելի է հատկապես Ֆլորիդայի նեղուցում:\\nՅուկատանը Լատինական Ամերիկայի կարևոր նշանակություն ունեցող նեղուցներից մեկն է։ Նրա միջոցով կապ է հաստատվում Հարավային և Հյուսիսային Ամերիկաների միջև։ Նեղուցի վրա գտնվող հիմնական նավահանգիստները դրանք Կանկունը և Լա Ֆեն են, որոնք համապատասխանաբար պատկանում են Մեքսիկային և Կուբային:"},{"page_url":"https://fr.wikipedia.org/wiki/Gioacchino_Lanza_Tomasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Gioacchino_Lanza_Tomasi.jpg","page_title":"Gioacchino Lanza Tomasi","context_page_description":"Gioacchino Lanza Tomasi, né le 11 février 1934 à Rome, est un musicologue, directeur artistique et écrivain italien, spécialiste de l'opéra. Il est également l'auteur de plusieurs ouvrages sur le patrimoine culturel de la Sicile et l'éditeur de textes consacrés à Giuseppe Tomasi di Lampedusa, l'auteur du Guépard, dont il est le fils adoptif.\\nIl a reçu en 2007 la Médaille d'or du mérite des beaux-arts décernée par le ministère de l'Éducation, de la Culture et des Sports de l'Espagne."},{"page_url":"https://fr.wikipedia.org/wiki/Carrotmob","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Porkkanamafia.jpg","page_title":"Carrotmob","context_page_description":"Carrotmob est une association à but non lucratif basée à Paris et originaire de San Francisco, en Californie. Elle utilise le buycott afin de récompenser l'engagement qu'a pris une entreprise de réaliser des changements socialement responsables dans sa façon de fonctionner. Carrotmob fait également référence à un mouvement global d'organisateurs de communautés qui utilisent la tactique Carrotmob d'activisme des consommateurs comme moyen de changer les entreprises dans leurs communautés."},{"page_url":"https://fr.wikipedia.org/wiki/W%C5%93rth","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Woerth_monument_francais.jpg","page_title":"Wœrth","context_page_description":"Wœrth est une commune française située dans le département du Bas-Rhin, en région Grand Est.\\nCette commune se trouve dans la région historique et culturelle d'Alsace et fait partie du parc naturel régional des Vosges du Nord.\\nSes habitants sont appelés les Wœrthois et les Wœrthoises."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8F%8D%E5%9C%8B%E6%AD%8C%E6%B3%95%E3%80%81%E5%9C%8B%E5%AE%89%E6%B3%95%E5%A4%A7%E9%81%8A%E8%A1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/DSCF5881_%2849930492913%29.jpg","page_title":"反國歌法、國安法大遊行","context_page_description":"“反恶歌法大游行”是指在2020年5月24日起由香港网民发起，自发在香港岛举行的反对国歌法及国安法的游行。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Kitzb%C3%BChel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Kitzbuehel-UntereGaensbachgasse_I.JPG","page_title":"Liste der denkmalgeschützten Objekte in Kitzbühel","context_page_description":"Die Liste der denkmalgeschützten Objekte in Kitzbühel enthält die 69 denkmalgeschützten, unbeweglichen Objekte der Stadtgemeinde Kitzbühel im gleichnamigen Bezirk Kitzbühel."},{"page_url":"https://en.wikipedia.org/wiki/Evie,_Orkney","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Wind_Turbines_-_Burgar_Hill%2C_Orkney%2C_Scotland%2C_UK_-_June_3%2C_1989_01.jpg","page_title":"Evie, Orkney","context_page_description":"Evie is a parish and village on Mainland, Orkney, Scotland. The parish is located in the north-west of the Mainland, between Birsay and Rendall, forming the coastline opposite the isle of Rousay."},{"page_url":"https://fr.wikipedia.org/wiki/Patric_Klandt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Patric_Klandt_2012.jpg","page_title":"Patric Klandt","context_page_description":"Patric Klandt, né le 29 septembre 1983 à Francfort-sur-le-Main, est un footballeur allemand. Il évoluait au poste de gardien de but."},{"page_url":"https://es.wikipedia.org/wiki/Modelo_de_Kano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Desplazamiento_temporal_modelo_Kano.png","page_title":"Modelo de Kano","context_page_description":"El modelo Kano es una teoría de desarrollo de productos y de satisfacción del cliente desarrollada en la década de 1980 por el profesor Noriaki Kano, que clasifica a las preferencias del cliente en cinco categorías."},{"page_url":"https://vi.wikipedia.org/wiki/Prunus_cerasoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Neerland%27s_Plantentuin_%28Pl._48%29_%288969299188%29.jpg","page_title":"Prunus cerasoides","context_page_description":"Tên khoa học:Prunus cerasoides, tiếng Nhật:ヒマラヤサクラ, tiếng Anh: wild himalayan cherry, ở Đà Lạt được gọi là Mai anh đào Đà Lạt, là một loài thực vật thuộc chi Mận mơ phân chi anh đào.Đây là loài Anh Đào phân bố ở Đông Á và phía bắc Nam Á ở độ cao trên 1000 m. Thuộc cây ôn đới, loài này đã được mô tả khoa học lần đầu tiên bởi nhà thực vật học Scotland David Don.Có nguồn gốc từ dãy Himalaya và dãy núi Tây Tạng, và một số vùng núi ở Nhật Bản, Trung Quốc, Hàn Quốc, Đài Loan ở độ cao từ 1000m và trên 1000m đến 3000m của vùng núi phía bắc đông nam á như:Chiang Mai, Đà Lạt, Sapa, Tagaung,\\nPhạm vi phân bố kéo dài từ phía bắc Nam Á: dãy Himalaya từ Himachal Pradesh ở phía bắc Ấn Độ, Nepan, tới Tây Nam Trung Quốc, bắc Miến Điện, bắc và Tây Nguyên Việt Nam, bắc Lào và kéo dài đến phía Đông Bắc Á: Đài Bắc, Busan, Tokyo, Okinawa, Thượng Hải...... Nó phát triển ở các khu rừng ôn đới, cận nhiệt đới ở độ cao từ 1.200-2.400 mét."},{"page_url":"https://zh.wikipedia.org/zh-sg/GAU-12%E5%B9%B3%E8%A1%A1%E8%80%85%E6%9C%BA%E7%82%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/LAV-AD_1999_firing_DM-SD-00-02951.JPEG","page_title":"GAU-12平衡者机炮","context_page_description":"GAU-12/U是一挺由美国通用动力开发及制造的电力驱动加特林式机炮，发射25×137毫米北约口径机炮炮弹。\\nGAU-12/U目前正被美国、意大利及西班牙所使用，其中最主要是安装在他们的战斗机上，例如AV-8“猎鹰II式”攻击机、空中炮艇和陆上的装甲战斗车辆。"},{"page_url":"https://ca.wikipedia.org/wiki/Diagrama_de_Coxeter-Dynkin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Uniform_tiling_73-t0.png","page_title":"Diagrama de Coxeter-Dynkin","context_page_description":"En geometria, un diagrama de Coxeter-Dynkin és un graf amb arestes etiquetades numèricament que representen les relacions espacials entre una col·lecció de miralls. Això descriu una construcció calidoscòpica: cada «node» del graf representa un mirall i l'etiqueta enganxada a la branca codifica l'ordre de l'angle díedre entre dos miralls. Una branca no marcada representa implícitament ordre-3.\\nCada diagrama representa un grup de Coxeter, i els grups de Coxeter estan classificats pels seus diagrames associats.\\nEls diagrames de Dynkin estan estretament relacionats, però difereixen dels diagrames de Coxeter en dos aspectes:\\nen primer lloc, les branques etiquetades com a «4» o més grans són dirigides, mentre que els diagrames de Coxeter no són dirigides;\\nen segon lloc, els diagrames Dynkin han de satisfer una restricció addicional, és a dir, que les úniques branques permeses són les etiquetades com 2, 3, 4 i 6.\\nEls diagrames Dynkin es corresponen i s'utilitzen per classificar els sistemes d'arrels i, per tant, les àlgebres de Lie semisimple."},{"page_url":"https://es.wikipedia.org/wiki/Kentucky","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/1850_Western_District_of_Columbia.jpg","page_title":"Kentucky","context_page_description":"Kentucky, oficialmente mancomunidad de Kentucky, es uno de los cincuenta estados que, junto con Washington D. C., forman los Estados Unidos de América. Su capital es Frankfort y su ciudad más poblada, Louisville.\\nEstá ubicado en la región Sur del país, división Centro Sureste. Limita al norte con el río Ohio que lo separa de Illinois, Indiana y Ohio, al noreste con los ríos Big Sandy y Tug Fork que lo separan de Virginia Occidental, al sureste con Virginia, al sur con Tennessee y al oeste con el río Misisipi que lo separa de Misuri. Fue admitido en la Unión el 1 de junio de 1792, como el estado número 15.\\nAunque el centro de su actividad económica son la manufactura de productos industrializados y el turismo, buena parte del estado es predominantemente rural, con la agricultura como principal fuente de ingresos.\\nAnteriormente, se creía que el origen del nombre del estado venía de una palabra amerindia, que significa «terreno de caza oscuro y sangriento», porque las tribus nativas que vivían en la región cazaban dentro de los densos bosques del estado, y porque a menudo estas tribus luchaban entre sí en estos bosques.​"},{"page_url":"https://en.wikipedia.org/wiki/Giovanni_Caprara_(volleyball)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Giovanni_Caprara_1.jpg","page_title":"Giovanni Caprara (volleyball)","context_page_description":"Giovanni Caprara is an Italian women's volleyball coach who currently manages Azerbaijan women's national volleyball Netherlands women's team.\\nIn 2005-2008 head coach of the Russian women's team, from April 2010 to March 2011 the head coach of women's national team of Greece. Merited Coach of Russia.\\nWith the season-2014/15 head coach Eczacıbaşı VitrA. Caprara led the Istanbul team to victory CEV Champions League and the Club World Championship.\\nWife - Irina Kirillova, one of the best volleyball players of the world the 2nd half of 1980, after the collapse of the Soviet Union came to play for Croatia. The couple met when Kirillova played in Bergamo, where Caprara was the second coach."},{"page_url":"https://en.wikipedia.org/wiki/1978_Philippine_parliamentary_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Ferdinand_Marcos.JPEG","page_title":"1978 Philippine parliamentary election","context_page_description":"A parliamentary election was held in the Philippines on April 7, 1978 for the election of the 165 regional representatives to the Interim Batasang Pambansa. The elections were participated in by the leading opposition party, the Lakas ng Bayan, which had twenty-one candidates for the Metro Manila area while the leading candidate was the jailed opposition leader Ninoy Aquino, and the Marcos regime's party known as the Kilusang Bagong Lipunan, which was led by the then-First Lady Imelda Marcos. Ninoy was allowed to run by his fellow partymates under the Liberal Party, who boycotted the election and was not allowed to campaign, and so his family campaigned for him. The night before the election on April 6, 1978, a noise barrage was organized by the supporters of which occurred up to dawn.\\nThese elections were followed by the sectoral election on April 27, which elected additional 14 representatives. Another 10 representatives were appointed, bringing up the total number of representatives to 189."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B5%D0%B1%D0%BB%D0%B0%D0%B2%D0%B8%D0%BA_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Keflavik_airport_%2815527495266%29.jpg","page_title":"Кеблавик (аэропорт)","context_page_description":"Международный аэропорт Кеблавик, также известный как Аэропорт Рейкьявик-Кеблавик, крупнейший аэропорт Исландии и главный хаб страны для международных авиаперевозок. Расположен в 3,1 км к западу от города Кеблавик и в 50 км от Рейкьявика. В аэропорту две взлётно-посадочные полосы, площадь аэропорта составляет около 25 кв. км.\\nМеждународный аэропорт Кеблавик является хабом для Icelandair и обслуживает большую часть международных авиаперевозок Исландии, все внутренние рейсы осуществляются через аэропорт Рейкьявика, который расположен в 3 км от городского центра Рейкьявика. Исключение составляют только сезонные рейсы в Акюрейри. Оператором аэропорта Кеблавик является государственное предприятие Isavia."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Finney_County,_Kansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Windsor_Hotel_%28Garden_City_KS%29_from_NE_1.JPG","page_title":"National Register of Historic Places listings in Finney County, Kansas","context_page_description":"This is a list of the National Register of Historic Places listings in Finney County, Kansas.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Finney County, Kansas, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 10 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://sv.wikipedia.org/wiki/Jo%C5%BEe_Ple%C4%8Dnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Plecnik_Prag_lores.jpg","page_title":"Jože Plečnik","context_page_description":"Jože Plečnik, född 23 januari 1872 i Ljubljana, död 7 januari 1957 i Ljubljana, var en slovensk arkitekt, verksam i Wien, Belgrad, Prag och Ljubljana."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%91%D7%99_%D7%95%D7%95%D7%9E%D7%91%D7%90%D7%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Abby_Wambach.jpg","page_title":"אבי וומבאק","context_page_description":"מארי אביגיל וומבאק היא כדורגלנית עבר אמריקאית ששיחקה כחלוצה. זכתה בתואר כדורגלנית השנה בארצות הברית שש פעמים. היא כבשה 184 שערים במדי הנבחרת, נתון המציב אותה במקום הראשון בכל הזמנים במספר השערים הבינלאומיים לגברים או נשים."},{"page_url":"https://tl.wikipedia.org/wiki/Xinghua","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%E5%9B%9B%E7%89%8C%E6%A5%BC%EF%BC%88%E5%85%B4%E5%8C%96%EF%BC%89.JPG","page_title":"Xinghua","context_page_description":"Ang Xinghua ay isang antas-kondado na lungsod na pinamamahalaan ng antas-prepektura na lungsod ng Taizhou, lalawigan ng Jiangsu, Tsina. Ito ay nasa gitnang bahagi ng lalawigan, at hinahangganan ng antas-prepektura na mga lungsod ng Yancheng sa hilaga at silangan at Yangzhou sa kanluran.\\nAng Xinghua ay daglat ng \\"Xingsheng jiaohua \\" na nagngangahulugang \\"pinauunlad turong.\\""},{"page_url":"https://ja.wikipedia.org/wiki/%E9%81%93%E3%81%AE%E9%A7%85%E4%B8%80%E6%9E%9A%E5%B2%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Ichimaiiwa-Rokumeikan01.JPG","page_title":"道の駅一枚岩","context_page_description":"道の駅一枚岩は、和歌山県東牟婁郡古座川町にある国道371号の道の駅である。"},{"page_url":"https://fr.wikipedia.org/wiki/Maison_de_la_musique_d%27Helsinki","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/HelsinkiMusicCentre-7177.jpg","page_title":"Maison de la musique d'Helsinki","context_page_description":"La Maison de la musique d'Helsinki est un centre de concerts et un centre musical situé rue Eero Erkonkatu dans le quartier Töölönlahti à Helsinki et près de la bibliothèque centrale d'Helsinki Oodi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Krakow_35.jpg","page_title":"История Польши","context_page_description":"С VII века до н. э. до IV века н. э. на территории Польши протекал процесс этногенеза славян. В X веке образовалось Польское государство под властью князя Мешко из рода Пястов, который в 966 году принял христианство по латинскому обряду. Болеслав Храбрый завершил объединение польских земель. В период феодальной раздробленности существовали самостоятельные удельные княжества, возглавляемые линиями династии Пястов. Казимир III Великий в середине XIV века овладел землями Галицко-Волынского княжества. Люблинская уния 1569 года объединила Польшу с Великим княжеством Литовским в единое государство — Речь Посполитую. Генриковы артикулы окончательно оформили устройство государства как «шляхетской республики». В 1772—1795 годах Пруссия, Австрия и Россия осуществили разделы Речи Посполитой. В 1807 года Наполеон создал на землях Пруссии зависимое от Франции Варшавское княжество, большая часть которого по решению Венского конгресса 1814—1815 годов вошла в состав России.\\nНа присоединённых землях происходили национально-освободительные восстания. В 1918 году была провозглашена Польская Республика. С 1939 по 1945 год Польша находилась под оккупацией Германии."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%93%D1%83%D0%BD%D0%B0%D1%80%D1%81_%D0%91%D0%B8%D1%80%D0%BA%D0%B5%D1%80%D1%82%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Eastern-Partnership-Summit-22-05-2015-2742.jpg","page_title":"Гунарс Биркертс","context_page_description":"Гунарс Биркертс — латыш сығышлы американ архитекторы, үҙ карьераһының бөтә дауамында Мичиган штатындағы Детройт ҡалаһы метрополитен проекты өҫтөндә эшләй. Латвия Фәндәр академияһының сит ил ағзаһы. Өс йондоҙ ордены офицеры."},{"page_url":"https://pl.wikipedia.org/wiki/Villahoz","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/VillahozIglesiaDeVillahozp1050356-p1050363.jpg","page_title":"Villahoz","context_page_description":"Villahoz – gmina w Hiszpanii, w prowincji Burgos, w Kastylii i León, o powierzchni 50,53 km². W 2011 roku gmina liczyła 351 mieszkańców."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%91%D0%B8%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F%D0%BB%D1%8B%D2%9B_%D2%9B%D0%B0%D1%83%D1%96%D0%BF%D1%81%D1%96%D0%B7%D0%B4%D1%96%D0%BA_%D0%BF%D1%80%D0%BE%D0%B1%D0%BB%D0%B5%D0%BC%D0%B0%D0%BB%D0%B0%D1%80%D1%8B%D0%BD%D1%8B%D2%A3_%D2%93%D1%8B%D0%BB%D1%8B%D0%BC%D0%B8-%D0%B7%D0%B5%D1%80%D1%82%D1%82%D0%B5%D1%83_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82%D1%8B%D0%BD%D1%8B%D2%A3_%D0%BC%D0%B5%D0%BC%D0%BB%D0%B5%D0%BA%D0%B5%D1%82%D1%82%D1%96%D0%BA_%D0%B5%D0%BD%D1%88%D1%96%D0%BB%D0%B5%D1%81_%D0%BA%D3%99%D1%81%D1%96%D0%BF%D0%BE%D1%80%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Seymour_Benzer.gif","page_title":"Биологиялық қауіпсіздік проблемаларының ғылыми-зерттеу институтының мемлекеттік еншілес кәсіпорны","context_page_description":"Биологиялық қауіпсіздік проблемаларының ғылыми-зерттеу институтының иемлекеттік еншілес кәсіпорны – ҚР Білім және Ғылым министрлігі Ғылым комитеті шаруышылық жүргізу құқығындағы ҚР Ұлттық биотехнология орталығы; Жамбыл облысы, Қордай ауданы, Гвардейский кентінде орналасқан.\\nОның құрамында 10 лаборатория, 8 бөлім, 1 бөлімше бар.\\nБиопрепараттарды сүрлеу әдістері мен технологиялары;\\nВирустық індеттерді балау және жіктеу;\\nВирустардың молекулярлық биологиясы мен гендік инженериясы;\\nТоршалық биотехнология;\\nМикроорганизмдер жинаққор;\\nҚұстардың вирустық ауруларын бақылау және алдын алу;\\nЗооноздық індеттерді бақылау және болжау;\\nӨсімдіктер иммунитеті;\\nБиопрепараттар технологиясын өнімдеу және бақылау лабораториялары жұмыс істейді.\\n1992 жылы ҚР Ауыл шаруашылығы министрлігі Бас ветеринария басқармасына, 1993 жылы ҚР Білім және ғылыми министрлігі Ұлттық биотехнология орталығына, 1999 жылы ҚР Энергетика, индустрия және сауда министрлігіне, 2001 жылдан ҚР Білім және ғылыми министрлігі Ұлттық битехнология орталығына қарайтын болды."},{"page_url":"https://en.wikipedia.org/wiki/Langaha_madagascariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Langaha_madagascariensis_001.jpg","page_title":"Langaha madagascariensis","context_page_description":"Langaha madagascariensis is a medium-sized highly cryptic arboreal species. It is endemic to Madagascar and found in deciduous dry forests and rain forests, often in vegetation 1.5 to 2 meters above the ground."},{"page_url":"https://pl.wikipedia.org/wiki/United_States_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/USS_Gerald_R._Ford_%28CVN-78%29_underway_on_8_April_2017.JPG","page_title":"United States Navy","context_page_description":"United States Navy – marynarka wojenna Stanów Zjednoczonych; jeden z rodzajów amerykańskich sił zbrojnych odpowiedzialny za organizację, szkolenie oraz wyposażenie morskich sił zbrojnych – w tym Korpusu Piechoty Morskiej – do prowadzenia działań bojowych na morzu. W szczególności, zadaniem marynarki i piechoty morskiej Stanów Zjednoczonych jest poszukiwanie i niszczenie nieprzyjacielskich sił morskich oraz powstrzymywanie jego handlu morskiego; w celu zdobycia i utrzymania ogólnej przewagi morskiej; kontroli obszarów morskich o żywotnym znaczeniu, ochrony żywotnych linii żeglugowych; ustanowienia i utrzymania lokalnej przewagi w obszarze działań morskich; zajmowanie i obrona baz morskich; oraz przeprowadzanie operacji lądowych i powietrznych niezbędnych do prowadzenia kampanii morskich."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D8%B1%D9%89_%D9%85%D8%A7%D9%83%D9%8A%D9%86%D8%B2%D9%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/MacKenzie%2C_Gary.jpg","page_title":"جارى ماكينزى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجارى ماكينزى لاعب كورة قدم من المملكه المتحده."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Affrique","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Blason_Famille_fr_de-Caylus.png","page_title":"Saint-Affrique","context_page_description":"Saint-Affrique est une commune française située dans le département de l'Aveyron, en région Occitanie."},{"page_url":"https://en.wikipedia.org/wiki/S%C3%BCdfriedhof_(Leipzig)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Werner_T%C3%BCbke_Gravestone.jpg","page_title":"Südfriedhof (Leipzig)","context_page_description":"Südfriedhof is, with an area of 82 hectares, the largest cemetery in Leipzig. It is located in the south of Leipzig in the immediate vicinity of the Völkerschlachtdenkmal. The Südfriedhof is, along with the Ohlsdorf Cemetery in Hamburg and the Südwestkirchfriedhof Stahnsdorf in Berlin, the largest park-like cemetery in Germany."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%B9%D0%B7%D0%BA%D1%80%D0%B0%D1%83%D0%BA%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Bandera_Aizkraukle.png","page_title":"Айзкраукле","context_page_description":"Айзкраукле е град в централна Латвия, намиращ се в историческите области Земгале и Видземе. Градът е административен център на район Айзкраукле. Айзкраукле се намира на около 90 km от столицата Рига и е разположен на десния бряг на река Даугава."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B8%8C%EB%A0%88%EC%B2%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/BrezelnSalz02_%28cropped%29.JPG","page_title":"브레첼","context_page_description":"브레첼은 매듭 모양으로 만든 독일식 빵이다. 독일, 오스트리아, 스위스 등 독일어 사용 국가에서 흔히 주식으로 먹는 빵이며, 프랑스의 알자스 지방에서도 즐겨 먹는다. 같은 모양의 미국식 과자가 프레츨로 불리기도 한다."},{"page_url":"https://pt.wikipedia.org/wiki/Amazona_kawalli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Amazona_kawalli_JJK%271.jpg","page_title":"Amazona kawalli","context_page_description":"O papagaio-dos-garbes é uma ave psitaciforme da família Psittacidae. Descrito em 1989, foi por muitos anos confundido com o papagaio-moleiro, diferenciando-se, porém, pela notável faixa branca presente na base do bico."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Mara%C3%B1%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/R%C3%ADo_Mara%C3%B1%C3%B3n_00277.jpg","page_title":"Río Marañón","context_page_description":"El río Marañón fluye íntegramente en territorio peruano y con el río Ucayali forma el río Amazonas. La fuente más lejos de la desembocadura está a 4,600 m de altura al pie del Nevado Yarupac cuya cumbre está a 5,480 m de altura en la Cordillera Raura​, en la provincia de Lauricocha. Más al norte, en la cordillera Huayllay tiene una segunda fuente importante: las nacientes de los ríos Carhuacocha y Janca, los que van a formar el río Nupe, el que se unirá con el río Lauricocha para formar el Marañón​. La longitud del río Marañón es de 1,707 km hasta su confluencia, en Nauta con el río Ucayali​.\\nEl área de captación del río Marañón es de 363,432 km² de los cuales 297,038 están en el Perú​. La diferencia está en el Ecuador."},{"page_url":"https://en.wikipedia.org/wiki/H%C3%B4tel_Mansencal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Mansencal-arriere.jpg","page_title":"Hôtel Mansencal","context_page_description":"The Hôtel Mansencal in Toulouse, France, is a Renaissance hôtel particulier of the 16th century. It is a listed historical monument since 1925."},{"page_url":"https://en.wikipedia.org/wiki/Conus_geographus","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Cone_g%C3%A9ographique.png","page_title":"Conus geographus","context_page_description":"Conus geographus, popularly called the geography cone or the geographer cone, is a species of predatory cone snail. It lives in reefs of the tropical Indo-Pacific, and hunts small fish. Although all cone snails hunt and kill prey using venom, the venom of this species is potent enough to kill humans. Specimens should be handled with extreme caution.\\nThe variety Conus geographus var. rosea G. B. Sowerby I, 1833 is a synonym of Conus eldredi Morrison, 1955."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D0%B1%D0%BE,_%D0%99%D0%BE%D1%85%D0%B0%D0%BD%D0%BD%D0%B5%D1%81_%D0%A5%D1%91%D1%81%D1%84%D0%BB%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/20190301_FIS_NWSC_Seefeld_Men_4x10km_Relay_Johannes_Hoesflot_Klaebo_850_6218.jpg","page_title":"Клебо, Йоханнес Хёсфлот","context_page_description":"Йоха́ннес Хёсфлот Клебо — норвежский лыжник, трёхкратный олимпийский чемпион 2018 года, трёхкратный чемпион мира 2019 года, обладатель Кубка мира сезонов 2017/18 и 2018/19, победитель многодневной гонки «Тур де Ски» сезона 2018/19, трёхкратный чемпион мира среди юниоров."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A3%D8%B1%D9%85%D9%86_%D9%81%D9%8A_%D8%A5%D8%B3%D8%B7%D9%86%D8%A8%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Armenian-church-in-Istanbul.jpg","page_title":"الأرمن في إسطنبول","context_page_description":"كان الأرمن في إسطنبول تاريخيًا واحدة من أكبر الأقليات الدينية في مدينة إسطنبول. وغالبًا ما يشار إلى المدينة من قبل الأرمن بإسم بولس من قبل وهي كلمة مشتقة من الاسم التاريخي للمدينة وهي القسطنطينية. تشير معظم الإحصائيات إلى أنّ عدد الأرمن في المدينة تتراوح بين 50,000 إلى 60,000 و70,000 نسمة.\\nخلال القرن التاسع عشر تحسنت أوضاع الملّة الأرمنيّة الأرثوذكسيّة لتُصبح أكثر طوائف الدولة العثمانية تنظيمًا وثراءً وتعليمًا، وعاشت النخبة من الأرمن في عاصمة الإمبراطورية العثمانية حيث تميزوا بالغناء الفاحش وعلى وجه الخصوص العائلات الكبيرة المعروفة آنذاك كعائلة دوزيان وباليان ودادايان حيث كان لهم نفوذ اقتصادي كبير في الدولة.\\nويتخذ من إسطنبول مقرًا أيضًا رئيس أساقفة الجالية التركية الأرثوذكسية ورئيس أساقفة الأرمن الأرثوذكس في تركيا. حيث أن الغالبية العظمى من الأرمن في إسطنبول ينتمون إلى الديانة المسيحية والكنيسة الأرمنية الأرثوذكسية مع أقلية تتكون من 3,450 أرمني يتبعون كنيسة الأرمن الكاثوليك. تاريخيًا كانت بعض الأحياء والنواحي تأوي أعدادًا كبيرة من غير المسلمين من سكان إسطنبول، مثل حي \\"بوابة الرمال\\" وحي ساماتيا الذي كان يسكنه عدد كبير من الأرمن الأرثوذكس."},{"page_url":"https://en.wikipedia.org/wiki/Carlos_Royer","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Carlos_Royer.jpg","page_title":"Carlos Royer","context_page_description":"Carlos \\"Bebe\\" Royer was a Cuban baseball pitcher in the Cuban League. He played from 1892 to 1910 with several Cuban ballclubs. He was elected to the Cuban Baseball Hall of Fame in 1939."},{"page_url":"https://ceb.wikipedia.org/wiki/Ceratina_dupla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Ceratina_dupla%2C_F%2C_side%2C_New_York%2C_Kings_County_2013-02-14-14.33.19_ZS_PMax_%288488235598%29.jpg","page_title":"Ceratina dupla","context_page_description":"Espesye sa buyog ang Ceratina dupla. Una ning gihulagway ni Thomas Say ni adtong 1837. Ang Ceratina dupla sakop sa kahenera nga Ceratina sa kabanay nga Apidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Roger_Joseph_Boscovich","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Bosco-image-1-14.jpg","page_title":"Roger Joseph Boscovich","context_page_description":"Roger Joseph Boscovich was a physicist, astronomer, mathematician, philosopher, diplomat, poet, theologian, Jesuit priest, and a polymath from the Republic of Ragusa. He studied and lived in Italy and France where he also published many of his works.\\nBoscovich produced a precursor of atomic theory and made many contributions to astronomy, including the first geometric procedure for determining the equator of a rotating planet from three observations of a surface feature and for computing the orbit of a planet from three observations of its position. In 1753 he also discovered the absence of atmosphere on the Moon."},{"page_url":"https://pl.wikipedia.org/wiki/Babiak_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Brd%C3%B3w_-_ko%C5%9Bci%C3%B3%C5%822.jpg","page_title":"Babiak (gmina)","context_page_description":"Babiak – gmina wiejska położona w województwie wielkopolskim, w północnej części powiatu kolskiego. W latach 1975–1998 administracyjnie należała do województwa konińskiego.\\nSiedzibą władz gminy jest Babiak. W 2016 roku gminę zamieszkiwały 8004 osoby."},{"page_url":"https://war.wikipedia.org/wiki/Villanueva,_Misamis_Oriental","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Ph_locator_misamis_oriental_villanueva.png","page_title":"Villanueva, Misamis Oriental","context_page_description":"An Villanueva usa nga ika-upat nga klase nga bungto ha lalawigan o probinsya han Misamis Oriental ha Pilipinas. Sumala han census han tuig 2000, mayda ini populasyon nga 24,867 ka tawo ha 4,779 nga panimalay."},{"page_url":"https://nl.wikipedia.org/wiki/Maximilianus_Transylvanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Transylvanus_De_Moluccis_Insulis.jpg","page_title":"Maximilianus Transylvanus","context_page_description":"Maximilianus Transylvanus, ook Maximilianus van Transsylvanië en Maximiliaen von Sevenborgen, was een zestiende-eeuwse schrijver, gevestigd in de Zuidelijke Nederlanden, die een eerste verslag publiceerde van de omvaart van de wereld door Magellaan en Elcano. Hij schreef het nadat hij de overlevenden van de Victoria interviewde, en omdat hij een familielid was van de financier van de reis Christopher de Haro, was zijn verslag De Moluccis Insulis, samen met dat van Antonio Pigafetta, een belangrijke kennisbron over de expeditie."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%89%B4%ED%8A%BC%EC%95%84%EC%A6%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/CIMG1481_ScraboViewNewtownardsTown.JPG","page_title":"뉴튼아즈","context_page_description":"뉴튼아즈는 북아일랜드 다운주의 도시로 인구는 28,039명이다. 벨파스트에서 동쪽으로 16km 정도 떨어진 곳에 위치한다."},{"page_url":"https://cs.wikipedia.org/wiki/Tramvajov%C3%A1_doprava_v_Gda%C5%88sku","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Konstal_NGd99.JPG","page_title":"Tramvajová doprava v Gdaňsku","context_page_description":"Tramvajová doprava v Gdaňsku zahrnuje síť městských tramvají o rozchodu 1435 mm. Přibližně od roku 1946 do roku 1961 existovala i meziměstská trať do Sopot."},{"page_url":"https://en.wikipedia.org/wiki/Dresden_Academy_of_Fine_Arts","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Dresdner-Kunstakademie.jpg","page_title":"Dresden Academy of Fine Arts","context_page_description":"The Dresden Academy of Fine Arts, often abbreviated HfBK Dresden or simply HfBK, is a vocational university of visual arts located in Dresden, Germany. The present institution is the product of a merger between the famous Dresden Art Academy, founded in 1764, the workplace and training ground of a number of influential European artists, and another well-established local art school, Hochschule für Werkkunst Dresden, after World War II."},{"page_url":"https://es.wikipedia.org/wiki/Bas%C3%ADlica_de_San_Antonio_de_Padua","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Padova_Basilica_di_Sant%27Antonio_Innen_Seitenkapelle_3.jpg","page_title":"Basílica de San Antonio de Padua","context_page_description":"La Basílica Pontificia Menor de San Antonio de Padua es una gran iglesia italiana, construida entre los años 1238 y 1310, que es uno de los principales lugares de culto católicos de la ciudad de Padua, en la región del Véneto.\\nConocida por los paduanos simplemente como il Santo [el Santo], es una de las iglesias más grandes del mundo visitada anualmente por más de 6.5 millones de peregrinos, lo que la convierte en uno de los santuarios más venerados del mundo cristiano. Sin embargo, no es la catedral de la ciudad, un título que pertenece al Duomo. En ella se custodian las reliquias de san Antonio de Padua y su tumba.\\nLa piazza del Santo, situada delante de la basílica, alberga el monumento ecuestre a Gattamelata de Donatello. Fundia en bronce en 1453, fue la primera estatua ecuestre realizada en Italia desde la época romana. Donatello también realizó las esculturas de bronce que Camillo Boito colocó en el altar mayor que el propio Boito diseñó.\\nTiene la dignidad de una basílica pontificia. Con los Pactos de Letrán, la propiedad y administración del complejo antoniano se cedió a la Santa Sede, ​ mientras permanecía territorialmente como parte del estado italiano."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Delitzsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Hallesche_Stra%C3%9Fe_44_Delitzsch_20180813_002.jpg","page_title":"Liste der Kulturdenkmale in Delitzsch","context_page_description":"In der Liste der Kulturdenkmale in Delitzsch sind die Kulturdenkmale der sächsischen Stadt Delitzsch verzeichnet, die bis April 2020 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Landkreis Nordsachsen."},{"page_url":"https://nl.wikipedia.org/wiki/Christian_Lopez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Christian_Lopez_%28en_1976%29.jpg","page_title":"Christian Lopez","context_page_description":"Christian Lopez is een voormalig profvoetballer uit Frankrijk, die speelde als verdediger gedurende zijn carrière. Hij beëindigde zijn loopbaan in 1987 bij US Montélimar. Lopez werd geboren in Frans Algerije. Met AS Saint-Étienne werd hij viermaal landskampioen en won hij driemaal de Coupe de France."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D1%8A%D1%80%D0%BB%D0%BE%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Alburnus_alburnus_cropped.jpg","page_title":"Върловка","context_page_description":"Върловка е вид лъчеперка от семейство Шаранови. Видът не е застрашен от изчезване."},{"page_url":"https://en.wikipedia.org/wiki/Rhoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Rhoon%2C_de_Sint_Willibrorduskerk_foto2_2015-08-02_16.11.jpg","page_title":"Rhoon","context_page_description":"Rhoon is a village that borders the municipality of the city of Rotterdam, South Holland, the Netherlands.\\nAccording to its history it was established in 1199 and was ruled by the lords of Duiveland. In the 14th century the village was struck by many floods.\\nIn the last big flood, the North Sea flood of 1953, the Dutch government implemented the \\"deltawerken\\". This is a large protection barrier of dikes and dams to keep the water of the North Sea out during high tides. In 1969 Rhoon also became part of this plan and a large dike was established around the island of IJsselmonde.\\nRhoon is part of the island of IJsselmonde and situated in the south of this island.\\nOn the lands outside the dikes is a small yacht marina on the banks of the river Oude Maas, and also a \\"griend\\" which is a tidal forest. The river Oude Maas has a tidal difference of around 1.2 meter in a twice daily cycle.\\nSince 1 January 1985, the village has been part of the municipality of Albrandswaard together with Poortugaal.\\nThe village has a connection to the city of Rotterdam by Rotterdam Metro line D, through Rhoon station.\\nIn Rhoon is the Dutch Consulate General of Ireland."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Pardoux-les-Cards","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Map_commune_FR_insee_code_23229.png","page_title":"Saint-Pardoux-les-Cards","context_page_description":"Saint-Pardoux-les-Cards är en kommun i departementet Creuse i regionen Nouvelle-Aquitaine i de centrala delarna av Frankrike. Kommunen ligger i kantonen Chénérailles som tillhör arrondissementet Aubusson. År 2009 hade Saint-Pardoux-les-Cards 295 invånare."},{"page_url":"https://hr.wikipedia.org/wiki/Semeiskie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Old_Believers_chapel.JPG","page_title":"Semeiskie","context_page_description":"Semeiskie je ruska etnička zajednica tzv. „staroobrednika” koji naseljavaju Zabajkalski kraj još od vremena vladavine Katarine Velike u 18. st. Njihova kultura predstavlja ostatak kulturnih izražaja Rusije prije 17. stoljeća, zbog čega su njihov kulturni prostor i oralna kultura postali nematerijalna svjetska baština još 2001., a 2008. godine su upisani i na UNESCO-v popis nematerijalne svjetske baštine u Aziji i Oceaniji."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%85%AB%E5%BE%B7%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/%E6%A1%83%E5%9C%92%E5%B8%82%E5%85%AB%E5%BE%B7%E5%8D%80%E5%B7%A7%E5%85%8B%E5%8A%9B%E5%85%B1%E5%92%8C%E5%9C%8B.jpg","page_title":"八德區","context_page_description":"八德区为中华民国桃园市的市辖区，位于桃园市的东北部，东西长6,760米，南北长8,460米，面积33.7111平方公里，是桃园市面积最小的行政区，为衔接桃园台地与台北盆地之门户。八德区北邻桃园区，东邻新北市莺歌区，西邻中坜区，西南连平镇区，南接大溪区，地势南高北低，有茄苳溪贯穿南北。统计至2020年7月底人口数有207,826人，人口密度约6,195人/平方公里，密度为桃园市第二高行政区，仅次于桃园区。桃园县于2014年12月25日升格为直辖市，原县辖八德市改制为八德区。"},{"page_url":"https://cs.wikipedia.org/wiki/Narkissos","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Michelangelo_Caravaggio_065.jpg","page_title":"Narkissos","context_page_description":"Narkissos je v řecké mytologii syn říčního boha Kéfísa a nymfy Leiropé nebo synem pastýře Endymióna a bohyně Měsíce Seléné.\\nByl to mladík poněkud plachý, ale krásný tak, že mu nadbíhaly ženy, ale i krásné nymfy. On však o žádnou z nich nestál, byl hrdý na svou krásu a dával přednost osamělým toulkám po lesích. Jeho odmítání, domýšlivost a sebeláska popouzely zejména nymfy, takže prosily bohyně Afrodítu i Nemesis, aby ho potrestaly.\\nPak se do Narkissa zamilovala nešťastná nymfa Echó, kterou bohyně Héra ze msty zbavila hlasu a odsoudila ji k tomu, že Echó přestala mluvit a opakovala jen poslední slova, která zaslechla od lidí či jiných tvorů. Osamělá Echó se zoufale zamilovala do krásného Narkissa. Ten však její láskou pohrdal a celé dny jenom pozoroval svůj obraz, který se odrážel na vodní hladině. Trest od bohů na sebe nedal dlouho čekat. Narkissos se zamiloval do obrazu na hladině a nemohl se od něj odtrhnout. Tak dlouho se nakláněl nad hladinu, až se nakonec ve studánce utopil. Jeho tělo nebylo nalezeno, prý bylo proměněno ve žlutý květ narcisu. V Řecku byl narcis považován za květinu smrti."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Bonner_Ortsteil_Godesberg-Villenviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Bad_Godesberg%2C_D%C3%BCrenstra%C3%9Fe_17.JPG","page_title":"Liste der Baudenkmäler im Bonner Ortsteil Godesberg-Villenviertel","context_page_description":"Die folgende Liste enthält in der Denkmalliste ausgewiesene Baudenkmäler auf dem Gebiet des Bonner Ortsteils Godesberg-Villenviertel im Stadtbezirk Bad Godesberg.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Denkmalliste der Stadt Bonn, die von der Unteren Denkmalbehörde geführt wird. Grundlage für die Aufnahme in die Denkmalliste ist das Denkmalschutzgesetz Nordrhein Westfalens.\\nKarte mit allen Koordinaten des Ortsteils Godesberg-Villenviertel: OSM"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Cavendish_banana_from_Maracaibo.jpg","page_title":"Банана","context_page_description":"Банана е име на род на зелјести растенија и на економски значаен вид од семејството Musaceae. Истото име се користи и за плодот на овие растенија, кој луѓето го користат во исхраната како овошје.\\nБананата е овошје кое од ботаничко гледиште претставува бобинка. Таа е плод на неколку големи зелјести, скриеносемени, монокотиледони растенија од родот Musa. Во некои земји, бананите се користат за варење, и тогаш се нарекуваат плантани. Ова овошје варира според величина, боја и цврстина, обично е издолжено и свиткано, со мек плод, богат со скроб и покриен со лушпа која може да биде зелена, жолта, црвена, пурпурна или кафена кај зрелите плодови. Плодовите растат во групи кои висат од врвот на растението. Скоро сите модерни, јадливи банани се партенокарпени банани кои потекнуваат од два диви вида - Musa acuminata и Musa balbisiana. Научните имиња на најчесто одгледуваните видови се: Musa acuminatа, Musa balbisiana и нивниот хибрид Musa × paradisiaca, што зависи од нивната геномска конституција. Постарото научно име, Musa sapientum, повеќе не е во употреба."},{"page_url":"https://et.wikipedia.org/wiki/Dorset","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Dorset_districts.png","page_title":"Dorset","context_page_description":"Dorset on tseremoniaalkrahvkond Edela-Inglismaal.\\nDorset jaguneb 8 omavalitsusringkonnaks:\\nWeymouth ja Portland\\nWest Dorset\\nNorth Dorset\\nPurbeck\\nEast Dorset\\nChristchurch\\nBournemouth\\nPoole"},{"page_url":"https://en.wikipedia.org/wiki/Florence_Mkhize_(patrol_vessel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Florence_Mkhize_patrol_vessel_photo.jpg","page_title":"Florence Mkhize (patrol vessel)","context_page_description":"Florence Mkhize is an environmental protection vessel operated by the South African Ministry of the Environment.\\nShe was launched in June 2006.\\nAt 14 metres, and capable of 65 knots, she is smaller and faster than four earlier environmental protection vessels. The three vessels in the Lillian Ngoyi class are 47 metres long and capable of 25 knots.\\nAt the launch of Florence Mkhize, Marthinus van Schalkwyk, South African Ministry of the Environment, asserted the vessel's design was unique.\\nThe hull is constructed of aluminium and she was designed and tested by Cape Advanced Engineering, a South African company based in Atlantis, Western Cape.\\nFlorence Mkhize spent her first four months in commission countering perlemoen poaching in Algoa Bay near Port Elizabeth.\\nAll of the South African environmental patrol vessels are named after anti-apartheid heroines, like Florence Mkhize."},{"page_url":"https://de.wikipedia.org/wiki/Liebe_(2012)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Isabelle_Huppert_66%C3%A8me_Festival_de_Venise_%28Mostra%29_3b.jpg","page_title":"Liebe (2012)","context_page_description":"Liebe ist ein Spielfilm des österreichischen Regisseurs und Drehbuchautors Michael Haneke aus dem Jahr 2012. Das kammerspielartige Drama handelt von einem pensionierten, gutsituierten Pariser Ehepaar, dessen Liebe auf die Probe gestellt wird, nachdem die Frau einen Schlaganfall erlitten hat. Das Drehbuch zu Liebe war laut Haneke durch eigene Erlebnisse in seiner Familie inspiriert. Der Film ist eine Produktion der französischen Les Films du Losange, des deutschen X-Filme Creative Pool und der österreichischen Wega Film.\\nHanekes Film, der am 20. Mai 2012 im Rahmen des Wettbewerbs der 65. Internationalen Filmfestspiele von Cannes uraufgeführt wurde, gewann mit der Goldenen Palme den Hauptpreis des Festivals. Es folgten zahlreiche weitere internationale Auszeichnungen, darunter 2013 ein Oscar und ein Golden Globe, jeweils als bester fremdsprachiger Film, sowie zwei BAFTA Awards und fünf Césars. Im September 2012 war Liebe als offizieller österreichischer Kandidat auf eine Nennung in der Oscar-Kategorie Bester fremdsprachiger Film ausgewählt worden.\\nIn Deutschland lief Liebe am 20. September 2012 in den Kinos an, in Österreich einen Tag später."},{"page_url":"https://ca.wikipedia.org/wiki/BMD-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/BMDgraphic1.jpg","page_title":"BMD-1","context_page_description":"El BMD-1 és un vehicle de combat d'infanteria per a paracaigudistes d'origen soviètic. Després de la Segona Guerra Mundial la Unió Soviètica va posar molt d'èmfasi en el desenvolupament de les seves fores aerotransportades, les Vozduixno-desantnie vojska. Per donar més potència de foc i mobilitat a les VDV un cop a terra, durant la dècada dels 60, es va dissenyar el BMD-1, que seria fabricat a la Planta de Tractors de Volgograd i entraria en servei el 1969.\\nTot i tenir múltiples semblances amb el BMP-1, el BMD-1 tenia un buc totalment nou i molt més lleuger, que li permetia ser desplegat des dels avions Il-76 i An-12. Aquest vehicle va transformar les VDV d'infanteria lleugera a infanteria mecanitzada i, amb 330 d'aquests blindats per cada divisió, només es veien superades per les forces mecanitzades més modernes del bloc capitalista.\\nMalgrat tenir nombrosos inconvenients, el BMD-1 va arribar a una producció d'unes 2.000 unitats, amb múltiples variants, i es va guanyar una bona reputació. Ha servit, i continua en actiu, a nombrosos estats i conflictes arreu del món, destacant especialment a la invasió soviètica de l'Afganistan."},{"page_url":"https://en.wikipedia.org/wiki/Viva_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/DonMillsStationVIVA.jpg","page_title":"Viva Green","context_page_description":"Viva Green is a Viva bus rapid transit line in York Region, north of Toronto, Ontario, Canada. It is operated by Tok Transit under contract from the Region of York."},{"page_url":"https://de.wikipedia.org/wiki/Anne_Schierenbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Schierenbeck%2C_Anne-8943.jpg","page_title":"Anne Schierenbeck","context_page_description":"Anne Schierenbeck ist eine deutsche Ingenieurin und war Mitglied der Bremischen Bürgerschaft."},{"page_url":"https://de.wikipedia.org/wiki/Roupala_montana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Roupala_montana_2_Jo%C3%A3o_de_Deus_Medeiros.jpg","page_title":"Roupala montana","context_page_description":"Roupala montana ist eine Pflanzenart in Familie der Silberbaumgewächse aus dem mittleren bis nördlichen Südamerika bis Zentralamerika und in den Süden Mexikos."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_Grupos_PET","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Logo_PET_-_EPS.jpg","page_title":"Lista de Grupos PET","context_page_description":"O Programa de Educação Tutorial é um programa do Governo Federal brasileiro de estímulo a atividades de pesquisa, ensino e extensão universitárias, no nível de graduação. O programa é subordinado à Secretaria de Educação Superior do Ministério da Educação."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%9D%E1%83%A0%E1%83%A2%E1%83%A3%E1%83%92%E1%83%90%E1%83%9A%E1%83%98%E1%83%98%E1%83%A1_%E1%83%93%E1%83%94%E1%83%93%E1%83%9D%E1%83%A4%E1%83%9A%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Portrait_of_Maria_of_Aragon%2C_Belem_Collection.JPG","page_title":"პორტუგალიის დედოფლების სია","context_page_description":"პორტუგალიის დედოფლების სიაში წარმოდგენილია იმ ქალების სია, რომლებიც დაქორწინებულნი იყვნენ პორტუგალიის მეფეზე, ან იმპერატორზე.\\nპორტუგალიას მთელი მისი ისტორიის მანძილზე 36 ასეთი დედოფალი ჰყავდა, აქედან სამი - მარია I, მარია II და ბეატრის I პორტუგალიის დედოფლები იყვნენ, ოღონდ მეფის პრივილეგიებით სარგებლობდნენ, ვინაიდან მათ ტახტი არა ქორწინებით, არამედ მემკვიდრეობით მიიღეს. დანარჩენები ატარებდნენ უბრალოდ დედოფლის ტიტულს, თუმცა ბევრ მათგანს დიდი ძალაუფლება ჰქონდა. ასეთები პორტუგალიის ისტორიაში არც ისე ცოტანი იყვნენ, მათ ასეთი შეუზღუდავი ძალაუფლება ძირითადად რეგენტობის დროს მიიღეს.\\nმეფე დინიშ I-ის მეუღლე - დედოფალი ისაბელ არაგონელი წმინდანადაა შერაცხული.\\nპორტუგალიის 36 დედოფლიდან 5 დაქორწინებული იყო იმპერატორზე, აქედან გამომდინარე მათ ჰქონდათ იმპერატრიცის ტიტული, 28 დაქორწინებული იყო მეფეზე და ჰქონდა დედოფლის ტუტული, ხოლო 3 თავად იყო პორტუგალიის მონარქი."},{"page_url":"https://en.wikipedia.org/wiki/Zygosaccharomyces_bailii","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Zygosaccharomyces_bailii_cells.jpg","page_title":"Zygosaccharomyces bailii","context_page_description":"Zygosaccharomyces bailii is a species in the genus Zygosaccharomyces. It was initially described as Saccharomyces bailii by Lindner in 1895, but in 1983 it was reclassified as Zygosaccharomyces bailii in the work by Barnett et al.\\nSpoilage resulting from growth of the yeast Zygosaccharomyces is widespread, which has caused significant economic losses to the food industry. Within this genus, Z. bailii is one of the most troublesome species due to its exceptional tolerance to various stressful conditions. A wide range of acidic and/or high-sugar products such as fruit concentrates, wine, soft drinks, syrups, ketchup, mayonnaise, pickles, salad dressing, etc., are normally considered to be shelf-stable, i.e. they readily inactivate a broad range of food-borne microorganisms. However, these products are still susceptible to spoilage by Z. bailii."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_succesvolste_medaillewinnaars_op_de_Olympische_Zomerspelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Michael_Phelps.jpg","page_title":"Lijst van succesvolste medaillewinnaars op de Olympische Zomerspelen","context_page_description":"Onderstaande tabellen geven de succesvolste medaillewinnaars op de Olympische Zomerspelen totaal, per sportdiscipline en de succesvolste Belg en Nederlander, vanaf de start in 1896 tot en met de laatste gehouden editie in 2016 weer."},{"page_url":"https://eo.wikipedia.org/wiki/Park_Kulturi_(metrostacio_en_Ni%C4%B5nij-Novgorodo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/NN_Metro_Park_Kultury_station_11-2018.jpg","page_title":"Park Kulturi (metrostacio en Niĵnij-Novgorodo)","context_page_description":"Park Kulturi estas fina stacio sur la Avtozavodskaja linio de la Metroo de Niĵnij-Novgorodo. Stacio situas post la stacio \\"Kirovskaja\\". \\"Kirovskaja\\" estis malfermita la 15-an de novembro 1989. Longo de la platformo estas 102 metroj."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C_%D0%92%D1%96%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC%D0%B0_%D0%95%D0%BA%D1%81%D0%BD%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Wilhelm_Exner_Medal.jpg","page_title":"Медаль Вільгельма Екснера","context_page_description":"Меда́ль Ві́льгельма Е́кснера — наукова нагорода Фонду Вільгельма Екснера, створеного Торгівельною асоціацією Австрії. Названа на честь Вільгельма Екснера. Вручається щорічно з 1921 року за наукові досягнення, які вплинули на економіку. Нагорода включає бронзову медаль діаметром 7,5 см і запрошення на аудієнцію з ланчем до президента Австрії. Серед нагороджених медаллю є 21 нобелівський лауреат."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A1liz_(recipiente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Communion_Cups_001.jpg","page_title":"Cáliz (recipiente)","context_page_description":"El cáliz o cálice es el vaso en el que el sacerdote católico consagra el vino en la eucaristía. Hay que notar que el cáliz en el cristianismo no es solo usado por la liturgia católica sino por otras iglesias cristianas y que deriva de la copa principal usada en el Pésaj ya que Jesucristo en la última cena que era en Pésaj o en vísperas del Pésaj usó tal importante elemento ritual para establecer la que luego en lenguas romances se denomina común unión o comunión a través del rito de la eucaristía."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_nh%E1%BA%A1c_c%E1%BB%A5_c%E1%BB%95_truy%E1%BB%81n_Trung_Qu%E1%BB%91c","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Dongxiaophoto.jpg","page_title":"Danh sách nhạc cụ cổ truyền Trung Quốc","context_page_description":"Những nhạc cụ cổ truyền Trung Quốc bao gồm rất nhiều loại nhạc khí khác nhau, từ nhạc cụ dây, hơi hay gõ. Chúng được chia làm tám loại nhạc cụ dựa trên chất liệu, tạo nên tám loại âm sắc cho dàn nhạc, được gọi là bát âm. tám loại này bao gồm: kim, thạch, thổ, ti, trúc, bào, cách, và mộc. Dù vậy, vẫn có những nhạc cụ khác không được xếp vào các loại trên."},{"page_url":"https://simple.wikipedia.org/wiki/London_station_group","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Waterloo_East_stn_entrance_Waterloo_concourse.JPG","page_title":"London station group","context_page_description":"The London station group is a group of 18 railway stations in central London. They are part of the National Rail network. Most are terminal stations, meaning that they are at the end of the railway line. The station group is shown on tickets as London Terminals."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Snooker-Begriffe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Chinese_Snooker.png","page_title":"Liste der Snooker-Begriffe","context_page_description":"In diesem Artikel gibt es eine umfassende Übersicht über die Begriffe und Regeln des Snookersports. Die Aussagen zu den Regeln folgen den offiziellen Regeln der World Professional Billiards and Snooker Association in der Fassung vom November 2019, in Bezug auf die verwendeten Bezeichnungen zum Teil auch den Regeln der nationalen Verbände von Deutschland, Österreich und der Schweiz für den deutschsprachigen Raum.\\nBegriffe mit eigenem Eintrag in dieser Liste, sind beim erstmaligen Vorkommen im Text anderer Kapitel kursiv geschrieben.\\nAuf der rechten Seite sind einige der bisher bedeutendsten Snookerspieler der Geschichte abgebildet."},{"page_url":"https://ro.wikipedia.org/wiki/Carlucet","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Carlucet_vue_village.jpg","page_title":"Carlucet","context_page_description":"Carlucet este o comună în departamentul Lot din sudul Franței. În 2009 avea o populație de 228 de locuitori."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%B6%99%E8%B3%A2%E6%A6%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/190324_%EC%A1%B0%ED%98%84%EC%98%81_%281%29.jpg","page_title":"趙賢榮","context_page_description":"赵贤荣，艺名贤荣，韩国女艺人，曾错译为赵玹容、赵贤英、赵玹英，作曲人身份的笔名为“Heidi”，为2009年11月由DSP Media花了4年的时间培养出来的女子组合Rainbow成员，队内担当为主唱，同时亦为子团Rainbow Pixie、Rainbow BLAXX成员。\\n2016年11月12日，随着Rainbow全体成员不再与DSP Media续约、团体活动正式结束，贤荣开始独立发展。"},{"page_url":"https://eo.wikipedia.org/wiki/Vilsheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Vilsheim_Ulrich-von-Pusch-Stra%C3%9Fe_3_-_Haus_2014.jpg","page_title":"Vilsheim","context_page_description":"Vilsheim estas komunumo en Germanio. Ĝi troviĝas en la distrikto Landshut kaj en la distriktaro Malsupra Bavario de la federacia lando Bavario. Fine de decembro 2017 la komunumo havis 2 583 loĝantojn."},{"page_url":"https://ru.wikipedia.org/wiki/The_Thing_You_Love_Most","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/RedDelicious.jpg","page_title":"The Thing You Love Most","context_page_description":"«То, что мы больше всего любим» — второй эпизод американского телевизионного сериала в жанре фэнтези «Однажды в сказке». Премьерный показ серии в США состоялся в восемь часов вечера 30 октября 2011 года на телеканале ABC. Режиссёром эпизода являлся Грег Биман, а сценарий к нему написали авторы идеи сериала Эдвард Китсис и Адам Хоровиц. Действие эпизода происходит в вымышленном городке Сторибрук, штат Мэн, и в сказочном мире. В Сторибруке Эмма Свон пытается покинуть город; события из прошлого в зачарованном лесу рассказывают о том, как королева Реджина использовала проклятие для того, чтобы отправить героев сказок в наш мир.\\nВо время премьерного показа «The Thing You Love Most» посмотрело 11,64 миллионов зрителей, что в итоге дало рейтинг в 3.9 бала/10% в группе людей в возрасте 18-49, и первое место в таймслоте телеканала ABC."},{"page_url":"https://de.wikipedia.org/wiki/San_Marco_(Rovereto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Altare_di_San_Vigilio%2C_patrono_di_Trento_-_Chiesa_di_San_Marco_-_Rovereto.jpg","page_title":"San Marco (Rovereto)","context_page_description":"San Marco ist die Erzpfarrkirche von Rovereto im Trentino. Die Mitte des 15. Jahrhunderts erbaute Kirche wurde mehrmals erweitert und umgestaltet. Geschmückt ist sie mit einer Reihe von Marmoraltären, die zu bedeutendsten Barockaltären im Trentino zählen. In San Marco hielt Wolfgang Amadeus Mozart 1769 auf der ersten Italienreise sein erstes Italienkonzert vor einem größeren Publikum ab."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%89%8E%E7%B6%AD%E5%A4%9A%E7%B6%AD%E9%BD%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Zavidovici_Municipality_Location.png","page_title":"扎維多維齊","context_page_description":"扎维多维齐是波斯尼亚和黑塞哥维纳的一座都市。在波黑的两个政治实体中，属波黑联邦。扎维多维齐位于三条河流的汇合处。扎维多维齐是一座年轻的都市。在19世纪末设市。这里的木材工业颇为发达。在奥匈帝国时期开始发展。市区的大多数人口是波斯尼亚人。全市人口中的97％是波斯尼亚人。城市附近多是山区。奥斯曼也统治过这里。在波黑战争中，城市受到很大的影响。1991年人口普查，扎维多维齐有人口12,947人。扎维多维齐首次被提及是在1565年。"},{"page_url":"https://ceb.wikipedia.org/wiki/Lespedeza_juncea","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Lespedeza_juncea_var._serpens_haimedohagi02.JPG","page_title":"Lespedeza juncea","context_page_description":"Espesye sa sitaw nga una nga gihulagway ni Carl von Linné d.y., ug nga gihatagan sa eksakto nga ngalan ni Christiaan Hendrik Persoon ang Lespedeza juncea. Ang Lespedeza juncea sakop sa kahenera nga Lespedeza sa kabanay nga Fabaceae."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_ch%C3%A2teaux_du_North_Ayrshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Portencross_Castle%2C_Ayrshire%2C_1900.jpg","page_title":"Liste des châteaux du North Ayrshire","context_page_description":"Cette liste recense les principaux châteaux du council area du North Ayrshire en Écosse."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%BE%D0%B2%D1%8B%D1%87%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/House_of_Culture_in_Solovychi_01.jpg","page_title":"Саловычы","context_page_description":"Саловычы — вёска ў Турыйскім раёне Валынскай вобласці Украіны."},{"page_url":"https://en.wikipedia.org/wiki/Abdulkareem_Baba_Aminu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Abdulkareem_Baba_Aminu_2.JPG","page_title":"Abdulkareem Baba Aminu","context_page_description":"Abdulkareem Baba Aminu is a Nigerian journalist, cartoonist, comicbook artist and retailer, painter, writer, poet and culture critic.\\nBaba Aminu is a commentator on culture. He was one of four judges for KORA Music Awards."},{"page_url":"https://en.wikipedia.org/wiki/Fredrikinkatu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Fredrikinkatu_Helsinki-2.jpg","page_title":"Fredrikinkatu","context_page_description":"Fredrikinkatu is a street in Helsinki, Finland that starts from Viiskulma in the district of Punavuori and continues north by the western side of Kamppi Center until it reaches Lutherinkatu and the Temppeliaukio Church in Etu-Töölö.\\nFredrikinkatu is mostly a northbound one-way street. Helsinki tram lines 1 and 3 run on Fredrikinkatu in both directions between Viiskulma and Bulevardi. There's a disused section of tram track between Urho Kekkosen katu and Arkadiankatu."},{"page_url":"https://war.wikipedia.org/wiki/Phyllodesmium_magnum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Phyllodesmium_magnum.jpg","page_title":"Phyllodesmium magnum","context_page_description":"Phyllodesmium magnum in uska species han Gastropoda nga ginhulagway ni William B. Rudman hadton 1991. An Phyllodesmium magnum in nahilalakip ha genus nga Phyllodesmium, ngan familia nga Facelinidae. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/U.S._Navy_and_U.S._Marine_Corps_aircraft_tail_codes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/EA-3B_VQ-1_in_flight_near_NAF_Atsugi.jpeg","page_title":"U.S. Navy and U.S. Marine Corps aircraft tail codes","context_page_description":"Tail codes on the U.S. Navy aircraft are the markings that help to identify the aircraft's unit and/or base assignment. These codes comprise one or two letters or digits painted on both sides of the vertical stabilizer, on the top right and on the bottom left wings near the tip. Although located both on the vertical stabilizer and the wings from their inception in July 1945, these identification markings are commonly referred as tail codes. It is important to note that tail codes are meant to identify units and assignments, not individual aircraft. For all aircraft of the U.S. Navy and U.S. Marine Corps unique identification is provided by bureau numbers."},{"page_url":"https://vi.wikipedia.org/wiki/Miqueliopuntia_miquelii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Opuntia7_filtered.jpg","page_title":"Miqueliopuntia miquelii","context_page_description":"Miqueliopuntia miquelii là một loài thực vật có hoa trong họ Cactaceae. Loài này được F. Ritter mô tả khoa học đầu tiên năm 1980."},{"page_url":"https://fr.wikipedia.org/wiki/Chlamydiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/ChlamydiaTrachomatisEinschlussk%C3%B6rperchen.jpg","page_title":"Chlamydiae","context_page_description":"Les chlamydiées sont un groupe de bactéries, qui sont toutes des parasites intracellulaires de cellules d'eucaryotes. Les espèces les plus connues infectent les mammifères et les oiseaux, mais certaines ont été retrouvées chez d'autres hôtes, comme des amibes. Au départ, on les considérait comme un seul genre, Chlamydia, mais à l'heure actuelle, différents genres ont été reconnus. Ils sont apparentés à certains autres groupes bactériens, en particulier les Thermomicrobia, mais ils constituent un phylum à part.\\nLe cycle des Chlamydiae implique deux formes distinctes. Une infection se produit par des corps élémentaires, qui sont inactifs d'un point de vue métabolique. Ceux-ci sont absorbés dans une vacuole de la cellule, où ils grandissent pour devenir des corps réticulés, plus grands, qui se reproduiront. Plus tard de nouveaux corps élémentaires seront produits et expulsés de la cellule.\\nLes Chlamydiae peuvent être aussi considérés comme un virus.\\nLes trois principales espèces de Chlamydiae infectant les humains sont :\\nChlamydia trachomatis, qui provoque le trachome et la chlamydiose, une maladie sexuellement transmissible ;"},{"page_url":"https://da.wikipedia.org/wiki/Alessandro_Allori","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Alessandro_Allori_-_Bianca_Capello_%28Dallas_Museum%29.jpg","page_title":"Alessandro Allori","context_page_description":"Allessandro Allori var en italiensk maler af den florentinske skole og far til Cristofano Allori.\\nAllori opdroges og uddannedes af Agnolo Bronzino, hvis kunst også fik kendelig indflydelse på ham således i fremstillingen af nøgne legemer. I Firenze kom han i medicæernes gunst, fik talrige bestillinger, malede fresker og alterbilleder til flere af byens kirker og udførte kartoner til det derværende tæppevæveri. Allori var en mester i den anatomiske tegning og har selv forfattet en maleranatomi. Af hans portrætter er især Bianca Capello’s bekendt."},{"page_url":"https://gl.wikipedia.org/wiki/Galer%C3%ADa_de_imaxes_de_Betanzos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Betanzos_Brab%C3%ADo_Igrexa_26.jpg","page_title":"Galería de imaxes de Betanzos","context_page_description":"Galería de imaxes do concello de Betanzos na provincia da Coruña."},{"page_url":"https://en.wikipedia.org/wiki/Louisiana_road_(Croatia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Milja_Nadvu%C4%8Dnik.jpg","page_title":"Louisiana road (Croatia)","context_page_description":"The Louisiana road is a roadway in Croatia, built between 1803 and 1812 by an association of noble families and designed by Josef Philipp Vukassovich. The road was finished by the French Empire. It is named after Napoleon's second wife Marie Louise.\\nIt linked Rijeka with Karlovac through Grobničko polje, Kamenjak, Gornje Jelenje, Lokve, Delnice, Skrad, Stubica, Severin na Kupi, and Netretić. The length of the Louisiana road was 18 Austrian miles. It was about 8 m wide. It was the shortest route between Rijeka and Karlovac, and was one of the most modern roads in the empire. With the building of the Lujzijana, the Karolina road became less important."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%A7%D8%AF%DB%8C%D8%B1%D8%A7_%DA%86%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Rio_Madeira_09072007.jpg","page_title":"مادیرا چایی","context_page_description":"مادیرا چایی بولووی اؤلکه‌سینده یئرلشن بیر چای. اۇزونلوغو۳۳۸۰ کیلومتر دیر. بۇ گۆن مادیرا چاییندان ثانییه‌ده ۳۱۲۰۰ متر مکعب سۇ آخیر. و آمازوننا تؤکولور."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_krasnoperekopski","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Karkinit_Bay.jpg","page_title":"Rejon krasnoperekopski","context_page_description":"Rejon krasnoperekopski – jednostka administracyjna wchodząca w skład Republiki Autonomicznej Krymu na Ukrainie.\\nRejon utworzony w 1936. Ma powierzchnię 1231 km² i liczy około 32 tysięcy mieszkańców. Siedzibą władz rejonu jest Krasnoperekopsk.\\nNa terenie rejonu znajdują się 1 miejska rada i 12 silskich rad, obejmujących w sumie 38 miejscowości."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D0%B4%D0%BE%D0%B2%D1%96_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Melagrane_%28Punica_granatum%29.jpg","page_title":"Плодові дерева","context_page_description":"Плодо́ві дере́ва або плодоно́сні дере́ва є представниками групи дикорослих та вирощувальних плодових та ягідних культур — рослин, з яких збирають багаті на цукор соковиті й тверді їстівні плоди. Плодові дерева є одними з найпопулярніших видів дерев на планеті, які дають плоди, фрукти й тому подібне, наприклад: зерняткові, до складу яких відносять яблуні й груші та кісточкові, до складу яких відносять персики, мигдаль, абрикоси, сливи й вишні."},{"page_url":"https://fy.wikipedia.org/wiki/Oud_Eik_en_Duinen","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Campbell%2C-JM4.jpg","page_title":"Oud Eik en Duinen","context_page_description":"Oud Eik en Duinen is in begraafplak in De Haach. It wurdt wol de Nederlânske Père-Lachaise neamd."},{"page_url":"https://en.wikipedia.org/wiki/Hand_pump","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/DrawingWater.jpg","page_title":"Hand pump","context_page_description":"Hand pumps are manually operated pumps; they use human power and mechanical advantage to move fluids or air from one place to another. They are widely used in every country in the world for a variety of industrial, marine, irrigation and leisure activities. There are many different types of hand pump available, mainly operating on a piston, diaphragm or rotary vane principle with a check valve on the entry and exit ports to the chamber operating in opposing directions. Most hand pumps are either piston pumps or plunger pumps, and are positive displacement.\\nHand pumps are commonly used in developing countries for both community supply and self-supply of water and can be installed on boreholes or hand-dug wells."},{"page_url":"https://de.wikipedia.org/wiki/T%C3%BCrkiye_Radyo_ve_Televizyon_Kurumu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/TRT_World_logosu.png","page_title":"Türkiye Radyo ve Televizyon Kurumu","context_page_description":"Türkiye Radyo ve Televizyon Kurumu ist die öffentlich-rechtliche Rundfunkgesellschaft der Türkei.\\nDie TRT wurde 1963 als öffentlich-rechtlicher Sender nach dem Vorbild der britischen BBC gegründet. Bis 1993 existierte offiziell ein Staatsmonopol auf die Ausstrahlung von Radio- und Fernsehprogrammen. 1968 wurde das erste Fernsehprogramm eingerichtet. Zurzeit konkurrieren 16 private landesweite Fernsehprogramme mit den Programmen der TRT, außerdem 15 regionale und über 200 lokale Fernsehsender."},{"page_url":"https://en.wikipedia.org/wiki/Married_couple_funerary_reliefs","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/BM_GR_1858%2C0819.2_-_01.JPG","page_title":"Married couple funerary reliefs","context_page_description":"Funerary reliefs of married couples were common in Roman funerary art. They are one of the most common funerary portraits found on surviving freedmen reliefs. By the fourth century, a portrait of a couple on a sarcophagus from the empire did not necessarily signify the burial of two spouses but instead demonstrated the importance of the material bond."},{"page_url":"https://de.wikipedia.org/wiki/Neuwerkkirche_Goslar","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Goslar_Neuwerkkirche_1.jpg","page_title":"Neuwerkkirche Goslar","context_page_description":"Die Neuwerkkirche ist eine ehemalige Klosterkirche aus dem 12. Jahrhundert in Goslar. Heute dient sie als evangelische Pfarrkirche. Der Bauzustand der Entstehungszeit ist in allen Teilen erhalten. Sie bietet daher ein stilreines Beispiel der romanischen Bauweise."},{"page_url":"https://es.wikipedia.org/wiki/Antonio_Quaranta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Libreta_de_casamiento.jpg","page_title":"Antonio Quaranta","context_page_description":"Antonio Quaranta. Fue maestro fundador de la primera escuela de San José de Jáchal, San Juan, Argentina, escuela que actualmente lleva su nombre, y realizó el primer registro de las características del lugar, su población, industrias y clima."},{"page_url":"https://eu.wikipedia.org/wiki/Richmond_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/WIMap-doton-Richmond.png","page_title":"Richmond (Wisconsin)","context_page_description":"Richmond Ameriketako Estatu Batuetako inkorporatutako herri bat da. Walworth konderrian kokatuta dago, Wisconsin estatuan. 1.835 biztanle ditu, 36 kilometro koadroko azaleran banatuta."},{"page_url":"https://bs.wikipedia.org/wiki/Cvjetnice_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Cirsium_rivulare_-_flowers.jpg","page_title":"Cvjetnice Bosne i Hercegovine","context_page_description":"Ovaj spisak cvjetnica Bosne i Hercegovine, skupa sa unesenim vrstama i bosanskohercegovačkim endemima, nepotpuni je pregled angiospermnih biljnih vrsta koje se navode u raspoloživoj literaturi na bosanskom hrvatskom, srpskom i srpskohrvatskom jeziku. Nisu uključene kulturne i povremeno unošene.\\nNapomena\\nZbog višekratnih promjena u biološkoj klasifikaciji i/ili taksonomskih rangova i naziva obuhvaćenih taksona, neki od njih se u priloženom spisku pojavljuju i po dva puta. To se posebno odnosi na one nazive binomne nomenklature koji su i danas u širokoj upotrebi.\\nNajčešće je promijenjeno ime roda i porodice, a ponekad i pripadajućih vrsta."},{"page_url":"https://en.wikipedia.org/wiki/Monument_to_Balzac","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/2018_Balzac_%281898%29_1.jpg","page_title":"Monument to Balzac","context_page_description":"Monument to Balzac is a sculpture by Auguste Rodin in memory of the French novelist Honoré de Balzac. According to Rodin, the sculpture aims to portray the writer's persona rather than a physical likeness. The work was commissioned in 1891 by the Société des Gens de Lettres, a full-size plaster model was displayed in 1898 at a Salon in Champ de Mars. After coming under criticism the model was rejected by the société and Rodin moved it to his home in Meudon. On July 2, 1939 the model was cast in bronze for the first time and placed on the Boulevard du Montparnasse at the intersection with Boulevard Raspail."},{"page_url":"https://fr.wikipedia.org/wiki/Nabil_Rajab","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Visit_to_Freedom_House_with_Abdulhadi_alkhawaja.jpg","page_title":"Nabil Rajab","context_page_description":"Nabil Ahmed Abdulrasul Rajab, né le 1ᵉʳ janvier 1954, est un militant des droits de l'homme et un opposant politique bahreïnien. Il est le président du Centre bahreïnien des Droits de l'homme, organisation non gouvernementale sans but lucratif œuvrant à promouvoir les droits de l'homme à Bahreïn. Il est également membre du Comité consultatif de la division Proche-Orient de l'organisation Human Rights Watch, secrétaire général délégué à la Fédération internationale des ligues des droits de l'homme, ancien président de CARAM Asie et président du Centre des Droits de l'homme du Golfe.\\nNabil commença à militer pour les droits de l'homme à l'occasion du soulèvement survenu à Bahreïn dans la décennie 1990, et s'engagea ensuite dans des campagnes en faveur des travailleurs immigrés employés dans les États appartenant au Conseil de coopération du Golfe. Il devint par la suite l'un des principaux militants à mener campagne contre les violations des droits de l'homme à Bahreïn, notamment contre la torture et les décès lors de détentions."},{"page_url":"https://es.wikipedia.org/wiki/Neuflieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Neuflieux_%28Aisne%29_mairie.JPG","page_title":"Neuflieux","context_page_description":"Neuflieux es una población y comuna francesa, en la región de Picardía, departamento de Aisne, en el distrito de Laon y cantón de Chauny."},{"page_url":"https://nl.wikipedia.org/wiki/Prinsenhof_(Amsterdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Prinsenhof.jpg","page_title":"Prinsenhof (Amsterdam)","context_page_description":"Het Prinsenhof is een gebouw aan de Oudezijds Voorburgwal 195-199 in Amsterdam. Het gebouw heeft in de loop der tijd diverse functies gehad."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Ferial_de_Boadilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Estaci%C3%B3n_de_Ferial_de_Boadilla.JPG","page_title":"Estación de Ferial de Boadilla","context_page_description":"Ferial de Boadilla es una estación de la línea ML-3 del Metro Ligero Oeste situada junto a la carretera de Villaviciosa, junto al Zoco de Boadilla del Monte y próxima al recinto ferial de la localidad. Abrió al público el 27 de julio de 2007.​​\\nSu tarifa corresponde a la zona B2 según el Consorcio Regional de Transportes.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%BB%E3%83%B3%E3%82%BA_(%E3%82%B8%E3%83%A7%E3%83%BC%E3%82%B8%E3%82%A2%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Doublebarreledcannonathensgeorgia-I.jpg","page_title":"アセンズ (ジョージア州)","context_page_description":"アセンズは、アメリカ合衆国ジョージア州の北東部に位置する都市であり、クラーク郡とともに統合市郡を形成している。ジョージア大学がある大学町であり、この大学がアセンズの創設とその後の成長に深く関わってきた。1991年、前年の住民投票結果に従い、当初の市としての認可を棄てて、クラーク郡と共に統合市郡を形成した。現在は集合的にアセンズ＝クラーク郡と呼ばれる。2010年の国勢調査で、この統合市郡の人口は115,452人となっており、2000年の100,266人に比べて15％増加した。アセンズ＝クラーク郡としてジョージア州では5番目の都市であり、アセンズ＝クラーク郡都市圏の中心都市である。都市圏人口は2008年で189,264人である。"},{"page_url":"https://en.wikipedia.org/wiki/Bagualosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Bagualosaurus_agudoensis.png","page_title":"Bagualosaurus","context_page_description":"Bagualosaurus is a genus of sauropodomorph dinosaur from the Santa Maria Formation of Brazil, dating to around 230 million years ago in the Carnian of the Late Triassic. It includes one species, Bagualosaurus agudoensis."},{"page_url":"https://fr.wikipedia.org/wiki/Hydro%C3%A9lectricit%C3%A9_en_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Barrage_de_Cambeyrac.jpg","page_title":"Hydroélectricité en France","context_page_description":"Le secteur de l'hydroélectricité en France bénéficie d'un potentiel important grâce à la présence de massifs montagneux : Alpes, Pyrénées, Massif central. Ce potentiel est déjà exploité en très grande partie, mais il subsiste un potentiel non négligeable à exploiter en petite hydraulique.\\nLa production hydroélectrique en France représentait 11,2 % de la production électrique totale en 2019 contre 12,5 % en 2018, année beaucoup plus pluvieuse. Le taux de couverture de la consommation par la production hydraulique atteignait 13,7 % en France en 2017-18.\\nLa France était en 2019 le 3ᵉ pays européen pour sa production hydroélectrique avec 9,7 % de la production européenne, derrière la Norvège et la Suède ; au niveau mondial, elle figurait au 12ᵉ rang avec 1,5 % du total mondial. En termes de puissance installée, elle était fin 2019 au 2ᵉ rang européen avec 10,2 % du total européen, après la Norvège et au 10ᵉ rang mondial avec 2,0 % du total mondial."},{"page_url":"https://sv.wikipedia.org/wiki/Klostret_Pomposa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Pomposa_z01.jpg","page_title":"Klostret Pomposa","context_page_description":"Klostret Pomposa är ett benediktinerkloster i den italienska kommunen Codigoro nära Ferrara. Det var ett av de mest berömda i Norditalien och känt för de karolingska manuskript som bevarats i det innehållsrika biblioteket, ett av de rikaste av karolingska arkiv, och för de romanska byggnaderna."},{"page_url":"https://id.wikipedia.org/wiki/Bandar_Udara_Internasional_Cam_Ranh","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Cam_ranh.jpg","page_title":"Bandar Udara Internasional Cam Ranh","context_page_description":"Bandara Udara Internasional Cam Ranh adalah bandar udara internasional di Nha Trang, Cam Ranh, provinsi Khanh Hoa, Vietnam dengan kode IATA CXR dan kode ICAO VVCR."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%90%D1%84%D0%BE%D0%BD%D1%81%D0%BE_%D0%B4%D0%B5_%D0%90%D0%BB%D0%B1%D1%83%D0%BA%D0%B5%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Coining_of_money_for_D%27Albuquerque_at_Goa%2C_1510.jpg","page_title":"Афонсо де Албукерк","context_page_description":"Афонсо де Албукерке, војвода на Гоа бил португалски генерал, голем освојувач, државник и градежник на империјата.\\nАфонсо ја унапреди трократната грандиозна шема на Португалија за борба против исламот, ширење на христијанството и обезбедување трговија со зачини со воспоставување на португалска азиска империја. Меѓу неговите достигнувања, Афонсо успеа да ја освои Гоа и беше првиот Европеец на ренесансата што го напаѓаше Персискиот Залив и го водеше првото патување со европска флота во Црвеното Море. Неговите воени и административни дела генерално се сметаат за највитажни за градење и обезбедување на португалското царство на Ориент, Блискиот Исток и зачинските патеки на источна Океанија.\\nАфонсо генерално се смета за воен гениј, и „веројатно најголем поморски командант на ерата“ со оглед на неговата успешна стратегија - тој се обидел да ги затвори сите поморски премини на Индискиот Океан кон Атлантикот, Црвеното Море, итн. Персискиот Залив и Пацификот, преобразувајќи го во португалски марија клаузул, воспоставен над опозицијата на Отоманското Царство и нејзините муслимански и хиндуисти сојузници."},{"page_url":"https://fr.wikipedia.org/wiki/Hayato_Okamoto","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Oudenaarde_-_Ronde_van_Vlaanderen_Beloften%2C_9_april_2016_%28B049%29.JPG","page_title":"Hayato Okamoto","context_page_description":"Hayato Okamoto, né le 1ᵉʳ juin 1995, est un coureur cycliste japonais, membre de l'équipe Aisan Racing."},{"page_url":"https://en.wikipedia.org/wiki/NYChrisG","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/NYChrisG_at_EVO_2012_%28cropped%29.jpg","page_title":"NYChrisG","context_page_description":"Christopher \\"NYChrisG\\" Gonzalez is an American competitive gamer, specializing in fighting games. He is considered one of the top Ultimate Marvel vs. Capcom 3 players. He is also the EVO 2016 champion for Ultimate Marvel vs. Capcom 3."},{"page_url":"https://en.wikipedia.org/wiki/2_Peter_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Papyrus_Bodmer_VIII.jpg","page_title":"2 Peter 2","context_page_description":"2 Peter 2 is the second chapter of the Second Epistle of Peter in the New Testament of the Christian Bible. The author identifies himself as \\"Simon Peter, a bondservant and apostle of Jesus Christ\\" and the epistle is traditionally attributed to Peter the Apostle, but there are charges that it is a work of Peter's followers between 60-90 CE."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%8B%89%E7%B1%B3%E7%BE%85%E4%BA%8C%E4%B8%96_(%E4%BA%9E%E6%8B%89%E5%B2%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Ramiro.gif","page_title":"拉米羅二世 (亞拉岡)","context_page_description":"拉米罗二世，又名拉米罗·桑切斯，称号为“修道士”，亚拉冈国王。拉米罗二世是桑乔一世与第二任妻子鲁西的费利西亚的幼子、佩德罗一世的异母弟、阿方索一世的同母弟。"},{"page_url":"https://de.wikipedia.org/wiki/Eidesvik_Offshore","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Viking_Avant.jpg","page_title":"Eidesvik Offshore","context_page_description":"Eidesvik Offshore ASA ist eine börsennotierte norwegische Spezialreederei."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AE%89%E5%9F%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Amperemeter_hg.jpg","page_title":"安培","context_page_description":"安培，簡稱安，是國際單位制中電流強度的單位，符號是A。同時它也是國際單位制中七個基本單位之一。安培是以法國數學家和物理學家安德烈-馬里·安培命名的，為了紀念他在古典電磁學方面的貢獻。\\n實際情況中，安培是對單位時間內通過導體橫截面的電荷量的度量。1秒內通過橫截面的電荷量為1庫侖時，電流強度為1安培。\\n比一安培小的電流可以用毫安、微安等單位表示。\\n1安= 1000毫安\\n1毫安= 1000微安"},{"page_url":"https://pt.wikipedia.org/wiki/Henrique_Courtenay,_1.%C2%BA_Marqu%C3%AAs_de_Exeter","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Henry_Courtenay_-_Order_of_the_Garter.jpg","page_title":"Henrique Courtenay, 1.º Marquês de Exeter","context_page_description":"Henrique Courtenay, 1.°Marquês de Exeter, 2.°Conde de Devon KG foi o primeiro Marquês de Exeter e Neto de Eduardo IV e sobrinho da Isabel de Iorque, era também primo de primeiro grau do rei Henrique VII, com quem possuía uma amizade próxima até ele romper com a Igreja Católica e declarar-se Chefe Supremo da Igreja da Inglaterra. Em 1538, foi preso na Torre de Londres com sua esposa, Gertrude Blount, e seu próprio filho, Eduardo, após conspirarem para deporem o monarca. Henrique foi executado, mas sua família só foi libertada quando Maria I — praticamente do Catolicismo — chegou ao trono e intercedeu por eles."},{"page_url":"https://fr.wikipedia.org/wiki/Beni_Yenni","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/WP_Jacques-Louis_Randon.jpg","page_title":"Beni Yenni","context_page_description":"Beni Yenni ou Aït Yenni ou parfois Ath Yenni, est une commune de la wilaya de Tizi Ouzou en Algérie. Elle est située à environ 35 km au sud-est de Tizi Ouzou, dans la région de Kabylie."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B8%D6%82%D5%A3%D5%BD%D5%A2%D5%B8%D6%82%D6%80%D5%A3%D5%AB_%D5%B0%D5%A1%D5%B7%D5%BF%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Druck_Augsburger_Reichsfrieden.jpg","page_title":"Աուգսբուրգի հաշտություն","context_page_description":"Աուգսբուրգի հաշտություն, կամ Աուգսբուգի համաձայնագիր, հաշտության համաձայնագիր, որն 1555-ի սեպտեմբերի 25-ին Աուգսբուրգ քաղաքում կնքվել է Սրբազան Հռոմեական կայսրության կայսր Կառլոս V-ի և Շմալկալդինյան դաշինքի զորքերի միջև։\\nԱյս համաձայնագրով պաշտոնապես ավարտվեց Սրբազան Հռոմեական կայսրությունում կրոնական երկու խոշոր ուժերի՝ լյութերականության և կաթոլիկության հակամարտությունը։ Համաձայնագրով հաստատվեցին կաթոլիկների և լյութերականների իրավունքները․ մասնավորապես, ցանկացած համայնքի ղեկավար ինքն էր որոշում այս երկու կրոններից որին հարեր, իսկ համայնքի ղեկավարին ենթակա գյուղացին կամ քաղաքացին պետք է դավաներ նույն կրոնն, ինչ համայնքի ղեկավարը, կամ գաղթեր այլ համայնք։"},{"page_url":"https://en.wikipedia.org/wiki/Lombards","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Wodan_Frea_Himmelsfenster_II_by_Emil_Doepler.jpg","page_title":"Lombards","context_page_description":"The Lombards or Langobards were a Germanic people who ruled most of the Italian Peninsula from 568 to 774.\\nThe medieval Lombard historian Paul the Deacon wrote in the History of the Lombards that the Lombards descended from a small tribe called the Winnili, who dwelt in southern Scandinavia before migrating to seek new lands. Roman-era authors however reported them in the 1st century AD, as one of the Suebian peoples, in what is now northern Germany, near the Elbe river. By the end of the 5th century, the Lombards had moved into the area roughly coinciding with modern Austria and Slovakia north of the Danube river, where they subdued the Heruls and later fought frequent wars with the Gepids. The Lombard king Audoin defeated the Gepid leader Thurisind in 551 or 552; his successor Alboin eventually destroyed the Gepids in 567.\\nFollowing this victory, Alboin decided to lead his people to Italy, which had become severely depopulated and devastated after the long Gothic War between the Byzantine Empire and the Ostrogothic Kingdom there."},{"page_url":"https://fr.wikipedia.org/wiki/Cimeti%C3%A8re_joyeux_de_S%C4%83p%C3%A2n%C8%9Ba","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Rumunia%2C_Sapanta%2C_Weso%C5%82y_Cmentarz_-Aw58-_28_IV_2012_r..jpg","page_title":"Cimetière joyeux de Săpânța","context_page_description":"Le Joyeux cimetière de Săpânța se situe dans le village de Săpânța, dans le Maramureș au nord de la Roumanie. Ce cimetière entoure l'église orthodoxe \\"Nașterea Maicii Domnului\\" du village et a la particularité d'avoir ses tombes ornées de stèles funéraires en bois peintes de couleurs vives, représentant une scène de la vie, une activité ou les causes du décès de la personne inhumée, accompagnés d'un poème, parfois nostalgique, souvent humoristique, dédié à la mémoire du mort."},{"page_url":"https://hu.wikipedia.org/wiki/Oregon_korm%C3%A1nyz%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/John_Whiteaker.jpg","page_title":"Oregon kormányzóinak listája","context_page_description":"Ez a lista az Amerikai Egyesült Államok Oregon államának kormányzóit sorolja föl. A 16. század során ez a föld őslakó amerikai csoportok; mint például a bannock, chasta, csinúk, kalapuya, klamath, molalla, nez perce, takelma és az umpqua törzsek otthona volt.\\n1778-ban James Cook átjáró után kutatva fedezte fel a partokat. 1805–1806-ban Meriwether Lewis és William Clark expedíció utazott keresztül és vizsgálta meg a területet Louisiana megvásárlása előtt. Kutatásaik során a Columbia torkolatához közel megépítették a Fort Clatsopot, téli szálláshelyüket. Az expedíción részt vett David Thompson, angol utazó, akinek 1811-ben megjelent publikációja szerint ez a vidék kimeríthetetlen prémvadász terület. Szintén abban az évben a New York-i John Jacob Astor a Columbia folyó torkolatánál megalapította a Fort Astoria települést, a Pacific Fur Company nyugati, kihelyezett prémvadász cégének telepét. Ez volt az első állandó fehér település Oregonban.\\nAz 1812-es brit–amerikai háború során a Pacific telepei brit ellenőrzés alá kerültek. Az 1820-as és 1830-as években a Hudson's Bay Company nyert ellenőrzés a terület felett. A társaság főhadiszállása Washington D.C.-ben volt."},{"page_url":"https://simple.wikipedia.org/wiki/Antoine_Duhamel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Antoine_Duhamel_at_the_Cin%C3%A9math%C3%A8que_fran%C3%A7aise.jpg","page_title":"Antoine Duhamel","context_page_description":"Antoine Duhamel was a French composer, orchestra conductor and music teacher.\\nDuhamel was born in Valmondois in the Val-d'Oise département of France. Duhamel was the son of French writer Georges Duhamel and actress Blanche Albane. He studied music at the Sorbonne.\\nHe wrote the score for his first movie in 1960. In 2002 he was awarded the Silver Bear at the Berlin Film Festival for his music for the Bertrand Tavernier directed movie, Laissez-passer.\\nAntoine Duhamel scored several of Jean-Luc Godard's movies, including Pierrot le Fou and Week End.\\nDuhamel died in Paris, France, aged, 89."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E5%9B%BD%E5%9B%BD%E5%AE%B6%E5%85%AC%E5%9B%AD%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/ParadiseValley.JPG","page_title":"美国国家公园列表","context_page_description":"美國共有62座國家公園保護區，由內政部下屬的國家公園管理局運作。國家公園需經國會立法建立。1872年，總統尤利西斯·辛普森·格蘭特簽署法案，設立第一個國家公園：黃石國家公園，之後又於1875年設立麥基諾國家公園，再於1890年設立岩溪公園、美洲杉國家公園和優勝美地國家公園。1916年，國會通過管理構成法建立國家公園管理局，「來保護自然風光、歷史遺蹟及其中的野生動植物，為人們提供休閒享受，同時保持它們不受損傷，留給子孫後代。」許多國家公園在國會立法設立前都經總統根據古蹟法劃為國家紀念區保護。7個國家公園配有國家保護區。雖然國家公園和國家保護區都是一起管理，但兩者分屬不同的單位，下方表格中的國家公園面積也不會包括保護區的面積。2019年設立的印第安納沙丘是美國最年輕的國家公園。\\n國家公園的入選標準包括自然風光、獨特的地質地貌、不同尋常的生態系統和人們在此娛樂休閒的可行性。與之相比，國家紀念區通常會根據歷史或考古學方面的意義來選擇景點。\\n全美有29個州、以及美屬薩摩亞和美屬維京群島擁有國家公園。這其中加利福尼亞州以9個居首，阿拉斯加州以8個緊隨其後，接下來分別是猶他州和科羅拉多州。阿拉斯加州的朗格－聖伊利亞斯國家公園占地面積超過3.2萬平方公里，大於美國面積最小的9個州，也是最大的國家公園，面積排第2至第4的國家公園同樣位於阿拉斯加州。密蘇里州的傑弗遜國家擴張紀念公園占地面積不足0.2平方公里，是最小的國家公園。所有國家公園的面積總和約有21萬平方公里，平均每個3620平方公里，不過中位數只有1280平方公里。根據2014年的統計數據，位於北卡羅萊納州和田納西州境內的大煙山國家公園是造訪人數最多的國家公園，這年有超過1000萬遊客到訪，其次是遊客人數超過470萬的亞利桑那州大峽谷國家公園。與之相比，位置偏遠的阿拉斯加州北極門國家公園同年僅接待遊客1.2萬人。截至2014年，美國已有14個國家公園入選世界遺產。\\n以下表格中列出美國現有的國家公園。對於已經取消的國家公園，或是屬於美國國家公園管理局管理的其他類型保護區不會列入下表。"},{"page_url":"https://sv.wikipedia.org/wiki/Hefei","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Location_of_Hefei_Prefecture_within_Anhui_%28China%29.png","page_title":"Hefei","context_page_description":"Hefei, tidigare romaniserat Hofei eller Luchow, är en stad på prefekturnivå och huvudstaden i provinsen Anhui i östra Kina. Det centrala storstadsområdet hade 3,3 miljoner invånare vid folkräkningen år 2010, på en yta av 655 kvadratkilometer."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Dettelbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Dettelbach%2C_Markt_5%2C_001.jpg","page_title":"Liste der Baudenkmäler in Dettelbach","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Stadt Dettelbach zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 214 Baudenkmäler."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%99%E0%B8%8A%E0%B8%B1%E0%B9%88%E0%B8%99%E0%B8%97%E0%B8%B5%E0%B8%A7%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Nationtv.png","page_title":"เนชั่นทีวี","context_page_description":"เนชั่นทีวี เป็นสถานีข่าว 24 ชั่วโมงแห่งแรกของประเทศไทย ออกอากาศตลอด 24 ชั่วโมง เริ่มส่งสัญญาณทางช่อง 8 ของสถานีโทรทัศน์เคเบิลยูบีซี เป็นครั้งแรก เมื่อวันที่ 1 มิถุนายน พ.ศ. 2543 และต่อมาย้ายการออกอากาศจากยูบีซี ช่อง 8 ไปยังสถานีวิทยุโทรทัศน์ไททีวี ช่อง 1 ผ่านระบบแอนะล็อก เอ็มเอ็มดีเอส เมื่อวันที่ 1 พฤษภาคม พ.ศ. 2546\\nปัจจุบันสามารถรับชม ผ่านโทรทัศน์ระบบดิจิทัลภาคพื้นดิน ช่อง 22 ที่เริ่มออกอากาศตั้งแต่ 1 เมษายน พ.ศ. 2557 เป็นต้นมา ทางดาวเทียมไทยคม 6 ช่อง 22 ทั้งระบบซี-แบนด์ และ เคยู-แบนด์, ทางโทรทัศน์เคเบิล ส่วนท้องถิ่นทั่วประเทศ"},{"page_url":"https://id.wikipedia.org/wiki/Rumpun_bahasa_Oto-Manguea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Otomanguean_Languages.png","page_title":"Rumpun bahasa Oto-Manguea","context_page_description":"Rumpun bahasa Oto-Manguea adalah rumpun bahasa besar yang terdiri dari berbagai bahasa yang dituturkan oleh penduduk asli Amerika. Semua bahasa di dalam rumpun bahasa ini kini dituturkan di Meksiko, tetapi cabang Manguea dalam rumpun bahasa ini pernah dituturkan hingga ke wilayah Nikaragua dan Kosta Rika.\\nKebanyakan penutur bahasa Oto-Manguea saat ini dapat ditemui di negara bagian Oaxaca. Di negara bagian tersebut terdapat dua cabang terbesar dari rumpun bahasa ini, yaitu bahasa-bahasa Zapotek dan Mixtek. Keduanya dituturkan oleh hampir 1,5 juta orang. Sementara itu, bahasa-bahasa Oto-Pamea dituturkan di Meksiko tengah, khususnya di negara bagian Meksiko, Hidalgo, dan Querétaro. Contohnya adalah bahasa Otomi dan bahasa Mazahua yang berkerabat dekat dengan bahasa Otomi; kedua bahasa tersebut dituturkan oleh lebih dari 500.000 orang. Beberapa bahasa Oto-Manguea sangat terancam punah; contohnya, bahasa Ixcatec memiliki jumlah penutur yang tidak melebihi 250 orang, dan kebanyakan sudah lansia. Bahasa Matlatzinca juga dirundung permasalahan yang sama.\\nRumpun bahasa Oto-Manguea merupakan rumpun bahasa paling beranekaragam dan paling tersebar secara geografis di Mesoamerika."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Stormclouds.jpg","page_title":"Погода","context_page_description":"Пого́да — совокупность значений метеорологических элементов и атмосферных явлений, наблюдаемых в определённый момент времени в той или иной точке пространства. Понятие «Погода» относится к текущему состоянию атмосферы, в противоположность понятию «Климат», которое относится к среднему состоянию атмосферы за длительный период времени. Если нет уточнений, то под термином «Погода» понимают погоду на Земле. Погодные явления протекают в тропосфере и в стратосфере — атмосферном слое, располагающемся на высоте примерно от 11 до 50 километров. Погоду можно описать давлением, температурой и влажностью воздуха, силой и направлением ветра, облачностью, атмосферными осадками, дальностью видимости, атмосферными явлениями и другими метеорологическими элементами.\\nПогода испытывает непрерывные изменения, которые могут быть очень ощутимы не только от одного дня к другому, но и на протяжении даже нескольких минут. Изменения погоды бывают периодические и непериодические. Периодические изменения — это те изменения, которые имеют периодический характер, потому что связаны с вращением Земли вокруг своей оси или вокруг Солнца."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D8%A7%D9%87%D9%85%D8%A7%D8%B3%DA%86%D8%A7%D8%B1%DA%A4%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Ahmasj%C3%A4rvi_Oulu_20130915_01.JPG","page_title":"بحيره اهماسچارڤى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاهماسچارڤى بحيره فى فينلاندا."},{"page_url":"https://en.wikipedia.org/wiki/CENTCOM_Materiel_Recovery_Element","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/18th_CSSB.png","page_title":"CENTCOM Materiel Recovery Element","context_page_description":"CENTCOM Materiel Recovery Element is a military organization tasked with conducting materiel reduction and engineer deconstruction operations in Afghanistan for the purpose of saving valuable military equipment and returning operating bases to local land owners, the Afghan Local Police, or the Afghan National Army."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%83%8F%E6%BA%AA%E6%B2%99%E9%9D%92%E5%B9%B4%E6%96%B0%E6%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/WKS_Youth_Village_Soccer_Patch_2016.jpg","page_title":"烏溪沙青年新村","context_page_description":"烏溪沙青年新村位於香港新界沙田區馬鞍山鞍駿街2號，由香港中華基督教青年會管轄，為全港宿營宿位最多及佔地面積最大的營地，面積11公頃，可容納1092名及600名營友入住，設備齊全。"},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Port_of_Southampton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Southhampton_spitfire_vs_Merc_by_kingofthefield.jpg","page_title":"History of the Port of Southampton","context_page_description":"The Port of Southampton is a major passenger and cargo port located in the central part of the south coast of England. It has been an important port since the Roman occupation of Britain nearly two thousand years ago, and has a multifaceted history. From the Middle Ages to the end of the 20th century, it was a centre for naval shipbuilding and a departure point for soldiers going to war. The port also played a role in the development of hovercraft, flying boat services, seaplanes and the Spitfire fighter plane. Before the advent of jet travel, Southampton was Britain's gateway to the world. The port also played a minor role in the history of Britain's canals."},{"page_url":"https://da.wikipedia.org/wiki/Andorra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Esgl%C3%A9sia_de_Sant_Crist%C3%B2fol_d%27Any%C3%B3s_-_1.jpg","page_title":"Andorra","context_page_description":"Andorra, officielt Fyrstendømmet Andorra, er et lille land, som ligger mellem Frankrig og Spanien i den østlige del af bjergkæden Pyrenæerne. Gennem århundreder har Andorra været et diarki med to samfyrster som statsoverhoveder: biskoppen af Urgell og Frankrigs statsoverhoved. Ordningen med to samfyrster blev traktatfæstet i 1278. Først i 1993 blev landet en suveræn stat efter at have indgået en aftale om dette med Frankrig og Spanien. Dermed blev Andorra et fuldgyldigt medlem af det internationale samfund og blev optaget som medlem i FN, Europarådet og en række andre internationale mellemstatslige organisationer.\\nAndorras politiske system har gennemgået en reformproces, hvor grundloven af 1993 har gjort landet til et parlamentarisk demokrati. Det tidligere fattige og isolerede land oplevede fra 1950'erne og fremefter en økonomisk opgangsperiode. Landet har gennemgået udviklingen til en moderne selvstændig stat, og har i denne proces oprettet nationale institutioner på mange felter indenfor samfunds- og kulturliv.\\nTurisme og handel, bankvirksomhed og ejendomsudvikling har været de vigtigste sektorer i økonomien."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D9%85_%D8%B1%D9%88%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Karim_Rouani.jpg","page_title":"كريم رواني","context_page_description":"كريم رواني ‏ لاعب كرة قدم فرنسي ذو أصول مغربية يلعب حاليا لصالح نادي الدرجة الممتازة أولمبيك أسفي المغربي منذ 2009 في مركز المهاجم.\\nلعب رواني في أندية بوردو ميرينياك أرلاك لانغون كاستيتس بيسكاروسي سبريمونت كومبلاين أولمبيك تشارلروا."},{"page_url":"https://fi.wikipedia.org/wiki/Robert_Rauschenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Rauschenberg3.JPG","page_title":"Robert Rauschenberg","context_page_description":"Robert Milton Ernest Rauschenberg oli yhdysvaltalainen kuvataiteilija.\\nRauschenberg syntyi Port Arthurissa, Teksasissa. Hän opiskeli Kansas City Art Institutessa ja Académie Julianissa Pariisissa ennen kuin pääsi Pohjois-Carolinan maineikkaaseen Black Mountain Collegeen vuonna 1948. Hänen uransa alku osui abstraktin ekspressionismin ja pop-taiteen siirtymävaiheille.\\nRauschenbergille myönnettiin vuonna 1964 Venetsian biennaalin pääpalkinto. Palkitsemiseen vaikutti taustalla hyvin voimakkaasti galleristi Leo Castelli. Hän jatkoi 2000-luvulle saakka työtään New Yorkissa ja studiollaan Floridan Captiva Islandilla. Hänelle myönnettiin National Medal of Arts vuonna 1993, ja hän oli Yhdysvaltain taiteiden ja kirjallisuuden akatemian jäsen vuodesta 1978.\\nRauschenberg palkittiin Grammy-palkinnolla Talking Headsin Speaking in Tongues -levyn kannesta. Hän oli kuollessaan 82-vuotias."},{"page_url":"https://en.wikipedia.org/wiki/Kirkbride,_Durisdeer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Kirkbride%2C_Enterkinfoot%2C_Nithsdale_-_Coshogle_Cottage_%26_S-E_view.jpg","page_title":"Kirkbride, Durisdeer","context_page_description":"Kirkbride, previously Kilbride was an ancient parish close to the village of Enterkinfoot, the lands of which lay on both sides of the River Nith in the old Strathnith area of Dumfries and Galloway, Scotland, about 5 miles south of Sanquhar and north of Closeburn. The parish was suppressed and divided between Durisdeer and Sanquhar parishes in 1732. The ruins of the kirk are a scheduled monument and the surrounding graveyard is a Category B listed building with the River Nith in the valley below. The Ha Cleuch Burn flows through the glen that lies to the east of the site with a lane reaching it that runs up from Enterkinfoot, ending at Coshogle Farm."},{"page_url":"https://en.wikipedia.org/wiki/East_Delta_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/East_Delta_University%2C_library.jpg","page_title":"East Delta University","context_page_description":"East Delta University is a private university in Chittagong, Bangladesh. It received the government's license in 2006 and started its academic operation in February 2008.\\nEast Delta University offers 6 undergraduate and 2 postgraduate programs. The University is approved by the Government of Bangladesh as well the Bangladesh University Grants Commission under the nation's private university rules. It is governed by the East Delta University Trust, a subsidiary of Chittagong Foundation, an independent and non-partisan social welfare organization."},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_from_Columbus,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Edwin_Jackson_on_June_23%2C_2012.jpg","page_title":"List of people from Columbus, Georgia","context_page_description":"The following list includes notable people who were born or have lived in Columbus, Georgia."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_de_Chrome_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Chrome_Island_Lightstation_5.JPG","page_title":"Phare de Chrome Island","context_page_description":"Le phare de Chrome Island est un phare situé sur un îlot au sud de l'île Denman sur la côte ouest de l'île de Vancouver, dans le District régional de Nanaimo, au Canada.\\nCe phare est géré par la Garde côtière canadienne."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B7%96%E5%B3%B6%E8%99%B9%E7%9F%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Kouseki.jpg","page_title":"巖島虹石","context_page_description":"巖島 虹石は日本画家。名は茂雄。明治2年1月26日、現在の山口県光市島田に生まれる。\\n父、巖島長平 母、マサの長男。\\n雅号を虹石、公貫、子敏、乾山、巖州、鶴羽山などがある。\\n幼少の頃から絵の才覚があり、神童と周囲に言われ育った。\\n熊野神社の社家で、お初穂包みに使った半紙反故がいつもあり、この紙は茂雄少年の望むままに与えられ画童はこれを使って、存分に絵を描いた。その素晴らしい出来栄えに、みな賞賛の言葉を惜しまなかったといわれている。\\n島田の新谷家には、虹石が11歳の時に描いた「達筆の書」と、「梅花挿瓶図」が所蔵されている。画像の「鯉」は10歳の頃の作品。\\n15歳で洋画を学び、20歳の時に難波覃庵に師事する。\\n難波覃庵は備中高松城守将清水宗治の末の老臣で南画の名手であった。\\n後に森寛斎に師事する。森寛斎が没するまでの7年間精進を続けた。\\n当時数少ない円山派の画技保持者として、虹石入門の翌々年である明治23年、帝室技芸員を拝命し幕末の動乱や維新の変革によって衰退していた日本画壇の復興の為に貢献したのである。\\nまた森寛斎が81歳で不帰の客となったとき、彼の画室に描きかけの「善悪図」が残されていたが、のちの虹石の加筆によって完成した。\\nこのことから深い師恩を感じた虹石は、毎月2日の師の命日には墓参を欠かすことはなかったといわれている。\\n同じ時期の寛斎の門には山元春挙や奥谷秋石などの優れた画人がいた。\\n明治33年、「西園雅集図」を発表する。この時32歳であった。\\nまた京都嵐山渡月橋の近く龍文寺の天井には龍を描いている。\\nほかに四国大展覧会においては、「松上鷹図」を出品し、金杯受賞作品となった。\\n明治35年、秋の美術展で高位に入賞し、京都丸山の平野屋にて祝賀会が開かれた。庭に出た人々は虹石を胴上げすることになり、胴上げした虹石の体を庭石の上に落としたのである。\\nこの時、山元春挙や亡き森寛斎の門下生がいたといわれている。\\nその後虹石の様態は思わしくなく、悪くなる一方で愛妻である、アイの心労による死で、益々悪化し、幼い娘の孝を残し死去。\\n虹石往年34歳であった。法名は大雄虹石居士。"},{"page_url":"https://en.wikipedia.org/wiki/Mareeba","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Moved_Termite_Mounts_Mareeba.JPG","page_title":"Mareeba","context_page_description":"Mareeba is a rural town and locality in the Shire of Mareeba in Far North Queensland, Australia. The town is 417 metres above sea level on the confluence of the Barron River, Granite Creek and Emerald Creek. Between 2008 and 2013, it was within the Tablelands Region. The town's name is derived from an Aboriginal word meaning meeting of the waters."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%AB%D5%B8%D6%80_%D4%B1%D5%B7%D6%84%D5%A5%D5%B6%D5%A1%D5%A6%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Lior_Ashkenazi%2C_taken_by_Niv_Calderon_%28cropped%29.jpg","page_title":"Լիոր Աշքենազի","context_page_description":"Լիոր Աշքենազի, թատրոնի և հեռուստատեսության իսրայելացի դերասան։"},{"page_url":"https://eu.wikipedia.org/wiki/Nan%C3%A7ois-sur-Ornain","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Vallee-ornain-depuis-vierge-noire.jpg","page_title":"Nançois-sur-Ornain","context_page_description":"Nançois-sur-Ornain Frantziako udalerria da, Meuse departamenduan dagoena, Ekialde Handia eskualdean. 2013an 377 biztanle zituen."},{"page_url":"https://nl.wikipedia.org/wiki/Speinshart","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Speinshart_World_Wars_Memorial.JPG","page_title":"Speinshart","context_page_description":"Speinshart is een plaats in de Duitse deelstaat Beieren, en maakt deel uit van het Landkreis Neustadt an der Waldnaab. Speinshart telt 1.132 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Ladakh","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Shepherd_in_Morey_Plains%2C_enroute_to_Leh%2C_in_Ladakh.jpg","page_title":"Ladakh","context_page_description":"Le Ladakh est une région et un territoire de l'Union indienne.\\nÉgalement appelé le Petit Tibet, Tibet indien ou Tibet occidental, le Ladakh a pour religions principales le bouddhisme tibétain pour 40 % de la population et l'islam pour 46 % de la population en 2009. Sa ville la plus importante est Leh."},{"page_url":"https://vi.wikipedia.org/wiki/Euphorbia_awashensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Euphorbia_awashensis2_ies.jpg","page_title":"Euphorbia awashensis","context_page_description":"Euphorbia awashensis là một loài thực vật có hoa trong họ Đại kích. Loài này được M.G.Gilbert mô tả khoa học đầu tiên năm 1992 publ. 1993."},{"page_url":"https://vi.wikipedia.org/wiki/Fin_de_si%C3%A8cle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Henri_de_Toulouse-Lautrec%2C_At_the_Moulin_Rouge.jpg","page_title":"Fin de siècle","context_page_description":"Fin de siècle trong Tiếng Pháp là cuối thế kỷ, một thuật ngữ mà có cả ý nghĩa tương tự trong tiếng Anh là chuyển giao thế kỷ. Thuật ngữ này thường được dùng để ám chỉ ''cuối thế kỷ 19''. Thời kỳ này được biết đến phổ biến là một giai đoạn trì trệ phát triển những năm 1873-1896, sau sự phát triển mau lẹ trong những năm đầu cuộc cách mạng công nghiệp lần thứ hai, nhưng đồng thời cũng là thời gian để hy vọng cho một sự khởi đầu mới. Tinh thần của thời Fin de siècle thường đề cập đến những dấu ấn văn hóa nổi bật trong những năm 1880 và năm 1890, trong đó có sự buồn bực, hoài nghi, bi quan, và ''... một niềm tin phổ biến rằng nền văn minh sẽ bị suy tàn.''.\\nThuật ngữ \\" fin de siècle\\" thường được áp dụng trong nghệ thuật, đặc biệt chỉ nghệ thuật của Pháp thời kì này, vì đặc điểm của văn hoá này lần đầu tiên xuất hiện ở đó, nhưng phong trào này đã ảnh hưởng đến nhiều nước châu Âu. Thuật ngữ này trở nên phù hợp với tình cảm và các đặc điểm liên quan đến văn hoá, trái với việc chỉ tập trung vào sự công nhận lúc đầu của phong trào ở Pháp."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B2%D9%85%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Hooker_Emerald_Brooch.jpg","page_title":"زمرد","context_page_description":"ایک سبز رنگ کا چمک دار اور شفاف پتھر جو نگینے کے علاوہ ادویات میں بھی استعمال ہوتا ہے۔ افغانستان، کشمیر، پاکستان، ہندوستان، کینیڈا، آسٹریلیا اور افریقا میں پایا جاتا ہے۔ دوا کے طور پر تقویتِ قلب و معدہ و دماغ کے لیے خاص طور پر مفید ہے۔ ماہرین اسے سلیکا کی بدلی ہوئی شکل بتاتے ہیں۔"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_couvre-chefs","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Odysseus_bjuder_cyklopen_vin%2C_Nordisk_familjebok.png","page_title":"Liste de couvre-chefs","context_page_description":"Cette page propose une liste de couvre-chefs par ordre alphabétique."},{"page_url":"https://pt.wikipedia.org/wiki/Laranja_sangu%C3%ADnea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Bloodorange1.jpg","page_title":"Laranja sanguínea","context_page_description":"A laranja sanguínea ou laranja-de-sangue é uma variedade da laranja com o carmesim, sangue cor de carne. O fruto é menor do que uma, a sua casca é geralmente vermelha. A carne escura, numa distintiva cor é devida à presença de antocianina, um pigmento comum em muitas flores e frutos, mas incomum em citrinos. Às vezes há coloração escura na parte externa da casca, também dependendo da variedade de laranja sanguínea. O grau de coloração depende da luz, temperatura e variedade.\\nA laranja sanguínea é frequentemente descrito como um híbrido entre a toranja e a tangerina, mas na verdade é apenas uma mutação de uma laranjeira. Há três tipos de laranja sanguínea no mundo: Moro, Tarocco e Sanguinello."},{"page_url":"https://mn.wikipedia.org/wiki/2012_%D0%BE%D0%BD%D1%8B_%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B0-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Sebastian_Vettel_2013_Catalonia_test_%2819-22_Feb%29_Day_2-2.jpg","page_title":"2012 оны Формула-1","context_page_description":"2012 оны Формула-1-дэлхийн аварга шалгаруулах тэмцээн нь Формула 1-ийн дэлхийн аваргын 63 дахь улиралын тэмцээн ба үүнд нийт 20 Гран При уралдааныг хамардаг. Энэ улиралын тэмцээн гуравдугаар сарын 18-аас арваннэгдүгээр сарын 25-ны хооронд явагдсан юм. Энэ дэлхийн аваргад Себастиан Феттель гурав дахь удаагаа амжилттайгаар дэлхийн аварга цолоо хамгаалсан бөгөөд хамгийн залуу гурван удаагийн дэлхийн аварга болсон юм. Мөн түүний баг Ред Булл-Рено хоёрдугаар нисгэгч Марк Вебберийн хамт хугацаанаас өмнө зохион бүтээгчийн дэлхийн аварга цолоо хамгаалжээ."},{"page_url":"https://de.wikipedia.org/wiki/Melodifestivalen_2013","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/L%C3%B6fbergsarenaNorr.JPG","page_title":"Melodifestivalen 2013","context_page_description":"Das Melodifestivalen 2013 war der schwedische Vorentscheid für den Eurovision Song Contest 2013 in Malmö. Es war die 53. Ausgabe des von der schwedischen Rundfunkanstalt SVT veranstalteten Wettbewerbs. Insgesamt dauerte der Wettbewerb vom 2. Februar 2013 bis zum 9. März 2013 an.\\nGewonnen wurde der Wettbewerb von Robin Stjernberg mit seinem Lied You, welches von Stjernberg selbst, Linnea Deb, Joy Deb und Joakim Harestad Haukaa geschrieben wurde. Ungewöhnlich war, dass Stjernberg den Wettbewerb gewinnen konnte, wobei er erst die zweite Runde Andra Chansen überstehen musste, bevor er das Finale erreichen konnte. Es war damit das erste Mal, dass ein Teilnehmer von Andra Chansen das Melodifestivalen gewinnen konnte."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%9B%89%E9%BA%97%E8%8B%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Hiu_Lai_Court_Fitness_Area.jpg","page_title":"曉麗苑","context_page_description":"晓丽苑是香港房屋委员会的居者有其屋的计划中的一个屋苑，于1997年建成，一共8座住宅大厦，全部都属和谐式居屋大厦，于居屋期数第16期乙、第17期甲及第17期乙推出。屋苑位于香港观塘区秀茂坪，新九龙内地段6205号，秀茂坪邨及基督教联合医院之间。原址为下秀茂坪徙置区，于1992年8月起拆卸，绝大多数原来的居民迁至天水围天耀邨，成为天水围新市镇的第一批居民。而晓丽苑由香港房屋署总建筑师设计。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BD%D1%81%D0%B5%D0%BD%D0%BD%D1%81_(%D0%86%D0%BD%D0%B4%D1%96%D0%B0%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Flag_of_Vincennes%2C_Indiana.png","page_title":"Вінсеннс (Індіана)","context_page_description":"Вінсеннс — місто в США, в окрузі Нокс штату Індіана. Населення — 18 423 особи."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Vorderwei%C3%9Fenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Vorderwei%C3%9Fenbach_Pfarrkirche_-_Innen_1_Altar.jpg","page_title":"Pfarrkirche Vorderweißenbach","context_page_description":"Die römisch-katholische Pfarrkirche Vorderweißenbach steht in der Gemeinde Vorderweißenbach im Bezirk Urfahr-Umgebung in Oberösterreich. Die den hll. Petrus und Paulus geweihte und dem Stift Wilhering inkorporierte Pfarrkirche gehört zum Dekanat St. Johann am Wimberg in der Diözese Linz. Die Kirche steht unter Denkmalschutz."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D0%B1%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D1%96%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/1750_Zaporozh.png","page_title":"Лубенський договір","context_page_description":"Лубенський договір — договір, підписаний улітку 1734 у полковому місті Лубни на Гетьманщині між Кошем Війська Запорозького Низового з одного боку та Московською державою з іншого, яка також діяла в інтересах Війська Запорозького Городового. Договір закріпляв перехід Війська Запорізького Низового під московський протекторат. З дати підписання договору почався останній період існування Запорізької Січі на корінних територіях, відомий як Нова Січ.\\nЗ часів руйнування Запорізької Січі 1709, яка уклала договір про протекторат із Шведським королівством, та підписання Прутського миру 1711, Запорізька Січ перебувала під протекторатом Османської імперії.\\nЗа умовами договору з Гетьманщиною та Московщиною, Запорізькій Державі поверталася всі відторгнуті території станом на 1709 рік — від витоків річки Самари до витоків Буга зі сходу на захід; від річки Тясмин та річки Оріль до володінь ногайців — з півночі на південь.\\nПідтверджувалося виняткове право користуватися промислами, рибальством на Дніпрі та право полювання у степу на вільних територіях.\\nТакож гарантувався самоврядний суверенітет Запоріжжя."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%AE%E9%9B%B7%E7%A9%86%E9%81%94%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Haven_van_Premuda.JPG","page_title":"普雷穆達島","context_page_description":"普雷穆达岛是克罗地亚的岛屿，位于亚得里亚海北部，由扎达尔县负责管辖，长10公里、宽1公里，面积9.2平方公里，最高点海拔高度58米，2001年人口58。"},{"page_url":"https://es.wikipedia.org/wiki/Pietro_Parolin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Secretary_Kerry_Meets_With_Vatican_Secretary_of_State_Parolin_%2811946205983%29.jpg","page_title":"Pietro Parolin","context_page_description":"Pietro Parolin es un prelado italiano de la Iglesia católica. Siendo arzobispo titular de Aquipendium, fue designado Secretario de Estado de la Santa Sede por el papa Francisco el 15 de octubre de 2013, en reemplazo de Tarcisio Bertone. El propio Francisco lo creó cardenal presbítero el 22 de febrero de 2014 y cardenal obispo el 28 de junio de 2018.​"},{"page_url":"https://id.wikipedia.org/wiki/Cheltenham","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Cheltenham.town.hall.arp.jpg","page_title":"Cheltenham","context_page_description":"Cheltenham merupakan nama kota di Inggris. Letaknya di bagian barat daya. Tepatnya di County Gloucestershire, Inggris. Pada tahun 2005, kota ini memiliki jumlah penduduk sebanyak 111.700 jiwa dan memiliki luas wilayah 46,61 km². Dengan kepadatan penduduk 2.396 jiwa/km²."},{"page_url":"https://de.wikipedia.org/wiki/Estland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sangaste_m%C3%B5isa_peahoone1.jpg","page_title":"Estland","context_page_description":"Estland ist ein Staat im Baltikum. Als nördlichster der drei baltischen Staaten grenzt es im Süden an Lettland, im Osten an Russland sowie im Norden und Westen an die Ostsee. Über den Finnischen Meerbusen hinweg bestehen enge Beziehungen zu Finnland, und historisch gibt es durch die Deutsch-Balten viele kulturelle Verbindungen nach Deutschland.\\nDer erstmals von 1918 bis 1940 und erneut seit 1991 unabhängige Staat ist Mitglied der Vereinten Nationen, seit 2004 der EU. Estland ist zudem Mitglied des Europarats, der NATO sowie der OSZE, seit 2010 der OWZE und seit 2011 der Eurozone.\\nEstland hat gut 1,3 Millionen Einwohner. Hauptstadt und größte Stadt Estlands ist Tallinn, die zweitgrößte Stadt ist Tartu."},{"page_url":"https://en.wikipedia.org/wiki/William_Rainey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Plutarch%27s_lives_for_boys_and_girls_-_being_selected_lives_freely_retold_%281900%29_%2814592616049%29.jpg","page_title":"William Rainey","context_page_description":"William Rainey RI RBA ROI was a British Artist and Illustrator. He was a prolific illustrator of both books and magazines and illustrated about 200 books during his career. He also kept painting and exhibited his work frequently. Rainey also wrote and illustrated six books himself, one was a colourful book for young children, the other five were juvenile fiction."},{"page_url":"https://simple.wikipedia.org/wiki/Deaths_in_July_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Adalet_Agaoglu_%28cropped%29.jpg","page_title":"Deaths in July 2020","context_page_description":"The following is a list of deaths that should be noted in July 2020. Individuals listed must have notability. Names under each date are noted in the order of the alphabet by last name or pseudonym. Deaths of non-humans are noted here also if it is worth noting.\\nEach listing of a death must have a source. If no reference is included, the death notice will be removed. The following are the requirements of adding a name to the list in its order: name, age, where they came from, what the person is known for, cause of death and a source."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E5%9C%8B%E8%BB%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/ROCN_cheng_kung_class_PFG2-1105_and_PFG2-1101_20050624.jpg","page_title":"中華民國國軍","context_page_description":"中华民国国军是中华民国的国家武装部队，由中华民国国防部管辖，是目前台澎金马地区主要防卫组织。背景为辛亥革命时期的革命军与北洋政府时期的北洋军，前身为孙中山与蒋中正等人于1924年6月16日所创立的“国民革命军”，史称黄埔建军。1946年制宪国民大会通过《中华民国宪法》，将国民革命军编入中华民国中央政府统领的“全国陆海空军”，开始实行军队国家化并改为现名。中华民国国军主要由陆军、海军、空军等三大军种所组成，战时可纳入海巡、警察等执法机关为辅助战力。近年实施精实案、精进案、精粹案，并大规模裁军，总兵力由60万人精简至21.5万人；将海军陆战队戍守之东沙岛、南沙太平岛交予海巡管理。虽然海洋委员会海巡署不是国军下辖单位，但少部分军人会被分发或借调到海巡服务。截至2018年，常备部队18万8千人，学生、入伍、受训、住院调疗及留职停薪1万9千人，以及文职、聘雇8千人，共21万5千人；列管后备军人238万人，辖区面积约71,880.06平方公里。\\n在此之前，中华民国是采用征兵制，服役役期两年。而军官采志愿制为主，仅招收少部分义务役男子，国家办有预官考试，招考大学、专科以上学历的役男，通过考试录取为预备军官者，在受训结束后，授予少尉军官阶级。士官国家办有预士考试，招考大学、专科以上学历的役男，通过考试录取为预备士官者，在受训结束后，授予下士士官阶级。随着时代演进，服役役期被缩短。直至2017年，志愿役与义务役并用制成为全体士官兵所依循的兵役制度，逐渐走向征兵与募兵双轨制。2018年1月1日起，开始实施募兵制，非志愿役而达到役龄的常备役男性则改服4个月军事训练役。"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B0%E0%A4%BE%E0%A4%B7%E0%A5%8D%E0%A4%9F%E0%A5%8D%E0%A4%B0%E0%A5%80%E0%A4%AF_%E0%A4%AE%E0%A4%B9%E0%A4%BE%E0%A4%AE%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%97_%E0%A5%AF%E0%A5%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/National_Highway_95_%28India%29.png","page_title":"राष्ट्रीय महामार्ग ९५","context_page_description":"राष्ट्रीय महामार्ग ९५ हा भारतातील एक प्रमुख राष्ट्रीय महामार्ग आहे."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BD%E6%80%9D%E8%8F%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Surrender_Singapore.jpg","page_title":"白思華","context_page_description":"白思華中將，CB，DSO*，OBE，MC，OStJ，DL，英國陸軍將領，1941年5月至1942年2月擔任馬來亞陸軍總司令，1942年2月15日因戰敗而率80,000大軍向日本投降，標誌著包括新加坡在內的整個馬來亞半島全境淪陷。\\n白思華於1914年第一次世界大戰爆發後參軍，於法國參戰，期間因軍功屢獲授勳。戰後，他先後於俄羅斯、愛爾蘭、奈及利亞和馬爾他等地服役，憑藉突出表現獲多番補送到軍事學院深造，並且屢獲擢升，1939年第二次世界大戰爆發後正式晉升為准將。1936年至1938年，白思華擔任馬來亞司令部參謀長，面對日本日漸增加的威脅，他任內展開技術評估，認為日軍最有機會從北面的泰國向南入侵馬來亞，指出有增兵布防的必要。不過，當他在1941年以中將身份重臨馬來亞出任陸軍總司令的時候，整個馬來亞無論兵力還是物資都相當不足，而且大部份的駐軍更是欠缺經驗和所需的訓練。\\n1941年12月8日，日軍隨著太平洋戰爭的爆發對馬來亞展開侵略，馬來亞戰役一觸即發。雖然白思華正確估算出日軍由泰國南下的登陸計劃，但卻因為指揮失誤而錯失及早攔截日軍的時機。相反，入侵馬來亞的日本陸軍第25軍裝備充足，而且訓練有素，並在山下奉文中將指揮下長驅直進，分散馬來亞各地的英軍只好邊戰邊退。1942年1月31日，馬來亞半島淪陷，只餘下新加坡仍然由英軍控制。2月8日，日軍進攻新加坡，並且成功登陸，拉開了新加坡戰役的戰幔。戰事持續約一周後，英軍處於劣勢，島上除了大約一半地方落入日軍手上以外，英軍還要面臨食水不足等困境。雖然白思華曾多番否決投降的建議，但最終在2月15日改變決定同意投降。白思華在淪陷後先後以戰俘身份被囚於新加坡、台灣和瀋陽，到1945年8月日本無條件投降後始獲釋放，並且於同年9月先後到日本和菲律賓出席兩地的日本投降儀式。\\n白思華投降一事遭評為「英國歷史上最嚴重的災難和最大規模的投降」，並大大削弱了英國戰後在馬來亞地區的管治威信。不少評論指責他連番戰略誤判，又欠缺個人魅力和領袖素質，需要為英軍戰敗負上責任。但也有評論指出白思華的其他同僚，以至是英國政府本身也要負上責任，對白思華在戰事中面對的處境和遭遇予以同情。1946年從軍中退休後，白思華在1948年發表《白思華報告書》，內容有指新加坡華人沒有團結抗日，在新加坡引起頗大非議；翌年，他又出版名為《馬來亞戰爭》的回憶錄，但無助於洗脫他在新加坡投降一事所留下的負面形象。白思華晚年曾任遠東戰俘協會終身主席，積極協助戰俘向日本索償，1966年於英國逝世。新加坡福康寧有小徑白思華路，以為紀念。"},{"page_url":"https://it.wikipedia.org/wiki/Canuto_il_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Knut_der_Gro%C3%9Fe_cropped.jpg","page_title":"Canuto il Grande","context_page_description":"Canuto II di Danimarca e I d'Inghilterra, noto anche come Canuto il Grande, in norreno Knútr inn ríki, è stato un sovrano norreno, re di Danimarca, d'Inghilterra e Norvegia, nonché governatore o signore feudale di Schleswig e Pomerania.Gli storici lo considerano il più importante sovrano dell'impero fattuale del Mare del Nord: questo titolo \\"imperiale\\" costituisce tuttavia una convenzione storiografica ed egli non portò mai un titolo imperiale."},{"page_url":"https://es.wikipedia.org/wiki/Beaubery","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Village_de_Beaubery.jpg","page_title":"Beaubery","context_page_description":"Beaubery es una población y comuna francesa, en la región de Borgoña, departamento de Saona y Loira, en el distrito de Charolles y cantón de Saint-Bonnet-de-Joux."},{"page_url":"https://sr.wikipedia.org/wiki/Meklaren_720S","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/McLaren_720S%2C_IAA_2017%2C_%281Y7A3406%29.jpg","page_title":"Meklaren 720S","context_page_description":"Meklaren 720S je sportski automobil koji je dizajnirao i proizveo britanski proizvođač automobila McLaren Automotive. To je drugi potpuno novi automobil iz serije Meklaren Super, koji je zamenio model 650S početkom maja 2017. godine. 720S predstavljen je na Sajmu automobila u Ženevi 7. marta 2017. i izgrađen je na modifikovanom karbon monokoku, koji je lakši i čvršći za razliku od modela 650S."},{"page_url":"https://en.wikipedia.org/wiki/Hancock_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/ISU_vs_Drake_at_Hancock_Stadium.jpg","page_title":"Hancock Stadium","context_page_description":"Hancock Stadium is a 13,391-seat multi-purpose stadium in Normal, Illinois. It opened in 1963. It is home to the Illinois State University Redbirds football team."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B4%D1%96%D0%BE%D0%BA%D0%B5%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B9_%D0%B2%D0%B5%D1%80%D1%82%D0%BE%D0%BB%D1%96%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/uk/3/32/Rcheli.jpg","page_title":"Радіокерований вертоліт","context_page_description":"Радіокеро́ваний вертолі́т — це літаюча модель вертольота, пілотована за допомогою системи дистанційного радіокеруванння. Як основне призначення, моделі вертольотів використовують аматори авіамоделізму як хобі та для спортивних змагань. Окрім цього подібні апарати мають ще прикладне значення, їх професійно використовують для проведення фотовідео зйомок з повітря, для агрохімічних робіт та у військовій справі."},{"page_url":"https://az.wikipedia.org/wiki/%C3%87oxn%C3%BCv%C9%99li_aromatik_birl%C9%99%C5%9Fm%C9%99l%C9%99r","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Biphenyl-3D-vdW.png","page_title":"Çoxnüvəli aromatik birləşmələr","context_page_description":"Çoxnüvəli aromatik birləşmələr-tərkibində iki və daha çox benzol nüvəsi olan aromatik birləşmələrə deyilir."},{"page_url":"https://es.wikipedia.org/wiki/Festival_Internacional_de_Cine_y_Arquitectura","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Peninsula_de_La_Magdalena.jpg","page_title":"Festival Internacional de Cine y Arquitectura","context_page_description":"El Festival Internacional de Cine y Arquitectura es un festival dedicado a explorar las interrelaciones entre el lenguaje arquitectónico y el lenguaje fílmico y, asimismo, ha focalizado su interés en la dirección artística, el diseño de producción y las nuevas tecnologías. Lleva celebrándose de forma anual desde 2013."},{"page_url":"https://it.wikipedia.org/wiki/Patriziato_(Norimberga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Rieter_Siebmacher205_-_N%C3%BCrnberg.jpg","page_title":"Patriziato (Norimberga)","context_page_description":"Il patriziato di Norimberga costituiva uno dei tre corpi sociali in cui era suddivisa la società della Città Imperiale di Norimberga, assieme ai cittadini ed agli straniera, e fu il vero ceto dominante della città sino all'occupazione napoleonica del 1806.\\nDal 1256 fino all'occupazione francese e alla successiva incorporazione da parte della Baviera il 15 settembre 1806, Norimberga era governata dal consiglio. Esso era suddiviso in \\"consiglio interno\\" e \\"Gran consiglio\\". Il Consiglio interno era composto da otto rappresentanti dell'artigianato cittadino, mentre i restati membri erano tutti membri del patriziato cittadino di Norimberga. La città imperiale di Norimberga, come altre città imperiali, si descriveva come una \\"repubblica\\". Oltre al riferimento al modello romano, il termine significa anche un'opposizione alle riforme monarchiche solitamente tipiche dei governi dell'epoca, ma quella di Norimberga non può essere paragonata ad una moderna democrazia, quanto piuttosto ad una oligarchia.\\nPatrizio era il titolo nobiliare spettante ai membri dell'aristocrazia al governo della città di Norimberga e della Libera Città Imperiale di Norimberga."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Downtown_and_Midtown_Detroit","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/MajesticTheaterDetroit.jpg","page_title":"National Register of Historic Places listings in Downtown and Midtown Detroit","context_page_description":"This is a list of the National Register of Historic Places listings in Downtown and Midtown Detroit, Michigan. It is intended to be a complete list of the properties and districts on the National Register of Historic Places in Downtown and Midtown neighborhoods in Detroit, Michigan, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in online maps.\\nThis National Park Service list is complete through NPS recent listings posted June 5, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Erin_Sanders","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Erin_Sanders_Profile_Photo_2016.jpg","page_title":"Erin Sanders","context_page_description":"Erin Sanders is an American actress. She is known for her roles as Quinn Pensky on Zoey 101, Camille Roberts on Big Time Rush, and for portraying Eden Baldwin on The Young and the Restless in 2008. She appeared as Chris on ABC Family's Melissa and Joey and starred in the film Guilty at 17, which premiered on Lifetime."},{"page_url":"https://eo.wikipedia.org/wiki/Karolo_Teodoro_(Palatinato_kaj_Bavario)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Berg-J%C3%BClich.PNG","page_title":"Karolo Teodoro (Palatinato kaj Bavario)","context_page_description":"Karolo Filipo Teodoro, el la vitelsbaĥa dinastio, estis ekde la 31-a de decembro 1742 kun la nomo \\"Karolo la 4-a\\" palatinata grafo kaj princo-elektisto de Elekto-Palatinato kaj duko de Jülich-Berg. Ekde la 30-a de decembro 1777 li estis kun la nomo \\"Karolo la 2-a\\" ankaŭ princo-elektisto de Bavario. Lia regado gravegis por la kultura, ekonomia kaj infrastruktura evoluo de suda Germanio en la dua duono de la 18-a jarcento."},{"page_url":"https://jv.wikipedia.org/wiki/J%C3%A9r%C3%A9my_Menez","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/J%C3%A9r%C3%A9my_M%C3%A9nez_%2811-03-2012%29.JPG","page_title":"Jérémy Menez","context_page_description":"Jérémy Ménez ya iku juru main bal-balan sing kewarganagaraané Perancis sing main kanggo klub Paris Saint-Germain, lan bisa main ing posisi glandhang."},{"page_url":"https://eu.wikipedia.org/wiki/Marano_di_Valpolicella","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Marano.jpg","page_title":"Marano di Valpolicella","context_page_description":"Marano di Valpolicella Italiako udalerri bat da. Veronako probintzian kokatuta dago, Veneto eskualdean. 3.145 biztanle ditu, 18,62 kilometro koadroko azaleran banatuta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D0%B9_%D0%9C%D0%B0%D1%82%D0%B2%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Flickr_-_Government_Press_Office_%28GPO%29_-_Afternoon_of_a_Faun.jpg","page_title":"Панов, Валерий Матвеевич","context_page_description":"Вале́рий Матве́евич Пано́в — артист балета, балетный педагог и балетмейстер, в 1974 году эмигрировавший из СССР в Израиль. Солист Михайловского и Мариинского театров, создатель и художественный руководитель театра «Театр-балет Панов Ашдод». Заслуженный артист РСФСР, лауреат Государственной премии РСФСР имени Глинки."},{"page_url":"https://sv.wikipedia.org/wiki/Huvudv%C3%A4gar_i_Finland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/KehaIII_vantaa1.jpg","page_title":"Huvudvägar i Finland","context_page_description":"Finlands huvudvägar utgörs av riksvägar, stamvägar, regionalvägar och förbindelsevägar. Majoriteten utgörs av längre trafiksträckningar. Innan dessa vägar började kallas riksvägar benämndes de i Finland som chaussér."},{"page_url":"https://ro.wikipedia.org/wiki/Jim_Parsons","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Jim_Parsons.png","page_title":"Jim Parsons","context_page_description":"James Joseph „Jim\\" Parsons este un actor american. Este cunoscut cel mai bine pentru rolul lui Sheldon Cooper din sitcomul Teoria Big Bang, performanța sa fiind considerată de mai mulți motivul succesului acestui show. Pe 16 iulie 2009 a fost nominalizat pentru un premiu Emmy la categoria „Cel mai bun actor dintr-o comedie” pentru rolul din Teoria Big Bang. În august 2009 el a câștigat premiul Television Critics Association pentru cele mai înalte realizări individuale în comedie."},{"page_url":"https://sv.wikipedia.org/wiki/Lasioglossum_altichum","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Lasioglossum_altichum_m.jpg","page_title":"Lasioglossum altichum","context_page_description":"Lasioglossum altichum är en biart som först beskrevs av Smith 1853. Lasioglossum altichum ingår i släktet smalbin, och familjen vägbin. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sv.wikipedia.org/wiki/Kanslihuset","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Kanslihusets_portal_2010.jpg","page_title":"Kanslihuset","context_page_description":"Kanslihuset, även kallat Ledamotshuset, är ett stort byggnadskomplex i kvarteret Mars och Vulcanus vid Mynttorget i Gamla Stan i Stockholm. Numera disponeras lokalerna av riksdagsförvaltningen."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%84%DB%8C%DA%A9%D8%B3_%D9%88%D8%A7%D9%84%D9%88%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Vallotton_Mon_portrait_1885.jpg","page_title":"فلیکس والوتون","context_page_description":"فلیکس والوتون نقاش سوئیسی ساکن فرانسه و از نبی‌ها بود. او در زمینه چاپ دستی و چوب‌تراشی نیز فعالیت می‌کرد."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Eisenstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Brunnendomplatzeisenstadt2.jpg","page_title":"Liste der denkmalgeschützten Objekte in Eisenstadt","context_page_description":"Die Liste der denkmalgeschützten Objekte in Eisenstadt enthält die 235 denkmalgeschützten, unbeweglichen Objekte der burgenländischen Landeshauptstadt Eisenstadt."},{"page_url":"https://pt.wikipedia.org/wiki/Daniel_Inouye","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Daniel_Inouye_Official_Photo_2009.jpg","page_title":"Daniel Inouye","context_page_description":"Daniel Ken \\"Dan\\" Inouye mais conhecido como Daniel Inouye 建: 井上 japonês, foi um político e advogado americano que foi senador dos Estados Unidos pelo estado do Havaí. Foi senador desde 1963 e era o membro mais antigo, falecendo 17 dias antes de completar 50 anos de serviço no Senado americano. Serviu como presidente pro tempore do Senado dos Estados Unidos. Tem representado continuamente o Havaí no Congresso desde a criação deste estado, em 1959. Foi o primeiro nipo-americano a servir na Câmara dos Representantes dos Estados Unidos e mais tarde o primeiro do Senado. Também é detentor da Medalha de Honra.\\nInouye é o segundo senador com mais tempo de permanência no senado, atrás de Robert Byrd, que serviu entre 1959 e 2010."},{"page_url":"https://ro.wikipedia.org/wiki/Thomas_Gravesen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/600px_Azzurro_con_Rombi_bianco_nero_e_bianco.png","page_title":"Thomas Gravesen","context_page_description":"Thomas Gravesen este un fost fotbalist internațional danez, care a activat ca mijlocaș.\\nGravesen a jucat la nivel profesionist în Danemarca, Germania, Anglia, Spania și Scoția, pentru Vejle Boldklub, Hamburger SV, Everton, Real Madrid și Celtic FC respectiv."},{"page_url":"https://fr.wikipedia.org/wiki/Gustave_Fouillaron","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Ch%C3%A2ssis_de_base_avec_courroie_longitudinale_av._1900.jpg","page_title":"Gustave Fouillaron","context_page_description":"Gustave Fouillaron, né le 9 août 1849 à La Caillère-Saint-Hilaire et mort le 24 novembre 1933 à Cholet, est un constructeur automobile français, inventeur du variateur de vitesse."},{"page_url":"https://en.wikipedia.org/wiki/Eremophila_exilifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Eremophila_exilifolia_%28habit%29_Dairy_Creek.jpg","page_title":"Eremophila exilifolia","context_page_description":"Eremophila exilifolia is a flowering plant in the figwort family, Scrophulariaceae and is endemic to Western Australia. It is a widely distributed shrub which is shaped like an inverted cone and has small, very sticky leaves and branches and lilac-coloured flowers."},{"page_url":"https://en.wikipedia.org/wiki/Yeravninsky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Coat_of_Arms_of_Eravninsky_rayon_%28Buryatia%29.png","page_title":"Yeravninsky District","context_page_description":"Yeravninsky District is an administrative and municipal district, one of the twenty-one in the Republic of Buryatia, Russia. It is located in the east of the republic. The area of the district is 25,600 square kilometers. Its administrative center is the rural locality of Sosnovo-Ozerskoye. As of the 2010 Census, the total population of the district was 18,705, with the population of Sosnovo-Ozerskoye accounting for 32.8% of that number."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%B8%D0%B1_(%D0%BF%D0%BB%D0%BE%D0%B4%D0%BE%D0%B2%D0%B5_%D1%82%D1%96%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Amanita_phalloides_1.JPG","page_title":"Гриб (плодове тіло)","context_page_description":"Гриб — розмовно-побутова назва плодових тіл грибів — макроміцетів. Згідно з сучасними науковими уявленнями, гриби виокремлюють у самостійне царство живої природи — лат. Fungi. Гриби, що утворюють великі плодові тіла належать до підцарств вищих грибів лат. Dikarya, у якому виділяють два типи — аскоміцети або сумчасті гриби, і базидіоміцети лат. Basidiomycota). З практичної точки зору розрізняють їстівні, неїстівні та отруйні гриби. «Грибом» називають також драглисту масу, що складається з різних мікроорганізмів, переважно дріжджових грибків і молочнокислих бактерій, які використовуються для отримання напоїв шляхом зброджування, наприклад, чайний гриб, кефірний гриб."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%81%BD%E4%BA%82%E6%95%B8%E4%BA%8C%E9%80%B2%E4%BD%8D%E6%95%B8%E5%88%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/PRBS_15_generator.png","page_title":"偽亂數二進位數列","context_page_description":"伪乱数二进制数列简称PRBS，是一种特别的二进制数列，若二进制数列的位元数为N，其中为1的数字有m'个，则其其自相关函数：\\n只有以下二个值：\\n其中\\n称为伪乱数二进制数列的占空比，类似连续时间信号的占空比。\\n伪乱数二进制数列称为伪乱数，虽然它是决定性的，不过其的数值和前后元素的数值无关，看似随机的，因此称为伪乱数。\\n伪乱数二进制数列可以延伸到无限长，方式是在个元素都出现过之后，再从再出现一次……，这点和真正的由放射性衰减或白噪声产生的数列不同，后者在本质上就是无限长的。伪乱数二进制数列比最大长度数列更普遍，后者是特别的N位元伪乱数二进制数列，是由线性移位暂存器所产生的。最大长度数列的占空比恒为50%，长度为k位元的暂存器，其数列长度为。伪乱数二进制数列可以用在电信、密码学及模拟等应用。"},{"page_url":"https://eu.wikipedia.org/wiki/Ruandako_Gerra_Zibila","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Rwandan_refugee_camp_in_east_Zaire.jpg","page_title":"Ruandako Gerra Zibila","context_page_description":"Ruandako Gerra Zibila Afrikako erdi-ekialdeko Ruandako Errepublikan gertatu zen gatazka izan zen. Bertan frantziarrek politikoki eta militarki sostengatutako Juvénal Habyarimanaren gobernuaren Ruandako Indar Armatuek eta Ruandako Fronte Patriotikoaren indar armatu Ruandako Armada patriotikoak elkarren aurka borrokatu zuten.\\nGatazka bi fasetan garatu zen Ruandan: Lehena 1990 eta 1993 artean izan zen 1990eko urriak 1ean hasi zen FPRak Ugandako ipar-ekialdea inbaditu zuenean. Lehen fasea 1993ko abuztuaren 4an amaitu zen Arushako Akordioa sinatu zenean, naiz eta gatazkak modu latentean jarraitu zuen. Bigarren fasea 1994ko apirilaren 6ko Juvénal Habyarimana Presidentearen hilketarekin eta Tutsien genozidioaren piztearekin hasi zen. Apirilaren 7an FPRak borrokari ekin zion berriro, eta gerra zibila azken hauen garaipenarekin eta herrialde osoaren kontrola hartzearekin amaitu zen 1994ko uztailaren 18an."},{"page_url":"https://da.wikipedia.org/wiki/Quickborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Ev.-Luth._Marienkirche_Quickborn_-_panoramio.jpg","page_title":"Quickborn","context_page_description":"Quickborn er en by i det nordlige Tyskland, beliggende i Pinneberg Amtkreds i delstaten Slesvig-Holsten. Byen har 20.188 indbyggere og ligger 17 km øst for Elmshorn og cirka 21 kilometer nordvest for Hamborgs centrum, på motorvej 7 mellem hansestaden og Neumünster."},{"page_url":"https://zh.wikipedia.org/wiki/2015%E5%B9%B4%E8%AF%97%E7%90%B3%E9%80%9A%E5%85%AC%E4%B8%BB60%E5%B2%81%E5%AF%BF%E8%BE%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/2016_Bangkok%2C_Dystrykt_Phra_Nakhon%2C_K%C5%82adka_dla_pieszych_na_skrzy%C5%BCowaniu_%28cropped%29.jpg","page_title":"2015年诗琳通公主60岁寿辰","context_page_description":"诗琳通公主殿下60岁寿辰庆典是2015年4月2日泰国王室成员诗琳通公主的60岁大寿。由于诗琳通公主出生于星期六，代表色是紫色；泰国人相信每一纪是一个轮回，而60岁为第5个里程碑，人们会在公主寿辰当天使用大量紫色表示对诗琳通公主的尊敬。"},{"page_url":"https://vi.wikipedia.org/wiki/H%E1%BB%99i_h%E1%BB%8Da_tri%E1%BB%81u_T%E1%BB%91ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Likan_Bamboo_and_Rocks.jpg","page_title":"Hội họa triều Tống","context_page_description":"Hội họa triều Tống hay Hội họa Lưỡng Tống kế thừa những tinh họa của hội họa triều Đường và Ngũ đại Thập quốc, nhưng hội họa Trung Hoa thời kỳ này đã có sự trưởng thành đáng kể."},{"page_url":"https://eo.wikipedia.org/wiki/Zell_ZH","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Gemeindehaus_zell_zh.jpg","page_title":"Zell ZH","context_page_description":"Zell ZH estas komunumo en la distrikto Vinterturo, Kantono Zuriko, Svislando. Ĝi havis 4938 loĝantojn je la 31-a de decembro 2007. La komunumo konsistas el la municipoj Zell, Rikon, Kollbrunn kaj Rämismühle, kaj la setlejoj Oberlangenhard, Unterlangenhard, Lettenberg, Schoren kaj Garten."},{"page_url":"https://en.wikipedia.org/wiki/Irene_Osgood","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Irene_Osgood.png","page_title":"Irene Osgood","context_page_description":"Irene Osgood was an American novelist, poet and dramatist. She was born near Richmond, Virginia, in 1875 and spent most of her life in England. She was a daughter of John De Belot. Among her novels were To a Nun Confessed, Servitude, Behind the Fan, The Garden of Spices, The House of Dolls, A Mother of Dreams, The Indelicate Duellist, An Idol's Passion, The Chant of A Lonely Heart, and other works, including many short stories.\\nOne of her latest works before she died was the drama Une Aventure de Capitane Lebrun, produced in 1913 at the Theatre Molière, Paris.\\nOsgood was twice married. Her first husband was Charles Piggot Harvey. Her second husband was Robert Sherard, an English author and great-grandson of the poet Wordsworth. She divorced him in 1915, the contest being a sensation at the time. In 1911 Sherard had brought a court case against his wife, claiming that he had written a number of the books published under her name. She died at Guilsborough Hall, her Northamptonshire residence."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8A%A0%E7%99%BE%E5%88%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Mohammed_receiving_revelation_from_the_angel_Gabriel.jpg","page_title":"加百列","context_page_description":"在不同的宗教中，加百列或称加百利、加俾额尔、伽弗里伊尔、吉卜利勒、吉布利尔、吉布列、加布里耶尔，拉丁语：Gabrielus，希腊语：Γαβριήλ，阿姆哈拉语：ገብርኤል，英语：Gabriel是一个传达天主讯息的炽天使，圣经中七美德的“节制”，对应七大罪的“暴食”苍蝇王，即炽天使别西卜。加百利第一次的出现是在希伯来圣经但以理书中，名字的意思是“天主的人”、“天神的英雄”、“上帝已经显示了他的神力”、或“将上帝之秘密启示的人”。他也被认为是上帝之手。\\n根据亚伯拉罕诸教，加百列是负责为神传讯息的天使长。有时候，他亦被视为死亡天使、火与雷的王子，不过最常见的还是作为其中一个主要为神传达讯息的使者。根据天主教宗教传统，他是天使长之一。加百列经常与米迦勒混为一谈，而两者皆为最高阶的炽天使，由于在圣经中记载多半向女性显现神迹，绘画作品中加百列被绘为女性形象，一般认为加百列是女性的保护者。而在伊斯兰教中，受真主之命向先知穆罕默德降示《古兰经》，但认知上与犹太教和基督教有所出入。在巴哈伊信仰的典籍中也有提及加伯利，最明显的例子就是巴哈欧拉的形上著作《七谷经》与《四谷经》。"},{"page_url":"https://en.wikipedia.org/wiki/Fitchburg_Cutoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Somerville_Junction_1907_postcard.jpg","page_title":"Fitchburg Cutoff","context_page_description":"The Fitchburg Cutoff was a rail line running 2.8 miles from Brighton Street in Belmont, Massachusetts to Somerville Junction in Somerville, Massachusetts. It was constructed in two segments in 1870 and 1881; passenger service lasted until 1927. Freight service ended in 1979–80 to allow construction of the Red Line Northwest Extension; the line was abandoned in three sections in 1979, 1983, and 2007.\\nAll of the right-of-way, except a short section near Alewife station, has been reused for three connecting rail trails: the Fitchburg Cutoff Path from Brighton Street to Alewife station, the Alewife Linear Park from Alewife to Massachusetts Avenue, and the Somerville Community Path east of Massachusetts Avenue. The paths are part of the Mass Central Rail Trail."},{"page_url":"https://pl.wikipedia.org/wiki/Caproni_Ca.101","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Caproni_Ca._101_bomb%C3%A1z%C3%B3_%28Olasz_fest%C3%A9ssel%29._Fortepan_17579.jpg","page_title":"Caproni Ca.101","context_page_description":"Caproni Ca.101 – włoski samolot bombowy i transportowy, powstały w drugiej połowie lat 20. XX wieku."},{"page_url":"https://en.wikipedia.org/wiki/Mohammad_Faghiri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Mohammad_Faghiri.jpg","page_title":"Mohammad Faghiri","context_page_description":"Mohammad Faghiri is an Iranian wrestler."},{"page_url":"https://de.wikipedia.org/wiki/Ein_Mann_wie_Sprengstoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Frank_Lloyd_Wright_portrait.jpg","page_title":"Ein Mann wie Sprengstoff","context_page_description":"Ein Mann wie Sprengstoff ist ein US-amerikanischer Spielfilm aus dem Jahre 1949. Der von King Vidor mit Gary Cooper in der Hauptrolle inszenierte Film nach dem Roman Der ewige Quell von Ayn Rand handelt von einem Architekten, dessen Visionen einer modernen Architektur bei seinen Zeitgenossen auf wenig Gegenliebe stoßen. Das Buch und der Film sind dabei eng an die Lebensgeschichte Frank Lloyd Wrights angelehnt."},{"page_url":"https://en.wikipedia.org/wiki/Sarah_Bird","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Sarah_Bird_2018.jpg","page_title":"Sarah Bird","context_page_description":"Sarah Bird is an American novelist, screenwriter, and journalist. She was born in 1949 in Ann Arbor, Michigan. Her father was an officer in the US Air Force, and her family, including her mother, Colista Bird, travelled with him around the US and the world during her childhood. Sarah's mother recognized signs of her daughter's creative storytelling talent as young as kindergarten.\\nShe attended the University of New Mexico, earning a BA there in 1973. Moving to the University of Texas at Austin, she went on to receive an MA in journalism there in 1976. She is married to George Jones, and has one son, Gabriel Bird-Jones, born in 1989. The family lives in Austin, Texas.\\nDuring the mid-eighties, Bird was a founding contributing-editor to Austin's Third Coast Magazine, for which she wrote numerous feature and humor articles.\\nBird's first published novel was Do Evil Cheerfully, a mystery.\\nIn 1986, her comic novel Alamo House was published based on her experience as a graduate student at the University of Texas.\\nShe published five contemporary romance novels with Silhouette under the pseudonym \\"Tory Cates\\"."},{"page_url":"https://sl.wikipedia.org/wiki/Na%C4%8Delo_povpre%C4%8Dnosti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/HubbleDeepField.800px.jpg","page_title":"Načelo povprečnosti","context_page_description":"Načêlo povpréčnosti je v filozofiji znanosti predstava o tem, da ljudje ali Zemlja v Vesolju niso nič posebnega. Je vrsta posplošitve Kopernikovega načela, ki se uporablja pri hevrističnem pogledu o legi Zemlje, ali kot filozofska izjava o mestu človeštva."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%B4me_de_Lodi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Duomo_di_Lodi_interno.jpg","page_title":"Dôme de Lodi","context_page_description":"Le Dôme de Lodi est la plus importante église de la ville de Lodi, en Lombardie."},{"page_url":"https://nl.wikipedia.org/wiki/Nouvelle_Vague_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/2007-02-25-Nouvelle-Vague-Oslo.jpg","page_title":"Nouvelle Vague (band)","context_page_description":"Nouvelle Vague is een Franse popgroep die newwaveklassiekers en bekende punknummers covert in een bossanova-jazzversie. Ze werd opgericht door Marc Collin en Olivier Libaux in 2003."},{"page_url":"https://fr.wikipedia.org/wiki/Grapsoidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Cardisoma_guanhumi.jpg","page_title":"Grapsoidea","context_page_description":"Les Grapsoidea sont une super-famille de crabes. Elle comprend près de 500 espèces actuelles dans sept familles. Une partie sont des crabes terrestres, même s'ils ont besoin de la proximité de l'eau de mer pour certains de leurs besoins physiologiques."},{"page_url":"https://en.wikipedia.org/wiki/Hermann_Blumenau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Hermann_Blumenau.jpg","page_title":"Hermann Blumenau","context_page_description":"Hermann Bruno Otto Blumenau was a German pharmacist who founded the city of Blumenau, situated in the Itajaí-Açu river valley in the state of Santa Catarina, Brazil."},{"page_url":"https://fr.wikipedia.org/wiki/Aquamanile","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Aquamanile.jpg","page_title":"Aquamanile","context_page_description":"Un aquamanile est un récipient destiné au lavage des mains, soit lors des actions liturgiques, soit dans la vie courante. Il peut être réalisé en céramique, en alliage cuivreux ou en métaux précieux. Seuls ceux en céramique ou en alliages cuivreux sont parvenus jusqu'à nous. On recense environ 380 aquamaniles médiévaux en alliage cuivreux. Il prend généralement des formes animales. Les aquamaniles sont apparus en Orient, puis ont été assimilés en Europe au début du Moyen Âge. Leur utilisation connaît un apogée dans le Moyen Âge tardif."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Ferdinand_Balthasar_Stieffell","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/%C3%96tigheim_St_Michael_Orgel.jpg","page_title":"Johann Ferdinand Balthasar Stieffell","context_page_description":"Johann Ferdinand Balthasar Stieffell war ein deutscher Orgelbauer."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D8%B2%D9%86%D8%AF_%D9%BE%D8%B3%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Chulalongkorn_%26_Sons.jpg","page_title":"فرزند پسر","context_page_description":"فرزند پسر زاده‌ای نر؛ پسری نسبت به والدینش است. نقطهٔ مقابل آن فرزند دختر است."},{"page_url":"https://da.wikipedia.org/wiki/K%C3%B8gevejens_Gasbeholder","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/K%C3%B8gevejens_Gasbeholder_after_demolition.jpg","page_title":"Køgevejens Gasbeholder","context_page_description":"Køgevejens Gasbeholder var en 108 meter høj lyseblå gasbeholder i Valby, der indtil sommeren 2007 deponerede 200.000 m³ bygas af typen spaltgas. Det er en såkaldt tørgasbeholder, dvs. der brugtes ikke vand til at holde gassen indespærret.\\nOpbevaring af gas til bygasnettet blev overflødiggjort, da Københavns Energi skiftede til en ny type bygas. Bygas2, som den kaldes, består af naturgas og luft. Da den nye gastype har lignende egenskaber kunne de fleste forbrugere fortsætte brugen af eksisterende gasinstallationer.\\nValby Gasværk og dets to gasbeholdere var eksploderet under en katastrofe i 1964 og havde skabt behov for nye forsyningsanlæg. Køgevejens Gasbeholder blev opført fra 1965 og taget i brug ved indvielsen den 21. december 1967.\\nGassen blev produceret på Sundby Gasværk og beholderen kunne opbevare gas nok til ca. to døgns forbrug af bygas i København og på Frederiksberg. I 2007 blev beholderen ligesom Sundby Gasværk taget ud af drift i forbindelse med Københavns Energis overgang fra den gamle type bygas til Bygas2, hvorefter den stod tom."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%A8%DB%8C_%D8%A6%DB%8E%D9%85_%D8%AF%DB%95%D8%A8%D9%84%DB%8C%D9%88%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/4_cilindros_y_museo_BMW%2C_M%C3%BAnich%2C_Alemania_2012-04-28%2C_DD_02.JPG","page_title":"بی ئێم دەبلیوو","context_page_description":"بی ئێم دەبلیوو یان بی ئێم ڤێ، کۆمپانیایەکی گەورەی ئەڵمانیە بۆ دروستکردنی ئۆتۆمبێل و مۆتۆرسایکل.\\nئەم کۆمپانیایە لە ساڵی ١٩١٦ لە شاری میونشن لە باڤاریا دامەزراوە. بی ئێم دەبلیو لە ئەڵمانیا، بەڕازیل، چین، ھیندستان، ئەفریقای باشوور وە ئەمریکا ئۆتۆمبێل بەرھەمدەھێنێت، لە ساڵی ٢٠١٥ بی ئێم دەبلیوو دوانزەھەمین کۆمپانیای بەرھەمھێنانی ئۆتۆمبێل بوو لە جیھاندا کە زیاتر لە ٢ میلیۆن ئۆتۆمبێلیان بەرھەمھێنا.\\nبەرھەمەکانیان لە ژێر ناوەی بی ئێم دەبلیوو، بی ئێم دەبلیوو ئێم، بی ئێم دەبلیوو ئای بەرھەمدەھێنن. ھەروەھا ھەریەک لە مینی و ڕۆڵز-ڕۆیس یش سەر بە کۆمپانیای بی ئێم دەبلیوون."},{"page_url":"https://en.wikipedia.org/wiki/Bibliography_of_Los_Angeles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Flag_of_Los_Angeles%2C_California.svg","page_title":"Bibliography of Los Angeles","context_page_description":"This is a bibliography of Los Angeles, California. It includes books specifically about the city and\\ncounty of Los Angeles and more generally the Greater Los Angeles Area. The list includes both non-fiction and notable works of fiction that significantly relate to the region. The list does not include annual travel books, recipe books, and currently does not contain works about sports in the region."},{"page_url":"https://ro.wikipedia.org/wiki/Augustin_Pyramus_de_Candolle","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Rue_de_Candolle.JPG","page_title":"Augustin Pyramus de Candolle","context_page_description":"Augustin Pyramus de Candolle numit și Augustin Pyrame de Candolle a fost un botanist și naturalist elvețian de proveniență franceză. Cu toate că accentul principal al savantului a fost botanica, de asemenea, el a contribuit la domenii asociate cum ar fi fitogeografia, agronomia, paleontologia, botanica medicală, și botanica economică. Abrevierea numelui său în cărți științifice este DC.."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%83%E3%82%AB%E3%83%A2%E3%83%AA%E3%83%BC%E3%83%81%E3%82%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Roccamorice-ViaDeHoratiis.JPG","page_title":"ロッカモリーチェ","context_page_description":"ロッカモリーチェは、イタリア共和国アブルッツォ州ペスカーラ県にある、人口約900人の基礎自治体。"},{"page_url":"https://fr.wikipedia.org/wiki/Ashfield_(Nouvelle-Galles_du_Sud)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/AshfieldNSWAmbleside.jpg","page_title":"Ashfield (Nouvelle-Galles du Sud)","context_page_description":"Ashfield est une ville-banlieue située dans la zone d'administration locale d'Inner West, dans l'agglomération de Sydney en Nouvelle-Galles du Sud. Elle comptait 23 841 habitants en 2016."},{"page_url":"https://sv.wikipedia.org/wiki/Gyldenstolpia_fronto","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Gyldenstolpia_fronto.jpg","page_title":"Gyldenstolpia fronto","context_page_description":"Gyldenstolpia fronto är en gnagare som först beskrevs av Herluf Winge 1887. Gyldenstolpia fronto ingår i släktet Gyldenstolpia och familjen hamsterartade gnagare. IUCN kategoriserar arten globalt som starkt hotad. Inga underarter finns listade i Catalogue of Life.\\nDenna gnagare är bara känd från tre fynd, en från norra Argentina och två från regionen kring staden Brasilia. De hittades alla i den låga vegetationen nära vattenansamlingar.\\nEtt exemplar hade en kroppslängd av 22,5 cm och en svanslängd av 11 cm. Bakfötterna var 4,3 cm långa och öronen var 2 cm stora. Viktuppgifter saknas. De lite styva håren som bildar ovansidans päls är gråa nära roten, ljusbruna i mitten och svarta vid spetsen vad som ger ett mörkbrunt utseende. Det finns en ganska tydlig gräns mot den ljusgråa till vita undersidan. Även undersidans hår är mörka nära roten, vad som ibland är synlig. Svansen är täckt av fjäll och vid varje fjäll finns tre bruna hår. Håren är nära bålen kortare än vid svansens spets.\\nInget är känt om levnadssättet."},{"page_url":"https://sk.wikipedia.org/wiki/%C4%8Cervenka_(okres_Olomouc)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%C4%8Cervenka_OL_flag.jpg","page_title":"Červenka (okres Olomouc)","context_page_description":"Červenka je obec v Česku v okrese Olomouc v Olomouckom kraji. 1. januára 2012 tu žilo 1 441 obyvateľov, z toho 700 mužov a 741 žien, pričom priemerný vek v obci bol 40,6 roka."},{"page_url":"https://la.wikipedia.org/wiki/Shawn_Johnson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Shawn_Johnson_competes_cropped.jpg","page_title":"Shawn Johnson","context_page_description":"Shawn Machel Johnson est gymnasta Americana, quattuor clipeis decorata in ludis Olympicis anni 2008, quorum clipeum argenteum pro re omnium et clipeum aureum pro re trabis aequilibrii abstulit. Pro re omnium victrix mundalis erat anno 2007 ac victrix Americana annis 2007 et 2008."},{"page_url":"https://nl.wikipedia.org/wiki/Friedrich-Werner_von_der_Schulenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Friedrich-Werner_Graf_von_der_Schulenburg_voor_het_volksgerichtshof_1944.jpg","page_title":"Friedrich-Werner von der Schulenburg","context_page_description":"Friedrich-Werner Erdmann Matthias Johann Bernhard Erich Graf von der Schulenburg, was een Duits diplomaat die betrokken was bij het complot van 20 juli 1944."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B1%CE%BD%CE%B1%CE%B8%CE%B7%CE%BD%CE%B1%CF%8A%CE%BA%CF%8C%CF%82_%CE%B1%CE%BC%CF%86%CE%BF%CF%81%CE%AD%CE%B1%CF%82_(%CE%9C%CE%B7%CF%84%CF%81%CE%BF%CF%80%CE%BF%CE%BB%CE%B9%CF%84%CE%B9%CE%BA%CF%8C_%CE%9C%CE%BF%CF%85%CF%83%CE%B5%CE%AF%CE%BF_%CE%A4%CE%AD%CF%87%CE%BD%CE%B7%CF%82_%CE%B1%CF%81._14.130.12)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Greek_Panathenaic_Prize_MET_N.14.130.12.jpg","page_title":"Παναθηναϊκός αμφορέας (Μητροπολιτικό Μουσείο Τέχνης αρ. 14.130.12)","context_page_description":"Ο Παναθηναϊκός αμφορέας του Κλεοφράδη που φιλοξενείται στη συλλογή του Μητροπολιτικού Μουσείου Τέχνης στην Νέα Υόρκη με αριθμό ευρετηρίου 14.130.12 είναι έπαθλο των αρχαίων Παναθηναίων."},{"page_url":"https://hu.wikipedia.org/wiki/Balassagyarmat_t%C3%B6megk%C3%B6zleked%C3%A9se","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ikarus_C56_%28HXT-661%29_N%C3%B3gr%C3%A1d_Vol%C3%A1n.jpg","page_title":"Balassagyarmat tömegközlekedése","context_page_description":"Balassagyarmat helyi közlekedését Balassagyarmat Város Önkormányzata megrendelésére a Volánbusz üzemelteti. A városból induló, várost érintő helyközi járatokat is a Volánbusz működteti az Innovációs és Technológiai Minisztérium megrendelésére."},{"page_url":"https://no.wikipedia.org/wiki/Miris_striatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/XN_Miris_striatus_02.jpg","page_title":"Miris striatus","context_page_description":"Miris striatus, er en tege tilhørende bladtegene. Den lever på varme solfylte blomsterenger.\\nMiris striatus finnes i det sørlige Norge, nord til Troms. Den er vanlig sørover i Europa."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%97%E9%9B%B7%E5%BE%B7%E9%87%8C%E5%85%8B%C2%B7%E5%A5%A5%E5%8F%A4%E6%96%AF%E7%89%B9%C2%B7%E5%B7%B4%E6%89%98%E5%B0%94%E8%BF%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Bartholdi_statue_liberte_terre_cuite.jpg","page_title":"弗雷德里克·奥古斯特·巴托尔迪","context_page_description":"弗雷德里克·奥古斯特·巴托尔迪，法国雕塑家，美国纽约著名的自由女神像的作者。"},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Weltmeisterschaften_1983/400_m_der_Frauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Bundesarchiv_Bild_183-1984-0603-019%2C_Dagmar_R%C3%BCbsam.jpg","page_title":"Leichtathletik-Weltmeisterschaften 1983/400 m der Frauen","context_page_description":"Der 400-Meter-Lauf der Frauen bei den Leichtathletik-Weltmeisterschaften 1983 fand am 7., 8., 9. und 10. August 1983 in Helsinki, Finnland, statt.\\n33 Athletinnen aus 25 Ländern nahmen an dem Wettbewerb teil. Die Läuferinnen aus der Tschechoslowakei errangen einen Doppelsieg. Die Goldmedaille gewann die Olympiazweite von 1980 und Vizeeuropameisterin von 1982 Jarmila Kratochvílová nach 47,99 s, womit sie einen neuen Weltrekord aufstellte. Am Tag zuvor war sie bereits Weltmeisterin über 800 Meter geworden. Silber ging mit 48,59 s an die EM-Dritte von 1982 Taťána Kocembová. Am Schlusstag sicherten sich die beiden siegreichen Tschechinnen zusammen mit der 4-mal-400-Meter-Staffel ihres Landes die Silbermedaille. Die sowjetische Athletin Marija Pinigina, frühere Marija Kultschunowa, kam mit 49,19 s auf den dritten Platz und errang mit der 4-mal-400-Meter-Staffel der UdSSR später eine zweite Bronzemedaille."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D1%83%D0%B4%D0%B0,_%D0%A4%D0%B0%D1%82%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/20150331_Mali_vs_Ghana_064_%28cropped%29.jpg","page_title":"Дауда, Фатау","context_page_description":"Абду́л Фата́ву Да́уда, более известный как Фата́у Да́уда — ганский футболист, вратарь и капитан клуба «Легон Ситис». Выступал в сборной Ганы."},{"page_url":"https://sk.wikipedia.org/wiki/Uheln%C3%A1_P%C5%99%C3%ADbram","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Uheln%C3%A1_P%C5%99%C3%ADbram_-_n%C3%A1m%C4%9Bst%C3%AD.jpg","page_title":"Uhelná Příbram","context_page_description":"Uhelná Příbram je mestečko ležiaca v okrese Havlíčkův Brod. Má 525 obyvateľov a jej katastrálne územie má rozlohu 21,81 km²."},{"page_url":"https://it.wikipedia.org/wiki/Parco_nazionale_Alejandro_de_Humboldt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Alejandro_de_Humboldt_National_Park.jpg","page_title":"Parco nazionale Alejandro de Humboldt","context_page_description":"Il parco naturale Alejandro de Humboldt è un'area naturale protetta che si trova nelle province di Holguín e Guantánamo, a Cuba.\\nIl suo nome è dovuto allo scienziato tedesco Alexander von Humboldt, che visitò l'isola nel 1800 e nel 1801."},{"page_url":"https://en.wikipedia.org/wiki/Nabataean_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Al_Khazneh_Petra_edit_2.jpg","page_title":"Nabataean architecture","context_page_description":"Nabatean architecture refers to the building traditions of the Nabateans in Jordan. It includes the temple and tombs of Petra in the sandstone cliffs of Jordan’s Negev desert. The style appears a mix of Mesopotamian and Hellenistic influences.\\nMuch of the surviving architecture was carved out of rock cliffs, hence the columns do not actually support anything. Ceramics and coins were also part of the culture. In addition to the most famous sites in Petra, there are also Nabatean complexes at Obodas and residential complexes at Mampsis and a religious site of et-Tannur."},{"page_url":"https://id.wikipedia.org/wiki/Krokot_mawar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%E6%9D%BE%E8%91%89%E7%89%A1%E4%B8%B9_20191005155847.jpg","page_title":"Krokot mawar","context_page_description":"Krokot mawar atau rose moss adalah tanaman hias yang tergolong familia Portulacaceae yang berasal dari Amerika Selatan."},{"page_url":"https://ro.wikipedia.org/wiki/S%C3%AEd%C3%AEnivka,_Brod%C3%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/%D0%A1%D0%B8%D0%B4%D0%B8%D0%BD%D1%96%D0%B2%D0%BA%D0%B0._%D0%97%D0%B0%D0%BA%D0%B8%D0%BD%D1%83%D1%82%D0%B8_%D0%BA%D0%BE%D1%81%D1%82%D0%B5%D0%BB_1930_%D1%80.jpg","page_title":"Sîdînivka, Brodî","context_page_description":"Sîdînivka este un sat în comuna Smilne din raionul Brodî, regiunea Liov, Ucraina."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%8F%D0%B4%D0%BE%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/B%C3%A4rtiger_Ritterling_Tricholoma_vaccinum.jpg","page_title":"Рядовка","context_page_description":"Рядовка, Рядківка — рід грибів порядку Агарикальні. Містить велику кількість видів, що ростуть по всьому світу зазвичай у лісах, оскільки утворюють симбіоз із деревами. Гриби рядківки досить часто ростуть рядками, що було взято за основу української назви грибів. Латинська назва Tricholoma походить від грецьких слів τριχος та λωμα, проте лише кілька видів мають волохату шапинку, що відповідає цій назві."},{"page_url":"https://nl.wikipedia.org/wiki/Catocala_johnsoniana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Catocala_johnsoniana.JPG","page_title":"Catocala johnsoniana","context_page_description":"Catocala johnsoniana is een vlinder uit de familie van de spinneruilen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1976 door Brower."},{"page_url":"https://ca.wikipedia.org/wiki/Campionat_del_M%C3%B3n_de_motocr%C3%B2s_1969","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Aberg.jpg","page_title":"Campionat del Món de motocròs 1969","context_page_description":"La temporada de 1969 del Campionat del Món de motocròs fou la 13a edició d'aquest campionat, organitzat per la FIM. El calendari oficial constava de 12 Grans Premis, celebrats entre el 20 d'abril i el 31 d'agost."},{"page_url":"https://es.wikipedia.org/wiki/Adrien_Bas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Adrien_Bas_-_Place_Gerson_%C3%A0_Saint-Paul%2C_pastel_sur_papier_gris_%281924%29.jpg","page_title":"Adrien Bas","context_page_description":"Adrien Bas fue un pintor francés. Reconocido especialmente por sus paisajes, también practicó otros géneros como retratos, bodegones o escenas interiores."},{"page_url":"https://gl.wikipedia.org/wiki/Galegofobia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/George_Steiner_2013_%28cropped%29.jpg","page_title":"Galegofobia","context_page_description":"A galegofobia fai referencia á aversión non xustificada cara a Galicia, cara á cultura e lingua galegas e cara ao individuo galego e a súa identidade. Malia que o termo non aparece recollido en ningún dicionario de corte académico, trátase da denominación xenérica e popular para se referir a este fenómeno tanto na prensa coma no eido social. Así, a primeira constancia que se ten do seu uso é nun artigo de prensa asinado por Villar Ponte e datado en 1916. As primeiras manifestacións de galegofobia correron a cargo de múltiples e sobranceiros literatos en lingua castelá, mais tamén é posible rastrexala na historiografía nacionalista española ou mesmo nos ámbitos político e televisivo contemporáneos.\\nSe ben é certo que os meirandes e máis numerosos exemplos de galegofobia proceden do ámbito hispánico, tamén existiu a nivel europeo e internacional.\\nNo prólogo de Cantares Gallegos, a escritora Rosalía de Castro puxo de relevo boa parte destas cuestións:"},{"page_url":"https://en.wikipedia.org/wiki/Mabalacat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Montessori_de_Xevera%2C_Xevera%2C_Mabalacat_City%2C_Pampanga%2C_Philippines.JPG","page_title":"Mabalacat","context_page_description":"Mabalacat, officially the City of Mabalacat, is a 3rd class component city in the province of Pampanga, Philippines. According to the 2015 census, it has a population of 250,799 people.\\nThe former municipality was officially upgraded to a city following a referendum on July 21, 2012 and became the third in Pampanga after Angeles and San Fernando.\\nThe city's name is derived from indigenous Negrito word mabalacat meaning \\"forest of balacats\\".\\nMabalacat has a land area of 83.18 square kilometres. Roughly majority of the Clark Freeport Zone is located in Mabalacat, the rest in nearby Angeles, where the main gate is located. The Clark International Airport, as well as the numerous hotels, casinos, golf courses, and resorts in Clark Freeport, are mostly situated in Mabalacat City.\\nThe soil is charcoal black and shiny, a sign of fertility, and is suitable for growing rice, sugarcane and other rootcrops."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%BE%D1%80%D0%B0%D1%85_%D1%83_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80%D1%83_(%D0%9B%D0%B5%D1%88%D1%98%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Zapis-0045-Lesje-Orah_20150221_1021.JPG","page_title":"Запис орах у манастиру (Лешје)","context_page_description":"Запис орах у манастиру (Лешје) се налази на парцели чији је власник ЈП \\"Србијашуме\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2007","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Dogs_Ukraine_2007_stamp.jpg","page_title":"Знаки поштової оплати України 2007","context_page_description":"Знаки поштової оплати України 2007 — перелік поштових марок, введених в обіг Укрпоштою у 2007 році.\\nЗ 12 січня по 22 грудня 2007 року була випущена 91 поштова марка, у тому числі 76 пам'ятних та 15 стандартних сьомого випуску. Номінал знаків поштової оплати, що було випущено в 2007 року від 0,01 до 3,35 гривні, та поштові марки з літерним індексом замість номіналу: «Ж», «Є», «N», «P» та «R». Тематика комеморативних марок охопила ювілеї визначних дат, подій, пам'яті видатних діячів культури та інши.\\nМарки було надруковано державним підприємством «Поліграфічний комбінат „Україна“».\\nВідсортовані за датою введення."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Clun","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/10_Buffalo_Lane%2C_Clun.jpg","page_title":"Listed buildings in Clun","context_page_description":"Clun is a civil parish in Shropshire, England. It contains 160 listed buildings that are recorded in the National Heritage List for England. Of these, one is listed at Grade I, the highest of the three grades, seven are at Grade II*, the middle grade, and the others are at Grade II, the lowest grade. The parish contains the small town of Clun, and smaller settlements, including Bicton, Chapel Lawn, New Invention and Whitcott Keysett, and is otherwise entirely rural.\\nThe town has an ancient history, and its oldest surviving listed buildings are the remains of Clun Castle, and the Norman west tower of St George's Church. A high proportion of the listed buildings are houses, cottages, farmhouses, and farm buildings, many of them timber framed, some with cruck construction, and dating from the 13th to the 18th century. In the churchyard of St George's Church are many listed memorials, consisting of chest tombs, pedestal tombs, and a headstone. The River Clun passes through the parish, and the bridge crossing it in the town, which dates back to the 14th or 15th century, is listed."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%98%9F%E5%B3%B6%E6%B2%99%E4%B9%9F%E5%8A%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/%EF%BC%92%EF%BC%90%EF%BC%91%EF%BC%98%E5%90%8D%E5%8F%A4%E5%B1%8B%E3%82%AA%E3%83%BC%E3%83%88%E3%83%88%E3%83%AC%E3%83%B3%E3%83%89_05.jpg","page_title":"星島沙也加","context_page_description":"星島 沙也加は、日本のタレント、モデル。\\n愛知県名古屋市出身。みらいくーる所属。2015年7月からG.P.Rとマネジメント業務提携を行っている。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%8C%D1%81%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Tunnel_Kalsoy%2C_Faroe_Islands.jpg","page_title":"Кальсой","context_page_description":"Кальсой — один із островів в північній частині Фарерського архіпелагу, розташований між островами Естурой та Куной."},{"page_url":"https://pt.wikipedia.org/wiki/%C3%89mile_Verhaeren","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Emile_Verhaeren%27s_signature.jpg","page_title":"Émile Verhaeren","context_page_description":"Emile Verhaeren foi um poeta belga de expressão francesa.\\nFoi autor de contos, peças de teatro e crítica literária, além de poesia, evoluiu do naturalismo para um misticismo que o levou a uma crise espiritual."},{"page_url":"https://en.wikipedia.org/wiki/Wakai_ki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Wakai_ki_poster.jpg","page_title":"Wakai ki","context_page_description":"Wakai ki is a 1956 Japanese film directed by Ishirō Honda. Wakai ki is abouta young girl who moves to Tokyo and endures the rivalries between other high school girls of varying cultural and economic backgrounds."},{"page_url":"https://ceb.wikipedia.org/wiki/Stigmatura_budytoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Stigmatura_budytoides_1847.jpg","page_title":"Stigmatura budytoides","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Orbigny ug Frédéric de Lafresnaye ni adtong 1837 ang Stigmatura budytoides. Ang Stigmatura budytoides sakop sa kahenera nga Stigmatura sa kabanay nga Tyrannidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9B%BD%E9%99%85%E6%9C%BA%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/KLIA_PTC%2BTower.jpg","page_title":"国际机场","context_page_description":"國際機場是指可接受來自其它國家的班機著陸和起飛的機場。這類機場通常較大，且通常有較長的跑道和設施以供常用於國際或洲際航行的大型飛機使用，並設有海關等邊境管制設施。除國際航班外，國際機場一般也接待國內航班，以方便旅客轉機。有些機場雖名稱不帶有「國際」字樣，但只要有相關設施，一樣可接受其他國家的飛機起降。\\n在某些情況下，旅行者和航空器可以在啟程地的國際機場完成目的地的海關及入境管理手續。例如，美國在某些外國機場設有海關和移民局辦公處，實施境外入境審查；這樣，從這些機場起飛的班機可以直接飛往美國境內未設有海關和移民局辦公設施的機場。"},{"page_url":"https://nl.wikipedia.org/wiki/R%C5%ABdnyy","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Coat_of_arms_of_Rudnyi.png","page_title":"Rūdnyy","context_page_description":"Rūdnyy is een - met district gelijkgestelde - stad aan de rivier de Tobol in de oblast Qostanay in Kazachstan.\\nBegin 2019 telde deze stad, samen met haar twee nederzettingen Gornyak en Qashar zo’n 130.000 inwoners, waarvan 58 % Russen, 21 % Kazachen en 10 % Oekraïners en voorts Kazachstanduitsers.\\nDe stad werd in 1955 gesticht, na de ontdekking van ijzerertsvoorraden in 1949. De plaatselijke economie wordt gedomineerd door de winning en verwerking van ijzererts. De dagbouwmijnen liggen aan de noord- en oostkant van de stad. De naam \\"Rudnyy\\" betekent erts.\\nIn de river Tobol bevindt zich het Qaratomar-stuwmeer, dat dient voor de watervoorziening.\\nDe autoweg A-22 verloopt door de stad."},{"page_url":"https://es.wikipedia.org/wiki/Parque_natural_de_El_Hondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Parque_Natural_del_Hondo_%28cropped%29.png","page_title":"Parque natural de El Hondo","context_page_description":"El parque natural de El Hondo se localiza entre los términos municipales de Crevillente y Elche, en la comarca del Bajo Vinalopó; y los municipios de Dolores y Catral, en la Vega Baja, al sur de la Comunidad Valenciana, España.\\nEl río Vinalopó desemboca en el azarbe de Cebadas, Sivaes o Niño, con quien se encuentra transversalmente al este del embalse de Levante de El Hondo. Dicho canal tiene dos desembocaduras, una en las lagunas de este parque, y otra en el mar, atravesando las Salinas de Santa Pola y dejando al río Vinalopó sin su desembocadura original.​\\nLas aguas de los embalses de El Hondo proceden principalmente de la desecación en 1803 de la laguna de Villena a través de la acequia del rey, ejecutada por Carlos IV para procurarse diezmos en beneficio de su renta, y de la desembocadura del río Segura, siendo elevadas desde el molino harinero de San Antonio, en Guardamar del Segura, y descendidas por gravedad mediante los aportes fluviales desde la cuenca endorreica de la Laguna de Villena a través de la acequia del rey como afluente del río Vinalopó, para abastecer a los regantes de la Comunidad de Riegos de Levante, que es la propietaria de los mismos."},{"page_url":"https://fr.wikipedia.org/wiki/Glaciations_quaternaires","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Five_Myr_Climate_Change_%28fr%29.svg","page_title":"Glaciations quaternaires","context_page_description":"Les glaciations quaternaires, aussi nommées glaciations plio-quaternaires, sont la succession d'au moins 17 périodes glaciaires survenant régulièrement depuis 2,58 millions d'années, et séparées par des périodes interglaciaires. Cette période s'inscrit dans un événement de refroidissement global du climat en cours depuis plus de 50 Ma et en constitue la période la plus froide. Les périodes glaciaires sont caractérisées par le développement d'inlandsis sur les continents, dont l'action a fortement contribué à façonner les paysages actuels par le biais de l'érosion glaciaire. Ces alternances se sont soldées par des cycles d'extinction suivie de recolonisation des milieux qui, associés à la dérive génétique, ont profondément structuré la diversité génétique de chaque zone au cours des épisodes glaciaires successifs."},{"page_url":"https://de.wikipedia.org/wiki/%C3%84rmelstreifen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/%C3%84rmelstreifen_Luftwaffe_Hindenburg.jpg","page_title":"Ärmelstreifen","context_page_description":"Ärmelstreifen waren Erinnerungsabzeichen oder Zugehörigkeitsabzeichen, die bestimmten Truppenteilen der Wehrmacht, der SA und der SS als Traditionsträger verliehen wurden. Die Auszeichnung wurde am rechten Unterärmel getragen. Ärmelbänder der Wehrmacht sind persönliche Tätigkeits- oder Tapferkeitsauszeichnungen, die mit den Ärmelstreifen nicht verwechselt werden dürfen. Im Unterschied zur Wehrmacht wird bei der Bundeswehr das Traditions- und Verbandsabzeichen als Ärmelband bezeichnet. Diese werden an beiden Unterärmeln getragen."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9F%D0%BB%D1%91%D1%81_(%D2%A1%D0%B0%D0%BB%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Flag_of_Plyos_%28Ivanovo_oblast%29.png","page_title":"Плёс (ҡала)","context_page_description":"Плёс — ҡала, Плес ҡала биләмәһе муниципаль берәмегенең административ үҙәге, Рәсәйҙең Иваново өлкәһендәге Приволжский районы составында тора. Иваново өлкәһенең иң мөһим мәҙәни, тарихи һәм туристик үҙәге, ҡала, шул иҫәптән федераль әһәмиәткә эйә булған тарихи биләмәләр исемлегенә индерелгән."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%86%D8%A7%D8%B1%D9%84%D8%B2_%D8%A8%DA%A9%D9%85%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Charles_Bachman_2012.jpg","page_title":"چارلز بکمن","context_page_description":"چارلز بکمن آمریکالی بیلیم اینسانی. ۱۱ دسامبر ۱۹۲۴ تاریخینده دۆنیایا گؤز آچیب. ۹۲ ایل عومر ائله‌ییب و ۱۳ ژوئیه ۲۰۱۷ میلادی تاریخینده وفات ائدیب."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B9%D0%BD%D0%B3%D0%B5%D1%80%D1%81%D1%82_(%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D1%96%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Mystic_Cottage_%28Pinehurst%2C_North_Carolina%29_001.jpg","page_title":"Пайнгерст (Північна Кароліна)","context_page_description":"Пайнгерст — селище в США, в окрузі Мур штату Північна Кароліна. Населення — 13 124 особи."},{"page_url":"https://pt.wikipedia.org/wiki/Flowery_Branch","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Main_Street%2C_Flowery_Branch_GA.jpg","page_title":"Flowery Branch","context_page_description":"Flowery Branch é uma cidade localizada no estado americano de Geórgia, no Condado de Hall."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%97%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%B8%E0%A7%87%E0%A6%B0_%E0%A6%AC%E0%A6%BF%E0%A6%B6%E0%A7%8D%E0%A6%AC_%E0%A6%90%E0%A6%A4%E0%A6%BF%E0%A6%B9%E0%A7%8D%E0%A6%AF%E0%A6%AC%E0%A6%BE%E0%A6%B9%E0%A7%80_%E0%A6%B8%E0%A7%8D%E0%A6%A5%E0%A6%BE%E0%A6%A8%E0%A6%B8%E0%A6%AE%E0%A7%82%E0%A6%B9%E0%A7%87%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/20090803_hosiosloukas12.jpg","page_title":"গ্রিসের বিশ্ব ঐতিহ্যবাহী স্থানসমূহের তালিকা","context_page_description":"এটি গ্রিসের ইউনেস্কো বিশ্ব ঐতিহ্যবাহী স্থানসমূহের একটি তালিকা। আর্মেনিয়ায় ১৮টি বিশ্ব ঐতিহ্যবাহী স্থান আছে। এর মধ্যে ১৬টি সাংস্কৃতিক ও ২টি সাংস্কৃতিক ও প্রাকৃতিক বা মিশ্র স্থান। ৫টি স্থান দ্বীপে অবস্থিত, একটি দ্বীপ ও মূল ভূখণ্ডের মধ্যে বণ্টিত ও ১২টি পুরোপুরি মূল ভূখণ্ডে অবস্থিত। বাসাইয়ে অ্যাপোলোর মন্দির প্রথম তালিকাভূক্ত হয় ১৯৮৬ সালে এবং ২০১৬ সালে অন্তর্ভুক্ত ফিলিপ্পি সর্বশেষ তালিকাভূক্ত স্থান। এছারাও ইউনেস্কোর সাম্ভাব্য ঐতিহ্যবাহী স্থানের তালিকায় আরো ১৪টি স্থান আছে।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Wittenau","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Stolperstein_Hermsdorfer_Str_70_%28Wittn%29_Maria_Novikowa.jpg","page_title":"Liste der Stolpersteine in Berlin-Wittenau","context_page_description":"Die Liste der Stolpersteine in Berlin-Wittenau enthält die Stolpersteine im Berliner Ortsteil Wittenau im Bezirk Reinickendorf, die an das Schicksal der Menschen erinnern sollen, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 24 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://sv.wikipedia.org/wiki/Stadsjagare","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/HMS_Norrk%C3%B6ping_%28J10%29.jpg","page_title":"Stadsjagare","context_page_description":"Stadsjagare var en typ av jagare inom svenska flottan som namngavs efter svenska kuststäder. Jagarna J5-J10 sjösattes åren 1935-40 och var av så kallad Göteborgsklass. De fyra sista, J11-J14, sjösattes 1942-43 med ett något modifierat utseende och beväpning jämfört med de tidigare, och blev då Visbyklass. Dessa fyra sista jagare modifierades senare till fregatter."},{"page_url":"https://en.wikipedia.org/wiki/44th_Golden_Globe_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Royal_Charity_Concert_1980_%28cropped_Hogan%29.jpg","page_title":"44th Golden Globe Awards","context_page_description":"The 44th Golden Globe Awards, honoring the best in film and television for 1986, were held on 31 January 1987 at the Beverly Hilton."},{"page_url":"https://en.wikipedia.org/wiki/Convertible","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/1934_Buick_Series_60_Convertible_Phaeton.JPG","page_title":"Convertible","context_page_description":"A convertible, cabriolet or spyder/spider is a passenger car that can be driven with or without a roof in place. The methods of retracting and storing the roof vary between models.\\nA convertible allows an open-air driving experience, with the ability to provide a roof when required. Potential drawbacks of convertibles are reduced structural rigidity and cargo space.\\nThe majority of convertible roofs are a folding construction made from cloth. Other types of convertible roofs include retractable hardtops and detachable hardtops."},{"page_url":"https://sv.wikipedia.org/wiki/K%C3%A4llan_(skulptur)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/K%C3%A4llan.JPG","page_title":"Källan (skulptur)","context_page_description":"Källan är en skulptur vid Lilla Bommens hamn utanför Göteborgsoperan.\\nPå monumentet rinner vatten ner för stenen. Den är utförd av Bård Breivik 1994 med medel från Charles Felix Lindbergs donationsfond."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%9D%E1%83%9C%E1%83%90%E1%83%99%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Monegasque_Revolution.jpg","page_title":"მონაკო","context_page_description":"მონაკო — სუვერენული ქალაქ-სახელმწიფო, ქვეყანა და ჯუჯა სახელმწიფო დასავლეთ ევროპაში, საფრანგეთის რივიერაზე. ჩრდილოეთიდან, აღმოსავლეთიდან და დასავლეთიდან საფრანგეთი, ხოლო სამხრეთიდან ხმელთაშუა ზღვა ესაზღვრება. ქვეყნის მცხოვრებთა რიცხვი 38,682-ია. ოფიციალური ენაა ფრანგული, ასევ ფართოდ გამოიყენება ინგლისური და იტალიური ენები და მონეგასკური დიალექტი. მონაკო მსოფლიოში ერთ-ერთ ყველაზე მდიდრულ ადგილად ითვლება.\\nქვეყნის ფართობი 2.1 კმ²-ია, რითაც მსოფლიოში ტერიტორიის სიმცირის მიხედვით ვატიკანის შემდეგ მეორე სუვერენული სახელმწიფოა. მოსახლეობის სიმჭიდროვე 1 კმ²-ზე 19,009 მცხოვრებია, რითაც მონაკო მსოფლიოში პირველ ადგილს იკავებს. ქვეყნის სახმელეთო საზღვარი 5.47 კილომეტრია, ხოლო სანაპირო ხაზის სიგრძე, რომელიც ყველაზე მოკლეა მსოფლიოში, 3.83 კილომეტრს უდრის. მონაკო იტალიის საზღვრიდან 15 კილომეტრითაა დაშორებული. ქვეყნის ყველაზე პოპულარული კვარტალია მონტე-კარლო.\\nმონაკოს სამთავროს მმართველობის ფორმაა კონსტიტუციური მონარქია, რომლის სათავეში პრინცი ალბერ II დგას. იგი დიდ პოლიტიკურ ძალაუფლებას ფლობს. მონაკოს სუვერენიტეტი ოფიციალურად 1861 წლის ფრანგულ-მონეგასკური შეთანხმების შედეგად აღიარეს. ქვეყანა 1993 წელს გაეროს წევრი გახდა."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_Santa_Maria_Maddalena_w_Rzymie","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Colonna_-_S_Maria_Maddalena.JPG","page_title":"Kościół Santa Maria Maddalena w Rzymie","context_page_description":"Kościół Santa Maria Maddalena – rzymskokatolicki kościół w Rzymie, w rione Colonna pod wezwaniem św. Marii Magdaleny. Należy do Zakonu Kleryków Regularnych Posługujących Chorym. Jest kościołem rektorskim w parafii Santa Maria in Aquiro.\\nJest jednym z arcydzieł stylu barokowo-rokokowego w Rzymie."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_de_Laponia_Finlandesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Pallastunturi.jpg","page_title":"Región de Laponia Finlandesa","context_page_description":"La región de Laponia o Laponia finesa es una de las diecinueve regiones de la República de Finlandia. Su capital administrativa es la ciudad de Rovaniemi. La Laponia finlandesa forma parte de una región geográfica más grande llamada Laponia. De 1938 a 2009 fue también una de las provincias ahora desaparecidas.\\nLa región de Laponia tiene solamente unos 183.775 habitantes, que representan el 3,6% de la población de Finlandia. La densidad de población es claramente la más baja del país. Las ciudades más notables de la provincia, además de su capital, son Kemi, Tornio, Kemijärvi e Inari."},{"page_url":"https://fr.wikipedia.org/wiki/World_Football_Challenge_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cowboysstadium_js.jpg","page_title":"World Football Challenge 2009","context_page_description":"Le World Football Challenge est un tournoi amical de football rassemblant des clubs d'Europe et d'Amérique du Nord, et qui eut lieu en juillet 2009. Chaque équipe rencontrait les trois autres une fois, formant ainsi un classement final. Tous les matchs eurent lieu sur terrain neutre, dans différents stades des États-Unis. C'est finalement le club de Chelsea FC qui remporta le tournoi."},{"page_url":"https://fi.wikipedia.org/wiki/Xidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Xidi_-_05.JPG","page_title":"Xidi","context_page_description":"Xidi on noin tuhannen asukkaan kylä Anhuin maakunnan eteläosassa Kiinassa. Xidi alkoi kehittyä vuoden 1465 jälkeen, kun 400 vuotta aiemmin kylään tullut Hun suvun jäsenet alkoivat toimia kauppiaina. Kylään rakennettiin tämän jälkeen monia yksityisiä ja julkisia rakennelmia. Xidin yli 300 rakennuksesta 124 on säilynyt hyvin, ja monet näyttävästi koristelluista rakennuksista ovat edelleen Ming- ja Qing-dynastioiden aikaisessa ulkoasussaan. Läheisen Hongcunin kylän kanssa Xidi valittiin vuonna 2000 Unescon maailmanperintöluetteloon, mikä on lisännyt alueen matkailua, josta tulevista lipputuloista asukkaille on luvattu korvaus, jos he pitävät kylän rakennukset perinteisessä ulkoasussa."},{"page_url":"https://en.wikipedia.org/wiki/Sidney_Eisenshtat","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Sinai_Temple%2C_Westwood%2C_Los_Angeles.JPG","page_title":"Sidney Eisenshtat","context_page_description":"Sidney Eisenshtat was an American architect who was best known for his synagogues and\\nJewish academic buildings."},{"page_url":"https://de.wikipedia.org/wiki/Rangordnungsfilter","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Minrangorp.jpg","page_title":"Rangordnungsfilter","context_page_description":"Die Rangordnungsfilter gehören zur Klasse der nichtlinearen Filter in der digitalen Bildverarbeitung. Dies sind Filter, die nicht durch eine Faltung beschrieben werden können.\\nBei den Rangordnungsfiltern werden die Grauwerte der Pixel in einer definierten Umgebung eines Pixels aufgesammelt, nach der Größe sortiert und in eine Rangordnung gebracht. Nun wird ein Grauwert aus dieser sortierten Liste ausgewählt, der den Grauwert des aktuellen Pixels ersetzt.\\nDie Wahl der Position bestimmt die Art des Rangordnungsfilters. Bei einer aufsteigenden Sortierung erhält man den\\nMinimumfilter, für den minimalen Grauwert, erste Position der Liste\\nMedianfilter, für den Grauwert, der sich in der Mitte der Liste befindet\\nMaximumfilter, für den maximalen Grauwert, letzte Position der Liste."},{"page_url":"https://en.wikipedia.org/wiki/Chasmodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Chasmodes_bosquianus.jpg","page_title":"Chasmodes","context_page_description":"Chasmodes is a small genus of combtooth blennies found in the western Atlantic Ocean."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D8%B3%D9%8A%D9%83%D8%A7_%D8%B1%D8%A7%D8%A8%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Sarsoon_Ka_Saag_Fresh.JPG","page_title":"براسيكا رابا","context_page_description":"براسيكا رابا هي نبتة تتكون من مختلف الأنواع المزروعة على نطاق واسع بما في ذلك صغير النبتة الملفوف نابا، بومدونج، بوك تشوي، والرابيني ؛ والفرع من براسيكا رابا أوليفيرا، وللبذور الزيتية العديد من الأسماء الشائعة منها: الكرنب، حقل الخردل، اللفت الطيور، والكتل.\\nفي بعض الأحيان يسمى الزيت المصنوع من البذرة الكانولا أو الكولا، وهذا أحد أسباب الخلط بينه وبين زيت بذور اللفت في بعض الأحيان، ولكن هذا يأتي من مختلف أنواع البراسيكا. البذور الزيتية المعروفة بالكانولا هي في بعض الأحيان أنواع خاصة من نبتة براسيكا رابا لكن عادةً الأنواع المرتبطة ببراعم البراسيكا وجون براسيكا."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%83%E3%82%B8%E3%83%AF%E3%83%BC%E3%82%B9%E3%83%BB%E3%82%AB%E3%82%A4%E3%83%91%E3%83%BC%E3%83%99%E3%83%AB%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Triton_moon_mosaic_Voyager_2_%28large%29.jpg","page_title":"エッジワース・カイパーベルト","context_page_description":"エッジワース・カイパーベルト 、または単にカイパーベルト は、太陽系の海王星軌道 より外側からおよそ 50 au までの黄道面付近にある、天体が密集した穴の空いた円盤状の領域であり、星周円盤の一種である。小惑星帯 と似ているが、範囲は20倍、質量は20から200倍と小惑星帯よりもはるかに大規模である。小惑星帯と同様、カイパーベルトは主に太陽系小天体か、太陽系が形成される際の残余物からなる。多くの小惑星が岩石と金属を主成分とする一方で、カイパーベルトの天体はその組成の大部分をメタンやアンモニア、水などの揮発性物質の凝縮物 が占めている。カイパーベルトには、公式に準惑星に分類されている天体のうち冥王星とハウメア、マケマケの3つが存在する。太陽系内にある衛星のいくつか、例えば海王星の衛星トリトンや土星の衛星フェーベは、カイパーベルトが起源である可能性がある。\\nエッジワース・カイパーベルトという名称は、オランダおよびアメリカ合衆国の天文学者ジェラルド・カイパー、およびアイルランドの天文学者ケネス・エッジワースに由来する。しかしカイパー自身はこの領域の存在を予測したわけではない。\\n1992年に冥王星およびカロンの発見以降初めてのカイパーベルト天体であるアルビオンが発見された。それ以降、カイパーベルト天体の発見個数は数千個にのぼり、直径が 100 km を超えるカイパーベルト天体は10万個以上存在すると予測されている。カイパーベルトは当初、軌道周期が200年未満の短周期彗星の主要な起源であると考えられた。1990年代中盤以降の研究では、カイパーベルトは力学的に安定であり、彗星の実際の起源は45億年前の海王星の外向き移動によって形成された、力学的に活発な 領域である散乱円盤であることが示されるようになった。エリスのような散乱円盤天体は非常に離心率が大きな軌道を持ち、太陽から 100 au ほど離れた遠方に到達する。\\nカイパーベルトは理論的に存在が予測されているオールトの雲とは異なる存在であり、オールトの雲はカイパーベルトの1000倍太陽から遠く、ほぼ球殻状に分布していると考えられている。カイパーベルト内の天体は、散乱円盤天体やオールトの雲、Hills cloud の天体と合わせ、太陽系外縁天体 と総称される。冥王星はカイパーベルトの中で最も大きく重い天体であり、太陽系外縁天体の中でこれより重いのは散乱円盤天体であるエリスのみである。冥王星は元々は惑星とみなされていたが、2006年に国際天文学連合による惑星の定義が行われた結果準惑星へと再分類され、カイパーベルトの一員とみなされるようになった。冥王星はカイパーベルト内の他の天体と組成的に類似しており、周辺の多数の天体と共にその軌道周期が海王星との2:3の軌道共鳴を起こしているという特徴を持つ。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B3%E0%B9%80%E0%B8%A0%E0%B8%AD%E0%B9%81%E0%B8%A1%E0%B9%88%E0%B8%9F%E0%B9%89%E0%B8%B2%E0%B8%AB%E0%B8%A5%E0%B8%A7%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/LN-Tambon-Thoet_Thai.png","page_title":"อำเภอแม่ฟ้าหลวง","context_page_description":"อำเภอแม่ฟ้าหลวง เป็นหนึ่งในอำเภอของจังหวัดเชียงราย"},{"page_url":"https://sk.wikipedia.org/wiki/Obl%C3%ADk_(%C4%8Cesk%C3%A9_st%C5%99edoho%C5%99%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Viola_ambigua1.JPG","page_title":"Oblík (České středohoří)","context_page_description":"Oblík je čadičový solitérny masív, ktorý sa nachádza asi 6 km na sever od Loun, v západnej časti Českého středohoří medzi obcami Raná, Chraberce a Mnichov. Na severovýchode naň nadväzujú dva nižšie vrcholy Srdov a Brník, oddelené sedlom. Oblík sa nachádza v západnej časti Českého středohoří, ktorá je geomorfologicky zaradená do podcelku Milešovské středohoří a okrsku Chožovské středohoří niekedy tiež nazývaného Lounské středohoří alebo Lounské vrchy. Od roku 1967 je vrch a jeho okolie v rozsahu približne 20 ha vyhlásený ako štátna prírodná rezervácia. Na vrchole kopca je umiestnený už nefunkčný svetelný maják pre leteckú prevádzku."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B2%D0%B8%D0%BB%D1%8C-%D0%BE-%D0%9F%D0%BB%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Neuville-au-Plain.JPG","page_title":"Невиль-о-Плен","context_page_description":"Невиль-о-Плен — Францин гӀала-коммуна, лаьтта Норманди регионехь. Коммунан департамент — Манш. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%AA%D9%88%D9%84%D8%AA%D8%A8%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Stoltebuell_Wappen.png","page_title":"شتولتبول","context_page_description":"شتولتبول یک شهر در آلمان است که در اشلسویگ-فلنسبورگ واقع شده‌است. شتولتبول ۸۲۱ نفر جمعیت دارد."},{"page_url":"https://en.wikipedia.org/wiki/Julia_Davis_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Fencers_in_Julia_Davis_Park.JPG","page_title":"Julia Davis Park","context_page_description":"Julia Davis Park is a municipal park in the downtown region of Boise, Idaho. Created in 1907 with a land donation from Thomas Jefferson Davis, it is the first park in the \\"String of Pearls\\", the group of parks operated by the Boise Parks and Recreation Department that are located along the Boise River. Being centrally located in Boise, the park contains several prominent sites, including museums such as the Boise Art Museum, the Idaho Historical Museum, and the Idaho Black History Museum, as well as other attractions like Zoo Boise, the Idaho Rose Society, and the Gene Harris Band Shell. The Boise River Greenbelt runs through the park, which is bordered by Broadway Avenue to the east, Capital Boulevard to the west, the Boise River to the south, and Myrtle Street to the north. Other amenities at Julia Davis Park include river access, statues, a rose garden, a playground and tennis court, a pond with paddle boat rentals, and a pedestrian bridge that connects the park with Boise State University."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D0%B8%D0%B2%D1%8B_Kodak","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/KodakNagel_Recomar_18.jpg","page_title":"Объективы Kodak","context_page_description":"Объективы Kodak — объективы, производимые компанией Eastman Kodak."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%BE%D0%BD%D0%BE,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Nicol%C3%B2_Tron_LXVIII_Doge_di_Venezia_1471.jpg","page_title":"Троно, Николо","context_page_description":"Николо Троно — 68-й венецианский дож.\\nРодился в семье Луки Троно и Лючии Тривизани. Фамилия Троно относилась к так называемым новым семьям Венеции, и вела свою летопись с 1158 года.\\nО молодости дожа мало известно, единственное отмечено, что он проявил себя как незаурядный торговец с восточными странами и уже в достаточно молодом возрасте заработал значительный капитал.\\nБыл женат на Деа Морозини, представительнице знатной венецианской фамилии. Имел единственного наследника Джованни, который в 1471 году был зверски убит турками. Также был женат на графине Лауре Ногарола, сестре гуманистки Изотты Ногаролы.\\nНачал править республикой 25 ноября 1471 года в возрасте 72 лет. Продолжил войну с турками, начатую в 1463 году предшественником Кристофоро Моро. Чтобы ослабить турок, в 1473 году отправил посольство в небольшое мусульманское государство Караман, расположенное на территории Ирана, к хану Узану Гассану. Однако выгоды это не принесло, слабые войска персов были разгромлены турками.\\nПохоронен в церкви Санта-Мария-деи-Фрари."},{"page_url":"https://bs.wikipedia.org/wiki/Microsoft","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/VistaParty3-cropped.jpg","page_title":"Microsoft","context_page_description":"Microsoft američka je međunarodna korporacija sa sjedištem u Redmondu koja razvija, proizvodi, licencira, podržava i prodaje računarski softver, korisničku elektroniku, te osobne računare i servise. Njihov najpoznatiji softver je serija operativnih sistema Microsoft Windows, te uredskih paketa Microsoft Office, kao i internetski preglednici Internet Explorer i Microsoft Edge. Njihovi hardverski proizvodi su poznata konzola Xbox i serija tableta Microsoft Surface. Microsoft je najveći proizvođač softvera ako se u obzir uzme prihod. Također je jedna od svjetskih najvrijednijih kompanija.\\nMicrosoft su osnovali Bill Gates i Paul Allen 4. aprila 1975. godine za razvoj i prodaju BASIC-a za računar Altair 8800. Nastojali su dominirati tržištem operativnih sistema za osobne računare sa MS-DOS-om sredinom 1980tih, što je popraćeno Microsoft Windowsom. Početna javna ponuda kompanije iz 1986. i naknadni rast u njenoj cijeni dionica, učinile su trojicu ljudi milijarderima, a 12 hiljada su postali milioneri među zaposlenicima Microsofta. Od 1990tih, Microsoft se značajno ogradio od tržišta operativnih sistema i napravio je više akvizicija preduzeća."},{"page_url":"https://pt.wikipedia.org/wiki/Carlos_Moy%C3%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Carlos_Moya_Australian_Open_2006.JPG","page_title":"Carlos Moyà","context_page_description":"Carlos Moyà Llompart, também conhecido como Carles Moyà, Carlos Moyá e Carlos Moya, é um ex tenista profissional espanhol.\\nEm 1999, Carlos Moyá foi número 1 de simples do ranking mundial masculino. Com isso, ele se tornou no primeiro tenista espanhol a chegar ao topo do ranking mundial.\\nConquistou apenas um título de Grand Slam na carreira, que foi o Open da França em 1998. Além dessa conquista, Moyá foi vice-campeão no Grand Slam do Open da Austrália de 1997.\\nEm 1998, foi finalista da Tennis Masters Cup. Mas na decisão perdeu o título para o compatriota Àlex Corretja.\\nGanhou em simples a três Masters Séries: o Monte Carlo Masters em 1998, o Cincinnati Masters em 2002 e o Roma Masters em 2004.\\nUm dos principais tenistas da Espanha de todos os tempos, Carlos Moyá encerrou sua carreira no segundo semestre de 2010 e despediu-se do circuito profissional na cidade de Sevilha, durante o Masters da Espanha. Jogando contra o compatriota David Ferrer, o ex-número um de simples do ranking mundial perdeu o jogo por 6-7 e 3-6 e deixou a quadra com um \\"até logo e obrigado\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_aan_de_Keizersgracht_(Amsterdam,_Noordwest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Amsterdam_-_Keizersgracht_94.JPG","page_title":"Lijst van rijksmonumenten aan de Keizersgracht (Amsterdam, Noordwest)","context_page_description":"Een overzicht van de 569 rijksmonumenten aan de Keizersgracht in Amsterdam.\\nHet overzicht is opgesplitst in drie delen. Dit is het noordwestelijk deel vanaf de Brouwersgracht tot de Raadhuisstraat. Dit zijn de nummers 1 t/m 183 aan de oneven zijde en 2 t/m 200 aan de even zijde.\\nZie ook de lijst van het zuidwestelijk gedeelte vanaf de Raadhuisstraat tot de Leidsestraat. Dat zijn de nummers 185 t/m 455 aan de oneven zijde en 202 t/m 508 aan de even zijde.\\nZie ook de lijst van het zuidelijke gedeelte vanaf de Leidsestraat tot de Amstel. Dat zijn de nummers 457 t/m aan de oneven zijde en 510 t/m aan de even zijde."},{"page_url":"https://cs.wikipedia.org/wiki/Vodn%C3%AD_n%C3%A1dr%C5%BE_K%C5%99i%C5%BEanovice_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/P%C5%99ehrada_K%C5%99i%C5%BEanovice.jpg","page_title":"Vodní nádrž Křižanovice I","context_page_description":"Křižanovice I je údolní nádrž na řece Chrudimce asi 3 km severozápadně od městečka Nasavrky. Vybudovaná byla spolu s vyrovnávací nádrží Práčov mezi lety 1948 až 1954. Maximální zatopená plocha dosahuje 31,8 ha."},{"page_url":"https://pt.wikipedia.org/wiki/Mikhail_Tskhakaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Tskhakaya_MG.jpg","page_title":"Mikhail Tskhakaya","context_page_description":"Mikhail Grigoryevich Tskhakaya, também conhecido como Barsov, foi um comunista georgiano. Barsov era um líder no movimento bolchevique na Geórgia, tendo sido ativo na política revolucionária desde 1880.\\nNasceu em 1865 no município de Martvili. Em 1892, ajudou a fundar o Mesame Dasi, o primeiro partido socialista da Geórgia. Juntou-se ao Partido Operário Social-Democrata Russo quando este foi fundado. Salvou o jovem Josef Stalin da expulsão pelo nacionalismo georgiano em 1904. No entanto, Barsov fez Stalin escrever um credo renunciando a seus pontos de vista e assistir a uma série de palestras suas sobre o marxismo. Apesar disso, continuaram amigos. Em julho de 1906, Tskhakaya foi testemunha de Stalin em seu casamento com Kato Svanidze. Em 9 de setembro, ambos estavam entre apenas seis bolcheviques na conferência social-democrata em Tbilisi. Dividiram uma sala no V Congresso do Partido Operário Social-Democrata Russo em Londres. Nenhum dos dois foi autorizado a votar devido à fraqueza do bolchevismo na Geórgia. Em 1907, após uma série de prisões e deportações, foi para o exílio na Suíça, onde visitou Lenin em Genebra. Retornou à Rússia em 1917, ao lado de Lenin no famoso trem."},{"page_url":"https://sk.wikipedia.org/wiki/Collemiers","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Map_commune_FR_insee_code_89113.png","page_title":"Collemiers","context_page_description":"Collemiers je francúzska obec, ktorá sa nachádza v departemente Yonne, v regióne Burgundsko."},{"page_url":"https://en.wikipedia.org/wiki/K%C3%B6nigstein_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/DSC06084_FKE_LINT_41_vor_Burg_K%C3%B6nigstein.jpg","page_title":"Königstein Railway","context_page_description":"The Königstein Railway is a 1902 opened, single-track and non-electrified secondary railway line that connects the town of Königstein im Taunus with the city of Frankfurt am Main on the southern edge of the Taunus in the German state of Hesse.\\nThe Regionalbahn line, which was also called the K-Bahn from 1989 to 1995, now runs from Koenigstein via Frankfurt-Höchst station as timetable route 646 to Frankfurt Hauptbahnhof."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Auslandsvertretungen_Kiribatis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Diplomatic_missions_of_Kiribati.png","page_title":"Liste der Auslandsvertretungen Kiribatis","context_page_description":"Dies ist eine Liste der diplomatischen Vertretungen Kiribatis.\\nKiribati eröffnete die erste diplomatische Vertretung im Jahr 2002 in der Hauptstadt Suva in Fidschi. Fidschi, seit dem 19. Jahrhundert ein diplomatischer Angelpunkt im Pazifik, hatte Umsiedler der Insel Banaba auf der Insel Rabi aufgenommen, zudem bestehen langjährige Wirtschaftsbeziehungen, z. B. durch die Anbindung an den internationalen Flugverkehr, hinzu kommen kiribatische Studenten der University of the South Pacific und andere Ausbildungsmaßnahmen.\\nZusätzlich zum Hohen Kommissar in Suva unterhält Kiribati Honorarkonsulate in Sydney, Tokio, Auckland, Honolulu, Seoul, Hamburg und London. Eine Botschaft wurde im taiwanischen Taipei errichtet und 2013 eine Ständige Vertretung bei den Vereinten Nationen in New York."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD%D1%82-%D0%9A%D1%80%D1%83%D0%B0_(%D0%AD%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Chapelle_de_Sainte-Croix_%28Ain%29.JPG","page_title":"Сент-Круа (Эн)","context_page_description":"Сент-Круа́ — коммуна во Франции, находится в регионе Рона — Альпы. Департамент — Эн. Входит в состав кантона Монлюэль. Округ коммуны — Бурк-ан-Брес.\\nКод INSEE коммуны — 01342."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%83%D0%B3%D1%80%D0%BE%D0%B6%D0%B0%D0%B5%D0%BC%D1%8B%D1%85_%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2_%D1%80%D1%8B%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Noturus_fasciatus.jpg","page_title":"Список угрожаемых видов рыб","context_page_description":"Список угрожаемых видов рыб содержит перечень видов хрящевых, лопастепёрых и лучепёрых рыб, которым Международным союзом охраны природы и природных ресурсов присвоены охранные статусы «Уязвимый вид», «Вымирающий вид» либо «Вид на грани исчезновения». В настоящее время в Красный список угрожаемых видов МСОП занесено 2356 редких и исчезающих видов рыб, из них 1234 вида — уязвимые, 661 вид — вымирающие и 461 вид — находящиеся на грани исчезновения. Ещё 6 видов лучепёрых рыб значатся в данном списке как исчезнувшие в дикой природе, а 63 вида — как уже полностью вымершие. Они также представлены в этом перечне.\\nНадвидовые таксоны рыб в данном списке приведены в систематическом порядке, принятом в современной ихтиологической литературе."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%B8%D0%B9_%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/%D0%90%D1%80%D0%B8%D0%B9_%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D1%8C1.JPG","page_title":"Арий Камень","context_page_description":"Арий Камень — необитаемый остров Командорского архипелага. Административно входит в состав Алеутского района Камчатского края.\\nЧетвёртый по величине остров Командорского архипелага.\\nРасположен на расстоянии 6,3 км к западу от острова Беринга. Представляет собой скалу высотой 49,8 м и окружностью около 1 км. Арий Камень лишён пресной воды.\\nК югу от острова Арий Камень находится безымянный плоский островок высотой 2 м."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A7%E5%B7%9D%E5%B4%8E%E8%B2%AF%E8%93%84%E9%8A%80%E8%A1%8C%E5%A4%A7%E9%98%AA%E6%94%AF%E5%BA%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Kawasaki_Savings_Bank.jpg","page_title":"旧川崎貯蓄銀行大阪支店","context_page_description":"旧川崎貯蓄銀行大阪支店は大阪府大阪市中央区にある歴史的建造物。銀行支店として建設されたが、現在はレストラン「堺筋倶楽部」である。"},{"page_url":"https://en.wikipedia.org/wiki/Dixeia_orbona","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Creamy_small_white_%28Dixeia_orbona_orbona%29_male.jpg","page_title":"Dixeia orbona","context_page_description":"Dixeia orbona, the creamy small white, is a butterfly in the family Pieridae. It is found in Senegal, the Gambia, Guinea-Bissau, Burkina Faso, Ghana, Nigeria, Cameroon, Sudan, Ethiopia, the Democratic Republic of the Congo, Uganda, Kenya and Tanzania. The habitat consists of open woodland and open montane forests, particularly forest-grassland mosaic.\\nThe larvae feed on Capparis species."},{"page_url":"https://ca.wikipedia.org/wiki/Euphorbia_ingens","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Euphorbia_ingens_%28habitus%29.jpg","page_title":"Euphorbia ingens","context_page_description":"Euphorbia ingens és una espècie fanerògama suculenta pertanyent a la família de les euforbiàcies. És endèmica de les regions tropicals del sud d'Àfrica. Es troba a una altitud de 10-1.600 m, tant a boscos caducifolis de la vall del Rift com a zones rocoses als voltants de camps de cultiu o en sòls sorrencs sense gaire vegetació, als turons rocosos, monticles de tèrmits i també a argiles al·luvials.\\nEs tracta d'un arbre que pot arribar a mesurar fins a 15 m d'alçada, i és autènticament xerofític, ja que les seves fulles són molt reduïdes, rudimentàries i curtes, adoptant les tiges la funció fotosintètica, que és també on s'emmagatzema el líquid. Les espines hi apareixen en parelles al llarg de les costes que fan les tiges. Té un tronc curt principal ramificat lliurement inicialment molt baix, el que dóna lloc, generalment, a la forma de canelobre de la corona individual de les branques. Produeix flors grogues i verdes a la part més alta de les branques durant la tardor i hivern. El fruit és el típic de les eufòrbies: rodó, trilobulat, una càpsula que es torna vermella o púrpura quan madura."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D0%B7%D0%B0_%D0%90%D0%BB%D0%B5%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Lizaalert000001.jpg","page_title":"Лиза Алерт","context_page_description":"Поисково-спасательный отряд «Лиза Але́рт» — добровольческое некоммерческое общественное объединение, занимающееся поиском пропавших без вести людей. Основано 14 октября 2010 года. По данным ПСО, за 2018 год поступило 13 996 заявок, из них волонтёры нашли живыми 11 027 человек и погибшими 1519."},{"page_url":"https://hu.wikipedia.org/wiki/Original_Dixieland_Jass_Band","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/ODJBcard.JPG","page_title":"Original Dixieland Jass Band","context_page_description":"Az Original Dixieland Jass Band az a New Orleans-i zenekar volt, amellyel elsőként készült hanglemez, már 1917-ben. Ez a szám a Livery Stable Blues volt. 1917-től a zenekar nevét már így írták: Original Dixieland Jazz Band.\\nA zenekar öt muzsikusból állt és Nick LaRocca trombitás vezette, aki rájött a hanglemezkészítés előnyeire, ezért az együttes hamar ismert lett, és a felvételei fennmaradtak az utókor számára.\\nAz együttes mindmáig leghíresebb száma a Tiger Rag:"},{"page_url":"https://sk.wikipedia.org/wiki/Katym%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/HUN_Katym%C3%A1r_COA.jpg","page_title":"Katymár","context_page_description":"Katymár je obec v Maďarsku v Báčsko-malokumánskej župe v Bácsalmásskom okrese.\\nMá rozlohu 7 108 ha a žije tu 2 099 obyvateľov."},{"page_url":"https://hu.wikipedia.org/wiki/Sid%C3%B3_Ferenc","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Sid%C3%B3_Ferenc_s%C3%ADrja.jpg","page_title":"Sidó Ferenc","context_page_description":"Sidó Ferenc kilencszeres világbajnok asztaliteniszező, labdarúgó, edző, sportvezető."},{"page_url":"https://en.wikipedia.org/wiki/List_of_listed_buildings_in_Jedburgh,_Scottish_Borders","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Port_House_in_Exchange_Street_Jedburgh.jpeg","page_title":"List of listed buildings in Jedburgh, Scottish Borders","context_page_description":"This is a list of listed buildings in the parish of Jedburgh in the Scottish Borders, Scotland."},{"page_url":"https://es.wikipedia.org/wiki/La_carretera_(novela)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/The-road.jpg","page_title":"La carretera (novela)","context_page_description":"La carretera es una novela post-apocalíptica de ciencia ficción escrita en 2006 por el escritor estadounidense Cormac McCarthy, creador de otras novelas como No es país para viejos y la trilogía de la frontera. La carretera fue galardonada con el Premio Pulitzer de 2007 en la categoría de ficción, ​ con el James Tait Black Memorial Prize en 2006 y fue finalista para el National Book Critics Circle Award en 2006.​"},{"page_url":"https://de.wikipedia.org/wiki/Tempel_von_Dendera","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Dendera_Wabet_11.jpg","page_title":"Tempel von Dendera","context_page_description":"Der Tempel von Dendera ist eine altägyptische Tempelanlage in Dendera, 55 km nördlich von Luxor in Oberägypten. Sie ist eine der wichtigsten Tempelstätten Ägyptens und war der Göttin Hathor gewidmet. Die Anlage liegt im Bezirk der antiken Provinzhauptstadt Tentyris, die während einiger Epochen der ägyptischen Geschichte als wichtiges religiöses Zentrum galt. Der heutige Tempelkomplex gehört zu den am besten erhaltenen ägyptischen Tempeln dieser Zeit."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BE%D0%B3%D0%BE%D0%BB%D1%8C_(%D0%BF%D1%82%D0%B0%D1%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bucephala_clangula_m_Humber_Bay_Park_Toronto.jpg","page_title":"Гоголь (птах)","context_page_description":"Го́голь зеленоголо́вий, або гоголь, заст. ґе́ґавка — птах родини качкових ряду гусеподібних. Один з 3-х видів роду у світовій фауні; єдиний вид роду у фауні України. В Україні — гніздовий, перелітний, зимуючий."},{"page_url":"https://de.wikipedia.org/wiki/Eberhard_Kieser","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Matthias_Kr%C3%B6nung_-_Zug_zum_Bankett.jpg","page_title":"Eberhard Kieser","context_page_description":"Eberhard Kieser war ein deutscher Kupferstecher und Verleger."},{"page_url":"https://de.wikipedia.org/wiki/Silberne_Eiche","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Silberne_Eiche_beide_B%C3%A4ume_Sch%C3%B6nberg-Fernitz.jpg","page_title":"Silberne Eiche","context_page_description":"Die Silberne Eiche ist eine markante Eiche westlich des Manhartsberges, in Schönberg am Kamp in Niederösterreich.\\nSie ist als Naturdenkmal eingetragen."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%AA%E9%98%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Solvognen_DO-6865_2000.jpg","page_title":"太阳","context_page_description":"太阳，或称日，是太阳系中心的恒星，它几乎是热等离子体与磁场交织著的一个理想球体。其直径大约是1,392,000公里，相当于地球直径的109倍；质量大约是2×10³⁰千克，约占太阳系总质量的99.86%，同时也是27,173,913.04347826倍的月球质量。\\n从化学组成来看，太阳质量的大约四分之三是氢，剩下的几乎都是氦，包括氧、碳、氖、铁和其他的重元素质量少于2%。\\n太阳的恒星光谱分类为G型主序星。虽然它以肉眼来看是白色的，但因为在可见光的频谱中以黄绿色的部分最为强烈，从地球表面观看时，大气层的散射使天空成为蓝色，所以它呈现黄色，因而非正式地称之为“黄矮星”。\\n光谱分类标示中的G2表示其表面温度大约是5778K，V则表示太阳像其他大多数的恒星一样，是一颗主序星，它的能量来自于氢聚变成氦的核聚变反应。太阳的核心每秒钟聚变6.2亿吨的氢。太阳一度被天文学家认为是一颗微小平凡的恒星，但因为银河系内大部分的恒星都是红矮星，现在认为太阳比85%的恒星都要明亮。太阳的绝对星等是 +4.83，但是由于其非常靠近地球，因此从地球上看来，它是天空中最亮的天体，视星等达到−26.74。太阳高温的日冕持续的向太空中拓展，创造的太阳风延伸到100天文单位远的日球层顶。这个太阳风形成的“气泡”称为太阳圈，是太阳系中最大的连续结构。\\n太阳目前正在穿越银河系内部边缘猎户臂的本地泡区中的本星际云。在距离地球17光年的距离内有50颗最邻近的恒星系，太阳的质量在这些恒星中排在第四。\\n太阳在距离银河中心24,000至26,000光年的距离上绕着银河公转，从银河北极鸟瞰，太阳沿顺时针轨道运行，大约2.25亿至2.5亿年遶行一周。由于银河系在宇宙微波背景辐射中以550公里/秒的速度朝向长蛇座的方向运动，这两个速度合成之后，太阳相对于CMB的速度是370公里/秒，朝向巨爵座或狮子座的方向运动。\\n地球围绕太阳公转的轨道是椭圆形的，每年1月离太阳最近，7月最远，平均距离是1.496亿公里。以平均距离算，光从太阳到地球大约需要经过8分19秒。太阳光中的能量通过光合作用等方式支持着地球上所有生物的生长，也支配了地球的气候和天气。人类从史前时代就一直认为太阳对地球有巨大影响，有许多文化将太阳当成神来崇拜。人类对太阳的正确科学认识进展得很慢，直到19世纪初期，杰出的科学家才对太阳的物质组成和能量来源有了一点认识。直至今日，人类对太阳的理解一直在不断进展中，还有大量有关太阳活动机制方面的未解之谜等待着人们来破解。\\n现今，太阳自恒星育婴室诞生以来已经45亿岁了，而现有的燃料预计还可以燃烧50亿年之久。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D1%80%D0%B1_%D0%BD%D0%B0_%D0%9A%D1%83%D1%80%D0%B0%D1%81%D0%B0%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Curacao_wapen.svg","page_title":"Грб на Курасао","context_page_description":"Грбот на Курасао содржи круна што ја претставува врската со Холандското кралско семејство. На левата страна има брод што ја претставува трговијата во земјата. На средина е покажан грбот на Амстердам претставувајќи ја трговијата на обврзници со Амстердам. На десната страна има прикажано цитрус дрво."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Tours","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Maison_du_Cerisier%2C_Tours_%E2%80%93_2.JPG","page_title":"Liste des monuments historiques de Tours","context_page_description":"Ce tableau présente la liste de tous les monuments historiques classés ou inscrits dans la ville de Tours, Indre-et-Loire, en France.\\nMalgré les destructions importantes, dues principalement à l'incendie de juin 1940 qui a détruit par le feu, près de 200 monuments historiques, la ville conserve en 2015 plus de 160 monuments inscrits ou classées et la ville historique est inscrite au patrimoine mondial de l'Unesco depuis l'an 2000.\\nLa base Mérimée établit une liste de 675 monuments pour la ville de Tours. La base Palissy recense 950 objets classés ou inscrits au titre des monuments historiques."},{"page_url":"https://is.wikipedia.org/wiki/Skegg%C3%BEerna","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Chlidonias_hybrida_2_%28Marek_Szczepanek%29.jpg","page_title":"Skeggþerna","context_page_description":"Skeggþerna er sjófugl af þernuætt. Skeggþerna er lík kríu. Hún verpir í Evrópu en vestur-evrópskar skeggþernur eru farfuglar og flestar fara til Vestur-Afríku yfir veturinn og dvelja rétt norðan miðbaugs. Skeggþerna hefur sést á Íslandi en ólíklegt er talið að hún muni verpa hérna en talið er að meðalhiti í júlí þurfi að vera um 20°C eða meiri til þess varp geti tekist."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%99%E3%81%A3%E3%81%B1%E3%81%84%E8%91%A1%E8%90%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Caxton_Fox_and_Grapes.jpg","page_title":"すっぱい葡萄","context_page_description":"「酸っぱい葡萄」は、イソップ寓話の一つで、その邦題の一つ。原題は \\"Ἀλώπηξ καί σταφυλή\\" 、ラテン語題名は直訳した \\"Vulpes et uva \\"、英題も直訳した \\"The Fox and the Grapes \\" で、邦題にも直訳した「狐と葡萄」がある。狐が己が取れなかった後に、狙っていた葡萄を酸っぱくて美味しくないモノに決まっていると自己正当化した物語が転じて、酸っぱい葡萄は自己の能力の低さを正当化や擁護するために、対象を貶めたり、価値の無いものだと主張する負け惜しみを意味するようになった。"},{"page_url":"https://ceb.wikipedia.org/wiki/La_Bastide,_Pyr%C3%A9n%C3%A9es-Orientales","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Population_-_Municipality_code_66018.svg","page_title":"La Bastide, Pyrénées-Orientales","context_page_description":"Ang La Bastide usa ka komyun sa Pransiya. Kini may 64 ka molupyo ug nahimutang sa departamento sa Pyrénées-Orientales sa rehiyon sa Occitanie."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%89%8B%E5%8B%95%E6%A7%8D%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/MauserSystem98Verschluss-03.jpg","page_title":"手動槍機","context_page_description":"手動供彈步槍，簡稱手動步槍，是指需要射擊者完全用手施力操作完成將子彈送入膛室並在射擊後將用完的彈殼退出膛室過程的步槍。由於每次子彈上膛都是以手動的方式進行，這類步槍的射速要遠低於利用氣動機械進行自動供彈的半自動或全自動。現今手動步槍在軍事上除狙擊步槍以外已經大部分被自動供彈步槍取代，在民間市場使用仍然相當廣泛，譬如狩獵和競賽。與自動供彈槍械相比，手動步槍的內彈道不受自動復進的槍機影響，膛壓更容易保持穩定，其精度有很大優勢，所以在對射速沒有要求的情況下更受歡迎。"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%BB%96%E6%9C%AC%E5%85%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/2013_%E8%87%BA%E7%81%A3%E3%80%8C%E4%BB%8A%E5%A4%A9%E6%8B%86%E5%A4%A7%E5%9F%94_%E6%98%8E%E5%A4%A9%E6%8B%86%E6%94%BF%E5%BA%9C%E3%80%8D%E9%81%8B%E5%8B%95_Slogan_for_Taiwanese_Campaign_against_KMT_government%27s_abuse_of_power.jpg","page_title":"廖本全","context_page_description":"廖本全，台湾学者与社会运动人士、曾任绿党第十七届中央执行委员，现为国立台北大学公共事务学院不动产与城乡环境学系副教授、地球公民基金会董事长、台湾农村阵线理事、长期为弱势团体与社会正义发声，关注国土规划、土地政策、环境保护、农村等议题。他是国立中兴大学法商学院都市计划研究所硕士、国立台北大学都市与区域规划博士，其教学研究专长为聚落、乡土空间分析与文化研究；都市、区域、国土政策与理论；土地政策与土地伦理；台湾环境议题等。\\n廖本全于2014年中华民国地方公职人员选举前的11月28日凌晨写了篇文章，内容提及“民主选举是对未来与梦想的选择”“政治是公民的公共事务，不是私民的权力争斗。”并提醒大家“政治是让生活、让社会、让未来走向善”以为绿党助选。之后在学校因太过劳累、心肌梗塞昏迷而被同事紧急送医，开刀移除血栓，已于12月1日恢复意识。绿党则于创党18年后首度赢得两席市议员。"},{"page_url":"https://sv.wikipedia.org/wiki/Djurg%C3%A5rdsbrunns_v%C3%A4rdshus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Djurg%C3%A5rdsbrunns_v%C3%A4rdshus_K%C3%A4llarsalen_1930.jpg","page_title":"Djurgårdsbrunns värdshus","context_page_description":"Djurgårdsbrunns värdshus är en restaurang belägen vid Djurgårdsbrunnsvägen 68 på Södra Djurgården i Stockholm."},{"page_url":"https://lt.wikipedia.org/wiki/Raguvos_seni%C5%ABnija","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Raguva%2C_seni%C5%ABnija.JPG","page_title":"Raguvos seniūnija","context_page_description":"Raguvos seniūnija yra Panevėžio rajono pietryčiuose. Plotas – 94,69 km², kurių 41 % užima miškai."},{"page_url":"https://pl.wikipedia.org/wiki/Jezioro_eutroficzne","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Eutrophic_pond.JPG","page_title":"Jezioro eutroficzne","context_page_description":"Jezioro eutroficzne – w typologii jezior: jezioro słodkowodne odznaczające się dużym stężeniem substancji odżywczych rozpuszczonych w wodzie, co powoduje silny rozwój życia biologicznego przy jednoczesnym spadku ilości tlenu w wodzie i ograniczeniu procesów mineralizacji. Jeziora eutroficzne nie są głębokie, ich woda obfituje w sole mineralne i ma odcień zielony lub zielonożółty co spowodowane jest masowym rozwojem glonów. Charakteryzują się małą przezroczystością wody, w takich zbiornikach zasięg penetracji światła słonecznego do wód jest niewielki, szczególnie latem, i sięga niekiedy tylko 20–100 cm. Wody takich jezior mają odczyn zasadowy lub obojętny.\\nSkutkiem tego jest pojawienie się organizmów beztlenowych i powstawanie mułu jeziornego, które prowadzi do powolnego wypłycania zbiornika, przekształcania go w torfowisko, bagno itp., później całkowitego zaniku jeziora.\\nNaturalne jeziora eutroficzne zostały w systemie Natura 2000 w krajach Unii Europejskiej uznane za siedlisko przyrodnicze wymagające ochrony."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%BF%E5%B7%9E%E5%B8%82%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/%E6%A8%A1%E8%8C%83%E4%BD%8F%E5%AE%85%E5%8C%BA%E6%97%A7%E5%9D%80%E7%AB%B9%E4%B8%9D%E5%B2%97%E4%B8%89%E9%A9%AC%E8%B7%AF1%E5%8F%B7.jpg","page_title":"广州市历史建筑列表","context_page_description":"本條目是關於在廣州市內的歷史建築的介紹。"},{"page_url":"https://en.wikipedia.org/wiki/August_Nielsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/MajorstuenKirke_20080511-1.jpg","page_title":"August Nielsen","context_page_description":"August Bendix Christofer Nielsen was a Norwegian architect.\\nAugust Nielsen was born in the village of Vik at Sømna in Nordland, Norway. He was a son of politician Sivert Nielsen and Jonethe Cornelia Falck Heide.\\nHe received the name Bendix from his maternal grandfather. In 1910 he married physician's daughter Ella Hassel, who was a sister of Odd Hassel.\\nNielsen attended Trondheim Technical College from 1893 to 1897, and spent the next years as an assistant of architects including Bredo Greve as well as Andreas Bugge, Heinrich Jürgensen and Ingvar Hjorth. During 1903, he conducted study trip to Scotland, England and France. He started his own architect's firm at Kristiania in 1911. He is most associated with the Deichman Library at Schous plass and the entrance portal at Frogner stadion.\\nHe contributed with Rudolf Emanuel Jacobsen in creating several buildings at Frogner station's 1914 Jubilee Exhibition; buildings that were moved later. He also designed villas in Trosterudveien 9 and 7, Holmenkollveien 61c and Gråkamveien 17.\\nFrom 1918 he partnered with architect Harald Sund. Among their works were Majorstuen Church, Fredrikstad Library and the diocesan seat in Tromsø."},{"page_url":"https://nl.wikipedia.org/wiki/Aphrophora_salicina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Schaumzikade.jpg","page_title":"Aphrophora salicina","context_page_description":"Aphrophora salicina is een halfvleugelig insect uit de familie Aphrophoridae. De wetenschappelijke naam van deze soort is voor het eerst geldig gepubliceerd in 1778 door Goeze."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BA%A7%E7%A4%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Rokiadelmasiledere.jpg","page_title":"座礁","context_page_description":"座礁とは、船舶が暗礁や浅瀬に底触したり乗り揚げる事象。厳密には座礁と座洲は区別されるが、座洲を含めた広義の総称として「座礁」ということもある。元々の用字は坐礁である。\\nなお、座礁とは本来は船舶が岩礁等に乗り揚げることであるが、クジラやイルカなどの海洋生物が潮流で乗り上げてしまうことも座礁と呼ばれる。座礁鯨も参照。"},{"page_url":"https://tr.wikipedia.org/wiki/D%C3%BCnyan%C4%B1n_en_b%C3%BCy%C3%BCk_camileri_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Cairo_-_Islamic_district_-_Al_Azhar_Mosque_and_University.JPG","page_title":"Dünyanın en büyük camileri listesi","context_page_description":"Bu liste dünyanın en büyük camilerini listelemektedir. Kriter olarak en az 5000 kişilik cemaat kapasitesine sahip camiler listeye alınmıştır."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_1173","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/NGC_1173_SDSS.jpg","page_title":"NGC 1173","context_page_description":"NGC 1173 is een niet bestaand object in het sterrenbeeld Perseus. Het hemelobject werd op 17 december 1884 ontdekt door de Franse astronoom Guillaume Bigourdan."},{"page_url":"https://de.wikipedia.org/wiki/Flusensieb","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Flusensieb_Trockner_03_%28fcm%29.jpg","page_title":"Flusensieb","context_page_description":"Ein Flusensieb oder auch Fusselsieb ist ein Sieb in einer Waschmaschine oder einem Wäschetrockner."},{"page_url":"https://fr.wikipedia.org/wiki/Adam_Levine","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Adam_Levine_2007.jpg","page_title":"Adam Levine","context_page_description":"Adam Noah Levine, né le 18 mars 1979 à Los Angeles, est un chanteur et guitariste américain. Il est le leader du groupe de pop rock Maroon 5."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%94%95%E6%B4%A5%E9%83%A1_(%E4%BB%81%E5%B7%9D%E5%BA%83%E5%9F%9F%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Islanders_of_Sir_James_Hall%27s_Group.jpg","page_title":"甕津郡 (仁川広域市)","context_page_description":"甕津郡は、大韓民国仁川広域市に属する郡。仁川西方の黄海に浮かぶ島々を郡域としている。また、韓国側が統治する黄海道沖の島も管轄しており、仁川中心部から193キロメートル西方の白翎島も甕津郡の領域である。\\n北朝鮮側の黄海南道に属する甕津半島には、同名の郡が存在する。"},{"page_url":"https://de.wikipedia.org/wiki/Beobachtungsturm_der_Grenztruppen_der_DDR","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Ddr_beobachtungsturm_9.jpg","page_title":"Beobachtungsturm der Grenztruppen der DDR","context_page_description":"Ein Beobachtungsturm oder kurz B-Turm war ein Wachturm der DDR-Grenztruppen an der Innerdeutschen Grenze und an der Ostseeküste."},{"page_url":"https://oc.wikipedia.org/wiki/Cast%C3%A8lgin%C3%A8st","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Castelginest_-_%C3%89glise_Saint-%C3%89tienne.jpg","page_title":"Castèlginèst","context_page_description":"Castèlginèst es una comuna lengadociana situada dins lo departament de la Nauta Garona e la region d'Occitània, ancianament de Miègjorn-Pirenèus."},{"page_url":"https://lt.wikipedia.org/wiki/Hogan_Lovells","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Hogan-hartson-logo.JPG","page_title":"Hogan Lovells","context_page_description":"Hogan Lovells - tarptautinis verslo teisės advokatų kontorų tinklas. Vienija per 2 500 advokatų. 40 biurų, viena iš 10 didžiausių kontorų pasaulyje. Įkurta 2010 m. gegužės mėn., kai apsijungė „Hogan & Hartson“ ir „Lovells“. Sudaro 2 LLPs, skėtinė organizacija - draugija pagal Šveicarijos teisę. Vadovai - Warren Gorrell, David Harris. Apyvarta - 1,8 mlrd. USD."},{"page_url":"https://es.wikipedia.org/wiki/Gu%C3%ADa_de_Isora","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Pascua_Florida.jpeg","page_title":"Guía de Isora","context_page_description":"Guía de Isora, también conocido simplemente como Guía, es un municipio perteneciente a la provincia de Santa Cruz de Tenerife, en la isla de Tenerife —Canarias, España—.\\nLa capital municipal está localizada en el casco urbano de Guía, situado a unos 560 msnm."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%97%D7%95%D7%99%D7%A6%D7%99_%D7%96%D7%99%D7%9E%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Taeniura_lymma2a.jpg","page_title":"מחויצי זימים","context_page_description":"מחויצי זימים היא תת-מחלקה במחלקת דגי הסחוס של יצורים ימיים. תת-מחלקה זו כוללת את דמויי כריש והבטאים. זו אחת משתי תת-מחלקות של דגי סחוס, לצד כסויי הזימים שבתוכה סדרת הכימראים.\\nלבני קבוצה זו זימים בעלי פתח חיצוני ומכאן שמם והם מכילים בין 5 ל-7 זימים. עורם דק ומחוספס, עוזר להם לנוע במהירות וגופם בעל עצמות עשויות סחוס ולא עצמות. האזור היחיד בגופם שעשוי מעצם הוא השיניים החדות.\\nאלו דגים גדולים ומרשימים בהרבה מקרים וכוללים גם את שני הדגים הגדולים בעולם: כריש לווייתני ששוקל עד 21 טון ומגיע לאורך 12.6 מטר וכריש ענק שאורכו 12 מטר ומשקלו 16 טון.\\nדגים אלה הם טורפי-על באוקיינוסים ותוקפים דגים קטנים מהם. כל בני הקבוצה הם טורפים, אוכלי נבלות או מסנני פלנקטון."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Obfelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Obfelden_Fabrikstr_6.JPG","page_title":"Liste der Kulturgüter in Obfelden","context_page_description":"Die Liste der Kulturgüter in Obfelden enthält alle Objekte in der Gemeinde Obfelden im Kanton Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://fr.wikipedia.org/wiki/Sciences_de_la_vie_et_de_la_Terre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/ADN_static.png","page_title":"Sciences de la vie et de la Terre","context_page_description":"L'expression sciences de la vie et de la Terre est utilisée dans le système éducatif français pour désigner l'enseignement ayant trait à la biologie, à la géologie et aux sujets connexes."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_(Gemeinde_Deutschlandsberg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Wand_aus_Plattengneis.JPG","page_title":"Kloster (Gemeinde Deutschlandsberg)","context_page_description":"Kloster ist ein Gebiet im Nordwesten der Stadt Deutschlandsberg in der Weststeiermark. Kloster war bis Ende 2014 eine Gemeinde mit 194 Einwohnern im Bezirk Deutschlandsberg in der Steiermark, Österreich. Im Rahmen der steiermärkischen Gemeindestrukturreform wurde Kloster 2015 mit den Gemeinden Deutschlandsberg, Bad Gams, Freiland bei Deutschlandsberg, Osterwitz und Trahütten zusammengeschlossen.\\nGrundlage dafür ist das Steiermärkische Gemeindestrukturreformgesetz – StGsrG.\\nEin Fusions- und Entwicklungsvertrag mit Deutschlandsberg und Bad Gams wurde bereits am 18. November 2013 unterzeichnet."},{"page_url":"https://en.wikipedia.org/wiki/Polistes_annularis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/RedWaspNest_cropped.jpg","page_title":"Polistes annularis","context_page_description":"Polistes annularis is a species of paper wasp found throughout the eastern half of the United States. This species of red paper wasp is known for its large size and its red-and-black coloration and is variably referred to as a ringed paper wasp or jack Spaniard wasp. It builds its nest under overhangs near bodies of water that minimize the amount of sunlight penetration. It clusters its nests together in large aggregations, and consumes nectar and other insects. Its principal predator is the ant, although birds are also known to prey on it. Unlike other wasps, P. annularis is relatively robust in winter conditions, and has also been observed to store honey in advance of hibernation. This species has also been used as a model species to demonstratr the ability to use microsatellite markers in maternity assignment of social insects."},{"page_url":"https://en.wikipedia.org/wiki/Port_Gamble,_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Port-Gamble-Water-Towers.jpg","page_title":"Port Gamble, Washington","context_page_description":"Port Gamble is an unincorporated community on the northwestern shore of the Kitsap Peninsula in Kitsap County, Washington, United States. It is also a small, eponymous bay, along which the community lies, near the entrance to Hood Canal. The unincorporated communities of Port Gamble and Little Boston, part of Kitsap County, lie on the west and the east side, respectively, of the mouth of this bay. The Port Gamble Historic District, a U.S. National Historic Landmark, covers one of the nation's best-preserved western lumber towns.\\nThe community of Port Gamble has a wide range of shops from antiques to a tea shop to an old-fashioned general store. It is a popular tourist destination, due to its location near Bremerton, Port Townsend, Bainbridge Island, and Seattle. Port Gamble is home to the grave of Gustave Englebrecht, the first U.S. Navy sailor to die in the Pacific."},{"page_url":"https://en.wikipedia.org/wiki/Indo-Aryan_migration","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/R1a_origins_%28Underhill_2010%29_and_R1a1a_oldest_expansion_and_highest_frequency_%282014%29.jpg","page_title":"Indo-Aryan migration","context_page_description":"The Indo-Aryan migrations were the migrations into the Indian subcontinent of Indo-Aryan peoples, an ethnolinguistic group that spoke Indo-Aryan languages, the predominant languages of today's North India, Pakistan, Nepal, Bangladesh, Sri Lanka and the Maldives. Indo-Aryan population movements into the region and Anatolia from Central Asia are considered to have started after 2000 BCE, as a slow diffusion after the Late Harappan period, which led to a language shift in the northern Indian subcontinent. The Iranian languages were brought into Iran by the Iranians, who were closely related to the Indo-Aryans.\\nThe Proto-Indo-Iranian culture, which gave rise to the Indo-Aryans and Iranians, developed on the Central Asian steppes north of the Caspian Sea as the Sintashta culture in present-day Russia and Kazakhstan, and developed further as the Andronovo culture, around the Aral Sea. The proto-Indo-Iranians then migrated southwards to the Bactria-Margiana Culture, from which they borrowed their distinctive religious beliefs and practices."},{"page_url":"https://ms.wikipedia.org/wiki/Aubigny-sur-N%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Aubigny_clocheton.JPG","page_title":"Aubigny-sur-Nère","context_page_description":"Aubigny-sur-Nère ialah komun di jabatan Cher di tengah Perancis."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%27%D1%8E%D1%97_%D0%9B%D0%BE%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Huey_P_Long_Bridge_Baton_Rouge_northwest_1.jpg","page_title":"Г'юї Лонг","context_page_description":"Г'юї Пірс Лонг — американський політичний діяч, сенатор від штату Луїзіана, на прізвисько «Морський цар». Радикальний демократ, губернатор Луїзіани в 1928—1932 рр., сенатор в 1932—1935. На президентських виборах 1932 р. підтримав Франкліна Делано Рузвельта, а в липні 1933 р. заявив про намір взяти учать у президентських виборах 1936 р.\\nЛонг — дуже суперечлива фігура в американській історії. Він виступав за збільшення оподаткування заможних верств і великих приватних корпорацій, за використання бюджетних коштів на будівництво доріг, мостів і розвиток системи освіти. Засуджував тогочасну політику ФРС. Автор програми «Поділимося нашим достатком». Супротивники звинувачували його в популізмі та диктаторських замашках одночасно.\\nНапередодні загибелі сенатор Лонг був надзвичайно незручним політичним супротивником для всіх потенційних учасників президентської кампанії в США 1936 р.\\nПід час керівництва Лонга, була розширена мережа освітніх закладів та лікарень, у тому числі благодійних, реалізовано масове будівництво безкоштовних шосе і мостів, що поклало кінець ізоляції сільської місцевості, задіяно систему забезпечення школярів безкоштовними підручниками.\\n8 вересня 1935 р."},{"page_url":"https://fr.wikipedia.org/wiki/Emmabunt%C3%BCs","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Emmabuntus_6_eme_Ecole_maternelle_Ile_de_France.jpg","page_title":"Emmabuntüs","context_page_description":"Emmabuntüs est une distribution Linux dérivée du système d'exploitation Ubuntu et de Debian. Elle est une des variantes d'Ubuntu construite pour reconditionner les ordinateurs personnels offerts aux Communautés Emmaüs.\\nEmmabuntüs est un mot-valise composé de Emmaüs et Ubuntu et se prononce Emma-boun-tous, comme Xubuntu se prononce Zou-boun-tou."},{"page_url":"https://es.wikipedia.org/wiki/Abraham_Attah","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Abraham_Attah_%28cropped%29.jpg","page_title":"Abraham Attah","context_page_description":"Abraham Nii Attah es un actor ghanés de residencia estadounidense.​ Proviene del grupo étnico Ga-Adangbe. Hizo su debut en el cine en la película Beasts of No Nation. Por su papel como el niño soldado Agu, Attah ganó el Premio Marcello Mastroianni en la edición No. 72 del Festival Internacional de Cine de Venecia.​\\nEn 2017 apareció en la película de Marvel Spider-Man: Homecoming.​ Se unió al reparto del tercer filme de Shane Carruth, The Modern Ocean, en etapa de preproducción.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D0%BB%D0%B5%D1%80%D1%81%D0%B3%D0%B0%D1%83%D0%B7%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/St._Peter_und_Paul_%28Unterkienberg%29.jpg","page_title":"Аллерсгаузен","context_page_description":"Аллерсгаузен — громада в Німеччині, розташована в землі Баварія. Підпорядковується адміністративному округу Верхня Баварія. Входить до складу району Фрайзінг. Центр об'єднання громад Аллерсгаузен.\\nПлоща — 26,56 км². Населення становить 5537 ос."},{"page_url":"https://la.wikipedia.org/wiki/Barium_(Italia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Izlo%C5%A1ci_zbirke_u_Bariju.jpg","page_title":"Barium (Italia)","context_page_description":"Vide etiam paginam discretivam: Barium\\nBarium est urbs et commune Italicum, circiter 321 000 incolarum, caput urbis metropolitanae Barensis in regione Apulia. Urbani Barienses et Barenses appellantur."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D8%AF%D8%A7%D8%AA%D8%B4%D9%8A%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Church_of_the_martyrs_of_Boris_and_Hlib._Zhydachiv._Lviv_region..JPG","page_title":"جيداتشيف","context_page_description":"جيداتشيف هي مدينة في مقاطعة لفيفسكا في أوكرانيا.\\nيبلغ عدد سكانها حوالي 11312 نسمة."},{"page_url":"https://en.wikipedia.org/wiki/This_Is_the_Night_(1932_film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Thelma_Todd%2C_Roland_Young%2C_Lili_Damita.jpg","page_title":"This Is the Night (1932 film)","context_page_description":"This Is the Night is a 1932 American pre-Code comedy film directed by Frank Tuttle, and starring Lili Damita, Charles Ruggles, Roland Young, Thelma Todd, and Cary Grant in his film debut. It was made by Paramount Pictures.\\nThe picture is based on the 1923 play Pouche by Henri Falk and René Peter, and the 1925 English-language adaptation Naughty Cinderella written by Avery Hopwood. The plays had already been adapted for film once before as Good and Naughty with Pola Negri.\\nNight scenes in this film were intended to be seen in blue tint. Tinting is used on the restored 2011 single DVD version released by Turner Classic Movies. However, tinting was absent from recent prints prior to restoration. The version shown on the TCM cable channel in the 1990s was not tinted, nor is the version in the 2016 DVD set \\"Cary Grant - The Vault Collection\\"."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%B2%DA%A9%D8%B1%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Mouscron%2C_Grand-Place_J5.jpg","page_title":"موزکرون","context_page_description":"شهر موزکرون در شهرستان موزکرون در استان انو در منطقه فدرال والوون در کشور بلژیک واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2008/Leichtathletik_%E2%80%93_Speerwurf_(Frauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Christina_Obergf%C3%B6ll_ISTAF_Berlin_2010.jpg","page_title":"Olympische Sommerspiele 2008/Leichtathletik – Speerwurf (Frauen)","context_page_description":"Der Speerwurf bei den Olympischen Spielen 2008 in Peking wurde am 19. und 21. August 2008 ausgetragen. 54 Athletinnen nahmen teil.\\nOlympiasiegerin wurde Barbora Špotáková aus Tschechien. Die Deutsche Christina Obergföll gewann die Silbermedaille, Bronze ging an die Britin Goldie Sayers."},{"page_url":"https://fr.wikipedia.org/wiki/Pagrus_auriga","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Pagrus_auriga_juvenile.jpg","page_title":"Pagrus auriga","context_page_description":"Pagrus auriga, le Pagre rayé, est une espèce de poissons marins de la famille des Sparidae. Il est présent sur les côtes d'Afrique de l'ouest.\\nIl s'agit d'une espèce comestible."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AF_%D8%AA%D8%A7%D9%82%D8%B3%D8%A8%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Vue_du_barrage_de_Taksebt_de_Tizi-Ouzou.JPG","page_title":"سد تاقسبت","context_page_description":"سد تاقسبت من بين أكبر السدود الهيدروليكية في الجزائر. يقع في ولاية تيزي وزو على بعد 10 كم جنوب شرق مدينة تيزي وزو و110 كم شرق الجزائر العاصمة. نشأ على وادي عيسي، أحد فروع وادي سيباو، وتقدر سعته بـ175 مليون متر مكعب.\\nيغطي سد تاقسبت مساحة لا تقل عن 550 هكتار، ويتغذى من مياه الأمطار وذوبان الثلوج التي تغطي جبال جرجرة. وهو يحتوي على محطة معالجة المياه ومحطة ضخ وأنفاق بما فيها أنابيب طولها عشرات الكيلومترات تسمح بنقل 150 مليون متر مكعب سنويا من الماء الصالح للشرب نحو العديد من المدن والقرى في كل من ولاية تيزي وزو، ولاية بومرداس، ولاية الجزائر العاصمة، ولاية المدية وولاية البليدة.\\nدشن رسميا يوم 5 يوليو/جويلية 2007. كلّف حوالي 540 مليون يورو."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%BA%D0%BE%D1%80%D0%B4%D0%B8_%D1%88%D0%B2%D0%B8%D0%B4%D0%BA%D0%BE%D1%81%D1%82%D1%96_%D0%B2_%D0%B0%D0%B2%D1%96%D0%B0%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Lockheed_SR-71_Blackbird.jpg","page_title":"Рекорди швидкості в авіації","context_page_description":"Рекорди швидкості\\nСвітовий рекорд"},{"page_url":"https://nl.wikipedia.org/wiki/Casablanca_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Casablanca%2C_Trailer_Screenshot.JPG","page_title":"Casablanca (film)","context_page_description":"Casablanca is een Amerikaanse romantische dramafilm uit 1942, geregisseerd door Michael Curtiz en met Humphrey Bogart en Ingrid Bergman in de hoofdrollen. De film is gebaseerd op het toneelstuk Everybody Comes to Rick's, geschreven door de Amerikanen Murray Burnett en Joan Alison, van wie Warner Brothers de rechten kocht.\\nHoewel het een A-film was met bekende acteurs in de hoofdrollen, had niemand verwacht dat de film een groot succes zou worden. De productie en uitgave ervan waren te gehaast om te kunnen profiteren van de publiciteit rondom Operatie Torch. Casablanca werd echter een groot succes."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%95%D7%93%D7%99_%D7%A9%D7%9E%D7%90%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%D7%9E%D7%93%D7%99%D7%A0%D7%AA_%D7%94%D7%A4%D7%9C%D7%90%D7%A4%D7%95%D7%A0%D7%99%D7%9D.jpg","page_title":"דודי שמאי","context_page_description":"דודי שמאי הוא מאייר הומוריסטן וקריקטוריסט ישראלי. לאורך השנים שימש כמאייר וכקריקטוריסט בעיתונים רבים כגון: מעריב, לאישה, חדשות, העולם הזה, מעריב לנוער ועיתון כולנו.\\nמתמחה באיורי פורטרטים ריאליסטיים ואיורי קו הומוריסטיים. בין השאר, הוא מלמד איור ילדים, נוער ומבוגרים מזה עשרות שנים, מרצה לאיור ולקריקטורה ומעביר סדנאות איור. הוא מציג את עבודותיו בתערוכות בישראל ובעולם."},{"page_url":"https://ca.wikipedia.org/wiki/Defensa_A%C3%A8ria_d%27Egipte","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/61-K_anti-aircraft_gun_at_the_Muzeum_Polskiej_Techniki_Wojskowej_in_Warsaw_%282%29.JPG","page_title":"Defensa Aèria d'Egipte","context_page_description":"Les Forces de Defensa Aèria d'Egipte o FDAE són una branca de les Forces Armades d'Egipte que s'encarrega de la defensa antiaèria. La FDAE és la responsable de protegir l'espai aeri egipci contra qualsevol atac aeri hostil. La FDAE va ser establerta d'acord amb el decret presidencial emès l'1 de febrer de 1968, que preveia l'establiment de la Força de Defensa Aèria com la 4ª branca de les forces armades egipcies, juntament amb l'Armada d'Egipte, l'Exèrcit d'Egipte i la Força Aèria d'Egipte. Anteriorment, la defensa aèria formava part de l'artilleria i estava sota el comandament operatiu de la Força Aèria.\\nEgipte té un sistema modern d'armament de defensa aèria, que es divideix entre els míssils antiaeris de llarg, mitjà i curt abast, els sistemes d'artilleria i els radars d'alerta primerenca. Els oficials són majoritàriament graduats de l'Acadèmia Egípcia de la Defensa Aèria, que es troba a Alexandria. La seu central es troba al Caire i actualment el Comandant en cap és el General de Divisió Ali Fahmi i el cap de personal de la defensa aèria és el general de divisió Darrag."},{"page_url":"https://sh.wikipedia.org/wiki/Altenkunstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Altenkunstadt_in_LIF.svg","page_title":"Altenkunstadt","context_page_description":"Altenkunštat je opština u njemačkoj saveznoj državi Bavarska. Jedno je od 11 opštinskih središta okruga Lihtenfels. Prema procjeni iz 2010. u opštini je živjelo 5.469 stanovnika. Posjeduje regionalnu šifru 9478111."},{"page_url":"https://pl.wikipedia.org/wiki/Mengjiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Demchugdongrub.jpg","page_title":"Mengjiang","context_page_description":"Mengjiang – marionetkowe państwo utworzone w 1936 r. przez Japonię na okupowanych przez nią obszarach Mongolii Wewnętrznej, w północno-wschodnich Chinach."},{"page_url":"https://sw.wikipedia.org/wiki/Pezi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Barb_gonio_080525_9610_ltn_Cf.jpg","page_title":"Pezi","context_page_description":"Mapezi ni sifa bainifu sana za mwili wa samaki. Hushirikishwa kwa miiba au tindi za mfupa zinazotokeza katika mwili na kufunikwa na kuunganishwa pamoja na ngozi, ama katika mtindo wa utando, kama inavyoonekana katika samaki wengi wenye mifupa, au sawa na kikono, kama inavyoonekana katika papa. Licha ya mkia au pezimkia, mapezi ya samaki hayana muungano wa moja kwa moja na uti wa mgongo na hutegemewa tu na misuli. Kazi yao kuu ni kusaidia samaki kuogelea. Mapezi yaliyomo katika sehemu tofauti kwenye samaki hutumikia madhumuni tofauti kama kusonga mbele, kugeuka, kukaa wima au kusimama. Takriban samaki wote hutumia mapezi wakati wa kuogelea, panzi-bahari hutumia mapeziubavu kwa kuumbia, na guguye huyatumia kwa kutembea."},{"page_url":"https://ru.wikipedia.org/wiki/266-%D0%B9_%D0%B8%D1%81%D1%82%D1%80%D0%B5%D0%B1%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B0%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D0%BA_%D0%9F%D0%92%D0%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%D0%9F%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BF%D0%BE%D0%BB%D0%B5%D1%82%D1%8B_%D0%BB%D0%B5%D1%82%D1%87%D0%B8%D0%BA%D0%BE%D0%B2_%D0%B0%D0%B2%D0%B8%D0%B0%D0%B1%D0%B0%D0%B7%D1%8B_%D0%94%D0%BE%D0%BC%D0%BD%D0%B0_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BE%D0%BA%D1%80%D1%83%D0%B3%D0%B0_%28%D0%97%D0%B0%D0%B1%D0%B0%D0%B9%D0%BA%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9%29_%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80.png","page_title":"266-й истребительный авиационный полк ПВО","context_page_description":"266-й истребительный авиационный полк ПВО — воинская часть истребительной авиации ПВО, принимавшая участие в боевых действиях Великой Отечественной войны, после распада СССР вошедшая в состав ВВС России."},{"page_url":"https://en.wikipedia.org/wiki/Ko%C5%BCuch%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Kozuchow-figury-Piotra-i-Pawla.jpg","page_title":"Kożuchów","context_page_description":"Kożuchów is a town in Lubusz Voivodeship, Poland."},{"page_url":"https://de.wikipedia.org/wiki/Monastero_di_San_Nicol%C3%B2_l%E2%80%99Arena_(Catania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Platania_Affresco_1669_%28eruzione%29.jpg","page_title":"Monastero di San Nicolò l’Arena (Catania)","context_page_description":"Das ehemalige Benediktinerkloster San Nicolò l’Arena im Westen der Altstadt von Catania gehört seit 2002 zum Unesco-Weltkulturerbe Spätbarocke Städte des Val di Noto. Es gilt als größter Klosterkomplex Siziliens mit der größten Kirche der Insel. Das Konventsgebäude beherbergt heute Teile der Universität Catania."},{"page_url":"https://pt.wikipedia.org/wiki/Niter%C3%B3i","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Contemporary_Art_Museum_in_Niteroi_City_4.jpg","page_title":"Niterói","context_page_description":"Niterói é um município da Região Metropolitana do Rio de Janeiro, no estado do Rio de Janeiro, Região Sudeste do Brasil. Foi a capital estadual, como indicado pela sua coroa mural dourada, exclusiva de capitais, entre 1834-1894 e novamente entre 1903-1975. Com população estimada em 513 584 habitantes, segundo os dados do Instituto Brasileiro de Geografia e Estatística de 2019, e uma área de 133,757 km², integra a Região Metropolitana do Rio de Janeiro e ostenta o mais elevado Índice de Desenvolvimento Humano Municipal do Rio de Janeiro e o sétimo maior entre os municípios do Brasil em 2010. Individualmente, é o segundo município com maior média de renda domiciliar per capita mensal do Brasil e aparece na 13ª posição entre os municípios do país segundo os indicadores sociais referentes à educação.\\nFoi capital estadual fluminense até a fusão entre os estados do Rio de Janeiro e da Guanabara em 1974. Distante 15 km da Cidade do Rio de Janeiro e possui como acessos a Ponte Rio–Niterói e Avenida do Contorno, ambas trechos da BR-101, a Alameda São Boaventura, trecho urbano da RJ-104, a Avenida Everton Xavier, trecho urbano da RJ-108."},{"page_url":"https://ca.wikipedia.org/wiki/Batalla_de_Lipari","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Aeolian_Islands_map.png","page_title":"Batalla de Lipari","context_page_description":"La Batalla de les Illes Lipari o Batalla de Lipari fou un enfrontament naval que tingué lloc l'any 260 aC entre l'armada romana dirigida pel cònsol Gneu Corneli Escipió Asina i la flota cartaginesa dirigida pel senador Boodes subordinat d'Anníbal Giscó, en el marc de la Primera Guerra Púnica. El resultat fou una contundent victòria cartaginesa i la captura de tota la flota romana."},{"page_url":"https://ast.wikipedia.org/wiki/Xard%C3%ADn_zool%C3%B3xicu","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Singapore_Zoo_Tigers.jpg","page_title":"Xardín zoolóxicu","context_page_description":"Un xardín zoolóxicu, parque zoolóxicu, casa de fieres, zoolóxicu o zoo, ye una instalación na que s'esiben animales dientro de les cortiles espuestes al públicu y nes que tamién pueden ser criaos.\\nEl términu xardín zoolóxicu referir a la zooloxía, l'estudiu de los animales, un términu que se deriven del griegu zωο y λóγος. Anguaño'l númberu de coleiciones d'animales abiertes al públicu en tol mundu supera los 1000, alredor del 80% d'ellos nes ciudaes."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E5%AE%A4%E6%B5%85%E9%96%93%E7%A5%9E%E7%A4%BE_(%E4%B8%8B%E6%B5%85%E9%96%93)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Fuji-omurosengen-monkey.jpg","page_title":"小室浅間神社 (下浅間)","context_page_description":"小室浅間神社は、山梨県富士吉田市にある神社。旧社格は郷社で、現在は神社本庁の別表神社。\\n全国にある浅間神社の一社。旧称冨士山下宮浅間神社。\\n「冨士山下宮小室浅間神社」とも称するほか、地元では「下宮さん」「下浅間」とも呼ばれる。"},{"page_url":"https://hu.wikipedia.org/wiki/Neobatrachia","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Lim_dumerilii_Insularis.jpg","page_title":"Neobatrachia","context_page_description":"A Neobatrachia a kétéltűek osztályába és a békák vagy farkatlan kétéltűek rendjébe tartozó alrend."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A5%CF%80%CE%BF%CF%88%CE%B7%CF%86%CE%B9%CF%8C%CF%84%CE%B7%CF%84%CE%B1_%CE%95%CE%BB%CE%BB%CE%AC%CE%B4%CE%B1%CF%82%E2%80%93%CE%A3%CE%B5%CF%81%CE%B2%CE%AF%CE%B1%CF%82%E2%80%93%CE%92%CE%BF%CF%85%CE%BB%CE%B3%CE%B1%CF%81%CE%AF%CE%B1%CF%82%E2%80%93%CE%A1%CE%BF%CF%85%CE%BC%CE%B1%CE%BD%CE%AF%CE%B1%CF%82_%CE%B3%CE%B9%CE%B1_%CF%84%CE%BF_%CE%A0%CE%B1%CE%B3%CE%BA%CF%8C%CF%83%CE%BC%CE%B9%CE%BF_%CE%9A%CF%8D%CF%80%CE%B5%CE%BB%CE%BB%CE%BF_%CE%A0%CE%BF%CE%B4%CE%BF%CF%83%CF%86%CE%B1%CE%AF%CF%81%CE%BF%CF%85_2030","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Karaiskakis_Stadium_Piraeus_Olympiacos-Arsenal.jpg","page_title":"Υποψηφιότητα Ελλάδας–Σερβίας–Βουλγαρίας–Ρουμανίας για το Παγκόσμιο Κύπελλο Ποδοσφαίρου 2030","context_page_description":"Η υποψηφιότητα Ελλάδας-Σερβίας-Βουλγαρίας-Ρουμανίας είναι κοινή υποψηφιότητα για τη διοργάνωση του Παγκόσμιου Κυπέλλου Ποδοσφαίρου 2030. Υποβλήθηκε από τέσσερις βαλκανικές χώρες, την Ελλάδα, τη Σερβία, τη Βουλγαρία και τη Ρουμανία.\\nΚατά την συνάντησή τους στις 25 Φεβρουαρίου 2019 στη Σόφια ο Υπουργός Νεολαίας και Αθλητισμού της Ρουμανίας Κονσταντίν Μπογκντάν Ματέι, ο Βουλγάρος Κράσεν Κράλεφ, ο Σέρβος Βάνια Ουντόβιτσιτς και ο Αναπληρωτής Υπουργός Πολιτισμού και Αθλητισμού της Ελλάδας, Γιώργος Βασιλειάδης επιβεβαίωσαν επισήμως ότι αυτές οι τέσσερις χώρες θα υποβάλλουν κοινή υποψηφιότητα για την οργάνωση του ευρωπαϊκού πρωταθλήματος ποδοσφαίρου 2028 και του Παγκοσμίου Κυπέλλου Ποδοσφαίρου 2030. Μετά τη δεύτερη συνάντηση στις 10 Απριλίου 2019 στη Θεσσαλονίκη, οι υπουργοί υπέγραψαν μνημόνιο κατανόησης."},{"page_url":"https://en.wikipedia.org/wiki/Reticulum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Constellation_Reticulum.jpg","page_title":"Reticulum","context_page_description":"Reticulum is a small, faint constellation in the southern sky. Its name is Latin for a small net, or reticle—a net of crosshairs at the focus of a telescope eyepiece that is used to measure star positions. The constellation is best viewed between October and December, but it cannot be seen from middle to northern latitudes."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_sat%C3%A9lites_naturais_do_Sistema_Solar","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Amalthea_Voyager-1.png","page_title":"Lista de satélites naturais do Sistema Solar","context_page_description":"Os planetas e os planetas anões oficiais do Sistema Solar são, até onde se sabe, orbitados por 214 satélites naturais ou luas. 19 satélites do Sistema Solar são grandes o suficiente para serem arredondados devido ao efeito de sua gravidade e, portanto, seriam considerados planetas ou planetas anões se estivessem em órbita direta ao redor do Sol."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%9E%D7%99%D7%93_%D7%9B%D7%95%D7%9B%D7%91%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Omid-kokabi.jpg","page_title":"אומיד כוכבי","context_page_description":"אומיד כוכבי הוא פיזיקאי ניסויי איראני באוניברסיטת טקסס באוסטין אשר נעצר באיראן כאשר חזר מארצות הברית כדי לבקר את משפחתו ב-30 בינואר 2011. תחילה הוא הואשם ב\\"איסוף מידע ושיתוף פעולה נגד הביטחון הלאומי\\", אך לאחר שזוכה מהאשמות העיקריות הוא נשפט על \\"התקשרות עם מדינה עוינת\\" ו\\"הכנסות לא חוקיות\\". על אף שהכחיש את ההאשמות נגדו, נידון כוכבי בסופו של דבר למאסר של 10 שנים.\\nבספטמבר 2013 האגודה הפיזיקאית האמריקאית הודיעה שכוכבי יחלוק את פרס אנדריי סחרוב לשנת 2014 על \\"האומץ שלו לסרב להשתמש בידע שלו בפיזיקה כדי לעבוד על פרויקטים שמסוכנים לאנושות ועל עמידתו בפני לחץ פיזי ופסיכולוגי קיצוני\\".\\nבנובמבר 2013 ארגון אמנסטי אינטרנשיונל הפיץ הודעה לעיתונות על כך שהם רואים בכוכבי כ\\"אסיר מצפוני, שנאסם אך ורק בשל סירובו לעבוד בפרויקטים צבאיים של איראן וכתוצאה מהאשמות מזויפות הקשורות לקשרי ההשכלה הלגיטימיים שלו עם מוסדות אקדמאיים מחוץ לאיראן\\". הארגון דרש את שחרורו המיידי וללא תנאי.\\nבאוקטובר 2014 האגודה האמריקאית לקידום המדע העניקה לכוכבי את אות המדע החופשי והאחראי \\"על עמידתו האמיצה ומוכנותו לשאת מאסר ולא לפגוע בהשקפה המוסרית שהמומחיות המדעית שלו לא תשמש לשימושים הרסניים ועל מאמציו לספק תקווה וחינוך לאסירים דומים\\"."},{"page_url":"https://en.wikipedia.org/wiki/Imeneo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/ONL_%281887%29_1.193_-_Interior_of_the_Duke%27s_Theatre.jpg","page_title":"Imeneo","context_page_description":"Imeneo is an opera seria in three acts by George Frideric Handel. The Italian-language libretto was adapted from Silvio Stampiglia's Imeneo. Handel had begun composition in September 1738, but did not complete the score until 1740. The opera received its first performance at the Lincoln's Inn Fields in London on 22 November 1740, and received another performance on 13 December. Handel then revised the score, and this revised version received concert performances in Dublin, on 24 and 31 March 1742."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%82%E0%B8%9B%E0%B9%8A%E0%B8%A2%E0%B9%80%E0%B8%8B%E0%B8%B5%E0%B8%A2%E0%B8%99_(%E0%B8%9E%E0%B8%B7%E0%B8%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Euphorbia_Milii_flowers.jpg","page_title":"โป๊ยเซียน (พืช)","context_page_description":"โป๊ยเซียน เป็นหนึ่งในไม้มงคล จัดอยู่ในวงศ์ Euphorbiaceae อยู่ในสกุล Euphorbia ซึ่งเป็นสกุลเดียวกับพืชหลายชนิด เช่น ต้นคริสต์มาส และส้มเช้า\\nโป๊ยเซียน มาจากภาษาจีน แปลว่าเทพยดาทั้ง 8 องค์ ได้แก่ เซียนทิก๋วยลี้ เซียนฮั่นจงหลี เซียนลือท่งปิน เซียนเจียงกั๋วเล้า เซียนหลันไฉ่เหอ เซียนฮ่อเซียนโกว เซียนหันเซียงจือ เซียนเชาก๊กกู๋ เชื่อกันว่า ถ้าบ้านใดมีดอกโป๊ยเซียนครบ 8 ดอก จะนำความโชคดีมาให้แก่บ้านของผู้นั้น"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D0%BE%D0%BA%D0%BE%D0%BC%D0%BE%D1%82%D0%B8%D0%B2%D0%BE%D0%B2_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D1%85_%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D1%8B%D1%85_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Oebb1110.jpg","page_title":"Список локомотивов Австрийских федеральных железных дорог","context_page_description":"Полный список локомотивов, эксплуатируемых или выведенных из эксплуатации Австрийских федеральных железных дорог"},{"page_url":"https://en.wikipedia.org/wiki/106th_Air_Refueling_Squadron","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/106th_Observation_Squadron_Douglas_O-38s.jpg","page_title":"106th Air Refueling Squadron","context_page_description":"The 106th Air Refueling Squadron is a unit of the Alabama Air National Guard 117th Air Refueling Wing. It is assigned to Birmingham Air National Guard Base, Alabama and is equipped with the KC-135R Stratotanker aircraft.\\nThe squadron is a descendant organization of the World War I 106th Aero Squadron, established on 27 August 1917. It was reformed on 21 January 1922. After several designation changes, it was re-designated the 106th Observation Squadron on 16 January 1924 and is one of the 29 original National Guard Observation Squadrons of the United States Army National Guard formed before World War II."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%92%D0%B0%D0%BB%D1%83%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/%D0%9F%D0%BB%D0%B0%D0%BD_%D0%92%D0%B0%D0%BB%D1%83%D0%B5%D0%BA_XVIII_%D0%B2%D0%B5%D0%BA.svg","page_title":"История Валуек","context_page_description":"История Валу́ек берёт начало с 1599 года и насчитывает более 400 лет. Этот малый российский пограничный город, который сегодня является районным центром муниципального образования в Белгородской области, был основан как крепость на Кальмиусском шляхе при впадении реки Валуй в реку Оскол и исполнял оборонительные функции. На территории, которая окружает город, люди обитали уже в эпоху палеолита, а в раннем Средневековье в поймах местных рек проживали представители салтово-маяцкой культуры. В Смутное время город подвергался захвату Лжедмитрием I; его неоднократно грабили крымские татары, а также гетман Яков Острянин во время Смоленской войны. С началом Крестьянской войны 1670—1671 годов город занял сторону правительства. В конце XVII столетия он стал отправной точкой Азовских походов, в связи с чем его посещали Пётр I, Патрик Гордон и другие военачальники того периода.\\nПосле ослабления Крымского ханства Валуйки потеряли своё оборонное значение, став к XIX веку одним из типичных уездных городов в составе Воронежской губернии. С началом Первой Русской революции политическая активность в городе возросла."},{"page_url":"https://fr.wikipedia.org/wiki/Kutn%C3%A1_Hora","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Kutna_Hora%2C_Sedlec_1.jpg","page_title":"Kutná Hora","context_page_description":"Kutná Hora est une ville de la région de Bohême centrale, en Tchéquie, et le chef-lieu du district de Kutná Hora. Sa population s'élevait à 20 653 habitants en 2020.\\nKutná Hora est célèbre en raison de ses mines d'argent d'où est sorti, au Moyen Âge, jusqu'au tiers de la production européenne ; elles ont permis de financer la construction d'églises, de monuments et de maisons magnifiques inscrites sur la liste du patrimoine mondial de l'UNESCO."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BD%E6%9C%97%E5%AF%A7%E5%A4%A7%E5%A8%81%E5%8A%9B%E5%8D%8A%E8%87%AA%E5%8B%95%E6%89%8B%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Flickr_-_~Steve_Z~_-_Hi_Power_Hi_Rez.jpg","page_title":"白朗寧大威力半自動手槍","context_page_description":"白朗寧大威力半自動手槍是一把由美國著名槍械發明家約翰·白朗寧作基礎上的設計、迪厄多內·塞弗和比利時埃斯塔勒的國營工廠改進及完成以及FN生產的單動操作式半自動手槍，發射當時歐洲威力最強大的9×19公釐口徑手槍子彈。白朗寧是在1926年開始設計，設計完成的數年前逝世。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%8E%E0%AE%95%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%87%E0%AE%B0%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AE%BE%E0%AE%AE%E0%AF%8D_%E0%AE%B5%E0%AE%AE%E0%AF%8D%E0%AE%9A%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/SecondDynastyKingLists.png","page_title":"எகிப்தின் இரண்டாம் வம்சம்","context_page_description":"பண்டைய எகிப்தின் இரண்டாம் வம்சம், பண்டைய எகிப்தை கிமு 2890 முதல் கிமு 2686 முடிய, தினீஸ் நகரத்தை தலைநகராகக் கொண்டு ஆண்டவர்கள். இவ்வம்சத்தினர் எகிப்தின் துவக்க கால அரச மரபுகளில் இரண்டாமவர் மற்றும் இறுதியானர் ஆவார். இவ்வம்சத்தவர்களில் நான்கு மன்னர்கள் எகிப்தை ஆண்டனர்."},{"page_url":"https://en.wikipedia.org/wiki/Ryman_Auditorium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Ryman_stage.jpg","page_title":"Ryman Auditorium","context_page_description":"Ryman Auditorium is a 2,362-seat live-performance venue located at 116 5th Avenue North, in Nashville, Tennessee. It is best known as the home of the Grand Ole Opry from 1943 to 1974 and is owned and operated by Ryman Hospitality Properties, Inc.\\nRyman Auditorium was included in the National Register of Historic Places in 1971 and was later designated a National Historic Landmark on June 25, 2001, for its pivotal role in the popularization of country music."},{"page_url":"https://en.wikipedia.org/wiki/Architecture_of_London","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Barkers%2C_Kensington_High_Street.jpg","page_title":"Architecture of London","context_page_description":"London is the largest and capital city of England and the United Kingdom. Founded as the ancient city of Londinium in the first century CE by the Romans as capital of the Roman province of Britannia, London has been an inhabited settlement almost continuously since. After the Roman withdrawal from Britain in the 5th century, the layout of the Roman settlement became the approximate blueprint of the Saxon and medieval city. This ancient core of London is known as the City of London with Westminster, the ancient centre of political power in London, lying to the west. Relatively few structures survive from London's medieval past due to the city's near-total destruction in the Great Fire of 1666, but notable survivors include the Tower of London, Westminster Abbey, Westminster Hall, Guildhall, St James's Palace, Lambeth Palace and a handful of scattered Tudor survivals. After the Great Fire, London was transformed as it was rebuilt and greatly modernised under the direction of the Baroque architect Sir Christopher Wren, with the new Baroque St Paul's Cathedral as its centrepiece."},{"page_url":"https://de.wikipedia.org/wiki/1772","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Friedrich_Arnold_Brockhaus_Vogel_von_Vogelstein.jpg","page_title":"1772","context_page_description":"17. Januar: Die Gattin des dänischen Königs, Caroline Mathilde, und der dänische Staatsminister Graf Johann Friedrich Struensee werden wegen Verdachts eines gegen König Christian VII. gerichteten Komplotts festgesetzt. Die Königin wird auf Schloss Kronborg verbracht, Struensee, ihr Geliebter, verhaftet. Der Minister wird am 28. April mit seinem Vertrauten Enevold von Brandt hingerichtet, die Königin verbannt."},{"page_url":"https://es.wikipedia.org/wiki/Presencio","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bandera_de_Presencio.svg","page_title":"Presencio","context_page_description":"Presencio es un municipio​ de la provincia de Burgos, situado 26 km al sur de la capital, en la carretera provincial Burgos-Roa. Posee una extensión de 35,07 km² y cuenta con unos doscientos habitantes. Pertenece al Partido Judicial de Lerma. El río que transcurre por sus pagos es el Cogollos.\\nLas localidades más cercanas son Mazuela, Ciadoncha, Revenga y Arenillas de Muñó."},{"page_url":"https://ru.wikipedia.org/wiki/PATH_(%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/PATH_afterhours.png","page_title":"PATH (транспортная система)","context_page_description":"PATH — скоростная железная дорога метрополитеновского типа, соединяющая Манхэттен с городами Хобокен, Джерси-Сити, Гаррисон и Ньюарк в штате Нью-Джерси."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9F%D1%8E%D0%B8%D0%B3%D1%83%D0%B7%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Map_commune_FR_insee_code_81218.png","page_title":"Пюигузон","context_page_description":"Пюигузон — Франциянең Тарн департаментына караган коммуна."},{"page_url":"https://nl.wikipedia.org/wiki/Wola_Rudzka","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Stary_M%C5%82yn_nad_Chodelk%C4%85_w_Woli_Rudzkiej.jpg","page_title":"Wola Rudzka","context_page_description":"Wola Rudzka is een dorp in Polen. Het bevindt zich in de gemeente Opole Lubelskie in de provincie Lublin. Wola Rudzka ligt 42 km ten zuidwesten van Lublin en 3 km ten noorden van Opole Lubelskie. Door het dorp loopt de provinciale weg Droga wojewódzka 824."},{"page_url":"https://it.wikipedia.org/wiki/Ford_Thunderbird","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/1975_Ford_Thunderbird.jpg","page_title":"Ford Thunderbird","context_page_description":"La Ford Thunderbird è un autoveicolo prodotto dalla Ford in undici versioni dal 1955 fino al 2005. L'introduzione di questo tipo di veicolo, che univa varie caratteristiche in una sola auto, andò a creare un mercato di nicchia chiamato Personal Luxury Car.\\nÈ considerata la vettura sportiva più prodotta di tutti i tempi con 4.438.106 esemplari."},{"page_url":"https://en.wikipedia.org/wiki/Philosophers_Legacy_(Heirloom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Olufeko%27s_mobile_studio_in_Silver_Spring_Maryland.png","page_title":"Philosophers Legacy (Heirloom)","context_page_description":"The Philosophers Legacy, also known as the phylosophers legacy, is an heirloom and charity work in the form of a digital painting created by Ade Olufeko, a designer known for his multidisciplinary work on African social economics. The original artwork was created in 2013. It underwent enhancements in Lagos and was reissued in 2017 as a major collaboration project piece through Oxford University's OAC. According to the Vanguard news, parts of the art piece's collaboration effort were influenced by 1985's We Are the World music project. Observations by legal experts suggest that the eventual buyer of the artwork's reissue cannot financially exploit the heirloom until the year 2033, stating that all \\"proceeds at any time from sales will remain within the African economic system\\"."},{"page_url":"https://en.wikipedia.org/wiki/Brashlyan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bulgaria-Brashlyan-04.jpg","page_title":"Brashlyan","context_page_description":"Brashlyan is a village in Malko Tarnovo Municipality, in Burgas Province, in southeastern Bulgaria.. Known as Sarmashik until 1934, today the entire village is an architectural reserve displaying characteristic Strandzha wooden architecture from the mid-17th to the 19th century.\\nBrashlyan lies in the low Strandzha mountains of Bulgaria's southeast, 14 kilometres northwest of Malko Tarnovo, 64 kilometres south of Burgas and 4 kilometres from the Bulgaria–Turkey border. The village traces its foundation to the 17th century when the residents of the Yurtet, Selishte and Zhivak neighbourhoods settled in the Lower Neighbourhood of Brashlyan. The village was mentioned in Ottoman tax registers of the mid-17th century as part of the district of Anchialos and grew into a major centre of animal husbandry by the 19th century. The old name Sarmashik was from Ottoman Turkish sarmaşık and had the same meaning, \\"ivy\\".\\nThe Sarmashik Affair, a predecessor of the Ilinden-Preobrazhenie Uprising, took place in Brashlyan in 1903."},{"page_url":"https://ceb.wikipedia.org/wiki/Geonoma_pauciflora","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Geonoma_pauciflora_Mart._%288367310063%29.jpg","page_title":"Geonoma pauciflora","context_page_description":"Espesye sa tanom nga bulí ang Geonoma pauciflora. Una ning gihulagway ni Carl Friedrich Philipp von Martius. Ang Geonoma pauciflora sakop sa kahenera nga Geonoma sa kabanay nga Arecaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Skyros","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Skyros%2C_Greece.jpg","page_title":"Skyros","context_page_description":"Skyros is an island in Greece, the southernmost of the Sporades, an archipelago in the Aegean Sea. Around the 2nd millennium BC and slightly later, the island was known as The Island of the Magnetes where the Magnetes used to live and later Pelasgia and Dolopia and later Skyros. At 209 square kilometres it is the largest island of the Sporades, and has a population of about 3,000. It is part of the regional unit of Euboea.\\nThe Hellenic Air Force has a major base in Skyros, because of the island's strategic location in the middle of the Aegean."},{"page_url":"https://sk.wikipedia.org/wiki/Castillon_(Canton_de_Lembeye)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Map_commune_FR_insee_code_64182.png","page_title":"Castillon (Canton de Lembeye)","context_page_description":"Castillon (Canton de Lembeye) je francúzska obec, ktorá sa nachádza v departemente Pyrénées-Atlantiques, v regióne Akvitánsko."},{"page_url":"https://en.wikipedia.org/wiki/Glen_Cove,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Old_Glen_Cove_NY_Post_Office.JPG","page_title":"Glen Cove, New York","context_page_description":"Glen Cove is a city in Nassau County, New York, United States, on the North Shore of Long Island. As of the United States 2010 Census, the city population was 26,964.\\nThe city was considered part of the early 20th century Gold Coast of the North Shore, as the areas along the waterfront were developed as large country estates by wealthy entrepreneurs and businessmen such as J.P. Morgan, Phipps, Pratt, and Prybil. Glen Cove also had manufacturing and a diverse population that worked in industry, local agriculture and retail businesses. Of Nassau County's five municipalities, Glen Cove is one of the two municipalities that is a city, rather than a town, the other being Long Beach on the South Shore.\\nThe city was the location of several successful manufacturing facilities in the 20th century. It attracted numerous immigrants from Ireland, Italy, and eastern Europe. More recently, it has been settled by immigrants of later migrations, from Central and South America, and Asia."},{"page_url":"https://pl.wikipedia.org/wiki/Dupont_(Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Dupont%2C_Indiana.jpg","page_title":"Dupont (Indiana)","context_page_description":"Dupont – miasto w Stanach Zjednoczonych, w stanie Indiana, w hrabstwie Jefferson."},{"page_url":"https://es.wikipedia.org/wiki/Hozier_(%C3%A1lbum)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Jasonaldean.jpg","page_title":"Hozier (álbum)","context_page_description":"Hozier es el primer álbum de estudio del cantante irlandés Hozier, publicado el 16 de septiembre de 2014 por la compañía discográfica Rubywork Records.​ Hozier escribió todas las canciones del álbum, mientras que la producción estuvo a cargo de Rob Kirwan y este.​​ El álbum incluye géneros como el blues, soul, R&B, folk rock e indie rock.​\\nSegún Metacritic, el álbum tuvo una recepción favorable por parte de los críticos de música profesionales, y obtuvo 79 puntos sobre 100 sobre la base de diez críticas.​ Algunos críticos hallaron similitud en este trabajo, con las obras del irlandés Van Morrison, ​ mientras que otros alaban la mezcla de géneros presentes en el álbum.​ Desde el punto de vista comercial, en los Estados Unidos debutó en la posición dos, de la lista Billboard 200 y llegó a los diez primeros puestos en Australia, Canadá, Escocia, Irlanda, Italia, Nueva Zelanda, Países Bajos, Suecia, entre otros.​​​​​​​​ Además fue certificado con disco de oro por la Recording Industry Association of America, por más de quinientas mil copias vendidas en ese territorio, ​ así como seis discos de platino por la Irish Recorded Music Association, por noventa mil copias.​"},{"page_url":"https://hu.wikipedia.org/wiki/John_Petrucci","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/G3_-_Joe_Satriani%2C_Steve_Vai_%26_John_Petrucci.jpg","page_title":"John Petrucci","context_page_description":"John Peter Petrucci amerikai gitáros, dalszerző, aki főként a Dream Theater progresszív metalzenekar alapító tagjaként ismert. Nemcsak az együttes egyik fő dalszerzője, de ő írja a zenekar dalszövegeinek nagy részét is, valamint az 1999-es Metropolis Pt. 2: Scenes from a Memory album óta pedig producere is a zenekarnak.\\nA Dream Theater mellett számtalan projektben megfordult már, közülük a Liquid Tension Experiment az egyik legismertebb, de többször is színpadra lépett a G3 keretein belül is. A G3-ba hatszor hívták meg, többször mint bármely más gitárost. Emellett több projektben is részt vett, de 2005-ben egy instrumentális albumot is megjelentetett Suspended Animation címmel.\\nAz utóbbi 25 év egyik legelismertebb és legnépszerűbb metalgitárosa, aki több zenei stílusban is otthonosan mozog. Joel McIver 2009-ben megjelent The 100 Greatest Metal Guitarists című könyve alapján John Petrucci lett minden idők 2. legjobb metalgitárosa. Emellett szerepelt a GuitarOne magazin Top 10 Greatest Guitar Shredders of All Time listáján is."},{"page_url":"https://de.wikipedia.org/wiki/1589","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Ortelius_-_Maris_Pacifici_1589.jpg","page_title":"1589","context_page_description":"30. April: König Heinrich III. und sein Schwager, der Hugenottenführer Heinrich von Navarra besiegeln nach längeren vorausgegangenen Verhandlungen unter dem Applaus des kriegsmüden Volkes ihre Versöhnung durch eine Begegnung im Park von Schloss Plessis-lès-Tours.\\n1. August: Der Dominikaner Jacques Clément sticht mit einem Messer auf den französischen König Heinrich III. ein. Der Attentäter wird von den herbeieilenden Wachen umgebracht, der König ringt mit dem Tod.\\n2. August: Frankreichs König Heinrich III. stirbt an den am Tag zuvor erlittenen Attentatsverletzungen. Damit endet die Dynastie Valois, die Bourbonen kommen mit Heinrich von Navarra im folgenden Jahr an die Macht.\\n5. August: Der Führer der Katholischen Liga, Charles II. de Lorraine, duc de Mayenne, proklamiert Charles de Bourbon unter dem Namen Karl X. zum neuen französischen König, um zu verhindern, dass dessen hugenottischer Neffe Heinrich von Navarra den Thron besteigt."},{"page_url":"https://fr.wikipedia.org/wiki/Meguro","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Daienji_03.jpg","page_title":"Meguro","context_page_description":"Meguro est un des 23 arrondissements spéciaux formant Tokyo, au Japon. L'arrondissement a été fondé le 15 mars 1947. La population de l'arrondissement est de 248 125 habitants pour une superficie de 14,70 km²."},{"page_url":"https://eo.wikipedia.org/wiki/Listo_de_papoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Clemens_XIV.PNG","page_title":"Listo de papoj","context_page_description":"Listo de papoj\\nNoto: antaŭ Sankta Viktoro la 1-a, datoj povas erari je unu jaro.\\nKontraŭpapoj ne estas indikataj. St. = sankta"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Wayne_County,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Beechwood_%28Isaac_Kinsey_House%29.jpg","page_title":"National Register of Historic Places listings in Wayne County, Indiana","context_page_description":"This is a list of the National Register of Historic Places listings in Wayne County, Indiana.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Wayne County, Indiana, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 39 properties and districts listed on the National Register in the county, including 1 National Historic Landmark. Another 2 properties were once listed but have been removed.\\nProperties and districts located in incorporated areas display the name of the municipality, while properties and districts in unincorporated areas display the name of their civil township. Properties and districts split between multiple jurisdictions display the names of all jurisdictions.\\nThis National Park Service list is complete through NPS recent listings posted August 23, 2019."},{"page_url":"https://br.wikipedia.org/wiki/Kernouez","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Monument_aux_morts_-_Kernou%C3%A9s-29.jpg","page_title":"Kernouez","context_page_description":"Kernouez a zo ur gumun eus Bro-Leon e kanton Lesneven, e departamant Penn-ar-Bed, e gwalarn Breizh."},{"page_url":"https://pt.wikipedia.org/wiki/Westland_Lynx","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/British_Lynx_landing_on_Kearsarge.jpg","page_title":"Westland Lynx","context_page_description":"O Westland Lynx é um helicóptero construído pela fábrica britânica GKN Westland Aircraft, na sua fábrica de Yeovil. O seu primeiro voo data de 21 de Março de 1971 como Westland WG.31. Inicialmente projectado para uso utilitário para fins quer civis quer militares, o interesse militar nesta máquina provocou o desenvolvimento da versão de Marinha e Exército, que estaria operacional em 1977, sendo posteriormente adotada por várias forças armadas pelo mundo.\\nSabe-se que a construtora francesa Aérospatiale foi licenciada para a produção de algumas unidades, para permanecerem no país.\\nEste helicóptero quebrou o recorde mundial no alcance de 15 e 25 km, voando a 321.74 km/h. Mais tarde estabeleceria novo recorde de 100 km em circuito-fechado, voando a uma velocidade de 400.87 km/h."},{"page_url":"https://en.wikipedia.org/wiki/Mbulu_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Manyara-Mbulu.svg","page_title":"Mbulu District","context_page_description":"Mbulu District is one of the six districts of the Manyara Region of Tanzania. It is bordered to the north by the Arusha Region and Lake Eyasi, to the east by the Babati Rural District, to the south by the Hanang District, and to the west by the Singida Region.\\nAccording to the 2002 Tanzania National Census, Mbulu District had a population of 237,882 inhabitants. According to the 2012 Tanzania National Census, the population of Mbulu District was 320,279.\\nThe District Commissioner is Chelestino Mofugo. Mbulu District is, since the 2015 general election, divided into two election counties: Mbulu Mjini and Mbulu Vijijini.\\nThe 2015-2020 members of parliaments are Zacharias Isaay and Flatei Massay, for Mbulu Mjini and Mbulu Vijijini respectively.\\nThe District is inhabited by people of different ethnic affiliations, especially the Iraqw people who are some of the earliest agro-pastoralists to migrate to what is now the Republic of Tanzania. Other native tribes are the Wahatzabeti living in Yaeda Chini, living a primitive life, and the Datooga people living in Mbulu Vijijini. People engage mainly in agriculture, keeping livestock and farming activities."},{"page_url":"https://en.wikipedia.org/wiki/List_of_museums_in_Montevideo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Museo_Gurvich.jpg","page_title":"List of museums in Montevideo","context_page_description":"This is a list of any museum and art gallery in Montevideo, Uruguay."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B5%82%E0%B4%B3%E0%B5%BB_%E0%B4%8E%E0%B4%B0%E0%B4%A3%E0%B5%8D%E0%B4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Lesser_Whistling_Duck_I_Picture_321.jpg","page_title":"ചൂളൻ എരണ്ട","context_page_description":"തെക്ക്-തെക്കുകിഴക്കൻ ഏഷ്യയിൽ കണ്ടുവരുന്ന ഒരു പക്ഷിയാണു് ചൂളൻ എരണ്ട. ഇവയുടെ ശാസ്ത്രീയ നാമം: Dendrocygna javanica എന്നാണ്. ഇംഗ്ലീഷിൽ ഈ പക്ഷിയെ Indian Whistling Duck അല്ലെങ്കിൽ Lesser Whistling Duck എന്നു പറയുന്നു. ഇവ തെക്കേ ഏഷ്യയിലും തെക്കുകിഴക്കൻ ഏഷ്യയിലും പ്രജനനം നടത്തുന്നു."},{"page_url":"https://ro.wikipedia.org/wiki/Atlanta","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Seal_of_Atlanta.png","page_title":"Atlanta","context_page_description":"Atlanta este capitala și cel mai populat oraș al statului american Georgia, respectiv centrul urban al celei de-a noua aglomerări urbane din Statele Unite ale Americii.\\nAtlanta este, de asemenea, sediul comitatului Fulton, deși porțiuni din oraș se extind și în comitatele înconjurătoare Clayton și DeKalb. Conform datelor estimative din iulie 2006, furnizate de Biroul de recensăminte al Statelor Unite, orașul Atlanta avea o populație de 486.411 locuitori, în timp ce populația zonei metropolitane era de 5.138.223 de locuitori, ocupând locul nouă în națiune. Locuitorii orașului sunt cunoscuți sub numele de Atlantans."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Mexican_Americans","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Cavazos_GeneralRichard_USArmy.jpg","page_title":"List of Mexican Americans","context_page_description":"Mexican Americans are residents of the United States who have Mexican ancestry. The list includes Mexican immigrants and those who lived in the southwestern United States when the territory was incorporated in 1848."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Kane","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Kane_Lodge.jpg","page_title":"Paul Kane","context_page_description":"Paul Kane was an Irish-born Canadian painter, famous for his paintings of First Nations peoples in the Canadian West and other Native Americans in the Columbia District.\\nA largely self-educated artist, Paul Kane grew up in York, Upper Canada and trained himself by copying European masters on a \\"Grand Tour\\" study trip through Europe. He undertook two voyages through the Canadian northwest in 1845 and from 1846 to 1848. The first trip took him from Toronto to Sault Ste. Marie and back. Having secured the support of the Hudson's Bay Company, he set out on a second, much longer voyage from Toronto across the Rocky Mountains to Fort Vancouver and Fort Victoria.\\nOn both trips Kane sketched and painted First Nations and Métis peoples. Upon his return to Toronto, he produced more than one hundred oil paintings from these sketches. The oil paintings he completed in his studio are considered a part of the Canadian heritage, although he often embellished them considerably, departing from the accuracy of his field sketches in favour of more dramatic scenes. Kane's work followed the tenets of salvage ethnography."},{"page_url":"https://sv.wikipedia.org/wiki/Henrik_Grosch","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/HenrikAugustGrosch.JPG","page_title":"Henrik Grosch","context_page_description":"Henrik August Grosch, född den 21 juli 1848 i Kristiania, död den 11 februari 1929, var en norsk museiman. Han var brorson till Christian H. Grosch.\\nGrosch blev juris kandidat 1871 och anställdes vid Justitiedepartementet 1873, men blev 1886 tjänstledig för att helt kunna ägna sig åt Kristiania konstindustrimuseum.\\nHan hade varit med om att starta det 1876 och var fram till 1919 dess konservator och direktör. Under hans ledning blev det ett av de mest betydande museerna i sin art i Norden.\\nGrosch hade stort inflytande på norsk konsthantverk. Han gav bland annat ut planschverken Gamle norske tæpper, Gamle norske billedtæpper, Gammel norsk vævkunst."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D0%B6%D0%B0%D0%BC%D0%B5%D0%BD_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/BenjaminConstant.jpg","page_title":"Бенжамен Констан","context_page_description":"Анрі́-Бенжаме́н Конста́н де Ребе́к, фр. Henri-Benjamin Constant de Rebecque — франкошвейцарський та французький письменник, публіцист, політичний діяч часів Французької революції, бонапартизму Реставрації."},{"page_url":"https://cs.wikipedia.org/wiki/G%C3%B6taland","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Map_swedish_lands.png","page_title":"Götaland","context_page_description":"Götaland je historické území Švédska rozkládající se v jeho jižní části. Na severu hraničí se Svealandem.\\nProvincie Småland je pokryta hustými lesy. V nejjižnější části, Skåne, se nachází řada zemědělských statků. Obojí, tedy lesy i hospodářství, je zastoupeno ve Västergötlandu i Östergötlandu. Pobřeží je relativně ploché s písečními plážemi a mnoha malými ostrovy.\\nGötaland v současnosti není oficiální správní jednotkou. Jako historické území však v sobě zahrnuje celkem 10 provincií:\\nBlekinge\\nBohuslän\\nDalsland\\nGotland\\nHalland\\nSkåne\\nSmåland\\nVästergötland\\nÖland\\nÖstergötland"},{"page_url":"https://pl.wikipedia.org/wiki/Riecznoj_wokza%C5%82_(stacja_metra_w_Nowosybirsku)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Rechnoy_vokzal_%28Novosibirsk%29.jpg","page_title":"Riecznoj wokzał (stacja metra w Nowosybirsku)","context_page_description":"Riecznoj wokzał – jedna ze stacji linii Leninskiej, znajdującego się w Nowosybirsku systemu metra."},{"page_url":"https://en.wikipedia.org/wiki/Frazier_History_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/TSC_medieval_glaiveman.jpg","page_title":"Frazier History Museum","context_page_description":"The Frazier History Museum, previously known as the Frazier Historical Arms Museum and the Frazier International History Museum, is a history museum located on Museum Row in the West Main District of downtown Louisville, Kentucky. An affiliate of the Smithsonian Institution, the Frazier documents and reinterprets stories from history using artifacts, gallery talks, and live interpretations that are written and performed in costume by a staff of teaching artists.\\nFounded in 2004 as a museum of historical arms and armor, the Frazier has since expanded its focus to cover regional, national, and international history. The museum is home to one of the largest collections of toy soldiers and historic miniatures on permanent public display in the world, The Stewart Collection. Subjects of other permanent exhibitions include historic arms, bourbon whiskey, and the Lewis and Clark Expedition.\\nIn 2018, the Frazier became the official starting point of the Kentucky Bourbon Trail."},{"page_url":"https://sv.wikipedia.org/wiki/Varnums_f%C3%B6rsamling,_Karlstads_stift","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%C3%96sterviks_kapell.JPG","page_title":"Varnums församling, Karlstads stift","context_page_description":"Varnums församling var en församling i Karlstads stift i Värmlands län. Församlingen uppgick 1960 i Kristinehamns församling."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%86%D8%B7%D9%82%D9%87_%D8%B7%D8%A8%DB%8C%D8%B9%DB%8C_%D8%AD%D9%81%D8%A7%D8%B8%D8%AA_%D8%B4%D8%AF%D9%87_%DA%A9%D9%88%D9%87_%D9%86%DB%8C%D9%85%D8%A8%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/On_the_top_of_Nimba_Range.jpg","page_title":"منطقه طبیعی حفاظت شده کوه نیمبا","context_page_description":"منطقه طبیعی حفاظت شده کوه نیمبا نام منطقه‌ای حفاظت شده و میراث جهانی یونسکو در کشورهای گینه و ساحل عاج است. این منطقه ۱۷۵۴۰ هکتار وسعت دارد که ۱۲۵۴۰ هکتار آن در گینه و ۵۰۰۰ هکتار آن در ساحل عاج واقع شده است."},{"page_url":"https://ca.wikipedia.org/wiki/Topon%C3%ADmia_del_Pa%C3%ADs_Valenci%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Llibre-dels-Feyts-CXXv.jpg","page_title":"Toponímia del País Valencià","context_page_description":"El poblament del País Valencià té una gran antiguitat, havent-se trobat restes d'homo sapiens de fa al voltant de 40.000 anys, tot i que les referències escrites als primers noms de la zona els tenim en escrits de grecs, fenicis i cartaginesos i, especialment, de romans, l'aportació dels quals pel que fa als noms de llocs va esdevenir predominant fins a l'arribada dels àrabs, que va comportar un important poblament berber.\\nEntre els topònims que perviuen al País Valencià, se n'ha documentat d’origen preromà, llatí, àrab, berber, català i castellà. D'entre els noms de municipi, vora un terç són llatins i un altre terç, àrabs o berbers; la resta són catalans o castellans."},{"page_url":"https://es.wikipedia.org/wiki/Carne","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/London_-_Smithfield_Market_-_3751.jpg","page_title":"Carne","context_page_description":"La carne es el tejido animal, principalmente muscular, que se consume como alimento.​Se trata de una clasificación coloquial y comercial que solo se aplica a animales terrestres —normalmente vertebrados: mamíferos, aves y reptiles—, pues, a pesar de que podría aplicarse a los animales marinos, estos entran en otra categoría, la de pescado, especialmente los peces —los crustáceos, moluscos y otros grupos suelen recibir el nombre de marisco—. Más allá de su clasificación biológica, otros animales, como los mamíferos marinos, se han considerado a veces carne y a veces pescado. En algunas regiones, la carne humana también puede adquirir esta denominación.\\nDesde el punto de vista nutricional, la carne es una fuente habitual de proteínas, grasas y minerales en la dieta humana. De todos los alimentos que se obtienen de los animales y plantas, la carne es el que mayores valoraciones y apreciaciones alcanza en los mercados y, paradójicamente, también es uno de los alimentos más evitados y que más polémicas suscita.​ Los animales que se alimentan exclusivamente de carne se llaman carnívoros, mientras que aquellos que se alimentan solamente de plantas, herbívoros."},{"page_url":"https://pl.wikipedia.org/wiki/Vero_Beach","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Humiston_Beach-Vero_Beach.JPG","page_title":"Vero Beach","context_page_description":"Vero Beach – miasto w Stanach Zjednoczonych, w stanie Floryda, siedziba administracyjna hrabstwa Indian River."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%88%D8%B4%D9%8A%D9%81%D8%A7%D8%AA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Don_Zon_kula.jpg","page_title":"كروشيفاتس","context_page_description":"كروسيفاتش هي مدينة وبلدية في وسط صربيا عدد سكانها 128,752 نسمة وفقا لتعداد عام 2011م، وهي المركز الإداري لمقاطعة \\"راسينياط. كانت ومازالت تُعرف باسم \\"ألاجه حصار\\" ‏ خلال الحكم العثماني الذي امتد من عام 1427م إلى 1833م واسمياً حتى 1867م، وكان اسم المقاطعة: \\"سنجق ألاجه حصار\\"."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_im_Landkreis_Nordwestmecklenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Rathaus_Gadebusch.jpg","page_title":"Liste der Baudenkmale im Landkreis Nordwestmecklenburg","context_page_description":"Diese Liste enthält die Baudenkmale im Landkreis Nordwestmecklenburg. Grundlage ist die Denkmalliste des Landkreises Nordwestmecklenburg. Die Angaben in den einzelnen Listen ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Karlskrona_naval_base","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Admiralstorn_karlskrona_v%C3%A4st.jpg","page_title":"Karlskrona naval base","context_page_description":"The Karlskrona naval base is the largest naval base of the Swedish Navy. Located in Blekinge in southern Sweden, the base has close ties with the city of Karlskrona. It has an exceptionally well-sheltered location: arcs of islands provide a strong defense not only from the sea but also from land attacks. Two of Sweden's three naval warfare flotillas are based there. It contains the Marinmuseum and the Ropewalk, the longest wooden building in the country."},{"page_url":"https://en.wikipedia.org/wiki/Cruiser_tank","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/IWM-E-17616-Crusader-19421002.jpg","page_title":"Cruiser tank","context_page_description":"The cruiser tank was a British tank concept of the interwar period for tanks designed as modernised armoured and mechanised cavalry, as distinguished from infantry tanks. Cruiser tanks were developed after medium tank designs of the 1930s failed to satisfy the Royal Armoured Corps. The cruiser tank concept was conceived by Giffard Le Quesne Martel, who preferred many small light tanks to swarm an opponent, instead of a few expensive and unsatisfactory medium tanks. \\"Light\\" cruiser tanks carried less armour and were correspondingly faster, whilst \\"heavy\\" cruiser tanks had more armour and were slightly slower.\\nThe British cruiser tank series started in 1938 with the A9 and A10 cruiser tanks, followed by the A13, A13 Mark II, the A13 Mark III Covenanter in 1940 and the A15 Crusader which entered service in 1941. The Crusader was superseded by the A27 Cromwell in 1944. The A34 Comet, a better-armed development of Cromwell, began to enter service in late 1944. The Centurion tank of 1946 became the \\"Universal tank\\" of the United Kingdom, transcending the cruiser and infantry tank roles and becoming one of the first main battle tanks."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%8F%D0%B4%D0%BE%D0%BA_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%B8%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Imperial_Arms_of_the_Crown_Prince_of_Iran.svg","page_title":"Порядок наследования иранского престола","context_page_description":"Иранская монархия была ликвидирована во время Исламской революции в 1979 году. Последний иранский шах Мохаммед Реза Пехлеви, правивший в 1941—1979 годах, вынужден был эмигрировать."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD,_%D0%A5%D0%B0%D0%B9%D0%BC%D0%B5_%D0%9B%D0%B0%D1%87%D0%B8%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Cardinal_Jaime_Sin_in_1988.jpg","page_title":"Син, Хайме Лачика","context_page_description":"Хайме Лачика Син — филиппинский кардинал. Титулярный епископ Оббы и вспомогательный епископ Харо с 10 февраля 1967 по 20 июня 1970. Апостольский администратор sede plena Харо с 20 июня 1970 по 15 января 1972. Титулярный архиепископ Масса Любрензе и коадъютор с правом наследования архиепархии Харо с 15 января по 8 октября 1972. Архиепископ Харо с 8 октября 1972 по 21 января 1974. Архиепископ Манилы с 21 января 1974 по 15 сентября 2003. Апостольский администратор Манилы по 15 сентября по 21 ноября 2003. Кардинал-священник с титулом церкви Санта-Мария-деи-Монти с 24 мая 1976.\\nС 1976 года по 1981 год был председателем Конференции католических епископов Филиппин.\\nСкончался 21 июня 2005 года. Похоронен в крипте кафедрального собора Манилы."},{"page_url":"https://cs.wikipedia.org/wiki/Chemick%C3%A1_zbra%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Chemical_agent_protection.jpg","page_title":"Chemická zbraň","context_page_description":"Chemická zbraň je zbraň, která objekt útoku zasáhne anorganickými či organickými sloučeninami, jež působí na organismus dráždivě nebo toxicky. Mechanismus působení je různý – od cíleného poškozování určitých částí těla až po působení systémové.\\nChemické zbraně jsou velice účinné při použití proti nechráněné živé síle vojsk nebo při zneužití proti civilnímu obyvatelstvu. Výroba je relativně levná, některé potenciální otravné látky se používají v průmyslu jako suroviny ve velkém. Z toho vyplývá vysoká nebezpečnost těchto látek při havárii zařízení či cíleném útoku na ně. Otravné látky se mohou vyskytovat ve skupenství pevném, kapalném i plynném."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%A9zenac","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/B%C3%A9zenac_-_Eglise_-01.JPG","page_title":"Bézenac","context_page_description":"Bézenac ist ein Ort und eine Commune déléguée südwestfranzösische Gemeinde Castels et Bézenac mit zuletzt 155 Einwohnern in der alten Kulturregion des Périgord im Département Dordogne in der Region Nouvelle-Aquitaine."},{"page_url":"https://hu.wikipedia.org/wiki/Bouglainval","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Population_-_Municipality_code_28052.svg","page_title":"Bouglainval","context_page_description":"Bouglainval település Franciaországban, Eure-et-Loir megyében. Bouglainval Tremblay-les-Villages községekkel határos."},{"page_url":"https://hr.wikipedia.org/wiki/Patrick_Stump","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Patrick_Stump_Infinity.jpg","page_title":"Patrick Stump","context_page_description":"Patrick Martin Vaughn Stumph, izvođačko ime Patrick Vaughn Stump američki je glazbenik, glazbeni producent, skladatelj, glumac i glazbeni kritičar, najpoznatiji kao vodeći pjevač, gitarist te skladatelj američkog rock sastava Fall Out Boya. Iako je izvorno svirao bubnjeve, igrom slučaja je postao pjevač nakon što je otkriven njegov veliki talent za pjevanje. Prema uglednom američkom tjedniku Billboardu Stump je jedan od najboljih vokala pop punka. 2001. godine pridružio se Fall Out Boyu, kada se prijavio na audiciju za bubnjara, ali je spletom okolnosti postao glavni pjevač. Sa sastavom je postigao veliki uspjeh. Ubrzo nakon izdavanja prvog albuma Take This To Your Grave sastav je dobio na popularnosti, a nekoliko singlova dospjelo je u top 10 Billboardove liste Hot 100. Njihov album iz 2007. Infinity On High kojeg publika i većina kritičara smatra njihovim najboljim albumom zasjeo je na prvo mjesto Billboardove liste 200. Stump je tijekom svoje karijere surađivao s velikim brojem izvođača, nekima je čak i producirao albume. Krajem 2009. Fall Out Boy su najavili stanku, nakon koje je Stump odlučio poraditi na samostalnoj karijeri."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%BF%D5%B8%D6%80%D5%B8_(%D5%B4%D5%A5%D5%BF%D6%80%D5%B8%D5%B5%D5%AB_%D5%AF%D5%A1%D5%B5%D5%A1%D6%80%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/T1300_Oslo_sporveier_Storo_stasjon_%28110723%29.jpg","page_title":"Ստորո (մետրոյի կայարան)","context_page_description":"Ստորո, Օսլոյի մետրոպոլիտենի կայարան, որը հանդիսանում է մի քանի մետրոյի 3 գծերի կապող օղակ, ինչպես նաև տրամվայի ու ավտոբուսային հանգույց: Գտնվում է Օսլոյի Նուդրե Ակեր շրջանի Ստորո միկրոշրջանում: Միկրոշրջանը իրենից ներկայացնում է բնակելի և արտադրական թաղամաս:\\nՍտորո կայարանը տեղակայված է «Օղակաձև գծի» վրա՝ միացնելով թիվ 3, 4 և 6 գծերը: Թիվ 3-ը գծի վերջին կայարանն է: Գտնվում է «Նյուդալեն» և «Ստորտինգ» կայարանների միջև՝ համապատասխանաբար 15 և 11 րոպե ժամային հեռավորության վրա։\\n«Ստորո» կայարանը հանդիսանում է նաև տրամվայի թիվ 11, 12 և 13, ինչպես նաև մի շարք ավտոբուսների կանգառ: Գրեֆսեն երկաթուղային կայարանից ոտքով հեշտությամբ կարելի է հասնել Ստորո։"},{"page_url":"https://en.wikipedia.org/wiki/Tomasz_Sta%C5%84ko","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Tomasz_Stanko_Blue.jpg","page_title":"Tomasz Stańko","context_page_description":"Tomasz Ludwik Stańko was a Polish trumpeter and composer. Stańko is associated with free jazz and the avant-garde.\\nIn 1962, Tomasz Stańko formed his first band, the Jazz Darings, with saxophonist Janusz Muniak, pianist Adam Makowicz, bassist Jacek Ostaszewski, drummer Wiktor Perelmuter. Inspired by early Ornette Coleman and the innovations of John Coltrane, Miles Davis and George Russell, the group is often cited by music historians as the first European group to play free jazz. In his later years he collaborated with pianist Krzysztof Komeda on Komeda's album Astigmatic, recorded in late 1965. In 1968, Stańko formed a quintet whose members included Janusz Muniak - tenor and soprano saxes, flute, Zbigniew Seifert - alto sax and violin, Bronisław Suchanek - bass, Janusz Stefański - drums, percussion. In 1975, he formed the Tomasz Stańko-Adam Makowicz Unit.\\nStańko established a reputation as a leading figure not only in Polish jazz, but on the world stage as well, working with many notable musicians, including Jack DeJohnette, Dave Holland, Reggie Workman, Rufus Reid, Lester Bowie, David Murray, Manu Katché and Chico Freeman. From 1984 he was a member of Cecil Taylor's big band."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%8C%EB%8D%B0%EC%98%99%EC%8A%A4%ED%82%A4%EC%84%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/NEWSIB2Fadd.png","page_title":"파데옙스키섬","context_page_description":"파데옙스키섬은 북극 바다의 섬이다. 뉴 노보시비르스크 제도 군도에 있고 러시아 사하 공화국의 행정 관할 구역에 있으며, 면적은 1,000 km²이다."},{"page_url":"https://en.wikipedia.org/wiki/Khmer_Empire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Cambodia-buddha-11thcentury-fix2.jpg","page_title":"Khmer Empire","context_page_description":"The Khmer Empire, also known as the Angkor Empire, the predecessor state to modern Cambodia, was a Hindu-Buddhist empire in Southeast Asia. The empire, which grew out of the former kingdoms of Funan and Chenla, at times ruled over and/or vassalised most of mainland Southeast Asia and parts of Southern China, stretching from the tip of the Indochinese Peninsula northward to modern Yunnan province, China, and from Vietnam westward to Myanmar.\\nIts greatest legacy is Angkor, in present-day Cambodia, which was the site of the capital city during the empire's zenith. The majestic monuments of Angkor, such as Angkor Wat and Bayon, bear testimony to the Khmer Empire's immense power and wealth, impressive art and culture, architectural technique, aesthetics achievements, and the variety of belief systems that it patronised over time. Satellite imaging has revealed that Angkor, during its peak in the 11th to 13th centuries, was the largest pre-industrial urban centre in the world.\\nThe beginning of the era of the Khmer Empire is conventionally dated to 802 when King Jayavarman II declared himself chakravartin on Phnom Kulen. The empire ended with the fall of Angkor in the 15th century."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D0%BC_%D0%94%D0%B0%D1%80%D0%B1%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Kim_Darby_1974.JPG","page_title":"Ким Дарби","context_page_description":"Ким Дарби — американская актриса, номинант на премии «Эмми», «Золотой глобус» и BAFTA."},{"page_url":"https://sv.wikipedia.org/wiki/La_Cellette,_Creuse","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Map_commune_FR_insee_code_23041.png","page_title":"La Cellette, Creuse","context_page_description":"La Cellette är en kommun i departementet Creuse i regionen Nouvelle-Aquitaine i de centrala delarna av Frankrike. Kommunen ligger i kantonen Châtelus-Malvaleix som tillhör arrondissementet Guéret. År 2009 hade La Cellette 269 invånare."},{"page_url":"https://sk.wikipedia.org/wiki/Chef-du-Pont","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Map_commune_FR_insee_code_50127.png","page_title":"Chef-du-Pont","context_page_description":"Chef-du-Pont je francúzska obec, ktorá sa nachádza v departemente Manche, v regióne Dolná Normandia."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Toronto_Mississauga_buildings","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Kaneff_Centre.jpg","page_title":"University of Toronto Mississauga buildings","context_page_description":"The University of Toronto Mississauga is a satellite campus of the University of Toronto. It is in Mississauga, Ontario, Canada about 33 kilometres west of the main St. George campus. It was formerly called the Erindale College but was later changed to the University of Toronto Mississauga. The campus has eight main educational buildings: the newly opened Maanjiwe nendamowinan Building, Deerfield Hall, the William G. Davis Building, the Kaneff Centre and Blackwood Gallery, the Recreation, Athletic, and Wellness Centre, the Hazel McCallion Academic Learning Centre which holds UTM's library, the Instructional Building, and the new Terrence Donnelly Health Sciences Complex for the Mississauga Academy of Medicine. The campus also houses 3 residence halls: Erindale Hall, Roy Ivor Hall, and Oscar Peterson Hall."},{"page_url":"https://en.wikipedia.org/wiki/Steinway_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Steinway_Hall_-_London.jpg","page_title":"Steinway Hall","context_page_description":"Steinway Hall is the name of buildings housing concert halls, showrooms and sales departments for Steinway & Sons pianos. The first Steinway Hall was opened in 1866 in New York City. Today, Steinway Halls and Steinway-Häuser are located in cities such as New York City, London, Berlin, and Vienna.\\nA related concept by Steinway is \\"Steinway Piano Galleries\\". The Steinway Piano Galleries have all the same features as Steinway Halls, but are smaller."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%DB%8C%D9%88%D9%87_%D8%B3%DB%8C%D8%A7%D9%87_%D8%BA%D8%B1%D8%A8%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/LatrodectusHesperusMaleLightColoredVentral003A.JPG","page_title":"بیوه سیاه غربی","context_page_description":"بیوه سیاه غربی نام یک گونه از سرده عنکبوت‌های بیوه است."},{"page_url":"https://es.wikipedia.org/wiki/Vag%C3%B3n_postal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Interior_de_uma_carruagem_combinada_do_Vouga_-_GazetaCF_1164_1936.jpg","page_title":"Vagón postal","context_page_description":"Los vagones postales eran vehículos ferroviarios, utilizados en la recogida, procesamiento y distribución de correo, a lo largo de los ferrocarriles."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%95%D7%91%D7%A8%D7%98_%D7%9E%D7%99%D7%9C%D7%99%D7%A7%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Robert-millikan2.jpg","page_title":"רוברט מיליקן","context_page_description":"רוברט אנדרוז מיליקן היה פיזיקאי אמריקני, זוכה פרס נובל לפיזיקה בשנת 1923."},{"page_url":"https://es.wikipedia.org/wiki/Pu%C3%B1o_en_alto","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Gonzo.svg","page_title":"Puño en alto","context_page_description":"o como puño cerrado o puño erguido) es un símbolo de solidaridad y apoyo. A menudo es usado para expresar unidad, fuerza o desafío. El saludo se remonta a la antigua Asiria como un símbolo de resistencia.​\\nrepresentantes de izquierda"},{"page_url":"https://pl.wikipedia.org/wiki/Micha%C5%82_Wojciechowski_(teolog)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/M-Wojciechowski-IMG_1770.JPG","page_title":"Michał Wojciechowski (teolog)","context_page_description":"Michał Jerzy Wojciechowski – polski biblista i publicysta, pierwszy katolik świecki w Polsce, który otrzymał tytuł naukowy profesora teologii."},{"page_url":"https://eo.wikipedia.org/wiki/Liebenwalde","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Wappen_Liebenwalde.png","page_title":"Liebenwalde","context_page_description":"Liebenwalde [LI:bnwalde] estas komunumo en Germanio. Ĝi troviĝas en la distrikto Oberhavel de la federacia lando Brandenburgio. Fine de decembro 2015 la komunumo havis 4 261 loĝantojn. Liebenwalde situas borde de la riveroj Havel, norde de la urbego Berlino."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%A9%E8%88%88%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Mosaic_Mural_at_Puhung_Station.jpg","page_title":"復興駅","context_page_description":"復興駅は、朝鮮民主主義人民共和国の平壌市平川区域にある平壌地下鉄万景台線の駅である。同線の起点。2011年、BootsnAllが選ぶ「世界で最も美しい地下鉄停留場15選」に入選。"},{"page_url":"https://nn.wikipedia.org/wiki/Sarah_av_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Sarah_Ferguson_in_Leeds_2008.jpg","page_title":"Sarah av York","context_page_description":"Sarah, kjend som Fergie, er den tidlegare kona til hertug Andrew av York.\\nHo vart fødd som Sarah Margaret Ferguson, og er dotter av Ronald Ferguson og hans fyrste kone, Susan Mary Wright. Ho vert ofte kalla «Fergie», eit kallenamn ho har fått på grunn av sitt pikenamn, Ferguson. Ho har aristokratisk bakgrunn, og er gjennom sin farmor slektning av hertuginne Alice av Gloucester, som er ei tante av dronning Elizabeth II av Storbritannia.\\n23. juli 1986 gifta ho seg med prins Andrew. Han fekk tittelen Hertug av York og Sarah vart titulert Den høgvørde hertuginna av York. Paret vart skilt i 1996, og Sarah mista tiltaleformen Den høgvørde og vart degradert til hertuginne Sarah av York.\\nHertugparet av York fekk to born i sitt ekteskap:\\nPrinsesse Beatrice av York\\nPrinsesse Eugenie av York\\nEtter skilsmissen har Sarah mellom anna vore programleiar for sitt eige talkshow. Ho har òg skrive ein sjølvbiografi, My story, pg ein serie barnebøker om «Budgie»."},{"page_url":"https://fr.wikipedia.org/wiki/Lipico","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/A_dance_dos_Mapicos.jpg","page_title":"Lipico","context_page_description":"Un lipico ou lipiko est un masque-heaume des Makondé du Mozambique."},{"page_url":"https://it.wikipedia.org/wiki/Mura_medievali_di_Milano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Porta_ticinese_medievale_a_Milano.jpg","page_title":"Mura medievali di Milano","context_page_description":"Le mura medievali di Milano sono state una cinta muraria eretta nel Medioevo a protezione della città lombarda di Milano. Hanno sostituito le mura romane di Milano, che erano state distrutte durante l'assedio della città del 1162, opera di Federico Barbarossa.\\nDemolite nel corso del XVI secolo, le mura medievali di Milano sono diventate obsolete per l'invenzione della polvere da sparo, che ha cambiato le tecniche di guerra, venendo sostituite dalle mura spagnole di Milano."},{"page_url":"https://en.wikipedia.org/wiki/Organ_Sonatas_(Bach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Corelli_Sonata_Op.5_No.3_Allegro.jpeg","page_title":"Organ Sonatas (Bach)","context_page_description":"The organ sonatas, BWV 525–530 by Johann Sebastian Bach are a collection of six sonatas in trio sonata form. Each of the sonatas has three movements, with three independent parts in the two manuals and obbligato pedal. The collection was put together in Leipzig in the late 1720s and contained reworkings of prior compositions by Bach from earlier cantatas, organ works and chamber music as well as some newly composed movements. The sixth sonata, BWV 530, is the only one for which all three movements were specially composed for the collection. When played on an organ, the second manual part is often played an octave lower on the keyboard with appropriate registration. Commentators have suggested that the collection might partly have been intended for private study to perfect organ technique, some pointing out that its compass allows it to be played on a pedal clavichord. The collection of sonatas is generally regarded as one of Bach's masterpieces for organ. The sonatas are also considered to be amongst his most difficult compositions for the instrument."},{"page_url":"https://en.wikipedia.org/wiki/List_of_birds_of_British_Columbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Tachycineta_thalassina_-San_Luis_Obispo%2C_California%2C_USA_-male-8_%281%29.jpg","page_title":"List of birds of British Columbia","context_page_description":"This list of birds of British Columbia includes species documented in the Canadian province of British Columbia. As of January 2020, there are 588 species included in this list. Of them, 227 are rare or accidental and 17 have been introduced to British Columbia or elsewhere in North America. Five species have been extirpated and one is extinct. Thirty-nine species have only sight records or are classed as hypothetical. An additional species of questionable origin is also included here.\\nThis list is presented in the taxonomic sequence of the Check-list of North and Middle American Birds, 7th edition through the 61st Supplement, published by the American Ornithological Society. Common and scientific names are also those of the Check-list, except that Canadian English spellings are used and the common names of families are from the Clements taxonomy because the AOS list does not include them.\\nThe following tags are used to describe some categories of occurrence.\\nAccidental - a species seldom recorded in British Columbia\\n(I) Introduced - a species that has been introduced to British Columbia by the actions of humans, either directly or indirectly"},{"page_url":"https://pl.wikipedia.org/wiki/Iwan_Myron","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Myron_Ivan.jpg","page_title":"Iwan Myron","context_page_description":"Iwan Myron ukr. Іван Мирон – ukraiński działacz społeczny, minister rządu Zachodnioukraińskiej Republiki Ludowej.\\nUkończył gimnazjum w Stanisławowie, następnie Uniwersytet Wiedeński. Z zawodu inżynier kolejowy. Po proklamacji Zachodnioukraińskiej Republiki Ludowej sekretarz transportu w rządach Kostia Łewyckiego i Sydora Hołubowycza.\\nCzłonek \\"Proswity\\" oraz UNDO."},{"page_url":"https://bs.wikipedia.org/wiki/IC_3303","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/IC3303_-_SDSS_DR14.jpg","page_title":"IC 3303","context_page_description":"IC 3303 je eliptična galaksija i nalazi se u sazviježđu Djevica. Prvo otkriće je napravio Friedrich Carl Arnold Schwassmann 14. septembra 1900. godine."},{"page_url":"https://sv.wikipedia.org/wiki/Christopher_Polhems_sluss","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Slussen%2C_Tillaeus%2C_1733.JPG","page_title":"Christopher Polhems sluss","context_page_description":"Christopher Polhems sluss kallas den andra slussen på det nuvarande Slussenområdet i Stockholm, konstruerad av Christopher Polhem. Slussen föregicks av Drottning Kristinas sluss från 1642. När Christopher Polhems slusskonstruktion öppnades för sjötrafiken den 2 maj 1755 hade den föregåtts av nästan 50 års diskussioner och utredningar. Strax intill uppfördes 1850 Nils Ericsons sluss.\\nSlussrännan låg kvar till 1930-talet men fylldes ut och revs till största delen när trafikanläggningen Slussen byggdes. Återstoden rivs under 2020 i samband med bygget av Nya Slussen."},{"page_url":"https://es.wikipedia.org/wiki/Teotihuac%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Teotihuac%C3%A1n%2C_M%C3%A9xico%2C_2013-10-13%2C_DD_39.JPG","page_title":"Teotihuacán","context_page_description":"Teotihuacán o Teotihuacan ​, o también Teo uacan ​ es el nombre que se da a la que fue una de las mayores ciudades prehispánicas de Mesoamérica. El topónimo es de origen náhuatl y fue empleado por los mexicas para identificar a esta ciudad construida por una civilización anterior a ellos y que ya se encontraba en ruinas cuando los mexicas la vieron por primera vez. A la fecha se desconoce el nombre que le daban sus habitantes originales. Los restos de la ciudad se encuentran al noreste del valle de México, en los municipios de Teotihuacán y San Martín de las Pirámides, aproximadamente a 78\\nkilómetros de distancia del centro de la Ciudad de México. La zona de monumentos arqueológicos fue declarada Patrimonio de la Humanidad por la Unesco en 1987.\\nLos orígenes de Teotihuacán son todavía objeto de investigación entre los especialistas. Alrededor del inicio de la era cristiana, Teotihuacán era una aldea que cobraba importancia como centro de culto en la cuenca del Anáhuac. Las primeras construcciones de envergadura proceden de esa época, como muestran las excavaciones en la Pirámide de la Luna. El apogeo de la ciudad tuvo lugar durante el Periodo Clásico."},{"page_url":"https://en.wikipedia.org/wiki/Den_Kongelige_G%C3%A6st","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Harkon_Boerresen.gif","page_title":"Den Kongelige Gæst","context_page_description":"Den Kongelige Gæst is an opera in one act by Hakon Børresen; the libretto is by Svend Leopold, and is based on a story by Henrik Pontoppidan. The opera was first given on 15 November 1919, at the Royal Danish Theatre, and has since proven to be among the most popular of Danish operas.\\nThe story plays out an evening in a doctor's home on the Jutland peninsula around 1900. Dr. Høyer and his wife are expecting guests for a dress ball. However, all the guests decline at the last moment, and Dr. Høyer is irritated, but slightly relieved. Instead, the family receives a surprise visitor, the unknown gentleman Prince Carnival, who acts in a free and easy manner, playing the piano, talking with Dr. Hoyer's wife, and suggesting to the couple to carry on with the party.\\nDuration: 1 hour"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%B0%D0%B7%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8D%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Supranational_PostSoviet_Bodies_RU.png","page_title":"Евразийский экономический союз","context_page_description":"Евразийский экономический союз — международная организация региональной экономической интеграции, обладающая международной правосубъектностью и учреждённая Договором о Евразийском экономическом союзе:Ст. 1. В ЕАЭС обеспечивается свобода движения товаров, а также услуг, капитала и рабочей силы, и проведение скоординированной, согласованной или единой политики в отраслях экономики.\\nЕАЭС создан в целях всесторонней модернизации, кооперации и повышения конкурентоспособности национальных экономик и создания условий для стабильного развития в интересах повышения жизненного уровня населения государств-членов.\\nСуществует путаница в аббревиатурах ЕАЭС и ЕврАзЭС: Евразийское экономическое сообщество является предшествующей ЕАЭС интеграционной организацией, упразднённой в связи с созданием ЕАЭС. Аббревиатура ЕАЭС принята во всех официальных международных документах."},{"page_url":"https://de.wikipedia.org/wiki/Stibor_zo_Stibor%C3%ADc_a_Beckova","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Scibor2.jpg","page_title":"Stibor zo Stiboríc a Beckova","context_page_description":"Stibor zo Stiboríc a Beckova war ein Adeliger polnischer Abstammung in der heutigen Slowakei. Er wurde aufgrund seiner zahlreichen Besitzungen oftmals auch als „kleiner slowakischer König“ bezeichnet."},{"page_url":"https://nl.wikipedia.org/wiki/MeteoGroup_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/MeteoConsult.jpg","page_title":"MeteoGroup Nederland","context_page_description":"MeteoGroup Nederland is een Nederlands weerbedrijf dat in 1986 als Meteo Consult werd opgericht door Harry Otten. Het bedrijf vervaardigt voor verschillende instanties weerberichten zoals RTL4. Begin 2020 is het bedrijf overgenomen door het Amerikaanse bedrijf DTN. Het gaat verder onder deze naam.\\nMeteoGroup Nederland is onderdeel van MeteoGroup dat naast Nederland ook actief is in vier andere Europese landen. Met haar 150 medewerkers is dit het grootste weerbedrijf van Europa, met het hoofdkantoor gevestigd in Wageningen. De Belgische dependance heet Meteo Services en is in Leuven gevestigd. Deze verzorgt weerberichten voor onder andere VTM en de krant Le Figaro.\\nNaast de bovengenoemde activiteiten is het bedrijf ook actief op het internet. Via haar sites worden verschillende weerdiensten aangeboden. Deze betaalde weerdiensten vallen onder de naam Meteo 24.\\nIn 2018 nam het Zwitserse bedrijf Thyssen-Bornemisza Group AG, dat eigenaar is van weerbedrijf DTN, MeteoGroup over van investeerder General Atlantic. Begin 2020 werden de publieksactiviteiten van het online platform weer.nl voortgezet onder verantwoording van Talpa Network.\\nBekende medewerkers zijn:\\nGerrit Hiemstra"},{"page_url":"https://en.wikipedia.org/wiki/Carpenter_Gothic","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/DeFuniak_Springs_Hist_Dist_CD0144a_St_Agathas.jpg","page_title":"Carpenter Gothic","context_page_description":"Carpenter Gothic, also sometimes called Carpenter's Gothic or Rural Gothic, is a North American architectural style-designation for an application of Gothic Revival architectural detailing and picturesque massing applied to wooden structures built by house-carpenters. The abundance of North American timber and the carpenter-built vernacular architectures based upon it made a picturesque improvisation upon Gothic a natural evolution. Carpenter Gothic improvises upon features that were carved in stone in authentic Gothic architecture, whether original or in more scholarly revival styles; however, in the absence of the restraining influence of genuine Gothic structures, the style was freed to improvise and emphasize charm and quaintness rather than fidelity to received models. The genre received its impetus from the publication by Alexander Jackson Davis of Rural Residences and from detailed plans and elevations in publications by Andrew Jackson Downing."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%95%EC%9E%AC%EB%8F%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Park_Jaedong.jpg","page_title":"박재동","context_page_description":"박재동은 대한민국의 만화가이다. 1974년에 만화가로 등단한 그는 경상남도 출생으로 현재 한국예술종합학교 교수로 있다. 배우자는 연기자 김선화이다."},{"page_url":"https://fr.wikipedia.org/wiki/Vrouwe-_en_Antonie_Gasthuys","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Vrouwe-en-AntonieGasthuys.jpg","page_title":"Vrouwe- en Antonie Gasthuys","context_page_description":"L’appellation Vrouwe- en Antonie Gasthuys, littéralement Hospice Notre-Dame-et-Saint-Antoine, renvoie à la fois à une organisation caritative autrefois vouée à l’accueil des pèlerins, et à certain hofje, ensemble de bâtiments contigus datant des XVIIᵉ et XVIIIᵉ siècles, sis rue Klein Heiligland dans le sud de la vieille ville de Haarlem aux Pays-Bas, dernier en date des lieux d’implantation successifs de ladite organisation."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D0%BE%D1%8F%D1%82_(%D0%A7%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/China_provinces.png","page_title":"Вилоят (Чин)","context_page_description":"Вилоятҳо Расман воҳидҳои сатҳи вилоятӣ ҳамчунин минтақаҳои маъмурии махсуси Гонконг ва Макао, баррасӣ мешаванд, ҳарчанд ки онҳо мухторияти бештар доранд.\\nДар айни замон, ба ҳайати Ҷумҳурии Халқии Чин 33 субъектҳои сатҳи олӣ, аз ҷумла 22 вилоят дохил аст. Расман вилояти 23-ум то ҳол Тайван ҳисобида мешавад."},{"page_url":"https://eu.wikipedia.org/wiki/Mania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Friern_Hospital%2C_London%3B_a_woman_suffering_from_mania%2C_with_Wellcome_V0029627.jpg","page_title":"Mania","context_page_description":"Psikiatrian, mania haserre, alaitasun, umore eta energia handiko beste egoera mentalak gehiegizko asalduraz, sentiberatasunez, eta aktibitateaz, kontzentrazio-ezarekin batera, gertatzen direneko nahasmendu mentala. Maiz, piromania, kleptomania eta beste obsesio batzuekin lotzen da, biak kontzeptu desberdinak izan arren."},{"page_url":"https://de.wikipedia.org/wiki/Intelligente_Stra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Solar_Roadway_Parking_Lot_Prototype.jpg","page_title":"Intelligente Straße","context_page_description":"Eine intelligente Straße bzw. Smart Street, Smart Highway oder Smart Road ist eine Straße, die über elektrotechnische Möglichkeiten verfügt, die über das bloße Befahren hinausgehen. Neben technologischen Vorteilen ist der Umweltschutz und die Nutzung Erneuerbarer Energien ein wichtiger Bestandteil der Technologie. Sie ist Teil der intelligenten Verkehrssysteme."},{"page_url":"https://de.wikipedia.org/wiki/Michaelskapelle_(Haselbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Michelberg%28Haselbach%29%2C_Kapelle_Innenansicht.jpg","page_title":"Michaelskapelle (Haselbach)","context_page_description":"Die Michaelskapelle ist eine kleine Votivkapelle auf dem Gipfel des Michelbergs südöstlich der Ortschaft Haselbach in der Gemeinde Niederhollabrunn im Bezirk Korneuburg in Niederösterreich. Sie ist dem heiligen Michael geweiht und gehört als Kapelle der Pfarre Haselbach zum Dekanat Stockerau im Vikariat Unter dem Manhartsberg der Erzdiözese Wien. Das Bauwerk steht unter Denkmalschutz."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Territorien_der_Stadt_und_Republik_Bern","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Eclepens_chateau.jpg","page_title":"Liste der Territorien der Stadt und Republik Bern","context_page_description":"Schultheiss, Räte und Burger der Stadt und Republik Bern regierten bis 1798 über die bernischen Gebiete immediat, indem Bern einen Landvogt einsetzte, und mediat dort, wo die Herrschaft in der Hand eines privaten Twingherrn lag.\\nDie Vogteien waren Verwaltungsposten, die ausschliesslich durch Mitglieder des Grossen Rates der Stadt Bern besetzt werden konnten. Die Amtleute wurden in der Regel auf sechs Jahre gewählt, ab 1710 wurden die Ämter im Grossen Rat unter den Bewerbern ausgelost. Die Ämter waren nach ihrem finanziellen Ertrag in vier Klassen eingeteilt."},{"page_url":"https://nl.wikipedia.org/wiki/Pont-H%C3%A9bert","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Map_commune_FR_insee_code_50409.png","page_title":"Pont-Hébert","context_page_description":"Pont-Hébert is een gemeente in het Franse departement Manche en telt 1713 inwoners. De plaats maakt deel uit van het arrondissement Saint-Lô."},{"page_url":"https://no.wikipedia.org/wiki/Hyperbolsk_geometri","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/HyperbolicTrig.jpg","page_title":"Hyperbolsk geometri","context_page_description":"Hyperbolsk geometri er en generalisering av euklidsk geometri hvor parallellpostulatet ikke er gyldig. Den er derfor en ikke-euklidsk geometri som beskriver plan eller rom som har konstant, negativ krumning. Den ble etablert av Janos Bolyai og Nikolaj Lobatsjevskij på midten av 1800-tallet og blir derfor også omtalt som Bolyai-Lobatsjevskij-geometri. Mange av deres oppdagelser var også kjent av Gauss, men hans resultat ble først kjent etter hans død. Han kalte denne nye geometrien for ikke-euklidsk geometri. Navnet hyperbolsk geometri ble innført flere tiår senere av Felix Klein da han kunne vise hvordan den kunne utledes mer generelt fra projektiv geometri.\\nI euklidsk geometri sier parallellpostulatet at man gjennom et punkt utenfor en linje alltid kan trekke en parallell linje. Den vil aldri skjære den gitte linjen. Men når man oppgir dette postulatet, er det ikke lenger opplagt hva som skjer med to linjer som forlenges i det uendelige. De kan skjære hverandre eller ikke. Det er nærliggende å si at i det siste tilfellet er linjene parallelle."},{"page_url":"https://de.wikipedia.org/wiki/Aufkl%C3%A4rungsturm_M","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/2017-09-15_-_Marinehorchturm_M_Gro%C3%9Fer_Raum_im_Mittelteil.jpg","page_title":"Aufklärungsturm M","context_page_description":"Der Fernmeldesektorturm M oder kurz Turm M war ein Aufklärungsturm der Marine in Pelzerhaken nahe Neustadt in Holstein an der schleswig-holsteinischen Ostseeküste südlich von Fehmarn im Kreis Ostholstein. Stationiert war dort bis 1992 der MFmSt 711 des Marinefernmeldestabes 70.\\nDer Turm wird nicht mehr militärisch genutzt. Die Gemeinde nutzt das Gelände als Lager und auf dem Turm gibt es einige Richtfunkverbindungen."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Den_Haag/Scheveningen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/RM18016_Den_Haag_-_Sweelinckplein_18.jpg","page_title":"Lijst van rijksmonumenten in Den Haag/Scheveningen","context_page_description":"Het stadsdeel Scheveningen in Den Haag, kent 228 inschrijvingen in het rijksmonumentenregister; hieronder een overzicht."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A4%B0%E0%A5%8D%E0%A4%95%E0%A5%87%E0%A4%9F%E0%A4%B0_%E0%A4%AA%E0%A5%8D%E0%A4%B0%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A5%87%E0%A4%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Mercator-projection.jpg","page_title":"मर्केटर प्रक्षेप","context_page_description":"मर्केटर प्रक्षेप एक भौगोलिक प्रक्षेपण विधि है। नौचालन में विशेषोपयोगी होने के कारण मर्केटर प्रक्षेप प्राचीन और सर्वाधिक सुविदित है। इसकी खोज मर्केटर नाम से विख्यात गर्हार्ड क्रेमर ने 1569 ई में की थी। लोगों की मिथ्या धारणा है कि बेलनाकार प्रक्षेप है।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Unterneustadt","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Elwe_Kassel.JPG","page_title":"Liste der Kulturdenkmäler in Unterneustadt","context_page_description":"Die Liste der Kulturdenkmäler in Unterneustadt enthält alle Kulturdenkmäler in der Unterneustadt, einem der 23 Gemeindeteile der kreisfreien Stadt Kassel, die in der vom Landesamt für Denkmalpflege Hessen 1983 herausgegebenen Denkmaltopographie veröffentlicht wurden."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%90%D0%BB%D1%96%D1%82%D1%83%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%BE%D0%B2%D1%96%D1%82%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Coat_of_arms_of_Dz%C5%ABkija.png","page_title":"Герб Алітуського повіту","context_page_description":"Герб Алітуського повіту — символ сучасного адміністративно-територіального утворення в Литовській республіці Алітуського повіту."},{"page_url":"https://ca.wikipedia.org/wiki/Bupr%C3%A8stids","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/BuprestisOctoguttata2.jpg","page_title":"Buprèstids","context_page_description":"Els buprèstids són una família de coleòpters polífags que inclou unes 13.000 espècies, fitòfagues tant en estat adult com larvari i que, en alguns casos, poden ser plagues per a l'agricultura. Moltes espècies tenen colors vistosos sent veritables joies per als col·leccionistes, la qual cosa queda reflectida al seu nom comú en anglès."},{"page_url":"https://de.wikipedia.org/wiki/Africa_Charter_Airline","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Africa_Charter_Airline_B737-236_ZS-SIT_%286864531727%29.jpg","page_title":"Africa Charter Airline","context_page_description":"Africa Charter Airline ist eine südafrikanische Fluggesellschaft mit Sitz in Lakefield in der Provinz Gauteng und Basis auf dem Lanseria International Airport."},{"page_url":"https://tr.wikipedia.org/wiki/Demir_Hisar_Belediyesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Coat_of_arms_of_Demir_Hisar_Municipality.jpg","page_title":"Demir Hisar Belediyesi","context_page_description":"Demir Hisar Belediyesi Makedonya'nın güneyinde bulunan bir belediyedir. Belediyenin merkezi Demir Hisar’dır. Belediye, Makedonya'nın idari dağılımında Pelagonya Bölgesi'nde yer alır."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Neuruppin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Neuruppin_Fehrbelliner_Stra%C3%9Fe_4a-f_Friedrich-Franz-Kaserne_14.JPG","page_title":"Liste der Baudenkmale in Neuruppin","context_page_description":"Die Liste der Baudenkmale in Neuruppin enthält alle Baudenkmale der brandenburgischen Stadt Neuruppin und ihrer Ortsteile auf der Grundlage der Landesdenkmalliste Brandenburg mit dem Stand vom 31. Dezember 2019. In der Liste der Bodendenkmale in Neuruppin befinden sich die Bodendenkmale in Neuruppin."},{"page_url":"https://id.wikipedia.org/wiki/Taman_Beihai","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Pavilion_of_Sharing_Coolness.JPG","page_title":"Taman Beihai","context_page_description":"Taman Beihai adalah sebuah taman publik dan bekas taman kekaisaran yang terletak di sebelah barat laut dari Kota Terlarang di Beijing, Tiongkok. Pada awalnya dibangun pada abad ke-11, taman ini merupakan salah satu yang terbesar dari semua taman Tiongkok dan mengandung banyak struktur penting bersejarah, istana, dan kuil. Sejak tahun 1925, tempat ini telah dibuka untuk umum sebagai taman. Taman Beihai juga terhubung pada ujung utara ke Shichahai.\\nTaman ini memiliki luas lebih dari 69 hectare, dengan sebuah danau yang mencakup lebih dari setengah dari keseluruhan taman. Di tengah taman terdapat sebuah pulau yang disebut Pulau Bunga Giok, dengan tempat tertingginya adalah 32 meter.\\nBeihai secara harfiah berarti \\"Laut Utara\\". Terdapat juga \\"Lautan\\" Tengah dan Selatan yang berhubungan. Dua \\"laut\\" yang disebut terakhir ini bertemu di dalam sebuah kompleks bangunan yang dikenal berdasarkan nama mereka sebagai Zhongnanhai; yang merupakan rumah dari pemimpin tertinggi Tiongkok."},{"page_url":"https://es.wikipedia.org/wiki/Toyota_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Houston_Toyota_Center_-.jpg","page_title":"Toyota Center","context_page_description":"El Toyota Center es un pabellón deportivo localizado en el centro de la ciudad de Houston, Texas. Debe su nombre a la empresa japonesa de automóviles Toyota, patrocinadora del pabellón. Los Houston Rockets, equipo de la NBA y principales usuarios del pabellón, comparten el recinto con los Houston Aeros de la Liga Americana de Hockey."},{"page_url":"https://hu.wikipedia.org/wiki/Jane_Fonda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Jane_Fonda_1998.jpg","page_title":"Jane Fonda","context_page_description":"Lady Jayne Seymour Fonda kétszeres Oscar-díjas amerikai színésznő, édesapja Henry Fonda színész. Öccse, valamint unokahúga szintén színészek."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Corps_immense_du_pr%C3%A9sident_Mao","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Mao_Zedong_portrait.jpg","page_title":"Le Corps immense du président Mao","context_page_description":"Le Corps immense du président Mao est un roman de Patrick Grainville publié le 1ᵉʳ septembre 2011."},{"page_url":"https://no.wikipedia.org/wiki/World_Cup_i_ishockey_2016_%E2%80%93_Tropper","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/US_national_team_jerseys_2016_%28WCH%29.png","page_title":"World Cup i ishockey 2016 – Tropper","context_page_description":"Alle åtte lag som deltar i World Cup i ishockey 2016 skulle ha en tropp bestående maksimalt av 20 utespillere og tre målvakter. Lagene innsendte enn preliminær tropp på 16 spillere den 2. mars 2016, og den endelige troppen skal presenteres 1. juni 2016. Trenerstabene for de åtte lagene ble offentliggjort 10. februar 2016.\\nStatistikken er ikke inkludert førturneringen.\\nSpillernes alder og klubblag pr. 17. september 2016."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B0%D1%8F_%D0%9E%D1%85%D1%82%D0%B0_(%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Komarovsky_Bridge_in_St_Petersburg.JPG","page_title":"Большая Охта (исторический район)","context_page_description":"Больша́я О́хта — местность на территории Красногвардейского района Санкт-Петербурга. Расположена между рекой Невой, шоссе Революции, проспектом Энергетиков и рекой Охтой.\\nПолучила название по реке Охте, на правом берегу которой находится. Определение Большая дано для отличия от Малой Охты, расположенной на левом берегу.\\nПрежде вдоль побережья находился шведский город Ниен. После его разрушения некоторое время здесь селений не было. В начале 1720-х годов, согласно указам Петра I, здесь началось строительство «по берегу Невы 500 изб с сеньми», в которые поселялись вместе с семьями плотники из Вологодской, Архангельской и Ярославской губерний. Каждая семья получала по половине дома. Плотники работали на партикулярной верфи.\\nСегодня о тех временах сохранилось несколько названий небольших улиц, которые ранее проходили между современными Свердловской набережной и проспектом Металлистов. Они увековечили фамилии охтинских плотников: Миронова, Панфилова, Абросимова, Гусева и Тарасова улицы.\\nДо начала XX века Большую Охту называли О́хтенскими сло́бодами и О́хтенской стороно́й.\\nПервое время застройка шла только вдоль берега Невы."},{"page_url":"https://hr.wikipedia.org/wiki/Crnogorska_pravoslavna_Crkva","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Petar_II_Petrovic-2.JPG","page_title":"Crnogorska pravoslavna Crkva","context_page_description":"Crnogorska pravoslavna Crkva sa sjedištem u prijestolnici Cetinje obnovljena listopada 1993. godine, nakon što je stvarno 1918. a službeno 1920. godine bila ukinuta kao dotad kanonski autokefalna crkva- samostalna pravoslavna Crkva.Kanonski je nepriznata od ostalih pravoslavnih crkava."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%9D_%D7%90%D7%A0%D7%96%D7%90%22%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Anzac1.JPG","page_title":"יום אנזא\\"ק","context_page_description":"יום אנזא\\"ק הוא יום זיכרון לאומי המצוין באוסטרליה ובניו זילנד שמנציח בהרחבה את כל האוסטרלים והניו זילנדים \\"ששירתו ומתו בכל המלחמות, העימותים ובמשימות שמירת השלום\\" ואת \\"התרומה וההקרבה של כל אלו ששירתו\\". יום זה מצוין מדי שנה ב-25 באפריל ובמקור צוין לכבודם של חיילי גיסות הצבא האוסטרליים והניו זילנדיים שלחמו במערכת גליפולי כנגד האימפריה העות'מאנית במלחמת העולם הראשונה.\\nיום אנזא\\"ק מצוין גם באיי קוק, בניואה, בפיטקרן ובטונגה ובעבר גם צוין בפפואה גינאה החדשה ובסמואה."},{"page_url":"https://de.wikipedia.org/wiki/Moltkeviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Moltkeviertel_1442_2.jpg","page_title":"Moltkeviertel","context_page_description":"Das Moltkeviertel ist ein Stadtviertel von Essen in Innenstadtnähe etwa 1,2 km Luftlinie südöstlich des Hauptbahnhofs. Es wird begrenzt durch die Kronprinzenstraße, die Ruhrallee, die Töpferstraße, die Rellinghauser Straße sowie die Bahnstrecke Essen Hbf – Essen-Werden. Verwaltungstechnisch gehört es zu den Stadtteilen Essen-Südostviertel und Essen-Huttrop; zur Abgrenzung der beiden Stadtteile und des Moltkeviertels siehe den Weblink unten zu \\"ESSENS BUNTE SEITE\\". Das Zentrum des Moltkeviertels bildet das Robert-Schmidt-Berufskolleg, die vormalige Königliche Baugewerkschule Essen, an der Ecke Moltkestraße/Robert-Schmidt-Straße."},{"page_url":"https://vi.wikipedia.org/wiki/Gro%C3%9Fmonra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Wappen_Grossmonra.png","page_title":"Großmonra","context_page_description":"Großmonra là một đô thị thuộc huyện Sömmerda trong bang Thüringen, nước Đức. Đô thị này có diện tích 38,92 km², dân số thời điểm 31 tháng 12 năm 2006 là 987 người."},{"page_url":"https://war.wikipedia.org/wiki/Phyllodactylus_angustidigitus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Angu.JPG","page_title":"Phyllodactylus angustidigitus","context_page_description":"An Phyllodactylus angustidigitus in uska species han Reptilia nga ginhulagway ni Dixon ngan Huey hadton 1970. An Phyllodactylus angustidigitus in nahilalakip ha genus nga Phyllodactylus, ngan familia nga Gekkonidae. Waray hini subspecies nga nakalista."},{"page_url":"https://sh.wikipedia.org/wiki/1876","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/WarCemCustLStand.jpg","page_title":"1876","context_page_description":"Godina 1876 bila je prijestupna godina koja počinje u subotu po gregorijanskom, odn. prijestupna godina koja počinje u četvrtak po 12 dana zaostajućem julijanskom kalendaru."},{"page_url":"https://fi.wikipedia.org/wiki/Espoonlahden_kirkko","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Espoonlahti_Church_entrance_hall%2C_holders_for_votive_candles_Aug_2017.jpg","page_title":"Espoonlahden kirkko","context_page_description":"Espoonlahden kirkko on vuonna 1980 valmistunut kirkko Espoonlahden kaupunginosassa Espoossa. Kirkon osoite on Kipparinkatu 10. Sen suunnitteli arkkitehtitoimisto Timo ja Tuomo Suomalainen. Kirkkoon on tehty laajennusosa vuonna 1997. Kirkossa on 410 istumapaikkaa, mutta yhdistämällä seurakuntasalin ja kirkkosalin sinne mahtuu 710 vierasta.\\nRakennusmateriaaleja ovat muun muassa betoni ja kupari sekä rakennuspaikalta kalliosta louhittu kivi. Salin ulkoseinien sisäpinta on pääosin ladottu louhoskivistä, osittain se on tehty betonielementeistä. Kirkko on moderni, ja eräät osat ovat metrin verran kallion sisällä.\\nKirkkosalin pohja on muodoltaan monikulmio, ja sen suunta on valittu niin, että jumalanpalveluksen aikana aurinko valaisee alttariseinän. Kirkkosalin kattoon alttarin kohdalle on ripustettu kirkkolaiva. Vuonna 2016 aloitettiin laaja peruskorjaus, jossa saneerattiin koko rakennus. Työt valmistuivat kesällä 2017. Rakennuksen ollessa jo käytössä tehtiin vielä jonkin verran säätöjä sekä pihatöitä. Kirkko vihittiin uudelleen käyttöön 3.12.2017."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Ringelsdorf-Niederabsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Niederabsdorf-Figurenbildstock-01.jpg","page_title":"Liste der denkmalgeschützten Objekte in Ringelsdorf-Niederabsdorf","context_page_description":"Die Liste der denkmalgeschützten Objekte in Ringelsdorf-Niederabsdorf enthält die 9 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Ringelsdorf-Niederabsdorf."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B9%80%E0%B8%AB%E0%B8%A1%E0%B8%B2%E0%B8%A3%E0%B8%A7%E0%B8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Scientific_racism_irish.jpg","page_title":"การเหมารวม","context_page_description":"การเหมารวม คือ คตินิยมหรือทัศนคติของสังคมทั่วไปที่มีต่อกลุ่มคนอื่น ชาติอื่น หรือลักษณะของบุคคลบางประเภทจนกลายเป็นมาตรฐาน มีพื้นฐานมาจากการสรุปเอาจากข้อสมมุติพื้นฐานที่มีแนวโน้มที่เป็นอัตวิสัย\\nการเหมารวมเกิดขึ้นจากความคิดที่คุ้นเคยทางมโนธรรม เช่น จากพฤติกรรมบางอย่าง หรือลักษณะพิเศษอันแตกต่างจากผู้อื่นที่ปรากฏและเป็นที่สังเกตอยู่ชั่วระยะเวลาอันยาวพอประมาณ การที่แนวคิดทางวัฒนธรรม จะกลายมาเป็นสิ่งที่ยอมรับกันโดยสังคมโดยทั่วไปได้ การเหมารวมไม่อาจจะเป็นแนวคิดที่ผิดไปทั้งหมด และจะต้องมีองค์ประกอบที่สังคมยอมรับ การเหมารวมมิได้ใช้แต่เฉพาะกลุ่มคนแต่อาจจะใช้ในสถานะการณ์ที่เกิดขึ้นอย่างสม่ำเสมอจนสามารถทำนายผลที่จะออกมาได้\\nการเหมารวมอาจจะเป็นได้ทั้ง “ดี” และ “ไม่ดี” แต่แนวคิดทางของการเหมารวมส่วนใหญ่แล้วยากที่จะเสนอภาพพจน์ทางบวกของกลุ่มชน"},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_des_%C3%A9v%C3%AAques_de_Troyes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Saint_Ly%C3%A9_chateau_eveques_3102.jpg","page_title":"Château des évêques de Troyes","context_page_description":"Le château des évêques de Troyes est un château situé à Saint-Lyé, en France."},{"page_url":"https://de.wikipedia.org/wiki/G%C3%BCssinger_Fehde","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/III_Andras_Thuroczy.jpg","page_title":"Güssinger Fehde","context_page_description":"Als Güssinger Fehde werden die kriegerischen Auseinandersetzungen zwischen dem habsburgischen Herzogtum Österreich und Steiermark und den ungarischen Herren von Güns im deutschwestungarischen Grenzbereich im Jahr 1289 bezeichnet. In insgesamt 37 Ortschaften kam es dabei im Lauf des Jahres zu Kampfhandlungen. Die österreichischen Truppen blieben siegreich und zerstörten im Zuge der Kämpfe zahlreiche Ortschaften, die sich heute vorwiegend im österreichischen Burgenland befinden. Die eroberten Herrschaften mussten allerdings nach dem Friedensschluss von Hainburg wieder an die Günser Herren zurückgegeben werden."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_st%C3%A1tn%C3%ADch_fos%C3%ADli%C3%AD_americk%C3%BDch_st%C3%A1t%C5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Maiasaura_BW.jpg","page_title":"Seznam státních fosílií amerických států","context_page_description":"Většina amerických států má svoji státní zkamenělinu. Tou se stává většinou dobře známá, početná nebo pro stát jinak významná fosílie některého pravěkého živočicha či rostliny. Kromě toho se rozlišuje ještě kategorie jako státní dinosaurus, státní drahokam apod."},{"page_url":"https://war.wikipedia.org/wiki/Matucana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Matucana_madisoniorum.jpg","page_title":"Matucana","context_page_description":"An Matucana in uska genus han Magnoliopsida. An Matucana in nahilalakip ha familia nga Cactaceae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0_%D0%A1%D0%B0%D0%B4%D0%BE%D0%B2%D0%B0_%D0%B2%D1%83%D0%BB%D0%B8%D1%86%D1%8F_(%D0%A0%D0%BE%D1%81%D1%82%D0%BE%D0%B2-%D0%BD%D0%B0-%D0%94%D0%BE%D0%BD%D1%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Rostov-on-don_building.jpg","page_title":"Велика Садова вулиця (Ростов-на-Дону)","context_page_description":"Велика Садова вулиця — центральна вулиця Ростова-на-Дону, одна з найстаріших і найгарніших вулиць міста."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B0%D0%BD_%D0%92%D0%B0%D0%BD_%D0%A5%D1%83%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Phan_Van_Hum.JPG","page_title":"Фан Ван Хум","context_page_description":"Фан Ван Хум — деятель вьетнамского национально-освободительного движения, философ, журналист, писатель."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Wettin-L%C3%B6bej%C3%BCn","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Wegweiser_Gimritz2.jpg","page_title":"Liste der Kulturdenkmale in Wettin-Löbejün","context_page_description":"In der Liste der Kulturdenkmale in Wettin-Löbejün sind alle Kulturdenkmale der Stadt Wettin-Löbejün und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 erstellt und seither laufend ergänzt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Cham%C3%A4leons","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Rieppeleon_brevicaudatus_M011.jpg","page_title":"Chamäleons","context_page_description":"Die Chamäleons sind eine Familie der Leguanartigen innerhalb der Schuppenkriechtiere.\\nEs sind über 200 Arten beschrieben, die sich in zwei Unterfamilien aufteilen: Die Echten Chamäleons und die Stummelschwanzchamäleons. Nahezu alle Chamäleons sind in ihrem natürlichen Lebensraum gefährdet, weshalb sie unter das Washingtoner Artenschutz-Übereinkommen fallen und ihre Haltung somit meldepflichtig ist."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%AF%D0%BD%D0%B8%D1%81_%D0%9A%D1%83%D1%80%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Yiannis_Kouros_2008_Keszthely_Hungary_2008.jpg","page_title":"Янис Курос","context_page_description":"Янис Курос е гръцки ултрамаратонец, считан за една от легендите в ултра дългите бягания. Държи множество рекорди на различни дистанции от 100 до 1000 мили и на многочасови бягания от 12 часа до 6 дни. Известен е с прякорите „Бягащия Бог“ и „Наследникът на Фидипид“.\\nКурос става известен след като печели Спартатлона през 1984 година с рекордно време, както и ултрамаратона от Сидни до Мелбърн за 5 дни, 5 часа и 7 минути. Притежава и австралийско гражданство през по-голямата част от кариерата си. Рекордът му на класически маратон е 2 часа и 24 минути.\\nОсвен с бягане Курос се занимава и с поезия като е написал над 1000 поеми, някои от които са в книгите му Symblegmata и The Six-Day Run of the Century."},{"page_url":"https://fr.wikipedia.org/wiki/Pays_des_Collines","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Bois_de_la_Louvi%C3%A8re_-_Livierenbos%2C_Flobecq_-_Vloesberg_01.jpg","page_title":"Pays des Collines","context_page_description":"Le Pays des Collines est une région naturelle sise entre l'Escaut et la Dendre, caractérisée par son aspect vallonné. Topographiquement elle est la même que la région appelée « Ardennes flamandes » de la Région flamande immédiatement voisine. Son sommet, le Pottelberg se trouve sur la commune de Flobecq, juste à la frontière entre les deux régions linguistiques. Administrativement parlant, le Pays des Collines se trouve dans la province de Hainaut."},{"page_url":"https://vi.wikipedia.org/wiki/Atelopus_limosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Atelopus_limosus02.jpg","page_title":"Atelopus limosus","context_page_description":"Sapo Limosa, hoặc Cóc Harlequin Limosa, là một loài cóc bị đe dọa ở Bufonidae. Đây là loài đặc hữu của Panama và được mô tả bởi Ibáñez, Jaramillo và Solís năm 1995.\\nNó phân bố ở các bờ suối trong rừng ẩm vùng đất thấp nhiệt đới hoặc cận nhiệt đới và sông ngòi của lưu vực Chagres ở miền trung Panama.\\nA. limosus bị đe dọa bởi bệnh chytridiomycosis và mất môi trường sống. Loài này đã giảm sút nhanh chóng trong phạm vi phân bố. Khoảng 75% cá thể được biết đến của loài này ở các địa điểm đất cao trên 1000 m đã biến mất, còn 58% sống ở đất thấp đã giảm sút và 38% biến mất."},{"page_url":"https://fr.wikipedia.org/wiki/Nada_Surf","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/2233214092_e0a01f7157.jpg","page_title":"Nada Surf","context_page_description":"Nada Surf est un groupe de rock américain, originaire de New York et emmené par le chanteur et guitariste Matthew Caws. Formé en 1993, c'est notamment grâce à leur premier single Popular que le groupe a rapidement obtenu une réputation mondiale et a pu effectuer des tournées aux États-Unis, au Canada, en Europe, en Australie et au Brésil.\\nLeurs chansons ont servi de bande son dans des séries télévisées américaines populaires telles que Six Feet Under, Newport Beach, How I Met Your Mother ou encore Heroes. Ils sont également crédités d'une apparition dans Les Frères Scott."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%89%E3%83%BC%E3%83%A9%E5%B7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Zadorra_ibaia_tresponden_2.jpg","page_title":"サドーラ川","context_page_description":"サドーラ川は、イベリア半島北部を流れる河川。スペイン・バスク州アラバ県とカスティーリャ・イ・レオン州ブルゴス県を流れる。本流であるエブロ川に合流後、カタルーニャ州で地中海に注いでいる。"},{"page_url":"https://et.wikipedia.org/wiki/Home_Insurance_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Home_Insurance_Building.JPG","page_title":"Home Insurance Building","context_page_description":"Kodukindlustuse hoone ehk Home Insurance Building oli kõrghoone Chicagos, praeguse West Adamsi tänava ja South Lasalle'i tänava nurgal. Hoonet peetakse üheks esimeseks pilvelõhkujaks korruste arvu, kõrguse ja konstruktsiooni põhjal. Hoone projekteeris arhitekt William Le Baron Jenney Home Insurance Company'le, mille peakontor oli New Yorgis."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%85%D5%B8%D5%BF%D5%B8%D6%82%D5%B6%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Giants_and_Freia.jpg","page_title":"Յոտուններ","context_page_description":"Յոտուններ, սկանդինավյան դիցաբանության մեջ հանդիպող գերբնական էակներ։ Յոտունները բնակվում են Յոտուննհեիմր կոչվող աշխարհում, որը սկանդինավյան դիցաբանական պատկերացումների համաձայն՝ գոյություն ունեցող ինը աշխարհներից մեկն է։ Նրանք Յոտուննհեիմր են ուղարկվել ասերի կողմից, որոնք են թողնում յոտուններին Ասգարդ գալ։ Յոտունները շատ հաճախ պատկերվում են ասերի և վաների հետ միասին։ Որպես կանոն յոտունները ի հակադրություն են ներկայացվում աստվածներին, սակայն երբեմն ոչ ագրեսիվ ձևով են հարաբերվում նրանց։ Նրանց ամուսնությունները ասերի և վաների հետ և խճճված տոհմածառերը Արձակ Էդդայում և Պոետիկ Էդդայում առաջ են բերում մի շարք դժվարություններ՝ կապված յոտուններին սկանդինավյան աստվածներից տարբերելու հետ։"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E7%A3%AF%E5%AD%90%E7%94%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/TEPCO_MinamiYokohama02.jpg","page_title":"新磯子町","context_page_description":"新磯子町は、神奈川県横浜市磯子区の町名。丁番を持たない単独町名である。住居表示未実施区域。2017年12月31日現在の人口は少数のため秘匿となっている。秘匿されていない最後の記録である2003年12月31日現在の人口は42人。郵便番号は235-0017。"},{"page_url":"https://en.wikipedia.org/wiki/Bad_Homburg_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/13-08-29_Bahnhof_Bad_Homburg_0004.jpg","page_title":"Bad Homburg station","context_page_description":"Bad Homburg station is located in Bad Homburg, Hesse, Germany on the Homburg Railway and was opened on 26 October 1907. It is used by about 19,000 passengers each day."},{"page_url":"https://fr.wikipedia.org/wiki/Andrea_Petkovic","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Andrea_Petkovic_%28GER%29_%289633273090%29.jpg","page_title":"Andrea Petkovic","context_page_description":"Andrea Petkovic, née le 9 septembre 1987 à Tuzla, ville de Bosnie-Herzégovine faisant alors partie de la Yougoslavie, est une joueuse de tennis allemande.\\nProfessionnelle depuis 2006, elle a atteint la neuvième place mondiale du classement WTA en simple le 10 octobre 2011 ainsi que la quarante-sixième place mondiale en double en 2014.\\nAndrea Petkovic a remporté à ce jour six titres en simple et a disputé cinq autres finales en simple ainsi que deux en double. Sa surface de prédilection est la terre battue. Entraînée par Dušan Vemić et Petar Popović depuis février 2019, elle habite à Griesheim près de Darmstadt, en Allemagne."},{"page_url":"https://en.wikipedia.org/wiki/Brinkworth,_Wiltshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/St_Michael%27s_and_All_Angels_church%2C_Brinkworth_-_geograph.org.uk_-_410491.jpg","page_title":"Brinkworth, Wiltshire","context_page_description":"Brinkworth is a village and civil parish in northern Wiltshire, England. The village lies between Royal Wootton Bassett and Malmesbury, about 1 mile north of the M4 motorway and 9 miles west of Swindon.\\nThe west end of Brinkworth village is Causeway End. The civil parish of Brinkworth includes the hamlets of Braydon Side, Callow Hill, The Common, and the tithing of Grittenham, a rural community to the south of the village of Brinkworth.\\nMuch of Brinkworth village is a linear settlement along the east-west B4042, extending for some 1 ¹⁄₂ miles. The village is sometimes described as the longest in England although others such as Meopham, Kent make the same claim.\\nThe village stands on a ridge overlooking the Dauntsey Vale to the south. The Woodbridge Brook, a tributary of the Bristol Avon, passes to the north of the village and another tributary of the Avon, the Brinkworth Brook, passes to the south. The Thunder Brook joins the Brinkworth Brook north of Grittenham."},{"page_url":"https://ro.wikipedia.org/wiki/Citro%C3%ABn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/2014_Citro%C3%ABn_Jumper_%28L1H1_body%3B_fl%29.jpg","page_title":"Citroën","context_page_description":"Citroën este unul dintre cei mai importanți producători de automobile din Franța și din lume. Compania a fost fondată în 1919 de către industriașul francez André-Gustave Citroën, iar din 1976 face parte din Grupul PSA Peugeot-Citroën.\\nÎn 1934, Citroën își câștigă reputația de marcă inovatoare odată cu lansarea modelului Traction Avant, primul automobil de producție în masă din lume cu tracțiune pe față și una dintre primele mașini cu o caroserie de tip unitar, fără piese mecanice fixate pe cadrul șasiului.\\nÎn 1954, Citroën produce primul sistem de suspensie hidropneumatic cu autonivelare, iar apoi în 1955 revoluționarul model DS, prima mașină de producție în masă cu discuri de frână moderne. În 1967, Citroën introduce la o serie de modele farurile cu reglare manuală, care permit o vizibilitate sporită pe drumurile șerpuite. Autovehiculele Citroën au câștigat o serie de premii naționale și internaționale, marca Citroën fiind aleasă de trei ori drept Mașina europeană a anului."},{"page_url":"https://en.wikipedia.org/wiki/Chriss_Rune_Olsen_Angvik","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Nico_%26_Vinz_-_Envy_-_%287274537408%29.jpg","page_title":"Chriss Rune Olsen Angvik","context_page_description":"Chriss Rune Olsen Angvik is a Norwegian musician and composer, and known from the bands Red Hot and Envy, backing Nico & Vinz."},{"page_url":"https://hr.wikipedia.org/wiki/Carpathian_Forest","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/W0822-Hellfest2013_CarpathianForest_Tchort_68358.JPG","page_title":"Carpathian Forest","context_page_description":"Carpathian Forest je norveški black metal sastav kojeg su 1990. godine osnovali pjevač i gitarist Natterfrost i basist, Klavijaturist i pjevač Nordavind.\\nNjihovo prvo izdano djelo je demo snimak iz 1992. godine pod nazivom \\"Bloodlust & Perversion\\", koji je oduševio poklonike black metal stila. Carpathian Forest se smatraju jedinstvenima među black metal sastavima zbog svojih tekstova vezanih za sotonizam, sadizam, samoubojstvo i slične teme.\\nZadnje izdanje ovog sastava je album Fuck You All!!!!, izdan 2006. godine."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B5%A4%E4%BA%95%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Akai_Station_080823_01.jpg","page_title":"赤井站","context_page_description":"赤井站是一个位于福岛县磐城市平赤井字田中，属于东日本旅客铁道磐越东线的铁路车站。"},{"page_url":"https://de.wikipedia.org/wiki/Horst_Linde","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/KA_EvStadtkirche_n_W1.JPG","page_title":"Horst Linde","context_page_description":"Horst Eduard Linde war ein deutscher Architekt, Stadtplaner und Hochschullehrer."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Myeongnyang","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Panokseon.jpg","page_title":"Battle of Myeongnyang","context_page_description":"In the Battle of Myeongnyang, on October 26, 1597, the Korean Joseon kingdom's navy, led by Admiral Yi Sun-sin, fought the Japanese navy in the Myeongnyang Strait, near Jindo Island, off the southwest corner of the Korean peninsula.\\nWith only 13 ships remaining from Admiral Won Gyun's disastrous defeat at the Battle of Chilchonryang, Admiral Yi held the strait as a \\"last stand\\" battle against the Japanese Navy, who were sailing to support their land army's advance towards the Joseon capital of Hanyang.\\nThe actual numeric strength of the Japanese fleet that Admiral Yi fought is unclear; various sources indicate the number of Japanese ships could have been anywhere between 120 and 330 ships, though the low end of this range appears to be a count of actual warships and the high end appears to be referring to the entire Japanese fleet. Regardless of the size of the Japanese fleet, all sources indicate that the Japanese ships heavily outnumbered the Korean ships, by at least a ten-to-one ratio. In total 30 Japanese warships were sunk or crippled during the battle."},{"page_url":"https://pl.wikipedia.org/wiki/Cyrtocara_moorii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Cyrtocara_moorii.jpg","page_title":"Cyrtocara moorii","context_page_description":"Cyrtocara moorii – endemiczny gatunek słodkowodnej ryby okoniokształtnej z rodziny pielęgnicowatych. Jedyny przedstawiciel rodzaju Cyrtocara. Bywa hodowany w akwariach. Jest zaliczana do pyszczaków z grupy utaka."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8F%D0%BE%D1%80%D1%9F_%D0%9C%D0%B0%D0%BA%D0%BB%D0%B5%D0%BB%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Portrait-of-general-george-b-mcclellan.jpg","page_title":"Џорџ Маклелан","context_page_description":"Џорџ Бринтон Маклелан је био генерал-мајор током Америчког грађанског рата и кандидат Демократске странке за председника 1864. године."},{"page_url":"https://it.wikipedia.org/wiki/Lower_Manhattan","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/New_York_City_-_Manhattan_-_Lower_Manhattan.PNG","page_title":"Lower Manhattan","context_page_description":"Lower Manhattan è un quartiere del borough centrale di New York, che tradotto in italiano significa Bassa Manhattan, riferendosi alla punta meridionale dell'omonima isola. È famoso per essere il centro finanziario maggiore della città. Infatti in questo quartiere si trova Wall Street, con la New York Stock Exchange, la più grande borsa valori del mondo. In questa zona sorge il One World Trade Center. All'interno del quartiere c'è inoltre la zona di TriBeCa e Battery Park City, prevalentemente residenziale."},{"page_url":"https://fr.wikipedia.org/wiki/The_Very_Thought_of_You_(chanson)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/The_Very_Thought_of_You_-_Radio_Mirror%2C_October_1935_01.jpg","page_title":"The Very Thought of You (chanson)","context_page_description":"The Very Thought of You est une célèbre chanson d'amour standard de jazz, écrite et composée par l'auteur-compositeur chef d'orchestre britannique Ray Noble. Elle est enregistrée pour la première fois en 78 tours en 1934, chez Victor Talking Machine Company - La voix de son maître par le célèbre crooner de jazz britannique de l’époque Al Bowlly, accompagné au piano stride par Monia Litter, puis par l'orchestre big band jazz de Ray Noble. Il fait partie du standard des crooners entre autres de Nat King Cole ou Frank Sinatra..."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%A5%D5%AF%D5%BD%D5%B8%D5%B6_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D5%8F%D5%A5%D5%AD%D5%A1%D5%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Jackson_County%2C_TX_Courthouse_IMG_1019.JPG","page_title":"Ջեկսոն շրջան (Տեխաս)","context_page_description":"Ջեկսոն շրջան, ԱՄՆ Տեխաս նահանգի 254 վարչական միավորներից մեկը։ Ընդհանուր տարածությունը 2.150 կմ² է, բնակչությունը՝ 14.391 մարդ ։ Շրջկենտրոնն է Էդնա բնակավայրը։ Կազմավորվել է 1836 թ.։\\nՕգտագործված աղբյուրներ\\nՏվյալներ ԱՄՆ վիճակագրության բյուրոյի կայքում\\nԾանոթագրություններ և նշումներ"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%99%E0%B8%B2%E0%B8%A1%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%81%E0%B8%A9%E0%B8%B1%E0%B8%95%E0%B8%A3%E0%B8%B4%E0%B8%A2%E0%B9%8C%E0%B8%9E%E0%B8%A1%E0%B9%88%E0%B8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Gawdawpalin_Temple_Bagan_Myanmar.jpg","page_title":"รายพระนามพระมหากษัตริย์พม่า","context_page_description":"บทความนี้รวบรวมรายพระนามพระมหากษัตริย์ของอาณาจักรต่าง ๆ ภายในประเทศพม่า"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D8%B1%D8%A7%D9%81%D8%AA%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Saad_Zaghlul.jpg","page_title":"كرافته","context_page_description":"الكراڤته قماشه طويله تُلف و تُربط حوالين الرقبة عادة تحت ياقة القميص. فى الغالب الرجال هم الذين يلبسون الكراڤته لكن بتظهر كمان ساعات ضمن هدوم الستات. لبس الكراڤته او عدمه ممكن يعبرو عن وظيفه او مكانه اجتماعيه او توجه فكرى.\\nالكراڤته بشكل قديم يشبه الشال كان بيلبسها سيناتورات مجلس الشيوخ فى روما و كان اسمها فاسكاليا Fascalia و كان سبب لبسهم ليها تدفية حبالهم الصوتيه عشان ما تتأثرش لما يخطبو فى المجلس، و بالتالى الفاسكاليا كانت بتعبر عن مركز اجتماعى و سياسى عند الرومان و ده خلا چنرالات الجيش هما كمان يلبسوها. اتنقلت الفاسكاليا للعسكر و للمرتزقه الكروات فى الجيش الرومانى و كان بيستعملوها فى مسح العرق و الدم و كمان للنف.\\nبقت عاده فى كرواتيا ان الست و هى بتودع جوزها او حبيبها اللى رايح حرب انها تديه الشال بتاعها فكان بيربطه حوالين رقبته و ده اصل اسم \\"كراڤته\\" المشتق من كلمة \\"كروات\\" Croat. فى المانيا اتسمت كراڤاته Krawatte و فى فرنسا كراڤت Cravate. مع مرور الوقت الكراڤته بقت جزء من الهدوم و دخلت عالم الموضه. تشارلز التانى دخل الكراڤته انجلترا و كانت بتتلبس و بتتربط بكذا طريقه. و اياميها ظهرت كراڤته اسمها \\"ستينكيرك\\" Steenkerque و ده لإن تشارلز فى معركه بالاسم ده \\"ستين كيرك\\" Battle of Steenkerque لبس لاول مره كراڤته بالشكل ده."},{"page_url":"https://et.wikipedia.org/wiki/Met%C5%A1etlino_rajoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Coat_of_Arms_of_Mechetlino_rayon_%28Bashkortostan%29.png","page_title":"Metšetlino rajoon","context_page_description":"Metšetlino rajoon on 2. järgu haldusüksus Venemaal Baškortostanis. Rajooni halduskeskus on Bolšeustikinskoje.\\nRajoonis on 12 külaasundust, kus on kokku 49 asulat.\\n2016. aastal oli rajooni elanike arv 23 394. 2010. aasta seisuga olid elanikest 59,8% baškiirid, 23,6% tatarlased ja 15,4% venelased."},{"page_url":"https://it.wikipedia.org/wiki/Dmitrij_St%C3%ABpu%C5%A1kin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Dmitry_Styopushkin.jpg","page_title":"Dmitrij Stëpuškin","context_page_description":"Dmitrij Fëdorovič Stëpuškin è un bobbista russo."},{"page_url":"https://ro.wikipedia.org/wiki/Ransbach-Baumbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Ransbach-Baumbach.jpg","page_title":"Ransbach-Baumbach","context_page_description":"Ransbach-Baumbach este un oraș din landul Renania-Palatinat, Germania."},{"page_url":"https://de.wikipedia.org/wiki/Wilhelm_Kimbel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Hofzeichner_Wilhelm_Kimbel_in_Berlin%2C_1908.jpg","page_title":"Wilhelm Kimbel","context_page_description":"Wilhelm Kimbel war ein deutscher Ebenist und Innenarchitekt."},{"page_url":"https://en.wikipedia.org/wiki/Walls_of_Seville","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/MurallasSevilla_completo.png","page_title":"Walls of Seville","context_page_description":"The Walls of Seville are a series of defensive walls surrounding the Old Town of Seville. The city has been surrounded by walls since the Roman period, and they were maintained and modified throughout the subsequent Visigoth, Islamic and finally Castilian periods. The walls remained intact until the 19th century, when they were partially demolished after the revolution of 1868. Some parts of the walls still exist, especially around the Alcázar of Seville and some curtain walls in the barrio de la Macarena.\\nThe walls originally had eighteen gates or points of access, four of which survive today: Puerta de la Macarena, Puerta de Córdoba, Postigo del Aceite and Postigo del Alcázar. The extant parts of the walls maintain an Almohad appearance, mixed with Classicist air resulting from restorations carried out in the 18th century."},{"page_url":"https://en.wikipedia.org/wiki/Aesepus_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Aesepus_Bridge._Picture_03.jpg","page_title":"Aesepus Bridge","context_page_description":"The Aesepus Bridge was a late antique Roman bridge over the Aesepus river in the ancient region of Mysia in modern-day Turkey. It is notable for its advanced hollow chamber system which has also been employed in other Roman bridges in the region, such as the Makestos Bridge. In a field examination carried out in the early 20th century, the four main vaults of the bridge were found in ruins, while nearly all piers and the seven minor arches had still remained intact. Today, the two remaining pier stubs in the riverbed are still extant, while the condition of the rest of the structure is difficult to determine."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%DB%8C%D8%A7%DA%AF%D8%B1%D8%A7%D9%85_%D8%A7%D9%86%DB%8C%D9%85%DB%8C%D8%B4%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Zirkumpolar_ani.gif","page_title":"دیاگرام انیمیشن","context_page_description":"در دیاگرام پویانمایی از همه امکانات پویانمایی استفاده نمی‌شود، بلکه فقط شکل‌های ساده، خطوط یا فلش‌ها برای نشان دادن بعضی از موضوعات بسیار ساده استفاده می‌شود که غالباً کاربرد آموزشی دارند."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%BB%A3%E6%9D%B1%E7%9C%81%E4%B8%AD%E9%86%AB%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Guangdong_Hospital_of_TCM_%28Napier_Island%29.jpg","page_title":"廣東省中醫院","context_page_description":"廣東省中醫院（粵拼：gwong² dung¹ saang² zung¹ ji¹ jyun²）\\n，又嗌廣州中醫藥大學第二臨床醫學院gwong² zau¹ zung¹ ji¹ joek⁶ daai⁶ hok⁶ dai⁶ ji⁶ lam⁴ cong⁴ ji¹ hok⁶ jyun²或廣東省中醫藥科學院gwong² dung¹ saang² zung¹ ji¹ joek⁶ fo¹ hok⁶ jyun²，係中國廣東嘅省級三甲醫院機構，1933年成立，有5間總院同3間門診部。佢係中國近代史入面，其中一間最早嘅中醫醫院，有「南粵杏林第一家」嘅名。"},{"page_url":"https://cs.wikipedia.org/wiki/V%C3%A1%C5%BEky","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Coenagrion_puella_Paarung.jpg","page_title":"Vážky","context_page_description":"Vážky jsou řád okřídleného velkého hmyzu s úzkým a velmi protáhlým tělem, který je v podstatě nezaměnitelný s druhem z jiného řádu. V hmyzím světě patří vážky mezi nejlepší letce a jsou hmyzem s nejdokonalejším zrakem. Životním prostředím, nezbytným k vývoji vážek, je až na výjimky voda. Vyvíjejí se proměnou nedokonalou. Všechny vážky i jejich larvy se živí dravě. Řád vážky se dělí na 3 podřády. Vědecké pojmenování řádu odonata pochází z řečtiny ze slova odontos, podle ozubeného kousacího ústrojí. Řád je předmětem studia zvláštního oboru entomologie zvaného odonatologie."},{"page_url":"https://it.wikipedia.org/wiki/Daniel_Navarro","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Tour_de_France_2017%2C_navarro_%2835326162064%29.jpg","page_title":"Daniel Navarro","context_page_description":"Daniel Navarro García è un ciclista su strada spagnolo che corre per il team Israel Start-Up Nation. È professionista dal 2005."},{"page_url":"https://no.wikipedia.org/wiki/Hugo_Haase","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Haase_1905.jpg","page_title":"Hugo Haase","context_page_description":"Hugo Haase var en tysk jurist, politiker og pasifist. Han var formann for SPD og kansler i Tyskland en kort periode i 1919. Haase ble drept i et attentat, utført av en sinnssyk person."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_kommuner_i_Frankrike_med_over_20000_innbyggere","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/N%C3%AEmes%2C_Centre_ville.jpg","page_title":"Liste over kommuner i Frankrike med over 20000 innbyggere","context_page_description":"Dette er en liste over kommuner i Frankrike med over 20 000 innbyggere etter folketellingen i 2006."},{"page_url":"https://ca.wikipedia.org/wiki/Hillel_l%27Anci%C3%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Tomb_of_hillel_the_elder.png","page_title":"Hillel l'Ancià","context_page_description":"Hil·lel l'Ancià, també fou conegut com a Hil·lel el Savi va ser un eminent rabí i un mestre jueu; fou el primer erudit que va sistematitzar la interpretació de la Torà escrita. Hillel va néixer, segons el Talmud, a Babilònia. Hil·lel va rebre la seva avançada formació a Jerusalem, a on va esdevenir una autoritat sobre la llei jueva, per aquest motiu va ser triat cap del seu consell religiós.\\nL'èmfasi de Hil·lel en el compliment de les normes ètiques, en la pietat personal, en la humilitat i en la preocupació pels altres van ser precursors de certs ensenyaments morals del cristianisme i del islam. El filòleg francès del s.XIX, Ernest Renan, va proposar en el seu llibre Vida de Jesús, que Hil·lel va ser un mestre de Jesús de Nazaret. Davant de la pregunta d'un dels seus estudiants sobre com es podrien resumir tots els continguts de la Torà, recull una hagadà, que Hil·lel li va respondre: \\"No facis al teu proïsme allò que no vols que et facin a tu, tota la resta és comentari\\".\\nHil·lel va fundar una escola lliberal d'interpretació de les escriptures, oposada a la rigidesa de l'escola de Xammai. L'enfrontament entre les dues escoles es va resoldre al seu favor."},{"page_url":"https://eo.wikipedia.org/wiki/Kelta_kruco","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bromptoncross.jpg","page_title":"Kelta kruco","context_page_description":"La Kelta kruco estas simbolo kiu kombinas krucon kie ringo ĉirkaŭas la intersekciĝon. En la kelta kristana mondo ĝi estis uzita kombinita kun la kristana kruco kaj tiu dizajno ofte estis uzita kiel alta kruco, izolita kruco el ŝtono kaj ofte riĉe ornamita. Kun la Kelta Renesanco, la formo, kutime ornamita kun plektaĵoj kaj aliaj ĉeftemoj de Insula arto, iĝis populara por funebraj monumentoj kaj alia uzoj, kaj restis tiel, disvastiĝante ekster la Britaj Insuloj.\\nEn Irlando, estas populara legendo ke la kelta katolika kruco estis lanĉita de Sankta Patriko aŭ eventuale Sankta Deklano dum lia tempo konvertante la paganajn irlandanojn, kvankam neniuj ekzemploj pluvivas de tiu frua periodo. Estis ofte asertite ke Patriko kombinis la simbolon de kristanismo kun la sunkruco de la paganoj, por ke ili havu ideon de la graveco de la kruco per interligado de ĝi kun la ideo de la vivigaj trajtoj de la suno. Tamen tiu teorio nun estas neverŝajna laŭ la plejmulto de arthistoriistoj, kiuj pensas ke la origino de krucoj portante la girlandon de venkinto ĉirkaŭ intersekciĝo estas pli verŝajna."},{"page_url":"https://es.wikipedia.org/wiki/Sur_de_Estados_Unidos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/13_Atlanta.jpg","page_title":"Sur de Estados Unidos","context_page_description":"La Región Sur de los Estados Unidos, también conocido como el sur estadounidense, Dixie, Dixieland, o simplemente el Sur, es una región de los Estados Unidos de América. Se encuentra entre el océano Atlántico y la Costa Oeste de los Estados Unidos, con el medio oeste y el Nordeste de Estados Unidos al norte y el golfo de México y México al sur.\\nEl Sur no coincide por completo con el sur geográfico de los Estados Unidos, pero se define comúnmente como la inclusión de los estados que lucharon por los Estados Confederados de América en la Guerra de Secesión.​ El Deep South está ubicado completamente en la esquina sureste. Arizona y Nuevo México, que se encuentran geográficamente en la parte sur del país, rara vez se consideran parte, mientras que Virginia Occidental, que se separó de Virginia en 1863, ​ comúnmente lo es.​​​ Algunos estudiosos han propuesto definiciones del Sur que no coinciden con los límites del estado.​​ Mientras que los estados de Delaware y Maryland, así como el Distrito de Columbia, permitieron la esclavitud antes del comienzo de la Guerra de Secesión, permanecieron con la Unión."},{"page_url":"https://de.wikipedia.org/wiki/N%C3%AD%C5%BEkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/N%C3%AD%C5%BEkov_CoA.jpg","page_title":"Nížkov","context_page_description":"Nížkov ist eine Gemeinde im Okres Žďár nad Sázavou, Tschechien. Sie hat 961 Einwohner auf 18,32 km² und somit eine Bevölkerungsdichte von 52 Einw./km²."},{"page_url":"https://hu.wikipedia.org/wiki/Roma_Termini","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/New_passenger_building_-_interior_-_3.jpg","page_title":"Roma Termini","context_page_description":"Roma Termini egy vasúti fejpályaudvar Rómában, Olaszországban. Egyike az ország 13 legforgalmasabb pályaudvarának, így a Grandi Stazioni üzemelteti. 1862-ben nyílt meg. Napjainkban számos olaszországi és nemzetközi vonat végállomása. Vonatok indulnak innen Párizs, München, Genova, Bázel és Bécs felé. Nevét a főépülettel szemben található Diocletianus termái ókori épületegyütteséről kapta, homlokzati frízét a Rómában élő híres magyar szobrászművész, Amerigo Tot készítette."},{"page_url":"https://pt.wikipedia.org/wiki/Hans-Joachim_Koellreutter","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Wu-li.jpg","page_title":"Hans-Joachim Koellreutter","context_page_description":"Hans-Joachim Koellreuter foi um compositor, professor e musicólogo brasileiro de origem alemã. Mudou-se para o Brasil em 1937 e tornou-se um dos nomes mais influentes na vida musical no país."},{"page_url":"https://en.wikipedia.org/wiki/Mercedes-Benz_W124","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/1988_Mercedes-Benz_300d_Diesel_Automatic_3.0_Rear.jpg","page_title":"Mercedes-Benz W124","context_page_description":"W124 is the Mercedes-Benz internal chassis-designation for the 1985 to 1995/96 version of the Mercedes-Benz E-Class, as well as the first generation to be officially referred to as E-Class. The W124 models replaced the W123 models after 1985 and were succeeded by the W210 E-Class after 1995.\\nIn North America, the W124 was launched in early November 1985 as a 1986 model and sold through the 1995 model year, through 7 November 1995.\\nSeries production began at the beginning of November 1984, with press reveal taking place on Monday, 26 November 1984 in Seville, Spain, with customer deliveries and European market launch starting in January 1985."},{"page_url":"https://de.wikipedia.org/wiki/Villalba_de_los_Alcores","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Villalba_de_los_Alcores_Santa_Mar%C3%ADa_del_Templo_890.jpg","page_title":"Villalba de los Alcores","context_page_description":"Villalba de los Alcores ist ein nordspanischer Ort und eine Gemeinde mit 409 Einwohnern im Nordosten der Provinz Valladolid der Autonomen Gemeinschaft Kastilien-León. Der gesamte Ort mit seiner Burg ist als Conjunto histórico-artístico anerkannt."},{"page_url":"https://pl.wikipedia.org/wiki/Fa%C5%82d%C3%B3wka_k%C4%99dzierzawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Plicaturopsis_crispa_G3.2.jpg","page_title":"Fałdówka kędzierzawa","context_page_description":"Fałdówka kędzierzawa – gatunek grzybów z rzędu pieczarkowców."},{"page_url":"https://sv.wikipedia.org/wiki/Dodecatheon_conjugens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Dodecatheon_conjugans_-_Bonneville_shooting_star%2C_Jumalatelille_liik_C_IMG_7719.JPG","page_title":"Dodecatheon conjugens","context_page_description":"Dodecatheon conjugens är en viveväxtart som beskrevs av Edward Lee Greene. Dodecatheon conjugens ingår i släktet Dodecatheon och familjen viveväxter. Utöver nominatformen finns också underarten D. c. viscidum."},{"page_url":"https://pl.wikipedia.org/wiki/Museo_de_Huesca","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Huesca_-_Museo_de_Huesca_01.jpg","page_title":"Museo de Huesca","context_page_description":"Museo de Huesca – muzeum mieszczące się w Huesce w regionie Aragonii. Znajdująca się w nim kolekcja obejmuje sztuki piękne i archeologię. Główną siedzibą muzeum są budynki dawnego Uniwersytetu Sertoriańskiego i Pałacu Królów Aragońskich z XII wieku.\\nDzieła sztuki pochodzą głównie z aragońskich klasztorów przejętych przez państwo w czasie nacjonalizacji i sprzedaży majątków kościelnych. Muzeum powstało dzięki wsparciu malarza Valentína Carderery, który nadzorował jego założenie i przekazał mu swoją prywatną kolekcję. W muzeum znajdują się dzieła Francisca Goi oraz szkice przygotowawcze do obrazu Dzwon z Hueski José Casady del Alisala."},{"page_url":"https://no.wikipedia.org/wiki/Allround-VM_p%C3%A5_sk%C3%B8yter_1986,_menn","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Ludwig-Schwabl-Stadion_Inzell.jpg","page_title":"Allround-VM på skøyter 1986, menn","context_page_description":"Allround-VM på skøyter 1986, menn ble arrangert på Ludwig Schwabl Stadion i Inzell, Vest-Tyskland den 15. og 16. februar 1986. Hein Vergeer fra Nederland ble verdensmester."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%BE%D5%B8%D6%82%D5%A1%D5%A5%D5%AC_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D4%BC%D5%B8%D6%82%D5%AB%D5%A6%D5%AB%D5%A1%D5%B6%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Bunkie_TX_%26_Pac._RR.jpg","page_title":"Ավուաել շրջան (Լուիզիանա)","context_page_description":"Ավուաել շրջան, ԱՄՆ Լուիզիանա նահանգի 64 վարչական միավորներից մեկը։ Ընդհանուր տարածությունը 2.243 կմ² է, բնակչությունը՝ 42.073 մարդ ։ Շրջկենտրոնն է Մարկսվիլ բնակավայրը։ Կազմավորվել է 1807 թ.։\\nՕգտագործված աղբյուրներ\\nՏվյալներ ԱՄՆ վիճակագրության բյուրոյի կայքում\\nԾանոթագրություններ և նշումներ"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B5%8D%E0%B4%AF%E0%B5%81%E0%B4%B5%E0%B5%86%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%8B_%E0%B4%B1%E0%B4%BF%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%8B_%E0%B4%87%E0%B5%BB%E0%B4%A1%E0%B4%BF%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B5%86%E0%B5%BB%E0%B4%A1%E0%B5%BB%E0%B4%B8%E0%B5%8D_%E0%B4%AA%E0%B4%BE%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Flag_of_Puerto_Rico.svg","page_title":"പ്യുവെർട്ടോ റിക്കോ ഇൻഡിപ്പെൻഡൻസ് പാർട്ടി","context_page_description":"അമേരിക്കന് ഐക്യനാടുകളിൽ നിന്നും സ്വാതന്ത്ര്യം നേടുക എന്ന ഉദ്ദേശത്തോടെ പ്യുവെർട്ടോ റിക്കോയിൽ ഉണ്ടായ രാഷ്ട്രീയ കക്ഷിയാണ്‌ പ്യുവെർട്ടോ റിക്കോ ഇൻഡിപ്പെൻഡൻസ് പാർട്ടി. പ്യുവെർട്ടോ റിക്കോയിലെ പ്രധാന മൂന്നു പാർട്ടികളിലൊന്നും, രജിസ്റ്റർ ചെയ്ത രാഷ്ട്രീയ കക്ഷികളുടെ പഴക്കത്തിൽ രണ്ടാംസ്ഥാനത്തു നില്ക്കുന്നതുമാണ്‌ ‌.\\nഈ പാർട്ടിയിൽ വിശ്വസിക്കുന്നവരെ പാശ്ചാത്യ ലോകം പൊതുവേ സ്വാതന്ത്ര്യസേനാനികള് എന്നോ പിപിയോളോസ് എന്നോ വിളിക്കുന്നു."},{"page_url":"https://sr.wikipedia.org/wiki/Visinska_mo%C4%8Dvara","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/NSGEwM.jpg","page_title":"Visinska močvara","context_page_description":"Visinske močvare ili ombrotrofne močvare su kiseli, vlažni habitati koji su siromašni u mineralnim solima. U njima obitava flora i fauna koja može da podnese takve ekstremne uslove. Visinske močvare, za razliku od nizijskih močvara se isključivo napaju precipitacijom i mineralnim solima uvedenim iz vazduha. One stoga predstavljaju specijalan tip tresave, hidrološki, ekološki i u smislu njihove razvojne istorije. U njima rast torfenske mahovine tokom vekova i milenijuma igra odlučnu ulogu. One isto tako imaju različiti karakter od pokrovnih močvara, koje su mnogo tanje i javljaju se u vlažnijim, oblačnijim klimatskim zonama."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%B0%D0%B8%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Anga%C3%AFs_vue_1.JPG","page_title":"Ангаис","context_page_description":"Ангаис — Францин гӀала-коммуна, лаьтта Керла Аквитани регионехь. Коммунан департамент — Атлантикан Пиренейш департамент. По гуон юкъа йогӀу. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/Zhonghe%E2%80%93Xinlu_line","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Dingxi_Station_Exit.JPG","page_title":"Zhonghe–Xinlu line","context_page_description":"The Zhonghe–Xinlu or Orange line is a metro line in Taipei operated by Taipei Metro, named after the districts it connects: Zhonghe, Xinzhuang and Luzhou. The line starts at Nanshijiao in Zhonghe, passes through central Taipei, then splits into two branches: one to Huilong in Xinzhuang, and one to Luzhou.\\nThe southern section between Nanshijiao and Guting opened in 1998. Due to heavy traffic for residents in the districts of Luzhou and Sanchong travelling in and out of central Taipei, a metro line was planned to meet this urgent need. The line would eventually consist of two branches which connects to Guting via central Taipei. The extension fully opened in 2012."},{"page_url":"https://fr.wikipedia.org/wiki/Couin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Chapelle_Couin_2.jpg","page_title":"Couin","context_page_description":"Couin est une commune française située dans le département du Pas-de-Calais en région Hauts-de-France."},{"page_url":"https://en.wikipedia.org/wiki/Dajnko_alphabet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Peter_Dajnko_-_Posvetne_pesmi_%281827%2C_fragment%29.jpg","page_title":"Dajnko alphabet","context_page_description":"The Dajnko alphabet was a Slovene alphabet invented by Peter Dajnko. It was used from 1824 to 1839 mostly in Styria."},{"page_url":"https://pt.wikipedia.org/wiki/Estrangulamento","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Cheetah_with_impala.jpg","page_title":"Estrangulamento","context_page_description":"Estrangulamento é o ato que consiste em pressionar o pescoço interrompendo o fluxo de oxigênio para o cérebro, podendo levar a pessoa que sofre a ação à inconsciência ou mesmo à morte. Em medicina forense chama-se de estrangulamento aquele causado ou não por laços de diversos tipos de materiais que proporcionam lesões distintas.\\nNo estrangulamento, poderá ser verificado na vítima a existência de um ou múltiplos sulcos horizontais, de profundidade uniforme, que não se interrompe e se localiza no meio do pescoço\\nExiste também o estrangulamento antebraquial que ocorre através da constrição do pescoço pela ação do braço e do antebraço sobre a laringe, o que é popularmente chamado como gravata.\\nCaso sejam usadas as mão para provocar a constrição no pescoço da vítima, a medicina forense chama este ato de esganadura."},{"page_url":"https://es.wikipedia.org/wiki/Crimea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Simferopol_04-14_img18_K-Marx-Street.jpg","page_title":"Crimea","context_page_description":"Crimea es una península del este de Europa, ubicada en la costa septentrional del mar Negro. Se localiza al sur del óblast ucraniano de Jersón, uniéndose a él por el istmo de Perekop, y al este el krai ruso de Krasnodar, del cual se une artificialmente por medio de un puente que pasa sobre el estrecho de Kerch, además el mar de Azov se encuentra al noroeste de la península. Tiene una superficie de 27 000 km².\\nPolíticamente, Crimea es en la actualidad un territorio disputado entre Rusia y Ucrania. El Imperio ruso conquistó la península en 1774 en la guerra turco-rusa y la incorporó al Kanato de Crimea, para ser integrada en el imperio en 1783. En la era soviética, la administración de la península pasó de la RSFS de Rusia a la RSS de Ucrania y, tras la disolución de la Unión, permaneció en la Ucrania postsoviética, estableciéndose una república autónoma en la península, así como un régimen especial para la ciudad de Sebastopol, administrada directamente por el gobierno central ucraniano durante 24 años."},{"page_url":"https://en.wikipedia.org/wiki/43rd_Infantry_Regiment_(France)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Barp.jpg","page_title":"43rd Infantry Regiment (France)","context_page_description":"The 43rd Infantry Regiment was a French infantry regiment which dated back to the creation in 1638 of the Régiment Royal des Vaisseaux - one of the regiments of the Maison militaire du roi de France created to serve on boats and in the colonies: all such regiments were, in 1791, given a number in the line-infantry order of battle meaning that they could be considered historically as the \\"ancestors\\" of the naval infantry regiments."},{"page_url":"https://en.wikipedia.org/wiki/2003_Seattle_Mariners_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Ryan_Feierabend.jpg","page_title":"2003 Seattle Mariners season","context_page_description":"The Seattle Mariners 2003 season was their 27th since the franchise creation, and ended the season finishing 2nd in the American League West, finishing with a record of 93-69.\\nOne notable fact about the 2003 Mariners is that they used only five starting pitchers the entire season. The five starting pitchers were Ryan Franklin, Freddy Garcia, Gil Meche, Jamie Moyer and Joel Piñeiro."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E6%B1%9F%E5%85%A7%E6%B5%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/1600_drawing_of_Dutch_ships_in_Taiwan.jpg","page_title":"臺江內海","context_page_description":"台江内海为17世纪台湾南部的一座大潟湖，简称台江，“内海”则为台语“潟湖”之意。此湖位于台南海岸边，是为台南市外海沙洲与海岸线中间所围绕而成，长度约为数十公里。而内海中最大岛屿为大员。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%8F%AD%E8%BE%BE%E5%B0%94%C2%B7%E6%9C%AC%C2%B7%E8%8B%8F%E5%B0%94%E5%9D%A6%C2%B7%E9%98%BF%E5%8B%92%E6%B2%99%E7%89%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Bandar_bin_Sultan.jpg","page_title":"班达尔·本·苏尔坦·阿勒沙特","context_page_description":"班達爾·本·蘇爾坦親王，全名為班達爾·本·蘇爾坦·本·阿卜杜勒-阿齊茲·紹德沙烏地阿拉伯外交家和國務活動家。他是沙烏地阿拉伯最有影響力的人士之一。在1983年到2005年間出任沙烏地阿拉伯駐美國大使。2005年10月16日，沙烏地阿拉伯國王阿卜杜拉·本·阿卜杜勒-阿齊茲任命他為紹德國家安全委員會主席。"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Monmouth_County,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Allenhurst_Railroad_Station_%283%29.JPG","page_title":"National Register of Historic Places listings in Monmouth County, New Jersey","context_page_description":"List of the National Register of Historic Places listings in Monmouth County, New Jersey\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Monmouth County, New Jersey. The locations of National Register properties and districts may be seen in an online map by clicking on \\"Map of all coordinates\\".\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D1%8D%D0%B9,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/James_Roday_by_Gage_Skidmore.jpg","page_title":"Родэй, Джеймс","context_page_description":"Джеймс Родэ́й, урожд. Джеймс Дэ́вид Родри́гес — американский актёр, сценарист, режиссёр и продюсер. Наибольшую популярность приобрел после роли Шона Спенсера в сериале «Ясновидец»."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D9%85%D8%A7%D9%8A%D9%86_%D8%B3%D8%A7%D9%88%D9%8A%D8%B1%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Romaine_Sawyers_2014.jpg","page_title":"روماين ساويرس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nروماين ساويرس لاعب كورة قدم من سينت كريستوفر و نيفيس."},{"page_url":"https://pt.wikipedia.org/wiki/Dohis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Dohis_vue_depuis_route_de_Parfondeval_1.jpg","page_title":"Dohis","context_page_description":"Dohis é uma comuna francesa na região administrativa de Altos da França, no departamento de Aisne. Estende-se por uma área de 8,1 km². Em 2010 a comuna tinha 92 habitantes."},{"page_url":"https://pl.wikipedia.org/wiki/Historia_pierwiastk%C3%B3w_chemicznych","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Binding_energy_curve_-_common_isotopes-pl.svg","page_title":"Historia pierwiastków chemicznych","context_page_description":"Historia pierwiastków chemicznych – dzieje zmian chemicznego składu „zwykłej materii”, od ery promieniowania do współczesnego Wszechświata – z dzisiejszym zróżnicowaniem gęstości materii oraz zawartości poszczególnych pierwiastków chemicznych."},{"page_url":"https://en.wikipedia.org/wiki/Diego_Biseswar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Diego_Biseswar_001.jpg","page_title":"Diego Biseswar","context_page_description":"Diego Marvin Biseswar is a Dutch professional footballer who plays as a left winger for Greek club PAOK."},{"page_url":"https://es.wikipedia.org/wiki/Constituci%C3%B3n_de_Ir%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Khomeini_motahari_tabatabaei_ghotbzadeh_Lahouti_banisadr.jpg","page_title":"Constitución de Irán","context_page_description":"La Constitución de la República Islámica de Irán​​ fue aprobada mediante un referéndum realizado entre el 2 y 3 de diciembre de 1979, y reemplazó a la fuerza la constitución de 1906.​​​ Fue sometida a una reforma el 28 de julio de 1989.​ La constitución es considerada como un \\"híbrido\\" entre \\"elementos teocráticos y democráticos\\". Mientras que los artículos I y II otorgan la soberanía a Dios, el artículo VI afirma la \\"orden de convocar elecciones populares para la presidencia y el Majlis o parlamento.\\"​ Sin embargo, todos los derechos y procedimientos democráticos están subordinados ante el Consejo de Guardianes y al Líder Supremo, cuyos poderes están detallados en el Capítulo VIII.​"},{"page_url":"https://ro.wikipedia.org/wiki/Bl%C3%A9court,_Haute-Marne","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Map_commune_FR_insee_code_52055.png","page_title":"Blécourt, Haute-Marne","context_page_description":"Blécourt este o comună în departamentul Haute-Marne din nord-estul Franței. În 2009 avea o populație de 109 de locuitori."},{"page_url":"https://id.wikipedia.org/wiki/Supergugus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Galaxy_superclusters_and_galaxy_voids.png","page_title":"Supergugus","context_page_description":"Supergugus adalah suatu struktur alam semesta yang terdiri dari beberapa gugusan galaksi dan grup galaksi, masing-masing supergugus memiliki massa sekitar 10¹³ - 10¹⁴ Massa matahari dan bisa berukuran berjuta-juta Tahun cahaya. Misalnya, supergugus Hydra yang berukuran 100 juta Tahun Cahaya dan supergugus perseus-pisces. grup Lokal dimana Galaksi Bima Sakti berada merupakan bagian dari supergugus Virgo bersama beberapa grup galaksi dan gugus galaksi lainnya.\\nSetiap supergugus saling terhubung dengan supergugus satu sama lain, Sehingga membentuk formasi Struktur Kosmos yang disebut jaringan kosmik, Filamen galaksi, dan Void."},{"page_url":"https://af.wikipedia.org/wiki/Lys_van_afhanklike_gebiede","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Denmark_Dependencies.PNG","page_title":"Lys van afhanklike gebiede","context_page_description":"Hierdie is 'n lys van afhanklike gebiede."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%90%D4%BB%D4%BF%D5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Map_of_BRICS_countries.svg","page_title":"ԲՐԻԿՍ","context_page_description":"ԲՐԻԿՍ-ը հինգ երկրների խումբ է, որոնց անդամ են Բրազիլիան, Ռուսաստանը, Հնդկաստանը, Չինաստանը և ՀԱՀ-ը։\\nBRIC հապավումն առաջին անգամ 2001 թվականին առաջարկել է բիզնես վերլուծաբան Ջիմ Օ՚Նիլը։ 2011 թվականի փետրվարի 18-ին ՀԱՀ-ի միանալուց հետո Հնդկաստանի ֆինանսների նախարարի հայտարարությամբ խումբը սկսեց կրել BRICS անվանումը։\\nԽմբի անվանումը ոչ միայն ապահովում է հնչեղություն, այլ նաև անգլերենում BRICS բառի տառադարձությունը շատ նման է անգլերեն bricks բառին, որը նշանակում է «աղյուս»։ Այսպիսով տերմինն օգտագործվում է որպես երկրների մի խումբ, որոնց զարգացումը մեծապես կապահովի համաշխարհային տնտեսության աճը։\\nՓորձագետները չէին սպասում ԲՐԻԿ խմբի երկրների միջև տնտեսական համագործակցություն։ Մանավանդ չէին ենթադրում, որ ԲՐԻԿ-ի երկրները կձևավորեն մի տնտեսական բլոկ կամ պաշտոնական առևտրային ասոցիացիա, ինչպիսին է Եվրասիական տնտեսական միությունը։ Սակայն ժամանակի ընթացքում երևաց, որ ԲՐԻԿ խմբի չորս երկրները փորձում են ստեղծել մի քաղաքական ակումբ կամ խորհուրդ, և այդ կերպ իրենց զարգացող տնտեսական հզորությունը վերափոխել աշխարհաքաղաքական ազդեցության։"},{"page_url":"https://es.wikipedia.org/wiki/Dignonville","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Map_commune_FR_insee_code_88133.png","page_title":"Dignonville","context_page_description":"Dignonville es una población y comuna francesa, en la región de Lorena, departamento de Vosgos, en el distrito de Épinal y cantón de Épinal-Est.Sus habitantes son llamados Branlous y Branloutes."},{"page_url":"https://en.wikipedia.org/wiki/Maryville_Alcoa_Greenway","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/MAG_at_Springbrook.jpg","page_title":"Maryville Alcoa Greenway","context_page_description":"The Maryville Alcoa Greenway is a cooperative effort by the two cities and Blount County, Tennessee to connect existing parks with a paved foot and cycle path."},{"page_url":"https://de.wikipedia.org/wiki/Kunstgewerbemuseum_Berlin","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Welfenkreuz_Vorderseite_KGM.jpg","page_title":"Kunstgewerbemuseum Berlin","context_page_description":"Das Kunstgewerbemuseum der Staatlichen Museen zu Berlin gilt als eine der bedeutendsten Sammlungen europäischen Kunsthandwerks vom Mittelalter bis zur Gegenwart. Das Museum entstand 1867 und hat seinen Standort sowie seinen Namen bis 1995 mehrfach geändert, die Ausstellungsräumlichkeiten wurden stetig vergrößert. Im Jahr 1985 wurde das neu errichtete Ausstellungsgebäude im Kulturforum in Berlin-Mitte eröffnet. Zum Kunstgewerbemuseum gehört die Filiale im Schloss Köpenick, die bis 1990 eine eigenständige Einrichtung in Ost-Berlin war.\\nIm Jahr 2019 verzeichnete das Kunstgewerbemuseum rund 51.000 Besucher."},{"page_url":"https://simple.wikipedia.org/wiki/Creation_myth","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Song_of_Ur-Nammu_AO5378_mp3h9129.jpg","page_title":"Creation myth","context_page_description":"A creation myth or creation story explains how the universe started, how the earth came to be, and why there are humans. Creation myths are usually part of religions and mythologies. Very often, creation myths say that humans were made by a god, spirit or other supreme being."},{"page_url":"https://it.wikipedia.org/wiki/Lanthieri","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Torre_Lantieri_-_Paratico_%28Foto_Luca_Giarelli%29.jpg","page_title":"Lanthieri","context_page_description":"I Lantieri sono una nobile famiglia con varie ramificazioni."},{"page_url":"https://es.wikipedia.org/wiki/Hazebrouck","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Map_commune_FR_insee_code_59295.png","page_title":"Hazebrouck","context_page_description":"Hazebrouck es una comuna francesa ubicada en el Departamento del Norte, en la región francesa de Norte-Paso de Calais. Esta ciudad de 22 000 habitantes es relativamente importante la tercera de la demarcación de Dunkerque, y la 16.a del Departamento del Norte."},{"page_url":"https://de.wikipedia.org/wiki/Marbach_am_Neckar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/SchillerDenkmalMarbachAusschnitt.jpg","page_title":"Marbach am Neckar","context_page_description":"Marbach am Neckar ist eine Stadt etwa 20 Kilometer nördlich von Stuttgart. Sie gehört zum Landkreis Ludwigsburg, zur Region Stuttgart und zur europäischen Metropolregion Stuttgart. Marbach ist bekannt als Geburtsstadt Friedrich Schillers; die Stadt ist Sitz des Schiller-Nationalmuseums, des Deutschen Literaturarchivs und des Literaturmuseums der Moderne."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B5%D0%B9%D0%BD%D1%81,_%D0%A3%D0%BE%D1%80%D1%80%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Warren_Haynes_12-5-2013.jpg","page_title":"Хейнс, Уоррен","context_page_description":"Уо́ррен Хейнс — американский рок- и блюзовый гитарист и вокалист.\\nНаиболее известен по своей продолжительной работе в качестве гитариста в группе Allman Brothers Band и как один из основателей и оригинальных участников группы Gov’t Mule. Также на заре своей музыкальной карьеры был гитаристом у Дэвида Аллана Ко и в группе Дики Беттса The Dickey Betts Band. Также музыкант известен по своей работе с оставшимися в живых участниками Grateful Dead — в частности, он ездил в концертные туры с «Филом Лешем и друзьями» и группой «The Dead». Также Хейнс основал и руководит лейблом звукозаписи Evil Teen Records.\\nЖурнал «Роллинг стоун» поместил Уоррена Хейнса на 23 место в своём опубликованном в 2003 году «Списке ста величайших гитаристов всех времен»."},{"page_url":"https://af.wikipedia.org/wiki/Hanns_Johst","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Bundesarchiv_Bild_183-2007-1010-501%2C_Hanns_Johst.jpg","page_title":"Hanns Johst","context_page_description":"Hanns Johst was 'n Duitse Naziistiese skrywer van toneelstukke, wat uit ekspressionisme gespruit het. Hy was ook die voorsitter van die Reichsschrifttumskammer."},{"page_url":"https://pt.wikipedia.org/wiki/Uni%C3%A3o_Econ%C3%B4mica_e_Monet%C3%A1ria_do_Oeste_Africano","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Africa-countries-UEMOA.svg","page_title":"União Econômica e Monetária do Oeste Africano","context_page_description":"A União Econômica e Monetária do Oeste Africano é uma organização de integração regional criada por sete países da África Ocidental que têm em comum uma moeda única, o Franco CFA.\\nA UEMOA foi criada por um tratado assinado em Dakar, Senegal, a 10 de janeiro de 1994 pelos Chefes de Estado e de Governo do Benim, Burkina Faso, Costa do Marfim, Mali, Níger, Senegal e Togo. A 2 de maio de 1997, a Guiné-Bissau tornou-se o oitavo estado membro da União."},{"page_url":"https://pt.wikipedia.org/wiki/Mick_Taylor","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Mick_Taylor2.jpg","page_title":"Mick Taylor","context_page_description":"Michael \\"Mick\\" Kevin Taylor é um guitarrista britânico, mais conhecido por ter sido um dos guitarristas dos The Rolling Stones entre 1969 e 1974, período após o qual seguiu carreira solo. Foi considerado o 37º melhor guitarrista da história, em enquete da revista norte-americana Rolling Stone.Utiliza uma guitarra Gibson Les Paul."},{"page_url":"https://en.wikipedia.org/wiki/Austrian_Silesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%C3%96sterreichisch-Schlesien_1746_en.svg","page_title":"Austrian Silesia","context_page_description":"Austrian Silesia, officially the Duchy of Upper and Lower Silesia, was an autonomous region of the Kingdom of Bohemia and the Habsburg Monarchy. It is largely coterminous with the present-day region of Czech Silesia and was, historically, part of the larger Silesia region."},{"page_url":"https://it.wikipedia.org/wiki/Eton_(Berkshire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Uk-eton-high-street.jpg","page_title":"Eton (Berkshire)","context_page_description":"Eton è una città del Regno Unito, situata nel Berkshire, in Inghilterra."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%89%E5%B7%9D%E7%AB%99_(%E5%9F%BC%E7%8E%89%E7%B8%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/JR_JM_line_symbol.svg","page_title":"吉川站 (埼玉縣)","context_page_description":"吉川站是一個位於埼玉縣吉川市木賣一丁目，屬於東日本旅客鐵道武藏野線的鐵路車站。車站編號是JM 20。"},{"page_url":"https://de.wikipedia.org/wiki/Biometrischer_Reisepass","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Bundesarchiv_B_145_Bild-F079070-0030%2C_Flughafen_Frankfurt-Main%2C_Zollkontrolle.jpg","page_title":"Biometrischer Reisepass","context_page_description":"Der biometrische Reisepass ist eine Kombination eines papierbasierten Reisepasses mit elektronischen Komponenten. Der ePass enthält biometrische Daten, die verwendet werden, um die Identität eines Reisenden feststellen zu können. Die weltweite Einführung von biometrischen Pässen wurde durch die Behörden der USA nach den Terroranschlägen vom 11. September 2001 gefordert."},{"page_url":"https://ru.wikipedia.org/wiki/Dorcadiini","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Dorcadion_aries.jpg","page_title":"Dorcadiini","context_page_description":"Dorcadiini — триба жесткокрылых из семейства усачей."},{"page_url":"https://de.wikipedia.org/wiki/Digitales_Stellwerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/GGB_Bhe_4-8_Riffelboden.jpg","page_title":"Digitales Stellwerk","context_page_description":"Ein digitales Stellwerk ist ein elektronisches Stellwerk, bei dem die Stellbefehle per Informationstechnik, z. B. über ein Datennetz, statt über konventionelle Kabel an die Weichen und falls vorhanden an Signale übermittelt werden."},{"page_url":"https://de.wikipedia.org/wiki/Font-de-Gaume","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Font_De_Gaume_vue_generale.jpg","page_title":"Font-de-Gaume","context_page_description":"Font-de-Gaume ist eine Höhle im Gebiet der französischen Gemeinde Les Eyzies im Département Dordogne. Mit ihren zahlreichen, polychromen Höhlenmalereien aus der Zeit des Magdalénien gehört sie zu den bedeutendsten Bilderhöhlen der Frankokantabrischen Höhlenkunst. Zugleich ist Font-de-Gaume die letzte noch öffentlich zugängliche Höhle mit polychromer Bemalung aus dem Jungpaläolithikum."},{"page_url":"https://hu.wikipedia.org/wiki/Csoszon_t%C3%A1rsadalma","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Gammo_yeojaedo-03.jpg","page_title":"Csoszon társadalma","context_page_description":"Csoszon társadalma konfuciánus eszmék, a három sarkalatos alapelv és az öt erkölcsi norma szerint épült fel. Négy osztály alkotta, a jangban, a nemesség, a csungin, a tulajdonképpeni középosztály, a szangmin, azaz a köznép, valamint a kitaszítottak rétege, a cshonmin. A társadalom urai a népesség alig 10%-át alkotó jangban ok voltak, akik számos privilégiummal rendelkeztek. A ranglétra legalján a rabszolgák helyezkedtek el.\\nEbben a korban jelentősen szigorodott a klánstruktúra a koreai társadalomban, a vérvonal elsődleges fontosságúvá vált. A családok életét törvénykönyv szabályozta, az egyes ceremóniák megkövetelésével és rítusainak pontos leírásával. A Korjo -korhoz képest jelentős változáson ment át a házasság intézménye, melyre számos szigorú szabály vonatkozott. Egy férfinak több felesége, illetve ágyasa is lehetett, a köznép, illetve rabszolga sorsú nőktől született gyermekek azonban illegitimnek számítottak.\\nA nők helyzete jelentősen romlott a korábbi korokhoz képest, a nemesi származású nőket teljesen elzárták a külvilágtól."},{"page_url":"https://it.wikipedia.org/wiki/Trans_World_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/TWA_L-049.jpg","page_title":"Trans World Airlines","context_page_description":"Trans World Airlines, Inc., ribattezzata TWA Airlines LLC nel 2001, è stata una delle maggiori compagnie aeree degli Stati Uniti con hub a St. Louis, New York, Denver e Kansas City. La compagnia operò dal 1930 fino a quando fu acquistata dalla American Airlines nel 2001.\\nIn passato la TWA era una delle più grandi compagnie aeree degli Stati Uniti, volando tra St. Louis alla maggior parte delle città americane. Ebbe anche un non trascurabile servizio di navette dalle città più piccole del Mid West. Fuori dagli Stati Uniti, la TWA aveva una rete di collegamenti ben sviluppata con l'Europa e il Medio Oriente, servita principalmente dallo hub di JFK. Prima della deregulation del 1978, la TWA, l'American Airlines, la United Airlines e la Pan Am erano conosciute come le \\"Big Four\\", in quanto erano le quattro più grandi compagnie aeree statunitensi."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1949","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Bruce_springsteen_front.jpg","page_title":"Lijst van personen geboren in 1949","context_page_description":"Dit is een lijst van personen die geboren zijn in 1949.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B6%B3%E5%88%A9%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ait-library073.JPG","page_title":"足利大学","context_page_description":"足利大学は、栃木県足利市大前町268-1に本部を置く日本の私立大学である。1967年に設置された。大学の略称は足大、英称ではAU。"},{"page_url":"https://sco.wikipedia.org/wiki/Black-breastit_throstle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Turdus_dissimilis_female_-_Ang_Khang.jpg","page_title":"Black-breastit throstle","context_page_description":"The black-breastit throstle is a species o bird in the faimily Turdidae. It is foond in Sooth Asie, Sootheast Asie an Cheenae. Awtho baith male an female birds hae the same colour on their lawer pairts, the upper section o males is maistly black in colour, while females are maistly grey-broun. Thus, the bird's common name refers tae the colour o the male bird's breast. They tend tae live in forests locatit at heich altitude."},{"page_url":"https://en.wikipedia.org/wiki/Greg_K.","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Greg_Kriesel_live_in_Rome.jpg","page_title":"Greg K.","context_page_description":"Gregory David Kriesel, known professionally as Greg K., is an American musician known as the bass guitarist and backing vocalist for the punk band The Offspring from 1984 to 2018."},{"page_url":"https://ru.wikipedia.org/wiki/Tcsh","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Tcsh_screenshot.png","page_title":"Tcsh","context_page_description":"TENEX C Shell или tcsh — одна из командных оболочек UNIX, созданная Кэном Гриром.\\nГлавной особенностью оболочки стала возможность автодополнения путей и команд. Во многом, именно эта особенность стала причиной популярности TENEX.\\nНекоторые возможности:\\nредактирование командной строки с поддержкой стилей vi и emacs;\\nпрограммируемое автодополнение;\\nпроверка правописания имён файлов, команд и переменных;\\nрасширенный механизм навигации по каталогам;\\nпериодические события;\\nвозможность указания в приглашении различной полезной информации.\\nTcsh является командной оболочкой по умолчанию в ОС FreeBSD. Для пользователя root не рекомендуется менять эту оболочку на какую-либо другую.\\nВ настройках по умолчанию история команд фильтруется по первым уже введённым символам, например если набрать cd и нажимать стрелки «вверх-вниз», то из истории будут отображаться только те команды, которые начинаются с cd."},{"page_url":"https://az.wikipedia.org/wiki/Morj","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/PolarBearWalrusTuskCarving.jpg","page_title":"Morj","context_page_description":"Su inəyi və ya Morj — dəniz məməlisi olaraq Morjkimilər fəsiləsinə daxil olan müasir dönəmdə mövcud olan növ. Yaşlı fərdi asanlıqla cavan fərddən fərqləndirmək olur. Bu dəniz canlısı ölçülərinə görə pərayaqlılar arasında yalnız Dəniz filindən geri qalır. Arealı əsasən Arktika qurşağında yerləşir."},{"page_url":"https://de.wikipedia.org/wiki/Ochodaeidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Codocera_ferruginea.jpg","page_title":"Ochodaeidae","context_page_description":"Die Ochodaeidae sind eine Familie der Käfer aus der Überfamilie Scarabaeoidea. Die Familie ist nahezu weltweit verbreitet und fehlt nur in Australien und Neuseeland. Sie umfasst zwei Unterfamilien mit 10 Gattungen und etwa 80 Arten. Der Schwerpunkt der Verbreitung liegt in der Holarktis, dem südlichen Afrika und Madagaskar. In Europa wurden bisher elf Arten nachgewiesen."},{"page_url":"https://de.wikipedia.org/wiki/SC_Magdeburg_(Handball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/SC_Magdeburg_03.jpg","page_title":"SC Magdeburg (Handball)","context_page_description":"Die Abteilung Handball des SC Magdeburg ist eine der erfolgreichsten des Sportclubs. Der SCM ist der erste deutsche Handballverein, der 2002 die Champions League im Handball gewinnen konnte. Mit dem Gewinn des DHB-Pokals 2016 holten die Magdeburger in ihrer 60. Saison ihren 30. Titel im Herrenbereich. Derzeit liegt der SCM in dieser Kategorie hinter dem THW Kiel gleichauf mit dem VfL Gummersbach auf Rang 2. Weitere zwei Titel wurden im Damenhandball gewonnen, sodass der SCM insgesamt 32 nationale und internationale Titel gewann. Von 2002 bis Mitte 2010 führten die Handballer den Zusatznamen „SC Magdeburg Gladiators“. Die Heimspielstätte des SC Magdeburg ist die 7000 Zuschauer fassende GETEC Arena."},{"page_url":"https://hr.wikipedia.org/wiki/Hrvatsko_Kraljevstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Hrvatski_skolski_muzej_krunidba_kralja_Zvonimira_300109.jpg","page_title":"Hrvatsko Kraljevstvo","context_page_description":"Hrvatsko Kraljevstvo nastalo je krunidbom prvoga hrvatskoga kralja Tomislava koji se prema legendi okrunio na Duvanjskom polju, a spominje sa kao kralj godine 925. godine. Za njegovih nasljednika izbijaju dinastičke borbe, potom slijedi mirna i čvrsta vladavina Stjepana Držislava, ponovne dinastičke borbe, te vladavina Petra Krešimira IV. i Dmitra Zvonimira. Hrvatsko Kraljevstvo izgubilo je posljednjeg hrvatskog vladara 1097. godine kada je u bitki na planini Gvozd poginuo posljednji hrvatski kralj Petar Svačić. Unatoč tomu, Hrvatska dobiva stranog vladara tek 1102. godine kada hrvatsko plemstvo prihvaća ugarskoga kralja Kolomana za hrvatskog vladara.\\nOd 1102. godine Kraljevina Hrvatska više nije bila neovisna zemlja, nego kraljevina u personalnoj uniji s Ugarskom. Od 1527. godine, obje kraljevine prihvaćaju za kralja vladara iz dinastije Habsburg - dakle vladarske kuće koja vlada također i Češkom i čitavim Svetim Rimskim Carstvom. Pri tome nisu Hrvatska i Ugarska smatrane dijelovima Svetog Rimskog Carstva."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%93%A5%E6%9C%AC%E5%93%88%E6%A0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Copenhagen_panorama.jpg","page_title":"哥本哈根","context_page_description":"哥本哈根是丹麦的首都、最大城市及最大港口。座落于丹麦西兰岛东部，与瑞典的马尔默隔松德海峡相望。\\n厄勒海峡大桥在2000年完工后，哥本哈根与瑞典的马尔默可透过车辆和铁路往来，促成了两地人力资源的互相交流，每年利用厄勒海峡大桥的通勤人数不断增长。此外大桥通车后也让两座城市之间形成北欧地区最大的城市群。\\n在2008年，《Monocle》杂志将哥本哈根选为“最适合居住的城市”，并给予“最佳设计城市”的评价。哥本哈根在全球城市分类中被列为第二类世界级城市。此外哥本哈根在西欧地区获选为“设置企业总部的理想城市”第三名，仅次于巴黎和伦敦。\\n哥本哈根城市建立之际的名称为“Kjøbmandehavn”，意为“商人的港口”。英语“Copenhagen”的名称来自于低地德语“Kopenhagen”，中文译名也由此而来。"},{"page_url":"https://it.wikipedia.org/wiki/Tenores_di_Bitti_%22Mialinu_Pira%22","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Tenores_di_bitti_mialinu_pira_2.jpg","page_title":"Tenores di Bitti \\"Mialinu Pira\\"","context_page_description":"Il Tenore di Bitti \\"Mialinu Pira\\" è uno dei gruppi a tenore di Bitti, intitolato allo scrittore Michelangelo \\"Mialinu\\" Pira, e nascono nel 1995."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%BE%D1%80%D1%85%D0%B5_%D0%92%D0%B0%D0%BB%D0%B4%D0%B8%D0%B2%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Universidad_de_Chile_-_Colo-Colo%2C_2018-04-15_-_Jorge_Valdivia_-_02.jpg","page_title":"Хорхе Валдивија","context_page_description":"Хорхе Луис Валдивија Торо је чилеански фудбалер.\\nТренутно игра за бразиски Палмеирас, и за Фудбалску репрезентацију Чилеа. Игра на позицији плејмејкера​​. За фудбалску репрезентацију Чилеа игра од 2004.. Професионалну каријеру започео је 2003. године са 19 година. За репрезентацију је играо на светским првенствима 2010. и 2014. године."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D8%A6%D9%88%D9%86%DB%8C%D8%AF_%DA%A9%D8%B1%D8%A7%D8%B3%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Krasin.jpg","page_title":"لئونید کراسین","context_page_description":"لئونید بوریسویچ کراسین یک فعال بلشویک روس، مهندس، کار آفرین اجتماعی و دیپلمات اهل اتحاد جماهیر شوروی بود که بین سال‌های ۱۹۲۴ تا ۱۹۲۵ میلادی به عنوان سفیر اتحاد شوروی در فرانسه فعالیت می‌کرد."},{"page_url":"https://hu.wikipedia.org/wiki/Stazione_di_Ponte_Galeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/PonteGaleria.jpg","page_title":"Stazione di Ponte Galeria","context_page_description":"Stazione di Ponte Galeria vasútállomás Olaszországban, Róma településen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%BE%D0%B1%D0%B6%D0%B5%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Kolobrzeg_c1890-1905_LOC_00729u.jpg","page_title":"Колобжег","context_page_description":"Коло́бжег, немецкое название Ко́льберг — курортный город и бывшая крепость в Польше, на реке Парсента, близ её впадения в Балтийское море. Четвёртый по числу жителей город Западно-Поморского воеводства. Исторический центр города погиб во время Второй мировой войны."},{"page_url":"https://it.wikipedia.org/wiki/Andrea_del_Castagno","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Andrea_del_castagno%2C_Dormition_of_the_Virgin_and_visitation.jpg","page_title":"Andrea del Castagno","context_page_description":"Andrea di Bartolo di Bargilla, detto Andrea del Castagno, è stato un pittore italiano.\\nFu uno dei protagonisti della pittura fiorentina nei decenni centrali del XV secolo, assieme a Beato Angelico, Filippo Lippi, Domenico Veneziano e Paolo Uccello. Il suo stile personalissimo fu influenzato da Masaccio e Donatello, dei quali sviluppò in particolare la resa prospettica, il chiaroscuro plastico, che drammatizzò con l'uso di tinte più scure, e il realismo delle fisionomie e dei gesti, talvolta così esasperato da raggiungere esiti espressionistici.\\nA Firenze la sua lezione fu solo in parte capita e recepita, mentre si sviluppava, in età laurenziana, un gusto prevalentemente legato alla ricercatezza del disegno e a un accordo elegante di tinte chiare. Fu invece a Ferrara che l'opera di Andrea del Castagno venne ulteriormente sviluppata, ponendo le basi per la scuola locale di Cosmè Tura, Francesco del Cossa ed Ercole de' Roberti."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Innenstadt_(G%C3%B6rlitz),_R%E2%80%93Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Rauschwalder_Stra%C3%9Fe_5.jpg","page_title":"Liste der Kulturdenkmale in Innenstadt (Görlitz), R–Z","context_page_description":"In der Liste der Kulturdenkmale in Innenstadt (Görlitz), R–Z sind sämtliche Kulturdenkmale der Görlitzer Innenstadt verzeichnet, die bis Oktober 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden und deren Straßenname mit den entsprechenden Anfangsbuchstaben beginnt. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Görlitz."},{"page_url":"https://cs.wikipedia.org/wiki/Air_Alg%C3%A9rie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Logo_Air_Alg%C3%A9rie.svg","page_title":"Air Algérie","context_page_description":"Air Algérie je národní letecký přepravce v Alžírsku. Společnost byla založena v roce 1946 a provoz zahájila o rok později. Jejím uzlovým letištěm je letiště Houariho Boumédièna. K roku 2014 létá do 28 zemí světa."},{"page_url":"https://de.wikipedia.org/wiki/Turnier","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/De_hertogen_van_Bourbon_en_Bretagne_in_tweegevecht_tijdens_een_toernooi.jpg","page_title":"Turnier","context_page_description":"Bei einem Turnier traten im Mittelalter mehrere Einzelpersonen oder Gruppen in einem Wettkampf gegeneinander an. Der heutige Begriff Turnier für sportliche Wettkämpfe leitet sich davon ab."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%93%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%B2%E0%A7%8D%E0%A6%9F%E0%A6%BE%E0%A6%B0_%E0%A6%95%E0%A7%8B%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Walter_Kohn.jpg","page_title":"ওয়াল্টার কোন","context_page_description":"ওয়াল্টার কোন একজন অস্ট্রীয়-মার্কিন তাত্ত্বিক পদার্থবিজ্ঞানী। তিনি ১৯৯৮ সালে রসায়নে নোবেল পুরস্কার লাভ করেন।"},{"page_url":"https://hu.wikipedia.org/wiki/Kelet-K%C3%B6z%C3%A9p-Anglia","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Image-Major_Oak_in_Sherwood_Forest_in_2006_%282%29.jpg","page_title":"Kelet-Közép-Anglia","context_page_description":"Kelet-Közép-Anglia egyike Anglia kilenc hivatalos régiója közül. Anglia középső területeinek keleti részét jelenti, amelyet Derbyshire, Leicestershire, Lincolnshire nagyobb része, Northamptonshire, Nottinghamshire és Rutland megyék alkotnak.\\nA régió területe 15,627 km² és több mint 4.5 millió embernek ad otthont. Kelet-Közép-Anglia területén négy nagy város található: Derby, Leicester, Lincoln, Nottingham, és több nagyobb település mint Boston, Loughborough, Mansfield, Northhampton és Skegness. London közelsége és néhány nemzeti autópályához való köttetése miatt a térség gazdasági központja. Mindemellett az East Midlands repülőtér is itt található."},{"page_url":"https://es.wikipedia.org/wiki/Samario","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Samarskite.jpg","page_title":"Samario","context_page_description":"El samario es un elemento químico de símbolo Sm y número atómico 62. Presenta una estructura cristalina romboedral, una masa atómica de 150,35 y una densidad de 7,35 g/cm³."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D0%BA%D0%B0_%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Latvija_nodarbin%C4%81tie-bezdarbnieki_15-74.svg","page_title":"Экономика Латвии","context_page_description":"Экономика Латвии — занимает 103-е место среди стран мира по объёму объёму ВВП по, по состоянию на 2018 год. Согласно классификация МВФ Латвия является развитой экономикой, а классификации Всемирного банка входит группу стран с высоким уровнем доходов. Среди постсоветских стран Латвия является одной из самых развитых. По ВВП на душу населения — $18 031. По ВВП на душу населения — $29 901."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%83%D1%81%D0%B5%D0%B9%D0%BD%D0%B7%D0%B0%D0%B4%D0%B5,_%D0%90%D0%BB%D0%B8-%D0%B1%D0%B5%D0%BA_%D0%93%D1%83%D1%81%D0%B5%D0%B9%D0%BD_%D0%BE%D0%B3%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/H%C3%BCseynzad%C9%99_%C6%8Fli_b%C9%99y.jpg","page_title":"Гусейнзаде, Али-бек Гусейн оглы","context_page_description":"Али-бек Гусейн оглы Гусейнзаде — азербайджанский учёный, философ, художник и врач."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%98%BF%E5%B0%94%E8%B4%9D%C2%B7%E5%8B%92%E5%B8%83%E4%BC%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Albert_Lebrun_1932_%282%29.jpg","page_title":"阿尔贝·勒布伦","context_page_description":"阿爾貝·弗朗索瓦·勒布倫，法國政治家，法蘭西第三共和國的最後一位總統。\\n勒布倫出生於默爾特-摩澤爾省上梅西一個農民家庭，以班上最好的成績畢業於巴黎綜合理工學院和礦業學院。原本是法國沃蘇勒和南錫的一名採礦工程師，29歲進入政壇，1900年作為左翼共和黨成員選入眾議院，曾加入內閣擔任公職，處理第一次世界大戰戰時政策。後來加入民主聯盟並在1920年當選為參議員，1925年至1929年間成為參議院副議長。1931年至1932年還當了正式議長一年。1932年他正式當上總統。\\n1939年成功連任，二次大戰爆發，他的總統職位於1940年7月10日被貝當取代，並於同年7月15日逃亡到維濟耶。1943年8月27日德國人進入該地區，他被德國緝獲，被送進蒂羅爾的一個小城堡囚禁。1943年10月10日由於健康不佳，他被允許回到維濟耶，但一直被不斷的監視。\\n1944年8月9日當盟軍解放法國後，勒布倫會見了戴高樂將軍，並承認他的領導，說他沒有正式辭去總統，是因為國民議會已經解散離開，沒有人接受他的辭職。\\n二次大戰結束後他正式歸隱，至1950年3月6日在曠日持久的疾病中死於肺炎。"},{"page_url":"https://en.wikipedia.org/wiki/Modern_physics","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Albert_Einstein_%28Nobel%29.png","page_title":"Modern physics","context_page_description":"Modern physics is an effort to understand the underlying processes of the interactions with matter, utilizing the tools of science and engineering. In general, the term is used to refer to any branch of physics either developed in the early 20th century and onward, or branches greatly influenced by early 20th century physics. Notable branches of modern physics include quantum physics, special relativity, and general relativity.\\nClassical physics is typically concerned with everyday conditions: speeds are much lower than the speed of light, sizes are much greater than that of atoms, and energies are relatively small. Modern physics, however, is concerned with more extreme conditions, such as high velocities that are comparable to the speed of light, small distances comparable to the atomic radius, and very high energies. In general, quantum and relativistic effects are believed to exist across all scales, although these effects may be very small in everyday life. While quantum mechanics is compatible with special relativity, one of the unsolved problems in physics is the unification of quantum mechanics and general relativity, which the Standard model currently cannot account for."},{"page_url":"https://es.wikipedia.org/wiki/Leona_Lewis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Leona_Lewis.jpg","page_title":"Leona Lewis","context_page_description":"Leona Louise Lewis es una cantante británica de R&B y ganadora de la tercera edición del reality show The X Factor de Reino Unido.\\nHa sido nominada a varios premios importantes como \\"Mejor disco del año\\" por Spirit y Echo. También ha sido comparada por la crítica con cantantes de la talla de Céline Dion, Mariah Carey, Whitney Houston y Christina Aguilera.​​ Su primer sencillo lanzado en 2006, «A Moment Like This», logró batir un récord mundial al ser descargada 50.000 veces en menos de 30 minutos. El 12 de noviembre de 2007 lanza su primer álbum de estudio, Spirit, el que debutó en el número uno en nueve países y fue certificado diez veces platino en el Reino Unido.​​ Durante 2007 y 2008 pública «Bleeding Love», como el segundo sencillo del álbum, que logró debutar directo al número uno en 17 países, de los que se inclúyen; Australia, Alemania, Estados Unidos, Reino Unido, Japón, etc. Luego vendrían otros cinco sencillos, de los que se destaca su propia versión de «Run», que obtuvo un gran éxito en Europa.\\nVegetariana desde los doce años, ​ Lewis ganó el certamen de PETA's Sexiest Vegetarian junto con Anthony Kiedis de los Red Hot Chili Peppers en 2008.​"},{"page_url":"https://pl.wikipedia.org/wiki/IC3PEAK","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Against_the_isolation_of_Runet_%282019-03-10%29_103.jpg","page_title":"IC3PEAK","context_page_description":"IC3PEAK – rosyjski duet muzyki elektronicznej z Moskwy, który został założony w październiku 2013 roku. Pierwsze piosenki zostały nagrane w języku angielskim, jednak najnowszy album jest w całości po rosyjsku. W 2018 roku wiele koncertów zostało odwołanych z powodu rzekomego łamania obowiązującego w Rosji prawa."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A6%D8%AD%D8%A9_%D9%81%D9%8A%D8%B1%D9%88%D8%B3_%D9%83%D9%88%D8%B1%D9%88%D9%86%D8%A7_%D9%81%D9%8A_%D8%A7%D9%84%D9%85%D9%83%D8%B3%D9%8A%D9%83_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Acceso_de_personas_con_s%C3%ADntomas_de_enfermedades_respiratorias_al_Instituto_Nacional_de_Ciencias_M%C3%A9dicas_y_Nutrici%C3%B3n_Salvador_Zubir%C3%A1n.jpg","page_title":"جائحة فيروس كورونا في المكسيك 2020","context_page_description":"الأحداث الواردة في هذه المقالة هي أحداث جارية وقد تكون عرضة لتغيرات سريعة وكبيرة. فضلًا، حدِّث المحتوى ليشمل أحدث المعلومات الموثوقة المعروفة عن موضوع المقالة.\\nتوثق هذه المقالة آثار جائحة فيروس كورونا 2019-2020 في المكسيك. حتى 19 مارس آذار 2020، حيث وجدت 118 حالة من فيروس كورونا المعروف طبياً بالرمز كوفيد-19 في المكسيك، وحالة وفاة واحدة."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%AD%E0%B8%87%E0%B8%AD%E0%B8%B2%E0%B8%AA%E0%B8%B2%E0%B8%A3%E0%B8%B1%E0%B8%81%E0%B8%A9%E0%B8%B2%E0%B8%94%E0%B8%B4%E0%B8%99%E0%B9%81%E0%B8%94%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Flag_of_Provincial_Volunteer_Defense_Corps.png","page_title":"กองอาสารักษาดินแดน","context_page_description":"กองอาสารักษาดินแดน เป็นองค์การ ขึ้นอยู่ในกระทรวงมหาดไทย มีฐานะเป็นนิติบุคคล ตามมาตรา 4 หมวด 1 ของพระราชบัญญัติกองอาสารักษาดินแดน พ.ศ. 2497 และมีกรรมการคณะหนึ่งจำนวนไม่น้อยกว่าสิบคน และไม่เกินยี่สิบคน เรียกว่า “คณะกรรมการกลางกองอาสารักษาดินแดน” ประกอบด้วยรัฐมนตรีว่าการกระทรวงมหาดไทย เป็นประธาน รัฐมนตรีว่าการกระทรวงกลาโหม เป็นรองประธานโดยตำแหน่ง ส่วนกรรมการอื่น เลขาธิการและรองเลขาธิการนั้น ให้รัฐมนตรีว่าการกระทรวงมหาดไทยเป็นผู้แต่งตั้งและถอดถอนโดยอนุมัติคณะรัฐมนตรี ตามมาตรา 6 ซึ่งกองอาสารักษาดินแดนนั้น เป็นกองกำลังกึ่งทหาร ทำหน้าที่รักษาความสงบร่วมกับพนักงานฝ่ายปกครองหรือตำรวจ ปราบปรามผู้กระทำผิดกฎหมาย การเทิดทูนและพิทักษ์รักษาไว้ซึ่งสถาบันพระมหากษัตริย์ รวมถึงรักษาความปลอดภัยในสถานที่สำคัญ และการคมนาคม และเป็นกำลังสำรองส่วนหนึ่งที่พร้อมจะเพิ่มเติมและสนับสนุนกำลังทหารได้เมื่อมีการร้องขอทั้งในยามปกติและยามศึกสงคราม และพระราชบัญญัติกองอาสารักษาดินแดน พ.ศ. 2497 หมวด 7 มาตรา 29 ได้บัญญัติไว้ เจ้าหน้าที่หรือสมาชิกกองอาสารักษาดินแดนในระหว่างทำการตามหน้าที่ ให้ถือว่าเป็นเจ้าพนักงานตามกฎหมายลักษณะอาญา"},{"page_url":"https://fr.wikipedia.org/wiki/Lutjanus_erythropterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Lutjanus_erythropterus_Day.png","page_title":"Lutjanus erythropterus","context_page_description":"Lutjanus erythropterus est une espèce de poisson de la famille des Lutjanidae.\\nLe Sultanat d'Oman lui a dédié un timbre, émis en 1999."},{"page_url":"https://en.wikipedia.org/wiki/Michael_Kirk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Michael_Kirk_%2814266301258%29_%28cropped%29.jpg","page_title":"Michael Kirk","context_page_description":"Michael Kirk is a documentary filmmaker and partial creator of the PBS show Frontline, where he worked as senior producer until 1987. Kirk owns a production company, the Kirk Documentary Group, in Brookline, Massachusetts. He is a former Nieman Fellow in Journalism at Harvard University. He has produced such documentaries as \\"Inside the Meltdown,\\" about the 2008 financial crisis, \\"Bush's War,\\" about the Iraq War under George W. Bush, and \\"The Way the Music Died,\\" about the dire straits of the record industry.\\nKirk was born in Denver and later moved to Boise, Idaho where he grew up and attended Bishop Kelly High School. He graduated from the University of Idaho in 1971 with a degree in communications. The university named an award after Kirk, “The Michael Kirk Award”, given annually to a student in broadcast journalism."},{"page_url":"https://eu.wikipedia.org/wiki/B%C4%83l%C4%83ci%C8%9Ba","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Balacita_jud_Mehedinti.png","page_title":"Bălăcița","context_page_description":"Bălăcița Errumaniako udalerri bat da, Mehedinți konderrian. 2.830 biztanle ditu, 98,95 kilometro koadroko azaleran banatuta."},{"page_url":"https://pt.wikipedia.org/wiki/Festival_Internacional_de_Balonismo_de_Torres","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Parque_do_Balonismo.Torres%2CRio_Grande_do_Sul%2CBrasil.JPG","page_title":"Festival Internacional de Balonismo de Torres","context_page_description":"Festival Internacional de Balonismo é um festival de balões de ar quente que ocorre anualmente na praia de Torres no Rio Grande do Sul."},{"page_url":"https://en.wikipedia.org/wiki/South_Brisbane_Dry_Dock","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/StateLibQld_1_139061_Ranelagh_%28ship%29.jpg","page_title":"South Brisbane Dry Dock","context_page_description":"South Brisbane Dry Dock is a heritage-listed dry dock at 412 Stanley Street, South Brisbane, City of Brisbane, Queensland, Australia. It was designed by William David Nisbet and built from 1876 to 1887. It is also known as the Government Graving Dock. It was added to the Queensland Heritage Register on 21 October 1992.\\nThe South Brisbane Dry Dock is the third oldest in Australia, the others being the Fitzroy Dry Dock, Cockatoo Island Dockyard, Sydney and the Alfred Graving Dock, Williamstown, Victoria."},{"page_url":"https://de.wikipedia.org/wiki/Ungl%C3%BCck_am_Djatlow-Pass","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%D0%90%D1%83%D1%81%D0%BF%D0%B8%D1%8F_2015.JPG","page_title":"Unglück am Djatlow-Pass","context_page_description":"Als Unglück am Djatlow-Pass wird der ungeklärte Tod von neun Ski-Wanderern im nördlichen Ural in der Sowjetunion, im Gebiet zwischen der Republik Komi und der Oblast Swerdlowsk im Jahr 1959 bezeichnet. Sie starben in der Nacht vom 1. auf den 2. Februar 1959 am nordöstlichen Hang des Berges Cholat Sjachl. Der Gebirgspass, an dem das Unglück geschah, wurde später nach dem Gruppenanführer Igor Djatlow Djatlow-Pass benannt.\\nFehlende Augenzeugen, die Umstände des Unglücks und nachfolgende journalistische Untersuchungen des Todes der Wanderer regten viele Spekulationen an. Untersuchungen der Todesfälle kamen zu dem Ergebnis, dass die Wanderer wahrscheinlich ihr Zelt von innen aufschlitzten und dieses barfuß und leichtbekleidet verließen. Die Leichen zeigten keine Anzeichen eines Kampfes, allerdings hatten zwei Opfer Schädelbrüche, zwei gebrochene Rippen und innere Verletzungen.\\nLaut dem damaligen Untersuchungsbericht waren die Kleidungsstücke einiger der Verunglückten radioaktiv kontaminiert. Die sowjetischen Untersuchungsorgane legten sich nur darauf fest, dass „höhere Gewalt“ zu den Todesfällen geführt habe. Der Zugang zu dem Gebiet wurde nach dem Ereignis für drei Jahre gesperrt."},{"page_url":"https://lv.wikipedia.org/wiki/Vi%C4%BC%C4%81ni","image_url":"https://upload.wikimedia.org/wikipedia/lv/3/3c/Vi%C4%BC%C4%81nu_HES.jpg","page_title":"Viļāni","context_page_description":"Viļāni ir pilsēta Latgalē, Viļānu novada centrs. Izvietojusies Maltas upes krastā autoceļu A12, P58 un P59 krustojumā pie dzelzceļa līnijas Rīga—Maskava iecirkņa Krustpils—Rēzekne II 215 km attālumā no Rīgas un 27 km — no Rēzeknes. Pilsētas tiesības Viļāni ieguva 1928. gadā."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%83%D0%B4%D1%83%D0%BB_%D0%94%D0%BE%D1%80%D0%B4%D0%B6%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Dudul_Dorje.jpg","page_title":"Дудул Дордже","context_page_description":"Дудул Дордже был Тринадцатым Гьялва Кармапой, главой школы Кагью Тибетского буддизма.\\nДудул Дордже родился в Хампа Дронгсар. В возрасте четырех лет он был узнан Гьялцабом Ринпоче. С восьми лет в монастыре он получил образование школ Кагью и Нингма. Дудул Дордже стал главой школы в возрасте 31 года. Он был известен своей любовью к животным.\\nСогласно легенде, он спас храм Джоканг в Лхасе от затопления, возложив кату на статую Будды Шакьямуни."},{"page_url":"https://sv.wikipedia.org/wiki/Broussonetia_kurzii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Kaeng_dok_salae.jpg","page_title":"Broussonetia kurzii","context_page_description":"Broussonetia kurzii är en mullbärsväxtart som först beskrevs av Joseph Dalton Hooker, och fick sitt nu gällande namn av Edred John Henry Corner. Broussonetia kurzii ingår i släktet Broussonetia och familjen mullbärsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Geologische_Wand_im_Botanischen_Volkspark_Blankenfelde-Pankow","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Botanischer_Volkspark_Blankenfelde-Pankow_II_06.JPG","page_title":"Geologische Wand im Botanischen Volkspark Blankenfelde-Pankow","context_page_description":"Die Geologische Wand im Botanischen Volkspark Blankenfelde-Pankow ist ein geologisches Anschauungsobjekt im Botanischen Volkspark Blankenfelde-Pankow. Die Gesteinsmauer besitzt als Nationaler Geotop Denkmalstatus.\\nDie Geologische Wand entstand 1891–1895 nach einem Entwurf des Volksschullehrers Eduard Zache im Volkspark Humboldthain. 1912 wurde sie in die Botanische Anlage Blankenfelde umgesetzt. Die Wand stellt einen idealen Schnitt durch die Schichten der Erdkruste Mitteleuropas dar. Sie besteht aus 123 Gesteinsarten aus Brandenburg, dem Rheinland, Schlesien, Sachsen und Thüringen und ist 31 Meter breit und bis zu 2,5 Meter hoch. 2018 wurde die Wand in Kooperation von Technischer Universität Berlin und dem Verein der Geowissenschaftler in Berlin und Brandenburg komplett gereinigt und größtenteils saniert."},{"page_url":"https://sv.wikipedia.org/wiki/Gloria_(Oriental_Mindoro)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Ph_locator_oriental_mindoro_gloria.png","page_title":"Gloria (Oriental Mindoro)","context_page_description":"Gloria är en kommun i Filippinerna. Kommunen ligger på ön Mindoro, och tillhör provinsen Oriental Mindoro. Folkmängden uppgår till 38 667 invånare."},{"page_url":"https://id.wikipedia.org/wiki/Allodia_lundstroemi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Allodia_lundstroemi%2C_Trawscoed%2C_North_Wales%2C_May_2015_2_-_Flickr_-_janetgraham84.jpg","page_title":"Allodia lundstroemi","context_page_description":"Allodia lundstroemi adalah spesies lalat yang berasal dari genus Allodia dan famili Mycetophilidae. Lalat ini juga merupakan bagian dari ordo Diptera, kelas Insecta, filum Arthropoda, dan kingdom Animalia.\\nLalat ini biasanya dapat ditemui di tempat lembab."},{"page_url":"https://en.wikipedia.org/wiki/Haddocks%27_Eyes","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Knight2.jpg","page_title":"Haddocks' Eyes","context_page_description":"\\"Haddocks' Eyes\\" is a song sung by The White Knight from Lewis Carroll's 1871 novel Through the Looking-Glass, chapter VIII.\\n\\"Haddocks' Eyes\\" is an example used to elaborate on the symbolic status of the concept of \\"name\\": a name as identification marker may be assigned to anything, including another name, thus introducing different levels of symbolization. It was discussed in several works on logic and philosophy."},{"page_url":"https://ca.wikipedia.org/wiki/George_Villiers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Coat_of_arms_Sir_George_Villiers%2C_1st_Duke_of_Buckingham%2C_KG.png","page_title":"George Villiers","context_page_description":"George Villiers KG va ser el primer Duc de Buckingham i favorit, segons alguns l'amant, del Rei Jaume I d'Anglaterra. Malgrat uns resultats polítics i militars molt discrets, seguí gaudint del favor reial durant els dos primers anys del regnat de Carles I, fins que va ser assassinat. És un dels cortesans reials més recompensats de tota la història."},{"page_url":"https://eo.wikipedia.org/wiki/Distrikto_Lu%C4%8Denec","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Lucenec_synagogue.jpg","page_title":"Distrikto Lučenec","context_page_description":"Distrikto Lučenec estas suda distrikto en Regiono Banská Bystrica. Ĉefa urbo de distrikto estas Lučenec. Distrikto najbaras kun distrikto Detva, distrikto Poltár kaj distrikto Rimavská Sobota, distrikto Veľký Krtíš kaj sude kun Hungario."},{"page_url":"https://vi.wikipedia.org/wiki/Ch%E1%BB%A7_nhi%E1%BB%87m_t%C3%A1c_chi%E1%BA%BFn_H%E1%BA%A3i_qu%C3%A2n_Hoa_K%E1%BB%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Gilday_CNO.jpg","page_title":"Chủ nhiệm tác chiến Hải quân Hoa Kỳ","context_page_description":"Chủ nhiệm tác chiến Hải quân, một số tài liệu tiếng Việt gọi là Tham mưu trưởng Hải quân, là sĩ quan cao cấp nhất của Hải quân Hoa Kỳ và là một thành viên trong Bộ Tổng tham mưu Liên quân Hoa Kỳ. Tham mưu trưởng Hải quân báo cáo trực tiếp với Bộ trưởng Hải quân Hoa Kỳ về tất cả những vấn đề liên quan đến hải quân trong đó có việc chỉ huy, sử dụng nguồn lực và hoạt động hữu hiệu của lực lượng hải quân. Dưới quyền của Bộ trưởng Hải quân, Tham mưu trưởng Hải quân Hoa Kỳ đảm nhận việc điều hợp nhân sự và nguồn lực đến các tư lệnh các bộ tư lệnh tác chiến thống nhất. Tham mưu trưởng Hải quân cũng thực thi tất cả các chức năng được diễn tả trong Mục 5033, Điều 10, Bộ luật Hoa Kỳ và những chức năng mà bộ trưởng giao phó hay giao các nhiệm vụ và trách nhiệm cho các vị sĩ quan khác trong bộ tham mưu của mình dưới danh nghĩa của chính mình. Giống như các vị khác trong Bộ tổng tham mưu Liên quân Hoa Kỳ, chức vụ này là một chức vụ hành chính và không có thực quyền tư lệnh đối với các lực lượng hải quân của Hoa Kỳ.\\nTham mưu trưởng Hải quân Hoa Kỳ là cố vấn chính của Tổng thống Hoa Kỳ, Bộ trưởng Quốc phòng Hoa Kỳ và Bộ trưởng Hải quân Hoa Kỳ về những hoạt động chiến tranh hải quân."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B5%A4%E5%B2%B3_(%E5%85%AB%E3%83%B6%E5%B2%B3%E5%B1%B1%E7%B3%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Mt.Amidadake_from_Mt.Akadake_05.jpg","page_title":"赤岳 (八ヶ岳山系)","context_page_description":"赤岳は、長野県南佐久郡南牧村、諏訪郡原村、茅野市、山梨県北杜市にまたがる標高2,899 mの山。八ヶ岳中信高原国定公園南部に位置し、八ヶ岳連峰の最高峰である。"},{"page_url":"https://it.wikipedia.org/wiki/Yemen","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Khat_fields_in_western_yemen.jpg","page_title":"Yemen","context_page_description":"Lo Yemen, raramente Iemen, è uno Stato posto all'estremità meridionale della Penisola araba; il suo nome ufficiale è Repubblica dello Yemen.\\nLa repubblica, oltre al territorio continentale, comprende l'arcipelago di Socotra, composto da quattro isole di cui l'isola di Socotra nell'Oceano Indiano, e gli arcipelaghi di Perim, Kamaran e Zucur-Hanish nel Mar Rosso.\\nEconomicamente lo Yemen è tra i Paesi più poveri del mondo, con condizioni di sottosviluppo diffuso e dipendenza pressoché totale da aiuti esterni, nonostante indubbi progressi siano stati fatti dal 1990, anno della riunificazione."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9C%A4%EC%95%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/YoonA_at_Dongguk_University_Graduation_Ceremony_02.jpg","page_title":"윤아","context_page_description":"윤아는 대한민국의 걸 그룹 소녀시대의 서브보컬, 리드댄서를 맡고 있는 가수이자 배우이다.\\n2007년 7월 14일부터 2007년 9월 9일까지 방영하여 종영한 텔레비전 드라마 《9회말 2아웃》으로 배우로 데뷔하였고, 같은 해 2007년 8월 5일부터는 걸 그룹 소녀시대 멤버로 데뷔하여 국내외에서 큰 인기를 얻으며 활발한 활동을 하였다. 윤아는 그녀의 가수 활동과는 별도로 다양한 텔레비전 드라마에 참여했다. 특히, 《너는 내 운명》과 《신데렐라 맨》, 《사랑비》, 《총리와 나》, 《THE K2》과 중국 드라마 《무신 조자룡》 등에 출연하였다. 2017년에는 영화 《공조》로 스크린 데뷔를 하며, 드라마와 영화를 넘나드는 배우로 입지를 다졌다."},{"page_url":"https://simple.wikipedia.org/wiki/Campania","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Flag_of_Campania.png","page_title":"Campania","context_page_description":"Campania is a region of the south of Italy. The capital is Napoli. The population in 2004 was about 5,701,931."},{"page_url":"https://es.wikipedia.org/wiki/Agencia_Espa%C3%B1ola_de_Medicamentos_y_Productos_Sanitarios","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Logo_AEMPS.svg","page_title":"Agencia Española de Medicamentos y Productos Sanitarios","context_page_description":"La Agencia Española de Medicamentos y Productos Sanitarios llamada anteriormente es una agencia estatal de España es creada por la Ley 66/1997, de 30 de diciembre, con rango de organismo autónomo hasta 2011 y a partir de entonces como agencia estatal.​ Sus competencias fueron ampliadas por la Ley 50/1998. Depende del Ministerio de Sanidad.\\nLa Ley 16/2003, de Cohesión y Calidad del Sistema Nacional de Salud, determina que son competencias de la Agencia Española de Medicamentos y Productos Sanitarios la evaluación y, en su caso, autorización de los productos sanitarios y cosméticos. La Agencia Española del Medicamento está presidida por quien ostenta la Secretaría de Estado de Sanidad."},{"page_url":"https://eo.wikipedia.org/wiki/Franklin_D._Roosevelt_(pariza_metrostacio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Station_Roosevelt_-_traductions.JPG","page_title":"Franklin D. Roosevelt (pariza metrostacio)","context_page_description":"Franklin D. Roosevelt [fʁɑ̃klɛ̃ ʁuzvɛlt] estas stacio sur linioj 1 kaj 9 de la Metroo de Parizo; ĝi situas en la 8-a arondismento de Parizo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D1%81%D0%BE%D0%BE%D0%BD%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Albacete_Pozohondo_Mapa_municipal.png","page_title":"Посоондо","context_page_description":"Посоондо — муніципалітет в Іспанії, у складі автономної спільноти Кастилія-Ла-Манча, у провінції Альбасете. Населення — 1792 особи.\\nМуніципалітет розташований на відстані близько 240 км на південний схід від Мадрида, 31 км на південь від Альбасете.\\nНа території муніципалітету розташовані такі населені пункти:\\nКампільйо-де-ла-Вірхен: 32 особи\\nНава-де-Абахо: 445 осіб\\nНава-де-Арріба: 120 осіб\\nЛос-Посікос: 64 особи\\nПосоондо: 1131 особа"},{"page_url":"https://en.wikipedia.org/wiki/List_of_companies_of_Finland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Finlandia_arriving_in_Tallinn_3_June_2013.JPG","page_title":"List of companies of Finland","context_page_description":"Finland is a sovereign state in Northern Europe. It was a relative latecomer to industrialization, remaining a largely agrarian country until the 1950s. It rapidly developed an advanced economy while building an extensive Nordic-style welfare state, resulting in widespread prosperity and one of the highest per capita incomes in the world. However, Finnish GDP growth was negative in 2012–2014, with a preceding nadir of −8% in 2009. Finland is a top performer in numerous metrics of national performance, including education, economic competitiveness, civil liberties, quality of life, and human development."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_spesies_Nepenthes","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Nepenthes_eymae.jpg","page_title":"Senarai spesies Nepenthes","context_page_description":"Senarai spesies Nepenthes ini merupakan senarai lengkap kesemua spesies yang diketahui mengenai pokok maging genus Nepenthes disusun menurut taburannya. Ambil perhatian bahawa beberapa spesies dengan taburan meluas disebut lebih dari sekali. Spesies yang bukan tempatan pada kawasan tertentu ditanda dengan asterik."},{"page_url":"https://es.wikipedia.org/wiki/Pl%C3%A1n%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Pl%C3%A1n%C4%9B_PS_CoA.jpg","page_title":"Pláně","context_page_description":"Pláně es una localidad del distrito de Pilsen Norte en la región de Pilsen, República Checa, con una población estimada a principio del año 2018 de 272 habitantes.\\nSe encuentra ubicada al norte de la región, en la cuenca hidrográfica del río Berounka —un afluente izquierdo del río Moldava que, a su vez, lo es del Elba—, y cerca de la frontera con las regiones de Ústí nad Labem, Karlovy Vary y Bohemia Central.​"},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%DA%A9%D9%88%DB%8C%DB%8C%D9%86%E2%80%8C%D9%81%DB%8C%D8%B4_(%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3-%DB%B3%DB%B9%DB%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/USS_Queenfish%3B0839303.jpg","page_title":"یواس‌اس کویین‌فیش (اس‌اس-۳۹۳)","context_page_description":"یواس‌اس کویین‌فیش (اس‌اس-۳۹۳) یک زیردریایی بود که طول آن ۳۱۱ فوت ۶ اینچ بود. این زیردریایی در سال ۱۹۴۳ ساخته شد."},{"page_url":"https://fr.wikipedia.org/wiki/Dieurostus_dussumieri","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Dieurostus_dussumieri.jpg","page_title":"Dieurostus dussumieri","context_page_description":"Dieurostus dussumieri, unique représentant du genre Dieurostus, est une espèce de serpents de la famille des Homalopsidae."},{"page_url":"https://en.wikipedia.org/wiki/Elizabeth_Charlotte,_Madame_Palatine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Mignard%2C_after_-_Elisabeth_Charlotte_of_the_Palatinate%2C_Duchess_of_Orl%C3%A9ans%2C_and_her_children_-_Versailles.png","page_title":"Elizabeth Charlotte, Madame Palatine","context_page_description":"Princess Elisabeth Charlotte, was a German princess member of the House of Wittelsbach and, as Madame, the second wife of Philippe I, Duke of Orléans and mother of Philippe II, Duke of Orléans, France's ruler during the Regency. She gained literary and historical importance primarily through her correspondence, which is of cultural and historical value due to her sometimes very blunt descriptions of French court life and is today one of the best-known German-language texts of the Baroque period.\\nAlthough she only had two surviving children, she not only became the ancestress of the House of Orléans, which came to the French throne with Louis Philippe I, the so-called \\"Citizen King\\" from 1830 to 1848, but also became the ancestress of numerous European royal families, so she was also called the “Grandmother of Europe”. Through her daughter she was the grandmother of Francis I, Holy Roman Emperor, the husband of Maria Theresa, and great-grandmother of Joseph II and Leopold II and Marie Antoinette, the last Queen of France before the French Revolution."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E5%9C%8B%E5%8B%99%E7%B8%BD%E7%90%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Liang_Shiyi_photo.jpg","page_title":"中華民國國務總理","context_page_description":"中华民国国务总理是中华民国国务院的首长，也是北洋政府时期的政府首脑。有些国务总理名义上曾代行大总统职权，但实权却握在军阀手上。此外，袁世凯担任大总统时，曾将国务总理改设为“国务卿”，此处亦一并收录。"},{"page_url":"https://en.wikipedia.org/wiki/Ahmadabad-e_Mosaddeq","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/%D9%82%D9%84%D8%B9%D9%87_%D8%A7%D8%AD%D9%85%D8%AF%D8%A2%D8%A8%D8%A7%D8%AF_%D9%85%D8%B5%D8%AF%D9%82.jpg","page_title":"Ahmadabad-e Mosaddeq","context_page_description":"Ahmadabad-e Mosaddeq is a village in the Ahmadabad Rural District, in the Central District of Nazarabad County, Alborz Province, Iran, 7.5 km south-west of Abyek. At the 2006 census, its population was 1,401, in 358 families.\\nThe Iranian politician Mohammad Mosaddegh spent his days of exile in his estates and is buried under his dining room. The compound has been subjected to serious deterioration, due to newly-imposed government restrictions."},{"page_url":"https://nl.wikipedia.org/wiki/%C4%8Cesk%C3%A9_Lhotice","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Ceske_Lhotice_CZ_flag.png","page_title":"České Lhotice","context_page_description":"České Lhotice is een Tsjechische gemeente in de regio Pardubice, en maakt deel uit van het district Chrudim.\\nČeské Lhotice telt 105 inwoners."},{"page_url":"https://no.wikipedia.org/wiki/Usain_Bolt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Usain_Bolt_Rio_100m_final_2016k.jpg","page_title":"Usain Bolt","context_page_description":"Usain St. Leo Bolt er en jamaicansk tidligere friidrettsutøver og verdensrekordholder på 100, 200 meter og 4 × 100 meter stafett. Han har vunnet åtte olympiske gullmedaljer og elleve verdensmesterskap."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A8%D7%99%D7%93%D7%AA_%D7%9E%D7%A4%D7%9C%D7%A1_%D7%99%D7%9D_%D7%94%D7%9E%D7%9C%D7%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/DeadSeaSinkhole.jpg","page_title":"ירידת מפלס ים המלח","context_page_description":"החל מהמחצית השנייה של המאה העשרים נרשמת ירידה מתמשכת במפלס ים המלח, שהצטברה לאורך התקופה לכדי קרוב לארבעים מטרים.\\nירידת המפלס גרמה לייבוש האגן הדרומי של הים וגורמת לתופעות כמו נסיגת חופים, בולענים ופגיעה בתשתיות ובסביבה. הירידה נבעה בעבר בעיקר מהקטנת זרימת המים לים המלח, בעיקר בנהר הירדן, עקב שימוש מוגבר במים אלה לצריכה שוטפת ולהשקיה במדינות הנמצאות באגן הניקוז של ים המלח. לאחר התייבשות האגן הדרומי הרחיבו מפעלי האשלג שלחוף ים המלח את הייצור, ובנו באגן המיובש בריכות אידוי למי הים. את המים הם שואבים מהים באגן הצפוני. שאיבת המים ואיוד המים בבריכות תורמים היום תרומה משמעותית לירידת מפלס הים."},{"page_url":"https://fr.wikipedia.org/wiki/1900_en_astronomie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/She_Shan_Observatory_-_Blink_comparator.jpg","page_title":"1900 en astronomie","context_page_description":"23 mars : la plus courte éclipse du Soleil.\\n28 mai : éclipse du Soleil."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Olbernhau","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Olbernhau%2C_Haus_Gr%C3%BCnthaler_Stra%C3%9Fe_11.JPG","page_title":"Liste der Kulturdenkmale in Olbernhau","context_page_description":"Die Liste der Kulturdenkmale in Olbernhau enthält die Kulturdenkmale in Olbernhau. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Erzgebirgskreis.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9A%AE%E4%BA%9E%E7%88%BE-%E7%B1%B3%E9%AB%98%C2%B7%E6%8B%89%E8%98%87%E5%8A%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Pierre-michel_lasogga.jpg","page_title":"皮亞爾-米高·拉蘇加","context_page_description":"皮亚尔-米高·拉苏加，德国职业足球员，司职中锋，现效力于卡塔尔星级足球联赛球会多哈艾阿拉比。"},{"page_url":"https://sk.wikipedia.org/wiki/Kovanice","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Flag_of_Kovanice.jpg","page_title":"Kovanice","context_page_description":"Kovanice je obec v Česku v okrese Nymburk v Stredočeskom kraji. 1. januára 2012 tu žilo 825 obyvateľov, z toho 410 mužov a 415 žien, pričom priemerný vek v obci bol 39,3 roka."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Uhersk%C3%A9_Hradi%C5%A1t%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Pit%C3%ADn%2C_bo%C5%BE%C3%AD_muka.jpg","page_title":"Seznam kulturních památek v okrese Uherské Hradiště","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Uherské Hradiště vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Bojkovicích včetně částí obce Krhov a Přečkovice\\nSeznam kulturních památek v Boršicích\\nSeznam kulturních památek v Buchlovicích včetně části obce Chrastě\\nSeznam kulturních památek v Částkově\\nSeznam kulturních památek v Drslavicích\\nSeznam kulturních památek v Hluku\\nSeznam kulturních památek v Kunovicích\\nSeznam kulturních památek v Komni\\nSeznam kulturních památek v Nivnici\\nSeznam kulturních památek v Osvětimanech\\nSeznam kulturních památek ve Starém Městě\\nSeznam kulturních památek ve Strání\\nSeznam kulturních památek v Uherském Brodě včetně částí obce Maršov, Těšov a Újezdec"},{"page_url":"https://en.wikipedia.org/wiki/List_of_protected_heritage_sites_in_Erquelinnes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Montignies-Saint-Christophe_FCh1.JPG","page_title":"List of protected heritage sites in Erquelinnes","context_page_description":"This table shows an overview of the protected heritage sites in the Walloon town Erquelinnes. This list is part of Belgium's national heritage."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%88%D9%84%D9%88%D9%85%D8%A8%D9%8A%D9%86_%D9%81%D8%A7%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Columbine_Valley%2C_Colorado.JPG","page_title":"كولومبين فالى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكولومبين فالى تاون فى امريكا."},{"page_url":"https://en.wikipedia.org/wiki/Murray_State_Racers_men%27s_basketball","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Marcus_Brown_Euroleague_Final_Four_2005.JPG","page_title":"Murray State Racers men's basketball","context_page_description":"Murray State Racers men's basketball program represents intercollegiate men's basketball at Murray State University. The school competes in the Ohio Valley Conference in Division I of the National Collegiate Athletic Association and play home games at the CFSB Center in Murray, Kentucky. Murray State made its 17th appearance in the NCAA Tournament in 2019. Four times the Racers advanced in the tournament, most recently when it defeated Marquette in 2019. In 1988, Murray State defeated North Carolina State in the first round but lost to eventual national champion Kansas in the second round. In 2010, 22 years to the date of the 1988 win, the Racers beat Vanderbilt and lost to eventual runner-up Butler in the second round."},{"page_url":"https://en.wikipedia.org/wiki/Ludvig_%C3%96hman","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/%C3%96hman.jpg","page_title":"Ludvig Öhman","context_page_description":"Carl Ludvig Öhman Silwerfeldt is a Swedish footballer who plays as a centre back for Grimsby Town in EFL League Two."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD_%D0%A0%D0%B5%D0%BC%D0%B1%D1%80%D0%B0%D0%BD%D0%B4%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Rembrandt-SMELL.jpg","page_title":"Список картин Рембрандта","context_page_description":"В списке представлены картины, признанные подлинными работами Рембрандта в итоговом каталоге одноимённого исследовательского проекта."},{"page_url":"https://de.wikipedia.org/wiki/Elisabeth_Kales-Wallner","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/WallnerElis.jpg","page_title":"Elisabeth Kales-Wallner","context_page_description":"Elisabeth Kales-Wallner war eine österreichische Operettensoubrette und Kammersängerin."},{"page_url":"https://en.wikipedia.org/wiki/Josep_Dom%C3%A8nech_i_Estap%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/CosmoCaixa_building.jpg","page_title":"Josep Domènech i Estapà","context_page_description":"Josep Domènech i Estapà was a Catalan architect.\\nHe graduated in 1881, and became professor of geodesy and descriptive geometry at the University of Barcelona, and member of the Acadèmia de Ciències i Arts, of which he subsequently became president.\\nHis works in Barcelona include the church of Sant Andreu del Palomar, Teatre Poliorama and Reial Acadèmia de les Ciències, Palau de la Justícia - Palace of Justice courthouse, Palau Montaner, now the Delegación del Gobierno Español in Barcelona, the University of Barcelona's Faculty of Medicine, Modelo prison, the Amparo de Santa Lucía / Empar de Santa Llúcia home for the blind, which eventually became the Museu de la Ciència de Barcelona, now known as CosmoCaixa Barcelona, the Fabra Observatory, Catalana de Gas i electricitat building and water tower, the Church of Our Lady of Carmen and Carmelite convent and Magoria station. He also headed the construction of the Hospital Clínic, based on a design by Ignasi C. Bartrolí. In the town of Viladrau, he built the Hotel Bofill.\\nHe created his own style through the modification of Classical motifs, distinct both from Eclecticism and Modernisme, but was accepted by the establishment."},{"page_url":"https://fr.wikipedia.org/wiki/Nagycs%C3%A9cs","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Nagycs%C3%A9csi_utcak%C3%A9p.jpg","page_title":"Nagycsécs","context_page_description":"Nagycsécs est un village et une commune du comitat de Borsod-Abaúj-Zemplén en Hongrie."},{"page_url":"https://pt.wikipedia.org/wiki/Osvaldo_Gomes_da_Costa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Osvaldo_Gomes_da_Costa.png","page_title":"Osvaldo Gomes da Costa","context_page_description":"Osvaldo Gomes da Costa foi um político e militar brasileiro."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%84%AD%E5%B7%9E%E6%97%A5%E7%94%A3%E6%B1%BD%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Nissan_Paladin_facelift_China_2012-06-02.JPG","page_title":"鄭州日産汽車","context_page_description":"鄭州日産汽車有限公司は、中華人民共和国河南省鄭州市に本社を構える商用車メーカーで、東風汽車と日産自動車の合弁会社である。"},{"page_url":"https://it.wikipedia.org/wiki/Jeff_Noon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Jeff_Noon.jpg","page_title":"Jeff Noon","context_page_description":"Jeff Noon è uno scrittore e sceneggiatore britannico, vincitore del Premio Arthur C. Clarke nel 1994 e del Premio John Wood Campbell per il miglior nuovo scrittore nel 1995 con il romanzo distopico Le piume di Vurt."},{"page_url":"https://sv.wikipedia.org/wiki/Kapamaryllis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/NakedLadies.jpg","page_title":"Kapamaryllis","context_page_description":"Kapamaryllis, Amaryllis belladonna är en amaryllisväxtart som beskrevs av Carl von Linné. Amaryllis belladonna ingår i Kapamaryllissläktet och familjen amaryllisväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Oberaden","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Germania_7-9_Varo.jpg","page_title":"Oberaden","context_page_description":"Il campo militare romano di Oberaden si trova nella frazione della città tedesca di Bergkamen. Fa parte di una serie di fortificazioni realizzate all'epoca di Augusto, ai fini dell'occupazione della Germania e della sua trasformazione in provincia romana."},{"page_url":"https://sv.wikipedia.org/wiki/Mortimer_Munck_af_Rosensch%C3%B6ld","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Munck_af_Rosensch%C3%B6ld%2C_Mortimer_med_v%C3%A4nner_1895.jpg","page_title":"Mortimer Munck af Rosenschöld","context_page_description":"Axel Gabriel Mortimer Munck af Rosenschöld, född 21 juli 1873, död 28 november 1942, var en svensk ämbetsman. Han var son till Thomas Munck af Rosenschöld. Från 1929 var han gift med Hanna Rydh.\\nMunck blev filosofie licentiat vid Lunds universitet 1901, avlade hovrättsexamen 1903, var sekreterare och ombudsman hos Vattenfallsstyrelsen 1908-1915 och tillförordnad expeditionschef i Lantförsvarsdepartementet 1916-1917 samt i Ecklesiastikdepartementet 1917. 1917-1929 var han statssekreterare i Ecklesiastikdepartementet, tillförordnad landshövding i Kronobergs län 1929-1930, samt landshövding i Jämtlands län 1931-1938."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%A4%D9%8A%D9%86%D9%89_%D8%AA%D8%B4%D9%88%D9%84%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/%E3%83%B4%E3%82%A3%E3%83%8B%E3%83%BC%E3%83%BB%E3%83%81%E3%83%A5%E3%83%BC%E3%82%AF2010.jpg","page_title":"ڤينى تشولك","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nڤينى تشولك لاعب بيسبول من امريكا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D1%82%D1%83%D1%80%D1%8C%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D1%82%D1%83%D1%80%D1%8C%D0%B5_%D0%92%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB.JPG","page_title":"Верхотурье","context_page_description":"Верхоту́рье — город в России, административный центр городского округа Верхотурский Свердловской области. Железнодорожная станция на линии Гороблагодатская — Серов — Приобье."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%96%D0%BB%D1%8C%D1%8F%D1%80%D1%8B%D0%BA%D0%B0_(%D0%B2%D0%BE%D0%B7%D0%B5%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Volc%C3%A1n_Villarrica.jpg","page_title":"Вільярыка (возера)","context_page_description":"Вільярыка — возера ля заходняга падножжа Анд Сярэдняга Чылі, ля паўночна-заходніх схілаў вулкана Вільярыка, у нацыянальным парку Лос-Парагуас, на вышыні 230 м. Плошча 172 км². Заходнія берагі спадзістыя, усходнія - гарыстыя. Упадае рака Пукон, выцякае рака Тальтэн."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_Kawau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Copper_Mine_pumphouse_on_Kawau_Island.jpg","page_title":"Île Kawau","context_page_description":"L'Île Kawau est une île de Nouvelle-Zélande."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_animais_que_representam_pa%C3%ADses","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Kiwifugl.jpg","page_title":"Lista de animais que representam países","context_page_description":"Esta é uma lista de animais que representam oficialmente os seus países. Alguns exemplos logo embaixo"},{"page_url":"https://it.wikipedia.org/wiki/Kawanishi_N1K","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/N1K1_in_biwalake.jpg","page_title":"Kawanishi N1K","context_page_description":"Il Kawanishi N1K-J Shiden era un caccia ad ala bassa prodotto dall'azienda giapponese Kawanishi Kōkūki KK nei primi anni quaranta ed impiegato dalla Dai-Nippon Teikoku Kaigun Kōkū Hombu, la componente aerea della Marina imperiale giapponese.\\nSviluppato dal precedente idrocaccia Kawanishi N1K Kyōfū, l'N1K-J venne considerato, sia dai suoi piloti che da quelli avversari, uno dei migliori caccia basati a terra utilizzati dalle forze armate giapponesi durante la seconda guerra mondiale. Dotato di armamento pesante e di una cellula in grado di sopportare danni anche gravi, dote rara tra i caccia giapponesi, l'N1K-J fu uno dei pochi caccia in grado di affrontare ad armi pari i Grumman F6F Hellcat, gli F4U Corsair ed i North American P-51 Mustang.\\nFu introdotto solo nel 1943, troppo tardi ed in un numero insufficiente per mutare le sorti del conflitto."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%B1%DA%A9_%D9%87%D9%85%D8%B1%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/The_Saxon_church_at_Kirk_Hammerton.jpg","page_title":"کرک همرتون","context_page_description":"کرک همرتون یک روستا و محله مدنی در بریتانیا است که در بخش هروگت واقع شده‌است. کرک همرتون ۵۳۸ نفر جمعیت دارد."},{"page_url":"https://en.wikipedia.org/wiki/Laura_Flessel-Colovic","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Conf_presse_FFE_2012-06-12_n11.jpg","page_title":"Laura Flessel-Colovic","context_page_description":"Laura Flessel-Colovic is a French politician and épée fencer who served as Minister of Sports from 2017 to 2018. Born in Pointe-à-Pitre, Guadeloupe, she has won the most Olympic medals of any French sportswoman, with five. Before 2007, she was a member of the Levallois Sporting Club Escrime, and now works with Lagardère Paris Racing. She is married and has one daughter.\\nShe was France's flag-bearer at the 2012 Summer Olympics opening ceremony in London, which was her fifth and last Olympics.\\nShe was appointed Minister of Sports in the Philippe Government on 17 May 2017 and resigned on 4 September 2018."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Washington_(condado_de_Harrison,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Clendening_Lake.JPG","page_title":"Municipio de Washington (condado de Harrison, Ohio)","context_page_description":"El municipio de Washington es un municipio ubicado en el condado de Harrison en el estado estadounidense de Ohio. En el año 2010 tenía una población de 638 habitantes y una densidad poblacional de 7,79 personas por km².​"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86%D9%82%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%C3%87ank%C4%B1r%C4%B1_%28Kaleden%29.jpg","page_title":"جانقري","context_page_description":"مدينة جانقري هي عاصمة محافظة جانقري تقع شمال شرق أنقرة وتبعد عنها 140كم يبلغ عدد سكانها 62,508 نسمة."},{"page_url":"https://de.wikipedia.org/wiki/St._Martin_(Memleben)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/StMartinMemleben1.jpg","page_title":"St. Martin (Memleben)","context_page_description":"Die Kirche Sankt Martin in Memleben ist ein Sakralbau der Evangelischen Kirche in Mitteldeutschland in Memleben, einem Ortsteil der Gemeinde Kaiserpfalz im Landkreis Burgenlandkreis in Sachsen-Anhalt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%BE%D0%BE%D0%BF%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Moscow_05-2017_img25_Zoo_main_entrance.jpg","page_title":"Московский зоопарк","context_page_description":"Московский зоопарк — зоологический парк в центре Москвы.\\nОдин из старейших зоопарков в Европе и пятый по площади зоопарк России после зоопарков Ярославля, Ростова-на-Дону, Новосибирска и Красноярска. Входит в десятку самых посещаемых зоопарков мира.\\nВ коллекции зоопарка 1267 видов животных, 10531 особей.\\nИмеет статус головного зоопарка России, штаб-квартира Евроазиатской ассоциацией зоопарков и аквариумов. Активный участник международных проектов по поддержанию и изучению видов в дикой природе, разведению редких видов животных в неволе.\\nРасположен рядом с Садовым кольцом между улицами Красная Пресня, Большой Грузинской и Зоологической. Главный вход находится на перекрёстке Красной Пресни и Большой Грузинской, недалеко от станций метро «Баррикадная» и «Краснопресненская».\\nСимволом Московского зоопарка до 2014 года был дикий таёжный кот — манул. После смены руководства символ был изменён на абстрактное изображение пеликанов, белок, дельфинов и голубей.\\nГАУ «Московский зоопарк» подчинён Департаменту культуры, Правительство Москвы."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%96%D0%BE_%D0%90%D0%B1%D0%B4%D0%BE_%D0%91%D0%B5%D0%BD%D1%96%D1%82%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Mario_Abdo_Ben%C3%ADtez_%282018-06-14%2C_cropped%29.jpg","page_title":"Маріо Абдо Бенітес","context_page_description":"Маріо Абдо Бенітес, також Маріто Бенітес — парагвайський бізнесмен, правий націонал-консервативний політик. Один з лідерів партії Колорадо, голова Сенату Парагваю в 2015—2016 роках. Здобув перемогу на виборах 2018, з 15 серпня 2018 року — Президент Парагваю."},{"page_url":"https://bs.wikipedia.org/wiki/Didier_Drogba","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Didier_Drogba.JPG","page_title":"Didier Drogba","context_page_description":"Didier Yves Drogba Tébily je profesionalni nogometaš iz Abidjana, Obala Slonovače. Trenutno igra za Chelsea. U dobi od 5 godina se preselio u Francusku. Nogometnu karijeru započeo je u Levalloisu, a prvi profesionalni ugovor potpisao je za Le Mans, koji je tada nastupao u Ligue 2. Nastupao je još za Guingamp i Marseille.\\n2004. godine je prešao u Chelsea. U Chelseu postaje jedan od ključnih igrača, te je svojim dobrim igrama pridonio klubu pri osvajanju Premijer lige 2005. i 2006. godine, igranju u finalu Lige prvaka 2008. godine, te osvajanju Lige prvaka u sezoni 2011/12.\\nDrogba također nastupa i za reprezentaciju Obale Slonovače, kojoj je svojim golovima osigurao nastup na Svjetskim prvenstvima 2006. i 2010..\\nNakon jednogodišnje avanture u Kini, 28. januara 2013. Drogba potpisuje za turski Galatasaray na godinu i pol dana. 19. maja 2014. Drogba objavljuje odlazak iz Galatasaraya.\\nNakon dvije godine, 2014. se ponovno vraća u Chelsea."},{"page_url":"https://es.wikipedia.org/wiki/H%C3%A1bitat_colectivo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%D0%92%D0%B7%D0%B3%D0%BB%D1%8F%D0%B4_%D0%BD%D0%B0_%D0%B7%D0%B0%D0%BF%D0%B0%D0%B4_%D0%B8%D0%B7_%D1%86%D0%B5%D0%BD%D1%82%D1%80%D0%B0_%D0%9F%D1%80%D0%B8%D0%BF%D1%8F%D1%82%D0%B8.jpg","page_title":"Hábitat colectivo","context_page_description":"Hábitat colectivo o residencia multifamiliar es un tipo de hábitat humano en donde varios hogares familiares o domicilios se ubican en el mismo edificio o inmueble.​​ Este concepto se opone al de hábitat individual, ​ y también incluye y se diferencia del hábitat intermedio o hábitat semi-colectivo.​​\\nNo debe confundirse con las construcciones unifamiliares que comparten pared medianera pero no se disponen una sobre otra, y responden al concepto anglosajón de terraced house.\\nNo debe confundirse el concepto de vivienda colectiva con el de vivienda colectivizada, resultado de la colectivización de la vivienda en el contexto de procesos revolucionarios colectivistas, ni este con el de \\"okupación\\" de la vivienda o con el de vivienda pública.\\nPor otro lado, el concepto de hábitat colectivo también se distingue de otros usos no residenciales de los inmuebles, como son las funciones económicas o las de equipamiento"},{"page_url":"https://es.wikipedia.org/wiki/Grito_de_Yara","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Carlos_Manuel_de_Cespedes.jpg","page_title":"Grito de Yara","context_page_description":"Se denomina como Grito de Yara al inicio del proceso independentista de Cuba de España que fue iniciado por Carlos Manuel de Céspedes el 10 de octubre de 1868.​"},{"page_url":"https://pl.wikipedia.org/wiki/Funkcje_trygonometryczne","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Circle_area_1.png","page_title":"Funkcje trygonometryczne","context_page_description":"Funkcje trygonometryczne – funkcje matematyczne, wyrażające między innymi stosunki między długościami boków trójkąta prostokątnego względem miar jego kątów wewnętrznych, będące przedmiotem badań trygonometrii.\\nFunkcje trygonometryczne, choć wywodzą się z pojęć geometrycznych, są rozpatrywane także w oderwaniu od geometrii. W analizie matematycznej są one definiowane m.in. za pomocą szeregów potęgowych lub jako rozwiązania pewnych równań różniczkowych.\\nDo funkcji trygonometrycznych współcześnie zalicza się: sinus, cosinus, tangens, cotangens, secans, cosecans, z czego dwóch ostatnich obecnie rzadko się używa.\\nFunkcje trygonometryczne znajdują zastosowanie w wielu działach matematyki, innych naukach ścisłych i technice; działem matematyki badającym te funkcje jest trygonometria, lub ściślej: goniometria."},{"page_url":"https://en.wikipedia.org/wiki/Wells,_Somerset","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Rowdens_Road_Cricket_Ground%2C_Wells_gates.JPG","page_title":"Wells, Somerset","context_page_description":"Wells is a cathedral city and civil parish in the Mendip district of Somerset, on the southern edge of the Mendip Hills. Although the population recorded in the 2011 census was only 10,536, and with a built-up area of just 3.244 square kilometres, Wells has had city status since medieval times, because of the presence of Wells Cathedral. Often described as England's smallest city, it is actually second smallest to the City of London in area and population, but unlike London it is not part of a larger urban agglomeration.\\nWells takes its name from three wells dedicated to Saint Andrew, one in the market place and two within the grounds of the Bishop's Palace and cathedral. A small Roman settlement surrounded them, which grew in importance and size under the Anglo-Saxons when King Ine of Wessex founded a minster church there in 704. The community became a trading centre based on cloth making and Wells is notable for its 17th-century involvement in both the English Civil War and Monmouth Rebellion. In the 19th century, transport infrastructure improved with stations on three different railway lines. However, since 1964 the city has been without a railway link."},{"page_url":"https://sv.wikipedia.org/wiki/Fika","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/I_tr%C3%A4dg%C3%A5rden.jpg","page_title":"Fika","context_page_description":"Fika är en svensk samhällsinstitution som innebär mellanmänskligt umgänge i kombination med intagande av exempelvis kaffe och kaka. Fika förekommer vanligen inom svenskt arbetsliv, i form av fikapauser eller kaffepauser – en fika tillsammans med kollegor. Denna tradition kan anses vara en del av svensk kultur.\\nPå många svenska arbetsplatser finns fastlagda tidpunkter för fikapaus – exempelvis mitt på förmiddagen och mitt på eftermiddagen. Pausen är del av den betalda arbetstiden och tillbringas ofta i närheten av kaffemaskiner och lunch/fika-rum. Det anses troligt att den svenska fikatraditionen ger möjlighet till större meningsutbyte och förståelse arbetskollegor emellan."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BD%90%E7%94%A8%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Flag_of_Sayo_Hyogo.JPG","page_title":"佐用町","context_page_description":"佐用町是位于日本兵库县西部的行政区划。\\n辖区位于中国山地东端，主要为山林地，千种川由中央区域自北往南通过，主要市区位于其支流佐用川沿岸。在南部与龙野市、上郡町相邻处为播磨科学公园都市，设有大型同步辐射设施SPring-8及兵库县立西播磨天文台等学术研究机构。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_bastion_forts","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Malta_-_Valletta_-_Triq_il-Lanca%2BFort_St._Elmo_01_ies.jpg","page_title":"List of bastion forts","context_page_description":"This is a list of bastion forts, also called Star forts."},{"page_url":"https://de.wikipedia.org/wiki/Palmfarne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Encephalartos_altensteinii_002.jpg","page_title":"Palmfarne","context_page_description":"Die Palmfarne sind eine der fünf heute lebenden, sehr unterschiedlich großen Gruppen der Samenpflanzen und umfassen etwa 320 Arten. Ihr deutscher Name bezieht sich auf die äußere Erscheinung, die sich durch einen palmenartigen oder unterirdischen Stamm und farnartige Blätter auszeichnet. Da ihre Samenanlagen nicht in Fruchtblättern eingeschlossen sind, gehören sie zu den Nacktsamern. Die weiblichen und männlichen Fortpflanzungsorgane stehen bei den meisten Arten in zapfenartigen Organen und befinden sich stets auf unterschiedlichen Individuen.\\nPalmfarne kommen weltweit in den Tropen vor, fehlen allerdings weitgehend in den tropischen Regenwäldern. Die Nutzung der Stämme als Stärke-Lieferanten war vor allem in der Vergangenheit von Bedeutung, heute sind einige Arten beliebte Zierpflanzen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%8A%D8%AF_%D9%87%D9%8A%D8%AF_(%D9%86%D9%8A%D9%88_%D8%A8%D8%B1%D9%88%D9%86%D8%B2%D9%88%D9%8A%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Intersection_Tide_Head.JPG","page_title":"تيد هيد (نيو برونزويك)","context_page_description":"تيد هيد ‏ هي مستوطنة تقع في كندا في Addington Parish, New Brunswick. يقدر عدد سكانها بـ 1,036 نسمة."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%85%D1%82%D1%8B%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ahtyrskij_rajon.PNG","page_title":"Ахтырский район","context_page_description":"Ахты́рский райо́н — административная единица на юге Сумской области Украины.\\nАдминистративный центр — город Ахтырка."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%AE%E0%A7%81%E0%A6%A6%E0%A7%8D%E0%A6%B0%E0%A6%AE%E0%A6%A8%E0%A7%8D%E0%A6%A5%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bangkok_Airport_07.JPG","page_title":"সমুদ্রমন্থন","context_page_description":"সমুদ্রমন্থন হলো হিন্দু পুরাণগুলিতে উল্লিখিত সর্বাধিক জনপ্রিয় শ্রুতি৷ ভাগবত পুরাণ, বিষ্ণুপুরাণ ও মহাভারত প্রভৃতি হিন্দু পুঁথি পুস্তকে এই ঘটনার বিবরণ পাওয়া যায়৷ সমুদ্রমন্থনের ঘটনাটি অমৃৃত তথা অমরত্বের সন্ধান দেয়৷"},{"page_url":"https://de.wikipedia.org/wiki/Industrialisierung","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Zeche_Sterkrade_Colliery0001.JPG","page_title":"Industrialisierung","context_page_description":"Industrialisierung ist innerhalb eines Staates ein Prozess, während dessen sich ein Agrarstaat zu einem Industriestaat entwickelt. Das Gegenteil ist die Deindustrialisierung."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%84%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%A8%D9%88%D8%AF%D8%A7%D9%BE%D8%B3%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Sz%C3%A9chenyi_Chain_Bridge_in_Budapest_at_night.jpg","page_title":"پل‌های بوداپست","context_page_description":"دانوب، از شمال به جنوب بوداپست، پایتخت مجارستان را به چندین بخش تقسیم می‌کند. پانزده پل شامل دوازده پل ترابری و دو پل ریلی این نقاط را در سراسر رودخانه متصل می‌کند:\\nشش پل: زنجیر، اِرژِبِت، آزادی، پتوفی، راکوتسی و ریلی جنوب در مرکز شهر قرار دارند که دانوب در زیر آن‌ها تک‌شاخه‌ای روان است.\\nسه پل: مِدیِری، ریلی شمال و مارگیت بر روی دو شاخهٔ دانوب ساخته شده‌اند.\\nزیر پل آرپاد چهار شاخه دانوب در حرکت است.\\nبر روی شاخه‌های جانبی دانوب چهار پل کا، کارخانهٔ کشتی، گوباچی و یِنو کواشایی نصب شده‌اند.\\nپل فرنتس دئاک بر روی شاخهٔ اصلی دانوب که از یک شاخهٔ فرعی توسط جزیرهٔ چپل جدا شده قرار دارد."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8A%E5%B8%82%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Kamiichi-station_2018.jpg","page_title":"上市駅","context_page_description":"上市駅は、富山県中新川郡上市町若杉にある富山地方鉄道本線の駅である。駅番号はT12。本駅で全列車がスイッチバックを行う。"},{"page_url":"https://nl.wikipedia.org/wiki/Cadeby_(South_Yorkshire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Cadeby_-_geograph.org.uk_-_116944.jpg","page_title":"Cadeby (South Yorkshire)","context_page_description":"Cadeby is een dorp en civil parish in het bestuurlijke gebied Doncaster, in het Engelse graafschap South Yorkshire. De civil parish telt 203 inwoners."},{"page_url":"https://de.wikipedia.org/wiki/Roman_Bezjak","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Bezjak_2014.jpg","page_title":"Roman Bezjak","context_page_description":"Roman Bezjak ist ein slowenischer Fußballspieler, der seit dem 14. Januar 2019 in Zypern bei APOEL Nikosia unter Vertrag steht."},{"page_url":"https://zh.wikipedia.org/zh-tw/ET2%E5%9E%8B%E7%94%B5%E5%8A%9B%E5%8A%A8%E8%BD%A6%E7%BB%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Electric_multiple_unit_ET2ML-078.jpg","page_title":"ET2型电力动车组","context_page_description":"ET2型電聯車是俄羅斯鐵路的電聯車車型之一，適用於供電制式為3000伏直流電的電氣化鐵路，由托爾若克車輛製造廠設計製造，於1993年研製成功並投入批量生產。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DB%8C%DA%A9%D8%AA%D9%88%D8%B1_%D8%AA%D9%88%D9%85%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Thommee.jpg","page_title":"ویکتور تومه","context_page_description":"ویکتور تومه; از فرماندهان نظامی نیروی زمینی لهستان و کهنه سرباز جنگ جهانی اول و جنگ داخلی روسیه بود. شهرت او به خاطر فرماندهی واحد عملیاتی پیترکوف در نبرد بزورا طی تهاجم آلمان نازی به لهستان در سال ۱۹۳۹ است."},{"page_url":"https://fr.wikipedia.org/wiki/Thomas_Pidcock","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Tom_Pidcock_-_2017_Tour_Series_%28Durham%2C_podium%29.jpg","page_title":"Thomas Pidcock","context_page_description":"Thomas « Tom » Pidcock, né le 30 juillet 1999 à Leeds, est un coureur cycliste britannique. Coureur polyvalent, il pratique avec succès le cyclo-cross, le cyclisme sur route, le VTT et a également fait de la piste. Il est notamment triple champion du monde dans les catégories de jeune et champion de Grande-Bretagne de cyclo-cross en 2019."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%95%D0%B3%D0%BE%D1%80%D0%BE%D0%B2_%D0%93%D0%B5%D0%BD%D0%BD%D0%B0%D0%B4%D0%B8%D0%B9_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/%D0%A2%D0%B5%D0%B0%D1%82%D1%80_%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%BE%D1%82_%D0%BD%D0%B0_%D0%B3%D0%B0%D1%81%D1%82%D1%80%D0%BE%D0%BB%D1%8F%D1%85_%D0%B2_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B5_%D0%B2_%D0%A6%D0%A1_%D0%A0%D0%9E%D0%A1%D0%A2%D0%9E_%28%D0%94%D0%9E%D0%A1%D0%90%D0%90%D0%A4%29_%D0%90%D0%BD%D0%BE%D1%85%D0%B8%D0%BD_%D0%90.%D0%98.%2C_%D0%95%D0%B3%D0%BE%D1%80%D0%BE%D0%B2_%D0%93.%D0%A1.%2C_%D0%98%D1%80%D0%B7%D0%B0%D0%BA_%D0%92.%D0%92.jpg","page_title":"Егоров Геннадий Семёнович","context_page_description":"Егоров Геннадий Семенович — совет һәм рәсәй театр һәм кино актеры, театр режиссеры, директоры, Рәсәй Федерацияһының атҡаҙанған мәҙәниәт хеҙмәткәре."},{"page_url":"https://de.wikipedia.org/wiki/Frisur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Codex_Manesse_Walther_von_der_Vogelweide.jpg","page_title":"Frisur","context_page_description":"Frisur oder Haartracht bezeichnet die Art und Weise, wie das Haupthaar getragen wird. Prinzipiell kann jedes Haar, ob menschlich oder tierisch, wenn es nicht zu hart ist, frisiert werden, wenngleich bei der Gestaltung des menschlichen Kopfhaares naturgemäß der größte Aufwand betrieben wird."},{"page_url":"https://cs.wikipedia.org/wiki/Sklabinsk%C3%BD_hrad","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/SKLABINYAI_v%C3%A1rrom.jpg","page_title":"Sklabinský hrad","context_page_description":"Sklabinský hrad je zřícenina hradu na nevysokém návrší nad obcí Sklabinský Podzámok v dolní části Kantorské doliny v severozápadní části Velké Fatry, přibližně 9 kilometrů na východ od Martina."},{"page_url":"https://it.wikipedia.org/wiki/Pesca_(attivit%C3%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/36-pesca%2CTaccuino_Sanitatis%2C_Casanatense_4182..jpg","page_title":"Pesca (attività)","context_page_description":"La pésca è un'attività commerciale e sportiva che da millenni fornisce cibo alle popolazioni insediate presso laghi, mari o fiumi, consistente nella cattura del pesce utilizzando strumenti di vario tipo da parte dei pescatori."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Myrmecia_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Myrmecia_desertorum_casent0914023_p_1_high.jpg","page_title":"List of Myrmecia species","context_page_description":"Myrmecia is a genus of small to large venomous ants commonly known as bulldog ants or jack jumper ants. The genus was first established by Danish zoologist Johan Christian Fabricius in 1804 and is placed in the subfamily Myrmeciinae of the family Formicidae. There are currently 94 described species in this genus, 93 of which are valid and identifiable. Almost all species are endemic to Australia and can be found nowhere else, with an exception of a single species found in New Caledonia."},{"page_url":"https://nl.wikipedia.org/wiki/Eukaryoten","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Eukaryote_tree_NL.svg","page_title":"Eukaryoten","context_page_description":"Eukaryoten, ook wel Eucarya, vormen een van de drie domeinen waarin de huidige biologische wetenschap het leven indeelt. Eukaryoten zijn alle organismen waarvan iedere cel een celkern bevat. Naast een celkern hebben de meeste eukaryotische cellen ook andere organellen, zoals mitochondriën en een golgiapparaat. In de cellen van algen en planten komen daarnaast chloroplasten voor. Tot de eukaryoten behoren, naast veel eencellige soorten, alle soorten meercellige organismen. Meercelligen bestaan uit verschillende, specifieke celtypen die verschillende weefsels vormen.\\nDe andere twee, prokaryotische, domeinen, de Bacteria en Archaea, werden eerder samengenomen als een domein, dat van de uitsluitend eencellige Monera. De moderne biologische taxonomie beschouwt de Bacteria en de Archaea inmiddels als twee zelfstandige domeinen, zodat er, samen met de Eukaryota, nu sprake is van in totaal drie taxonomische domeinen.\\nProkaryoten hebben een celbouw waarin het DNA niet omsloten wordt door een kernmembraan maar vrij in het cytoplasma ligt. Andere celorganellen ontbreken hier ook."},{"page_url":"https://nn.wikipedia.org/wiki/Astronomi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Galileo_moon_phases.jpg","page_title":"Astronomi","context_page_description":"Astronomi er vitskapen om himmellekamar og fenomen utanfor jordatmosfæren. Han tek for seg utvikling, fysikk, kjemi, meteorologi og rørslene til desse lekamane, i til|legg til utforminga og utviklinga av universet.\\nFysikken har tette band med astronomien. Mange fysiske oppdagingar kjem frå astronomiske observasjonar. Nokre viktige strukturar er solsystem og galaksar.\\nAstronomi er eit av dei få vitskaplege felta der amatørar enda spelar ein aktiv rolle, framfor alt i oppdaging og observering av tilfeldige fenomen som, til dømes, kometar. Astronomi skal ikkje forvekslast med astrologi, som er ein pseudovitskap der ein prøver å føreseie lagnaden til menneska gjennom å fylgje banane til himmellekamane. Dei to har liknande røter men skil seg markant i at astronomane bruker vitskaplege metodar og fakta som kan verifiserast, mens astrologar ikkje gjer det.\\nAstronomien var ein av dei første empiriske vitskapane, det vil seie ein vitskap der ein baserer teoriar på observasjon av faktiske hendingar i staden for filosofiske resonnement."},{"page_url":"https://it.wikipedia.org/wiki/Eutoxeres","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/MonographTrochi1Goul_0156.jpg","page_title":"Eutoxeres","context_page_description":"Eutoxeres Reichenbach, 1849 è un genere di uccelli della famiglia Trochilidae noti come falcetti."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BC%D0%B0%D0%BD%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%81%D1%96%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B0_%D1%80%D0%B0%D0%B4%D0%B0_(%D0%A8%D0%BE%D1%81%D1%82%D0%BA%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/%D0%A1.%D0%A2%D0%B8%D0%BC%D0%B0%D0%BD%D1%96%D0%B2%D0%BA%D0%B0_%D0%A8%D0%BE%D1%81%D1%82%D0%BA%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD_30.JPG","page_title":"Тиманівська сільська рада (Шосткинський район)","context_page_description":"Тиманівська сільська́ ра́да — орган місцевого самоврядування в Шосткинському районі Сумської області. Адміністративний центр — село Тиманівка.\\nСело Тиманівка знаходиться в 2-х км від лівого берега річки Десна, нижче за течією на відстані в 7 км розташоване село Чапліївка, на протилежному березі - село Радичів. По селу протікає пересихає струмок з загати. Від річки село відділяє великий лісовий масив. Річка в цьому місці звивиста, утворює лимани, стариці і заболочені озера."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre_de_Noirmont","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Eglise_Saint-Pierre_de_Noirmont_-_08.JPG","page_title":"Église Saint-Pierre de Noirmont","context_page_description":"L'église Saint-Pierre est une église de style classique située à Noirmont, ancien village constituant une des deux parties du village de Cortil-Noirmont, sur le territoire de la commune belge de Chastre en province du Brabant wallon."},{"page_url":"https://de.wikipedia.org/wiki/Heritage_(Rose)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Rosa_Heritage_1_RF.jpg","page_title":"Heritage (Rose)","context_page_description":"Die Rosensorte ‘Heritage’ ist eine hellrosa, öfterblühende Strauchrose, die von David Austin 1984 in Großbritannien eingeführt wurde.\\nGezüchtet wurde die Rosensorte aus einer Kreuzung der weißen Floribundarose ‘Schneewittchen’ und der hellrosa farbenen Englischen Rose ‘Wife of Bath’ mit einem Sämling. Die ‘Heritage’ gehört wie alle Englischen Rosen, die auf die Floribundarosa ‘Schneewittchen’ zurückgeführt werden, zur ‘Heritage’-Untergruppe der Englischen Rosen."},{"page_url":"https://sv.wikipedia.org/wiki/2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Jakarta_Ritz-Carlton_bomb_damage_2009.jpg","page_title":"2009","context_page_description":"2009 var ett normalår som började en torsdag i den gregorianska kalendern. Det var det sista året på decenniet 2000-talet. Året har utsetts till det Internationella astronomiåret, Internationella naturfiberåret och Naturens år."},{"page_url":"https://nl.wikipedia.org/wiki/Cosmas_en_Damianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Holy_Cosmas_and_holy_Damian_shrine_in_St._Michael_in_Munich.jpg","page_title":"Cosmas en Damianus","context_page_description":"Cosmas en Damianus waren volgens de christelijke overlevering tweelingbroers, geboren in de tweede helft van de 2e eeuw in Syrië. Van hun leven is niets met zekerheid bekend. Zij zouden allebei geneesheren zijn geweest, die kosteloos hun geneeskundige diensten aanboden en dankzij hun levenswijze velen tot het christendom bekeerden.\\nTijdens de christenvervolging onder keizer Diocletianus behoorden zij tot de eerste slachtoffers. Zij werden door de stadhouder Lycias gearresteerd en ondervraagd. Nadat zij over hun christelijke geloof hadden getuigd, werden zij in 303 onthoofd.\\nBoven hun graf in Cyrrhus is een kerk gebouwd. Van daaruit heeft hun verering zich naar Rome en van daaruit over de hele wereld verbreid. Reeds in de 5e eeuw werden zij veel vereerd. Paus Felix III verbouwde de tempel van Romulus bij het Forum Romanum tot een aan hen gewijde kerk. Het was deze kerk die de Nederlandse kardinaal Johannes Willebrands in 1975 toegewezen kreeg als titelkerk.\\nHet christendom ziet Cosmas en Damianus als de patroonheiligen van artsen, apothekers en andere beroepen uit de medische sector. Zij worden daarom vaak afgebeeld met een attribuut dat daar iets mee te maken heeft."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigliches_Kollegiatkapitel_der_Hl._Peter_und_Paul_auf_dem_Vy%C5%A1ehrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Canon_residences_Vysehrad_Prague_CZ_818.jpg","page_title":"Königliches Kollegiatkapitel der Hl. Peter und Paul auf dem Vyšehrad","context_page_description":"Das Königliche Kollegiatkapitel des Hl. Peter und Paul auf dem Vyšehrad in Prag wurde durch den Fürsten und böhmischen König Vratislav II. in der zweiten Hälfte des 11. Jahrhunderts gegründet. Um den Einfluss seines Bruders, des Prager Bischofs Jaromír-Gebehard, zu begrenzen, erwirkte er beim Heiligen Stuhl die Exemtion des Stifts, sodass das Kapitel bis 1763 nicht dem Prager Bischof, sondern dem Papst in Rom unterstellt war. Den Kanonikern des Kollegiatkapitels wurde zudem das Tragen der Mitra und von Pontifikalschuhen zugestanden.\\nDie großzügige Ausstattung des Stifts mit Gütern wurde später erweitert. Insbesondere Vratislavs Sohn Soběslav I. ließ die Stiftskirche reich ausstatten und erhöhte die Anzahl der Kanoniker auf 17, wodurch das Kapitel das bedeutendste Böhmens wurde. Die Kanoniker und Pröpste waren häufig Ratgeber und Kanzler der böhmischen Herzöge. Zu ihnen gehörte im 14. Jahrhundert der Propst und spätere Mainzer Erzbischof Peter von Aspelt.\\nDie Stiftskirche wurde 1079 im romanischen Stil einer fünfschiffigen Basilika erbaut und nach einem Brand im Jahr 1249 wieder aufgebaut. Im 14."},{"page_url":"https://nl.wikipedia.org/wiki/Del_Shannon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Del_Shannon_1965.jpg","page_title":"Del Shannon","context_page_description":"Del Shannon, geboren als Charles Weedon Westover, was een Amerikaans rock-'n-rollzanger."},{"page_url":"https://mg.wikipedia.org/wiki/Kumar_Bhattacharyya,_Baron_Bhattacharyya","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Kumar_Bhattacharyya.jpg","page_title":"Kumar Bhattacharyya, Baron Bhattacharyya","context_page_description":"Kumar Bhattacharyya, Baron Bhattacharyya dia mpanao politika, injeniera mizaka ny zom-pirenen'i Fanjakana Mitambatra teraka ny 6 Jiona 1940"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%BC%E3%82%B0%E3%83%AC%E3%82%A4%E3%82%BA%E9%83%A1_(%E3%82%AA%E3%83%8F%E3%82%A4%E3%82%AA%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Geyer_School_of_Ohio_in_1915.jpg","page_title":"オーグレイズ郡 (オハイオ州)","context_page_description":"オーグレイズ郡は、アメリカ合衆国オハイオ州の西部に位置する郡である。2010年国勢調査での人口は45,949人であり、2000年の46,611人から1.4%減少した。郡庁所在地はワーパーコネタ市であり、同郡で人口最大の都市でもある。\\nオーグレイズ郡はワーパーコネタ小都市圏に属している。"},{"page_url":"https://en.wikipedia.org/wiki/Dernbach,_Westerwaldkreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Klosterkirche_in_Dernbach.jpg","page_title":"Dernbach, Westerwaldkreis","context_page_description":"Dernbach is a local community in the district of Westerwaldkreis in Rhineland-Palatinate, Germany, and part of the municipal association Verbandsgemeinde Wirges. The village is known throughout the country by the three-way interchange A48/A3, called Dernbacher Dreieck, and well known worldwide by the international congregation Poor Handmaids of Jesus Christ, called Dernbacher Schwestern."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_governants_i_pr%C3%ADnceps_de_Transsilv%C3%A0nia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/II._R%C3%A1k%C3%B3czi_Ferenc_M%C3%A1nyoki.jpg","page_title":"Llista de governants i prínceps de Transsilvània","context_page_description":"El Principat de Transsilvània es va caracteritzar per ser una monarquia electiva on l'alta noblesa hongaresa dirigia aquesta unitat politicoadministrativa independent, que va existir entre els segles XVI i XVIII.\\nDesprés de la invasió turca del Regne d'Hongria, Transsilvània va formar un Principat, independent a partir de 1570, amb prínceps de cultura i idioma hongaresos. En 1686 el Sacre Imperi Romanogermànic va recuperar els antics territoris hongaresos de l'Imperi Otomà i posteriorment va expulsar els turcs de la regió de Transsilvània. La independència de Transsilvània es va acabar en 1711, quan quedà sota control austríac."},{"page_url":"https://simple.wikipedia.org/wiki/N%C3%A4fels","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kerenzerberg_N%C3%A4fels.JPG","page_title":"Näfels","context_page_description":"Näfels is a former municipality, in the municipality of Glarus Nord and canton of Glarus in Switzerland."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%BC%E3%82%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%E3%83%88%E3%83%BC%E3%82%B4%E5%A4%A7%E4%BD%BF%E9%A4%A8%E5%85%A8%E6%99%AF.jpg","page_title":"トーゴ","context_page_description":"トーゴ共和国、通称トーゴは、西アフリカに位置する共和制国家。東にベナン、北にブルキナファソ、西にガーナと国境を接し、南は大西洋のギニア湾に面する。首都はロメ。"},{"page_url":"https://tr.wikipedia.org/wiki/Fizik_motoru","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Box2d-screenshot.png","page_title":"Fizik motoru","context_page_description":"Fizik motoru, video oyunlarında ve simülasyon yazılımlarında kullanılan, üç boyutlu nesnelerin geometrilerinin kesişim testleri ve bu gibi fiziksel etkileşimlerini test eden bir yazılımdır. İçinde birçok fizik formülü tanımlıdır. Video oyun motorlarının bir parçasıdır.\\nVideo oyunlarında ve çeşitli simülasyon yazılımlarında kullanılırlar, üç boyutlu nesnelerin geometrik kesişimlerini test ederler. Fakat yöntemler yani kullanılan algoritmalar çeşitlidir. Bazı fizik motorları nesnelerin kutulanmış ve kürelenmiş geometrik sınırlarını denetleyerek kesişim testini gerçekleştirirler, bu dünyada yaygınlıkla kullanılan yöntemdir, ayrıca çok basit bir algoritma yapısı vardır. Lakin, bu basit yöntemler nesnelerin gerçek davranışlarını yansıtmazlar. Bundan dolayı video oyun motorlarından farklı olarak, simülasyon yazılımlarında daha gelişmiş ile geometrik kesişim testleri gerçekleştirilir.\\nFizik motoru, video oyunlarında ve simülasyon yazılımlarında gerçekçiliği belirleyen en büyük unsurlardan biridir. Ücretli olanların değeri onlarca dolardan yüzbinlerce dolara kadar varabilir."},{"page_url":"https://eu.wikipedia.org/wiki/Dongeradeel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Exterieur_OVERZICHT_VOORGEVELS_-_Dokkum_-_20355511_-_RCE.jpg","page_title":"Dongeradeel","context_page_description":"Dongeradeel Herbehereetako Frisiako herria da. 2010eko urtarrilaren 1eko erroldaren arabera, herriak 24.317 biztanle zituen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D1%8B%D1%82%D1%8B%D0%B9_%D1%80%D1%8B%D0%BD%D0%BE%D0%BA_(%D0%95%D1%80%D0%B5%D0%B2%D0%B0%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Interior_del_mercado_de_Yerevan.JPG","page_title":"Центральный крытый рынок (Ереван)","context_page_description":"Центральный крытый рынок — торговый комплекс Еревана, столицы Армении. Расположен на проспекте Месропа Маштоца неподалёку от Голубой мечети. Построен в 1952 году. Является одной из наиболее известных работ архитектора Григора Агабабяна. После реконструкции в начале 2010-х годов стал частью торгового комплекса. Туристическая достопримечательность. Входит в список памятников истории и культуры Армении."},{"page_url":"https://gl.wikipedia.org/wiki/Etelhems_krukmakeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Cartel_da_Etelhems_Krukmakeri.jpg","page_title":"Etelhems krukmakeri","context_page_description":"Etelhems krukmakeri é unha olaría en Etelhem, Gotland, a máis antiga da illa."},{"page_url":"https://fr.wikipedia.org/wiki/Peter_Connolly","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Peter_connolly.jpg","page_title":"Peter Connolly","context_page_description":"Peter Connolly, né le 8 mai 1935 et mort le 2 mai 2012, est un historien, archéologue et illustrateur spécialiste de l'Antiquité grecque et romaine. Il a utilisé ses compétences d'illustrateur dans ses ouvrages."},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_Rockbridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Church_Hill_on_Timber_Ridge%2C_cropped.jpg","page_title":"Hrabstwo Rockbridge","context_page_description":"Hrabstwo Rockbridge – hrabstwo w USA, w stanie Wirginia, według spisu z 2000 roku liczba ludności wynosiła 20 808. Siedzibą hrabstwa jest Lexington."},{"page_url":"https://sv.wikipedia.org/wiki/Afghanistans_historia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Afghanmap1893.JPG","page_title":"Afghanistans historia","context_page_description":"Afghanistans historia kan spåras mycket långt tillbaka i tiden. Redan 9-6000 f.Kr bedrevs det jordbruk och boskapsskötsel i området och på 4000-talet fanns där en storartad stadskultur. Genom sitt läge mellan Syd-, Väst och Centralasien har området varit viktigt för handeln och mottagit kulturella influenser från många håll. Området har många gånger invaderats av stormakter och mera tillfälliga erövrare men också varit centrum för riken som varit mycket större än det nuvarande Afghanistan. Landet Afghanistan som vi känner det grundades år 1747, var under en del av 1800-talet brittiskt protektorat och blev självständigt år 1919. År 1979 invaderades landet av Sovjetunionen till stöd för en svag kommunistisk regering. Sedan dess har det ständigt pågått krig mot invasionstrupper och mellan inhemska styrkor, och sedan 2001 har USA stora militära styrkor i landet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D0%BD%D0%B3%D1%83%D1%80%D0%B0%D1%83%D0%B0_(%D0%BF%D1%80%D0%BE%D0%B2%D0%B8%D0%BD%D1%86%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Bandera_de_P%C3%ADllaro.png","page_title":"Тунгурауа (провинция)","context_page_description":"Тунгурауа — провинция в центральной части Эквадора. Население по данным на 2010 год — 504 583 человека. Административный центр — город Амбато."},{"page_url":"https://de.wikipedia.org/wiki/Cleit","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/A_Cleit_On_St_Kilda_-_geograph.org.uk_-_1379478.jpg","page_title":"Cleit","context_page_description":"Ein Cleit ist eine Steinhütte, die nur auf den Inseln und Stacs des Archipels von St. Kilda, die gelegentlich zu den Äußeren Hebriden in Schottland gezählt werden, zu finden ist. Es gibt auf Hirta 1260 Cleitean und auf anderen Inseln der Gruppe weitere 170. Während viele noch erhalten sind, verfallen sie langsam.\\nDie vorgelagerte Insel Boreray beherbergt das Cleitean MacPhàidein, ein „Cleit-Dorf“ mit drei kleinen Hütten. Infolge eines Ausbruchs der Pocken auf Hirta im Jahr 1727 wurden drei Männer und acht Jungen auf dem Stac an Armin vor Boreray bis zum folgenden Mai ausgesetzt.\\nAuf St. Kilda, das baumlos ist, nutzten die Inselbewohner den Wind, der durch die Spalten des Trockenmauerwerks strömte, um Nahrung durch Trocknung zu konservieren, statt sie zu räuchern oder zu Pökeln. Die Cleitean wurden verwendet um Produkte zu speichern oder zu trocknen wie:\\nAngelausrüstung\\nDünger\\nEier\\nFisch\\nGefieder\\nGetreide\\nHeu\\nKartoffeln\\nLammfleisch\\nSeile\\nSeevögelkadaver\\nTorf\\nIn seinem Buch über St. Kilda schreibt David A."},{"page_url":"https://ast.wikipedia.org/wiki/Surinam","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Henck_Arron%2C_Beatrix%2C_Johan_Ferrier_1975.jpg","page_title":"Surinam","context_page_description":"El Surinam, oficialmente República del Surinam ye un estáu allugáu na costa atlántica nororiental d'América del Sur. Llenda col océanu Atlánticu al norte, cola Guayana Francesa al este, con Guyana al oeste y con Brasil al sur. Ye, colos sos 165.000 km² d'estensión, el país más pequeñu del continente sudamericanu. La so población, de 566.000 persones, vive na so mayoría averada a la costa, na capital del país, Paramaribu, y na rodiada d'esta.\\nEl territoriu de Surinam, habitáu tradicionalmente por delles tribus indíxenes, foi esploráu y disputáu por varies potencies europees primnero de quedar embaxu la xurisdicción holandesa a finales del sieglu XVII. En 1954 el país convirtiose nún de los países constituyentes del Reinu d'Holanda. El 25 de payares de 1975 declarose estáu independiente, pero sigue calteniendo importantes rellaciones económiques, culturales y diplomátiques cola so antigua metrópoli. Los sos habitantes indíxenes vienen siendo de magar cada vegada más activos na reclamación de les sos tierres tradicionales y na conservación de los sos vezos y formes de vida.\\nSurinam considérase, dende'l puntu de vista cultural, un país caribeñu, y ye miembru de la Comunidá del Caribe."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_comunelor_din_Suedia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Falkenberg_Municipality_in_Halland_County.png","page_title":"Lista comunelor din Suedia","context_page_description":"Aceasta este lista comunelor din Suedia."},{"page_url":"https://en.wikipedia.org/wiki/Edmundo_Rivero","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Edmundo_rivero_guitar.jpg","page_title":"Edmundo Rivero","context_page_description":"Leonel Edmundo Rivero was an Argentine tango singer, composer, and impresario."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B0%E0%B2%BE%E0%B2%B7%E0%B3%8D%E0%B2%9F%E0%B3%8D%E0%B2%B0%E0%B3%80%E0%B2%AF_%E0%B2%B9%E0%B3%86%E0%B2%A6%E0%B3%8D%E0%B2%A6%E0%B2%BE%E0%B2%B0%E0%B2%BF_(%E0%B2%AD%E0%B2%BE%E0%B2%B0%E0%B2%A4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/NH75.jpg","page_title":"ರಾಷ್ಟ್ರೀಯ ಹೆದ್ದಾರಿ (ಭಾರತ)","context_page_description":"ಭಾರತದಲ್ಲಿ, ರಾಷ್ಟ್ರೀಯ ಹೆದ್ದಾರಿಗಳು ಪ್ರಮುಖ ಅತಿದೂರದ ಹೆದ್ದಾರಿಗಳು. ಬಹುತೇಕ ಹೆದ್ದಾರಿಗಳು ಭಾರತ ಸರ್ಕಾರದ ಉಸ್ತುವಾರಿಯಲ್ಲಿವೆ, ಉಳಿದವು ಸಾರ್ವಜನಿಕ-ಖಾಸಗಿ ಪಾಲುದಾರಿಕೆಯಲ್ಲಿ ಖಾಸಗಿ ವಲಯದಿಂದ ನಿರ್ವಹಿಸಲ್ಪಡುತ್ತಿವೆ. ಬಹುತೇಕ ಹೆದ್ದಾರಿಗಳು ದ್ವಿಪಥ ಹೆದ್ದಾರಿಗಳು. ಅವು ಸುಮಾರು ೬೭, ೦೦೦ ಕಿ.ಮಿ. ದೂರವನ್ನು ವ್ಯಾಪಿಸುತ್ತವೆ, ಇದರಲ್ಲಿ ಸುಮಾರು ೨೦೦ ಕಿ.ಮಿ. ನಷ್ಟು ಕ್ಷಿಪ್ರಗತಿ ಮಾರ್ಗಗಳಿವೆ.\\nಭಾರತದ ರಾಷ್ಟ್ರೀಯ ಹೆದ್ದಾರಿಗಳ ಪಟ್ಟಿಯನ್ನು ಕೆಳಗೆ ನೀಡಲಾಗಿದೆ. ಪ್ರಸ್ತುತ ಈ ಪಟ್ಟಿಯು ಹೆದ್ದಾರಿ ಸಂಖ್ಯೆಯ ಆಧಾರದ ಮೇಲೆ ಹೊಂದಿಸಲ್ಪಟ್ಟಿದೆ. ಇದನ್ನು ಹೆದ್ದಾರಿಯ ಉದ್ದ ಅಥವಾ ಮಾರ್ಗದ ಆರಂಭದ ಸ್ಥಳದ ಪ್ರಕಾರ ಸಹ ಜೋಡಿಸಬಹುದು. ಶಿರೋನಾಮೆಗಳ ಬಳಿ ಕಾಣುವ ಪುಟ್ಟ ಬಾಕ್ಸ್ ಒತ್ತಿ ಬೇಕಾದಂತೆ ಜೋಡಿಸಿಕೊಳ್ಳಬಹುದು.\\nಸೂಚನೆ: ಈ ಪಟ್ಟಿ ಅಪೂರ್ಣ. ಮುಂದುವರೆಸಲಾಗುವುದು."},{"page_url":"https://ca.wikipedia.org/wiki/Can%C3%A7oner_medieval","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Mariam_matrem_virginem.jpg","page_title":"Cançoner medieval","context_page_description":"Un cançoner medieval és un llibre manuscrit o publicat durant l'edat mitjana que conté una col·lecció de poemes i cançons de trobadors o trobers, que generalment amb anotacions sobre la polifonia o monofonia. Abans del 1420 els cançoners medievals incorporaven la música sagrada i secular al mateix lloc, amb l'excepció del treball de Guillaume de Machaut. A partir del 1420 la música secular i la sagrada s'ofereix de manera separada, amb grans llibres per als cors que cantaven música sagrada, i petits cançoners per un ús més privat de les classes benestants. Els primers cançoners es van compilar primerament a la Catalunya Nord, actual França, però també a Itàlia, Alemanya i la península Ibèrica."},{"page_url":"https://no.wikipedia.org/wiki/Tadsjikistans_riksv%C3%A5pen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Coat_of_arms_of_Tajikistan_1992-1993.svg","page_title":"Tadsjikistans riksvåpen","context_page_description":"Tadsjikistans riksvåpen ble antatt 28. desember 1993. Våpenet er et sirkulært emblem, med en gyllen krone og syv gylne stjerner som sentralmotiv. Kronen er et symbol på grunnprinsippene i Zoroastrisme. De syv stjernene står for Den hellige ånd og de seks skytsåndene for kveg, for ild, for metall, for jord, for vann, og for planter. Kronen viser også til det persiske ordet taj som betyr krone, hvorfra betegnelsen for Tadsjikere er avledet. Krone peker i denne forbindlsen mot at Sentral-Asia er «verdens krone» med sine høye fjell.\\nNederst i emblemet en oppslått gull bok og de snødekkede Pamirfjellene med en oppstigende sol og solstråler. På hver side er emblemet omgitt av bomull- og hvete-aks. Omkring aksene er det et banner i nasjonalflaggets farger."},{"page_url":"https://eo.wikipedia.org/wiki/Istv%C3%A1n_Kiss_(skulptisto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/D%C3%B3zsa_Gy%C3%B6rgy_Memorial._-_D%C3%B3zsa_Gy%C3%B6rgy_Square%2C_BudapestDSCN4000.jpg","page_title":"István Kiss (skulptisto)","context_page_description":"István Kiss [iŝtvAn kiŝ], laŭ hungarlingve kutima sinsekvo Kiss István estis hungara skulptisto, altlerneja instruisto, honora membro de Belarta Akademio de Sovetunio.\\nIstván Kiss naskiĝis la 8-an de junio 1927 en Ciumeghiu, li mortis la 29-an de decembro 1997 en Budapeŝto."},{"page_url":"https://nl.wikipedia.org/wiki/Bryophryne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Bryophryne_nubilosus09.jpg","page_title":"Bryophryne","context_page_description":"Bryophryne is een geslacht van kikkers uit de familie Craugastoridae. De soort werd voor het eerst wetenschappelijk beschreven door Stephen Blair Hedges, William Edward Duellman en Matthew P. Heinicke in 2008. Het geslacht is pas in 2008 erkend en werd daarvoor niet in de literatuur gebruikt.\\nEr zijn negen soorten inclusief de pas in 2015 beschreven soort Bryophryne bakersfield. De verschillende soorten komen voor in delen van Zuid-Amerika. Alle soorten leven endemisch in Peru. De meeste soorten zijn bergbewoners en leven op enkele kilometers boven zeeniveau.\\nEen aantal soorten is pas zeer recentelijk ontdekt, de soorten Bryophryne abramalagae en Bryophryne flammiventris zijn in 2010 voor het eerst wetenschappelijk beschreven."},{"page_url":"https://pt.wikipedia.org/wiki/Livro_de_Malaquias","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Lorch_St.Laurenz_-_Fenster_2_Malachias.jpg","page_title":"Livro de Malaquias","context_page_description":"O Livro de Malaquias é um livro profético que faz descrições que mostram a necessidade de reformas antes da vinda do Messias. Por ser um livro curto e de acordo com a catalogação, Malaquias é o último dos profetas menores, tendo sido escrito por volta do ano 430 a.C., sendo que o seu nome não é citado em mais nenhum livro da Bíblia.\\nO profeta Malaquias foi contemporâneo de Esdras e Neemias, no período após o exílio do povo judeu na Babilônia em que os muros de Jerusalém tinham sido já reconstruídos em 445 a.C., sendo necessário conduzir os israelitas da apatia religiosa aos princípios da lei mosaica.\\nOs temas tratados na obra seriam o amor de Deus, o pecado dos sacerdotes, o pecado do povo e a vinda do Senhor.\\nNas últimas linhas deste livro do Antigo Testamento bíblico, vemos uma exortação de Deus às famílias: \\"converter o coração dos pais aos filhos e dos filhos aos seus pais\\". No término do livro de Malaquias convida-se ao arrependimento da família como alicerce da sociedade."},{"page_url":"https://en.wikipedia.org/wiki/V%C3%A4stervik_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/V%C3%A4stervik_station.JPG","page_title":"Västervik Municipality","context_page_description":"Västervik Municipality is a municipality in Kalmar County, south-eastern Sweden, with its seat in the city of Västervik.\\nThe present municipality was created in 1971, when the former City of Västervik was amalgamated with eight surrounding rural municipalities."},{"page_url":"https://de.wikipedia.org/wiki/Schwarzh%C3%A4upterhaus_(Tallinn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Visit_of_the_Conference_of_the_Presidents_of_the_European_Parliament_BB5A4977_%2834879285541%29.jpg","page_title":"Schwarzhäupterhaus (Tallinn)","context_page_description":"Das Schwarzhäupterhaus ist das denkmalgeschützte ehemalige Gemeinschaftshaus der Brüderschaft der Schwarzhäupter in der estnischen Hauptstadt Tallinn. Heute wird es für die Durchführung von Kulturveranstaltungen genutzt."},{"page_url":"https://cs.wikipedia.org/wiki/Prusko-rakousk%C3%A1_v%C3%A1lka","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Saxon_Cavalry_in_Prague_1866.jpg","page_title":"Prusko-rakouská válka","context_page_description":"Prusko-rakouská válka byla válka vedená v roce 1866 mezi Pruským královstvím, Italským královstvím a jejich spojenci na straně jedné a Rakouským císařstvím a jeho spojenci na straně druhé o převahu v Německém spolku. Vítězství Pruska nad Rakouským císařstvím vedlo ke vzniku Rakousko-Uherska a pruské hegemonii v Severoněmeckém spolku, což byl krok vedoucí ke sjednocení Německa a jeho maloněmecké řešení s vyloučením Rakouska. Důsledkem války získala Itálie Benátky odstoupené Rakouskem."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D9%88%D8%AF%D9%88%D8%A7%D8%B1%D8%AF%D8%8C_%D9%BE%D9%86%D8%B3%DB%8C%D9%84%D9%88%D8%A7%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Penns_Valley_Drive.jpg","page_title":"وودوارد، پنسیلوانیا","context_page_description":"وودوارد یک منطقهٔ مسکونی در ایالات متحده آمریکا است که در شهرستان سنتر، پنسیلوانیا واقع شده‌است. وودوارد ۱٫۵۳ کیلومتر مربع مساحت و ۱۱۰ نفر جمعیت دارد و ۳۴۳٫۵۱ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Strau%C3%9Ffurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Strau%C3%9Ffurt-Stolperstein-Melitta-Opfermann-CTH.JPG","page_title":"Straußfurt","context_page_description":"Straußfurt ist eine Gemeinde im Landkreis Sömmerda in Thüringen und Sitz der Verwaltungsgemeinschaft Straußfurt, der weitere sechs Gemeinden angehören."},{"page_url":"https://sv.wikipedia.org/wiki/Canale,_Piemonte","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Mappa_provincia_IT-CN_Canale.png","page_title":"Canale, Piemonte","context_page_description":"Canale är en ort och kommun i provinsen Cuneo i regionen Piemonte i Italien. Kommunen hade 5 909 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Chittorgarh_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Rajasthan_Monument_36.JPG","page_title":"Chittorgarh district","context_page_description":"Chittaurgarh district is one of the 33 districts of Rajasthan state in western India. The historic city of Chittaurgarh is the administrative headquarters of the district. The modern district of Chittaurgarh was established on 1 August 1948 by integrating portions of various states: Mewar, Pratabgarh, Tonk, and Jhalawar."},{"page_url":"https://en.wikipedia.org/wiki/Williams,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Williams_iowa.jpg","page_title":"Williams, Iowa","context_page_description":"Williams is a city in Hamilton County, Iowa, United States. The population was 344 at the 2010 census. Williams is a regional center of wind power generation."},{"page_url":"https://en.wikipedia.org/wiki/Gerhard_Chroust","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Gerhard_Chroust_2007.png","page_title":"Gerhard Chroust","context_page_description":"Gerhard Chroust is an Austrian systems scientist, and Professor Emeritus for Systems Engineering and Automation at the Institute of System Sciences at the Johannes Kepler University Linz, Austria. Chroust is an authority in the fields of formal programming languages and interdisciplinary information management."},{"page_url":"https://sv.wikipedia.org/wiki/Farrera_(kommunhuvudort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Farrera_esglesia.JPG","page_title":"Farrera (kommunhuvudort)","context_page_description":"Farrera är en kommunhuvudort i Spanien i kommunen Farrera. Den ligger i provinsen Província de Lleida och regionen Katalonien, i den nordöstra delen av landet, 500 km nordost om huvudstaden Madrid. Farrera ligger 1 355 meter över havet och antalet invånare är 105.\\nTerrängen runt Farrera är bergig åt nordväst, men åt sydost är den kuperad. Den högsta punkten i närheten är 2 041 meter över havet, 2,1 km öster om Farrera. Runt Farrera är det mycket glesbefolkat, med 4 invånare per kvadratkilometer. Närmaste större samhälle är Sort, 14,8 km sydväst om Farrera. I omgivningarna runt Farrera växer i huvudsak barrskog.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 7 °C. Den varmaste månaden är juli, då medeltemperaturen är 18 °C, och den kallaste är februari, med -2 °C. Genomsnittlig årsnederbörd är 1 004 millimeter. Den regnigaste månaden är november, med i genomsnitt 126 mm nederbörd, och den torraste är oktober, med 61 mm nederbörd."},{"page_url":"https://en.wikipedia.org/wiki/Kentucky%27s_10th_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Elijah-Phister.jpg","page_title":"Kentucky's 10th congressional district","context_page_description":"Kentucky's 10th congressional district was a district of the United States House of Representatives in Kentucky. It was lost to redistricting in 1933. Its last Representative was Andrew J. May."},{"page_url":"https://es.wikipedia.org/wiki/Clunia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Hispania_roads.svg","page_title":"Clunia","context_page_description":"La Colonia Clunia Sulpicia es una ciudad romana situada entre las localidades de Coruña del Conde y Peñalba de Castro, en el sur de la provincia de Burgos. Se trató de una de las ciudades más importantes de la mitad norte de Hispania y fue la capital de un convento jurídico de la provincia Hispania Citerior Tarraconensis, el denominado Conventus Cluniensis. Clunia es un topónimo de origen arévaco.​"},{"page_url":"https://en.wikipedia.org/wiki/Nuannuan_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%E6%9A%96%E6%9A%96%E8%A6%AA%E6%B0%B4%E5%85%AC%E5%9C%92_Nuannuan_Water_Park_-_panoramio.jpg","page_title":"Nuannuan District","context_page_description":"Nuannuan District, also Nuan Nuan, is a district of the city of Keelung, Taiwan."},{"page_url":"https://es.wikipedia.org/wiki/Naz%C4%B1m_Pach%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Nazim_Pascha.png","page_title":"Nazım Pachá","context_page_description":"Hussein Nazım Pachá fue un militar al servicio del Imperio otomano, jefe del Estado Mayor durante la Primera guerra de los Balcanes.\\nEra un partidario decidido de la doctrina ofensiva francesa, ​ diseñada por el militar Ferdinand Foch, que había sido su instructor en la Escuela Especial Militar de Saint-Cyr y que más tarde mandaría los ejércitos aliados en el frente occidental durante la Primera Guerra Mundial.\\nDespués de su nombramiento como jefe del Estado Mayor imperial, cambió de inmediato los plantes militares otomanos, que había trazado Colmar von der Goltz, un oficial alemán encargado de la reorganización de la estrategia del imperio.​ Von der Goltz había dispuesto que, en caso de guerra con los Estados balcnicos, las fuerzas del sultn se mantendrán a la defensiva, tanto en el Vardar como en Tracia oriental.​\\nNazım Pacha abandonó la estrategia de Von der Goltz, y, a pesar de problemas de movilización del ejército, diseñó un plan ofensivo audaz en los dos frentes. Convencido, como lo estaban los observadores occidentales, de que el ejército serbio se hallaba debilitado tras su derrota en la guerra serbo-búlgara, decidió de atacarlo primero con el fin de neutralizarlo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D0%BD%D0%BA%D0%B8%D0%BD%D1%81,_%D0%9C%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Callwaiting.jpg","page_title":"Дженкинс, Марк","context_page_description":"Марк Дженкинс — современный американский художник, представитель стрит-арта, известен благодаря скульптурам из прозрачной плёнки и скотча."},{"page_url":"https://sv.wikipedia.org/wiki/Habropoda_laboriosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Habropoda_laboriosa_f2.jpg","page_title":"Habropoda laboriosa","context_page_description":"Habropoda laboriosa är en biart som först beskrevs av Fabricius 1804. Habropoda laboriosa ingår i släktet Habropoda och familjen långtungebin. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Lisa_Schmitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/2015-09-13_1.FFC_Frankfurt_vs_1.FFC_Turbine_Potsdam_Lisa_Schmitz_004.jpg","page_title":"Lisa Schmitz","context_page_description":"Lisa Schmitz ist eine deutsche Fußballtorhüterin."},{"page_url":"https://pt.wikipedia.org/wiki/Mourisco_Mar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/EnseadaBotafogo.jpg","page_title":"Mourisco Mar","context_page_description":"Mourisco Mar é a sede de desportos aquáticos do Botafogo de Futebol e Regatas, situado no bairro de Botafogo, Rio de Janeiro, Brasil. Fica localizado no início da praia de Botafogo, mais precisamente na avenida Repórter Nestor Moreira, sem número, tendo vista para toda a enseada de Botafogo e também para o Pão de Açúcar."},{"page_url":"https://cs.wikipedia.org/wiki/Velk%C3%BD_Kundy%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%BA%D1%83%D0%BD%D0%B4%D1%8B%D1%881.jpg","page_title":"Velký Kundyš","context_page_description":"Velký Kundyš je řeka v Marijské republice a v Kirovské oblasti v Rusku. Je 173 km dlouhá. Povodí má rozlohu 1710 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Cit%C3%A9_Plantagen%C3%AAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Carte_Cit%C3%A9_Plantagen%C3%AAt.JPG","page_title":"Cité Plantagenêt","context_page_description":"Le Vieux Mans, dont la dénomination de marketing touristique Cité Plantagenêt a été proposée et retenue en 2003, est le centre médiéval historique de la ville du Mans anciennement Vindunum."},{"page_url":"https://az.wikipedia.org/wiki/Milli_%C4%B0nc%C9%99s%C9%99n%C9%99t_Muzeyi_(Buenos-Ayres)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/MNBA_Bourdelle_7656.JPG","page_title":"Milli İncəsənət Muzeyi (Buenos-Ayres)","context_page_description":"Milli İncəsənət Muzeyi — Buenos-Ayres şəhərinin Rekoleta rayonunda yerləşən incəsənət muzeyi. 2004-cü ildə muzey Neuken şəhərində öz filialını açdı."},{"page_url":"https://fr.wikipedia.org/wiki/Plan%C3%A8te_X","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Charon_Discovery.jpg","page_title":"Planète X","context_page_description":"Est appelée planète X toute planète hypothétique supposée se situer au-delà de Neptune. Si un tel objet existait, il serait alors la neuvième planète du système solaire.\\nÀ la suite de la découverte de Neptune en 1846 sur la base de perturbations observées dans la trajectoire d'Uranus, de nombreuses spéculations sur l'existence d'une autre planète pouvant exister au-delà de son orbite commencèrent à émerger. La recherche commença dès le milieu du XIXᵉ siècle et culmina au début du XXᵉ siècle quand l'astronome Percival Lowell présenta l'hypothèse de la planète X pour expliquer des anomalies dans les mouvements apparents des planètes géantes du système solaire, en particulier Uranus et Neptune. Cette planète invisible aurait une période orbitale de 3 600 ans, perturberait Uranus et causerait ces irrégularités.\\nLa découverte de Pluton par Clyde Tombaugh, en 1930, a semblé valider l'hypothèse de Lowell et Pluton fut alors officiellement considérée comme la neuvième planète. Il devint cependant rapidement clair que Pluton était bien plus petit que ce qui était supposé lors de sa découverte."},{"page_url":"https://de.wikipedia.org/wiki/Haus_Vercken","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Kl%C3%B6sterchen_-_R%C3%BCckansicht.JPG","page_title":"Haus Vercken","context_page_description":"Das Haus Vercken, umgangssprachlich auch Klösterchen genannt, ist ein barockes Bürgerhaus im Zentrum der belgischen Stadt Eupen. Das Gebäude mit der Adresse Marktplatz 1 ist heute ein Kloster der Franziskanerinnen von der Heiligen Familie und steht unter der Bezeichnung Haus Marktplatz 1 seit dem 25. Februar 1950 als Kulturdenkmal unter Denkmalschutz."},{"page_url":"https://en.wikipedia.org/wiki/Marie_Souvestre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Marie_Souvestre_relaxed_%28sq_cropped%29.jpg","page_title":"Marie Souvestre","context_page_description":"Marie Souvestre was an educator who sought to develop independent minds in young women. She founded a school in France and when she left the school with one of her teachers she founded Allenswood Academy in London."},{"page_url":"https://de.wikipedia.org/wiki/Damerower_Werder","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Wisente_damerow.JPG","page_title":"Damerower Werder","context_page_description":"Der Damerower Werder ist eine Halbinsel im Kölpinsee in der Mecklenburgischen Seenplatte. Er liegt im Naturpark Nossentiner/Schwinzer Heide. Von Norden grenzt der Jabelsche See an. Auf der Halbinsel werden in zwei getrennten Anlagen, einem Freibereich mit 320 Hektar Wald und einer Schauanlage, zwischen 20 und 34 Wisente gehalten und gezüchtet.\\nDer Damerower Werder, die Halbinsel Heidenkirchhof, Teilflächen des Umlandes, des Kölpinsees mit seiner Bucht Schwenzin sowie des Jabelschen Sees gehören zum 777 Hektar großen Naturschutzgebiet Damerower Werder. Die Unterschutzstellung erfolgte im Jahr 1966. Gebietserweiterungen gab es 1990 und 1998. Schutzzweck ist der Erhalt und der Schutz des Wisentlebensraumes auf der Halbinsel, des Kranichsammelplatzes am Schwenzin, der Feuchtwiesen, der Röhrichtbestände, der Seggenriede und der Magerrasenflächen auf der Halbinsel Heidenkirchhof."},{"page_url":"https://fr.wikipedia.org/wiki/Fru%C5%A1ka_gora","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ruma_junction_train_to_Sabac.JPG","page_title":"Fruška gora","context_page_description":"La Fruška gora est un massif montagneux situé en Serbie, au nord de la région de Syrmie, dans la province autonome de Voïvodine.\\nLa Fruška gora est un inselberg, une « montagne insulaire », qui s'élève dans la partie méridionale de la plaine de Pannonie ; sur le plan géologique, elle constitue un horst, une zone résultant d'un soulèvement de terrain, et s'est formée au Paléozoïque. Le massif abrite aujourd'hui une flore et une faune particulièrement riches ; en 1960, une grande partie du massif, soit 25 525 ha, a été transformée en parc national et, en 2000, une zone de 42 000 ha a été désignée comme une zone importante pour la conservation des oiseaux.\\nLa région de la Fruška gora est habitée depuis la Préhistoire et des vestiges appartenant notamment aux cultures néolithiques de Starčevo et de Vinča y ont été mis au jour. Dans l'Antiquité, à l'époque de la Tétrarchie, la ville romaine de Sirmium, aujourd'hui Sremska Mitrovica, située au pied du massif, devint momentanément l'une des capitales de l'Empire romain, au même titre que Trèves, Mediolanum et Nicomédie ; dix empereurs romains y ont vu le jour."},{"page_url":"https://fr.wikipedia.org/wiki/Podmila%C4%8Dje","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D1%83_%D0%9F%D0%BE%D0%B4%D0%BC%D0%B8%D0%BB%D0%B0%D1%87%D1%98%D1%83.JPG","page_title":"Podmilačje","context_page_description":"Podmilačje est un village de Bosnie-Herzégovine. Il est situé dans la municipalité de Jajce, dans le canton de Bosnie centrale et dans la Fédération de Bosnie-et-Herzégovine. Selon les premiers résultats du recensement bosnien de 2013, il compte 657 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Vinnie_Colaiuta","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/VinnieplayingGretsch.jpg","page_title":"Vinnie Colaiuta","context_page_description":"Vincent « Vinnie » Colaiuta est un batteur de jazz fusion."},{"page_url":"https://sv.wikipedia.org/wiki/Tephrosia_purpurea","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Plant_KOZUNJI.jpg","page_title":"Tephrosia purpurea","context_page_description":"Tephrosia purpurea är en ärtväxtart som först beskrevs av Carl von Linné, och fick sitt nu gällande namn av Christiaan Hendrik Persoon. Tephrosia purpurea ingår i släktet Tephrosia och familjen ärtväxter."},{"page_url":"https://es.wikipedia.org/wiki/Museo_del_Jade","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Olmec_jade_from_Costa_Rica._Museo_del_Jade.jpg","page_title":"Museo del Jade","context_page_description":"El Museo del Jade y de la Cultura Precolombina, llamado simplemente Museo del Jade, es un museo histórico, cultural y arqueológico ubicado en San José, Costa Rica, perteneciente al Instituto Nacional de Seguros. Resguarda una colección arqueológica conformada por una amplia gama de artefactos de cerámica, hueso, madera, concha y piedra como estatuaria, metates, manos de moler y otros, sin embargo, su principal atractivo es la enorme cantidad de piezas arqueológicas confeccionadas con piedras semipreciosas conocidas en su conjunto como jade, colección considerada como la más grande del mundo con respecto a esta piedra preciosa. Hasta el año 2014, su sede estuvo ubicada en la planta baja de la sede central del INS, en avenida 7, calles 9 y 11, luego pasó a ocupar un moderno edificio de cinco pisos, localizado al oeste de la Plaza de la Democracia, construido con el propósito específico de albergarlo. En la actualidad se considera al Museo del Jade un importante promotor de la cultura costarricense."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D9%85%DB%8C%D8%A7%D9%85%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Delta_Tau_Delta%2C_Miami_University.jpg","page_title":"دانشگاه میامی","context_page_description":"دانشگاه میامی دانشگاهی ایالتی واقع در ایالت اوهایو در آمریکا می‌باشد. پردیس اصلی دانشگاه در شهر آکسفورد، در نزدیکی شهرهای سینسیناتی و دیتون، واقع شده و دارای سه پردیس اقماری دیگر به فواصل کمتر از ۴۰ کیلومتر از پردیس اصلی است و یک پردیس دیگر آن در کشور لوکزامبورگ در اروپا می‌باشد. دانشگاه میامی در سال ۱۸۰۹ بنا نهاده شده و جزء ۱۰ قدیمی‌ترین دانشگاه‌های دولتی-ایالتی در ایالات متحده آمریکا است و دومین دانشگاه قدیمی در ایالت اوهایو به حساب می‌آید.\\nدر گزارش US News & World Report مربوط به سال ۲۰۱۵، دانشگاه میامی در زمره ۳۰ دانشگاه برتر دولتی-ایالتی آمریکا، و در بین ۷۵ دانشگاه برتر در مجموع دانشگاه‌های ایالتی و خصوصی قرار گرفت. در رتبه‌بندی آموزش مقاطع کارشناسی، دانشگاه میامی مکان دوم را پس از دانشگاه پرینستون کسب کرد. برای آخرین رتبه‌بندی به این صفحه مراجعه کنید.\\nدانشکده‌ها:\\nکالج هنر و علوم\\nدانشکده بازرگانی\\nکالج هنرهای خلاق\\nکالج مهندسی و کامپیوتر\\nکالج علوم مقدماتی و کاربردی\\nبرخی از فارغ التحصیلان سرشناس:\\nبیست و سومین رئیس‌جمهور آمریکا\\nرئیس سابق مجلس نمایندگان آمریکا\\nنخست‌وزیر سابق کره جنوبی\\nسناتور ایالت واشینگتن\\nفرماندار سابق ایالت اوهایو"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%B3%D0%B0%D1%80%D0%B0%D0%B4%D0%BE%D1%9E_%D0%86%D1%82%D0%B0%D0%BB%D1%96%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Piazza_del_Duomo%2C_Catania%2C_Panorama.jpg","page_title":"Сьпіс гарадоў Італіі","context_page_description":"Сьпіс гарадоў Італіі паводле колькасьці насельніцтва. У сьпіс уключаныя гарады з насельніцтвам ня менш за 200 000 чалавек па стане на 31 траўня 2016 году. Колькасьць насельніцтва прыводзіцца адносна названага гораду без уліку пасяленьняў, якія складаюць яго прыгарады."},{"page_url":"https://hu.wikipedia.org/wiki/Route_66","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Ok66.jpg","page_title":"Route 66","context_page_description":"A 66-os amerikai országút az Egyesült Államok és a világ egyik leghíresebb országútja. Szokták a „The Mother Road”, vagyis „Az országutak anyja”, illetve „Az Egyesült Államok főútja” néven is emlegetni.\\nAz USA-ban szokás, hogy az autóutak egy-egy híres ember nevét viselik. A 66-ost Will Rogers humorista után nevezték el. Az autópálya mind közlekedésileg, mind pedig történelmileg rendkívül fontos volt. Manapság már csak turisták és megszállottak keresik fel a közel 4 000 kilométeres országút egy-egy szakaszát, vagy akár a teljes hosszát."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%B1%DA%A9%D9%86%D8%AF%D9%88%D8%B1%D9%81_(%D9%81%D8%B1%D8%A7%D9%86%DA%A9%D9%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Stadtmauerpartie_in_Merkendorf.JPG","page_title":"مرکندورف (فرانکن)","context_page_description":"مرکندورف (فرانکن) آلمانین بایرن ایالتینده یئر آلان بیر شهردیر و ۴۳۸ متر دنیز سوییه‌سیندن اۇجالیقی وار. بۇ شهرین ۲۶٫۰۸ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://en.wikipedia.org/wiki/Castile_soap","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Bar_of_Castile_soap.jpg","page_title":"Castile soap","context_page_description":"Castile soap is a vegetable oil-based hard soap made in a style similar to that originating in the Castile region of Spain."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A3%D0%BD%D0%B3%D1%83%D1%9F%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Map_of_Zanzibar_Archipelago-mk.svg","page_title":"Унгуџа","context_page_description":"Унгуџа или Занзибар е најголемиот и најзначајниот остров во Занзибар, Танзанија."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BB%D0%BB%D0%B5%D0%BD%D0%B1%D0%B5%D1%80%D0%B3,_%D0%90%D0%BD%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Ann_Hallenberg.jpg","page_title":"Халленберг, Анн","context_page_description":"Анн Халленберг — шведская оперная певица, исполнительница барочной музыки."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%82ge_de_la_pierre","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Biface_de_St_Acheul_MHNT.jpg","page_title":"Âge de la pierre","context_page_description":"L’Âge de la pierre, ou Âge de pierre, est la période de la Préhistoire durant laquelle les humains ont fabriqué et utilisé des outils et des armes en pierre, avant l'usage prépondérant des métaux."},{"page_url":"https://en.wikipedia.org/wiki/Soyuz_TMA-07M","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Soyuz_TMA-07M_crew_during_the_%27fit_check%27.jpg","page_title":"Soyuz TMA-07M","context_page_description":"Soyuz TMA-07M was a spaceflight launched to the International Space Station in 2012 which transported three members of the Expedition 34 crew to the station. The Soyuz remained docked to the space station and served as an emergency escape vehicle for the Expedition 35 increment, before returning its crew to Earth in May 2013."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3,_%D0%A0%D0%BE%D0%B7%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Bundesarchiv_Bild_183-14077-006%2C_Rosa_Luxemburg.jpg","page_title":"Люксембург, Роза","context_page_description":"Ро́за Люксембу́рг — марксизман теоретик, философ, экономист, публицист. Немцойн а, Европин а аьррохьара революцин социал-демократин Ӏаткъаме гӀуллакхойх цхьаъ.\\nЦо дакъа лоцура Польшин революцин социал-демократин хьостехь лаьттина полякийн политикан эмигрантин кружокехь. Розас къийсам бира Полякийн социалистан партин национализман дуьхул. ТӀеман дуьхул агитаци ярна бахьнехь иза деа шарахь чуйоллина Ӏайира. Цо бухбиллира тӀеман дуьхьул йолу Спартак бертан а, Германин Коммунистн партин а. Иза а, цуьна накъост Карл Либкнехт байинера Берлинан белхалой гӀовттар эшича."},{"page_url":"https://no.wikipedia.org/wiki/Pingviner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Waimanu_BW.jpg","page_title":"Pingviner","context_page_description":"Pingvinfugler er en biologisk orden som utelukkende består av arter og slekter i pingvinfamilien, også kalt pingviner. En familie med flygeudyktige, dykkende sjøfugler som har fått vingene omdannet til luffelignende svømmeredskaper. Artene består av mer eller mindre sosiale individer som lever i flokk og er tilpasset et marint og terrestrisk habitat i og ved havet, der fuglene jakter føden under dykking i de kalde og meget næringsrike havstrømmene.\\nPingvinfamilien teller 18 arter fordelt i seks slekter. Alle artene lever på den sørlige halvkule og flere av dem er utrydningstrua, i en eller annen grad.\\nDen største nålevende arten er keiserpingvinen, som normalt blir cirka 112–115 cm høy og typisk veier omkring 19–46 kg. Den minste pingvinarten er dvergpingvinen, som normalt blir cirka 40–45 cm høy og typisk veier omkring 0,5–2.1 kg."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%82_%D1%81_%D0%BE%D1%82%D0%BB%D0%BE%D0%B6%D0%B5%D0%BD%D0%BD%D1%8B%D0%BC_%D0%BF%D1%80%D0%BE%D1%87%D1%82%D0%B5%D0%BD%D0%B8%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D0%A1%D1%85%D0%B5%D0%BC%D0%B0_%D1%8D%D0%BA%D1%81%D0%BF%D0%B5%D1%80%D0%B8%D0%BC%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B9_%D1%83%D1%81%D1%82%D0%B0%D0%BD%D0%BE%D0%B2%D0%BA%D0%B8.jpg","page_title":"Бит с отложенным прочтением","context_page_description":"Бит с отложенным прочтением — криптографический примитив, при помощи которого осуществляется передача секретного бита информации от нескольких агентов Алисы к нескольким агентам Боба, который спустя определённое время, подбираемое Алисой, открывается для прочтения.\\nДанный протокол является безопасным в случае подлога Алисы, если гарантировано, что она не сможет раскрыть передачу, адресованную честному Бобу, не будучи пойманной. Также приведённый примитив безопасен в случае попытки обмана Бобом, если гарантировано, что никакой информации не может быть получено до тех пор, пока Алиса сама не раскроет свою передачу."},{"page_url":"https://fr.wikipedia.org/wiki/Antonin_le_Pieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Sbeitla_04.jpg","page_title":"Antonin le Pieux","context_page_description":"Antonin le Pieux est un empereur romain, qui régna de 138 à 161. Par son père Titus Aurelius Fulvus, consul en 89, et son grand-père Titus Aurelius Fulvus, consul en 85, il est originaire de Nemausus."},{"page_url":"https://en.wikipedia.org/wiki/Country_Music_Association_Award_for_Single_of_the_Year","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Lady_A_-_Charlotte_12-27-12-39.jpg","page_title":"Country Music Association Award for Single of the Year","context_page_description":"The following list shows the recipients for the Country Music Association Award for Single of the Year. It was first handed out at the inaugural 1967 CMA Awards to Jack Greene for his recording of \\"There Goes My Everything\\" by Dallas Frazier. While its sister category, Song of the Year recognises the songwriters, Single of the Year is awarded to the artist. Starting in 1989 and 2016 respectively, the producer and mix engineer of the track also received an award."},{"page_url":"https://en.wikipedia.org/wiki/2006_Austrian_legislative_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/2006_Austrian_legislative_election_-_Results.svg","page_title":"2006 Austrian legislative election","context_page_description":"Legislative elections were held in Austria on 1 October 2006 to elect the 23rd National Council, the lower house of Austria's bicameral parliament.\\nThe governing Austrian People's Party suffered substantial losses and was unexpectedly overtaken by the Social Democratic Party of Austria. The Greens became the third largest party for the first time, while the Freedom Party of Austria fell to fourth for the first time. The Alliance for the Future of Austria, competing in its first national election, narrowly passed the 4% electoral threshold, despite opinion polling which indicated it would fall short.\\nAfter the 2002 election, the ÖVP formed government with the FPÖ; in 2005, the Alliance for the Future of Austria split from the FPÖ. Most of the FPÖ's National Council deputies joined the new party, which replaced the FPÖ as the junior partner in government. As a result of the 2006 election, the ÖVP–BZÖ coalition lost its majority. After three months of negotiations, the SPÖ and ÖVP formed a grand coalition under SPÖ leader Alfred Gusenbauer, which took office on 11 January 2007."},{"page_url":"https://de.wikipedia.org/wiki/Hai-Van-Pass","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Vietnam_relief_location_map.jpg","page_title":"Hai-Van-Pass","context_page_description":"Der Hai-Van- oder Wolken-Pass bildet die natürliche Grenze und Wetterscheide zwischen Nord- und Süd-Vietnam. Er ist ca. 20 km lang, erreicht 496 Meter Höhe und führt über den Ausläufer der Truong-Son-Berge, der bis zum Meer reicht. Vom höchsten Punkt bietet sich ein Panoramablick über den Ozean, nach Đà Nẵng und die Halbinsel Son Tra. Oftmals aber ist der Pass in Wolken gehüllt.\\nÜber den Pass verläuft die Nationalstraße 1. Seit 2005 wird die äußerst wichtige Verkehrsverbindung durch den 6,3 km langen Hai-Van-Tunnel entlastet. Weiter überquert die Bahnstrecke Hanoi–Ho-Chi-Minh-Stadt den Pass."},{"page_url":"https://es.wikipedia.org/wiki/Am%C3%A9lie-les-crayons","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Amelie-les-crayons-woodstower-lyon-2008.jpg","page_title":"Amélie-les-crayons","context_page_description":"Amélie-les-crayons es un grupo musical francés de folk y de chanson, caracterizado por sus elaboradas actuaciones en directo, que son casi un espectáculo de teatro o cabaret. Está formado por la cantante, Amélie, junto a 3 músicos en los distintos instrumentos. Aunque lo lógico sería pensar que el nombre del grupo proviene de Amélie, por la cantante, y Les crayons, por los 3 músicos que la acompañan, la realidad es que no es ese su verdadero origen, que se ha mantenido siempre en un halo de misterio, avivado en parte por el título de su segundo álbum \\"Et porquoi les crayons?\\", o por el hecho de que los músicos del tercer disco no sean los mismos que los anteriores. Se ha sugerido que los lápices hacían referencia a los que Amélie utiliza de vez en cuando para recogerse el pelo.​ Sin embargo, en una entrevista ha admitido que se trataba de un guiño a la canción así titulada de Bourvil.​\\nAmélie concibió el grupo no como un número de canto, pues en su opinión, de esa forma solo se centra la atención en la cantante, sino como un espectáculo de canciones.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Muskogee_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Kendall_Place_Historic_District%2C_1_of_2.JPG","page_title":"Liste der Einträge im National Register of Historic Places im Muskogee County","context_page_description":"Dies ist eine Liste der Einträge in das National Register of Historic Places im Muskogee County, Oklahoma.\\nDie Liste ist eine vollständige Aufstellung der Anwesen und Distrikte, die im Muskogee County in Oklahoma in das National Register of Historic Places eingetragen sind. Derzeit sind in diesem County 47 Einträge vorhanden, davon zwei National Historic Landmarks."},{"page_url":"https://hsb.wikipedia.org/wiki/Frank_Kupfer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Frank_Kupfer_-_WK_36.jpg","page_title":"Frank Kupfer","context_page_description":"Frank Kupfer je něhdyši sakski politikar Křesćansko-demokratiskeje Unije Němskeje, kiž bě wot 1994 do 2019 zapósłanc wólbneho wokrjesa 33 w sakskim krajnym sejmje. Wón bě mjez 2002 a 2008 městopředsyda frakcije CDU a wot 2008 do 2014 jako statny minister za wobswět a ratarstwo čłon sakskeho knježerstwa. Wot septembra 2014 hač do septembra 2018 bě wón z předsydu frakcije CDU w krajnym sejmje.\\nKupfer bu 2009 jako direktny kandidat swojeje strony z 45,8 % hłosow woleny. Při wólbach 2019 ze strowotniskich přičin hižo njenastupi.\\nWón je ewangelski, ženjeny a nan dweju dźěsćow."},{"page_url":"https://sv.wikipedia.org/wiki/Guldmarknaden_i_Jerevan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Gold-crystals.jpg","page_title":"Guldmarknaden i Jerevan","context_page_description":"Guldmarknaden, på armeniska kallad \\"Vosku Shuka\\", i Armeniens huvudstad i Jerevan på gatan Movses Chorenatsu är en av stadens marknadsplatser där det säljs guld och diamanter. Marknaden ägs av företaget Vagharsj & söner. Marknaden har stor betydelse för Armeniens handel med guld och har bland annat besökts av ministrar från Armeniens parlament."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Matki_Zbawiciela_w_Gnie%C5%BAnie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Dalki_-Towarzystwo_Czytelni_Ludowych.jpg","page_title":"Parafia Matki Zbawiciela w Gnieźnie","context_page_description":"Parafia pod wezwaniem Matki Zbawiciela w Gnieźnie\\nKaplica parafialna mieści się na osiedlu Dalki, przy ulicy Antoniego Ludwiczaka w neorenesansowym budynku dawnego Uniwersytetu Ludowego z 1919-1920, w którym uczył się Stanisław Mikołajczyk."},{"page_url":"https://en.wikipedia.org/wiki/Mondariz_%E2%80%93_Balneario","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Palacioagua.jpg","page_title":"Mondariz – Balneario","context_page_description":"Mondariz–Balneario is a spa town and municipality in Galicia, Spain. It has the distinction of being the smallest municipality in Galicia and one of the smallest in Spain with an area of 2.4 km2."},{"page_url":"https://de.wikipedia.org/wiki/Schmalspurbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Rasender_Roland_2012_09_06.jpg","page_title":"Schmalspurbahn","context_page_description":"Als Schmalspurbahn wird eine Bahn bezeichnet, deren Spurweite kleiner als die Normalspur mit 1435 mm ist. Dies gilt auch dann, wenn es sich dabei, wie zum Beispiel in Südafrika, um die vorherrschende Spurweite handelt. Das Gegenstück zur Schmalspurbahn ist die Breitspurbahn, welche eine breitere Spurweite als die Normalspur hat."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D1%82%D0%B5%D0%BD%D1%83%D0%B0_(%D0%99%D0%BE%D0%BD%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Fontenoy.Yonne-au_carrefour-08.JPG","page_title":"Фонтенуа (Йонна)","context_page_description":"Фонтенуа́ — муніципалітет у Франції, у регіоні Бургундія-Франш-Конте, департамент Йонна. Населення — 321 осіб.\\nМуніципалітет розташований на відстані близько 155 км на південний схід від Парижа, 140 км на захід від Діжона, 26 км на південний захід від Осера."},{"page_url":"https://sv.wikipedia.org/wiki/Gerhard_Munthe_(bibliotekarie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Portrett_av_Gerhard_Frantz_Wilhelm_Munthe_%281919-1997%29.jpg","page_title":"Gerhard Munthe (bibliotekarie)","context_page_description":"Gerhard Frantz Wilhelm Munthe, född den 28 april 1919 i Kristiania, död där den 5 oktober 1997, var en norsk bibliotekarie, son till Wilhelm Munthe och bror till Preben Munthe.\\nHan blev universitetsbibliotekarie vid Universitetsbiblioteket i Bergen 1947, chefsbibliotekarie vid Det Kongelige Norske Videnskabers Selskap 1964, och överbibliotekarie vid Universitetsbiblioteket i Oslo 1970, och var riksbibliotekarie mellan 1975 och 1986."},{"page_url":"https://af.wikipedia.org/wiki/Grysneushoringvo%C3%ABl","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Tockus_nasutus00.jpg","page_title":"Grysneushoringvoël","context_page_description":"Die grysneushoringvoël is 'n algemene standvoël in doringboomsavanne en droë breëblaarboomveld. Hulle kom dikwels in swerms voor buite die broeiseisoen. Die voël is 44–50 cm lank en weeg 130–220 g. In Engels staan die voël bekend as die African grey hornbill."},{"page_url":"https://ms.wikipedia.org/wiki/Rosa_Salazar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Rosa_WIKI.jpg","page_title":"Rosa Salazar","context_page_description":"Rosa Bianca Salazar ialah seorang pelakon wanita Amerika Syarikat. Beliau terkenal dengan perannya dalam siri NBC Parenthood dan siri antologi FX American Horror Story: Murder House. Beliau pernah berlakon dalam The Divergent Series: Insurgent, Maze Runner: The Scorch Trials dan Maze Runner: The Death Cure dan juga muncul di film Netflix The Kindergarten Teacher dan Bird Box. Beliau melakonkan watak tajuk dalam filem Alita: Battle Angel."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D9%86_%D8%AA%D8%A7%D9%8A%D9%84%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/John_Tyler.png","page_title":"جون تايلر","context_page_description":"چون تايلر هوا الرئيس العاشر لامريكا, من سنة 1841 بعد موت هاريسون اللى كان هوا النايب بتاعه, لسنة 1845.\\nاتولد جون تيلار 29 مارس 1790 فى فيرجينيا, خد شهادته من ويليام اند مارى كوليدج, وبدا دراسته للقانون.\\nوكان هوا اول نايب لرئيس امريكى يمسك الحكم بعد الرئيس فى تاريخ امريكا.\\nومن سنة 1825 لسنة 1827 كان حاكم لولاية فيرجينيا. ومن سنة 1827 لسنة 1836 كان سيناتور عن ولاية فيرجينيا."},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_in_Moscow","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%D0%A5%D1%80%D0%B0%D0%BC_%D0%92%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D0%B8%D1%8F_%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%BC_%D0%BF%D1%80%D0%B8%D0%B4%D0%B5%D0%BB%D0%BE%D0%BC%2C_%D0%B4%D0%BE%D0%BC%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BA%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%B2%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%B5%D0%BF%D0%B8%D1%81%D0%BA%D0%BE%D0%BF%D0%BE%D0%B2_%D0%A1%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D1%85_%D0%B8_%D0%9F%D0%BE%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D1%85.jpg","page_title":"List of churches in Moscow","context_page_description":"In 2019 there were more than 1200 churches from different Christian denominations in Moscow. In a multi-ethnic city with more than 100 nationalities and scores of different religious denominations, the majority of the population belongs to the Russian Orthodox Church, which consequently has by far the largest number of churches; compared to over 1600 before the 1917 revolution; much smaller numbers belong to various Eastern and Western denominations. Non-orthodox churches include the Seventh-day Adventist church, the Roman Catholic Cathedral of the Immaculate Conception of the Holy Virgin Mary and the Anglican St. Andrew's Church. There have been indications of other Christian denominations in Moscow since the 14th century, when the first non-orthodox parishes were created.\\nUntil 1917, more than 1,600 churches existed in Moscow; however, this changed after the 1917 Revolution in Russia, when the Bolsheviks came to power. One of their ideologies was state atheism, and subsequently many churches were destroyed or reconstructed for other purposes."},{"page_url":"https://en.wikipedia.org/wiki/Gloppen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Vereide.jpg","page_title":"Gloppen","context_page_description":"Gloppen is a municipality in the county of Vestland, Norway. It is located in the traditional district of Nordfjord. Gloppen is generally subdivided into three areas: Hyen in the west, Gloppen in the center, and Breim in the east.\\nEach of the areas have their own main service centres. Sandane, the administrative centre of the municipality, is the largest with about 2,500 inhabitants. Sandane, Vereide, and Sørstranda are centered on the Gloppefjorden in Gloppen in the central part of the municipality. The villages of Byrkjelo, Re, Kandal, and Egge are centered on the lake Breimsvatnet in the Breim area in the east. The villages of Straume, Eimhjellen, and Solheim are located around the Hyefjorden in Hyen in the west. The whole municipality sits on the southern side of the large Nordfjorden.\\nThe European route E39 highway runs through the municipality before crossing the Nordfjorden on a car ferry. The Sandane Airport, Anda is located along the E39 highway, just north of Vereide.\\nThe 1,031-square-kilometre municipality is the 112th largest by area out of the 356 municipalities in Norway. Gloppen is the 162nd most populous municipality in Norway with a population of 5,854."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%BF%D5%A5%D6%83%D5%A1%D5%B6_%D4%BF%D5%B8%D6%82%D6%80%D5%BF%D5%AB%D5%AF%D5%B5%D5%A1%D5%B6_(%D5%AC%D5%A5%D5%A6%D5%BE%D5%A1%D5%A2%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Stepan_Kurtikyan.jpg","page_title":"Ստեփան Կուրտիկյան (լեզվաբան)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Ստեփան Կուրտիկյան\\nՍտեփան Հարությունի Կուրտիկյան, հայ լեզվաբան, թարգմանիչ, մանկավարժ։"},{"page_url":"https://pl.wikipedia.org/wiki/Dom_podcieniowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Dom_podcieniowy_nr_75_w_%C5%BBu%C5%82awkach.jpg","page_title":"Dom podcieniowy","context_page_description":"Dom podcieniowy – najbardziej reprezentacyjny typ budynków wiejskich, występujący przede wszystkim na Żuławach.\\nSą to budynki mieszkalne, w których do szczytu lub ściany bocznej przylega wsparta na słupach zamknięta sporych rozmiarów wystawka. Podcienie przez większość swojej historii pełniły głównie funkcję reprezentacyjną, w praktyce wykorzystywane były jako pokoje letnie, miejsca spotkań modlitewnych lub podręczny magazyn/warsztat. Często też podcień dostawiano wtórnie, aby podkreślić status społeczny właściciela, a jego architektura odznaczała się bogatymi zdobieniami zwłaszcza w konstrukcji słupów, które na przełomie XVIII/XIX w. przybierały kształty typowe dla budynków klasycystycznych. Charakterystyczne są też tzw. fachwerki, czyli efektowne układy konstrukcji ryglowej często zdobiące czoło podcienia. Najlepiej zachowane domy podcieniowe można dziś podziwiać w Trutnowach, Żuławkach, Marynowach, Nowej Kościelnicy i Przemysławiu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%88%D1%82%D0%B0%D0%B1_%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D1%81%D0%B8%D0%BB_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Flag_of_Russia%27s_Chief_of_Staff.svg","page_title":"Генеральный штаб Вооружённых сил Российской Федерации","context_page_description":"Генера́льный штаб Вооружённых сил Росси́йской Федера́ции — центральный орган военного управления Министерства обороны Российской Федерации и основной орган оперативного управления Вооружёнными силами Российской Федерации.\\nВ соответствии с решениями Президента Российской Федерации — Верховного главнокомандующего Вооружёнными силами Российской Федерации и Министра обороны Российской Федерации, Генеральный штаб осуществляет управление Вооружёнными силами, организует планирование обороны Российской Федерации, мобилизационную подготовку и мобилизацию в Российской Федерации в пределах полномочий Минобороны России, а также координирует деятельность других войск, воинских и специальных формирований в области обороны.\\nДень Генерального штаба Вооруженных Сил Российской Федерации отмечается ежегодно 25 января."},{"page_url":"https://es.wikipedia.org/wiki/Lucie_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/LucieGreenAtQEDcon2015-3.jpg","page_title":"Lucie Green","context_page_description":"Lucinda \\"Lucie\\" May Green es una comunicadora de ciencias e investigadora solar británica.​ Desde 2005, Green ha sido una Becaria de Investigación de la Sociedad Real Universitaria en el Laboratorio de Ciencia Espacial Mullard de la University College de Londres.​​ Green dirige el programa de participación pública de MSSL y forma parte del Consejo de la División de Física Solar Europea de la Sociedad Europea de Física y el consejo asesor del Museo de Ciencias de Londres.​\\nEn 2013, Green se convirtió en la primera mujer presentadora de The Sky at Night después de la muerte de Patrick Moore.​\\nLa investigación de Green se centra principalmente en las actividades atmosférica del Sol, particularmente en las eyecciones de masa coronal y los cambios en el campo magnético del Sol que los activa.​​"},{"page_url":"https://nl.wikipedia.org/wiki/Ivoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Romance_of_the_Western_Chamber_fan_Asian_Art_Museum_SF_1992.93.1.JPG","page_title":"Ivoor","context_page_description":"Ivoor is het harde, witgekleurde materiaal afkomstig van de slagtanden van landdieren zoals olifanten, nijlpaarden of mammoeten, of zeedieren zoals de walrus of narwal. Deze tanden kunnen tot drie meter lang worden en wel 100 kilogram wegen. Ook zou de mythologische eenhoorn een ivoren hoorn dragen. Het meeste ivoor is afkomstig uit de binnenlanden van Afrika.\\nAl in de oudste beschavingen werd ivoor gebruikt voor de vervaardiging van beeldjes of om erop te tekenen; de bloeitijd van de beeldhouwkunst in ivoor lag in de 14e eeuw. In de 20e eeuw werd ivoor vooral gebruikt in de kunstnijverheid, in de biljartballenindustrie en bij het bouwen van piano's.\\nIn de pianobouw werd ivoor gebruikt om toetsen mee te beleggen. Het ivoor had als voordeel dat het materiaal hard, duurzaam en een beetje stroef was, en dat het prettig aanvoelde onder de vingers, en zweet goed absorbeerde. Ivoren toetsen zitten nog wel op oude piano's maar het restaureren van antieke instrumenten wordt steeds lastiger, omdat 'gerecycled' ivoor steeds moeilijker te krijgen is. Tegenwoordig past men op alle nieuwe instrumenten kunststof toe als toetsbeleg."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%DB%8C%DA%A9%D9%84_%D8%A7%D8%B3%D9%86%D9%88_(%D9%87%D9%86%D8%B1%D9%85%D9%86%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Michael_Snow.jpg","page_title":"مایکل اسنو (هنرمند)","context_page_description":"مایکل اِسنو یک هنرمند کانادایی است که در گسترهٔ وسیعی از هنرهما همچون نقاشی، عکاسی، مجسمه‌سازی، موسیقی، فیلم‌سازی و هولوگرافی فعالیت می‌کند.\\nاو از اعضای جنبش فیلم‌سازی ساختاری/ماتریالیستی در دههٔ ۶۰ میلادی است.\\nاز فیلم‌ها یا مجموعه‌های تلویزیونی که وی در آن‌ها نقش داشته است می‌توان به طول موج اشاره نمود.\\nوی در طول حیات حرفه‌ای خود، برنده جوایزی همچون «نشان لیاقت کانادا»، «نشان شوالیه هنر و ادبیات فرانسه»، «جایزه فرماندار کل کانادا» و کمک‌هزینه گوگنهایم شده است و از دانشگاه‌های «پانتئون سوربن» و «دانشگاه کبک در شیکوتیمی» دکترای افتخاری دریافت نموده است."},{"page_url":"https://hu.wikipedia.org/wiki/G%C3%A1bor_Andor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/G%C3%A1bor_Andor_sz%C3%BCl%C5%91h%C3%A1za_%283%29.jpg","page_title":"Gábor Andor","context_page_description":"Gábor Andor, születési nevén Greiner Andor Kossuth-díjas magyar regényíró, költő, humorista, publicista, dalszövegíró.\\n„Gábor Andor a pesti kabaré minden hangon verselni képes napszámosa volt.”\\n– Molnár Gál Péter"},{"page_url":"https://nl.wikipedia.org/wiki/Tang_Xianzong","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Tang_Xianzong.jpg","page_title":"Tang Xianzong","context_page_description":"Tang Xianzong was keizer van de Chinese Tang-dynastie. Hij regeerde van 805 tot 820.\\nHet keizerlijk gezag in het China van de late Tang-dynastie was sterk verzwakt door de grootschalige An Lushan-opstand. Militaire gouverneurs in de provincies waren sindsdien vrijwel onafhankelijk en trokken zich weinig aan van het hof. Xianzong slaagde erin om het keizerlijk gezag weer te herstellen. In 806 stierf de gouverneur van Sichuan en Xianzong slaagde erin om de opvolger te benoemen, iets wat zijn grootvader Dezong vergeefs had geprobeerd in vergelijkbare gevallen. Gedurende de rest van zijn regeerperiode wist Xianzong de macht van de gouverneurs te beteugelen, al was daar wel voortdurende strijd voor nodig. Tussen 814 en 819 bedwong Xianzong in een serie campagnes de rebelse gouverneurs, waarna het gehele rijk weer onder het directe gezag van de keizer stond. Deze strijd putte de schatkist echter wel uit.\\nXianzong ondermijnde de macht van de gouverneurs van de provincies verder door de prefecturen hun belastingen direct aan het hof te laten afdragen, in plaats van aan de provincies. Op militair gebied paste hij een vergelijkbare strategie toe."},{"page_url":"https://en.wikipedia.org/wiki/Indonesian_National_Police","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/PDL_IPDA_KOM.png","page_title":"Indonesian National Police","context_page_description":"The Indonesian National Police is the national police force of Indonesia. Founded on 1 July 1946, it was formerly a part of the country's military since 1962. The police were formally separated from the military on 1 April 1999 in a process which was formally completed on 1 July 2000.\\nThe organisation is now independent and is under the direct auspices of the President of Indonesia, while the Armed Forces is under the Ministry of Defense. The Indonesian National Police is responsible for law enforcement and policing duties all over Indonesia. The organisation is widely known for its corruption, violence and incompetence.\\nThe Indonesian National Police also takes part in international United Nations missions, and after special training, provided security for the UNAMID mission to protect internally-displaced people in Darfur.\\nThe strength of the Indonesian National Police stood at approximately 387,470 in 2011 and the number is increasing every year. It also includes up-to 12,000 water police personnel and an estimated 40,000 People's Security trainees who serve as a police auxiliary and report for three weeks of basic training each year."},{"page_url":"https://en.wikipedia.org/wiki/Distinctive_unit_insignia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/63_RSC_DUI.jpg","page_title":"Distinctive unit insignia","context_page_description":"A distinctive unit insignia is a metallic heraldic badge or device worn by soldiers in the United States Army. The DUI design is derived from the coat of arms authorized for a unit. DUIs may also be called \\"distinctive insignia\\" or, imprecisely, a \\"crest\\" or a \\"unit crest\\" by soldiers or collectors. The U.S. Army Institute of Heraldry is responsible for the design, development and authorization of all DUIs."},{"page_url":"https://en.wikipedia.org/wiki/Gud_(music_producer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Yung_Gud_2014.png","page_title":"Gud (music producer)","context_page_description":"Carl-Mikael Göran \\"Micke\\" Berlander, known professionally as Gud, is a Swedish DJ and producer best known as a member of rapper Yung Lean's Stockholm-based group Sad Boys. He began producing at the age of twelve, making psychedelic trance music, which heavily influenced his sonic palette. His production as a part of Sad Boys has been well received.\\nOutside of his role in Sad Boys, he has released an extended play Beautiful, Wonderful, and has acted as a producer for several acts including Halsey and Deniro Farrar. He has also remixed several songs for other artists such as Jacques Greene, Kacy Hill, and Tinashe. These remixes have also garnered a positive critical response from publications including Pigeons & Planes and The Fader."},{"page_url":"https://fr.wikipedia.org/wiki/Zarautz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Blason_en_pierre.jpg","page_title":"Zarautz","context_page_description":"Zarautz est une commune du Guipuscoa dans la communauté autonome du Pays basque en Espagne.\\nC'est une ville touristique située au centre de la côte de la province. En 2006, il y avait 22 323 habitants, mais durant l'époque estivale le chiffre de 60 000 est atteint fréquemment.\\nLa commune fait partie de l'Eurocité basque Bayonne - San Sebastian."},{"page_url":"https://en.wikipedia.org/wiki/March_1939","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/HMS_Ramillies_Memorial.jpg","page_title":"March 1939","context_page_description":"The following events occurred in March 1939:"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%8B%E9%87%8C%E6%96%AF%E8%92%82%E5%AE%89%C2%B7%E8%90%8A%E5%BE%B7%E6%96%AF%E9%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ledesma_Lazio_Fiorentina.JPG","page_title":"克里斯蒂安·萊德斯馬","context_page_description":"克里斯蒂安·丹尼爾·萊德斯馬，是一名出生於阿根廷的足球運動員，同時擁有義大利國籍；司職中場，目前效力瑞士球隊盧加諾。\\n2010年世界盃後，他入圍了由切薩雷·普蘭德利執教的義大利國家隊，正式選擇了代表義大利國家隊出賽。"},{"page_url":"https://en.wikipedia.org/wiki/Kasbeer,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/20120128_42_Grain_Elevator%2C_Kasbeer%2C_Illinois.jpg","page_title":"Kasbeer, Illinois","context_page_description":"Kasbeer is an unincorporated community in Bureau County, Illinois, United States. Kasbeer is located along Illinois Route 26, north of Princeton and south of Ohio. The town of Kasbeer was originally begun 1/2-mile to the south of its current location, but formed when the railroad routed its tracks to the north. This small rural cornbelt town was named after Asa Kasbeer, a very successful farmer on that land, and his family. Currently, the town has only a Church and Post Office, other than its 30 houses and Grain Elevator; however, in an earlier time also had a two-building Grade School, General Store and gas station, barber shop, auto mechanic's garage, lumber yard, small cement block plant, television sales and service store, tavern, and for a short while a bank. Kasbeer is one of many small towns which is within the Princeton School District."},{"page_url":"https://en.wikipedia.org/wiki/Narrow-gauge_railways_in_Bosnia_and_Herzegovina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Lokomotive_kk_Bosnabahn_7_IDA_%28Krauss_%26_Cie_no._404-1874%29.jpg","page_title":"Narrow-gauge railways in Bosnia and Herzegovina","context_page_description":"Most Bosnian-gauge railway lines were built during the Austro-Hungarian Empire. Several 760 mm gauge railways were planned in order to link the extensive narrow-gauge railways in the Austro-Hungarian Empire with those in Bosnia and Herzegovina. Until the outbreak of the Balkan Wars in 1912 several were constructed.\\nBetween World War I and World War II the network was extended significantly, at the end connecting the Adriatic Coast with Belgrade, with the network growing to around 1500 km in length.\\nConstruction of a new standard-gauge line from Sarajevo to Ploče on the Adriatic in 1966 replaced the 760 mm Narentabahn from Sarajevo to the coast and had the effect of isolating the south-western narrow-gauge system from the 760 mm railways starting at Sarajevo. With the demise of a connecting network all the other remaining narrow-gauge lines were then at risk and restricted to local traffic.\\nThe system based on the Adriatic closed in 1975. By 1979 the rest of the Bosnian lines had closed. In Serbia the last 760 mm line closed in 1983. The most modern diesel railcars were sold to the Portuguese Railways, becoming Portuguese train type 9700."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%83%D8%A7%D8%B2%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Mkazi_Shadjuu_2.jpg","page_title":"مكازي","context_page_description":"مكازي هي مدينة في اتحاد جزر القمر تقع على جزيرة القمر الكبرى. في 2012, يقدر عدد سكانها إلى 8 438 نسمة."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%AC%E3%83%B3%E3%82%B8%E9%83%A1_(%E3%83%8E%E3%83%BC%E3%82%B9%E3%82%AB%E3%83%AD%E3%83%A9%E3%82%A4%E3%83%8A%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Map_of_Orange_County_North_Carolina_With_Municipal_and_Township_Labels.PNG","page_title":"オレンジ郡 (ノースカロライナ州)","context_page_description":"オレンジ郡は、アメリカ合衆国ノースカロライナ州の中央部に位置する郡である。2010年国勢調査での人口は133,801人であり、2000年の118,227人から13.2%増加した。郡庁所在地はヒルズボロ町であり、同郡で人口最大の町はチャペルヒル町である。チャペルヒルには、国内最古の州立大学であり、ノースカロライナ大学システムに属するノースカロライナ大学チャペルヒル校がある。\\nアメリカ合衆国行政管理予算局はチャタム郡をローリー・ダーラム・チャペルヒル広域都市圏に含めており、その都市圏人口は2012年推計で1,998,808人である。2003年6月6日に行政管理予算局が統計上都市圏を再定義し、それまで長くローリー・ダーラム・チャペルヒル大都市圏に入っていた区域を2つの大都市圏に分割した。ただし、2つに分かれても1つの大都市圏として機能し続けている。"},{"page_url":"https://pl.wikipedia.org/wiki/Gernot_Langes_Stadion","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Gernot_Langes_Stadion_Wattens.jpg","page_title":"Gernot Langes Stadion","context_page_description":"Gernot Langes Stadion – stadion piłkarski w Wattens, w Austrii. Został otwarty 16 czerwca 1959 roku. Może pomieścić 5023 widzów. Swoje spotkania rozgrywają na nim piłkarze klubu WSG Wattens. Do 2013 roku obiekt nosił nazwę Alpenstadion, w 70. urodziny długoletniego prezydenta klubu, Gernota Langes-Swarovskiego został nazwany jego imieniem. 25 maja 2010 roku na stadionie odbył się towarzyski mecz reprezentacji piłkarskich Nigerii i Arabii Saudyjskiej, a 29 maja 2018 roku na obiekcie, również towarzysko zmierzyły się kadry narodowe Armenii i Malty."},{"page_url":"https://de.wikipedia.org/wiki/Marktsteft","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/KeerlhausMst.JPG","page_title":"Marktsteft","context_page_description":"Marktsteft ist eine Stadt im unterfränkischen Landkreis Kitzingen und Mitglied der Verwaltungsgemeinschaft Marktbreit."},{"page_url":"https://en.wikipedia.org/wiki/List_of_St._Louis_Cardinals_first-round_draft_picks","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/DSC03897_Brett_Wallace_%28AFL%29.jpg","page_title":"List of St. Louis Cardinals first-round draft picks","context_page_description":"The St. Louis Cardinals are a Major League Baseball franchise based in St. Louis, Missouri. They play in the National League Central division. Since the institution of MLB's Rule 4 Draft, the Cardinals have selected 77 players in the first round. Officially known as the \\"First-Year Player Draft\\", the Rule 4 Draft is MLB's primary mechanism for assigning amateur baseball players from high schools, colleges, and other amateur baseball clubs to its teams. The draft order is determined based on the previous season's standings, with the team possessing the worst record receiving the first pick. In addition, teams which lost free agents in the previous off-season may be awarded compensatory or supplementary picks.\\nOf the 77 players picked in the first round by St. Louis, 39 have been pitchers, the most of any position; 30 of them were right-handed, while nine were left-handed. Eight outfielders, ten third basemen, six shortstops, six first basemen, five catchers, and two second basemen were taken as well."},{"page_url":"https://ms.wikipedia.org/wiki/Shruti_Haasan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Shruti_Haasan_graces_red_carpet_of_Femina_Stylista_West_%2804%29_%28cropped%29.jpg","page_title":"Shruti Haasan","context_page_description":"Shruti Haasan ialah seorang pelakon dan penyanyi filem India yang bekerja dengan majoritinya dalam filem Tamil, Telugu, dan Hindu. Dilahirkan dalam keluarga Haasan, beliau ialah anak perempuan pelakon Kamal Haasan dan Sarika Thakur. Beliau ialah penerima beberapa anugerah, termasuk tiga Anugerah Filmfare Selatan, dan telah menubuhkan dirinya sebagai salah seorang pelakon utama di panggung wayang India Selatan."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%85%D8%B9%D8%A9_%D8%A7%D9%84%D8%B3%D9%88%D8%B1%D8%A8%D9%88%D9%86_%D8%A7%D9%84%D8%AC%D8%A7%D9%85%D8%B9%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Universite_Paris_IV.jpg","page_title":"جامعة السوربون الجامعة","context_page_description":"جامعة السوربون بالفرنسية هي كيان جديد لتجمع جامعات تاريخية في باريس وهي: جامعة باريس السوربون أو باريس الرابعة مع جامعة بيير وماري كوري، والمتحف الوطني للتاريخ الطبيعي في باريس. هذا التحالف هو أصل جامعة السوربون الذي ولد في 1 شباط/ يناير 2018."},{"page_url":"https://sh.wikipedia.org/wiki/Sch%C3%B6nbach_(Eifel)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Sch%C3%B6nbach_in_DAU.svg","page_title":"Schönbach (Eifel)","context_page_description":"Šenbah je opština u njemačkoj saveznoj državi Rajna-Palatinat. Jedno je od 109 opštinskih središta okruga Vulkanajfel. Prema procjeni iz 2010. u opštini je živjelo 269 stanovnika. Posjeduje regionalnu šifru 7233064."},{"page_url":"https://en.wikipedia.org/wiki/Allan_Ramsay_(artist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Sir_William_Douglas%2C_4th_Baronet.jpg","page_title":"Allan Ramsay (artist)","context_page_description":"Allan Ramsay was a prominent Scottish portrait-painter."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%94%BC%EB%B8%8C%EB%A6%AC%EB%85%B8%EA%B2%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Fibrinandligand.png","page_title":"피브리노겐","context_page_description":"피브리노겐은 혈액응고에 관계하는 혈장 단백질이다. 간에서 합성되고 섬유소원이라고 불리기도 한다. 사람과 같은 척추동물의 혈장 속에 녹아 있으며, 사람에게는 1L 속에 대략 2-3g 정도가 함유되어 있다. 양쪽 끝과 중앙부에 마디가 있는 막대 모양이다. 우리 피부에 상처가 났을때 피부리겐의 영향으로 딱지가 형성된다. 구체적으로는, 혈관벽에 상처가 났을때 혈소판에서 트롬보키나아제라는 효소가 유리되어 혈장에 녹아있는 프로트롬빈을 트롬빈으로 활성화시킨다. 이 트롬빈 효소는 피브리노겐을 가수분해하여 피브린으로 만들어준다. 이때 이 피브린의 분자는 서로 물리적으로 결합하여 젤라틴과 같은 겔로 변화한다."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AD%D9%83%D9%88%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D8%A4%D9%82%D8%AA%D8%A9_%D9%84%D9%84%D8%AC%D9%85%D9%87%D9%88%D8%B1%D9%8A%D8%A9_%D8%A7%D9%84%D8%A5%D8%B3%D8%A8%D8%A7%D9%86%D9%8A%D8%A9_%D8%A7%D9%84%D8%AB%D8%A7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Cardenal_Segura.JPG","page_title":"الحكومة المؤقتة للجمهورية الإسبانية الثانية","context_page_description":"الحكومة المؤقتة للجمهورية الإسبانية الثانية هي الحكومة التي تولت السلطة السياسية في إسبانيا بعد سقوط الملك ألفونسو الثالث عشر وإعلان الجمهورية في 14 أبريل 1931 حتى الموافقة على دستور 1931 في 9 ديسمبر 1931. وتشكيل أول حكومة عادية في 15 ديسمبر، واستمرت حتى 15 أكتوبر 1931، حيث ترأسها نيسيتو ألكالا زامورا، وبعد استقالته بسبب الصياغة التي أعطيت للمادة 26 من الدستور التي تناولت المسألة الدينية، خلفه مانويل أثانيا لاستلام زمام الحكومة."},{"page_url":"https://sl.wikipedia.org/wiki/Anastazija_Romanova","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Grand_Duchess_Anastasia_Nikolaevna.jpg","page_title":"Anastazija Romanova","context_page_description":"Velika vojvodinja Anastazija Ruska, ruska plemkinja in svetnica, * 5. junij 1901, † 17. julij 1918."},{"page_url":"https://de.wikipedia.org/wiki/Kaiser-Wilhelm-Denkmal_an_der_Porta_Westfalica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Denkmal-Wilhelm-I_Schmitz.jpg","page_title":"Kaiser-Wilhelm-Denkmal an der Porta Westfalica","context_page_description":"Das Kaiser-Wilhelm-Denkmal an der Porta Westfalica ist ein Kaiser-Wilhelm-Denkmal, das oberhalb des Weserdurchbruchs Porta Westfalica, des „Tors nach Westfalen“, auf dem Gebiet der Stadt Porta Westfalica im nordrhein-westfälischen Kreis Minden-Lübbecke steht. Es wurde durch die preußische Provinz Westfalen von 1892 bis 1896 errichtet und entstand vor dem Hintergrund der nationalen Ideen im Deutschen Kaiserreich. Das insgesamt rund 88 m hohe Denkmal reiht sich ein in die Reihe der deutschen Nationaldenkmale.\\nArchitekt des landschaftsprägenden Denkmals war Bruno Schmitz, das Kaiserstandbild entwarf der Bildhauer Caspar von Zumbusch. Seit 2008 gehört das Denkmal zu der Straße der Monumente. Durch seine herausragende geographische Lage ist es das wichtigste Wahrzeichen der Stadt Porta Westfalica und des nördlichen Ostwestfalens.\\nVon 2013 bis 2018 wurde das Denkmal restauriert und gemäß einem neuen Besucherkonzept durch den Architekten Peter Bastian aus Münster umgebaut. Dabei entstanden in der Ringterrasse des Denkmals ein Restaurant und ein Ausstellungsraum. Nach dem Umbau wurde das Denkmal am 8. Juli 2018 feierlich neu eröffnet."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%94%84%EB%9E%80%EC%B2%B4%EC%8A%A4%EC%BD%94_%EB%8D%B0_%EB%AC%B4%EB%9D%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Francesco_de_Mura_-_Self-Portrait_-_62.48_-_Minneapolis_Institute_of_Arts.jpg","page_title":"프란체스코 데 무라","context_page_description":"프란체스코 데 무라는 이탈리아 나폴리 출신의 후기 바로크 시대 화가이다. 나폴리와 토리노에서 활동하였다. 그의 후기 작품들은 신고전주의를 반영하고 있다.\\n프란체스코 솔리메나 밑에서 배웠고, 도메니코 비올라, 마티아 프레티와 동시대의 화가이다."},{"page_url":"https://pt.wikipedia.org/wiki/Metr%C3%B4_de_S%C3%A3o_Paulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Esta%C3%A7%C3%A3o_Brooklin_-_Obras.jpg","page_title":"Metrô de São Paulo","context_page_description":"Metrô de São Paulo ou Metropolitano de São Paulo, conhecido popularmente como Metrô, é um sistema de transporte metroviário que serve a cidade de São Paulo, no Brasil. O Metrô de São Paulo é operado pela Companhia do Metropolitano de São Paulo, sociedade de economia mista do estado de São Paulo. Fundada em 24 de abril de 1968, a empresa é responsável pelo planejamento, projeto, construção e operação do sistema de transporte metroviário na Região Metropolitana de São Paulo. Tendo a maior parte de seu controle acionário associada ao governo do estado, é subordinada à Secretaria dos Transportes Metropolitanos do Estado de São Paulo. Integra também a Rede Metropolitana de Transporte de São Paulo. O Grupo CCR opera, respectivamente, as linhas 4–Amarela e 5–Lilás do sistema.\\nO metrô paulista está em operação desde 14 de setembro de 1974. É o maior e mais movimentado sistema de transporte metroviário do Brasil, com uma extensão de 101,1 quilômetros de linhas ferroviárias distribuídas em seis linhas, que possuem um total de 89 estações. Compõem o sistema as linhas 1–Azul, 2–Verde, 3–Vermelha, 4–Amarela, 5–Lilás e 15–Prata."},{"page_url":"https://hu.wikipedia.org/wiki/Mende_Val%C3%A9r","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Mende_Val%C3%A9r_Gy%C3%B6ngy%C3%B6s.jpg","page_title":"Mende Valér","context_page_description":"Felsőgallói Mende Valér Károly Mária magyar építész, grafikus. A magyar népi építészet volt legnagyobb hatással építészi munkásságára, de a kortárs angol és finn építészek is nagy hatással voltak rá."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Gers","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Eglise_de_Mirande.jpg","page_title":"Liste des monuments historiques du Gers","context_page_description":"Cet article recense les monuments historiques du Gers, en France.\\nPour les monuments historiques de la commune d'Auch, voir la liste des monuments historiques d'Auch"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%B9%D1%81%D0%BC%D0%BE%D0%BD%D0%B4,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%88%D0%B5%D0%BA_%D0%A2%D0%B5%D0%BE%D0%B4%D0%BE%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Franciszek_Ejsmond_-_Ciche_szcz%C4%99%C5%9Bcie.jpg","page_title":"Эйсмонд, Францишек Теодор","context_page_description":"Францишек Теодор Эйсмонд — польский живописец."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Leipziger_Vorstadt_(A%E2%80%93H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Leipziger_Stra%C3%9Fe_Dresden_Eisenbahnbr%C3%BCcke_und_Bahndammbefestigung.JPG","page_title":"Liste der Kulturdenkmale in der Leipziger Vorstadt (A–H)","context_page_description":"Die Liste der Kulturdenkmale in der Leipziger Vorstadt enthält die Kulturdenkmale des Stadtteils Leipziger Vorstadt in der Dresdner Gemarkung Neustadt. Diese Gemarkung gliedert sich in die Stadtteile Innere Neustadt, Äußere Neustadt, Leipziger Vorstadt, Radeberger Vorstadt und Albertstadt. Zur Leipziger Vorstadt gehört auch die vorstädtische Siedlung Neudorf und das Quartier Scheunenhofviertel. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Dresden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen.\\nAufgrund der hohen Anzahl der Kulturdenkmale wurde die alphabetisch nach Adressen geordnete Liste in folgende zwei Teillisten untergliedert:\\nListe der Kulturdenkmale in der Leipziger Vorstadt (A–H)\\nListe der Kulturdenkmale in der Leipziger Vorstadt\\nDiese Teilliste enthält alle Kulturdenkmale von A–H."},{"page_url":"https://de.wikipedia.org/wiki/Schleu%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Schleu%C3%9F_Dorfkirche.JPG","page_title":"Schleuß","context_page_description":"Schleuß gehört zur Ortschaft Windberge und ist ein Ortsteil der Stadt Tangerhütte im Landkreis Stendal in Sachsen-Anhalt."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_Belgische_gemeenten_naar_bestuurlijke_indeling","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Arrondissement_Tournai-Mouscron_Belgium_Map.png","page_title":"Lijst van Belgische gemeenten naar bestuurlijke indeling","context_page_description":"Deze lijst geeft aan bij welke bestuurlijke entiteiten een Belgische gemeente ingedeeld is."},{"page_url":"https://es.wikipedia.org/wiki/%C3%91andut%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Nanduti_lace.jpg","page_title":"Ñandutí","context_page_description":"El ñandutí es un encaje de agujas que se teje sobre bastidores en círculos radiales, bordando motivos geométricos o zoomorfos, en hilo blanco o en vivos colores.\\nPreferentemente se realizan detalles para vestimentas, ornamentos religiosos, sombreros, abanicos, todo tipo de artículos ornamentales. Es el símbolo de la ciudad de Itauguá, y es considerada como la reina de toda la artesanía de la República del Paraguay."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%BE%D1%81%D0%BE%D1%84%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Huike_thinking.jpg","page_title":"Философия","context_page_description":"Филосо́фия — особая форма познания мира, вырабатывающая систему знаний о наиболее общих характеристиках, предельно-обобщающих понятиях и фундаментальных принципах реальности и познания, бытия человека, об отношении человека и мира. К задачам философии на протяжении её истории относились как изучение всеобщих законов развития мира и общества, так и изучение самого процесса познания и мышления, а также изучение нравственных категорий и ценностей. К числу предельных философских вопросов относятся, например, вопросы «Познаваем ли мир?», «Существует ли Бог?», «Что такое истина?», «Что такое хорошо?», «Что есть Человек?», «Что первично — материя или сознание?» и другие.\\nХотя иногда философию определяют более узко, в качестве науки с определённым предметом изучения, такой подход встречает возражения современных философов, настаивающих на том, что философия представляет собой скорее мировоззрение, общий критический подход к познанию всего сущего, который применим к любому объекту или концепции. В этом смысле каждый человек хотя бы изредка занимается философией, то есть размышляет."},{"page_url":"https://es.wikipedia.org/wiki/Alexandre_Quintanilha","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Alexandre_Quintanilha%2C_2015.png","page_title":"Alexandre Quintanilha","context_page_description":"Alexandre Tiedtke Quintanilha GOSE, es un físico portugués, exdirector del Instituto de Biología Molecular y Celular de la Universidad de Oporto y profesor del Instituto de Ciencias Biomédicas Abel Salazar."},{"page_url":"https://es.wikipedia.org/wiki/Movistar_(Espa%C3%B1a)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Mobile_World_Centre_-_2013_-_Barcelona_03.JPG","page_title":"Movistar (España)","context_page_description":"Movistar es un operador de la compañía multinacional española de telecomunicaciones Telefónica, que presta los servicios de telefonía, internet y televisión en España.​\\nFue lanzada como marca comercial el 25 de julio de 1995, adquiriendo su condición de operador multimodal el 1 de mayo de 2010, tras la unificación bajo el nombre de la marca, de todos los servicios de telefonía, internet y televisión, en los que se sitúa como el primer operador del país.​​"},{"page_url":"https://br.wikipedia.org/wiki/Triagad","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Menhir_of_L%C3%A9han.jpg","page_title":"Triagad","context_page_description":"Triagad a zo ur gumun eus ar Vro Vigoudenn e kanton Pont-'n-Abad, e departamant Penn-ar-Bed, e mervent Breizh. E Lechiagad emañ ar porzh ha lodenn arvor ar gumun."},{"page_url":"https://pl.wikipedia.org/wiki/Leon_Furmanowicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Leon_Furmanowicz.jpg","page_title":"Leon Furmanowicz","context_page_description":"Leon Furmanowicz – uczestnik powstania wielkopolskiego, podporucznik w 15 Wielkopolskim pułku artylerii lekkiej, w stopniu majora dowódca 8 dywizjonu artylerii przeciwlotniczej w Toruniu."},{"page_url":"https://vi.wikipedia.org/wiki/Kepa_Arrizabalaga","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Chelsea_3_Arsenal_2_%2830294529588%29_%28cropped%29.jpg","page_title":"Kepa Arrizabalaga","context_page_description":"Kepa Arrizabalaga Revuelta là thủ môn người Tây Ban Nha thi đấu cho câu lạc bộ Chelsea và Đội tuyển bóng đá quốc gia Tây Ban Nha. Anh đang nắm giữ kỷ lục là thủ môn có giá chuyển nhượng cao nhất thế giới.\\nKepa trưởng thành từ học viện đào tạo của Athletic Bilbao và từng được cho mượn tại Ponferradina và Real Valladolid trước khi trở thành thủ môn chính thức của Bilbao từ mùa giải 2016-17.\\nKepa cùng đội tuyển U-19 Tây Ban Nha vô địch Giải vô địch bóng đá U-19 châu Âu 2012 và có trận đấu đầu tiên cho Đội tuyển bóng đá quốc gia Tây Ban Nha vào tháng 11 năm 2017 trước khi được triệu tập tham dự World Cup 2018 vào tháng 5 năm 2018."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BB%D1%83%D1%82%D0%B8%D0%BD_%D0%94%D0%BE%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/MD4.jpg","page_title":"Милутин Достанић","context_page_description":"Милутин Р. Достанић био је српски математичар. Своју научничку пажњу усмерио је на Функционалну анализу и Теорију оператора."},{"page_url":"https://pl.wikipedia.org/wiki/Big_Ten_Conference","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/TheBigHouse.jpg","page_title":"Big Ten Conference","context_page_description":"Big Ten Conference - jedna z konferencji systemu amerykańskich międzyuczelnianych rozgrywek sportowych NCAA, należąca do najwyższej klasy rozgrywkowej, NCAA Division I. Choć formalnie ma charakter wyłącznie sportowy, często jej nazwy używa się także w innych kontekstach, mając na myśli po prostu grupę złożoną z należących do Big Ten uczelni. Podobnie zresztą dzieje się z niektórymi innymi konferencjami NCAA, z których najsłynniejszą jest Ivy League.\\nKonferencja powstała w 1896, zaś pod obecną nazwą znana jest od 1917 roku. W latach 1946-49 liczyła dziewięć uczelni, a od 1990 do dziś ma jedenastu członków. Zmiany te nie wpłynęły jednak na jej nazwę, choć obecnie liczba 12 znajduje się w logo konferencji. Uczelnie Big Ten są rozsiane w ośmiu stanach w północno-wschodniej części USA. Po dwie uczelnie znajdują się w stanach Indiana i Michigan. Po jednym przedstawicielu mają w konferencji Minnesota, Wisconsin, Illinois, Ohio, Pensylwania, Iowa i Nebraska. Jedenaście uczelni to uniwersytety publiczne, zaś jeden ma status świeckiego uniwersytetu prywatnego. Biura konferencji zlokalizowane są w Park Ridge w stanie Illinois, na przedmieściach Chicago."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%82%AA%E3%83%90%E3%83%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Adansonia_digitata_2004-09-23.JPG","page_title":"バオバブ","context_page_description":"バオバブは樹木の属の一つ。アオイ目アオイ科バオバブ属の総称。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A9%B9%E8%BF%AA%C2%B7%E8%8E%AB%E6%8B%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Jordi_Moll%C3%A0_%28cropped%29.jpg","page_title":"詹迪·莫拉","context_page_description":"詹迪·莫拉是西班牙的一位演員、導演、製作人、作家、藝術家。莫拉雖然是一位西班牙人演員，但也出演大量的英國電影和好萊塢電影。它還導演過三部電影，並且出版過兩本著作。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Zundert","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Breedschotsestraat_4.jpg","page_title":"Lijst van gemeentelijke monumenten in Zundert","context_page_description":"De gemeente Zundert heeft 91 gemeentelijke monumenten, hieronder een overzicht. Zie ook de rijksmonumenten in Zundert."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_V%C3%B6cklabruck","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/V%C3%B6cklabruck_Heimathaus.jpg","page_title":"Liste der denkmalgeschützten Objekte in Vöcklabruck","context_page_description":"Die Liste der denkmalgeschützten Objekte in Vöcklabruck enthält die 88 denkmalgeschützten, unbeweglichen Objekte der oberösterreichischen Bezirkshauptstadt Vöcklabruck."},{"page_url":"https://en.wikipedia.org/wiki/Wall_of_the_Ferme_g%C3%A9n%C3%A9rale","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Barri%C3%A8re_d%27Enfer%2C_place_Denfert-Rochereau%2C_Paris_03.jpg","page_title":"Wall of the Ferme générale","context_page_description":"The Wall of the Ferme générale was commissioned by Antoine Lavoisier and built between 1784 and 1791 by the Ferme générale, the corporation of tax farmers. It was one of the several city walls of Paris built between the early Middle Ages and the mid 19th century. It was 24 kilometers long and roughly followed the route now occupied by line 2 and line 6 of the Métro. It crossed the districts of the Place de l'Étoile, Batignolles, Pigalle, Belleville, Nation, the Place d'Italie, Denfert-Rochereau, Montparnasse and the Trocadéro."},{"page_url":"https://en.wikipedia.org/wiki/National_Botanic_Garden_of_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Wallace_Garden_and_Principality_House_-_geograph.org.uk_-_1234460.jpg","page_title":"National Botanic Garden of Wales","context_page_description":"The National Botanic Garden of Wales is a Botanical Garden located in Llanarthney in the River Tywi valley, Carmarthenshire, Wales. The garden is both a visitor attraction and a centre for botanical research and conservation, and features the world's largest single-span glasshouse measuring 110 m long by 60 m wide.\\nThe National Botanic Garden of Wales seeks \\"to develop a viable world-class national botanic garden dedicated to the research and conservation of biodiversity, lifelong learning and the enjoyment of the visitor.\\" The Garden is a registered charity reliant upon funding from visitors, friends, grants and gifts. Significant start-up costs were shared with the UK Millennium Fund."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%91%A1%E8%90%84%E7%89%99%E7%8E%8B%E5%9C%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Portugallia_et_Algarbia.jpg","page_title":"葡萄牙王國","context_page_description":"葡萄牙王國為存在於1139年—1910年、地處歐洲伊比利亞半島西部的君主國。葡萄牙王國總共經歷了四個王朝，按先後順序依次是勃艮第王朝、阿維斯王朝、哈布斯堡王朝、布拉干薩王朝。15世紀—20世紀葡萄牙擁有自己的殖民帝國—葡萄牙帝國。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%B0%EC%95%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Santagadea.jpg","page_title":"연안","context_page_description":"연안 또는 해안은 일반적으로 바다와 육지가 맞닿아 서로 밀접한 영향을 미치는 지역 및 해역을 총칭한다. 연안은 해변, 갯벌, 만, 삼각주 등 다양한 모습을 보이고 있고, 해양 생물 및 철새 등에는 산란장과 서식지이자, 사람들에게는 항만, 임해공단, 어항 및 어촌, 관광지 등이 되고 있다.\\n최근 연안을 이용하는 행위가 서로 상충되고, 연안 자원의 무분별한 이용으로 연안환경이 훼손되는 사례가 많다. 이런 대표적인 경우가 갯벌이나 바다를 매립하여 육지로 만드는 경우와, 육지에서 발생한 환경 오염원을 그대로 바다에 버리는 경우다. 대한민국같은 경우, 2000년 이후로 신규 매립은 억제하고 있으나 시화호 방조제같은 경우 심각한 사회적 갈등을 빚고 있기도 하다.\\n이런 문제로 세계 각국은 연안통합관리라는 개념으로 중앙정부 차원에서 연안 지역에 대한 계획적인 관리를 추진하고 있으며, 연안을 가진 151개국 중 71개국에서 시행 중이다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%83%D0%BF%D0%BB%D0%B5%D1%82_(%D0%B1%D0%BE%D0%B5%D0%B2%D0%BE%D0%B9_%D0%BC%D0%BE%D0%B4%D1%83%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%22Duplet%22_fighting_module_06.jpg","page_title":"Дуплет (боевой модуль)","context_page_description":"«Дуплет» — башенный боевой модуль украинского производства, разработанный Житомирским бронетанковым заводом."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tourist_attractions_in_Baku","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Baku_20170506_141213.jpg","page_title":"List of tourist attractions in Baku","context_page_description":"Baku, the capital of Azerbaijan, receives 2.5 million tourists a year. According to Ilya Umansky, vice president of the Association of Tour Operators of Russia, Baku has become a more popular tourist destination in recent years."},{"page_url":"https://en.wikipedia.org/wiki/List_of_active_Indonesian_Navy_ships","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/KRI_Tarakan_%28905%29.jpg","page_title":"List of active Indonesian Navy ships","context_page_description":"All the Indonesian Navy vessels are named with the prefix KRI or Naval Vessel of the Republic of Indonesia. Smaller sized boats with light armaments usually have the prefix KAL, stands for Kapal Angkatan Laut. The classes are often named after lead ships or the first ship commissioned.\\nThe Navy consists of Frigates, Corvettes, Submarines, Fast Attack Craft, Minesweepers, Landing Transport Ships, Support Vessels and Training Ships."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0%D1%85_%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Clean_up_new_georgia.jpg","page_title":"Кампания на островах Нью-Джорджия","context_page_description":"Кампания на островах Нью-Джорджия — была серией наземных и морских сражений Тихоокеанской кампании Второй мировой войны между союзными войсками и Японской Империей. Кампания была частью операции «Cartwheel», стратегии союзников в южной части Тихого океана. Кампания проходила на островах Нью-Джорджии, в центральных Соломоновых Островах, с 30 июня по 7 октября 1943 года."},{"page_url":"https://en.wikipedia.org/wiki/Micropterix_mansuetella","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Micropterix_mansuetella-Bayern%2C_Oberbayern%2C_Wolfratshausen%2C_K%C3%B6nigsdorfer_Moor-bE-HdN-960a.jpg","page_title":"Micropterix mansuetella","context_page_description":"Micropterix mansuetella is a species of moth belonging to the family Micropterigidae. It is found primarily in freshwater wetlands and is distributed throughout northern, eastern, central and western Europe. The most southern occurrence is eastern Tyrol in Austria.\\nThis is a small moth with a forewing length of 3.4–3.9 millimetres for males and 3.8–4.2 millimetres for females. It is largely bronzy-gold in colour with some reddish and purple markings. The forewings have a costal spot near the wingbase, a fascia before middle not reaching the dorsum, and the posterior half of wing is deeper golden, often more or less purple-tinged. The hindwings are rather dark bronzy-grey, posteriorly purplish-tinged.Its most distinctive feature is the dark coloured tuft of hair on its head: in most other Micropterix species of the region this tuft is much paler. Like other members of the family, this species has functional jaws and it feeds as an adult on pollen grains, mainly from the flowers of Carex species. The larva and pupa are unknown."},{"page_url":"https://en.wikipedia.org/wiki/Lower_Moselle","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/StolzenbergIMG_5530.JPG","page_title":"Lower Moselle","context_page_description":"The Lower Moselle is the name given to the lower reaches of the Moselle river - just under 100 kilometres long - in Germany between Pünderich and the Moselle's confluence with the Rhine at Koblenz. The Lower Moselle landscape differs from that of the Middle and Upper Moselle, much of it forming a narrower valley with high and steep sides in places. On the cut banks of the river that are oriented towards the south and west, vineyards are managed, often on the tiniest, terraced strips of land on steep hillslopes.\\nThe upgrading of the Moselle into a waterway for big ships in the 1960s has permanently changed the appearance of the river and its banks. Five changes of level between Koblenz and Zell in order to build locks for large ships have changed a riverbed that was narrow in places and wide in others with gently sloping banks into a canal-like waterway that is contained by artificial walls and rock embankments in the areas of the locks."},{"page_url":"https://en.wikipedia.org/wiki/Ice_age","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Iceage_south-intergl_glac_hg.png","page_title":"Ice age","context_page_description":"An ice age is a long period of reduction in the temperature of the Earth's surface and atmosphere, resulting in the presence or expansion of continental and polar ice sheets and alpine glaciers. Earth's climate alternates between ice ages and greenhouse periods, during which there are no glaciers on the planet. Earth is currently in the Quaternary glaciation, known in popular terminology as the Ice Age. Individual pulses of cold climate within an ice age are termed \\"glacial periods\\", and intermittent warm periods within an ice age are called \\"interglacials\\" or \\"interstadials\\", with both climatic pulses part of the Quaternary or other periods in Earth's history.\\nIn the terminology of glaciology, ice age implies the presence of extensive ice sheets in both northern and southern hemispheres. By this definition, we are in an interglacial period—the Holocene. The amount of heat-trapping gases emitted into Earth's oceans and atmosphere is predicted to prevent the next glacial period, which otherwise would begin in around 50,000 years, and likely more glacial cycles."},{"page_url":"https://en.wikipedia.org/wiki/Pashto_media","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Maidan_radio_host_in_2009.jpg","page_title":"Pashto media","context_page_description":"Pashto media includes Pashto literature, Pashto-language newspapers, magazines, television and radio stations, as well as Pashto films and Pashto internet. Pashto media involves the Pashtuns of Pakistan, Afghanistan and the Pashtun diaspora around the world."},{"page_url":"https://fr.wikipedia.org/wiki/Maputaland-Pondoland-Albany","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/MPA_Nature_panorama.jpg","page_title":"Maputaland-Pondoland-Albany","context_page_description":"L'ensemble Maputaland-Pondoland-Albany est une écorégion d'Afrique australe considérée comme un épicentre de biodiversité par Conservation International."},{"page_url":"https://da.wikipedia.org/wiki/Fyrkarakter","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/LuzFaroGruposDestellos09.PNG","page_title":"Fyrkarakter","context_page_description":"Fyrkarakter kaldes den måde hvorpå et fyr, et fyrskib eller et sømærke lyser og er mørkt på så de kan identificeres.\\nFyrkaraktererne for fyr angives i søkort med særskilte betegnelser som fastsættes af International Association of Lighthouse Authorities. Fyrkarakteren Gp Oc 10s 15m 10M angiver eksempelvis at lyset er tændt længere tid end det er slukket i grupper af tre med en periode på ti sekunder. Fyret formørkes med andre ord tre gange i hurtig rækkefølge hvert tiende sekund. Endvidere fremgår det at fyrets lys er femten meter over havniveau og fyret kan ses på ti sømils afstand. Fyret kan altså ses på cirka 19 kilometers afstand forudsat god sigt og at observatøren er på mindst 5 meters højde.\\nI fyrkarakteren angives lysets farve med bogstaverne W for hvid, R for rød og G for grøn. Sekundangivelserne angiver fyrkarakterens periode, den tid det tager for fyrkarakteren at færdiggøre sin cyklus og starte forfra. Et vinkelfyr benytter ofte alle tre farver for at markere hvornår man ligger korrekt i en sejlrende."},{"page_url":"https://hu.wikipedia.org/wiki/Belgium_t%C3%B6rt%C3%A9nelme","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Princess_Astrid_engaged_in_1926.jpg","page_title":"Belgium történelme","context_page_description":"Belgium történelme az őskortól egészen napjainkig szorosan összekapcsolódik a németalföldi régió, illetve szomszédai, Hollandia és Luxemburg történelmével. Egészen a 19. századig Belgium területén kisebb-nagyobb grófságok-hercegségek léteztek, amelyek a szomszédos nagyhatalmak, Franciaország és a Német-római Birodalom befolyási övezetébe tartoztak. A francia forradalmi hadsereg csapatai 1794-ben elfoglalták ezen államokat és teljesen beolvasztották Franciaországba. Napóleon császár vereségét követően a mai Belgium az Egyesült Holland Királyság része lett, és csak 1830-ban, a belga szabadságharc győzelmét követően önállósodott az ország.\\nAz első világháború alatt részben, a második világháború alatt teljesen megszállták az országot a németek, a felszabadulás után Belgium egyik alapító tagja volt a NATO-nak, majd az európai közösségeknek, és Brüsszelben található mindkét nemzetközi szervezet központja is. Belgium területén keresztül húzódik a germán és az újlatin nyelveket beszélő népcsoportokat elválasztó képzeletbeli határvonal. Az országban ennek megfelelően két nagy nyelvi-kulturális közösség, a francia és a flamand él, illetve az ország keleti részén található német kisebbség."},{"page_url":"https://en.wikipedia.org/wiki/Roman_architectural_revolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Mausoleo_di_Augusto_-_panoramio_%283%29.jpg","page_title":"Roman architectural revolution","context_page_description":"The Roman architectural revolution, also known as the concrete revolution, was the widespread use in Roman architecture of the previously little-used architectural forms of the arch, vault, and dome. For the first time in history, their potential was fully exploited in the construction of a wide range of civil engineering structures, public buildings, and military facilities. These included amphitheatres, aqueducts, baths, bridges, circuses, dams, roads, and temples.\\nA crucial factor in this development that saw a trend to monumental architecture was the invention of Roman concrete, which led to the liberation of the shape from the dictate of the traditional materials of stone and brick.\\nFor the first time in recorded history we find evidence of an interest in the shapes of the space contained strong enough to outweigh the functional logic of the masonry masses that contained it. There was nothing new in the employment of curvilinear or polygonal forms, as such...But in so far as such buildings incorporated curvilinear or polygonal rooms and corridors, the shapes of these were determined by the form of the building as a whole, not by any aesthetic principle."},{"page_url":"https://tr.wikipedia.org/wiki/Vasili_(Kostroma_Knezi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Vasily_Yaroslavich_Grand_Dukes_of_Vladimir.jpg","page_title":"Vasili (Kostroma Knezi)","context_page_description":"Vasily Yaroslavich Vladimir Büyük dükü. Vasili, II. Yaroslav'ın en küçük oğludur. III. Vsevolod'un hayatta kalan en büyük torunu olarak, 1272'de Vladimir'in ve ertesi yıl 1273'de Novgorod'un büyük dükü oldu. Vladimir'in dükü olduktan sonra oraya yerleşmekle uğraşmayan ilk prenslerden biriydi. Vasili'nin soyundan gelenler Ocak 1276'da ölümünden sonra yarım yüzyıl boyunca Kostroma'yı yönetmeye devam ettiler."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%9E%D0%9C%D0%9E%D0%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/USSR_OMON_patch.png","page_title":"Рижский ОМОН","context_page_description":"Рижский ОМОН — отряд милиции особого назначения города Рига Латвийской ССР. В 1991 году выведен в город Тюмень, против ряда сотрудников в Латвии были возбуждены уголовные дела."},{"page_url":"https://nl.m.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1882","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Vaino_Hakkila.jpg","page_title":"Lijst van personen geboren in 1882","context_page_description":"Dit is een lijst van personen die geboren zijn in 1882.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9F%A9%E5%9B%BD%E6%94%BF%E6%B2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Kim_Dae-jung_%28Cropped%29.png","page_title":"韩国政治","context_page_description":"韩国政治根据《韩国宪法》的规定实行立法、行政、司法三权分立的政治体制，立法权属于一院制的国会，以总统为中心的政府掌握国家的行政权，司法权属于由法官构成的法院。韩国的行政部门实行总统制，是韩国三权分立制度的核心体制。韩国总统由国民直接选举产生，任期为5年。为避免任何个人长期掌握国家权力，《韩国宪法》规定总统不能连任。韩国总统通过由15-30人组成的国务会议行使行政权。韩国国会是韩国一院制立法机关，按法律规定应由至少200个议席组成，每届任期四年，其中80%以上的席位由国民投票选举产生，其余的5%以上的席位通过比例代表制产生。韩国司法机构独立于韩国行政和立法机构。韩国法院实行三审终审制。大法院是韩国最高司法机构，也是管理韩国司法系统的行政权力机构。\\n建国后的大韩民国在美国的帮助下制定了民主宪法，并设立了较为现代的政治制度框架。不过在美国扶植下产生的韩国首位总统李承晚却推行个人独裁。1961年5月16日，朴正熙发动五一六军事政变上台，开始了韩国长达26年的军政威权统治。经过民主阵营近30年的斗争，韩国在1987年举行了第一次公平开放的大选。目前，韩国已成功发展自由民主制，《政体资料集》和美国中央情报局出版的《世界概况》将韩国列为民主国家。"},{"page_url":"https://de.wikipedia.org/wiki/J%C3%B6rn_Pfab","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Flor_Urbana_J%C3%B6rn_Pfab_Fleetinsel_HH.jpg","page_title":"Jörn Pfab","context_page_description":"Jörn Pfab war ein norddeutscher Bildhauer, der für seine Arbeiten Bronze, Stein, nichtrostenden Stahl und Kunststoff verwendete."},{"page_url":"https://es.wikipedia.org/wiki/Talinaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Talinum_tenuissimum_01.jpg","page_title":"Talinaceae","context_page_description":"Talinaceae es una pequeña familia de plantas dicotiledóneas dentro del orden de las cariofilales. Comprende dos géneros, Talinella y Talinum, y unas 27 especies que se distribuyen en América y África, incluyendo a Madagascar.​\\nEsta familia ha sido reconocida por sistemas modernos de clasificación, como el sistema APG III de 2009.​ Anteriormente, los géneros que constituyen esta familia habían sido dispuestos en Portulacaceae, pero los análisis filogenéticos sobre datos moleculares indican que los dos géneros que la constituyen comprenden un clado monofilético que debe considerarse como una familia separada.​​"},{"page_url":"https://en.wikipedia.org/wiki/Heavy_metal_music","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Tuska_20130630_-_Nightwish_-_48.jpg","page_title":"Heavy metal music","context_page_description":"Heavy metal is a genre of rock music that developed in the late 1960s and early 1970s, largely in the United Kingdom and the United States. With roots in blues rock, psychedelic rock, and acid rock, heavy metal bands developed a thick, massive sound, characterized by distortion, extended guitar solos, emphatic beats, and loudness. The lyrics and performances are sometimes associated with aggression and machismo.\\nIn 1968, three of the genre's most famous pioneers, Led Zeppelin, Black Sabbath and Deep Purple were founded. Though they came to attract wide audiences, they were often derided by critics. Following the blueprint laid down by Led Zeppelin and Black Sabbath, several American bands modified heavy metal into more accessible forms during the 1970s: the raw, sleazy sound and shock rock of Alice Cooper and Kiss; the blues-rooted rock of Aerosmith; and the flashy guitar leads and wild party rock of Van Halen. During the mid-1970s, Judas Priest helped spur the genre's evolution by discarding much of its blues influence; Motörhead introduced a punk rock sensibility and an increasing emphasis on speed."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A1%9E%E7%89%B9%E5%88%A9%E5%85%8B%E6%B8%85%E7%9C%9F%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%C5%9Eehitlik_mosque_Berlin_by_ZUFAr.jpg","page_title":"塞特利克清真寺","context_page_description":"塞特利克清真寺是德國首都柏林新克爾恩的一家清真寺，始建於1999年，由墨哈萊姆‧希爾米‧塞納爾普設計，2005年完工。\\n清真寺可容納1,500人聚禮，是柏林最大、德國第二大的清真寺。"},{"page_url":"https://fr.wikipedia.org/wiki/Tortue_peinte","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Western_painted_turtle.jpg","page_title":"Tortue peinte","context_page_description":"La Tortue peinte est l'une des espèces de tortues les plus répandues d'Amérique du Nord. Elle vit dans les points d'eau stagnante, du sud du Canada à la Louisiane et le Nord du Mexique, et de l'Atlantique au Pacifique. C'est la principale tortue présente sur cette aire de répartition. C'est l'unique représentante du genre Chrysemys, appartenant à la famille des Emydidae. Des fossiles prouvent son existence depuis au moins 15 millions d'années. Elle comporte quatre sous-espèces — C. p. picta, C. p. dorsalis, C. p. marginata et C. p. belli — qui ont divergé au cours de la dernière glaciation.\\nLa femelle Tortue peinte adulte mesure entre 10 et 25 cm de long, le mâle est un peu plus petit. La carapace de cette tortue est lisse et ovale sans arête à son sommet. Sa peau est vert olive à noir avec des rayures rouges, orange ou jaunes aux extrémités. Les sous-espèces se différencient à leurs carapaces : celle de C. p. picta a des segments alignés à son sommet, C. p. marginata a une grande marque grise sur le plastron, C. p. dorsalis a une ligne rouge sur la carapace et C. p. belli a un motif rouge sur le plastron."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BC%D0%BE%D1%80%D1%8F%D0%BD%D0%B8_(%D0%BF%D0%BB%D0%B5%D0%BC%27%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/West_slavs_9th-10th_c..png","page_title":"Поморяни (плем'я)","context_page_description":"Поморя́ни, померани — західнослов'янські племена, що жили до XVI–XVII ст. в низов'ях Одри на узбережжі Балтійського моря. В 900 межа поморянського ареалу проходила по Одрі на заході, Віслі на сході та Нотечу на півдні. Дали назву історичній місцевості Померанія.\\nУ X столітті польський князь Мешко I включив землі поморян до складу польської держави. В XI поморяни підняли повстання і знов отримали незалежність від Польщі. Першим відомим князем був Земомисл. В цей період їхня територія поширилася на захід від Одри в землі лютичів. За ініціативою князя Вартислава I поморяни прийняли християнство.\\nЗ 1180-х років почав зростати німецький вплив і на землі поморян почали прибувати немецькі поселенці. Через руйнівні війни з данцями поморські феодали схвалювали заселення спустошених земель німцями. Згодом почався процес германізації та полонизації поморянського населення. Уникнувшими асиміляції серед німців та поляків, залишками поморян нині є кашуби, що налічують 300 тисяч чоловік."},{"page_url":"https://ca.wikipedia.org/wiki/Varicorhinus_alticorpus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Specimen_of_Onychostoma_alticorpus.JPG","page_title":"Varicorhinus alticorpus","context_page_description":"Varicorhinus alticorpus és una espècie de peix de la família dels ciprínids i de l'ordre dels cipriniformes."},{"page_url":"https://it.wikipedia.org/wiki/Pedaliante","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Vittorio_Bonomi.png","page_title":"Pedaliante","context_page_description":"Il pedaliante, nome completo Bossi-Bonomi Pedaliante o anche cicloaliante Bossi-Bonomi, è stata una macchina volante, costruita nel 1936 accreditata come il primo veicolo al mondo che ha reso possibile il volo a propulsione umana, record conseguito il 18 marzo 1937 presso l'aeroporto di Cinisello Balsamo.\\nFu progettato da Enea Bossi e costruito da Vittorio Bonomi, mentre pilota fu Emilio Casco, un maggiore dell'esercito italiano, nonché ciclista dall'eccezionale resistenza fisica. Si è stabilito che nessuna persona comune avrebbe potuto ripetere l'esperienza di volo con il pedaliante.\\nPer supportare il decollo venne anche utilizzata una catapulta di lancio, che permise al veicolo di volare per 1 km nell'ambito di una competizione italiana. Ha effettuato 80 voli in totale, di cui 43 senza l'uso della catapulta. Insieme al Mufli tedesco è stato l'aereo meno veloce mai costruito."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Perus_presidenter","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/HerenciaZevallos.jpg","page_title":"Liste over Perus presidenter","context_page_description":"Republikken Perus president er slik det er nedfelt i Perus konstitusjon fra 1993, statsleder og representerer republikken i alle offisielle internasjonale saker. Presidenten velges hvert femte år, og den sittende president kan ikke gjenvelges. Etter et fem åres opphold, kan derimot en tidligere president sitte på nytt. Det finnes ingen grense på hvor mange ganger en kan sitte som presidentkandidat. Den nåværende presidenten er Pedro Pablo Kuczynski, valgt inn i 2016.\\nInnsettelsen av regjeringen skjer 28. juli, som er uavhengighetsdagen fra Spania og nasjonal fridag."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A7%E0%B8%B4%E0%B8%81%E0%B8%B4%E0%B8%9E%E0%B8%B5%E0%B9%80%E0%B8%94%E0%B8%B5%E0%B8%A2%E0%B8%A0%E0%B8%B2%E0%B8%A9%E0%B8%B2%E0%B8%95%E0%B8%AD%E0%B8%87%E0%B8%87%E0%B8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Wikipedia-logo-to.png","page_title":"วิกิพีเดียภาษาตองงา","context_page_description":"วิกิพีเดียภาษาตองกา เป็นสารานุกรมวิกิพีเดียที่จัดทำขึ้นในภาษาตองงา เริ่มสร้างเมื่อเดือนมกราคม พ.ศ. 2547 ปัจจุบันวิกิพีเดียภาษาตองกามีบทความมากกว่า 1,400 บทความ"},{"page_url":"https://de.wikipedia.org/wiki/Ra%C4%8Dice-P%C3%ADstovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Racice_Pistovice_map.png","page_title":"Račice-Pístovice","context_page_description":"Račice-Pístovice ist eine Gemeinde in Tschechien. Sie liegt neun Kilometer westlich von Vyškov und gehört zum Okres Vyškov. Die Gemeinde ist Teil der Mikroregion Drahanská vrchovina."},{"page_url":"https://fr.wikipedia.org/wiki/Iris_orientalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Iris_orientalis_2007-05-13_355.jpg","page_title":"Iris orientalis","context_page_description":"L'Iris turc ou Iris des steppes est une plante herbacée vivace de la famille des Iridacées originaire de Turquie et de Grèce."},{"page_url":"https://bar.wikipedia.org/wiki/Santa_Rosa_Island,_Kalifornien","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Californian_Channel_Islands_map_de.png","page_title":"Santa Rosa Island, Kalifornien","context_page_description":"Santa Rosa Island is mid 215,27 km² Fläch de zwoatgressde Insl vo de kalifornischn Kanoiinsln im Pazifik. De Insl is uma 26 km long, bis za 17 km broad und eareichd im Vail Peak a Häh vo 484 Meta iwa'm Meea. Santa Rosa liegd 42 Kilometa sidli vo da kalifornischn Gstod zwischn San Miguel und Santa Cruz, da gressdn Insl van Archipel, in da Noadgruppe vo de Channel Islands. Santa Rosa Island ghead administrativ zan Santa Barbara County und is Bstondtei vanChannel-Islands-Nationalpark. Die Insl hod laut Census 2000 zwoa registriade Eihwohna.\\n2007 is do a neie endemische Flechtnoat entdeckd worn, de 2009 z Eahrn van US-President Barack Obama an Nam Caloplaca obamae eahoidn.\\nDe af da Insl entdeckdn Knochn van Arlington Springs Man san mid iwa 13.000 Joar de vamuadli ejdasdn bishea efundne Menschnknochn af'm amerikanischn Kontinent."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%80%D0%B8%D1%81%D1%83%D0%BD%D0%BA%D0%BE%D0%B2_%D0%B8_%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD_%D0%A2%D0%B0%D1%80%D0%B0%D1%81%D0%B0_%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Taras_Shevchenko_painting_0113.jpg","page_title":"Список рисунков и картин Тараса Шевченко","context_page_description":"Сохранилось 835 рисунков и картин Тараса Григорьевича Шевченко, дошедших до нашего времени в оригиналах и частично в гравюрах на металле и дереве, выполненных российскими и зарубежными гравёрами, а также в копиях, которые были изготовлены художниками ещё при жизни Шевченко. Кроме того, существуют сведения о 278 утерянных и до сих пор не найденных работах Шевченко.\\nЖивописные и графические работы по времени написания датируются 1830—1861 годами и территориально связаны с Россией, Украиной и Казахстаном. По жанрам — это портреты, композиции на мифологические, исторические и бытовые темы, архитектурные и ландшафтные пейзажи. Они выполнены маслом на холсте, а также акварелью, сепией, тушью, свинцовым карандашом и в технике офорта на отдельных листах белой, цветной и тонированной бумаги различных размеров, а также в пяти альбомах.\\nВ список включены завершённые работы Шевченко, составляющие значительную часть его художественного наследия, а также его многочисленные эскизы, этюды, наброски и учебные студии, которые представляют ценность для раскрытия творческого пути и творческого метода художника. Небольшое количество работ имеют авторские подписи и надписи, ещё меньше — авторские даты."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%97%E0%A6%AE%E0%A7%8D%E0%A6%AC%E0%A7%81%E0%A6%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Cupula_Bellas_Artes.jpg","page_title":"গম্বুজ","context_page_description":"গম্বুজ স্থাপত্যের একটি বৈশিষ্ট্য যে একটি ভবনের ওপর একটি গোলকের উচ্চতর অর্ধেকের মত সাধারণত দেখে। এটি একটি বৈশিষ্ট্য যা অনেক ধর্মীয় এবং সরকার ভবনকে বৈশিষ্ট্যপূর্ণ করে তোলে। এছাড়া যদি কোনও একজন একটি গম্বুজের নিচে অথবার ভেতরে কথা বললে, তার কন্ঠস্বর আরো জোরে শব্দ করে। উদাহরণস্বরূপ একটি গম্বুজ একটি মসজিদ, মন্দির, অথবা একটি প্রাসাদ বা একটি গুরুত্বপূর্ণ ভবন, সনাক্ত করা এইটি সহজতর করে।"},{"page_url":"https://it.wikipedia.org/wiki/Sevierville","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Sevier-county-tn-courthouse.jpg","page_title":"Sevierville","context_page_description":"Sevierville è una città degli Stati Uniti d'America, situata nello Stato del Tennessee, nella contea di Sevier, della quale è il capoluogo."},{"page_url":"https://en.wikipedia.org/wiki/Karstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Karstadt_Kiel_Glasfassade.jpg","page_title":"Karstadt","context_page_description":"Karstadt Warenhaus GmbH is a German department store chain whose headquarters are in Essen.\\nUntil 30 September 2010 the company was a subsidiary of Arcandor AG and was responsible within the group for the business segment of over-the-counter retail.\\nOn 9 June 2009 Essen District Court ordered provisional asset administration and protective measures in response to an application for the opening of insolvency proceedings. It also appointed a provisional insolvency administrator. The insolvency proceedings were opened on 1 September 2009. On 7 June 2010 the board of creditors resolved to sell Karstadt Warenhaus GmbH to the investor Nicolas Berggruen. Berggruen had taken over all Karstadt stores by 1 October 2010. This had been determined by Essen District Court on 3 September 2010. On 14 August 2014 it was announced that Karstadt had been completely taken over by Signa Holding of the Austrian investor René Benko, which already owned the majority of the sports shops and premium stores.\\nKarstadt Warenhaus GmbH comprises 83 department stores, 4 bargain centres, 2 branches of K Town and the online shop karstadt.de. The 28 sports shops belong to Karstadt Sports GmbH."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A1%D6%80%D5%B8%D5%B6_%D4%B3%D5%B8%D6%80%D5%A4%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/20130403_Aaron_Gordon_MCDAAG_MVP_%283%29_cropped.jpg","page_title":"Աարոն Գորդոն","context_page_description":"Աարոն Գորդոն, ամերիկացի պրոֆեսիոնալ բասկետբոլիստ, հարձակվող։ Ներկա պահին հանդես է գալիս Բասկետբոլի ազգային ասոցիացիայի «Օռլանդո Մեջիք» ակումբում։\\nՄեկ ուսումնական տարի հանդես է եկել Արիզոնայի համալսարանի «Ուայլդքեթս» ակումբում։\\nԾնվել է Սան Խոսե բնակավայրում ։ Հանդես է եկել Սան Խոսեի «Արչբիշոպ Միտի» կոչվող ավագ դպրոցի բասկետբոլային թիմում, որի կազմում երկու անգամ հաղթել է Կալիֆորնիայի առաջնությունը, ինչպես նաև երկու անգամ արժանացել «Կալիֆորնիայի Միստր Բասկետբոլ» տիտղոսին։ Համալսարանում անցկացրած ժամանակահատվածում ընդգրկվել է «All-Pac-12 առաջին թիմ» խորհրդանշական հավաքականում։\\nԸնտրվել է NBA-ի 2014 թվականի դրաֆթի առաջին ռաունդի 4-րդ ընտրությամբ՝ «Օռլանդո Մեջիքի» կողմից։\\nՄասնակցել է նաև ՖԻԲԱ-ի մինչև 19 տարեկանների աշխարհի առաջնությանը՝ ներկայացնելով Միացյալ Նահանգների երիտասարդական հավաքականը և նվաճելով ոսկե մեդալ։ Հավաքականի կազմում եղել է առաջատար միավորների և անդրադարձների կատեգորիայում։"},{"page_url":"https://fi.wikipedia.org/wiki/Konstantin_T%C5%A1ernenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Konstantin_Chernenko_%28retouched%29.jpg","page_title":"Konstantin Tšernenko","context_page_description":"Konstantin Ustinovitš Tšernenko oli neuvostoliittolainen poliitikko ja NKP:n pääsihteeri 13. helmikuuta 1984 lähtien kuolemaansa asti.\\nTšernenkosta tuli keskuskomitean ehdokasjäsen vuonna 1966 ja täysjäsen 1971. Hän liittyi politbyroohon lokakuussa 1977 ja tuli täysjäseneksi marraskuussa 1978. Leonid Brežnevin kuoleman jälkeen 1982 hän hävisi valtataistelun Juri Andropoville, joka nousi valtaan, mutta kuoli vain 15 kuukautta myöhemmin helmikuussa 1984."},{"page_url":"https://de.wikipedia.org/wiki/Hemmi_Takashi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Hemmi_2_sw.jpg","page_title":"Hemmi Takashi","context_page_description":"Hemmi Takashi war in der Taishō- und Shōwa-Zeit ein japanischer Holzschnitt-Künstler der Yōga-Richtung und Dichter."},{"page_url":"https://en.wikipedia.org/wiki/The_Northern_Celestial_Masters","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/LaoGod.jpg","page_title":"The Northern Celestial Masters","context_page_description":"The Northern Celestial Masters type of the Way of the Celestial Master Daoist movement existed in the north of China during the Southern and Northern Dynasties. The Northern Celestial Masters were a continuation of the Way of the Celestial Masters as it had been practiced in Sichuan province by Zhang Lu and his followers. After the community was forced to relocate in 215 CE, a group of Celestial Masters established themselves in Northern China. Kou Qianzhi, from a family who followed the Celestial Master, brought a new version of Celestial Master Daoism to the Northern Wei. The Northern Wei government embraced his form of Daoism and established it as the state religion, thereby creating a new Daoist theocracy that lasted until 450 CE. The arrival of Buddhism had great influence on the Northern Celestial Masters, bringing monasticism and influencing the diet of practitioners. Art produced in areas dominated by the Northern Celestial Masters also began to show Buddhist influence. When the theocracy collapsed, many Daoists fled to Louguan, which quickly became an important religious center."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%82%D0%B1%D0%B5%D0%BA,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/6/68/%D0%9F%D0%BE%D1%81%D0%BB%D1%83%D0%B6%D0%BD%D0%BE%D0%B9_%D1%81%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%9D%D0%BE%D1%82%D0%B1%D0%B5%D0%BA%D0%B0-1875.jpg","page_title":"Нотбек, Владимир Васильевич","context_page_description":"Владимир Васильевич фон Нотбек — выдающийся теоретик и практик стрелкового и оружейного дела, а также крупнейший организатор оружейного производства в Российской Империи XIX века, начальник Императорского Тульского оружейного завода, инспектор стрелковой части в войсках и инспектор оружейных и патронного завода, генерал от инфантерии."},{"page_url":"https://fr.wikipedia.org/wiki/Stufetta_du_cardinal_Bibbiena","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Stufetta_del_cardinal_bibbiena%2C_putto_trainato_da_chiocciole.jpg","page_title":"Stufetta du cardinal Bibbiena","context_page_description":"La Stufetta du cardinal Bibbiena est une petite pièce au troisième étage du Palais apostolique, au Vatican, en bordure de la Loggetta du cardinal Bibbiena. Elle est célèbre pour un cycle de fresques de l'école de Raphaël reproduisant des décorations de style antique."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D8%A7%D8%B1%D8%B3%D8%A8%D9%88%D8%B1%D8%BA_(%D9%85%D8%A7%D8%B3%D8%A7%D8%AA%D8%B4%D9%88%D8%B3%D8%AA%D8%B3)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Clarksburg_Town_Hall.jpg","page_title":"كلارسبورغ (ماساتشوستس)","context_page_description":"كلارسبورغ ‏ هي بلدة أمريكية تقع في الولايات المتحدة في مقاطعة بيركشاير (ماساتشوستس). يقدر عدد سكانها بـ 1,702 نسمة ومساحتها 33.3 كم² وترتفع عن سطح البحر 347 متر."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%B7%D0%B8%D0%BA%D0%BE%D0%B2%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Vezikovo1885.jpg","page_title":"Везиково","context_page_description":"Ве́зиково — деревня в Губаницком сельском поселении Волосовского района Ленинградской области."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E6%9E%9C%E9%9D%92%E6%9D%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Picea_neoveitchii_foliage.jpg","page_title":"大果青杄","context_page_description":"大果青杄为松科云杉属的植物，是中国的特有植物。分布于中国大陆的陕西、甘肃、湖北等地，生长于海拔1,300米至2,000米的地区，多生在山坡。"},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Notre-Dame_de_Noyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Chevet_et_biblioth%C3%A8que_de_la_cath%C3%A9drale_de_Noyon.JPG","page_title":"Cathédrale Notre-Dame de Noyon","context_page_description":"La cathédrale Notre-Dame de Noyon est une église catholique située au centre de la ville de Noyon, dans le département de l'Oise en région Hauts-de-France.\\nElle fut le siège de l'évêché de Noyon du milieu du VIᵉ siècle jusque 1790, date à laquelle ce diocèse fut supprimé et son territoire incorporé au sein du diocèse de Beauvais. En 1851, le diocèse de Beauvais prit le nom de diocèse de Beauvais-Noyon.\\nLa cathédrale Notre-Dame de Noyon, construite à partir de 1145, est l'un des premiers jalons de l'architecture gothique. Autour d'elle subsiste une partie du groupe épiscopal et du quartier canonial tel qu'il a évolué au fil du temps : les ruines de la chapelle de l'évêque, bâtie au XIIᵉ siècle ; un bâtiment ayant fait fonction de réfectoire des chanoines, puis de salle capitulaire, construit au XIIIᵉ siècle, ainsi qu'un cloître de la même époque ; la bibliothèque du chapitre, qui date du XVIᵉ siècle ; le palais épiscopal du XVIIᵉ siècle ; enfin les maisons des chanoines, réédifiées suivant les cas au XVIIᵉ siècle ou au XVIIIᵉ siècle."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Arsenal_F.C._managers","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Billy_Wright_%281961%29.jpg","page_title":"List of Arsenal F.C. managers","context_page_description":"Arsenal Football Club is an English professional association football club based in Islington, London. The club was formed in Woolwich in 1886 as Dial Square before it was shortly renamed to Royal Arsenal, and then Woolwich Arsenal in 1893. They became the first southern member admitted into the Football League in 1893, having spent their first four seasons solely participating in cup tournaments and friendlies. The club's name was shortened to Arsenal in 1914, a year after moving to Highbury. In spite of finishing fifth in the Second Division in 1915, Arsenal rejoined the First Division at the expense of local rivals Tottenham Hotspur when football resumed after the First World War. Since that time, they have not fallen below the first tier of the English football league system and hold the record for the longest uninterrupted period in the top flight.\\nThere have been nineteen permanent and eight caretaker managers of Arsenal since 1897; Stewart Houston has managed the club in two separate spells as caretaker. The most successful person to manage Arsenal is Arsène Wenger, who won three Premier League titles, seven FA Cups and seven Community Shields between 1996 and 2018."},{"page_url":"https://ca.wikipedia.org/wiki/Parc_Nacional_del_Banc_d%27Arguin","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/PNBA_43.JPG","page_title":"Parc Nacional del Banc d'Arguin","context_page_description":"El Parc Nacional de Banc d'Arguin de la badia d'Arguin es troba a l'Àfrica occidental, a la costa oest de Mauritània, entre Nouakchott i Nouadhibou. Està inscrit en la llista del Patrimoni de la Humanitat des del 1989.\\nÉs un lloc important de reproducció per a les aus migratòries, incloent-hi flamencs, territ becadell, pelicans i gavines."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%B8%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Defileul_Trinca_Edinet_vedere_spre_sat_panta_stinga.jpg","page_title":"Тринка","context_page_description":"Тринка — село в Единецком районе Молдавии. Относится к сёлам, не образующим коммуну."},{"page_url":"https://de.wikipedia.org/wiki/D%C3%A4nischer_Wohld","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/EgernborgKongsborg.png","page_title":"Dänischer Wohld","context_page_description":"Die Landschaft Dänischer Wohld ist eine Halbinsel zwischen Eckernförder Bucht und Kieler Förde in Schleswig-Holstein. Im Süden wird der Dänische Wohld durch die Levensau und die Eider begrenzt. Hauptort der historischen Landschaft sowie eines gleichnamigen Amtes, das nur einen zentralen Teil der Halbinsel umfasst, ist Gettorf.\\nDer Dänische Wohld liegt überwiegend im Altkreis Eckernförde des heutigen Rendsburg-Eckernförde. Einige Orte im Südosten gehören seit 1922 bzw. 1959 zur Stadt Kiel. Insgesamt leben auf dem Dänischen Wohld ca. 46.500 Menschen."},{"page_url":"https://sv.wikipedia.org/wiki/Salttuss","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Hennediella_heimii_capsule.jpg","page_title":"Salttuss","context_page_description":"Salttuss är en bladmossart som beskrevs av Richard Henry Zander 1993. Salttuss ingår i släktet Hennediella och familjen Pottiaceae. Arten är reproducerande i Sverige. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9C%E1%83%A3%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Napata_english2.jpg","page_title":"ნური","context_page_description":"ნური — ადგილი თანამედროვე სუდანში, ნილოსის სამხრეთ–აღმოსავლეთ ნაწილში. ახლოსაა პირამიდები, რომლებიც ოდესღაც ნუბიის მეფეს ეკუთვნოდა. ნური სამანიდან დაახლოებით 15, ხოლო ჯებელ ბარკალიდან 10 კილომეტრითაა დაშორებული. აქ აღმოჩენილი ყოველი რელიკვია ძველ ქალაქ ნაპატას ეკუთვნის, რომელიც ნუბიის სამეფოს პირველი დედაქალაქი იყო.\\nმეფე ტახარკა იყო მფლობელი ნურისთან ახლოს მდებარე ყველაზე ძველი პირამიდისა, რომლის ფართობი 51.75 მ², ხოლო სიმაღლე 40–50 მეტრია. მისი მემკვიდრე ტანუტამონი და მას შემდეგ ყოველი მომდევო ნუბიის მეფე ნასტასენამდე თავიანთ ცოლებიანად ელ–კურუში არიან დამარხულნი. ნურისთან მდებარე პირამიდები ზოგადად უფრო პატარაა და ხშირად უფრო მძიმედ დაზიანებული, ვიდრე ეგვიპტისა, მაგრამ მათი დიდი ნაწილი ჯერ კიდევ ინახავს ისეთ უმნიშვნელოვანეს ნივთებს, როგორიცაა დასაკრძალი აღჭურვილობა, რომელიც ქუშის სამეფოს მმართველებს ეკუთვნოდათ და თავადაც აქ განისვენებენ. ქრისტიანული ეპოქის დროს აქ ეკლესია აღიმართა, რომლის მშენებლობაზეც გამოიყენეს ქვები, რომლებიც ოდესღაც პირამიდების კედლებს ავსებდა.\\nეს პირამიდები სისტემატურად ჯორჯ რაიზნერმა გამოიკვლია.\\nნურის პირამიდები გებელ ბარკალის რაიონში მდებარე რამდენიმე ნაგებობასთან ერთად 2003 წლიდან იუნესკოს მსოფლიო მემკვიდრეობის ძეგლების სიაშია შესული."},{"page_url":"https://eo.wikipedia.org/wiki/Friedrich_Leopold_zu_Stolberg-Stolberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Friedrich_leopold_graf_zu_stolberg.jpg","page_title":"Friedrich Leopold zu Stolberg-Stolberg","context_page_description":"Friedrich Leopold zu Stolberg-Stolberg estis germana-dana poeto, advokato kaj tradukisto. Li polemike atakitis per la verko Xenien."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%89%E0%A4%B8%E0%A5%8D%E0%A4%AE%E0%A4%BE%E0%A4%A8%E0%A4%BF%E0%A4%AF%E0%A4%BE_%E0%A4%B5%E0%A4%BF%E0%A4%B6%E0%A5%8D%E0%A4%B5%E0%A4%B5%E0%A4%BF%E0%A4%A6%E0%A5%8D%E0%A4%AF%E0%A4%BE%E0%A4%B2%E0%A4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/OsmaniaUnivArtsCollege.JPG","page_title":"उस्मानिया विश्वविद्यालय","context_page_description":"उस्मानिया विश्वविद्यालय हैदराबाद, तेलंगाना में स्थित एक सार्वजनिक राज्य विश्वविद्यालय है। इसकी स्थापना 1918 में हैदराबाद के निज़ाम, मीर उस्मान अली खान ने किया था। इसका मुख्य वास्तुकार नवाब सरवर जंग थे। यह भारत का सातवां सबसे पुराना विश्वविद्यालय है।\\nनिज़ाम \\"उस्मानिया विश्वविद्याल\\" आर्ट्स कॉलेज के उद्घाटन करते हुए"},{"page_url":"https://es.wikipedia.org/wiki/Tringa_stagnatilis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Marsh_Sandpiper_%28Tringa_stagnatilis%29_in_Hyderabad%2C_AP_W_IMG_2400.jpg","page_title":"Tringa stagnatilis","context_page_description":"El Archibebe fino o Tringa stagnatilis es un pájaro limícola. Es una tringa bastante pequeña y habita en las estepas herbáceas abiertas y en las tierras húmedas de la taiga del extremo este de Europa y Asia Central.\\nSe parece al Archibebe claro pero es más pequeño y delgado, con un pico largo y fino y patas largas amarillentas. Al igual que el Archibebe claro, su plumaje es de un color pardo grisáceo durante la estación de cría, más pálido en invierno y tiene una franja clara en la espalda que es visible durante el vuelo. Sin embargo, se encuentra más estrechamente emparentado con el Archibebe común y el Andarríos bastardo. Juntos, forman un grupo de pequeñas tringas que tienen patas rojizas o amarillentas, su plumaje de cría es más oscuro con un diseño de pequeñas motas marrones en el pecho y el cuello.\\nEs una especie migratoria, y la mayoría de los ejemplares pasan el invierno en África y la India, y unos pocos llegan hasta el sudeste asiático y Australia. Prefieren pasar el invierno en terrenos húmedos y frescos como pantanos y lagos y normalmente se mueven solos o en grupos pequeños."},{"page_url":"https://ca.wikipedia.org/wiki/Establiments","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Sarri%C3%A0_Mallorca.jpg","page_title":"Establiments","context_page_description":"Establiments és un barri residencial de Palma, situat al districte nord de la ciutat. Antigament havia format part del municipi d'Esporles, del qual s'independitzà, però de 1910 ençà pertany al municipi de Palma, essent l'únic municipi de les Illes Balears que n'ha perdut la condició.\\nLimita a llevant amb el municipi de Puigpunyent, al nord amb el municipi d'Esporles, a ponent amb Son Espanyol pel camí de la Real i el torrent de Sarrià, i al sud amb Son Anglada pel torrent de la Riera i amb el Secar de la Real pels camins de Ca na Verda, del Vicari i de Son Espases.\\nLa línia d'autobús que el comunica amb Ciutat és la núm. 16. La major part d'habitatges són unifamiliars. Disposa d'un centre educatiu públic, el CEIP Establiments, que imparteix classes d'infantil i primària, i pertany a la zona B d'educació del municipi. Aquest centre està adscrit als instituts d'educació secundària de Son Pacs, Josep Maria Llompart, Joan Maria Thomàs i Madina Mayurqa. També compta una escola infantil concertada nomenada Jardines de la Infancia de les Religioses de la Puresa de Maria, adscrita al col·legi Madre Alberta de Palma."},{"page_url":"https://fr.wikipedia.org/wiki/La_Soif_du_mal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Touch_of_Evil.JPG","page_title":"La Soif du mal","context_page_description":"La Soif du mal est un film policier américain réalisé par Orson Welles, sorti en 1958.\\nIl commence par le plus long plan-séquence à la grue de l'histoire du cinéma."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%9A%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%B2%E0%A5%8D%E0%A4%B8_%E0%A4%A1%E0%A4%BF%E0%A4%95%E0%A4%A8%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Dickens_by_Watkins_detail.jpg","page_title":"चार्ल्स डिकन्स","context_page_description":"चार्ल्स जॉन हफाम डिकन्स हा इंग्रजी भाषेतील सर्वाधिक लोकप्रिय कादंबरीकारांपैकी एक होता.\\nत्याने आपल्या साहित्यिक कारकिर्दीत डझनभराहून अधिक कादंबऱ्या, अनेक लघुकथा, काही नाटके व अनेक ललितेतर पुस्तके लिहिली. साप्ताहिकांमधून व मासिकांमधून सुरुवातीला मालिकेच्या स्वरूपात प्रकाशित झालेल्या त्याच्या कादंबऱ्या नंतर पुस्तकरूपाने प्रकाशित झाल्या. ओघवती भाषा, अनेकपदरी कथानके तसेच विलक्षण, बहुआयामी व्यक्तिमत्त्वे ही डिकन्सच्या लेखनशैलीची खासियत होती. आपल्या अनेक प्रसिद्ध कादंबऱ्यांनी डिकन्सला जगभर अमाप प्रसिद्धी मिळवून दिली. आपल्या लेखनातून तसेच इतर कामातून डिकन्सने समाजसुधारणेचा जीवनभर पुरस्कार केला.\\nत्याने बॉझ या टोपणनावानेही लिखाण केले होते."},{"page_url":"https://en.wikipedia.org/wiki/Kieran_Gibbs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Kieran_Gibbs.jpg","page_title":"Kieran Gibbs","context_page_description":"Kieran James Ricardo Gibbs is an English professional footballer who plays as a left back for Premier League club West Bromwich Albion and the English national team.\\nGibbs began his senior career with Arsenal in 2007, after joining the club from the Wimbledon academy in 2004. He began as a winger and moved to left back after a loan spell with Norwich City during the same 2007–08 season where he made his Arsenal debut. He made his full England debut in a friendly against Hungary at Wembley Stadium on 11 August 2010."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%A4%D0%9E%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/German_KFOR_armoured_vehicle%2C_1999.jpg","page_title":"КФОР","context_page_description":"Косовске снаге, познатије по свом акрониму КФОР, представљају међународне мировне снаге под вођством НАТО-а чији је задатак чување реда и мира, односно стварања и одржавање сигурности на Косову и Метохији.\\nКФОР је на простор Косова и Метохије стигао 12. јуна 1999. године, два дана након што је усвојена Резолуцији 1244 Савета безбједности ОУН и три дана након потписивања Војно-техничког споразума у Куманову. У то вријеме, на Космету је влада велика хуманитарна криза, а војне и полиције снаге СР Југославије и Ослободилачка војска Косова су свакодневно водиле борбе. Приближно милион људи је избјегло са Космета.\\nКФОР постепено преноси своја овлашћења заштите вјерске и културне баштине на Косовску полицију. Према подацима из децембар 2018. године, КФОР је у свом саставу имао око 3.642 војника из 28 земаља."},{"page_url":"https://de.wikipedia.org/wiki/Weinstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Silcher-Denkmal_Schnait.jpg","page_title":"Weinstadt","context_page_description":"Weinstadt ist eine Stadt etwa 15 km östlich von Stuttgart in Baden-Württemberg. Sie gehört zur Region Stuttgart und zur europäischen Metropolregion Stuttgart. Die erst im Rahmen der Gebietsreform zum 1. Januar 1975 neu gebildete Gemeinde ist seit dem 9. März 1976 eine Stadt und seit dem 1. Januar 1979 eine Große Kreisstadt. Heute ist sie die sechstgrößte Stadt des Rems-Murr-Kreises und bildet ein Unterzentrum im Mittelbereich Waiblingen/Fellbach."},{"page_url":"https://en.wikipedia.org/wiki/Ami_(camera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Ami_2_%286%29.JPG","page_title":"Ami (camera)","context_page_description":"The Ami is a viewfinder camera made of plastic, produced during the communist era of Poland era by the Polish firm Warsaw Photo-Optical Works or WZFO. It was the successor to their Bakelite-cased Druh camera, which was popular with youth due to its simplicity. The Ami was also quite popular, although its availability was sometimes restricted due to production limits in the economy imposed by the government.\\nThe word ami does not have any particular meaning in Polish, but French was a widely known language in Poland at the time and it is thus possible that the name refers to the French word ami."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Vaize","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/FR_17_Saint-Vaize_-_Au_bord_de_la_Charente.JPG","page_title":"Saint-Vaize","context_page_description":"Saint-Vaize est une commune du sud-ouest de la France située dans le département de la Charente-Maritime. Ses habitants sont appelés les Vasiliens et les Vasiliennes."},{"page_url":"https://pt.wikipedia.org/wiki/Inflama%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/NeutrophilerAktion.png","page_title":"Inflamação","context_page_description":"A inflamação ou processo inflamatório é uma reação do organismo a uma infecção ou lesão dos tecidos.\\nEm um processo inflamatório a região atingida fica avermelhada e quente. Isso ocorre devido a um aumento do fluxo de sangue e demais líquidos corporais migrados para o local. Na área inflamada também ocorre o acúmulo de células provenientes do sistema imunológico, com dor localizada mediada por certas substâncias químicas produzidas pelo organismo. No processo, os leucócitos destroem o tecido danificado e enviam sinais aos macrófagos, que ingerem e digerem os antígenos e o tecido morto. Em algumas doenças esse processo pode apresentar caráter destrutivo.\\nO processo inflamatório caracteriza-se como um mecanismo de defesa do organismo, e esta defesa constitui na ação de destruir, diluir e isolar o agente agressor, além de que inicia o processo reparativo de cicatrização e regeneração deste tecido que foi lesionado.\\nA inflamação pode lesar o próprio organismo de uma maneira mais nociva que o próprio agente agressor, e um exemplo disto é a artrite reumatoide na medicina humana e alguns tipos de pneumonia."},{"page_url":"https://zh.wikipedia.org/wiki/1929%E5%B9%B4%E5%8D%97%E7%BE%8E%E8%B6%B3%E7%90%83%E9%8C%A6%E6%A8%99%E8%B3%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/El_Gasometro.JPG","page_title":"1929年南美足球錦標賽","context_page_description":"1929年南美足球錦標賽是南美足協第 12 屆南美足球錦標賽，本屆主辦國為阿根廷，比賽日期為1929年11月1日至11月17日。本次進入決賽圈的球隊包括南美足聯的 4 個成員國家隊。\\n本屆南美足球錦標賽原預計在1928年舉行，但因智利、阿根廷、烏拉圭三隊參加荷蘭阿姆斯特丹舉辦的1928年夏季奧林匹克運動會而延後舉行。\\n玻利維亞、巴西、智利在本屆比賽中棄權。\\n主辦國兼上屆冠軍阿根廷最後以3戰全勝6積分，在美洲盃奪得第4次冠軍。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%92%D0%B0%D0%B4%D1%83%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/3155_-_Vaduz_-_Schloss_Vaduz.JPG","page_title":"Замок Вадуц","context_page_description":"Замок Вадуц — замок у Ліхтенштейні, офіційна резиденція князя, що отримав назву від міста Вадуц, на пагорбі, над яким він розташований."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%AA%E5%8D%97%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ozaki-Sta001.JPG","page_title":"阪南市","context_page_description":"阪南市是位於大阪府西南部的城市，為大阪府轄下最南端的城市，距離大阪市中心約45公里，但距離相鄰的和歌山市區僅10公里。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%D8%A8%E2%80%8C%D9%88%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Subway_Munich_Rindermarkt.JPG","page_title":"ساب‌وی","context_page_description":"ساب‌وی شرکت غذاخوری آمریکایی است، که در زمینه مدیریت بر مجموعه‌ای از رستوران‌های زنجیره‌ای فعالیت می‌کند. رستوران‌های زنجیره‌ای ساب‌وی در سال ۱۹۶۵ توسط فرد دلوکا تأسیس شد و هم‌اکنون مالک شبکه‌ای از ۴۴٬۸۳۴ شعبه در ۱۱۲ کشور می‌باشد و بعنوان بزرگترین رستوران زنجیره‌ای جهان شناخته می‌شود."},{"page_url":"https://en.wikipedia.org/wiki/Chandramouleshwara_Temple","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Chandramouleshwara_temple_Unkal_3.JPG","page_title":"Chandramouleshwara Temple","context_page_description":"The Chandramouleshwar Temple in Hubli City, Unkal area, is a 900 year old temple built during the Badami Chalukyan era. It is situated near Unkal circle, Unkal Lake\\nUnkal is an area in the Hubli-Dharwad municipality in Karnataka. It is on old Pune – Bangalore highway NH4, about 3 km north of Hubli city centre. The beautiful, natural, scenic Unkal Lake is located in this area. It is a good picnic spot and a must-visit place.\\nThe Chandramouleshwar temple is dedicated to lord Shiva. It houses two big Shivalingas. The main shrine has four entrances in all the four directions. The presiding deity of the shrine, Lord Chandramouleshwar faces east. The other Linga is known as Chaturmukha Linga, literally meaning the four faced Linga.\\nThe temple remains open from sunrise to sunset."},{"page_url":"https://af.wikipedia.org/wiki/Weer_(meteorologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Thunder_lightning_Garajau_Madeira_289985700.jpg","page_title":"Weer (meteorologie)","context_page_description":"Weer is die toestand van die atmosfeer, tot die mate wat dit warm of koud, nat of droog, kalm of stormagtig, oopgetrek of bewolk is. Die meeste weerverskynsels kom voor binne die troposfeer net onder die stratosfeer. Weer verwys, in die algemeen, na dag-tot-dag temperature en neerslae, terwyl klimaat die term is vir die gemiddelde atmosferiese toestand oor langer tydsperiodes. Wanneer dit in die algemeen gebruik word, verwys \\"weer\\" gewoonlik na die weer op Aarde.\\nDie dryfkrag agter weer is meerendeels digtheidsverskille tussen verskillende plekke. Hierdie verskille kan voorkom as gevolg van die hoek wat sonstrale die aarde se atmosfeer inval by 'n bepaalde plek, wat wissel by die lengtegrade vanaf die trope. Die sterk temperatuurverskille tussen die pole en tropiese lug veroorsaak die vorming van straalstrome.\\nWeerstelsels in die middelbreedtegraadliggings, soos ekstratropiese siklone, word veroorsaak deur onstabiliteite van die straalstroomvloei. Omdat die aardas gekantel is relatief tot sy orbitaalvlak, val sonlig die Aarde se atmosfeer binne op verskillende hoeke by verskillende tye van die jaar. Op die aardoppervlak wissel temperature gewoonlik met ±40 °C per jaar."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%89%A3%E6%A0%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Ichi_you_cha.jpg","page_title":"扣树","context_page_description":"扣樹為冬青科冬青屬的植物，是中國的特有植物。分布在中國大陸的四川、雲南、湖南、湖北、海南、廣西、廣東等地，生長於海拔1,000米至1,200米的地區，一般生於密林中，目前已由人工引種栽培。"},{"page_url":"https://it.wikipedia.org/wiki/Elezioni_primarie_del_Partito_Democratico_del_2008_(Stati_Uniti_d%27America)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Flag_of_Arkansas.svg","page_title":"Elezioni primarie del Partito Democratico del 2008 (Stati Uniti d'America)","context_page_description":"Le elezioni primarie del Partito Democratico statunitense del 2008 si sono tenute tra i mesi di gennaio e giugno in vista delle elezioni presidenziali. Il candidato che ha ottenuto più voti popolari è stata la senatrice Hillary Clinton, ma la maggioranza dei delegati nei singoli Stati e il numero più alto di superdelegati favorevoli è stato ottenuto dal senatore Barack Obama, che ha così avuto la nomination."},{"page_url":"https://vec.wikipedia.org/wiki/Castelmezzano","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Castelmezzano_panorama.jpg","page_title":"Castelmezzano","context_page_description":"Castelmezzano el xe on comun n'te la provincia de Potensa chel fa parte de la rejon Baxiłicata"},{"page_url":"https://it.wikipedia.org/wiki/Storia_degli_Stati_Uniti_d%27America_(1789-1849)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/USA_Territorial_Growth_1810.jpg","page_title":"Storia degli Stati Uniti d'America (1789-1849)","context_page_description":"Dopo l'elezione di George Washington come primo Presidente degli Stati Uniti d'America nel 1789, il Congresso approvò la prima di molte leggi che organizzavano il governo, e adottò la \\"carta dei diritti\\", nella forma di dieci emendamenti alla nuova costituzione — la Carta dei Diritti degli Stati Uniti d'America.\\nGeorge Washington, noto eroe della guerra d'indipendenza americana, comandante dell'esercito continentale e presidente della convenzione costituzionale, forse la più popolare figura politica dell'epoca negli Stati Uniti, venne proclamato \\"Padre della Nazione\\" e vinse le elezioni praticamente senza opposizione. Washington si mosse per istituire il ramo esecutivo del governo federale degli Stati Uniti. Il Congresso approvò il Judiciary Act del 1789, che istituiva l'intero sistema giudiziario federale, compresa la Corte Suprema.\\nL'acquisto della Louisiana, nel 1803, diede ai contadini dell'ovest accesso alle acque del Mississippi, rimosse la presenza francese dal confine occidentale degli USA, fornì nuove distese di terra e portò avanti la visione dei leader americani, di creazione di una \\"Grande Nazione\\"."},{"page_url":"https://es.wikipedia.org/wiki/Artur_Boruc","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Artur_Boruc_Dinamo_Moscow_Celts.jpg","page_title":"Artur Boruc","context_page_description":"Artur Boruc es un futbolista internacional​ polaco que juega de portero en el Legia de Varsovia de la Ekstraklasa.\\nBoruc comenzó su carrera en la tercera división polaca de la mano de su club natal, el Pogoń Siedlce. Se unió al Legia de Varsovia en 1999, marchándose como cedido al Dolcan Ząbki en 2000 antes de abrirse hueco dentro de la plantilla del Legia en 2002, convirtiéndose en portero titular en club ya en 2003. En el verano de 2005, se unió al Celtic de Glasgow de la Scottish Premiership. En sus cinco años en Glasgow, Boruc estuvo presente en 221 partidos para el club, ​ ganando en tres ocasiones la liga, una Copa de Escocia y dos Copas de la Liga de Escocia. Los fanáticos celtas apodaron a Boruc The Holy Goalie por su devoto catolicismo. Se mudó a Italia en 2010 para unirse a la Fiorentina, pasando dos años en el club de la Serie A antes de regresar a Gran Bretaña en 2012 para fichar por el Southampton FC de la Premier League, fichando posteriormente por el AFC Bournemouth en 2015 después de jugar una temporada como préstamo en el equipo."},{"page_url":"https://en.wikipedia.org/wiki/Sanchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Sanchi_Great_Stupa_1851.jpg","page_title":"Sanchi","context_page_description":"Sanchi Stupa is a Buddhist complex, famous for its Great Stupa, on a hilltop at Sanchi Town in Raisen District of the State of Madhya Pradesh, India. It is located in 46 kilometres north-east of Bhopal, capital of Madhya Pradesh.\\nThe Great Stupa at Sanchi is one of the oldest stone structures in India, and an important monument of Indian Architecture. It was originally commissioned by the emperor Ashoka in the 3rd century BCE. Its nucleus was a simple hemispherical brick structure built over the relics of the Buddha. It was crowned by the chhatri, a parasol-like structure symbolising high rank, which was intended to honour and shelter the relics. The original construction work of this stupa was overseen by Ashoka, whose wife Devi was the daughter of a merchant of nearby Vidisha. Sanchi was also her birthplace as well as the venue of her and Ashoka's wedding. In the 1st century BCE, four elaborately carved toranas and a balustrade encircling the entire structure were added. The Sanchi Stupa built during Mauryan period was made of bricks. The composite flourished until the 11th century."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AD%E0%A6%BE%E0%A6%B0%E0%A6%A4%E0%A7%80%E0%A6%AF%E0%A6%BC_%E0%A6%89%E0%A6%AA%E0%A6%95%E0%A7%82%E0%A6%B2%E0%A6%B0%E0%A6%95%E0%A7%8D%E0%A6%B7%E0%A7%80_%E0%A6%AC%E0%A6%BE%E0%A6%B9%E0%A6%BF%E0%A6%A8%E0%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Indian_Coast_Guard_Ships_Vijaya_%2834%29_and_Samar_%2842%29.jpg","page_title":"ভারতীয় উপকূলরক্ষী বাহিনী","context_page_description":"ভারতীয় উপকূলরক্ষী বাহিনী ভারতের চতুর্থ সশস্ত্র বাহিনী, যা দেশের সুবিশাল উপকূল অঞ্চলে প্রহরা দেয়। ভারতীয় উপকূলরক্ষী বাহিনী ১৮ আগস্ট ১৯৭৮ প্রতিষ্ঠিত হয়। ভারতীয় উপকূলরক্ষী বাহিনী ভারতীয় নৌবাহিনী, মৎস্য অধিদপ্তর, রাজস্ব বিভাগের এবং কেন্দ্রীয় ও রাজ্য পুলিশ বাহিনীর সঙ্গে ঘনিষ্ঠ সহযোগিতার মধ্যে কাজ করে।"},{"page_url":"https://it.wikipedia.org/wiki/Stra%C3%9Fkirchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Pfarrkirche_Stra%C3%9Fkirchen.JPG","page_title":"Straßkirchen","context_page_description":"Straßkirchen è un comune tedesco di 3.333 abitanti, situato nel land della Baviera."},{"page_url":"https://pl.wikipedia.org/wiki/Lipa_(powiat_kozienicki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Lipa_-_budynek_OSP.jpg","page_title":"Lipa (powiat kozienicki)","context_page_description":"Lipa – wieś w Polsce położona w województwie mazowieckim, w powiecie kozienickim, w gminie Głowaczów.\\nWieś szlachecka położona była w drugiej połowie XVI wieku w powiecie wareckim ziemi czerskiej województwa mazowieckiego. 15 lutego 1864 roku, w czasie powstania styczniowego miała tu miejsce bitwa oddziału Dzieci Warszawskich.\\nDo 1870 istniała gmina Lipa.\\nPo odzyskaniu niepodległości, mieszkańcy upamiętnili poległych powstańców styczniowych dębowym krzyżem. Krzyż obalony w 1944 przez Niemców, po ich wycofaniu został wzniesiony ponownie. W 1971 z inicjatywy Antoniego Lipca przy krzyżu postawiono kamienny pomnik.\\nW czasie okupacji niemieckiej w Lipie w zabudowaniach należących do Wacława Wrońskiego działała wytwórnia Sidolówek, uruchomiona z inicjatywy Antoniego Lipca.\\nW latach 1975–1998 miejscowość należała administracyjnie do województwa radomskiego."},{"page_url":"https://en.wikipedia.org/wiki/Arroyo_Point","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Urdoviza.jpg","page_title":"Arroyo Point","context_page_description":"Arroyo Point is the northeast extremity of a trapezoid-shaped and mostly ice-covered headland projecting 900 m from the east coast of Ioannes Paulus II Peninsula into Hero Bay, Livingston Island in the South Shetland Islands, Antarctica. The point forms the south side of the entrance to Stoyanov Cove and, together with nearby Agüero Point, separates the termini of Urdoviza Glacier to the north from Medven Glacier to the south.\\nThe feature is named after Jesús Arroyo, a crewman of the Argentine Navy Lockheed Neptune aircraft that crashed in poor weather on the slopes of Mount Friesland on 15 September 1976."},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Obama","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Samantha_Power.jpg","page_title":"Kabinett Obama","context_page_description":"Am 20. Januar 2009 wurde Barack Obama zum 44. Präsidenten der Vereinigten Staaten vereidigt. Im November 2012 wurde er für eine zweite Amtszeit wiedergewählt. Sie endete am 20. Januar 2017."},{"page_url":"https://de.wikipedia.org/wiki/Pira_Delal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Pira_Delal%2C_Kurdistan.jpg","page_title":"Pira Delal","context_page_description":"Delal ist eine der ältesten Brücken der Stadt Zaxo in der Autonomen Region Kurdistan im Irak. Laut mündlichen Überlieferungen soll Pira Delal aus der römischen Antike stammen. Sie überquert den Fluss Chabur im Südosten der Stadt. Sie ist 114 Meter lang und 4,70 Meter breit und überquert den Fluss über sechs Bögen, der große mittlere Bogen in 15,5 Metern Höhe. Reliefs und Inschriften an den Wänden, die ursprünglich Informationen zum Bau und zur Geschichte des Bauwerks angaben, fehlen und sind nicht mehr rekonstruierbar. Für das Amt für Altertum in Dohuk ist die Brücke eine der wichtigsten von 159 archäologischen Stätten in Zaxo. Seit 2013 werden Teile der Brücke durch die Regierung Kurdistans restauriert."},{"page_url":"https://eo.wikipedia.org/wiki/John_Knox","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Knoxbezaicones.jpg","page_title":"John Knox","context_page_description":"John KNOX, estis pastro de Skotlando. Li estis gvidanto de la Protestantismo Reformacio kiu estas rigardita kiel la fondanto de la presbiteranisma eklezio."},{"page_url":"https://ca.wikipedia.org/wiki/Santa_Maria_de_Ta%C3%BCll","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Vall_de_Bo%C3%AD._Ta%C3%BCll._Santa_Maria_16.JPG","page_title":"Santa Maria de Taüll","context_page_description":"Santa Maria de Taüll és una església romànica de la localitat de Taüll al terme municipal de la Vall de Boí. Es troba a la plaça del poble de Taüll, i a pocs metres al sud-oest hi ha l'església de Sant Climent que pertany a la mateixa època. Les dues van ser erigides i consagrades al mateix temps: la de Santa Maria fou consagrada un dia més tard que la de Sant Climent, l'any 1123. A partir del segle xviii va ser l'única parròquia del municipi de Taüll, mentre que la de Sant Climent exercia de capella del cementiri modern de Taüll, però als segles anteriors, havien compartit parroquialitat les dues esglésies. És un monument del municipi de la Vall de Boí declarat bé cultural d'interès nacional."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Finanz%C3%A4mter_in_Nordrhein-Westfalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Herne_Finanzamt_Neubau.jpg","page_title":"Liste der Finanzämter in Nordrhein-Westfalen","context_page_description":"Diese Liste nennt die Finanzämter in Nordrhein-Westfalen."},{"page_url":"https://fr.wikipedia.org/wiki/Chariot_de_supermarch%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Kiddie_shopping_carts.jpg","page_title":"Chariot de supermarché","context_page_description":"Un chariot, charrette de supermarché, ou encore au Québec panier d'épicerie, est un chariot, métallique ou en matière plastique, conçu pour faciliter le transport des marchandises achetées dans un supermarché ou d'autres types de magasins.\\nCaddie est une marque propriété de la société française Ateliers Réunis Caddie. Le terme « caddie » est par antonomase entré dans le langage courant pour désigner un chariot de supermarché, bien que l'entreprise intervient régulièrement pour s'opposer à ce que le nom de ses produits soient utilisées comme tel."},{"page_url":"https://it.wikipedia.org/wiki/Catania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Chiosco_Giammona.jpg","page_title":"Catania","context_page_description":"Catania è un comune italiano di 310 247 abitanti, capoluogo della città metropolitana di Catania in Sicilia.\\nCuore di un agglomerato urbano di circa 700 000 residenti esteso alle pendici sud orientali del Monte Etna, è il centro dell'area metropolitana più densamente popolata della Sicilia, e di una più ampia conurbazione nota come Sistema lineare della Sicilia orientale, che conta circa 1.693.173 abitanti su una superficie di 2.400 chilometri quadrati. La città è inoltre il fulcro economico e infrastrutturale del Distretto del Sud-Est Sicilia, istituito il 26 febbraio 2014 alla presenza dell'allora presidente della Repubblica Italiana Giorgio Napolitano. Principale polo industriale, logistico e commerciale della Sicilia, è sede dell'Aeroporto Vincenzo Bellini.\\nFondata nel 729 a.C. dai Calcidesi della vicina Naxos, la città vanta una storia millenaria caratterizzata da svariate dominazioni i cui resti ne arricchiscono il patrimonio artistico, architettonico e culturale. Sotto la dinastia aragonese fu capitale del Regno di Sicilia, e dal 1434 per volere del re Alfonso V è sede della più antica Università dell'isola."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%8A%D8%B1%D9%88%D8%B3_%D9%83%D9%88%D8%B1%D9%88%D9%86%D8%A7_%D8%A8%D9%8A%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/MERS_Coronavirus_Particles_%2814702416040%29.jpg","page_title":"فيروس كورونا بيتا","context_page_description":"الفيروسات التاجية هي عائلة من الفيروسات المعروفة لاحتوائها على سلالات تسبب أمراضًا قاتلة محتملة للثدييات والطيور وبين البشر تنتشر عبر قطرات من السوائل المحمولة جواً ينتجها الأفراد المصابون.\\nالأنواع المعروفة منها أربعة تسمى ألفا وبيتا وجاما ودلتا والأولى والثانية تصيب فقط الثدييات من الخفافيش والخنازير والقطط والبشر والثالث يصيب الطيور مثل الدواجن بينما الرابع يصيب الطيور والثدييات على حد سواء.\\nوصف العلماء لأول مرة في الستينيات هذا الفيروس الذي أطلقوا عليه اسمه نظرا لتاج البروتينات السكرية التي تنبثق من الغلاف المحيط بجزيء الفيروس."},{"page_url":"https://de.wikipedia.org/wiki/Audi_R8_LMS_GT3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Audi_R8_LMS_Spa.JPG","page_title":"Audi R8 LMS GT3","context_page_description":"Der Audi R8 LMS ist ein Rennwagen der Gruppe GT3, der auf Basis des Audi R8 der zweiten Generation entwickelt wurde. Der Verkauf begann im September 2015. Bereits vorher setzten die Audi-Werkteams Audi Sport Team WRT und Audi Sport Team Phoenix das Fahrzeug zu Test- und Erprobungszwecken bei verschiedenen Rennen ein. Der Wagen ist das Nachfolgemodell des 2012 erschienenen Audi R8 LMS ultra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BC%D0%BE%D0%BD_%D0%BB%D0%B5%D1%82%D1%8F%D1%89%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%D0%94%D0%B5%D0%BC%D0%BE%D0%BD_%D0%BB%D0%B5%D1%82%D1%8F%D1%89%D0%B8%D0%B9.jpg","page_title":"Демон летящий","context_page_description":"«Демон летящий» — незаконченная картина русского художника Михаила Врубеля. Написана в 1899 году и является частью серии иллюстраций к поэме Михаила Лермонтова «Демон»."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%BB%92%E9%83%A8%E5%B8%82%E5%9B%BD%E9%9A%9B%E6%96%87%E5%8C%96%E3%82%BB%E3%83%B3%E3%82%BF%E3%83%BC%E3%82%B3%E3%83%A9%E3%83%BC%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Kurobe_Colare.jpg","page_title":"黒部市国際文化センターコラーレ","context_page_description":"黒部市国際文化センターコラーレは、富山県黒部市三日市にある音楽、芸術文化、生涯学習などの複合文化ホール。愛称はコラーレ 。富山弁で「来られ」から命名された。"},{"page_url":"https://vi.wikipedia.org/wiki/Timor","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/ID_-_Timor.PNG","page_title":"Timor","context_page_description":"Timor là tên gọi của một hòn đảo tại phần ngoài cùng phía nam của Đông Nam Á hải đảo, nằm ở phía bắc biển Timor. Nó được chia thành 2 phần là Đông Timor, nay là nhà nước độc lập có cùng tên gọi và Tây Timor thuộc về tỉnh Đông Nusa Tenggara của Indonesia.\\nĐảo này có diện tích khoảng 30.780 km². Tên gọi của nó là một kiểu phát âm của từ timur trong tiếng Mã Lai để chỉ \\"đông\\"; nó được gọi như vậy là do nó nằm ở rìa phía đông của một chuỗi các đảo."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%9C%D0%B0%D1%80%D1%81%D1%8C%D1%8F%D0%BB%D1%8C-%D0%B4%D0%B5-%D0%92%D0%B0%D0%BB%D0%B5%D1%82%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Saint-Martial_Church.jpg","page_title":"Сен-Марсьяль-де-Валетт","context_page_description":"Сен-Марсьяль-де-Валетт — Францин гӀала-коммуна, лаьтта Керла Аквитани регионехь. Коммунан департамент — Дордонь. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%82%D0%B5%D0%BB%D1%8C_(%D0%91%D0%9C%D0%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ratel_60_Mortar_platform.jpg","page_title":"Ратель (БМП)","context_page_description":"«Рател» — первая колесная БМП в мире. Разработана в 1968-72 гг. компанией «Спрингфилд-Бюссинг». В 1978-87 гг. для Сухопутных войск ЮАР заводом «Сандок-Австраль» выпущено 1,4 тыс. ед. Различные варианты БМП применялись Сухопутными войсками ЮАР эпохи апартеида в Анголе и Намибии и Сухопутными войсками Марокко в в Западной Сахаре. После 1994 г. БМП «Рател» применялись Национальными силами ЮАР в миротворческих операциях в Лесото, Сомали, Нигерии, ЦАР, Ливии и Йемене."},{"page_url":"https://no.wikipedia.org/wiki/AFI%27s_100_Years%E2%80%A6100_Songs","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/BetteMidler90cropped.jpg","page_title":"AFI's 100 Years…100 Songs","context_page_description":"AFI's 100 Years…100 Songs er en liste over de 100 viktigste amerikanske filmlåtene ifølge det amerikanske filminstituttet. Listen ble offentliggjort 22. juni 2004 i en CBS-sending med skuespilleren John Travolta som programleder."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lavrinhas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Lavrinhas_bandeira.png","page_title":"Lavrinhas","context_page_description":"Lavrinhas sī ūi-tī Pa-se São Paulo chiu ê chi̍t ê chū-tī-thé."},{"page_url":"https://es.wikipedia.org/wiki/Eclipta_prostrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Eclipta_prostrata_at_Kadavoor.jpg","page_title":"Eclipta prostrata","context_page_description":"Eclipta prostrata es una especie de planta fanerógama de la familia Asteraceae. Es una de las Diez Flores Sagradas de Kerala."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Vienna","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Vienna_Allied_sectors_%281945-1955%29.png","page_title":"History of Vienna","context_page_description":"The history of Vienna has been long and varied, beginning when the Roman Empire created a military camp in the area now covered by Vienna's city centre. From that humble beginning, Vienna grew from the Roman settlement known as Vindobona to be an important trading site in the 11th century. It became the capital of the Babenberg dynasty and subsequently of the Austrian Habsburgs, under whom it became one of Europe's cultural hubs. During the 19th century as the capital of the Austrian Empire and later Austria-Hungary, it temporarily became one of Europe's biggest cities. Since the end of World War I, Vienna has been the capital of the Republic of Austria."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%81%90%E9%BE%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Macronaria.jpg","page_title":"恐龙","context_page_description":"恐龍是恐龍總目的通稱，是出現於中生代的多樣化優勢陸棲脊椎動物，曾支配全球陸地生態系統約1億4千萬年之久。恐龍最早出現在2億3千萬年前的三疊紀，所有非鳥恐龍以及大部分鳥形恐龍於約6千6百萬年前所發生的白堊紀末滅絕事件中絕滅，僅有鳥形恐龍中的鳥類存活下來並且繁榮至今。\\n原本恐龍被認為是和蜥蜴相近的物種，恐龍英文名稱的原意就是「恐怖的蜥蜴」。在1861年，古生物學家發現當時被認為是鳥類的始祖鳥化石，與身為恐龍的美頜龍化石極度相似，差別只在於始祖鳥化石有著羽毛痕跡，這顯示恐龍與鳥類可能是有關聯的親戚；以後的1970年代古生物學熱衷研究恐龍、並形成恐龍文藝復興，提出恐龍也許是群活躍的溫血動物，並可能有社會行為；1980年代，許多研究指出現代鳥類極可能是蜥臀目獸腳亞目虛骨龍類近鳥型恐龍的一支，雖然這個觀點在當時並未獲得化石證據和大多數的古生物學家支持，但「恐龍與鳥類之間必定存在著某種關係」這一點卻被承認，也從側面支持了恐龍是溫血動物的假設；在1990年代中後期，古生物學家開始在中國等地發現大量的化石證據，中華龍鳥、尾羽龍、北票龍等有直接羽毛證據的有羽毛恐龍相繼出土，為恐龍與鳥類間的演化關係提供了愈漸明確的線索，這也連帶影響恐龍的形象，變成了高度活躍而且行為多樣的生物；而2000年以後甚至有少數科學家主張恐龍和鳥類應該分類於同一綱之內，而學界普遍已經視鳥類為恐龍進化出來的後代了；到了2010年代，因為愈來愈多現代鳥類和鳥型恐龍間的過渡物種相繼被發現、填補了原本化石材料上的空白，從鳥類基因庫內的分子生物學推斷，也完全確定了「鳥」和「鳥型恐龍」之間的演化關係，鳥類更進一步被認定為「唯一存活至今的恐龍類群」，在博物館、兒童讀物、或者電影中的很多知名獸腳類恐龍也被更新為有羽毛的形象。\\n自從19世紀的工業革命早期，第一批恐龍化石被科學方法鑑定後，重建的恐龍骨架因為其體型極其巨大或小巧、構造奇妙，已成為全球各地博物館的主要展覽品，從此恐龍開始被世人所知。在20世紀前半期，隨著電影工業在美國興起，大眾媒體都視恐龍為行動緩慢、慵懶的冷血動物。恐龍已是現代大眾文化的一部分，無論兒童或者成年人均對恐龍有很高的興致。恐龍往往是熱門書籍與電影、各種玩具的題材，各類媒體也常報導恐龍的科學研究進展與新發現。\\n本文主要涉及「非鳥恐龍」，一般社會大眾對恐龍的認知也主要停留在非鳥恐龍的層次上，在沒有相關知識的情況下，現實中大多數人所認為的「恐龍」一詞並不包含現在的「鳥類」。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Oberhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/AlteFalkensteinschule.jpg","page_title":"Liste der Baudenkmäler in Oberhausen","context_page_description":"Die Liste der Baudenkmäler in Oberhausen enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Oberhausen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Oberhausen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://es.wikipedia.org/wiki/Valle_de_Lecr%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Iglesia_%28El_Padul%29.jpg","page_title":"Valle de Lecrín","context_page_description":"El Valle de Lecrín es una comarca española situada en la parte centro-sur de la provincia de Granada, comunidad autónoma de Andalucía. Este territorio limita con la Vega de Granada al norte, la Alpujarra Granadina al este, la Costa Granadina al sur, y la comarca de Alhama al oeste.\\nEl valle que da nombre a la comarca se ubica en la vertiente suroccidental de Sierra Nevada, extendiéndose desde el corazón de la misma hasta la meseta de las Albuñuelas y la sierra de los Guájares, por una parte, y desde el Suspiro del Moro hasta la confluencia de los ríos Ízbor y Guadalfeo, por otra.\\nEstá formada por ocho municipios, de los cuales el más poblado es El Padul, y el más extenso es Albuñuelas, siendo este último también el de menor número de habitantes; por el contrario, el municipio de menor superficie es Villamena. Su capital tradicional e histórica es la villa de Dúrcal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BB%D1%8C%D0%B4%D0%B5%D1%80%D0%B5%D0%B9_%D1%83%D0%B7%D0%BB%D0%BE%D1%86%D0%B2%D0%B5%D1%82%D0%BA%D0%BE%D0%B2%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Helosciadium_nodiflorum_%E2%80%94_Flora_Batava_%E2%80%94_Volume_v16.jpg","page_title":"Сельдерей узлоцветковый","context_page_description":"Сельдере́й узлоцветко́вый — вид многолетних травянистых растений рода Сельдерей семейства Зонтичные.\\nВидовой эпитет научного названия растения «узлоцветковый» связан с месторасположением цветков на растении."},{"page_url":"https://no.wikipedia.org/wiki/Funny_Girl_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Barbra_Streisand_My_Name_is_Barbra_television_special_1965.JPG","page_title":"Funny Girl (film)","context_page_description":"Funny Girl er en amerikansk biografisk filmmusikal fra 1968, regissert av William Wyler. Manuset ble skrevet av Isobel Lennart og er basert på scenemusikalen Funny Girl. Barbra Streisand, Omar Sharif, Kay Medford, Anne Francis og Walter Pidgeon spilte hovedrollene.\\nFilmen handler om den eksentriske tenåringsjenta Fanny Brice, som drømmer om en karrière innen teater. Hun får etter hvert jobb på et vaudevilleteater og arbeider seg oppover karrièrestigen. En dag har hun blitt en stor Broadway-stjerne under Florenz Ziegfelds ledelse. Hun gifter seg med en sjarmerende ungkar og stifter familie, men ektemannens uberegnelige gamblerkarrière står i veien for lykken i forholdet deres.\\nLennarts filmmanus er basert på scenemusikalen, mens Streisand gjentok rollen som Fanny. Jule Styne og Bob Merrill, som hadde komponert og skrevet låtene for musikalen, skrev nye sanger for filmen, blant annet tittelsporet «Funny Girl». Flere sanger fra musikalen ble kuttet ut, mens tre sanger som Brice selv har fremført ble lagt til, blant annet sluttsangen «My Man». Innspillingen varte fra august til desember 1967.\\nFilmen hadde verdenspremière i New York 18. september 1968."},{"page_url":"https://cs.wikipedia.org/wiki/Rota%C4%8Dn%C3%AD_vakuov%C3%A1_odparka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Heidolph_Rotary_evaporator.jpg","page_title":"Rotační vakuová odparka","context_page_description":"Rotační vakuová odparka je laboratorní zařízení sloužící k rychlému odpaření většího množství rozpouštědla a získání pevné látky v něm rozpuštěné."},{"page_url":"https://es.wikipedia.org/wiki/Rafael_Coronel","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Diego_Rivera_Mural_Palacio_Nacional_Mexico.jpg","page_title":"Rafael Coronel","context_page_description":"Rafael Coronel Arroyo, conocido como Rafael Coronel, fue un artista y pintor mexicano.​"},{"page_url":"https://fr.wikipedia.org/wiki/Annoux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Tour_Chappe_Annoux_mai_1994.jpg","page_title":"Annoux","context_page_description":"Annoux est une petite commune française rurale située dans le département de l'Yonne en région Bourgogne-Franche-Comté, au sommet d'un plateau, entourée de champs, eux-mêmes entourés de forêts. Annoux fait partie de la communauté de communes du Serein.\\nSi par le passé, l'agriculture et les bois furent les principales sources de revenus des habitants, il leur faut désormais, pour la majorité, aller travailler dans les villes avoisinantes. Il ne reste que le Vieux Château du XIIIᵉ siècle comme trace du passé médiéval du village, la majorité des habitations actuelles datant des XVIIIᵉ et XIXᵉ siècles.\\nLa base Mérimée du ministère de la Culture recense 17 constructions ou monuments intéressants, même si ces derniers ne sont pas inscrits au titre des monuments historiques."},{"page_url":"https://en.wikipedia.org/wiki/J%C5%AB-Ni","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Ju-Ni.jpg","page_title":"Jū-Ni","context_page_description":"Jū-Ni is a Michelin Star Omakase style sushi restaurant located in San Francisco, California founded by Geoffrey Lee and Tan Truong."},{"page_url":"https://be.wikipedia.org/wiki/%D0%91%D1%85%D0%B0%D0%BA%D1%82%D0%B0%D0%BF%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Bhaktapur-Taumadhi_Tole-20-Tempelwagen-2013-gje.jpg","page_title":"Бхактапур","context_page_description":"Бхактапур — старажытны неварскі горад на ўсход ад сталіцы Непала — горада Катманду. Архітэктурныя помнікі. 77 000 жыхароў, з’яўляецца трэцім па колькасці насельніцтва і найменшым з трох каралеўскіх гарадоў даліны Катманду. Бхактапур азначае «горад вернікаў».\\nБхактапур размешчаны на рацэ Ханумантэ, як і Катманду, знаходзіцца ля падножжа Гімалаяў."},{"page_url":"https://vi.wikipedia.org/wiki/Urobatis_maculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Urobatis_maculatus_danzante.jpg","page_title":"Urobatis maculatus","context_page_description":"Urolophus maculatus là một loài cá trong họ Urotrygonidae. Đây là loài đặc hữu của México. Môi trường sống tự nhiên của nó là biển nông, bãi dưới triều, rạn san hô, cửa sông, đầm lầy gian triều, vụng biển. Nó bị đe dọa do mất môi trường sống."},{"page_url":"https://en.wikipedia.org/wiki/Leopoldine_von_Sternberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Portrait_of_Princess_Maria_Leopoldine_von_Liechtenstein%2C_n%C3%A9e_Countess_von_Sternberg_%281733-1809%29.jpg","page_title":"Leopoldine von Sternberg","context_page_description":"Leopoldine von Sternberg was a princess consort of Liechtenstein by marriage to Prince Franz Joseph I. She is noted to have belonged to the discussion circle of Eleonore of Liechtenstein, who acted as political advisers to Emperor Joseph II."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%A9%D7%99%D7%9E%D7%AA_%D7%94%D7%90%D7%99%D7%A8%D7%95%D7%A2%D7%99%D7%9D_%D7%95%D7%94%D7%9B%D7%A0%D7%A1%D7%99%D7%9D_%D7%A9%D7%9C_%D7%90%D7%A4%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Steve_Jobs_Theater_-_external.jpg","page_title":"רשימת האירועים והכנסים של אפל","context_page_description":"חברת אפל מכריזה על מוצרים חדשים, עיצוב מחודשים, שדרוגים ועדכונים למערכות הפעלה באמצעות מסיבות עיתונאים. לעיתים קרובות פרטי האירוע נשמרים בסוד כדי ליצור באזז שיווקי, ונחשפים רק במהלך האירוע עצמו. אירועים אלה מוזרמים בדרך כלל בשידור חי באתר האינטרנט של אפל."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%98%89%E8%AB%BE%E6%92%92%E9%86%AB%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Canossa_Hospital_%28Caritas%29.jpg","page_title":"嘉諾撒醫院","context_page_description":"嘉諾撒醫院是香港一所天主教醫院，位於香港島半山區舊山頂道1號與羅便臣道交界，近梅道一帶，現時屬香港明愛管轄。\\n嘉諾撒醫院由嘉諾撒仁愛女修會於1929年創立。現時的醫院大樓於1960年重建，佔地70,000平方呎，並提供病床160張。嘉諾撒醫院於1991年轉為香港明愛轄下機構。"},{"page_url":"https://en.wikipedia.org/wiki/Miriam_Adelson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Miriam_Adelson_June_2019.jpg","page_title":"Miriam Adelson","context_page_description":"Miriam Adelson is an Israeli American philanthropist and doctor. She married American business magnate Sheldon Adelson in 1991, and has since become a prominent Republican Party donor. She is the current publisher of the newspaper Israel Hayom. Miriam and Sheldon Adelson were presented with the Woodrow Wilson Award for Corporate Citizenship by the Woodrow Wilson International Center for Scholars of the Smithsonian Institution in 2008. In 2013, she received honorary citizenship of Jerusalem. She was awarded the Presidential Medal of Freedom in 2018."},{"page_url":"https://pl.wikipedia.org/wiki/Barbeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Casemate.png","page_title":"Barbeta","context_page_description":"Barbeta – nieruchoma, opancerzona, niska, cylindryczna osłona na okrętach wojennych, stanowiąca podstawę wieży artyleryjskiej, która obracała się na łożysku na barbecie. Barbeta chroniła mechanizmy i elementy mocowania dział, zwłaszcza przy większych kątach podniesienia lufy, gdy tylna część działa przemieszczała się w dół wewnątrz barbety. Chroniła również mechanizmy zasilania w amunicję oraz obsługę dział. Barbety stosowano przy działach większych kalibrów, przede wszystkim na dużych pancernych okrętach artyleryjskich – pancernikach i krążownikach.\\nSama koncepcja barbety została zaadaptowana do konstrukcji okrętów z fortyfikacji w latach 70. XIX wieku, najpierw na okrętach francuskich. Początkowo była to cylindryczna lub gruszkowatego kształtu osłona, nad którą wystawały nieosłonięte lufy dział i nie chroniła obsługi od góry przed odłamkami. W latach 80. XIX wieku przykryto barbety wieżami. W związku z zanikiem klas okrętów artyleryjskich, opancerzone barbety w konstrukcji okrętów również zanikły. Obecnie barbetą nazywa się nieopancerzoną osłonę podstawy wieży artyleryjskiej na okrętach."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Kladno","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Kladno_CZ_Town_Hall_01.jpg","page_title":"Liste der denkmalgeschützten Objekte in Kladno","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Kladno ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt."},{"page_url":"https://no.wikipedia.org/wiki/Jingguangbanen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Hankou-Dazhimen-Station-0237.jpg","page_title":"Jingguangbanen","context_page_description":"Jingguangbanen er en viktig hovedstrekning på jernbanenettet i Folkerepublikken Kina. Strekningen løper fra Vestbanegården i Beijing og sørover til Guangzhou i provinsen Guangdong.\\nJernbanelinjen består av to avsnitt. Det nordlige avsnittet, Jinghanbanen, går fra Beijing til Hankou, og det sørlige avsnittet, Wuguangbanen, fra Wuchang til Guangzhou. Hankou og Wuchang, som før var hver sin by, men nå er bydeler i Wuhan, ligger på hver sin side av elven Yangzi. Det var først i 1957 at de to jernbanestrekningene ble sammenknyttet da Yangtzebroen i Wuhan stod ferdig.\\nJingguangbanen knytter sammen Beijing og Guangzhou og strekker seg gjennom seks provinser, nemlig Beijing, Hebei, Henan, Hubei, Hunan og Guangdong. Lengden er 2324 kilometer. Det gjennomgående Jingjiu-toget mellom Beijing og Hongkong følger fremdeles denne banen, selv etter at Jingjiubanen ble åpnet.\\nDen 7. februar 1923 gikk jernbanearbeidere på Jinghanbanen til streik for sine rettigheter og i protest mot krigsherrenes brutalitet. Denne streiken fikk en viss betydning for det kinesiske kommunistpartis fremvekst."},{"page_url":"https://ca.wikipedia.org/wiki/Souvenir","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Souvenir.london.arp.750pix.jpg","page_title":"Souvenir","context_page_description":"Un souvenir és un record d'un lloc que s'emporta una persona que hi ha anat per fer turisme sota la forma d'un petit objecte. Cada indret turístic té els seus souvenirs, que han esdevingut part de la imatge de marca externa, com per exemple les miniatures de la Torre Eiffel de París, els soldadets de plom londinencs o les ballarines flamenques espanyoles.\\nEls souvenirs fan referència a monuments, paisatges o aspectes culturals propis de la regió que es visita i que sovint han esdevingut tòpics, ja que des de l'estranger s'identifica aquell indret amb aquella icona, fins i tot si no correspon a la realitat. Es basen en els estereotips i pretenen suscitar un record afectiu en la persona que els adquireix, d'aquí el seu nom.\\nEls souvenirs es poden vendre en botigues especialitzades, a la sortida de llocs emblemàtics, a les estacions i aeroports o dins els comerços tradicionals. Poden adoptar qualsevol forma però en general tenen un preu baix i estèticament se'ls associa a la tendència kitsch, com podria ser el cas dels anomenats souvenirs Gaudí.\\nEn el món japonès se'ls coneix com a omiyague."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%85%E0%A4%AB%E0%A4%BC%E0%A4%97%E0%A4%BC%E0%A4%BE%E0%A4%A8_%E0%A4%9A%E0%A4%B0%E0%A5%8D%E0%A4%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Afghan-Church%2C_Bombay-FV.jpg","page_title":"अफ़ग़ान चर्च","context_page_description":"चर्च सेंट जॉन इंजीलवादी, जिसे सामान्यतः अफ़ग़ान चर्च के नाम से जाना जाता है दक्षिणी मुम्बई में स्थित ईसाई चर्च है, जिसका निर्माण 1938 में प्रथम अफ़गान युद्ध की विनाशकारी हार के मृतकों की याद में ब्रिटेन द्वारा बनाया गया। चर्च मुम्बई के कोलाबा क्षेत्र के नेवी नगर में स्थित है।"},{"page_url":"https://fr.wikipedia.org/wiki/Centrale_de_chauffage_solaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Fernw%C3%A4rmespricher_Theiss.JPG","page_title":"Centrale de chauffage solaire","context_page_description":"Une centrale de chauffage solaire est une centrale solaire thermique basse température. Elle utilise l'énergie du rayonnement solaire afin de produire de l'eau chaude de manière centralisée, ensuite distribuée aux consommateurs via un réseau de chaleur. Cette chaleur peut répondre à des besoins de chauffage ou d'eau chaude sanitaire. Dans certains cas, la chaleur produite peut être utilisée pour des applications industrielles.\\nLes capteurs solaires thermiques utilisés sont généralement placés au sol ou sur un vaste toit et couvrent des surfaces qui peuvent être importantes.\\nLe Danemark est un des pays les plus en pointe sur ce type de techniques et possède de nombreuses centrales, mettant ainsi à profit son réseau de chaleur développé depuis les années 1970. En 2017, la plus grande centrale au monde, d'une superficie de 156 694 m², se situe dans ce pays, à Silkeborg, au centre du Jutland.\\nEn Europe, la première centrale a été construite en Suède en 1979 et a été démantelée depuis. En 2010, la plus vieille centrale toujours en activité date de 1985."},{"page_url":"https://de.wikipedia.org/wiki/Silesauridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/MEPAN_silezaur_rauizuch.jpg","page_title":"Silesauridae","context_page_description":"Die Silesauridae sind eine relativ diverse monophyletische Gruppe von mittelgroßen herbivoren oder omnivoren Vogellinien-Archosauriern aus der unmittelbaren Verwandtschaft der Dinosaurier. Sie lebten von der frühen Mittel- bis in die jüngere Obertrias im westlichen Teil des Superkontinentes Pangaea."},{"page_url":"https://fy.wikipedia.org/wiki/List_fan_huneb%C3%AAden_yn_Nederl%C3%A2n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Hunebed_D44_in-Westenesch_bij_Emmen.jpg","page_title":"List fan hunebêden yn Nederlân","context_page_description":"Hunebêdden binne prehistoryske megalityske bouwurken dy't op ferskate plakken yn Nederlân, Dútslân, Denemark en Skandinaavje fûn wurde kinne.\\nYn Nederlân stiene hunebêden yn de provinsjes Drinte, Grinslân en Oerisel. Hjoed de dei steane noch 53 derfân op harren orizjinele lokaasje: 52 yn Drinte, en ien yn Grinslân. In twadde Grinslanner hunebêd G5, dy't yn 1982 by Delfsyl fûn waard ûnder in terpke, is ôfbrutsen en wer opboud yn Aquariom yn Delfsyl.\\nHjirûnder folget in list fan hunebêden yn Nederlân."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%AF%CE%BF%CE%BD%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Schema_Saeulenordnungen.jpg","page_title":"Κίονας","context_page_description":"Ο κίονας ή κίων είναι κυκλικής διατομής, ορθό στοιχείο, μονολιθικό ή αποτελούμενο από τμήματα λίθου σε σχήμα κυλινδρικών τυμπάνων και χρησιμοποιείται στην αρχιτεκτονική και εν γένει στην οικοδομία ως υποστύλωμα. Συνήθως, αποτελείται από τη βάση, τον κορμό και το κιονόκρανο, ενώ η βάση απουσιάζει από τους δωρικούς κίονες."},{"page_url":"https://hu.wikipedia.org/wiki/Guadiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Afluentes_del_Guadiana.png","page_title":"Guadiana","context_page_description":"A Guadiana az Ibériai-félsziget egyik leghosszabb folyója.\\nSpanyolországban ered Toledótól légvonalban mintegy 81 km, közúton 100 km távolságra délre, a Sierra Morena lejtőin Villarrubia de los Ojos településnél, melytől közvetlenül nyugatra bele is ömlik Cigüela. A folyó Spanyolország délnyugati végén, a portugál határnál ömlik a tengerbe Huelva tartományban, e város közelében.\\nÉrdekesség, hogy Madridtól közúton csak 80 km távolságra, Tarancón közelében a Tajo egyik másodlagos mellékfolyójától, a Rió de la Vegától csak pár száz méterre ered a Riánsares, mely a Cigüela mellékfolyója, így tehát ezáltal már a Guadiana mellékfolyója."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%83%9D%E3%83%AC%E3%82%AA%E3%83%B33%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Napoleon_at_Fontainebleau%2C_31_March_1814_by_Paul_Hippolyte_Delaroche_%28Paris_1797-1856%29.jpg","page_title":"ナポレオン3世","context_page_description":"ナポレオン3世は、フランス第二共和政の大統領、のちフランス第二帝政の皇帝。本名はシャルル・ルイ＝ナポレオン・ボナパルトであり、皇帝に即位して「ナポレオン3世」を名乗る以前については一般にルイ・ナポレオンと呼ばれている。本項でもそのように記述するものとする。\\nナポレオン・ボナパルトの甥にあたり、1815年のナポレオン失脚後、国外亡命生活と武装蜂起失敗による獄中生活を送ったが、1848年革命で王政が消えるとフランスへの帰国が叶い、同年の大統領選挙でフランス第二共和政の大統領に当選した。第二共和政の大統領の権力は弱く、はじめ共和派、のち王党派が牛耳るようになった国民議会から様々な掣肘を受けたが、1851年に国民議会に対するクーデタを起こし、独裁権力を掌握。1852年に皇帝に即位して「ナポレオン3世」となり、第二帝政を開始した。1850年代は「権威帝政」と呼ばれる強圧支配を敷いたが、1860年代頃から「自由帝政」と呼ばれる議会を尊重した統治へと徐々に移行した。内政面ではパリ改造計画、近代金融の確立、鉄道網敷設などに尽くした。外交ではクリミア戦争によってウィーン体制を終焉させ、ヨーロッパ各地の自由主義ナショナリズム運動を支援することでフランスの影響力を拡大を図った。またアフリカ・アジアにフランス植民地を拡大させた。しかしメキシコ出兵の失敗で体制は動揺。1870年に勃発した普仏戦争でプロイセン軍の捕虜となり、それがきっかけで第二帝政は崩壊し、フランスは第三共和政へ移行した。\\n以降2020年現在までフランスは共和政であるため、彼がフランスにおける最後の君主にあたる。"},{"page_url":"https://it.wikipedia.org/wiki/Denali","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Mount_Mckinley_3D.gif","page_title":"Denali","context_page_description":"Il Denali è una montagna degli Stati Uniti situata in Alaska, che fa parte della grande catena dell'Alaska, un arco montuoso di 960 km che si estende attraverso la parte sudorientale dello stato: con i suoi 6190 metri d'altezza s.l.m, è la più alta del Paese e dell'intero continente nordamericano nonché la terza al mondo per prominenza."},{"page_url":"https://it.wikipedia.org/wiki/Ponti_sospesi_per_lunghezza_della_campata_principale","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Yangluo_Bridge_-_Wuhan%27s_5th_bridge_over_the_Yangtze_River.jpg","page_title":"Ponti sospesi per lunghezza della campata principale","context_page_description":"I ponti sospesi più lunghi del mondo sono qui ordinati secondo la lunghezza della campata principale, il più comune metodo con cui si confrontano le dimensioni dei ponti sospesi, che raggiungono le dimensioni maggiori rispetto a ponti costruiti secondo altri tipi di costruzione."},{"page_url":"https://fr.wikipedia.org/wiki/Saab_9-X_BioHybrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Saab_9-X_Air_010.JPG","page_title":"Saab 9-X BioHybrid","context_page_description":"La Saab 9-X BioHybrid est un concept car du constructeur automobile suédois Saab présenté au salon international de l'automobile de Genève de 2008.\\nLe projet devait définir une automobile compacte Saab en phase avec l'atmosphère écologiste et les attentes technologiques contemporaines. Le concept s'orienta rapidement vers une voiture à motorisation hybride, optimisée pour le biocarburant et compatible avec la norme technologique multimédia de l'époque, en plus d'intégrer les caractéristiques de l'image de marque Saab, à savoir une étude aérodynamique poussée, une conduite sécurisante et la présence d'un turbo."},{"page_url":"https://es.wikipedia.org/wiki/Cividade","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Capela_da_Nossa_Senhora_da_Torre_Braga.jpg","page_title":"Cividade","context_page_description":"Cividade es una freguesia portuguesa perteneciente al concelho de Braga. Posee un área de 0,28 km² y una población total de 1884 habitantes. La densidad poblacional asciende a 6728,6 hab/km². Situada en la colina homónima, en el corazón de Braga, esta freguesia coincide con el centro de Bracara Augusta. Posee un importante patrimonio arqueológico.\\nDatos: Q1094465\\nMultimedia: Cividade"},{"page_url":"https://ca.wikipedia.org/wiki/Artigas_(Aude)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Artigues%2C_Aude%2C_General_View.JPG","page_title":"Artigas (Aude)","context_page_description":"Artigues és un municipi francès, situat al departament de l'Aude i a la regió d'Occitània."},{"page_url":"https://jv.wikipedia.org/wiki/Lassi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bhang_shop_in_Jaisalmer%2C_Rajasthan%2C_India.jpg","page_title":"Lassi","context_page_description":"Lassi ya iku ombèn-ombèn moncèr tradhisional adhédhasar yogurt sing asalé saka anak bawana India. Lassi digawé saka campuran yogurt, banyu, bumbon, lan sok-sokan dikèki woh-wohan."},{"page_url":"https://pt.wikipedia.org/wiki/Rarotonga","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Rarotonga.jpg","page_title":"Rarotonga","context_page_description":"Rarotonga é a maior das Ilhas Cook do sul. Tem origem vulcânica e fica localizada no Oceano Pacífico sul e a nordeste da Nova Zelândia. É a mais populosa das Ilhas Cook com 14153 habitantes.\\nA capital das Ilhas Cook, Avarua está situada no norte desta ilha, assim como o aeroporto internacional. Rarotonga é um destino turístico muito popular, com muitos resorts, hotéis e motéis."},{"page_url":"https://de.wikipedia.org/wiki/Walla_Walla_(Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Klimadiagramm-metrisch-deutsch-Walla-Walla-USA.png","page_title":"Walla Walla (Washington)","context_page_description":"Walla Walla ist eine Stadt im Südosten des US-Bundesstaates Washington, am Nordwestabfall der Blue Mountains, unweit der Grenze zu Oregon. Zum Zeitpunkt des United States Census 2010 lebten 31.731 Menschen in der Stadt. Walla Walla ist Hauptort des gleichnamigen Countys."},{"page_url":"https://et.wikipedia.org/wiki/Po","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/LocationPoRiver.PNG","page_title":"Po","context_page_description":"Po on Itaalia pikim jõgi.\\nPo pikkus on 652 km, suurim laius 503 m. Jõe keskmine vooluhulk on 1540 m³/s. Tema valgla suurus on 74 000 km², millest 70 000 km² asub Itaalias. Po valgla piir moodustab suure osa Itaalia piirist Prantsusmaa ja Šveitsiga.\\nPo algab Piemontest Cotti Alpidest Monte Viso jalamilt. Ülemjooksul voolab ta mägijõena itta. Mägedest Lombardia madalikule laskunud, pöördub ta põhja, ühinedes vasakpoolse lisajõe Pellice ning parempoolsete lisajõgede Varaita ja Mairaga. Seejärel voolab ta läbi Moncalieri ja Torino, mis väga lähestikku paiknevad. Torinos suubub temasse vasakult Dora Riparia. Seejärel pöördub ta kirdesse ja Chivassos, kus temasse vasakult suubub Orco, itta ning voolab selles suunas kuni suudmeni. Ta voolab läbi Casale ja Valenza. Nende vahel suubub temasse vasakult Sesia, mida mööda kulgeb Piemonte ja Lombardia piir. Pärast Valenzat suubuvad Posse paremalt Tanaro ja Scrivia. Sesia ja Scrivia suudme vahel on Po Piemonte ja Lombardia piiriks. Seejärel, juba Lombardias, suubuvad Posse vasakult Agogna ja Ticino jõgi ning pärast Casteli linna vasakult Lambro ja paremalt Trebbia."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%81%D8%B7_%D8%B1%D9%85%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Athabasca_Oil_Sands_map.png","page_title":"نفط رملي","context_page_description":"النفط الرملي أو الرمال النفطية أو الرمال القطرانية هو نوع من ترسبات البتومين. وهو مزيج طبيعي من الرمال أو الطين والمياه ونوع كثيف ولزج من النفط يعرف بالبتومين. وهو موجود في أماكن مختلفة من العالم إلا أنه موجود بكميات تجارية ضخمة في كندا وفنزويلا\\n.\\nيعّرَف النفط الرملي بأنه غير معتاد أو خام «بتوميت» للتفريق بينه وبين النفط الخام الطبيعي المستخرج من الآبار النفطية. وأصبح يُعد في الفترة الأخيرة من احتياطي النفط العالمي نظرا لارتفاع أسعار النفط وتدني كلفة استخراجه وتكريره باستعمال تقنيات جديدة مما جعله مربحا تجارياً."},{"page_url":"https://pl.wikipedia.org/wiki/Jaskinia_na_Mi%C5%82asz%C3%B3wce","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Jaskinia_na_Mi%C5%82asz%C3%B3wce_plan.jpg","page_title":"Jaskinia na Miłaszówce","context_page_description":"Jaskinia na Miłaszówce – jaskinia znajdująca się w prawych zboczach Doliny Mnikowskiej na terenie wsi Mników, w powiecie krakowskim, w województwie małopolskim w województwie małopolskim, w powiecie krakowskim, w gminie Liszki. Pod względem geograficznym jest to obszar Garbu Tenczyńskiego w obrębie Wyżyny Krakowsko-Częstochowskiej."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BD%CF%85%CF%88%CF%89%CF%84%CE%AE%CF%81%CE%B1%CF%82_%CF%80%CF%81%CE%B1%CE%B3%CE%BC%CE%AC%CF%84%CF%89%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/18_03_120_toombs.jpg","page_title":"Ανυψωτήρας πραγμάτων","context_page_description":"Ο ανυψωτήρας πραγμάτων είναι ένας μικρός ανελκυστήρας που προορίζεται να μεταφέρει αντικείμενα και όχι ανθρώπους. Τέτοιου είδους ανυψωτήρες που βρίσκονται μέσα σε σύγχρονες κατασκευές, συμπεριλαμβανομένων εμπορικών, δημόσιων και ιδιωτικών κτιρίων, συχνά συνδέονται μεταξύ πολλαπλών ορόφων. Όταν εγκαθίστανται σε εστιατόρια, σχολεία, νοσοκομεία, σπίτια συνταξιοδότησης ή σε ιδιωτικές κατοικίες, συνήθως καταλήγουν σε μια κουζίνα.\\nΟ όρος φαίνεται να έχει γίνει γνωστός στις Ηνωμένες Πολιτείες τη δεκαετία του 1840, μετά από το μοντέλο των προηγούμενων \\"ανυψωτήρων πραγμάτων\\" που τώρα είναι γνωστοί ως δίσκοι περιστρεφόμενοι και σερβιρίσματος για την διανομή τροφίμων. Ο μηχανικός ανυψωτήρας πραγμάτων επινοήθηκε από τον Τζορτζ Κάννον, εφευρέτη της Νέας Υόρκης. Ο Κάννον καταχώρησε για πρώτη φορά το δίπλωμα ευρεσιτεχνίας ενός συστήματος φρένων το οποίο θα μπορούσε να χρησιμοποιηθεί για έναν ανυψωτήρας πραγμάτων στις 6 Ιανουαρίου 1883. Ο Κάννον υπέβαλε αργότερα το δίπλωμα ευρεσιτεχνίας για τον μηχανικό ανυψωτήρα πραγμάτων στις 17 Φεβρουαρίου 1887. Σύμφωνα με πληροφορίες, Ο Κάννον παρήγαγε ένα τεράστιο ποσό δικαιωμάτων από τα διπλώματα ευρεσιτεχνίας ανυψωτήρων πραγμάτων έως τον θάνατό του το 1897."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%89._%D8%AC%D9%8A%D9%87._%D9%83%D8%A7%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/T._J._Carrie.JPG","page_title":"تى. جيه. كارى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتى. جيه. كارى لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B0%E0%B4%BE%E0%B4%9C%E0%B5%80%E0%B4%B5%E0%B5%8D_%E0%B4%97%E0%B4%BE%E0%B4%A8%E0%B5%8D%E0%B4%A7%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Rajiv_Gandhi_%281987%29.jpg","page_title":"രാജീവ് ഗാന്ധി","context_page_description":"രാജീവ് രത്ന ഗാന്ധി ഇന്ത്യയുടെ ആറാമത്തെ പ്രധാനമന്ത്രിയായിരുന്നു. ഫിറോസ് ഗാന്ധിയുടെയും ഇന്ദിരാ ഗാന്ധിയുടേയും മൂത്ത മകനായ രാജീവ്, നാല്പതാമത്തെ വയസ്സിൽ പ്രധാനമന്ത്രി സ്ഥാനത്തെത്തി. ഇന്ത്യയിലെ ഏറ്റവും പ്രായം കുറഞ്ഞ പ്രധാനമന്ത്രി എന്ന നേട്ടം കൈവരിച്ചു. മരണാനന്തരം 1991 ൽ രാജ്യം ഒരു പൗരനു നൽകുന്ന പരമോന്നത ബഹുമതിയായ ഭാരതരത്ന പുരസ്കാരം നൽകി ആദരിച്ചു.\\nകേംബ്രിഡ്ജിലെ ട്രിനിറ്റി കോളേജിലും, ലണ്ടനിലെ ഇംപീരിയൽ കോളേജിലുമായി പഠനം നടത്തിയെങ്കിലും ബിരുദം പൂർത്തിയാക്കാൻ കഴിഞ്ഞിരുന്നില്ല. കേംബ്രിഡ്ജിലെ പഠനസമയത്ത് പരിചയപ്പെട്ട ഇറ്റാലിയൻ വംശജയായ സോണിയാ മൈനോ എന്ന പെൺകുട്ടിയെ പിന്നീട് വിവാഹം കഴിച്ചു. പിന്നീട് രാജീവ് ഇന്ത്യൻ എയർലൈൻസിൽ വൈമാനികനായി ഉദ്യോഗത്തിൽ ചേർന്നു. നെഹ്രു കുടുംബത്തിന്റെ രാഷ്ട്രീയത്തിൽ രാജീവ് തീരെ തൽപ്പരനായിരുന്നില്ല. എന്നാൽ സഞ്ജയ് ഗാന്ധിയുടെ മരണത്തോടെ രാജീവ് പൊതുരംഗത്തേക്ക് വരികയുണ്ടായി. ഇന്ദിരയുടെ മരണത്തോടെ രാജീവിനെ കോൺഗ്രസ് നേതൃത്വം പ്രധാനമന്ത്രി സ്ഥാനത്തേക്ക് നാമനിർദ്ദേശം ചെയ്തു.\\n1984 ലെ പൊതു തിരഞ്ഞെടുപ്പിൽ ഇന്ത്യൻ പാർലിമെന്റ് കണ്ട ഏറ്റവും വലിയ ഭൂരിപക്ഷത്തിൽ ഇന്ത്യൻ നാഷണൽ കോൺഗ്രസ്സിനെ രാജീവ് അധികാരത്തിലെത്തിച്ചു. മത്സരിച്ച 491 ൽ 404 സീറ്റുകൾ കരസ്ഥമാക്കിയാണ് അത്തവണ കോൺഗ്രസ്സ് വിജയിച്ചത്. രാജീവിന്റെ നേതൃത്വത്തിൽ ഇന്ത്യയിൽ ഒട്ടനവധി നവീന പദ്ധതികൾ നടപ്പിലാക്കുകയുണ്ടായി."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%BF%84%E8%AA%9E%E5%9C%B0%E7%90%86%E5%88%86%E4%BD%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Russian_ex-USSR_2004.PNG","page_title":"俄語地理分佈","context_page_description":"俄语地理分布，俄语遍及于俄罗斯领土，1917年俄罗斯帝国灭亡，苏联成立，部分前帝俄属地，例如波兰、芬兰、爱沙尼亚、拉脱维亚、立陶宛及卡尔斯州都展开了去俄语化运动。\\n苏联前期一度采取本土化政策试图逆转帝俄时期各地的俄罗斯化进程。1930年代，斯大林上台后开始取消本土化政策，事实上实行俄化政策，最终使俄语于1990年法律上成为苏联所有加盟国的官方语言，但同时各加盟国亦保留了继续使用当地语言作为额外官方语言的权力。\\n1991年苏联瓦解，有多达2500万的俄裔分布在俄罗斯联邦之外的其他苏联加盟国，约占前苏联俄罗斯人的六分之一，或除俄罗斯之外各加盟国总人口的十分之一。这些俄裔中的很多人由于族群冲突而沦为难民。"},{"page_url":"https://en.wikipedia.org/wiki/Richard_Casey,_Baron_Casey","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Coat_of_Arms_of_Richard_Casey%2C_Baron_Casey%2C_KG%2C_GCMG%2C_CH%2C_DSO%2C_MC%2C_PC.png","page_title":"Richard Casey, Baron Casey","context_page_description":"Richard Gavin Gardiner Casey, Baron Casey KG, GCMG, CH, DSO, MC, PC was an Australian statesman who served as the 16th Governor-General of Australia, in office from 1965 to 1969. He was also a distinguished army officer, long-serving cabinet minister, Ambassador to the United States, member of Churchill's War Cabinet, and Governor of Bengal.\\nCasey was born in Brisbane, but moved to Melbourne when he was young. He studied engineering at the University of Melbourne and then went on to Trinity College, Cambridge. In 1914, Casey enlisted as a lieutenant in the Australian Imperial Force. He saw service in the Gallipoli Campaign and on the Western Front, reaching the rank of major and winning the Distinguished Service Order and the Military Cross before becoming a Chief Intelligence Officer in 1920. Casey joined the Australian public service in 1924 to work at Whitehall as a liaison officer with the British administration. He reported directly to the prime minister, Stanley Bruce, with whom he developed a close relationship.\\nIn 1931, Casey was elected to federal parliament for the United Australia Party."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%A7%D9%85%D8%B3%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/LaMassana_01.jpg","page_title":"لامسانا","context_page_description":"لامسانا النطق الكاتالاني, locally; هي أحد أبرشيات أندورا السبعة. كما أنها اسم لأكبر بلدات الأبرشية. أشتق اسم الأبرشية من اسم لاتني يعني التفاح. تقع الأبرشية على منطق جبلية بامتياز وفيها أعلى جبل في أندورا كلها وهو جبل كم بيدروسا. تملك الأبرشية حدودا مع كلا من فرنسا وإسبانيا. تملك الأبرشية مساحة 65 كيلوا مترا، منها 262 هكتار (650 أكر) أراضي زراعية اي 14% من مجموع مساحة أندورا كلها. جبل كم بيدروسا هو أعلى جبل في أندورا كلها حيث يبلغ ارتفاعه 2,942 متر. تملك الأبرشية ثلاث أنهار رئيسية منها جران فاليرا. تعتبر الأبرشية معلم سياحي في أندورا كما أنها تعتمد عليه في اقتصادها."},{"page_url":"https://fr.wikipedia.org/wiki/Oxyde_de_m%C3%A9sityle","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Mesityl-oxide-3D-balls.png","page_title":"Oxyde de mésityle","context_page_description":"L'oxyde de mésityle est un composé organique de formule semi-développée CH₃CCH=C(CH₃)₂. Cette cétone α, β-insaturée est un composé liquide incolore volatile avec une forte odeur d'urine de chat."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_culturels_d%27importance_nationale_dans_le_canton_de_Zurich","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Universit%C3%A4t_Z%C3%BCrich_-_Biologisches_Institut_%26_Zoologisches_Museum_2011-08-06_18-23-20_ShiftN.jpg","page_title":"Liste des biens culturels d'importance nationale dans le canton de Zurich","context_page_description":"Cette liste présente les biens culturels d'importance nationale dans le canton de Zurich. Cette liste correspond à l'édition 2009 de l'Inventaire Suisse des biens culturels d'importance nationale pour le canton de Zurich. Il est trié par commune et inclus : 204 bâtiments séparés, 66 collections, 50 sites archéologiques et trois cas particuliers."},{"page_url":"https://it.wikipedia.org/wiki/Centostazioni","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Novara-Stazione_FS-DSCF0912.JPG","page_title":"Centostazioni","context_page_description":"Centostazioni S.p.A. era una società per azioni nata per riqualificare, valorizzare e gestire 103 stazioni italiane, con azionista di maggioranza Ferrovie dello Stato Italiane; il 15 novembre 2016 divenne al 100% di Ferrovie dello Stato in seguito al riacquisto delle azioni. Il 16 luglio 2018 è stata fusa in RFI."},{"page_url":"https://is.wikipedia.org/wiki/Madison_Square_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/MSG_Messier_Night.jpg","page_title":"Madison Square Garden","context_page_description":"Madison Square Garden er mannvirki á í mið-Manhattan í New York sem er notað fyrir íþróttaviðburði eins og körfubolta, íshokkí og hnefaleika. Ennfremur er það til dæmis notað fyrir tónleika, sýningar og sirkusa. Íshokkíliðið New York Rangers og körfuboltaliðið New York Knicks eiga sinn heimavöll í MSG. Það er nefnt eftir James Madison, fjórða forseta Bandaríkjanna og er elsta stóra íþróttamannvirki New York-borgar. 320 viðburðir eru þar á ári að meðaltali og komast tæp 20.000 manns þar fyrir.\\nFyrstu tvö mannvirkin sem hétu nafninu Madison Square Garden voru byggð árið 1879 and 1890 og voru staðsett á Madison-torgi. Þriðja samnefnt mannvirki var byggt árið 1925 á horni 8. breiðgötu og 50. strætis. Mannvirkið sem stendur núna er á horni 5. breiðgötu og Broadway og var reist fyrst árið 1968. Endurbætur voru gerðar 1989-1991 og 2011-2013."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_rektor%C5%AF_Masarykovy_univerzity","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Prof._PhDr._Petr_Fiala%2C_Ph.D.%2C_LL.M..jpg","page_title":"Seznam rektorů Masarykovy univerzity","context_page_description":"Toto je chronologický seznam rektorů Masarykovy univerzity se sídlem v Brně, která byla založena v roce 1919."},{"page_url":"https://no.wikipedia.org/wiki/MS_%C2%ABTonjer%C2%BB_(1953)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Haugesund_-_no-nb_digifoto_20150121_00155_NB_MIT_FNR_19560.jpg","page_title":"MS «Tonjer» (1953)","context_page_description":"MS «Tonjer» var i perioden 1953-1969 et lokalrutebåt tilhørende Haugesund Dampskibsselskab, Haugesund."},{"page_url":"https://la.wikipedia.org/wiki/Stetten_(Rhenus_Superior)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Stetten%2C_Mairie.jpg","page_title":"Stetten (Rhenus Superior)","context_page_description":"Stetten est commune Francicum 338 incolarum praefecturae Rheni Superioris in regione orientali Alsatia."},{"page_url":"https://es.wikipedia.org/wiki/Tonnay-Boutonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Map_commune_FR_insee_code_17448.png","page_title":"Tonnay-Boutonne","context_page_description":"Tonnay-Boutonne es una población y comuna francesa, situada en la región de Poitou-Charentes, departamento de Charente Marítimo, en el distrito de Saint-Jean-d'Angély y cantón de Tonnay-Boutonne."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B2%BD%EB%A7%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Horse-racing-1.jpg","page_title":"경마","context_page_description":"경마는 기수와 말이 일정한 구간을 달려서 순위를 겨루는 스포츠이다.\\n일반적 의미: 연령, 성별, 경주거리, 부담중량, 상금 등 정해진 조건하에서 2두 이상의 말을 달리게 하여 승부를 겨루는 경기에 고객이 돈을 걸고 즐기는 성인 레저이다.\\n법률적 의미: 기수가 기승한 말의 경주에 승마투표권을 발매하고 승마 적중자에게 환급금을 교부하는 행위를 말한다.\\n별명은 ‘왕들의 스포츠’.\\n일반적으로 경마장에서 개최된다. 개개 경기를 경주라고 부르며, 하루동안 여러 차례의 경주가 벌어진다. 경주에서는 일반적으로 기수가 말을 타고 일정한 거리를 달려, 가장 빨리 결승선에 도달한 말을 승리한 말로 한다. 결승지점에 도달한 것은 일반적으로 말의 코끝이 결승선을 통과했을 때로 본다."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_Th%C3%A9%C3%A2tre_(Bordeaux)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Assemb%C3%A9e_Bordeaux_mars_1871.jpg","page_title":"Grand Théâtre (Bordeaux)","context_page_description":"Le Grand Théâtre de Bordeaux, commandé par le maréchal de Richelieu, gouverneur de Guyenne, et édifié par l'architecte Victor Louis, a été inauguré le 7 avril 1780 avec la représentation de l'Athalie de Jean Racine.\\nClassé monument historique en 1899, réminiscence de l'Antiquité par son péristyle, l'ouvrage de 88 mètres sur 47 de style néo-classique, s'inscrit dans l'opulent urbanisme bordelais hérité du siècle des Lumières.\\nIl abrite une salle de spectacle d'un millier de places, exemple parfait de théâtre à l'italienne.\\nAprès plus de deux cents ans d'usages divers ou de transformations successives de ses salles comme de son environnement, il a retrouvé, à la fois sa décoration intérieure bleue, or et marbre blanc d'origine à l'occasion de sa dernière restauration en 1991 et sa perspective de temple des muses avec l'aménagement de la place de la Comédie et du cours du Chapeau-Rouge en 2006.\\nLe Grand Théâtre est aujourd'hui le siège de l'Opéra national de Bordeaux qui y programme sa saison lyrique et les représentations du Ballet de l'Opéra."},{"page_url":"https://sco.wikipedia.org/wiki/Lauren_Bacall","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Lauren_Bacall_1945_%28cropped%29.jpg","page_title":"Lauren Bacall","context_page_description":"Lauren Bacall wis an American movie, radio an stage actress an model. Weel kent for her deep vyce, Bacall startit actin durin the 1940s until her daith. She haes haed big roles in movies lik The Big Sleep an Dark Passage.\\nAwtho weel kent as an actress hersel, she an aa haed fame as bein the fowert wife o actor Humphrey Bogart. Thay stayit marrit until Bogart deit in 1957 an haed a son; Stephen an a dochter, Leslie. Bacall marrit Jason Robards in 1961, an aa an actor. Thay haed ane son, Sam, an divorcit in 1969.\\nBacall's first cousin wis Shimon Peres, that is the umwhile Prime Meenister an Preses o Israel.\\nBacall deit in New York Ceety, New York frae a massive stroke, agit 89."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_lieux_patrimoniaux_de_Qu%C3%A9bec","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Quartier_g%C3%A9n%C3%A9ral_du_35e_Groupe-brigade_du_Canada%2C_Qu%C3%A9bec.jpg","page_title":"Liste des lieux patrimoniaux de Québec","context_page_description":"Cet article recense les lieux patrimoniaux de Québec inscrit au répertoire des lieux patrimoniaux du Canada, qu'ils soient de niveau provincial, fédéral ou municipal.\\nPour le reste de la région, voir Liste des lieux patrimoniaux de la Capitale-Nationale.\\nSont inclus dans cette liste — et en sont par ailleurs extraits — les bâtiments de la Citadelle de Québec."},{"page_url":"https://it.wikipedia.org/wiki/Cooper_T51","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/1959_Cooper_Climax_T51_Goodwood%2C_2009.JPG","page_title":"Cooper T51","context_page_description":"La Cooper-Climax T51 è una vettura da Formula 1 realizzata dalla Cooper Car Company nel 1959 e che gareggiò nel campionato medesimo; partecipò anche l'anno successivo divenendo la prima monoposto di Formula 1 ad esporre uno sponsor, ovvero il marchio della Yeoman Credit Racing."},{"page_url":"https://en.wikipedia.org/wiki/Christian_VII_of_Denmark","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Christian_VII_of_Denmark.jpg","page_title":"Christian VII of Denmark","context_page_description":"Christian VII was a monarch of the House of Oldenburg who was King of Denmark–Norway and Duke of Schleswig and Holstein from 1766 until his death in 1808. For his motto he chose: \\"Gloria ex amore patriae\\".\\nChristian VII's reign was marked by mental illness and for most of his reign Christian was only nominally king. His half-brother Frederick was designated as regent of Denmark in 1772. From 1784 until Christian VII's death in 1808, Christian's son, later Frederick VI, acted as unofficial regent."},{"page_url":"https://ro.wikipedia.org/wiki/Croke_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Croke_Park_Stadium_from_the_Royal_Canal_-_geograph.org.uk_-_395735.jpg","page_title":"Croke Park","context_page_description":"Croke Park este un stadion din Dublin, Irlanda. Adesea numit Croker de către fani, el este principalul stadion și sediul Gaelic Athletic Association.\\nÎncepând cu 1884 el este utilizat de GAA pentru a găzdui jocuri galice"},{"page_url":"https://en.wikipedia.org/wiki/Susan_M._Gaines","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/SMGaines.jpg","page_title":"Susan M. Gaines","context_page_description":"Susan M Gaines is an American writer. She is the author of the novels Accidentals and Carbon Dreams, and co-author with Geoffrey Eglinton and Jurgen Rullkötter of the science book Echoes of Life: What Fossil Molecules Reveal about Earth History. Her short stories have been nominated twice for the Pushcart Prize. She is a former fellow of the Hanse Institute for Advanced Study in Germany. In 2018, she was awarded a Suffrage Science Award for women in science and science writers who have inspired others."},{"page_url":"https://la.wikipedia.org/wiki/Daniel_Heinsius","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Daniel_Heinsius_-_Imagines_philologorum.jpg","page_title":"Daniel Heinsius","context_page_description":"Daniel Heinsius fuit humanista et bibliothecarius Academiae Lugduno-Batavae."},{"page_url":"https://sv.wikipedia.org/wiki/Svenska_Ords_skrivstuga","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Svenska_Ords_skrivstuga%2C_jan_2019.jpg","page_title":"Svenska Ords skrivstuga","context_page_description":"Svenska ords skrivstuga ligger i kvarteret Flintan i parken Vita bergen på Södermalm i Stockholm. Det lilla trähuset från 1700-talet var under många år Hans Alfredsons och Tage Danielssons författarstuga. Fastigheten ägs av AB Stadsholmen och är blåmärkt av Stadsmuseet i Stockholm, vilket innebär \\"att bebyggelsen bedöms ha synnerligen höga kulturhistoriska värden\\"."},{"page_url":"https://it.wikipedia.org/wiki/Fiat_Punto_(2012)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Fiat_Punto_2012_5door_front.JPG","page_title":"Fiat Punto (2012)","context_page_description":"La Fiat Punto è un'autovettura di tipo utilitaria, prodotta dalla casa automobilistica italiana FIAT e commercializzata in Europa dal 2012 al 2018. Si tratta di un modello concepito per sostituire, a partire dall'anno di commercializzazione, altri due modelli della casa torinese: la Grande Punto e la Punto Evo."},{"page_url":"https://en.wikipedia.org/wiki/Limberg_(Wiehen_Hills)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Panorama_Limberg_from_Auetal.jpg","page_title":"Limberg (Wiehen Hills)","context_page_description":"The Limberg is a hill in the Egge, a side ridge of the Wiehen Hills, south of Preußisch Oldendorf in the German state of North Rhine-Westphalia. The ruins of Limberg Castle are located on the hillside."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%92%E1%83%A0%E1%83%9D%E1%83%90%E1%83%98%E1%83%A0%E1%83%90%E1%83%A1%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Bandeira_do_Munic%C3%ADpio_de_Groa%C3%ADras.jpg","page_title":"გროაირასი","context_page_description":"გროაირასი — მუნიციპალიტეტი ბრაზილიაში, სეარის შტატში. მდებარეობს ქვეყნის ჩრდილო-აღმოსავლეთ რეგიონში. მიეკუთვნება სეარის შტატის ჩრდილო-დასავლეთ მეზორეგიონს.\\n2010 წლის მონაცემებით, მოსახლეობა 10 228 ადამიანს შეადგენდა. ფართობი 155.963 კმ²-ია. მოსახლეობის სიმჭიდროვე 65.58 კმ²-ზე."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%8E%A5%E9%A7%81%E5%B7%B4%E5%A3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/TYBus_THSR_Taoyuan_Station_Shuttle_767FD_with_LED_on.jpg","page_title":"接駁巴士","context_page_description":"接驳巴士，又称穿梭巴士，指在特定地点之间往来接送乘客的巴士。一般常见的有机场与市区各旅馆间的接驳巴士、铁路车站与临近商场、景点或社区间的接驳巴士。"},{"page_url":"https://ceb.wikipedia.org/wiki/Ansonia_rubigina","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Ghatophryne_rubigina_3.jpg","page_title":"Ansonia rubigina","context_page_description":"Espesye sa baki ang Ansonia rubigina. Una ning gihulagway ni Pillai ug Pattabiraman ni adtong 1981. Ang Ansonia rubigina sakop sa kahenera nga Ansonia sa kabanay nga Bufonidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%81%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%BF%E0%AE%B0%E0%AE%AE%E0%AE%A3%E0%AE%BF%E0%AE%AF_%E0%AE%AA%E0%AE%BE%E0%AE%B0%E0%AE%A4%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/%E0%AE%AA%E0%AF%81%E0%AE%A4%E0%AF%81%E0%AE%B5%E0%AF%88%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D_%E0%AE%AE%E0%AE%95%E0%AE%BE%E0%AE%95%E0%AE%B5%E0%AE%BF_%E0%AE%AA%E0%AE%BE%E0%AE%B0%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE%E0%AE%B0%E0%AF%8D_%E0%AE%B5%E0%AE%BE%E0%AE%B4%E0%AF%8D%E0%AE%A8%E0%AF%8D%E0%AE%A4_%E0%AE%87%E0%AE%B2%E0%AF%8D%E0%AE%B2%E0%AE%AE%E0%AF%8D.JPG","page_title":"சுப்பிரமணிய பாரதி","context_page_description":"சின்னசுவாமி சுப்பிரமணிய பாரதி ஒரு கவிஞர், எழுத்தாளர், பத்திரிக்கையாசிரியர், விடுதலைப் போராட்ட வீரர் மற்றும் சமூக சீர்திருத்தவாதி ஆவார். இவரைப் பாரதியார் என்றும் மகாகவி என்றும் அழைக்கின்றனர். பாரதி, தமிழ்க் கவிதையிலும் உரைநடையிலும் சிறப்பான புலமை கொண்டு, நவீனத் தமிழ்க் கவிதைக்கு முன்னோடியாகத் திகழ்ந்தார். தமிழ், தமிழர் நலன், இந்திய விடுதலை, பெண் விடுதலை, சாதி மறுப்பு, பல்வேறு சமயங்கள் குறித்து கவிதைகளும் கட்டுரைகளும் எழுதியுள்ளார். தம் எழுத்துகள் மூலமாக மக்கள் மனதில் விடுதலை உணர்வை ஊட்டியவர். எட்டப்ப நாயக்கர் மன்னர் இவருடைய கவித்திறனை மெச்சி, கலைமகள் எனப் பாெருள்படும் பாரதி என்ற பட்டம் வழங்கினார். பாரதியாரின் நூல்கள் தமிழ்நாடு மாநில அரசினால் 1949 ஆம் ஆண்டில் நாட்டுடைமை ஆக்கப்பட்டன. இந்தியாவிலேயே முதன்முதலாக நாட்டுடைமையாக்கப்பட்ட இலக்கியம் பாரதியாருடையதாகும்.\\nபாரதி, இந்திய வரலாற்றின் திருப்பங்கள் நிறைந்த காலகட்டத்தில் வாழ்ந்தவர். பால கங்காதர திலகர், உ. வே. சாமிநாதையர், வ. உ. சிதம்பரம் பிள்ளை, மகான் அரவிந்தர் முதலியோர் இவரின் சமகாலத்தைய மனிதர்கள் ஆவர். இவர் விவேகானந்தரின் மாணவியான சகோதரி நிவேதிதையை தமது குருவாகக் கருதினார்."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_los_Shirvanshah","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Palacio_de_los_Shirvanshah%2C_Baku%2C_Azerbaiy%C3%A1n%2C_2016-09-26%2C_DD_162-164_HDR.jpg","page_title":"Palacio de los Shirvanshah","context_page_description":"El Palacio de los Shirvanshahs es el mayor monumento de la rama Shirvan-Absheron de la arquitectura de Azerbaiyán, situado en la Ciudad Interior de Bakú. El complejo contiene el principal edificio del palacio, Divankhane, las criptas de enterramiento, la mezquita del shah con un minarete, el mausoleo de Seyid Yahya Bakuvi, un portal en el este - la puerta de Murad, una presa y los restos de la casa de baños.\\nEl palacio, junto con la Torre de la Doncella y el resto de recinto amurallado de Bakú fue inscrito como Patrimonio de la Humanidad de la Unesco en 2000.​\\nEl palacio está representado en el anverso del billete de 10.000 manat de 1994-2006, ​ y del billete de 10 manat emitidos desde 2006.​"},{"page_url":"https://id.wikipedia.org/wiki/Stryker","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/US_Navy_070801-N-4965F-006_U.S._Army_Stryker%27s_attached_to_the_2nd_Stryker_Brigade_Combat_Team_%282SBCT%29_are_staged_on_the_kilo_piers_of_the_Fleet_Industrial_Supply_Center_at_Naval_Station_Pearl_Harbor.jpg","page_title":"Stryker","context_page_description":"Stryker adalah kendaraan lapis baja pertama yang diperkenalkan ke dalam layanan Angkatan Darat Amerika Serikat sejak tahun 1980. Kendaraan serbaguna ini dapat digunakan baik sebagai pembawa infanteri atau sistem senjata mobile bersenjata dengan meriam 105 mm. Dengan kecepatan tertinggi 62 mph dan kemampuan untuk membawa sembilan tentara ditambah awak, kendaraan segala medan menyediakan baik membawa pasukan yang sangat mobile maupun senjata yang kuat di lingkungan pertempuran melawan teror.\\nDengan kemampuan diterbangkan oleh C-130 Hercules, Stryker dapat mencapai zona tempur jauh lebih cepat daripada tank Abrams, yang telah dikritik karena terlalu berat dan tidak mampu mengatasi situasi off-road. Stryker telah beraksi di Irak dan Afghanistan, dan lebih dari 2.400 telah dikontrak untuk dibangun."},{"page_url":"https://en.wikipedia.org/wiki/Widdringtonia_schwarzii","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Widdringtonia_schwarzii_kz1.jpg","page_title":"Widdringtonia schwarzii","context_page_description":"Widdringtonia schwarzii is a species of Widdringtonia native to South Africa, where it is endemic to the Baviaanskloof and Kouga Mountains west of Port Elizabeth in Eastern Cape Province; it occurs on dry rocky slopes and crags at 600-1,200 m altitude. It is threatened by habitat loss, particularly by wildfire. The Willowmore cypress is a protected tree in South Africa.\\nIt is a medium-sized evergreen tree growing to 20–25 m tall. The leaves are scale-like, 1.5 mm long and 1 mm broad on small shoots, up to 10 mm long on strong-growing shoots, and arranged in opposite decussate pairs. The cones are globose to rectangular, 2–3 cm long, with four scales. It is closely related to Widdringtonia wallichii from Western Cape Province, being most easily distinguished by its larger seeds with a short seedwing."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A5%AD%E6%9C%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Chasublepurple.jpg","page_title":"祭服","context_page_description":"祭服とは\\n祭祀の際に神官などが着る服。\\nキリスト教聖職者の衣装のこと。本記事で詳述する。\\nキリスト教における祭服は、キリスト教聖職者が奉神礼・典礼・礼拝のときに使用するための衣装のことである。\\n西方教会ではキャソック、アルバ、カズラ、ストラ、カッパ・マグナなど。正教会ではステハリ、エピタラヒリ、オラリ、ポルーチ、フェロン、サッコスなど。\\n教派によって用いる祭服の形状は異なる。特に西方教会と東方教会の相違は大きい。正教会における祭服は、西方教会のものとかなり外観が異なっている。起源が同じものであると考えられ、首からかける帯であるというところには共通点があるといったストラとエピタラヒリのような例もあるが、多くは見た目には殆ど異なったものとなっている。例えば同じミトラでも、西方教会のミトラ と、正教会のミトラ とでは、形状は同じ名称を持つ冠とは思えないほど全く違う形状をとっている。以下、教派毎にその祭服と、祭ごとに用いられる祭服の色の特徴を詳述する。"},{"page_url":"https://zh.wikipedia.org/wiki/2017%E5%B9%B4%E5%9C%8B%E9%9A%9B%E8%B6%B3%E5%8D%94U-20%E4%B8%96%E7%95%8C%E7%9B%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Copa_Mundial_de_F%C3%BAtbol_Sub-20_de_2017.png","page_title":"2017年國際足協U-20世界盃","context_page_description":"2017年國際足總U-20世界盃是第 21 屆國際足總U-20世界盃，即國際足球總會為其成員國 21 歲以下國家隊組織的兩年一度男子青年足球錦標賽，自1977年以「國際足總世界青年錦標賽」的名義首次舉行。該屆賽事將於2017年5月20日至6月11日期間由韓國主辦。韓國亦因此成為繼日本和墨西哥之後，第三個主辦過FIFA全部國際賽事的國家——其中包括2002年國際足總世界盃、2001年聯合會盃以及2007年國際足總U-17世界盃。\\n韓國足總原本提出避開在傳統的6月及7月主辦賽事，因為此時恰逢韓國的雨季，並且各國家隊有可能選擇適齡球員去參加同期舉行的聯合會盃。\\n塞爾維亞作為2015年的冠軍已無緣實現衛冕，因為他們未能進入歐洲區外圍賽的決賽圈。有及於此，他們亦成為連續第五個未能入圍正賽的衛冕冠軍。"},{"page_url":"https://de.wikipedia.org/wiki/Han_Yang_Ling","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Han_Yang_Ling_05.JPG","page_title":"Han Yang Ling","context_page_description":"Das Mausoleum Han Yang Ling ist das Grab von Han Jingdi, des vierten Kaisers der Westlichen Han-Dynastie. Es befindet sich im Bezirk Weicheng der Stadt Xianyang, 20 km nördlich von der Provinzhauptstadt Xi’an am Fluss Wei unweit des Flughafens Xi’an Xianyang in der westchinesischen Provinz Shaanxi. Es gehört zu den „Fünf Mausoleen“ der Westlichen Han-Dynastie."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A1%91%E5%B8%83%E5%8B%92%E8%B5%9B","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Map_commune_FR_insee_code_36217.png","page_title":"桑布勒赛","context_page_description":"桑布勒賽是法國安德爾省的一個市鎮，位於該省北部，屬於伊蘇丹區。該市鎮總面積8.08平方公里，2009年時的人口為106人。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B8%D1%81%D0%B0%D0%BB%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Manizales-Colombia2.jpg","page_title":"Манисалес","context_page_description":"Маниса̀лес е град в Колумбия. Разположен е в западната част на страната високо в Андите на надморска височина 2160 м. Главен административен център на департамент Калдас. Основан е на 12 октомври 1849 г. Има жп гара. Транспортен възел. Текстилна, фармацевтична, обувна и хранителна промишленост. Има университет, основан през 1943 г. Население около 380 000 жители през 2003 г."},{"page_url":"https://id.wikipedia.org/wiki/Turnamen_Merdeka_1968","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Stadium_Merdeka_Complete.jpg","page_title":"Turnamen Merdeka 1968","context_page_description":"Turnamen Merdeka 1968 diselenggarakan dari 9 Agustus-25 Agustus 1968, di Malaysia dengan 12 negara yang berpartisipasi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B5%D1%97%D0%B7%D0%BD%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Pereyizdna1.jpg","page_title":"Переїзна (станція)","context_page_description":"Переї́зна — вузлова вантажно-пасажирська залізнична станція Краснолиманської дирекції Донецької залізниці."},{"page_url":"https://es.wikipedia.org/wiki/Breitscheidplatz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Weltdiabetestag-2008-Berlin-2.jpg","page_title":"Breitscheidplatz","context_page_description":"Breitscheidplatz es una plaza pública principal en la ciudad de Berlín, Alemania. Junto con la avenida Kurfürstendamm, marca el centro del antiguo Berlín Occidental.\\nTras la Primera Guerra Mundial, la plaza fue punto de encuentro para los bohemios. En 1928, la plaza albergaba un conjunto de cines, teatros y otros establecimientos comerciales, y algunos empresarios habían buscado convertirla en la Broadway de Berlín.​\\nEn la tarde del 19 de diciembre de 2016, la plaza, que albergaba un mercado navideño, fue el escenario de un atentado reclamado por el Estado Islámico​ en el que un terrorista realizó un atropello masivo con un camión matando a 12 personas e hiriendo a otras 49.​"},{"page_url":"https://sv.wikipedia.org/wiki/Buffon,_C%C3%B4te-d%27Or","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Map_commune_FR_insee_code_21114.png","page_title":"Buffon, Côte-d'Or","context_page_description":"Buffon är en kommun i departementet Côte-d'Or i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen Montbard som tillhör arrondissementet Montbard. År 2009 hade Buffon 164 invånare."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D0%BE%D1%9E%D0%BD%D0%B5%D0%BD%D1%81%D0%BA%D1%96_%D1%82%D1%80%D0%B0%D0%BB%D0%B5%D0%B9%D0%B1%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Trol-ua-rivne.jpg","page_title":"Роўненскі тралейбус","context_page_description":"Роўненскі тралейбус — тралейбусная сістэма, якая дзейнічае з 1974 года ў горадзе Роўна. Рух адкрыты 24 снежня 1974. Па стане на снежань 2017 13 маршрутаў, 2 з якіх па ўказанні, у тралейбусным парку знаходзіцца 86 машын.\\nСярэдні ўзрост тралейбусаў 26,4 года.\\nУ 2011 годзе тралейбусамі горада было перавезена 27 371 тыс. чал., што на 8% менш чым у 2010 годзе, калі было перавезена 29 761 тыс. пасажыраў. У 2016 годзе гарадскога электратранспарту перавезена 34.300.000 пасажыраў, што на 2,4% больш, чым у 2015 годзе."},{"page_url":"https://cy.wikipedia.org/wiki/Asbig","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Aspic-with-eggs.jpg","page_title":"Asbig","context_page_description":"Jeli sawrus sy'n dal neu'n garnisio saig o gig neu bysgod oer yw asbig. Defnyddiwyd e'n gyntaf tua diwedd y 18g, ac yn draddodiadol fe'i wneir o figwrn neu draed llo, ond erbyn heddiw defnyddir powdwr asbig parod yn aml."},{"page_url":"https://fr.wikipedia.org/wiki/Masakatsu_Shibasaki","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/ShibasakiTamifluSynthesisPartII.png","page_title":"Masakatsu Shibasaki","context_page_description":"Masakatsu Shibasaki est un chimiste japonais. Il obtient en 1974 son doctorat en chimie dans le groupe de Shun’ichi Yamada et complète sa formation post doctorante avec Elias J. Corey à l'université Harvard. Il retourne au Japon et devient professeur à l'université Teikyō en 1977 puis est nommé à l'université de Hokkaidō en 1986. De 1983 à 1986, Shibasaki est à la tête d'un groupe de recherche au centre de recherche de chimie de Sagami. De 1991 jusqu'en 2010, il est professeur à l'université de Tokyo. Depuis 2010, il est directeur délégué de la Fondation de la recherche microbienne à Tokyo."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BA%D5%A1%D5%B5%D5%BC%D5%B8%D5%BF_%D5%AC%D5%A5%D5%BC%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%D0%9C%D0%B5%D0%B4%D0%B2%D0%B5%D0%B6%D0%B0%D1%82%D0%B0%D0%B2.jpg","page_title":"Ժայռոտ լեռներ","context_page_description":"Ժայռոտ լեռներ, լեռներ Հյուսիսային Ամերիկայի Կորդիլերների համակարգում, ԱՄՆ֊ի և Կանադայի արևմուտքում՝ հյուսիսային լայնության 60 և 32օ աստիճանների միջև։ Սկիզբ առնելով Բրիտանական Կոլումբիայից ՝ Ժայռոտ Լեռները ձգվում են 4800կմ՝ հասնելով մինչև Միացյալ Նահանգների հարավ-արևելք՝ Նյու Մեքսիկո։ Խաղաղ և Ատլանտյան օվկիանոսների ավազանների ջրբաժան է։ Գտնվելով հյուսիսամերիկյան Կորդիլերների համակարգում ժայռոտ Լեռները ինչ-որ կերպ տարբերվում են նույն համակարգում գտնվող խաղաղօվկիանոսյան ափամերձ Կասկադյան և Սիեռա Նևադա լեռնաշղթաներից, որոնք գտնվում են դեպի ավելի արևմտյան մասում։ Բարձրությունը մինչև 4399 մ է ։"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BA%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Starr_031209-0059_Cocos_nucifera.jpg","page_title":"Кокос","context_page_description":"Кокос— кокос пальмасының шырынды жемісі; қабығынан ор түрлі токарлық бұйымдар жасалады, талшықтарынан төсеніштер тоқылады арқан есіледі; кокостың ұлпасынан тамақтық және техникалық кокос майы алынады; кеспеген жаңғақтарының шырыны — кокос сүті — шол қандыратын сусын."},{"page_url":"https://sq.wikipedia.org/wiki/Shravasti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Jetavana_-_Anathapindika%27s_Stupa%2C_Shravasti_%289239811156%29.jpg","page_title":"Shravasti","context_page_description":"Shravasti ishte një qytet i Indisë së lashtë dhe një nga gjashtë qytetet e Indisë gjatë jetës së Gautama Budës. Qyteti gjendej në fushat pjellore të Gangut në distriktin e sotëm me të njëjtin emër, Shravasti, që i përket divizionit të Devipatanit në shtetin indian të Uttar Pradeshit pranë Balrampurit, rreth 170 km në veri-lindje të Lucknowt. Më herët ishte pjesë e Distriktit të Bahraichit, por më vonë u nda në dy për arsye administrative duke u formuar distrikti i Shravastit.\\nShravasti gjendet pranë lumit perëndimor Rapti dhe është ngushtësisht i lidhur me jetën e Gautama Budës, që besohet se këtu ka kaluar 24 Chaturmas. Lidhja e Budës me Shravastin bazohet nga prania e stupave të lashta, viharave madhështore dhe mjaft tempujve pranë fshatit të \\"Sahet-Mahetit\\". Thuhet se këtë qytet e ka themeluar mbreti i Periudhës Vedike, Shravasta.\\nShravasti ishte kryeqyteti i Mbretërisë Kosala gjatë shekullit të VI p.e.s. deri në shekullin e VI të e.s.. Kjo qendër e begatë tregtare ishte e mirënjohur për lidhjet e saj fetare."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%BA%D0%B0%D0%BC%D0%B1%D0%B0%D1%80%D0%B0_%D0%9E%D1%81%D0%B8%D0%BF_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/uk/3/33/%D0%95%D0%BC%D1%96%D0%BB%D1%96%D1%8F_%D0%A5%D0%B5%D0%BC%D1%96%D0%B9%2C_1943_%D1%80.jpg","page_title":"Шкамбара Осип Михайло Петрович","context_page_description":"Óсип Михáйло Петрóвич Шкамбáра 18 листопада 1914, с. Варваринці, нині Теребовлянський район — 16 червня 1944, с. Під'ярків Бібрківського району Львівської області, похований у с. Старі Стрілища Жидачівського району) — український політичний і громадський діяч, обласний провідник ОУН Львівської області (1942—1944)."},{"page_url":"https://en.wikipedia.org/wiki/History_of_coronavirus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Coronaviruses_004_lores.jpg","page_title":"History of coronavirus","context_page_description":"The history of coronaviruses is a reflection of the discovery of the diseases caused by coronaviruses and identification of the viruses. It starts with the first report of a new type of upper-respiratory tract disease among chickens in North Dakota, US, in 1931. The causative agent was identified as a virus in 1933. By 1936, the disease and the virus were recognised as unique from other viral diseases. The became known as infectious bronchitis virus, but later officially renamed as Avian coronavirus.\\nA new brain disease of mice was discovered in 1947 at Harvard Medical School in Boston. The virus causing the disease was called JHM. Three years later a new mouse hepatitis was reported from the National Institute for Medical Research in London. The causative virus was identified as mouse hepatitis virus.\\nIn 1961, a virus was obtained from a school boy in Epsom, England, who was suffering from common cold. The sample designated B814 was confirmed as novel virus in 1965. New common cold viruses collected from medical students at the University of Chicago were also reported in 1966."},{"page_url":"https://az.wikipedia.org/wiki/Qaymaql%C4%B1_alman_piroqu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Plum_cake2_ies.jpg","page_title":"Qaymaqlı alman piroqu","context_page_description":"Qaymaqlı alman piroqu-Mayalı və ya şəkər tozlu xəmirdən hazırlanmış üzərinə təbii meyvələr düzülmüş piroq."},{"page_url":"https://no.wikipedia.org/wiki/Versjoner_av_Ubuntu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Ubuntu_9.04_Jaunty_Jackalope.png","page_title":"Versjoner av Ubuntu","context_page_description":"Versjoner av Ubuntu er en liste over versjoner av den populære Linux-distribusjonen Ubuntu. Ubuntu er basert på Linux-distrusjonen Debian, men oppdateres langt oftere. Ubuntu blir utviklet av Canonical Ltd. og bruker år og måned som versjonsnummer. Den første versjonen av Ubuntu, versjon 4.10, ble lansert den 20. oktober 2004.\\nUbuntu er et operativsystem som oppdateres to ganger i året, vanligvis i april og oktober. Fordelen med dette er at systemet stadig blir oppdatert med programvare – deriblant Linuxkjernen, for å reflektere industriens forandringer i maskinvaren. Ulempen er en kort levetid med hensyn til støtte og support, men de som ønsker et mer stabilt system, henvises til egne Long Time Support-utgaver.\\nHver fjerde utgave er en LTS-utgave, som betyr at teknisk støtte er tilgjengelig i fem år. Versjon 6.06, 8.04, 10.04, 12.04, 14.04, 16.04 og 18.04 er LTS-utgaver. Betalt support er også tilgjengelig fra Canonical Ltd. Noe lignende dette gjelder også Linux-distribusjonen Fedora; den oppdateres ofte, mens Red Hat Enterprise Linux lanseres for de som ønsker mer stabilitet."},{"page_url":"https://it.wikipedia.org/wiki/Pinellas_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/CSX_Clearwater_Subdivision_-_Pinellas_Park%2C_Florida.jpg","page_title":"Pinellas Park","context_page_description":"Pinellas Park è una città degli Stati Uniti d'America, situata in Florida, nella Contea di Pinellas."},{"page_url":"https://de.wikipedia.org/wiki/Bali_(Neu-Taipeh)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Bali_Taipei_Market.jpg","page_title":"Bali (Neu-Taipeh)","context_page_description":"Bali, auch Pali, ist ein Bezirk der Stadt Neu-Taipeh im Norden Taiwans, Republik China."},{"page_url":"https://fr.wikipedia.org/wiki/Guimry","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sturm_aul_Gimry_1891.jpg","page_title":"Guimry","context_page_description":"Guimry est un aoul du Daghestan situé à flanc de montagne dans le raïon d'Ountsoukoul. C'est le village natal de Chamil, imam qui combattit l'armée impériale russe au XIXᵉ siècle."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D1%80%D1%96%D0%B1%D0%B0%D0%BB%D1%8C%D0%B4%D1%96_(%D0%9E%D1%80%D0%B5%D0%B3%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Oregon_Garibaldi.jpg","page_title":"Гарібальді (Орегон)","context_page_description":"Гарібальді — місто в США, в окрузі Тілламук штату Орегон. Населення — 779 осіб."},{"page_url":"https://fr.wikipedia.org/wiki/Clematis_patens_%27Amethyst%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Clematis_Amethyst_Beauty_%27Evipo043%27_3.jpg","page_title":"Clematis patens 'Amethyst'","context_page_description":"Clematis patens 'Amethyst', est un cultivar de clématite de l'espèce Clematis patens, obtenu en 1969 par Kozo Sugimoto au Japon.\\nLa clématite 'Amethyst' a été commercialisée à partir de 1967 par les pépinières du Saijo de Kozo Sugimoto."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Falcon_(BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/2004_Ford_Falcon_%28BA_II%29_Futura_sedan_%282010-06-17%29.jpg","page_title":"Ford Falcon (BA)","context_page_description":"The Ford Falcon (BA) is a full-sized car produced by Ford Australia from 2002 to 2005. It was the second significantly re-engineered iteration of the sixth generation of this Australian-made model, and also included the Ford Fairmont (BA)—the luxury-oriented version of the Falcon. This platform also formed the basis of the Ford Territory sport utility vehicle.\\nTo address the relatively poor reception of the preceding AU series, the BA series was heavily updated for launch in September 2002—the same time as its biggest rival, the Holden Commodore. It featured a substantially revised and more conservative exterior styling, with every panel new except for the carry-over door skins. Interiors, too, were substantially revised, while mechanically, a new independent rear suspension setup was fitted to all sedan derivatives and the engine and transmissions received extensive upgrades. In October 2004, Ford introduced a Mark II update, bringing subtle styling and mechanical changes, and in October 2005, replaced the BA with the BF.\\nIn the final months of 2002, the BA model received the influential Wheels Car of the Year award, breaking a 36-year drought."},{"page_url":"https://ca.wikipedia.org/wiki/Terra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Terrestrial_planet_size_comparisons.jpg","page_title":"Terra","context_page_description":"La Terra és el tercer planeta en distància respecte al Sol, el més dens i el cinquè en mida dels vuit planetes del sistema solar. És també el més gran dels quatre planetes terrestres del sistema solar. De vegades s'anomena món o el planeta blau.\\nHi habiten milions d'espècies, inclosos els humans; i és l'únic astre on se sap que hi ha vida. El planeta es va formar fa aproximadament 4.600 milions d'anys, i hi va aparèixer vida al cap de 1.000 milions d'anys. La biosfera de la Terra ha alternat significativament l'atmosfera i altres condicions abiòtiques, permetent la proliferació d'organismes aeròbics i la formació de la capa d'ozó que, juntament amb el camp magnètic terrestre, bloqueja la radiació solar perjudicial. Les propietats físiques de la Terra, així com la seva història geològica i òrbita, han permès que la vida persisteixi durant aquest període. S'espera que el planeta pugui tenir vida durant com a mínim 500 milions d'anys més.\\nL'escorça terrestre es divideix en diversos segments rígids, o plaques tectòniques, que es mouen per la superfície al llarg de molts milions d'anys."},{"page_url":"https://de.wikipedia.org/wiki/Senioren-Convent_(Hochschule)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/SC-Ball_Jena_%281881%29.JPG","page_title":"Senioren-Convent (Hochschule)","context_page_description":"Senioren-Convente sind Zusammenschlüsse von Corps an einer Universität oder Hochschule. Die deutsch-baltischen Studentenverbindungen an der Universität Tartu und der Universität Tallinn sowie der Präsidenkonvent und der Präsidenkonvent der lettischen Damenverbindungen in Riga haben Chargierten-Convente."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beschermd_erfgoed_in_de_gemeente_Junglinster","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/1_rue_de_Junglinster_Godbrange_Luxembourg_2011-08.JPG","page_title":"Lijst van beschermd erfgoed in de gemeente Junglinster","context_page_description":"In deze lijst van beschermd erfgoed in de gemeente Junglinster zijn alle geclassificeerde nationale monumenten van de Luxemburgse gemeente Junglinster opgenomen."},{"page_url":"https://sv.wikipedia.org/wiki/Lepanto_(dikt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Battle_of_Lepanto_1571.jpg","page_title":"Lepanto (dikt)","context_page_description":"Lepanto är en dikt från 1911 av den engelske författaren G.K. Chesterton. Den skildrar slaget vid Lepanto år 1571, då en kristen flotta ledd av Juan de Austria besegrade en betydligt större osmansk styrka ledd av Ali Pascha. Diktens tema är striden för den kristna civilisationens överlevnad. Chesterton fick idén till dikten under ett samtal med sin vän John O'Connor om slaget vid Lepanto och religionskrig i allmänhet. Dikten trycktes 12 oktober 1911 i Hilaire Bellocs veckotidning The Eye-Witness."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Jackson_County_(Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Map_of_Minnesota_highlighting_Jackson_County.svg","page_title":"Liste der Einträge im National Register of Historic Places im Jackson County (Minnesota)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Jackson County in Minnesota führt alle Bauwerke und historischen Stätten im Jackson County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%B1%DB%8C%D9%86%DA%86%D8%B1%D8%A7%D8%8C_%DA%A9%D9%84%D8%B1%D8%A7%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Trinchera%2C_Colorado.JPG","page_title":"ترینچرا، کلرادو","context_page_description":"ترینچرا یک منطقهٔ مسکونی در ایالات متحده آمریکا است که در شهرستان لاس انیماس، کلرادو واقع شده‌است. ترینچرا ۱٬۷۶۵ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/Lasioglossum_repraesentans","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Lasioglossum_repraesentans_f.jpg","page_title":"Lasioglossum repraesentans","context_page_description":"Lasioglossum repraesentans is een vliesvleugelig insect uit de familie Halictidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1853 door Smith."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%81ejery","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/%C5%81ejery_Pozna%C5%84_1.jpg","page_title":"Łejery","context_page_description":"Łejery – teatr szkolny, założony w 1975 roku przez Jerzego Hamerskiego w Poznaniu jako \\"dziecięcy teatr gromadny\\".\\nW 1986 roku współpracę z zespołem podjęła Elżbieta Drygas, na stałe związując swe losy z Łejerami, od tego czasu stanowi jego drugi filar artystyczno-wychowawczy. W 1990 roku po opracowaniu programu, powstała szkoła podstawowa o tej samej nazwie, założona przez twórców teatru łejerskiego, przy dużym udziale rodziców dzieci należących do Łejerów. Przez teatr i szkołę przeszła ogromna rzesza dzieci i młodzieży, uczonych przez zabawę w sztukę wrażliwości i refleksji, rozwijających własne artystyczne zainteresowania. Wielu z nich kontynuowało i rozwijało umiejętności w dziedzinie sztuki w życiu dorosłym."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%B5%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D1%82%D1%83%D1%88%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%D0%91%D0%B5%D1%80%D0%B5%D0%B6%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%A0%D0%B0%D1%82%D1%83%D1%88%D0%B0_2019_%D1%80%D1%96%D0%BA.jpg","page_title":"Бережанская ратуша","context_page_description":"Бережанская ратуша — ратуша в городе Бережаны Тернопольской области. Памятник архитектуры национального значения. Расположена на центральной площади Рынок.\\nПостроена в 1811 году в центре площади, на месте древней ратуши, в стиле раннего классицизма. Когда-то на первом этаже были размещены различные магазины, а на втором — гимназия. Памятник целом отражает стиль провинциального градостроительства периода раннего классицизма. Здание кирпичное, прямоугольное в плане, с внутренним двориком, двухэтажное, с двухъярусной башней над центральной частью южного фасада. На башне вмонтирован механические часы с четырьмя циферблатами. Завершает башню сигнатурка. Четыре входа здания расположены по центральным осям четырёх фасадов. Входы оформлены порталами в виде глухих двухколонных портиков с лепными гербами в тимпанах.\\nВ помещениях ратуши размещены четыре музея: Бережанский районный краеведческий музей, Литературно-мемориальный музей Богдана Лепкого, Музей преследуемой Церкви и Бережанский музей книги."},{"page_url":"https://oc.wikipedia.org/wiki/T%C3%A8rra_de_Bancali%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Comunautat_de_comunas_del_Centre_del_Tarn.png","page_title":"Tèrra de Bancaliá","context_page_description":"Tèrra de Bancaliá es una comuna novèla occitana d’Albigés creada lo 1èr de genièr de 2019 en fusionar las comunas de Romegós, Ronèl, Tèrra Clapièr, Lo Travet, Sent Antonin de la Calm e Sant Lionç e la Fenassa que venon comunas delegadas. L'ostau de la comuna es a Romegós. Sa polulacion es de 255 abitants.\\nAdministrativament, es dins l'arrondiment d'Albi, lo departament de Tarn e la region d'Occitanie dins l'estat francés. Electoralament, es dins lo canton del Naut Dadon."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Neu-Ulm","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Wasserturm_Neu-Ulm.JPG","page_title":"Liste der Baudenkmäler in Neu-Ulm","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Großen Kreisstadt Neu-Ulm zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A8%D1%83%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/181128_2018_Asia_Artist_Awards_Suga_%281%29_%28cropped%29.png","page_title":"Шуга","context_page_description":"Мин Юн-ги, познат също като Шуга или Agust D, е южнокорейски рапър, продуцент и автор на песни. Подписан в компанията Big Hit Entertainment, той дебютира като член на Южнокорейската поп идол група BTS през 2013. През 2016 издава първия си солов микстейп, Agust D. Корейската асоциация за авторски права приписва над 70 песни на Шуга като автор на песни и продуцент, включително „Wine“ на Suran, което достигна номер две в музикалната класация на Gaon и спечели най-добрата песен на Soul / R&B за годината на 2017 Melon Music Awards."},{"page_url":"https://pt.wikipedia.org/wiki/Cratera_em_pedestal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Pedestal_crater_and_streaks.jpg","page_title":"Cratera em pedestal","context_page_description":"Em geologia planetária, uma cratera em pedestal é uma cratera cujo ejecta se assenta sobre o terreno circundante formando assim uma plataforma elevada. Elas se formam quando uma cratera de impacto expele material que por sua vez forma uma camada resistente à erosão, e como consequencia a área próxima se erode mais devagar do que o resto da região. Alguns pedestais tem sido medidos apuradamente centenas de metros acima da área circundante. Isso implica que centenas de metros de materiais foram levados pela erosão. Isso faz com que tanto a cratera quanto sua cobertura de ejecta se situem acima dos arredores. Crateras em pedestal foram observadas pela primeira vez durante as missões Mariner."},{"page_url":"https://gl.wikipedia.org/wiki/Sirius","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Canis_Major_charta_%28big_names%29.png","page_title":"Sirius","context_page_description":"Sirio, ou Sirius na súa denominación latina, é o nome propio da estrela Alpha Canis Maioris, a máis rutilante de todo o ceo nocturno da Terra, situada na constelación do hemisferio celeste sur Canis Maior. Esta estrela tan notable, que é realmente unha estrela binaria, é ben coñecida desde a antigüidade; por exemplo, no antigo Exipto, a saída helíaca de Sirio marcaba a época das inundacións do Nilo, e estivo presente en civilizacións tan dispares como a grega e a polinesia. En ocasións, e coloquialmente, Sirio é chamada «Estrela Can» a raíz da constelación á que pertence.\\nA compoñente primaria das dúas estrelas que conforman o sistema, Sirio A, é unha estrela branca da secuencia principal de tipo espectral A1V que ten unha temperatura superficial de 10 000 K e que está a uns 8,6 anos luz do Sistema Solar, sendo a quinta estrela máis próxima do Sol. A súa magnitude aparente na banda B é -1,46, e na banda V é -1,47. Friedrich Bessel, en 1844, deduciu a presenza dunha compañeira, un obxecto celeste moi tenue agora chamado Sirio B ou «o Cachorro», que foi observado casualmente por primeira vez en 1862 polo construtor de obxectivos astronómicos Alvan Graham Clark."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%98%AC%EB%A6%BC%ED%94%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Winter_olympics_all_cities.PNG","page_title":"올림픽","context_page_description":"올림픽은 전 세계 각 대륙 각국에서 모인 수천 명의 선수가 참가해 여름과 겨울에 스포츠 경기를 하는 국제적인 대회이다. 또한 전 세계에서 가장 큰 스포츠 행사인 올림픽은 2년마다 하계 올림픽과 동계 올림픽이 번갈아 열리며, 국제 올림픽 위원회가 감독하고 있다. 또한 오늘날의 올림픽은 기원전 8세기부터 서기 5세기에 이르기까지 고대 그리스 올림피아에서 열렸던 고대 올림피아 경기에서 비롯되었다. 그리고 19세기 말에 피에르 드 쿠베르탱이 고대 올림피아 제전에서 영감을 얻어, 근대 올림픽을 부활시켰다. 이를 위해서 피에르 드 쿠베르탱은 1894년에 IOC를 창설했으며, 2년 뒤인 1896년에 그리스 아테네에서 제 1회 올림픽이 열렸다. 이때부터 IOC는 올림픽 운동의 감독 기구가 되었으며, 조직과 활동은 올림픽 헌장을 따른다.\\n또한 20세기에 올림픽 운동이 발전함에 따라, IOC는 변화하는 세계의 사회 환경에 적응해야 했다. 이러한 변화의 예로는 얼음과 눈을 이용한 경기 종목을 다루는 동계 올림픽, 장애인이 참여하는 패럴림픽, 스페셜 올림픽, 데플림픽, 10대 선수들이 참여하는 유스 올림픽 등을 들 수 있다. 그 뿐만 아니라 IOC는 20세기의 변화하는 경제, 정치, 기술 환경에도 적응해야 했다. 그리하여 올림픽은 피에르 드 쿠베르텡이 기대했던 순수한 아마추어 정신에서 벗어나서, 프로 선수도 참가할 수 있게 되었다. 올림픽은 점차 대중 매체의 중요성이 커짐에 따라 올림픽의 상업화와 기업 후원을 놓고도 논란이 생겨났다. 또한 올림픽을 치르며 발생한 보이콧, 도핑, 심판 매수, 테러와 같은 수많은 일들은 올림픽이 더욱 굳건히 성장할 수 있는 원동력이 되었다.\\n올림픽은 국제경기연맹, 국가 올림픽 위원회, 각 올림픽의 위원회로 구성된다. 의사 결정 기구인 IOC는 올림픽 개최 도시를 선정하며, 각 올림픽 대회마다 열리는 올림픽 종목도 IOC에서 결정한다. 올림픽 경기 개최 도시는 경기 축하 의식이 올림픽 헌장에 부합하도록 조직하고 기금을 마련해야 한다. 올림픽 축하 행사로는 여러 의식과 상징을 들 수 있는데 올림픽기나 성화가 그 예이다.\\n올림픽은 거의 모든 국가가 참여할 정도로 규모가 커졌다. 하계 올림픽은 33개의 종목과 약 400개의 세부종목에서 13,000 명이 넘는 선수들이 겨루고 그중 각 종목별 1, 2, 3위는 각각 금/은/동메달을 수여받는다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Worcester_County_(Massachusetts)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Map_of_Massachusetts_highlighting_Worcester_County.svg","page_title":"Liste der Einträge im National Register of Historic Places im Worcester County (Massachusetts)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Worcester County in Massachusetts führt alle Bauwerke, National Historic Landmarks und Historic Districts im Bristol County auf, die in das National Register of Historic Places aufgenommen wurden.\\nAufgrund der Vielzahl der vorhandenen Einträge wurden alle Einträge nördlich der Massachusetts Route 2 in eine gesonderte Liste ausgelagert. Zudem gibt es für die Städte Southbridge und Uxbridge eigene Listen:\\nListe der Einträge im National Register of Historic Places in Southbridge (Massachusetts), 83 Einträge\\nListe der Einträge im National Register of Historic Places in Uxbridge (Massachusetts), 53 Einträge\\nDarüber hinaus besitzt die Stadt Worcester so viele im NRHP eingetragene Denkmäler, dass diese aus Gründen der Übersicht auf drei weitere Listen verteilt sind:\\nListe der Einträge im National Register of Historic Places im östlichen Worcester (Massachusetts), 97 Einträge\\nListe der Einträge im National Register of Historic Places im nordwestlichen Worcester (Massachusetts), 102 Einträge\\nListe der Einträge im National Register of Historic Places im südwestlichen Worcester (Massachusetts), 80 Einträge"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BC%D0%BF%D0%B5%D1%80%D1%96%D0%B0%D0%BB%D1%96%D0%B7%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/World_1898_empires_colonies_territory.png","page_title":"Імперіалізм","context_page_description":"Імперіалі́зм — державна політика, практика і пропаганда розширення і панування держави, звичайно, шляхом прямого захоплення території або за рахунок отримання політичного і економічного контролю. Імперіалізм як державна політика завжди передбачає використання сили: прямої військової або у якийсь іншій формі. Імперіалізм часто вважається морально негожим, тому термін часто використовується в міжнародній пропаганді, щоб засудити і дискредитувати зовнішню політику противника.\\nТермін використовується для характеристики політики країн незалежно від того, чи називають вони себе імперіями.\\nВизначення терміну значно відрізняються залежно від політичної системи, з позицій якої дається таке визначення. В СРСР давались визначення терміну, що напряму пов'язували імперіалізм з капіталізмом:\\nМала радянська енциклопедія містить визначення імперіалізму, наведене в роботі В. І. Леніна «Імперіалізм, як вища стадія капіталізму»: «капіталізм на тій стадії розвитку, коли склалося панування монополій і фінансового капіталу, почався розділ світу міжнародними трестами і закінчився розділ всієї землі найбільшими капіталістичними країнами»."},{"page_url":"https://en.wikipedia.org/wiki/J._E._M._Ag_Supply,_Inc._v._Pioneer_Hi-Bred_International,_Inc.","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Stephen_Breyer%2C_SCOTUS_photo_portrait.jpg","page_title":"J. E. M. Ag Supply, Inc. v. Pioneer Hi-Bred International, Inc.","context_page_description":"J. E. M. Ag Supply, Inc. v. Pioneer Hi-Bred International, Inc., 534 U.S. 124, was a decision of the United States Supreme Court holding for the first time that utility patents may be issued for crops and other flowering plants under 35 U.S.C. § 101. The Supreme Court rejected the argument that the exclusive ways to protect these plants are under the Plant Variety Protection Act, 7 U.S.C. § 2321, and the Plant Patent Act of 1930, 35 U.S.C. §§ 161-164."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%83%E6%B0%9F%E5%8C%96%E9%87%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/AuF5-F2-calculated-B3LYP-2007-3D-balls.png","page_title":"七氟化金","context_page_description":"七氟化金是一種金的氟化物，化學式為AuF₇。這種化合物最早於1986年製得。最初認為其中的金元素的氧化態為+7，但後來的進一步研究否定這一點。該化合物實際上是五氟化金與氟分子形成的配合物，即AuF₅·F₂，如果能得到更多證據確認，這將是第一種雙氟配合物。理論計算也表明，該物質能量比AuF₇低205kJ/mol，因此後者幾乎不可能存在。光譜實驗證明在734cm⁻¹有伸縮振動，也就是端基配位的氟分子鍵長增大。"},{"page_url":"https://en.wikipedia.org/wiki/Temporary_gentlemen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/CooeeMarchers1915.jpg","page_title":"Temporary gentlemen","context_page_description":"Temporary gentlemen is a term used to refer to officers of the British Army who held temporary commissions, particularly when such men came from outside the traditional officer class. Historically the officers of the British Army were drawn from the gentry and upper middle-classes and were expected to be gentlemen. The expensive uniforms and social expectations placed on officers prevented those without a private income from joining.\\nThe outbreak of the First World War required a rapid expansion in the size of the army and a corresponding increase in the officer corps. During the war more than 265,000 additional officers were recruited, many on temporary commissions. Many of these were drawn from the lower middle and working classes. They came to be referred to as \\"temporary gentlemen\\" with the expectation being that they would revert to their former social standing after the war. At the end of the war, many were unwilling to return to their former positions on reduced salaries and there were too few managerial positions to provide full employment, resulting in considerable hardship."},{"page_url":"https://pt.wikipedia.org/wiki/5_de_dezembro","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Jose_Carreras_Royal_Albert_Hall_2001.jpg","page_title":"5 de dezembro","context_page_description":"5 de dezembro é o 339.º dia do ano no calendário gregoriano. Faltam 26 para acabar o ano."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%93%AC%E6%B3%B0%E5%B8%83%E8%B4%BE%E5%86%85%E5%A1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Ponte_Buggianese_panorama.JPG","page_title":"蓬泰布贾内塞","context_page_description":"蓬泰布賈內塞，是義大利皮斯托亞省的一個市鎮。總面積29平方公里，人口8818人，人口密度304.1人/平方公里。ISTAT代碼為047016。"},{"page_url":"https://en.wikipedia.org/wiki/Museum_of_Diplomatic_Corps","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Museum_of_Diplomatic_Corps%2C_Vologda%2C_5_stage_and_piano.jpg","page_title":"Museum of Diplomatic Corps","context_page_description":"The Museum of Diplomatic Corps is a private historical museum located in Russian city Vologda. It is situated in a wooden manor that belonged to a noble Pavel Puzan-Puzyrevsky where, in 1918, the American Embassy was quartered. The exposition of the museum is devoted to little known events which took place in Vologda in February–July 1918, and is connected with a stay of 11 foreign embassies and diplomatic missions headed by the American Ambassador David Rowland Francis.\\nMuseum was closed on 4 November 2012."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Sin%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Colombia_Desembocadura_del_r%C3%ADo_Sin%C3%BA_en_el_mar_Caribe.jpeg","page_title":"Río Sinú","context_page_description":"El río Sinú es un río de Colombia que desemboca en el mar Caribe y que discurre por el departamento de Córdoba."},{"page_url":"https://ro.wikipedia.org/wiki/Mun%C8%9Bii_St%C3%A2ni%C8%99oarei","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Mun%C5%A3ii_Tarc%C4%83ului%2C_03.JPG","page_title":"Munții Stânișoarei","context_page_description":"Munții Stânișoarei sunt o grupă muntoasă a Carpaților Moldo-Transilvani, aparținând de lanțul muntos al Carpaților Orientali. Cel mai înalt pisc este Vârful Bivolul, având 1.530 m."},{"page_url":"https://ca.wikipedia.org/wiki/Motor_de_quatre_temps","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Ciclo_de_cuatro_tiempos.png","page_title":"Motor de quatre temps","context_page_description":"El motor o cicle de quatre temps és un tipus de motor d'explosió que requereix quatre curses del pistó o èmbol per a completar el cicle termodinàmic."},{"page_url":"https://it.wikipedia.org/wiki/Bromus_tectorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Bromus_tectorum_sl13.jpg","page_title":"Bromus tectorum","context_page_description":"Il forasacco dei tetti è una specie di pianta spermatofita monocotiledone appartenente alla famiglia Poaceae."},{"page_url":"https://en.wikipedia.org/wiki/64_BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Antiochos_XIII_Asiatikos%2C_Tetradrachm%2C_69-64_BC%2C_HGC_9-1340.jpg","page_title":"64 BC","context_page_description":"Year 64 BC was a year of the pre-Julian Roman calendar. At the time it was known as the Year of the Consulship of Caesar and Figulus. The denomination 64 BC for this year has been used since the early medieval period, when the Anno Domini calendar era became the prevalent method in Europe for naming years."},{"page_url":"https://bs.wikipedia.org/wiki/Hermelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Mustela.erminea.jpg","page_title":"Hermelin","context_page_description":"Hermelin je mali sisar iz porodice kuna."},{"page_url":"https://de.wikipedia.org/wiki/2012","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Erhard_Wunderlich_01.jpg","page_title":"2012","context_page_description":"Das Jahr 2012 war wie das Vorjahr geprägt vom Arabischen Frühling. In Syrien ging der Bürgerkrieg das ganze Jahr weiter; in Ägypten wurde in einem Referendum unter anhaltenden Protesten eine islamisch geprägte Verfassung angenommen.\\nIn Europa war das Jahr besonders von der Eurokrise geprägt. Besonders in den von der Krise stark getroffenen Ländern Griechenland, Spanien und Italien kam es zu Protesten gegen die Krisenpolitik der Europäischen Union und gegen die Politik der eigenen Regierungen.\\nIn Deutschland kam es nach der Aufdeckung der Anschläge der rechtsextremen Terrorgruppe NSU und nach der Aufdeckung verschiedener Ermittlungspannen zu grundsätzlichen Diskussionen über die Arbeit des Verfassungsschutzes; die Forderung eines neuen Verbotsverfahrens gegen die Nationaldemokratische Partei Deutschlands wurde laut. Am 14. Dezember 2012 beschloss der Bundesrat mit großer Mehrheit, erneut ein Verbot der NPD beim Bundesverfassungsgericht zu beantragen. Die Richter wiesen den Antrag im Januar 2017 ab."},{"page_url":"https://es.wikipedia.org/wiki/Escudo_de_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Billete_de_dos_pesos._Venezuela_1811.jpg","page_title":"Escudo de Venezuela","context_page_description":"El Escudo de Armas de la República Bolivariana de Venezuela es el emblema heráldico que representa al país, y que constituye, junto con la bandera y el himno nacional, los símbolos patrios de Venezuela.​ Con ligeras variantes, el escudo aprobado en 1836 por el Congreso es el mismo vigente hasta la actualidad.​\\nSeñor: ¡Dichoso el ciudadano que bajo el escudo de las armas a su mando, ha convocado la Soberanía Nacional para que ejerza su voluntad absoluta!\\nSimón Bolívar.\\n."},{"page_url":"https://nl.wikipedia.org/wiki/Moeder_Overste_(bier)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Moederoverste.jpg","page_title":"Moeder Overste (bier)","context_page_description":"Moeder Overste is een Belgisch bier van hoge gisting.\\nHet bier wordt sinds 1985 gebrouwen in Brouwerij Lefebvre te Quenast. De naam verwijst naar kloosterzusters, maar ook naar ook naar een bazige schoonmoeder.\\nHet is een amberkleurige tripel met een alcoholpercentage van 8%."},{"page_url":"https://fr.wikipedia.org/wiki/Fran%C3%A7ois_de_France_(1555-1584)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Hercule-Francois_Duke_of_Alencon.jpg","page_title":"François de France (1555-1584)","context_page_description":"François de France, né au château de Fontainebleau le 18 mars 1555 et mort à Château-Thierry le 10 juin 1584, et inhumé en l'église de l'abbaye royale de Saint-Denis, duc d'Alençon, d'Anjou, de Touraine, de Brabant et de Château-Thierry, est le dernier fils d'Henri II et de Catherine de Médicis.\\nÀ la tête du parti des Malcontents, François joua un rôle politique particulièrement important dans la France des années 1570. Il provoqua des troubles à la cour de son frère Henri III et participa aux sixième et septième guerres de religion.\\nDans le cadre de la guerre d'indépendance contre l'Espagne, il fut appelé à devenir le nouveau souverain des Pays-Bas. Prétendant de la reine Élisabeth Iʳᵉ d'Angleterre de 1572 à sa mort, il ne se maria jamais.\\nIl meurt de la tuberculose le 10 juin 1584 à Château-Thierry. Sa mort eut d'importantes répercussions politiques : le roi Henri III demeurant toujours sans descendance à cette date, la disparition du duc d'Anjou permit au protestant Henri de Navarre de devenir l'héritier direct de la couronne de France."},{"page_url":"https://sl.wikipedia.org/wiki/David_Stirling","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/The_Special_Air_Service_%28sas%29_in_North_Africa_during_the_Second_World_War_E21340.jpg","page_title":"David Stirling","context_page_description":"Sir David Stirling, škotski častnik, plemič in operativec, * 1915, † 1990.\\nStirling velja za očeta SASa."},{"page_url":"https://de.wikipedia.org/wiki/Tellurtrioxid","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/TeO3.png","page_title":"Tellurtrioxid","context_page_description":"Tellurtrioxid ist eine chemische Verbindung und das Anhydrid der Orthotellursäure H₆TeO₆."},{"page_url":"https://pl.wikipedia.org/wiki/Bu%C5%82garski_Centralny_Komitet_Rewolucyjny","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/BASA-600K-1-1865-15-Vasil_Levski-retouched.jpeg","page_title":"Bułgarski Centralny Komitet Rewolucyjny","context_page_description":"Bułgarski Centralny Komitet Rewolucyjny – bułgarska organizacja niepodległościowa, utworzona w 1870 r. przez Wasiła Lewskiego i Lubena Karawełowa. Stawiała sobie za cel wyzwolenie ziem bułgarskich spod panowania tureckiego drogą zbrojnego powstania.\\nPoczątkowo głównym liderem organizacji był Lewski, który opracował dla Komitetu program walki o niepodległą, demokratyczną republikę, a jako wrogów bułgarskiego ludu wskazywał zarówno Turków, jak i bułgarskich zamożnych właścicieli ziemskich, akceptujących panowanie tureckie. Po śmierci Lewskiego, straconego przez Turków w lutym 1873 r., Karawełow odszedł od taktyki powstańczej, zaś pierwszoplanową postacią komitetu stał się Christo Botew, również radykalny demokrata. Komitet dwukrotnie inicjował powstania na ziemiach bułgarskich: w Starej Zagorze w 1875 r. i w całej centralnej Bułgarii w kwietniu r. 1876. Oba wystąpienia zakończyły się klęską; w drugim zginęli, walcząc jako dowódcy oddziałów, niemal wszyscy radykalni członkowie Komitetu. Odnowiona w tym samym roku organizacja przyjęła nowy, bardziej zachowawczy program, postanawiając walczyć o niepodległą Bułgarię jedynie u boku Rosji i rezygnując z daleko idących zmian społecznych."},{"page_url":"https://pl.wikipedia.org/wiki/Ant%C3%B3nio_Dam%C3%A1sio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Antonio_Damasio.jpg","page_title":"António Damásio","context_page_description":"António Rosa Damásio – portugalski profesor neurologii behawioralnej pracujący w Stanach Zjednoczonych. Wykładał na Uniwersytecie Południowej Kalifornii, gdzie prowadził katedrę Brain and Creativity. Zanim objął to stanowisko w 2005, kierował katedrą neurologii na Uniwersytecie Iowa. Pracował tam w latach 1976–2005. Poza tym, że jest powszechnie znanym badaczem wielu zagadnień związanych z neurologią, to również autorem książek objaśniających jego teorie."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B7%D6%80%D5%AB%D5%AF_%D5%91%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/EricTsang2008.jpg","page_title":"Էրիկ Ցան","context_page_description":"Էրիկ Ցան, հոնկոնգցի դերասան, պրոդյուսեր, ռեժիսոր, սցենարիստ։ Հանդիսատեսին հայտնի է «Պատահական լրտեսը» և «Երկվորյակ վիշապները» ֆիլմերից։ Էրիկը հայտնի է նաև Հոնկոնգյան TVB հեռուսատաալիքի «Սուպեր եռյակի սերիաները» շոուից, որը նա վարել է շուրջ 18 տարի։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D0%BB%D0%BA%D0%BE%D1%81%D0%BE%D0%BF%D0%BE%D1%87%D0%BD%D0%B8%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Peak_of_Courageous.jpg","page_title":"Казахский мелкосопочник","context_page_description":"Каза́хский мелкосо́почник — степь в центральном Казахстане, с небольшими, обрывистыми низкогорными массивами. На западе мелкосопочник ограничен Тургайской ложбиной, на северо-востоке долиной Иртыша, на севере Западно-Сибирской равниной, на юго-западе Туранской низменностью. Протяжённость с запада на восток 1200 км, ширина на западе 900 км и на востоке 400 км. В центре расположены Каркаралинские горы. Южнее массив Кызылтас с горой Аксоран максимальной высотой 1565 м. На юго-западе горы Улытау. На севере изолированно расположена Кокчетавская возвышенность. На востоке хребты Чингизтау, Акшатау. По окраинам раскиданы обособленные, довольно высокие массивы небольшого размера — Баянаул, Дегелен, Жаксы-Жалгызтау, Бурабай, Нияз и др. В южной части мелкосопочника, в 70 км от Балхаша находится массив Бектау-Ата.\\nДва заповедника, расположенных на территории Казахского мелкосопочника — Коргалжынский и Наурзумский — являются объектом Всемирного наследия ЮНЕСКО."},{"page_url":"https://en.wikipedia.org/wiki/Jacques_Backereel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Jacques_Backereel_-_landscape_with_figures.jpg","page_title":"Jacques Backereel","context_page_description":"Jacques Backereel, was a Flemish Baroque landscape painter. After training in Antwerp he worked for some time in Rome. He is mainly known for large-scale landscape paintings."},{"page_url":"https://en.wikipedia.org/wiki/Allan_Saxe_Field","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Texas_State_vs._UT_Arlington_softball_2019_02.jpg","page_title":"Allan Saxe Field","context_page_description":"Allan Saxe Field is the home of the UTA Mavericks softball team located in Arlington, Texas. As a result of a complete reconstruction in 2014-15, the stadium currently has a capacity of 622. A sellout crowd of 702 set a new attendance record on March 12, 2016 when Samford visited. The previous record of 474 was set against the University of Texas on March 11, 2010 when stadium capacity was 250. In 2016, Allan Saxe also drew crowds of 622, 522 and 512 that would have set the record had it occurred in any year prior. Adjacent to Clay Gould Ballpark, the stadium is located at the intersection of W. Park Row Drive and Fielder Road."},{"page_url":"https://es.wikipedia.org/wiki/Hans_Keilson","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Hans_keilson2007.jpg","page_title":"Hans Keilson","context_page_description":"Hans Alex Keilson fue un escritor y psicoanalista germanoneerlandés, de origen judío, conocido principalmente por sus obras ambientadas en la Segunda Guerra Mundial, donde fue miembro de la resistencia neerlandesa. Su obra literaria y ensayística ha sido destacada recientemente."},{"page_url":"https://de.wikipedia.org/wiki/Welterbe_in_den_Vereinigten_Staaten_von_Amerika","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Mount_Rainier_7437.JPG","page_title":"Welterbe in den Vereinigten Staaten von Amerika","context_page_description":"Zum Welterbe in den Vereinigten Staaten von Amerika gehören 24 UNESCO-Welterbestätten, darunter elf Stätten des Weltkulturerbes, zwölf Stätten des Weltnaturerbes und eine gemischte Kultur- und Naturerbestätte. Die Vereinigten Staaten haben die Welterbekonvention 1973 ratifiziert, die ersten zwei Welterbestätten wurden 1978 in die Welterbeliste aufgenommen. Die bislang letzte Welterbestätte wurde 2019 eingetragen, eine Stätte steht auf der Roten Liste des gefährdeten Welterbes."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%88%B1%E7%91%9E%E5%8F%91%E9%93%81%E8%B7%AF%E4%BC%A6%E6%95%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Overground-Class172-Gospel-Oak.jpg","page_title":"爱瑞发铁路伦敦","context_page_description":"愛瑞發鐵路倫敦是一家列車運營公司，它歸由英國愛瑞發列車有限公司管理。這家公司負責管理倫敦地上鐵。"},{"page_url":"https://sco.wikipedia.org/wiki/Pape_Sergius_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Sergius_IV.jpg","page_title":"Pape Sergius IV","context_page_description":"Pape Sergius IV wis Pape an ruler o the Papal States frae 31 Julie 1009 tae his daith in 1012."},{"page_url":"https://war.wikipedia.org/wiki/Phleum_bertolonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Timothy_grass.jpg","page_title":"Phleum bertolonii","context_page_description":"An Phleum bertolonii in uska species han Liliopsida nga ginhulagway ni Dc.. An Phleum bertolonii in nahilalakip ha genus nga Phleum, ngan familia nga Poaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://sv.wikipedia.org/wiki/Graffignana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Chiesa_SS_Pietro_e_Paolo_Apostoli_-_Graffignana_LO.jpg","page_title":"Graffignana","context_page_description":"Graffignana är en ort och kommun i provinsen Lodi i regionen Lombardiet i Italien. Kommunen hade 2 626 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Shoppers_Drug_Mart","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Shoppers_Drug_Mart_Dupont.jpg","page_title":"Shoppers Drug Mart","context_page_description":"Shoppers Drug Mart Corp., in Quebec Pharmaprix genannt, ist eine kanadische Apotheken- und Drogeriemarktkette. Der Sitz der Firmenzentrale ist in Toronto.\\nAußer Arzneimitteln, Drogerieartikeln, medizinischen Geräten und Hilfsmitteln bietet Shoppers Drug Mart auch Dienstleistungen im Bereich Home-Care an.\\nGegründet wurde das Unternehmen 1962 von Murray Koffler. 1983 veräußerte Koffler das Shoppers Drug Mart an das kanadische Unternehmen Imasco. 2000 wurde das Unternehmen an ein Konsortium von Investmentgesellschaften veräußert. 2013 übernahm Loblaw Companies das Unternehmen für umgerechnet 9,1 Milliarden Euro. Das Unternehmen war zeitweise im Aktienindex S&P/TSX 60 an der Toronto Stock Exchange gelistet."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9C%E3%82%BF%E3%83%B3%E3%83%8D%E3%82%B3%E3%83%8E%E3%83%A1%E3%82%BD%E3%82%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Chrysosplenium_kiotoense_2.JPG","page_title":"ボタンネコノメソウ","context_page_description":"ボタンネコノメソウは、ユキノシタ科ネコノメソウ属の多年草。別名、ボタンネコノメ。\\nなお、本種の種小名または変種名については、kiotoenseまたは kiotenseがある。前者については、大井次三郎が1933年に記載した種小名であるが、大井が1937年に本種をホクリクネコノメの変種に組み替えた際に、変種名を kiotense として記載した。そのため、その後の学名の扱いに混乱が生じているが、本種が最初に記載されたのは kiotoense であり、YList でも同様に扱っているため、本稿では原則として kiotoense を使用することとする。"},{"page_url":"https://fr.wikipedia.org/wiki/Myzom%C3%A8le_vermillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Myzomela_cruentata_-_The_Birds_of_New_Guinea_%28cropped%29.jpg","page_title":"Myzomèle vermillon","context_page_description":"Le Myzomèle vermillon est une espèce de passereaux de la famille des Meliphagidae."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/P%C3%A9csv%C3%A1rad","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/HUN_P%C3%A9csv%C3%A1rad_COA.jpg","page_title":"Pécsvárad","context_page_description":"Pécsvárad sī Magyar Baranya kūn ê chi̍t ê siâⁿ-chhī."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D8%B3_%D8%A7%D9%86%D8%AA%D9%88%D9%86%D9%8A%D9%88_%D8%A7%D8%B3%D9%83%D9%88%D8%AF%D9%8A%D8%B1%D9%88_%D9%84%D9%88%D9%BE%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Joseantonioescudero22nov12ur.JPG","page_title":"چوس انتونيو اسكوديرو لوپيز","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچوس انتونيو اسكوديرو لوپيز سياسى من اسبانيا."},{"page_url":"https://en.wikipedia.org/wiki/V%C3%ADzv%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Drave_at_V%C3%ADzv%C3%A1r%2C_Hungary.jpg","page_title":"Vízvár","context_page_description":"Vízvár is a village in Somogy County, Hungary. Zsitvapuszta and Csütörtökhely are parts of the settlement."},{"page_url":"https://fi.wikipedia.org/wiki/Kaupunkimaiset_taajamat_Valko-Ven%C3%A4j%C3%A4ll%C3%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Coat_of_Arms_of_Stre%C5%A1yn.png","page_title":"Kaupunkimaiset taajamat Valko-Venäjällä","context_page_description":"Valko-Venäjällä on monia eli noin sata kaupunkimaista taajamaa. Näillä pikkukaupunkia monessa suhteessa muistuttavilla asutuskeskuksilla ei kuitenkaan ole virallista kaupungin asemaa. Silti esimerkiksi taajamien englanninkielisillä kotisivuilla tai matkailussa näitä taajamia saatetaan kutsua kaupungeiksi. Myös Valko-Venäjän väestötilastoissa kaupunkimaisten taajamien asukkaat katsotaan kaupunkilaisiksi.\\nKaupunkityyppisten taajamien joukkoon kuuluu Valko-Venäjällä muun muassa hallintopiirien keskuksia ja erilaisia teollisuuden tai palvelujen ympärille kasvaneita asutuskeskittymiä. Käsitteellisesti kaupunkityyppiset asutustaajamat luokitellaan Valko-Venäjän lain mukaan kolmeen ryhmään, joilla on tyypillistä:\\nKaupunkimaiset taajamat: asukasluku > 2000, teollisuusyrityksiä ja kehittynyt asumisen infrastruktuuri\\nLoma-asutustaajamat tai kylpylätaajamat: asukasluku vähintään 2000, kylpylöitä, lomakyliä tai muita kuntoutuslaitoksia, ja kehittynyt asumisen infrastruktuuri\\nTyöläisten taajamat: asukasluku vähintään 500, palvelee teollisuuslaitoksia, rakennustyömaita, rautatieasemia, sähköntuotantoa tai muita teollisuuskohteita"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%AE%D9%88%D8%AF%DA%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Leblebi.jpg","page_title":"نخودچی","context_page_description":"نخودچی یک میان‌وعده از نخودهای پخته شده‌است که در ایران، سوریه و ترکیه رایج است و گاهی اوقات با نمک، ادویه جات، ترشی‌جات، گل میخک یا آبنبات پوشش داده می‌شود. در ممقان بیش از ۱۳۰۰ واحد نخودپزی وجود دارند که ۴۰ درصد نخود سفید تولید شده را به نخودچی تبدیل می‌کنند. نخودهای مورد استفاده برای نخودچی، نخودهای تازه و ریز هستند که در آب پخته شده و پس از آبکش شدن پوست آن جدا می‌شود. سپس در مرحله بودادن در دیگ‌های بزرگ با نمک یا شکر تفت داده و ترد و پفکی می‌شود. در تونس این اصطلاح به یک سوپ صبحانه‌ای که بسیار پرطرفدار از نخود است و همچنین شامل تخم مرغ و نان خشک است اشاره دارد."},{"page_url":"https://it.wikipedia.org/wiki/Segnaletica_stradale_nella_Repubblica_Ceca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/B16cr.jpg","page_title":"Segnaletica stradale nella Repubblica Ceca","context_page_description":"I segnali stradali nella Repubblica Ceca sono regolati dal decreto legge n. 30 del 2001 e sono decretati congiuntamente dal ministero dei lavori pubblici ceco e dalla polizia. Sono installati lungo il ciglio della strada sul lato destro della carreggiata e sono suddivisi in segnali di pericolo, di precedenza, di divieto e restrizione, di obbligo, di regolazione stradale, di indicazione, di aiuto alla guida e pannelli integrativi.\\nSe vi è del testo nei segnali, questo è in lingua ceca, senza traduzioni in altre lingue. La maggior parte dei segnali sono basati su disegni come nella maggior parte dei Paesi europei, eccezion fatta per quelli con scritte come il segnale di Fermarsi e dare precedenza o quello di Dogana.\\nAgli incroci non regolati da segnaletica stradale o semafori vige la regola generale di dare la precedenza ai veicoli provenienti da destra, a meno che non sia altrimenti specificato."},{"page_url":"https://gl.wikipedia.org/wiki/Dictyostelium_discoideum","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Dictyostelium_Aggregation.JPG","page_title":"Dictyostelium discoideum","context_page_description":"Dictyostelium discoideum é unha especie de ameba que vive no solo pertencente ao filo Amoebozoa, infrafilo Mycetozoa. Considerado un mofo mucoso, D. discoideum é un eucariota que durante o seu ciclo de vida pasa de ser un conxunto de amebas unicelulares separadas a unha masa multicelular e despois a un corpo frutífero. O seu peculiar ciclo de vida asexual consta de catro fases: vexetativa, agregación, migración e culminación. O ciclo vital de D. discoideum é relativamente curto, o que permite observar sucesivamente as catro etapas de maneira doada. As células implicadas no ciclo de vida realizan movementos, sinalización química e desenvolvemento, o que é aplicable á investigación do cancro humano. A simplicidade do seu ciclo vital fai que D. discoideum sexa un valioso organismo modelo para estudos de procesos xenéticos, celulares e bioquímicos aplicables a outros organismos."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%B8%D5%AF%D5%AB%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/%E5%A4%9A%E6%91%A9%E3%83%8B%E3%83%A5%E3%83%BC%E3%82%BF%E3%82%A6%E3%83%B3%E3%81%AE%E5%85%A8%E6%99%AF%EF%BC%882013%E5%B9%B410%E6%9C%8812%E6%97%A5%E6%92%AE%E5%BD%B1%EF%BC%89.jpg","page_title":"Տոկիո","context_page_description":"Տոկիո, Ճապոնիայի մայրաքաղաքը և 47 պրեֆեկտուրաներից մեկը։ Մեծ Տոկիոյի տարածքն աշխարհում ամենախիտ բնակեցված մետրոպոլիտենն է։ Քաղաքը Ճապոնիայի կայսեր և Ճապոնիայի կառավարության նստավայրն է։ Տոկիոն գտնվում է Հոնսյու կղզու Կանտո տարածաշրջանի հարավարևելյան մասում և ներառում է Իձու և Օգասավարա կղզիները։ Տոկիոն նախկինում հայտնի էր Էդո անվանմամբ ։ 1603 թվականին սյոգուն Իեյասու Տոկուգավան քաղաքը դարձրեց իր շտաբ-բնակարանը և այն դե ֆակտո դարձավ կառավարության նստավայր։ Այն պաշտոնապես դարձավ մայրաքաղաք, երբ Մեյձի կայսրը 1868 թվականին իր նստավայրը Կիոտոյից տեղափոխեց Տոկիո: Հենց այս ժամանակ Էդոն անվանափոխվեց՝ դառնալով Տոկիո։ Տոկիոյի մետրոպոլիսը ձևավորվել է 1943 թվականին\` նախկին Տոկիոյի պրեֆեկտուրայի և Տոկիո քաղաքի միաձուլումից։\\nՏոկիոն հաճախ քաղաք են անվանում, սակայն պաշտոնապես հայտնի է, որ այն կառավարվում է որպես «մայրաքաղաքային պրեֆեկտուրա»: Այն միավորում է քաղաքի և պրեֆեկտուրայի տարրերը, ինչը եզակի է Տոկիոյի համար։ Տոկիոյի մետրոպոլիտենի կառավարությունը ղեկավարում է Տոկիոյի 23 քաղաքային վարչական շրջանները, որն ընդգրկում է շրջան, որը Տոկիո քաղաքն էր մինչև 1943 թվականի միաձուլումը և մետրոպոլիտենային պրեֆեկտուրա դառնալը։"},{"page_url":"https://en.wikipedia.org/wiki/Lazarski_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Lazarski_University.png","page_title":"Lazarski University","context_page_description":"Lazarski University is a private Polish university located in Warsaw, founded by Ryszard Łazarski in 1993.\\nThe educational offer comprises studies at 3 faculties: the Faculty of Law and Administration, the Faculty of Economics and Management and the Faculty of Medicine. The university’s educational offer comprises BA studies, MA studies, doctoral studies in law, postgradual studies, MBA, LLM, doctoral seminars, trainings and language courses. The university also offers studies in English, enabling to obtain the British degree of Coventry University.\\nThe university educates lawyers, economists, business people, civil servants, politicians and diplomats. In 2017, it also started educating doctors at the Faculty of Medicine, as the second private university in Poland."},{"page_url":"https://eo.wikipedia.org/wiki/Boninal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Vegeta%C3%A7%C3%A3o_Morro_de_Areia_-_Boninal_-_Bahia_-_Brasil.jpg","page_title":"Boninal","context_page_description":"Boninal estas municipo en la brazila subŝtato Bahio, kiu havis 13.695 loĝantojn en 2010."},{"page_url":"https://sv.wikipedia.org/wiki/A1_(motorv%C3%A4g,_Tyskland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Autobahn_Overhead_Sign.jpg","page_title":"A1 (motorväg, Tyskland)","context_page_description":"A1 är en motorväg i Tyskland och sträcker sig ifrån Heiligenhafen i norra delen av landet till Saarbrücken i sydvästra delen av landet. Via städerna Lübeck, Hamburg, Bremen, Osnabrück, Münster, Dortmund, Wuppertal, Köln, Trier. Motorvägen är ej utbyggd än i Eifelbergen och ifrån Heiligenhafen till Puttgarden. Motorvägen är 732 km lång och när den är helt utbyggd så kommer den att vara mer 780 km lång, vilket kommer att göra den till en av de längsta motorvägarna i Tyskland. Idag är det endast motorvägarna A7 och A3 som är längre.\\nMotorvägen är en av de viktigare för den skandinaviska europatrafiken. Den delar huvudansvaret tillsammans med A7 för att föra trafiken söderut. A1 leder den skandinaviska trafiken västerut till länder som Frankrike, Spanien, Belgien etcetera, medan A7 leder trafiken mer till länder som Österrike, Schweiz och Italien.\\nDen är också en av de viktigare vägarna i Tyskland, då den förbinder flera stora städer med varandra, som Hamburg och Köln. Den leder också trafik ifrån Hannover och Berlin till Köln."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%AA%E3%83%BC%E3%83%AC%E3%83%B3%E3%83%89%E3%83%AB%E3%83%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Pfarrkirche_Spieskappel.jpg","page_title":"フリーレンドルフ","context_page_description":"フリーレンドルフ は、ドイツ連邦共和国ヘッセン州シュヴァルム＝エーダー郡に属す町村である。この町は州指定の保養地である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%AA%E3%82%B9%E3%83%86%E3%82%A3%E3%82%A2%E3%83%BC%E3%83%8E%E3%83%BB%E3%83%AD%E3%83%8A%E3%82%A6%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Cristiano_Ronaldo_2012.jpg","page_title":"クリスティアーノ・ロナウド","context_page_description":"クリスティアーノ・ロナウド・ドス・サントス・アヴェイロ OIHは、ポルトガル・フンシャル出身のサッカー選手。セリエA・ユヴェントスFC所属。ポルトガル代表。ポジションはフォワード。\\n愛称はCR7、ロニー。日本のメディアからはクリロナとも呼ばれる。テレビやスポーツ紙の多くは「ロナウド」と表記されているが、読売新聞や朝日新聞など一般紙では「ロナルド」表記が用いられている。\\nサッカー関係者からしばしば世界最高の選手と評されるプレイヤー。所属した4チーム全てにおいてリーグ戦または国内スーパーカップでの優勝を経験しており、UEFAチャンピオンズリーグを5度制覇している。イングランドプレミアリーグで3度、スペインリーガ・エスパニョーラで2度、2019年にはイタリアセリエAでも優勝し、欧州三大リーグで優勝した史上初の選手となった。UEFAチャンピオンズリーグで7度得点王を獲得し、バロンドールを5度受賞するなど数々の栄誉を手にした。また、レアル・マドリードの通算最多得点記録、プレミアリーグのシーズン最多得点記録、UEFAチャンピオンズリーグの通算最多得点記録・同シーズン最多得点記録などで、数々の記録を打ち立てている。\\nポルトガル代表では主将を務めており、同国代表の歴代最多出場記録、欧州国家における代表最多得点記録の保持者であると共にUEFA欧州選手権の通算最多出場、最多得点記録保持者でもある。UEFA EURO 2016では主将としてポルトガルを主要な国際大会初優勝に導いた。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%ED%83%88%EB%A6%AC%EC%95%84_%EC%9A%94%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Pizzochero.jpg","page_title":"이탈리아 요리","context_page_description":"이탈리아 요리는 기원전 4세기부터 다양한 사회·정치 변화와 함께 발전해 왔다. 특히 유럽인들이 세계 각지로 진출한 이후 신대륙에서 감자, 토마토, 단고추, 옥수수 등의 다양한 식재료가 유입되면서 이탈리아 요리는 큰 변화를 겪었다. 이런 재료는 18세기 이전까지는 보급되지 않았다.\\n이탈리아 요리는 각지마다 고유한 특색이 있고 다양하지만 크게 북부와 남부로 구분한다. 다른 나라와 국경을 맞대던 북부는 산업화하여 호황을 누리면서 농업이 발달한 덕분에 쌀이나 유제품이 사용되는 요리가 많지만 경제적으로 침체됐던 남부는 지역 특산물인 올리브와 토마토, 모짜렐라 치즈나 해산물을 활용한 요리가 많다.\\n간결함으로 귀결되는 특징이 있어 많은 경우 4개~8개 정도의 재료로 조리되며 정교한 준비 과정보다는 재료의 질에 따라 맛이 좌우된다. 치즈와 포도주는 이탈리아 요리의 핵심을 차지하며 여러 종류가 존재하는데 식재료와 치즈의 차이는 파스타의 종류와 요리에 기본이 되는 수프, 소스의 차이를 뜻한다.\\n2013년 CNN은 세계 최고의 요리로 이탈리아 요리를 선정했다."},{"page_url":"https://ceb.wikipedia.org/wiki/Bredstedt_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/St._Nicolai-Kirche_zu_Bredstedt.JPG","page_title":"Bredstedt (munisipyo)","context_page_description":"Munisipyo ang Bredstedt sa Alemanya. Nahimutang ni sa estado pederal sa Schleswig-Holstein, sa amihanang bahin sa nasod, 400 km sa amihanan-kasadpan sa Berlin ang ulohan sa nasod. Adunay 5,100 ka molupyo.\\nHapit nalukop sa kasagbotan ang palibot sa Bredstedt. Dunay mga 80 ka tawo kada kilometro kwadrado sa palibot sa Bredstedt medyo hilabihan populasyon. Ang klima klima sa kontinente. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 17 °C, ug ang kinabugnawan Enero, sa -4 °C."},{"page_url":"https://fr.wikipedia.org/wiki/Tcherkizovska%C3%AFa_(m%C3%A9tro_de_Moscou)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/PlanSituationBouchesStationTcherkizovska%C3%AFa.jpg","page_title":"Tcherkizovskaïa (métro de Moscou)","context_page_description":"Tcherkizovskaïa est une station de la ligne Sokolnitcheskaïa du métro de Moscou, située sur le territoire du raion Preobrajenskoïe dans le district administratif est de Moscou. Elle dessert notamment le stade Lokomotiv du club de football Lokomotiv Moscou.\\nElle est mise en service en 1990.\\nLa station est ouverte tous les jours aux heures de circulation du métro. Elle est desservie par des trolleybus et des autobus."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Starling","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Australian_Team_Members_Karate_1970.jpg","page_title":"Paul Starling","context_page_description":"Paul Noel Starling is an Australian martial artist renowned as a Gōjū-ryū Karate master. He was the most senior Caucasian student of Gōjū-ryū Gogen Yamaguchi, and is a world Vice President of the International Karate do Goju Kai Association"},{"page_url":"https://cs.wikipedia.org/wiki/Old%C5%99ich_Unger","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bohumil_Kol%C3%A1%C5%99.jpg","page_title":"Oldřich Unger","context_page_description":"Oldřich Unger byl český rozhlasový redaktor, reportér, hlasatel a herec Divadla Járy Cimrmana."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D0%BC%D0%BE%D0%BB%D0%BE%D1%87%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Euphorbia_inconstantia2_ies.jpg","page_title":"Список видів роду молочай","context_page_description":"Список видів роду Молочай:\\nСписок, який містить 2046 визнаних видів роду Молочай, складений на основі даних сайту «The Plant List».\\nУкраїнські назви видів, які містять посилання на авторитетні джерела, є прийнятими українськими назвами."},{"page_url":"https://fi.wikipedia.org/wiki/Elena_B%C4%83sescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Conventia_PD-L_2013_-_Elena_Basescu.jpg","page_title":"Elena Băsescu","context_page_description":"Elena Băsescu on romanialainen poliitikko. Hänet valittiin Euroopan parlamenttiin vuoden 2009 vaaleissa. Hän oli Euroopan kansanpuolueen ryhmän jäsen ja Vetoomusvaliokunnan varapuheenjohtaja.\\nElena Băsescu on presidentti Traian Băsescun tytär. Kampanjan aikana häntä arvosteltiin kokemattomuudesta, mutta kehuttiin korruptoitumattomuudesta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%8D%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/AdelieBlizzardApr1913.jpg","page_title":"Австралийская антарктическая экспедиция","context_page_description":"Австрали́йская антаркти́ческая экспеди́ция 1911—1914 годов — комплексное исследование полярного континента под руководством геолога Дугласа Моусона, уже имевшего полярный опыт после участия в экспедиции Шеклтона 1907—1909 годов. Изначально целью Моусона было составление карты отдельных участков береговой линии Антарктиды в Австралийском секторе континента протяжённостью около 2000 миль из примерно 6600. Значительную финансовую поддержку экспедиции оказала Австралийская ассоциация содействия развитию науки, остальные средства поступили от частных жертвователей и широкой публики. Береговая команда из 31 человека была разделена на два отряда, расположившихся на мысе Денисона и шельфовом леднике Шеклтона, которые собрали, в противоположность экспедиции Шеклтона, преследовавшей, в основном, цели первооткрывательских рекордов, ценные научные данные в самых широких областях — биологии, геологии, гляциологии и метеорологии и др. На острове Маккуори был высажен отдельный экспедиционный отряд, главной целью которого были метеорологические наблюдения и налаживание постоянной радиосвязи между Австралией и Антарктидой."},{"page_url":"https://da.wikipedia.org/wiki/Kristendommens_indf%C3%B8relse_i_Norden","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Charlemagne_et_Louis_le_Pieux.jpg","page_title":"Kristendommens indførelse i Norden","context_page_description":"Kristendommens indførelse i Norden eller religionsskiftet i Norden er betegnelsen for den langvarige religiøse forandring, der ændrede befolkningens trosretning i Norden fra at have været hedninger til hovedsagelig at blive kristne.\\nReligionsskiftet var ikke resultatet af en enkeltstående begivenhed eller handling, men var en langvarig proces under hvilken de nordiske lande blev til centraliserede kongedømmer. De familier der endte med at blive til kongehuse havde i mange år haft nær kontakt med lande, der allerede var kristne og nordiske stormænd havde tætte familiemæssige bånd til kristne fyrstehuse, specielt i Polen, Ukraine og Konstantinopel. Processen var i store træk først afsluttet omkring år 1300, hvorfor hele det nordiske samfund først fra dette tidspunkt var fuldt integreret i den kristne kultur.\\nOvergangen fra det før-kristne samfund til det kristne samfund skete i sammenhæng med gennemgribende sociale, politiske og kulturelle forandringer af de nordiske samfund, hvorunder stormænd blev til konger, der krævede skat, slog mønt og indførte monoteismen for at understøtte denne nye samfundstype."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%8D%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Traverse-%D1%81.jpg","page_title":"Первая русская антарктическая экспедиция","context_page_description":"Первая русская антарктическая экспедиция 1819—1821 под руководством Фаддея Беллинсгаузена и Михаила Лазарева в воды Южного океана имела целью доказать или опровергнуть предположение о существовании шестого материка — Антарктиды. Снаряжалась одновременно с аналогичной экспедицией Михаила Васильева и Глеба Шишмарёва на шлюпах «Открытие» и «Благонамеренный», посылаемой в северные полярные воды. Под командованием Беллинсгаузена находился шлюп «Восток», а Лазарева — шлюп «Мирный», численность команды достигала 190 человек. Из-за чрезвычайной поспешности снаряжения не удалось собрать научного отряда, и практически все научные наблюдения, как в области географии, так и этнографии и естествознания, осуществляли офицеры и единственный учёный на борту — экстраординарный профессор Казанского университета Иван Симонов. Для фиксации событий, ландшафтов открытых островов и биологических видов был взят академик живописи Павел Михайлов, снятые им виды Южных Шетландских островов использовались в английских лоциях даже в 1940-е годы.\\nРусская антарктическая экспедиция завершилась полным успехом, став второй, которая обошла всю Антарктику."},{"page_url":"https://pl.wikipedia.org/wiki/Kandydaci_w_prawyborach_prezydenckich_Partii_Demokratycznej_w_2020_roku","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Michael_Bennet_by_Gage_Skidmore.jpg","page_title":"Kandydaci w prawyborach prezydenckich Partii Demokratycznej w 2020 roku","context_page_description":"Ten artykuł zawiera listę kandydatów w prawyborach Partii Demokratycznej, poprzedzająch wybory prezydenckie w Stanach Zjednoczonych w 2020 roku. Ponad 300 osób zarejestrowało się w Federalnej Komisji Wyborów jako kandydaci na prezydenta Stanów Zjednoczonych z ramienia Partii Demokratycznej."},{"page_url":"https://fr.wikipedia.org/wiki/Nabil_Rajab","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Mohamed_Albuflasa_in_solidarity_with_Rajab.JPG","page_title":"Nabil Rajab","context_page_description":"Nabil Ahmed Abdulrasul Rajab, né le 1ᵉʳ janvier 1954, est un militant des droits de l'homme et un opposant politique bahreïnien. Il est le président du Centre bahreïnien des Droits de l'homme, organisation non gouvernementale sans but lucratif œuvrant à promouvoir les droits de l'homme à Bahreïn. Il est également membre du Comité consultatif de la division Proche-Orient de l'organisation Human Rights Watch, secrétaire général délégué à la Fédération internationale des ligues des droits de l'homme, ancien président de CARAM Asie et président du Centre des Droits de l'homme du Golfe.\\nNabil commença à militer pour les droits de l'homme à l'occasion du soulèvement survenu à Bahreïn dans la décennie 1990, et s'engagea ensuite dans des campagnes en faveur des travailleurs immigrés employés dans les États appartenant au Conseil de coopération du Golfe. Il devint par la suite l'un des principaux militants à mener campagne contre les violations des droits de l'homme à Bahreïn, notamment contre la torture et les décès lors de détentions."},{"page_url":"https://af.wikipedia.org/wiki/Pier_Paolo_Pasolini","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Pier_Paolo_Pasolini.jpg","page_title":"Pier Paolo Pasolini","context_page_description":"Pier Paolo Pasolini was 'n Italiaanse filmregisseur, digter, skrywer en intellektueel, wat hom ook onderskei het as akteur, joernalis, romanskrywer, dramaturg en politieke figuur.\\nHy bly 'n kontroversiële persoonlikheid in Italië vanweë sy stomp styl en die fokus van sommige van sy werke op seksuele taboe-aangeleenthede. Hy was 'n gevestigde hooffiguur in Europese letterkunde en filmkuns. Sy moord het heftige openbare proteste in Italië uitgelok, terwyl steeds debatte gevoer word oor die omstandighede daarvan. Pasolini is dood op die strand van Ostia naby Rome aangetref. 'n Nadoodse ondersoek het gewys dat hy deur sy eie motor doodgery is. Die motor het blykbaar verskeie kere bo-oor hom gerol.\\nIn 1979 is die manlike prostituut Pier Pelosi, wat op die tydstip van die moord sewentien jaar oud was, van moord aangekla en skuldig bevind. Hy is tot 'n tronkstraf van nege jaar en sewe maande gevonnis wat hy tot 1982 uitgedien het. Eers later het hy beweer dat hy die moord in opdrag van verskeie opdraggewers gepleeg het."},{"page_url":"https://en.wikipedia.org/wiki/Ore_Mountains","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Klimadiagramm-deutsch-Fichtelberg_%28SN%29-Deutschland.png","page_title":"Ore Mountains","context_page_description":"The Ore Mountains or Ore Mountain Range in Central Europe have formed a natural border between Saxony and Bohemia for around 800 years, from the 12th to the 20th centuries. Today, the border between Germany and the Czech Republic runs just north of the main crest of the mountain range. The highest peaks are the Klínovec, which rises to 1,244 metres above sea level and the Fichtelberg.\\nThe area played an important role in contributing Bronze Age ore, and as the setting of the earliest stages of the early modern transformation of mining and metallurgy from a craft to a large-scale industry, a process that preceded and enabled the later Industrial Revolution.\\nIn 2019 the region became a UNESCO World Heritage site."},{"page_url":"https://fr.wikipedia.org/wiki/Algorithme_d%27Euclide","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Euklid.jpg","page_title":"Algorithme d'Euclide","context_page_description":"En mathématiques, l'algorithme d'Euclide est un algorithme qui calcule le plus grand commun diviseur de deux entiers, c'est-à-dire le plus grand entier qui divise les deux entiers, en laissant un reste nul. L'algorithme ne connaît pas la factorisation de ces deux nombres."},{"page_url":"https://ca.wikipedia.org/wiki/Marcilhac_(Pu%C3%A8i_Domat)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Map_commune_FR_insee_code_63208.png","page_title":"Marcilhac (Puèi Domat)","context_page_description":"Marcillat és un municipi francès, situat al departament del Puèi Domat i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 195 habitants."},{"page_url":"https://sv.wikipedia.org/wiki/Mirabel-aux-Baronnies","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Mirabel_aux_Baronnies.jpg","page_title":"Mirabel-aux-Baronnies","context_page_description":"Mirabel-aux-Baronnies är en kommun i departementet Drôme i regionen Auvergne-Rhône-Alpes i sydöstra Frankrike. Kommunen ligger i kantonen Nyons som tillhör arrondissementet Nyons. År 2009 hade Mirabel-aux-Baronnies 1 530 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/Ferdinando_Minoia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Ferdinando_Minoia_in_1931_%28cropped%29.jpg","page_title":"Ferdinando Minoia","context_page_description":"Ferdinando Minoia, dit Nando Minoia né le 2 juin 1884 à Milan et mort le 28 juin 1940 est un pilote automobile italien qui a connu une carrière, exceptionnellement longue et variée. Il remporte la Coppa Florio en 1907 sur Isotta-Fraschini. En 1923, il devient le premier pilote à conduire une voiture avec un moteur en position centrale, la Benz Tropfenwagen. Il remporte en 1927 la première édition des Mille Miglia sur une OM et enfin, devient en 1931, le premier champion d'Europe des pilotes de l'AIACR sur Alfa Romeo sans avoir gagné la moindre course du championnat."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BD%D0%B3%D0%B0%D1%80%D1%8B%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mount_Tongariro.jpg","page_title":"Тангарыра","context_page_description":"Тангарыра — вульканічны масіў у цэнтральнай частцы Паўночнага вострава Новай Зэляндыі.\\nМасіў складаецца з 12 конусаў вышынёй да 1978 м, знаходзіцца на тэрыторыі аднайменнага нацыянальнага парку. Першае вывяржэньне вулькану датаванае прыкладна 250 тыс. год таму. З 1839 року зарэгістравана болей за 70 вывяржэньняў, апошняе адбылося ў 2012 пасьля 115-гадовага перапынку.\\nНа схілах Тангарыра і суседняга вулькану Нгаўрухоэ ў 2000—2003 ладзіліся здымкі трылёгіі «Ўладар пярсьцёнкаў»."},{"page_url":"https://de.wikipedia.org/wiki/Automobilwerk_Zwickau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/P_50_Trabant.jpg","page_title":"Automobilwerk Zwickau","context_page_description":"Der VEB Automobilwerk Zwickau war ein Kraftfahrzeughersteller in Zwickau. Der Volkseigene Betrieb ging 1955 aus dem VEB Kraftfahrzeugwerk Audi Zwickau hervor, das bis 1948 als „Werk Audi“ zur Auto Union AG, Chemnitz gehörte.\\nDer zum Industrieverband Fahrzeugbau der DDR gehörende Pkw-Hersteller AWZ wurde 1958 mit dem VEB Sachsenring Kraftfahrzeug- und Motorenwerke Zwickau zum VEB Sachsenring Automobilwerke Zwickau vereinigt."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_Camille-Desmoulins_(Paris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/P1020687_Paris_XI_Rue_Camille_Desmoulins_rwk.JPG","page_title":"Rue Camille-Desmoulins (Paris)","context_page_description":"La rue Camille-Desmoulins est une voie située dans le quartier de la Roquette du 11ᵉ arrondissement de Paris, en France."},{"page_url":"https://en.wikipedia.org/wiki/Parham,_Suffolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Parham_Village_Sign_-_geograph.org.uk_-_959077.jpg","page_title":"Parham, Suffolk","context_page_description":"Parham is a village and civil parish in the East Suffolk district of Suffolk in eastern England. Located seven miles north of Woodbridge, in 2005 it had a population of 300, reducing to 263 at the 2011 census and according to the 2011 census there were 129 males and 134 females living at this time.\\nThe flint-built parish church of St Mary, though restored in 1886, dates from the late 14th Century and was likely built for William de Ufford. The Rood screen is from the 15th Century. Parham is located on the B1116. William Willoughby, 1st Baron Willoughby of Parham is interred in the church, too.\\nParham Airfield Museum is located nearby. Parham railway station, on the Framlingham Branch, was shut to passenger traffic in November 1952.\\nBetween 1870 and 1872 John Marius Wilson's Imperial Gazetteer visited Parham and wrote the following as an entry for the parish.\\nPARHAM, a village and a parish in Plomesgate district, Suffolk. The village stands on the river Ore, adjacent to the Framlingham branch of the East Suffolk railway, 2¼ miles S S E of Framlingham; and has a station on the railway, and a post-office under Wickham-Market. The parish comprises 2, 212 acres."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%A8%D0%B0%D0%BF%D0%B5%D0%BB%D1%8C-%D0%9A%D1%80%D0%B0%D0%BE%D0%BD%D0%BD%D0%B5%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/La_Chapelle-Craonnaise_-_%C3%89glise_01.jpg","page_title":"Ла-Шапель-Краоннез","context_page_description":"Ла-Шапе́ль-Краонне́з — муніципалітет у Франції, у регіоні Пеї-де-ла-Луар, департамент Майєнн. Населення — 327 осіб.\\nМуніципалітет розташований на відстані близько 270 км на південний захід від Парижа, 90 км на північний схід від Нанта, 23 км на південний захід від Лаваля."},{"page_url":"https://es.wikipedia.org/wiki/IKEA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Map_of_IKEA_stores.svg","page_title":"IKEA","context_page_description":"IKEA es una corporación multinacional con sede en Suecia dedicada a la fabricación y venta minorista de muebles en paquete plano, colchones, electrodomésticos y objetos para el hogar. Fue fundada en la provincia de Småland en 1943 por Ingvar Kamprad. Al año 2015 IKEA contaba con 328 tiendas en 28 países​ y empleaba a 155 000 trabajadores, y su éxito en el mundo de las operaciones es caso de estudio en las escuelas de negocios.​. Su casa matriz está en la ciudad sueca de Älmhult.\\nLa empresa está controlada por INGKA Holding B.V., junto a uno de sus fundadores de mobiliario que es controlada a su vez por una fundación benéfica​ sin ánimo de lucro y con una baja carga fiscal. Su propiedad intelectual está controlada por una serie de corporaciones que llevan hasta las Antillas Neerlandesas​ y la Interogo Foundation de Liechtenstein.​\\nLa palabra IKEA está formada por las iniciales de su fundador Ingvar Kamprad más la primera letra de Elmtaryd y Agunnaryd, que son la granja y la aldea donde creció, respectivamente. La marca IKEA pertenece a una fundación establecida en los Países Bajos bajo el control de la familia Kamprad y que cobra un canon a cada establecimiento por su operación."},{"page_url":"https://en.wikipedia.org/wiki/Formation_of_Donald_Trump%27s_Cabinet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Gary_D._Cohn_-_World_Economic_Forum_Annual_Meeting_Davos_2010.jpg","page_title":"Formation of Donald Trump's Cabinet","context_page_description":"As President, Donald Trump has the authority to nominate members of the United States Cabinet to the Senate for confirmation under the Appointments Clause, in Article II, Section II, Clause II of the Constitution.\\nThey are listed in order of creation of the cabinet position, which is also used as the basis for the presidential line of succession."},{"page_url":"https://fr.wikipedia.org/wiki/Rabat_(v%C3%AAtement)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Beffhen.JPG","page_title":"Rabat (vêtement)","context_page_description":"Le rabat est une double pièce de tissu, généralement amidonnée et de couleur blanche, placée sous le col, qui descend sur le devant du vêtement."},{"page_url":"https://eo.wikipedia.org/wiki/Konveksa_unuforma_kahelaro_de_e%C5%ADklida_3-spaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Rectified_cubic_honeycomb2.png","page_title":"Konveksa unuforma kahelaro de eŭklida 3-spaco","context_page_description":"En geometrio, konveksa unuforma kahelaro de eŭklida 3-spaco estas unuforma kahelaro de tri-dimensia eŭklida spaco kun ne-interkovrantaj konveksaj unuformaj pluredraj ĉeloj. Vorto konveksa ĉi tie ne estas uzata plene laŭ difino de la konveksa aro, sed analoge al kondiĉoj de konvekseco de hiperpluredro. Do, konveksa kahelaro estas kahelaro kiu verigas kondiĉojn de konvekseco de hiperpluredro, krom tio ke la angula difekto ne estas pozitiva.\\nEkzistas 28 ĉi tiaj kahelaroj:\\nLa sola regula kahelaro de eŭklida 3-spaco, kuba kahelaro, kaj 7 ĝiaj tranĉoj;\\nLa alternita kuba kahelaro kaj 4 ĝiaj tranĉoj;\\n10 prismaj formoj bazitaj je la unuformaj ebenaj kahelaroj;\\n5 ŝanĝoj de iuj el la pli supre listigitaj per plilongigo aŭ turnigo.\\nIli povas esti konsiderataj la tri-dimensiaj analogoj de la unuformaj kahelaroj de la ebeno."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27%C5%93uvres_d%27art_public_%C3%A0_Montr%C3%A9al","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Beaver_Lake_Chalet.jpg","page_title":"Liste d'œuvres d'art public à Montréal","context_page_description":"Montréal possède une riche tradition d'art public. Inscrites de plain-pied dans le paysage urbain, les œuvres d'art public façonnent l'environnement de la métropole. Qu'elles soient intégrées aux parcs, aux places publiques, aux bibliothèques ou aux centres culturels, ces œuvres font partie du décor quotidien du montréalais ou du visiteur. Reflet de notre histoire, les œuvres d’art public de la métropole comprennent notamment des sculptures, des monuments, des bustes, des fontaines et des œuvres d’art contemporain."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%96%D0%B8%D0%BC%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Gimeux2.JPG","page_title":"Жиме","context_page_description":"Жиме насеље је и општина у западној Француској у региону Поату-Шарант, у департману Шарант која припада префектури Коњак.\\nПо подацима из 2011. године у општини је живело 736 становника, а густина насељености је износила 99,46 становника/km². Општина се простире на површини од 7,4 km². Налази се на средњој надморској висини од 60 метара."},{"page_url":"https://pl.wikipedia.org/wiki/Toru%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Mury_Starego_Miasta_w_Toruniu.jpg","page_title":"Toruń","context_page_description":"Toruń – miasto na prawach powiatu w północnej Polsce, siedziba sejmiku, zarządu i marszałka województwa oraz jednostek im podporządkowanych. Jest również jednym z miast centralnych Bydgosko-Toruńskiego Obszaru Funkcjonalnego. Stolica diecezji toruńskiej. Drugie co do wielkości miasto w województwie kujawsko-pomorskim. Położone jest nad Wisłą i Drwęcą. Jego prawobrzeżna część leży na Pomorzu, zaś lewobrzeżna znajduje się na Kujawach.\\nToruń, z liczbą 201 447 mieszkańców, zajmuje 15. miejsce w Polsce. Jest dużym ośrodkiem gospodarczym i handlowym oraz ważnym węzłem drogowym i kolejowym. Pod Toruniem działa Pomorska Specjalna Strefa Ekonomiczna. Toruń to również ośrodek akademicki, naukowy, kulturalny i turystyczny. Na największej w mieście uczelni, Uniwersytecie Mikołaja Kopernika w 2017 roku studiowało blisko 20 tys. studentów. W mieście działa orkiestra symfoniczna oraz teatry, kina, liczne muzea i galerie sztuki. W ciągu miesiąca w Toruniu odbywa się średnio sto różnego rodzaju imprez kulturalnych, poczynając od festiwali, koncertów, wystaw, spektakli teatralnych, przeglądów poetyckich i fotograficznych, a na plenerowych pokazach historycznych kończąc."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%A7%D9%88%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/11-Navban_2.png","page_title":"ناوبان","context_page_description":"ناوبان یکم، دوم و سوم نام سه درجه در نیروی دریایی ارتش جمهوری اسلامی ایران می‌باشند که معادل ستوان یکم، دوم و سوم در سایر نیروهای ارتش ایران می‌باشند. ناوبان سوم پایین‌ترین درجهٔ افسری در نیروی دریایی می‌باشد."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_missions_in_Russia","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Smolenskaya_Nab_10_02.JPG","page_title":"List of diplomatic missions in Russia","context_page_description":"This is a list of diplomatic missions in Russia. As the world's largest country, a permanent member of the United Nations Security Council, regional power in Europe and Asia and the principal successor state to the Soviet Union, the Russian Federation hosts a large diplomatic community in its capital city of Moscow. Moscow hosts 148 embassies, with numerous countries maintaining consulates general and consulates throughout the country."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Clamerey","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Map_commune_FR_insee_code_21177.png","page_title":"Clamerey","context_page_description":"Clamerey sī ūi-tī Hoat-kok Bourgogne tōa-khu Côte-d'Or séng ê chi̍t-ê commune."},{"page_url":"https://vi.wikipedia.org/wiki/Grave","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Grave_skyline_maaskade.jpg","page_title":"Grave","context_page_description":"Grave là một đô thị và thành phố ở phía nam Hà Lan. Grave là một thành phố có tường thành, ở tỉnh Brabant."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%81%DB%81%D8%B1%D8%B3%D8%AA_%D8%B4%DB%81%D8%B1_%D8%A8%D9%84%D8%AD%D8%A7%D8%B8_%D8%B3%D8%A8_%D8%B3%DB%92_%D8%B2%DB%8C%D8%A7%D8%AF%DB%81_%D8%A8%D9%84%D9%86%D8%AF_%D9%88_%D8%A8%D8%A7%D9%84%D8%A7_%D8%B9%D9%85%D8%A7%D8%B1%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Dniepr_river_in_Kyiv.jpg","page_title":"فہرست شہر بلحاظ سب سے زیادہ بلند و بالا عمارات","context_page_description":"یہ فہرست شہر بلحاظ سب سے زیادہ بلند و بالا عمارتیں ہیں۔ بلند و بالا عمارت سے مراد ایک ایسا ڈھانچے ہے جو کم از کم 35 میٹر یا 12 منزلوں پر مشتمل ہو۔ یہ ان شہروں کی فہرست ہے جن میں 100 یا اس سے زیادہ بلند و بالا عمارتیں موجود ہیں۔"},{"page_url":"https://hr.wikipedia.org/wiki/Bistabil","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/JK_FF_impulse_diagram.png","page_title":"Bistabil","context_page_description":"Bistabil, je sekvencijalni sklop digitalne elektronike koji može zapamtiti podatak veličine jedan bit. Elektronički gledano radi se o bistabilnom multivibratoru, tj. o sklopu koji ima dva stabilna stanja. Bistabili u osnovnoj izvedbi, zvanoj SR-bistabil, imaju dva ulaza i dva izlaza, no postoje i složenije izvedbe koje imaju i do pet ulaza. Neki od tih ulaza mogu reagirati na logičko staǌe na ǌima, dok neki reagiraju na promjenu staǌa. Ulazni impulsi koji se dovode bistabilu se znaju nazivati i okidni impulsi. Ulazi se označavaju ovisno o vrsti bistabila, dok se izlazi označavaju s i. Promjena iz jednog stabilnog stanja u drugo naziva se okidanje bistabila.\\nBistabile možemo podijeliti u dvije osnovne skupine i to na asinkrone i sinkrone bistabile. Asinkroni bistabili imaju svojstvo da reagiraju na promjenu impulsa čim se pojavi na ulazu u sklop, što daje pogrešan rezultat kada se ulazni impulsi ne dovode istovremeno na ulaz. Sinkroni bistabil je verzija asinkronog koji ima dodatni ulaz na koji se dovode sinkronizacijski impulsi konstantne frekvencije tako da bistabil mijenja stanje na promjenu okidnog impulsa.\\nBistabil su 1919. godine napravili William Eccles i F. W."},{"page_url":"https://ceb.wikipedia.org/wiki/Balmain_(bahin_nga_lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Balmain_Court_House_Post_Office.JPG","page_title":"Balmain (bahin nga lungsod)","context_page_description":"Bahin nga lungsod ang Balmain sa Ostralya. Nahimutang ni sa rehiyon sa Leichhardt ug estado sa State of New South Wales, sa habagatan-sidlakang bahin sa nasod, 250 km sa amihanan-sidlakan sa Canberra ang ulohan sa nasod. 13 metros ibabaw sa dagat kahaboga ang nahimutangan sa Balmain, ug adunay 9,783 ka molupyo.\\nAng yuta palibot sa Balmain kay patag. Ang usa ka luok sa sidlakan, dagat ang pinakaduol sa Balmain. Ang kinahabogang dapit sa palibot dunay gihabogon nga 84 ka metro ug 2.1 km sa sidlakan sa Balmain. Dutdot ang lumulupyo ining dapita. Ang kinadul-ang mas dakong lungsod mao ang Sydney, 2.6 km sa habagatan-sidlakan sa Balmain. Sa rehiyon palibot sa Balmain, mga lawis, mga lapyahan, ug mga luuk talagsaon komon.\\nHapit nalukop sa kabalayan ang palibot sa Balmain. Ang klima umogon ug subtropikal. Ang kasarangang giiniton 18 °C. Ang kinainitan nga bulan Disyembre, sa 24 °C, ug ang kinabugnawan Hulyo, sa 10 °C. Ang kasarangang pag-ulan 1,380 milimetro matag tuig. Ang kinabasaan nga bulan Pebrero, sa 200 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 36 milimetro."},{"page_url":"https://ro.wikipedia.org/wiki/Iosafat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Monegro-Josapfat-Ezechias.jpg","page_title":"Iosafat","context_page_description":"Iosafat este menționat în Vechiul Testament ca al patrulea rege în Iuda, din casa lui David. El era fiul lui Asa și al Azubei, fiica lui Șilhi. El a domnit între 873 î.Hr. - 849 î.Hr., 870 î.Hr. - 48 î.Hr. sau 870 î.Hr. - 845 î.Hr. Iosafat a domnit douăzeci și cinci de ani și a venit pe tron la treizeci și cinci de ani."},{"page_url":"https://eo.wikipedia.org/wiki/Provincoj_de_Finnlando","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Finland_Regions_Map_Numbered.svg","page_title":"Provincoj de Finnlando","context_page_description":"Finnlando estas dividita al 19 modernaj provincoj aŭ regionoj. La provincoj estas regataj desube: la provincajn deputitarojn elektas aŭ la deputitoj de ĝiaj komunumoj aŭ, por la provincoj Alando kaj Kainuu, rekte la loĝantaro. Ĝis la fino de 2009 la lando havis ankaŭ 6 guberniojn, kiuj estis distriktoj de ŝtata administrado, sed tiuj estis malfonditaj. La provinco Alando havas ampleksan aŭtonomion.\\nEsperanto-finnaj kaj Esperanto-svedaj vortaroj tradukas la koncepton maakunta respektive landskap al Esperanto per la vorto \\"provinco\\", kaj la historian koncepton lääni respektive län al Esperanto per la vorto \\"gubernio\\", nelaste pro la longa rusa regado en Finnlando, kiam la koncepto de lääni en la rusa lingvo nomatis plurale Губерний = gubernioj kaj la koncepto de maakunta ruse nomatis plurale Провинций = provincoj. Aliaj eŭropaj lingvoj nun tradukas maakunta respektive landskap per ekvivalento de la vorto \\"regiono\\", kaj tradukas la historiajn unuojn lääni respektive län per ekvivalento de la vorto \\"provinco\\". Tio kontrastas al la esperanta lingvouzo kaj povas kaŭzi konfuzon."},{"page_url":"https://it.wikipedia.org/wiki/Saint-Martin-le-Vinoux","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/St_Martin_le_Vinoux.JPG","page_title":"Saint-Martin-le-Vinoux","context_page_description":"Saint-Martin-le-Vinoux è un comune francese di 5.431 abitanti situato nel dipartimento dell'Isère della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://no.wikipedia.org/wiki/Sikorsky_UH-60_Black_Hawk","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/HH-60G_Pave_Hawk.jpg","page_title":"Sikorsky UH-60 Black Hawk","context_page_description":"Sikorsky UH-60 Black Hawk er et mellomstort flerbrukshelikopter. Det er i bruk av militæret i mer enn 20 land, deriblant USA, Australia, Israel og Østerrike. Helikopteret kan brukes til mange forskjellige oppgaver, blant annet taktisk forflytting, elektronisk krigføring og evakuering av sårede.\\nBlack Hawk ble konstruert for å erstatte Bell UH-1 Iroquois i 1972 og ble satt inn i tjeneste i 1979."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%B7%E8%9C%86%E8%9D%B6%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Eurybiahalimede.jpg","page_title":"海蜆蝶屬","context_page_description":"海蜆蝶屬是蜆蝶科蜆蝶亞科海蜆蝶族裡的一個屬。共有21個物種，分布於新熱帶界低地。一些物種有兩性異型，大多數物種都會在不同的分布地域出現各種形態，使更難辨認。"},{"page_url":"https://en.wikipedia.org/wiki/COVID-19_pandemic_on_cruise_ships","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/World_Dream.jpg","page_title":"COVID-19 pandemic on cruise ships","context_page_description":"The COVID-19 pandemic spread to a number of cruise ships, with the nature of such ships—including crowded semi-enclosed areas, increased exposure to new environments, and limited medical resources—contributing to the heightened risk and rapid spread of the disease.\\nThe British-registered Diamond Princess was the first cruise ship to have a major outbreak on board, with the ship quarantined at Yokohama from 4 February 2020 for approximately one month. Over 700 people became infected, and 14 people died. At the time, the ship accounted for over half the reported cases of SARS-CoV-2 outside of mainland China.\\nGovernments and ports responded by preventing many cruise ships from docking and advising people to avoid travelling on cruise ships. Similarly, many cruise lines suspended their operations to mitigate the spread of the pandemic.\\nAs of 2 May 2020, over 40 cruise ships have had confirmed positive cases of coronavirus on board. The last cruise ship with passengers aboard during the first wave of the pandemic, Artania, docked at its home port with its last eight passengers on 8 June 2020."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%AElots_de_l%27%C3%AEle_du_Mill%C3%A9naire","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/CarolineIsland-CentralLeeward.JPG","page_title":"Liste des îlots de l'île du Millénaire","context_page_description":"L’île du Millénaire, souvent appelée île de Caroline, est un atoll des Kiribati en forme de croissant situé à 1 500 km au sud de l'archipel d'Hawaï au centre de l'océan Pacifique. Elle est composée de 39 îlots entourant un lagon central peu profond. Les îlots, qui n'émergent que de quelques mètres au-dessus du niveau de la mer, ont une origine géologique commune et sont composés de dépôts de sable et de roches calcaires reposant sur le récif corallien.\\nTrois grands îlots - Nake, Long, et les îlots du Sud - représentent 68 % de la superficie terrestre. Le restant des îlots, répartis en quatre groupes, furent étudiés lors d'une étude écologique réalisée par Angela et Cameron Kepler en 1988. À cette époque, beaucoup de ces îlots isolés, alors sans nom, furent nommés par des dérivés de langues polynésiennes. Plusieurs des îlots les plus petits furent alors remarqués comme disparaissant entièrement ou réapparaissant suivant les grandes tempêtes, la forme des plus grands îlots ayant d'ailleurs beaucoup changé au cours du siècle passé."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EB%AC%B4%EB%8B%A4%EB%A6%AC%EC%95%BC%EA%B0%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Aral_map.png","page_title":"아무다리야강","context_page_description":"아무다리야 강은 파미르 고원에서 발원해, 힌두쿠시 산맥을 빠져서 투르크메니스탄과 우즈베키스탄의 국경 지대의 북서쪽에서 흐르는 강이다. 고대에는 옥수스 강, 중세에는 지훈 강이라고 불리기도 했다. 원래는 아랄 해로 흘러서 들어갔지만, 면화 재배를 목적으로 한 과도한 관개로 인한 사막화로 인해 현재는 사막 쪽에서 사라지고 있다. 연장 1450km. \\"다리야\\"는 투르크어로 \\"강\\"의 의미이므로 \\"아무 강\\"이라고 표기하는 경우도 볼 수 있다. 일부 구간은 우즈베키스탄 · 타지키스탄과 아프가니스탄의 국경으로 기능하고 있다."},{"page_url":"https://tr.wikipedia.org/wiki/Samsun%27da_Haziran_2015_T%C3%BCrkiye_genel_se%C3%A7imleri","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Samsun%27da_2015_T%C3%BCrkiye_genel_se%C3%A7imleri%2C_Ladik.png","page_title":"Samsun'da Haziran 2015 Türkiye genel seçimleri","context_page_description":"Samsun'da Haziran 2015 Türkiye genel seçimleri, 7 Haziran 2015 tarihinde gerçekleşen Haziran 2015 Türkiye genel seçimlerinin Samsun sonuçları. İldeki toplam 3.132 sandıkta oy kullanması beklenen 917.806 seçmenin 754.912'si oy kullanmış ve seçime katılım %84,11 oranında gerçekleşmiştir. Kullanılan oyların 17.147'si ise geçersiz sayılmıştır. Yurt dışında yaşayıp Samsun seçim çevresinde oy kullanan kişi sayısı ise 17.424 olmuştur.\\nSeçimlere katılma yeterliliği taşıyan otuz bir partiden yirmisi seçimlere katılmış ve bu partilerden on altısı Samsun'da aday göstermiş, buna karşın Doğru Yol Partisi, Hak ve Adalet Partisi, Hak ve Özgürlükler Partisi ve Yurt Partisi Samsun'da aday göstermemişler ancak yurt dışı oy pusulasında yer almaları dolayısıyla Samsun'da da oy almışlardır. Ayrıca üç bağımsız aday Samsun seçim çevresinde seçime katılmış, böylece milletvekilliği için yarışacak aday sayısı toplam 147 olmuştur.\\nMilletvekili adayları partilerin il teşkilatlarının tavsiyesi doğrultusunda genel merkez tarafından belirlenmiştir."},{"page_url":"https://sv.wikipedia.org/wiki/Euceratocerus_gibbifrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Euceratocerus_gibbifrons_P1210075a.jpg","page_title":"Euceratocerus gibbifrons","context_page_description":"Euceratocerus gibbifrons är en skalbaggsart som beskrevs av White 1960. Euceratocerus gibbifrons ingår i släktet Euceratocerus och familjen trägnagare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_T%C3%B6nisvorst","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/57_Fachwerkger%C3%BCst%2C_Hahnenweide_28_%28Vorst%29.jpg","page_title":"Liste der Baudenkmäler in Tönisvorst","context_page_description":"Die Liste der Baudenkmäler in Tönisvorst enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Tönisvorst im Kreis Viersen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Tönisvorst eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://es.wikipedia.org/wiki/Patrick_Dempsey","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Patrick_Dempsey_Le_Mans_2009.jpg","page_title":"Patrick Dempsey","context_page_description":"Patrick Galen Dempsey es un actor y piloto de carreras estadounidense.\\nSe le conoce sobre todo por interpretar al neurocirujano Derek Shepherd en la serie Anatomía de Grey por el que fue nominado al Emmy.\\nHa aparecido en películas como No puedes comprar mi amor, Estallido, Sweet Home Alabama, Encantada, Made of Honor, Historias de San Valentín o Transformers: el lado oscuro de la luna."},{"page_url":"https://it.wikipedia.org/wiki/What_Kind_of_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/What_Kind_of_Man_-_Logo.jpg","page_title":"What Kind of Man","context_page_description":"What Kind of Man è un singolo del gruppo musicale britannico Florence and the Machine, il primo estratto dal terzo album in studio How Big, How Blue, How Beautiful e pubblicato il 12 febbraio 2015.\\nParticolarmente apprezzato dalla critica, si è aggiudicato due candidature al prestigioso Premio Grammy del 2016 nelle categorie miglior interpretazione rock e miglior canzone rock."},{"page_url":"https://en.wikipedia.org/wiki/Manlius_Township,_LaSalle_County,_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Map_highlighting_Manlius_Township%2C_La_Salle_County%2C_Illinois.svg","page_title":"Manlius Township, LaSalle County, Illinois","context_page_description":"Manlius Township is located in east-central LaSalle County, Illinois. As of the 2010 census, its population was 6,275 and it contained 2,782 housing units. It contains the town of Seneca and the eastern part of Marseilles."},{"page_url":"https://it.wikipedia.org/wiki/Ferdinand_von_Schill","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Schill_Statue.JPG","page_title":"Ferdinand von Schill","context_page_description":"Ferdinand Baptista von Schill è stato un ufficiale prussiano noto per essere insorto, senza successo, contro l'occupazione francese."},{"page_url":"https://cy.wikipedia.org/wiki/Sisticola_cefnfrown","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/TrochalopteronPhoeniceumGould.jpg","page_title":"Sisticola cefnfrown","context_page_description":"Aderyn a rhywogaeth o adar yw Sisticola cefnfrown a adnabyddir hefyd gyda'i enw gwyddonol Cisticola discolor; yr enw Saesneg arno yw Brown-backed cisticola. Mae'n perthyn i deulu'r Teloriaid sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn C. discolor, sef enw'r rhywogaeth."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%B1%D0%B0%D1%80%D0%B0_%D0%AF%D0%B3%D0%B5%D0%BB%D0%BB%D0%BE%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Lucas_Cranach_d.%C3%84._-_Bildnis_Barbara_von_Sachsen_%28Gem%C3%A4ldegalerie%2C_Berlin%29.jpg","page_title":"Барбара Ягеллонка","context_page_description":"Барбара Польська або Барбара Ягеллонка — польська королівна та литовська княжна з династії Ягеллонів, донька короля Польщі Казимира IV та Єлизавети Габсбург, дружина Георга, герцога Саксонського."},{"page_url":"https://de.wikipedia.org/wiki/Strategische_Raketentruppen_der_Sowjetunion","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Soviet_Military_Power_ICBM_map.gif","page_title":"Strategische Raketentruppen der Sowjetunion","context_page_description":"Die Strategischen Raketentruppen der Sowjetunion waren von 1958 bis 1992 eine Teilstreitkraft der Sowjetarmee. In der offiziellen Rangfolge der Teilstreitkräfte der Sowjetarmee nahmen die Raketentruppen noch vor den Landstreitkräften den ersten Rang ein. Die sowjetischen Einsatzgrundsätze unterschieden sich bei den Boden-Boden-Raketen für strategische, operative und taktische Raketen. Mit nuklearen Sprengköpfen ausgerüstete Raketensysteme strategischer Bedeutung mit Reichweiten ab 1.000 km wurden in den Strategischen Raketentruppen zusammengefasst. Truppenteile, die mit Operativ-taktischen Raketenkomplexen mit Reichweiten von mehreren hundert Kilometern ausgerüstet waren, wurden den Armeen bzw. Armeekorps zugeordnet. Taktische Raketenkomplexe wurden den motorisierten Schützen- und Panzerdivisionen zugeordnet. Sie dienten der Bekämpfung von Zielen im Verantwortungsbereich der Division und hatten eine Reichweite von bis zu 120 km."},{"page_url":"https://fr.wikipedia.org/wiki/Indopith%C3%A8que","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Gigantopithecus_bilaspurensis_mandible.JPG","page_title":"Indopithèque","context_page_description":"Indopithecus est un genre éteint de primates de la famille des hominidés, qui vivait en Asie du Sud durant le Miocène supérieur, il y a 8 à 9 millions d'années."},{"page_url":"https://en.wikipedia.org/wiki/Vitrified_clay_pipe","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/VCP_Install.jpg","page_title":"Vitrified clay pipe","context_page_description":"Vitrified clay pipe is pipe made from a blend of clay and shale that has been subjected to high temperature to achieve vitrification, which results in a hard, inert ceramic.\\nVCP is commonly used in gravity sewer collection mains because of its long life and resistance to almost all domestic and industrial sewage, particularly the sulfuric acid that is generated by hydrogen sulfide, a common component of sewage. Only hydrofluoric acid and highly concentrated caustic wastes are known to attack VCP. Such wastes would not be permitted to be discharged into a municipal sewage collection system without adequate pretreatment.\\nThere are three main types of VCP produced in the U.S.: Bell & Spigot Pipe, Band-Seal pipe and NO-DIG Pipe. All VCP manufactured in the U.S. must comply with ASTM C425 to provide a flexible leak-free joint.\\nClay pipe has been in-use in sanitary sewer systems for at least 5,000 years"},{"page_url":"https://it.wikipedia.org/wiki/Battistero_di_Cremona","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Paolo_Monti_-_Servizio_fotografico_-_BEIC_6357528.jpg","page_title":"Battistero di Cremona","context_page_description":"Il battistero di San Giovanni Battista è il battistero di Cremona, situato accanto al duomo della città. È alto 34 metri e ha un diametro di 20,50 metri; la pianta dell'edificio è ottagonale, con riferimento numerologico all'otto."},{"page_url":"https://sv.wikipedia.org/wiki/Myomyrus_macrodon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Mat%C3%A9riaux_pour_la_faune_du_Congo_%286298591245%29.jpg","page_title":"Myomyrus macrodon","context_page_description":"Myomyrus macrodon är en fiskart som beskrevs av Boulenger, 1898. Myomyrus macrodon ingår i släktet Myomyrus och familjen Mormyridae. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Meteor_(web_framework)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Meteor-logo.png","page_title":"Meteor (web framework)","context_page_description":"Meteor, or MeteorJS, is a free and open-source isomorphic JavaScript web framework written using Node.js. Meteor allows for rapid prototyping and produces cross-platform code. It integrates with MongoDB and uses the Distributed Data Protocol and a publish–subscribe pattern to automatically propagate data changes to clients without requiring the developer to write any synchronization code. On the client, Meteor can be used with any popular front-end JS framework, Vue, React, Svelte, Angular, or Blaze.\\nMeteor is developed by Meteor Software. The startup was incubated by Y Combinator and received $11.2M in funding from Andreessen Horowitz in July 2012. Meteor raised an additional $20M in Series B funding from Matrix Partners, Andreessen Horowitz and Trinity Ventures. It intends to become profitable by offering Galaxy, an enterprise-grade hosting environment for Meteor applications."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Ausgaben_der_amerikanischen_und_britischen_Zone_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Bi_Zone_1945_34_DE_M-Serie.jpg","page_title":"Briefmarken-Ausgaben der amerikanischen und britischen Zone in Deutschland","context_page_description":"Die Briefmarken-Ausgaben aus der Amerikanisch-Britischen Besatzungszone wurden zunächst ab dem 19. März 1945 bis Anfang 1946 in der Währung Reichsmark herausgegeben. Ab Februar 1946 bis Anfang 1947 wurden Briefmarken des Kontrollrats, also für die Bizone und die Sowjetische Besatzungszone gemeinsam ausgegeben. Nach dem Bruch der Alliierten im Mai 1948, wurden ab dem 21. Juni 1948 neue, bzw. alte Kontrollratsausgaben mit Aufdruck, in der Währung DM ausgegeben. Die letzten Ausgaben der Bizone aus Anlass des 200. Geburtstages von Johann Wolfgang von Goethe kamen am 15. August 1949 heraus, denen ab dem 7. September die ersten Ausgaben der neu gegründeten Bundesrepublik Deutschland folgten.\\nDie insgesamt 20 Briefmarken von 1945 unterscheiden sich in drei Serien nach dem Druck in den drei Ländern USA, Großbritannien und Deutschland, wobei diese eindeutig zugeordnet werden können und in der Standardliteratur für Briefmarkensammler auch getrennt gelistet werden. Auch in den 61 Ausgaben der Dauermarken von 1948 bis 1949 gab es auf Grund des allgemeinen Mangels der Nachkriegszeit viele unterscheidbaren Varietäten der gleichen Marken."},{"page_url":"https://hu.wikipedia.org/wiki/L%C3%BClsfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/L%C3%BClsfeld%2C_SW_-_Schallfeld_v_N.JPG","page_title":"Lülsfeld","context_page_description":"Lülsfeld település Németországban, azon belül Bajorországban. Lakosainak száma 827 fő. +/-"},{"page_url":"https://en.wikipedia.org/wiki/Karto-Zan_languages","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Kartvelian_languages_tree.png","page_title":"Karto-Zan languages","context_page_description":"The Karto-Zan, also known as Georgian-Zan, languages are a branch of Kartvelian language family that contains Georgian and Zan languages. Svan language forms the other branch of the Kartvelian family, showing characteristic differences from Karto-Zan group. It has been hypothesized that divergence between Svan and Proto-Kartvelian language goes back as far as 19th century BCE. Georgian and Zan languages on the other hand diversified from Proto-Georgian-Zan language during 7th century BCE. Both languages share common archaic words related to metallurgy and agriculture absent in Svan."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%88%D8%B1%D8%A7%D9%86%D8%B3_%D9%88%D9%8A%D9%86%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/TYPO_London-_Lawrence_Weiner_%286325139876%29.jpg","page_title":"لورانس وينر","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nلورانس وينر فنان من امريكا."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D1%86%D1%80%D0%BA%D0%B0%D0%B2%D0%B0_%D0%95%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D1%98%D0%B5_%D1%81%D1%80%D0%B5%D0%BC%D1%81%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Crkva_Sv._Nikole_%28Ada%C5%A1evci%29_348.jpg","page_title":"Списак цркава Епархије сремске","context_page_description":"Следи списак цркви Епархије сремске по Архијерејским намесништвима:"},{"page_url":"https://nl.wikipedia.org/wiki/Monteur","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/R%26D_Avidsen.JPG","page_title":"Monteur","context_page_description":"Een monteur is een technisch onderlegd en meestal in die richting ook geschoold persoon, die technische installaties bouwt, het onderhoud doet en er zo nodig reparaties aan verricht. Het kan uiteenlopende typen installaties betreffen. Het is een beroep voor mannen en vrouwen.\\nSpecialisaties zijn onder meer: automonteur, servicemonteur, CV monteur of verwarmingsmonteur, onderhoudsmonteur, beveiligingsmonteur, storingsmonteur, installatiemonteur, bandenmonteur, elektromonteur, vliegtuigmonteur en dergelijke.\\nOp grote schepen spreekt men in dit verband van een scheepswerktuigkundige.\\nMinder frequent wordt de term demonteur gebruikt voor het demonteren van, bijvoorbeeld, auto's.\\nVroeger herkende men een monteur aan zijn blauwe overall. Tegenwoordig is de werkkleding van monteurs diverser."},{"page_url":"https://fi.wikipedia.org/wiki/Kapitulaatio","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Shigemitsu-signs-surrender.jpg","page_title":"Kapitulaatio","context_page_description":"Kapitulaatio on sotilaskielessä käytetty käsite, joka tarkoittaa antautumista. Useimmiten termiä käytetään, kun antautuminen tapahtuu ehdoitta."},{"page_url":"https://pl.wikipedia.org/wiki/Komprachcice_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/P5060012.jpg.jpg","page_title":"Komprachcice (stacja kolejowa)","context_page_description":"Komprachcice – stacja kolejowa w Komprachcicach, w województwie opolskim, w Polsce.\\nW roku 2017 stacja obsługiwała 50–99 pasażerów na dobę."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bodendenkm%C3%A4ler_in_Pfaffenhofen_an_der_Ilm","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/St._Vitus_%28G%C3%B6belsbach%29_01.jpg","page_title":"Liste der Bodendenkmäler in Pfaffenhofen an der Ilm","context_page_description":"Auf dieser Seite sind die Bodendenkmäler der oberbayerischen Stadt Pfaffenhofen an der Ilm zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Bodendenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Hormizd_I_Kushanshah","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Hormizd_I_Kushanshah_Merv_mint.jpg","page_title":"Hormizd I Kushanshah","context_page_description":"Hormizd I Kushanshah was Kushanshah of the Kushano-Sasanian Kingdom from 275 to 300. His reign was marked by his rebellion against his brother and suzerain the Sasanian King of Kings Bahram II.\\nHormizd I Kushanshah was notably the first Kushano-Sasanian ruler to claim the title of \\"Great Kushan King of Kings\\" instead of the traditional \\"Great Kushan King\\". This displays a noteworthy transition in Kushano-Sasanian ideology and self-perception and possibly a direct dispute with the ruling branch of the Sasanian family. By the time of Bahram II's death in 293, Hormizd I Kushanshah's rebellion had been suppressed; he continued to rule until his death in 300, and was succeeded by his namesake Hormizd II Kushanshah."},{"page_url":"https://de.wikipedia.org/wiki/Candelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Candelo-DSCF0335.JPG","page_title":"Candelo","context_page_description":"Candelo ist eine italienische Gemeinde mit 7521 Einwohnern in der Provinz Biella in der Region Piemont und ist Träger der Bandiera Arancione des TCI."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_provinciales_de_Mendoza_de_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Cambia_Mendoza.png","page_title":"Elecciones provinciales de Mendoza de 2019","context_page_description":"Las elecciones generales de la provincia de Mendoza de 2019 tuvieron lugar el domingo 29 de septiembre, con el objetivo de renovar los cargos de Gobernador y Vicegobernador, así como 24 de los 48 escaños de la Cámara de Diputados, y 19 de los 38 escaños del Senado Provincial, configurando los poderes ejecutivo y legislativo para el período 2019-2023. Se renovaron también las intendencias y concejos deliberantes por departamento, aunque la mayoría de estos comicios se realizaron en desfase con la elección gubernativa y legislativa, y la elección provincial misma se desdobló de las elecciones presidenciales y legislativas nacionales. Fueron las décimas elecciones desde la restauración democrática de 1983, y los vigesimosextos comicios provinciales mendocinos desde la instauración del sufragio secreto en la Argentina. Asimismo, los comicios municipales destacaron por ser los primeros luego de que el gobierno provincial de Alfredo Cornejo lograse un fallo favorable para prohibir las reelecciones indefinidas de las intendencias de la provincia, aunque este solo actuaría a partir de las siguientes elecciones.​"},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BB%93ng_h%E1%BB%93_thi%C3%AAn_v%C4%83n_Praha","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Prazsky_orloj_celkovy_pohled.jpg","page_title":"Đồng hồ thiên văn Praha","context_page_description":"Đồng hồ thiên văn Praha, nằm tại thủ đô của Cộng hòa Séc. Đồng hồ được lắp đặt lần đầu vào năm 1410, là đồng hồ thiên văn cổ thứ ba và cổ nhất vẫn còn hoạt động trên thế giới.\\nĐồng hồ thiên văn được đặt tại bức tường phía nam của Tòa thị chính Thành Cổ ở Quảng trường Thành Cổ. Đồng hồ này về mặt kỹ thuật thì bao gồm ba gồm ba bộ phận chính: mặt đồng hồ thiên văn, tượng trưng cho vị trí của Mặt Trời và Mặt Trăng trên bầu trời và hiển thị các chi tiết thiên văn khác nhau; \\"Bước chân của các Tông đồ\\", một bộ máy đồng hồ hiển thị mỗi giờ một nhân vật trong các Tông đồ và các nét điêu khắc chuyển dịch khác- đáng chú ý là một nhân vật của Cái chết; và một mặt đồng hồ lịch với các mề đay đại diện cho các tháng."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_Klickitat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Goldendale_WA_-_county_courthouse.jpg","page_title":"Condado de Klickitat","context_page_description":"El condado de Klickitat es uno de los 39 condados del estado estadounidense de Washington.\\nAl año 2000, su población era de 19.161 y de 20.377 en 2008.​ Su sede de condado y ciudad más grande es Goldendale.\\nToma su nombre de la tribu klickitat de los yakama.\\nEl Condado de Klickitat fue creado a partir del Condado de Walla Walla el 20 de diciembre de 1859.​"},{"page_url":"https://la.wikipedia.org/wiki/Lafran%C3%A7aise","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Notre_Dame_de_Lapeyrouse.JPG","page_title":"Lafrançaise","context_page_description":"Lafrançaise est commune Francicum 2'870 incolarum praefecturae Tarnis et Garumnae in regione australi Meridiano et Pyrenaeis."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D0%A3%D0%B0%D0%B8%D0%BA%D0%B0%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/University_of_Waikato_village_green.jpg","page_title":"Университет Уаикато","context_page_description":"Университет Уаикато — университет в Гамильтоне, Новая Зеландия основанный в 1964 году со вторым кампусом, расположенным в Тауранге."},{"page_url":"https://hu.wikipedia.org/wiki/Berberek","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Berber_World.png","page_title":"Berberek","context_page_description":"A berberek Északnyugat-Afrika őslakos rokon népcsoportjainak összefoglaló neve. Legismertebb csoportjuk a tuaregek.\\nA „berber” nevet a kívülállók alkalmazták rájuk, ennek eredete a latin „barbari”, amit az ókori rómaiak az Észak-Afrika partjain élő, latinul nem beszélő népekre és magára a területre is vonatkoztattak.\\nA berber identitást a nyelvhez és a kultúrához való kötődés jelenti. A legfőbb berber dialektust „tamazight” néven illetik.\\nManapság a Cyreanica régiót kivéve a berberek kétnyelvűek, a berber mellett arabul is beszélnek.\\nA berberek számára életbevágóan fontos volt a családhoz és a törzshöz való kötődés, hiszen csak így maradhattak életben, ez a kötődés napjainkig megmaradt. A berber közösséget alkotó családok és rokonok egymás közelében laknak, ez különösen a kisebb falvakra jellemző. Ezek a csoportok Tripolitania körzetben élnek."},{"page_url":"https://en.wikipedia.org/wiki/Italian_Minister_of_Justice","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Filippo_Mancuso.jpg","page_title":"Italian Minister of Justice","context_page_description":"This is a list of the Italian Ministers of Justice since 1946. The Minister of Justice is a senior member of the Italian Cabinet and leads the Ministry of Justice.\\nThe current Minister of Justice is Alfonso Bonafede, a member of the Five Star Movement, appointed on 1 June 2018, who serves in the cabinet of Giuseppe Conte."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%B5%D0%B2%D1%96%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/H%C3%A9v%C3%ADz.jpg","page_title":"Хевіз","context_page_description":"Хевіз — місто на заході Угорщини в медьє Зала. Населення 4 550 чоловік."},{"page_url":"https://de.wikipedia.org/wiki/Marton-Museum","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Marton_Museum.jpg","page_title":"Marton-Museum","context_page_description":"Das Marton-Museum in Samobor bei Zagreb ist ein privates Porzellan-, Kunst- und Möbelmuseum.\\nNach jahrzehntelanger Sammlertätigkeit hat sich der kroatische Tennisprofi und spätere Diplomat und Geschäftsmann Veljko Marton ein Privatmuseum mit wertvollen Objekten aus Glas, Silber, Porzellan, mit Möbeln, Uhren, Bildern eingerichtet. Der Schwerpunkt der Sammlung liegt im 18. und frühen 19. Jahrhundert. Das Museum wurde 2003 eröffnet, internationale Beachtung fand unter anderem 2010 die auf Leihgaben Martons beruhende Porzellan-Ausstellung „Prachtware“ im Liechtenstein-Museum in Wien."},{"page_url":"https://cs.wikipedia.org/wiki/N%C3%A1rodn%C3%AD_muzeum_um%C4%9Bn%C3%AD_Qu%C3%A9becu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/L_Arbre_de_la_rue_Durocher_-_02.jpg","page_title":"Národní muzeum umění Québecu","context_page_description":"Národní muzeum umění Québecu, je umělecké muzeum v Québecu v Kanadě. Muzeum se nachází v parku Battlefield ve čtyřech budovách; tři byly postaveny přímo pro ně, jedna byla původně vězení.\\nInstituce vznikla jako Musée de la province de Québec v roce 1933, přičemž přípravné práce začaly o víc než deset let dříve. Muzeum původně zahrnovalo provinční archiv, muzeum umění a přírodovědné muzeum, které se osamostatnilo roku 1962. V následujícím roce bylo muzeum přejmenováno na Musée du Quebec. Provinční archiv byl z muzea vyčleněn v roce 1979 a zůstalo pouze muzeum umění. V roce 2002 se přejmenovalo na současný název.\\nSbírka obsahuje přes 40 tisíc děl od 16. století po současnost. Jsou tu především díla, která byla vytvořena v Québecu nebo umělci z Québecu, ale i díla z jiných částí Kanady a ze zbytku světa. Muzeum také provozuje odbornou knihovnu a archiv věnovaný umění."},{"page_url":"https://pt.wikipedia.org/wiki/Diocese_de_Campo_Maior","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Catedral_de_Santo_Antonio_Campo_Maior-Piau%C3%AD-Brasil.JPG","page_title":"Diocese de Campo Maior","context_page_description":"A Diocese de Campo Maior é uma Circunscrição Eclesiástica da Igreja Católica no estado do Piauí. Diocese sufragânea da Diocese de Teresina, da região eclesiástica Nordeste 4 da CNBB."},{"page_url":"https://de.wikipedia.org/wiki/Hildegard_von_Spitzemberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Marie_Schleinitz_03.jpg","page_title":"Hildegard von Spitzemberg","context_page_description":"Hildegard Freifrau von Spitzemberg war eine Berliner Salonnière der Bismarckzeit und des Wilhelminischen Zeitalters."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Aachen-Mitte_(A%E2%80%93H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/AC-Bluecherpl33-35.JPG","page_title":"Liste der Baudenkmäler in Aachen-Mitte (A–H)","context_page_description":"Die Liste der Baudenkmäler in Aachen-Mitte (A–H) enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Aachen-Mitte in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Aachen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AA%9C%E9%9A%88%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Hinokuma-dera_Temple_Ruins.jpg","page_title":"檜隈寺","context_page_description":"檜隈寺は、奈良県高市郡明日香村にあった渡来系氏族、東漢氏の氏寺とされる古代寺院。7世紀後半の創建で、中世には道興寺とも称した。"},{"page_url":"https://en.wikipedia.org/wiki/Todd_Woodbridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Australian_Open_2015_%2816375947211%29.jpg","page_title":"Todd Woodbridge","context_page_description":"Todd Andrew Woodbridge, OAM is a retired Australian professional tennis player and current sports broadcaster with the Nine Network.\\nWoodbridge is best known for his successful Doubles partnerships with Mark Woodforde and later Jonas Björkman. He is among the most successful doubles players of all time, having won 16 Grand Slam men's doubles titles, and a further six Grand Slam mixed doubles titles. Additionally, he was a gold medalist with Woodforde at the 1996 Summer Olympics to complete a career Golden Slam. In total he has won 83 ATP doubles titles. Woodbridge reached the World No. 1 doubles ranking in July 1992.\\nIn 2002, he was inducted into the Australian Institute of Sport 'Best of the Best'.\\nWoodbridge was at the Seven Network between 2006 and 2018, working for Seven Sport as a tennis commentator, where he was also a host of the network's Australian Open coverage. In April 2018, he hosted the morning sessions of the 2018 Commonwealth Games on the Gold Coast for the network.\\nIn 2014, alongside Woodforde, the International Tennis Federation presented him with its highest accolade, the Philippe Chatrier award, for his contributions to tennis."},{"page_url":"https://eu.wikipedia.org/wiki/Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ciudad_de_Heredia.JPG","page_title":"Costa Rica","context_page_description":"Costa Rica, ofizialki Costa Ricako Errepublika, Erdialdeko Amerikako estatu burujabea da, Ozeano Barearen eta Karibe itsasoaren artean dagoena. Mugakide ditu Nikaragua, iparraldean, eta Panama, hegoaldean. 51.100 kilometro koadroko eremua du, eta 2016an 4,8 milioi biztanle zituen. Hiriburua eta hiri populatuena San Jose da. Alajuela, Cartago, Heredia, Limon eta Puntarenas dira beste hiri nagusiak.\\nEspainiaren kolonia izan zen, eta 1821. urtean egin zen independente. Independentziaren lehen urteetan istilu handiak izan ondoren, 1889. urtean demokrazia baketsuko aldia hasi zen, bi bider bakarrik eten dena: 1917-1919 urteetan diktadura bat egon zen agintean, eta 1948an altxamendu militar bat gertatu zen. Herrialdea aspaldidanik izan da neutrala nazioarteko politikan. Ez du armadarik eta Latinoamerikako politika sistema egonkorrena du."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B7%A1%E6%B0%B4%E5%AE%A2%E9%81%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%E6%B7%A1%E6%B0%B4%E5%AE%A2%E9%81%8B_969-FU_631%282%29.jpg","page_title":"淡水客運","context_page_description":"淡水汽车客運股份有限公司，简称淡水客運，主要经营新北市公车、台北市联营公车。\\n目前与指南客运、中兴巴士、光华巴士、新北客运、基隆客运、统联客运同属中兴巴士集团。\\n淡水客运董事长吕良宗是1990年代上半期窜起的台湾公车业界新霸主。淡水吕家由淡水客运起家，陆续成功购并中兴巴士、新北客运与光华巴士，成为中兴巴士集团。\\n台湾高尔夫球名将吕良焕与吕西钧都是吕良宗的亲戚，吕良宗之弟吕清游曾任国大代表。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B8%D1%98%D0%B5%D0%BF%D0%BE%D1%80_N.11","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Nieuport-Macchi_11000_%28Ni_11%29_French_First_World_War_single_seat_fighter_colourized_drawing.jpg","page_title":"Нијепор N.11","context_page_description":"Нијепор N.11 је француски ловачки авион. Авион је први пут полетео 1915. године..\\nНајвећа брзина авиона при хоризонталном лету је износила 156 km/h.\\nРаспон крила авиона је био 7,52 метара, а дужина трупа 5,64 метара. Празан авион је имао масу од 320 килограма. Нормална полетна маса износила је око 480 килограма."},{"page_url":"https://gl.wikipedia.org/wiki/Ricardo_I_Orsini","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Richard_Orsini_-_death_1304.jpg","page_title":"Ricardo I Orsini","context_page_description":"Ricardo Orsini, finado en 1303 ou 1304, foi o conde palatino de Cefalonia e Zante desde antes de 1260 até a súa morte en 1303/4, e tamén capitán xeral de Corfú en 1286–1290, conde de Gravina en 1284–1291. Tamén serviu como bailío anxevino no Principado de Acaia desde 1297 até 1300."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94-10_(%D0%BF%D0%B0%D1%80%D0%B0%D1%88%D1%8E%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/SkyJump2018-02.jpg","page_title":"Д-10 (парашют)","context_page_description":"Д-10 — десантный парашют. Был разработан НИИ парашютостроения и принят на вооружение ВДВ в конце 90-х годов.\\nПредназначен для совершения боевых и учебных прыжков парашютистами-десантниками всех специальностей с полным табельным вооружением и снаряжением на скоростях выброски от 140 до 400 км/ч, со стабилизацией до 3 секунд и более, в диапазоне высот от 200 до 4000 метров. Имеет 26 основных строп, изготовленных из капронового шнура ШКП-150, 22 внешние дополнительные стропы длиной 3 м, а также 24 внутренние дополнительные стропы из капронового шнура ШКП-120 длиной 4 м.Срок эксплуатации парашюта Д-10 — 14 лет, в течение которых он может выдержать от 80 до 120 применений в зависимости от общей полетной массы парашютиста и условий совершения прыжка.\\nГабаритные размеры десантной системы, уложенной в ранец:\\nвысота не более 0,250 м;\\nширина не более 0,320 м;\\nдлина не более 0,580 м.\\nМасса десантной системы без переносной сумки и прибора - не более 11,7 кг."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%85%E0%B0%B5%E0%B0%BF%E0%B0%AD%E0%B0%95%E0%B1%8D%E0%B0%A4_%E0%B0%95%E0%B0%B5%E0%B0%B2%E0%B0%B2%E0%B1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Conjoined_X-ray.jpg","page_title":"అవిభక్త కవలలు","context_page_description":"అవిభక్త కవలలు అనగా గర్భంలో శరీరభాగాలు కలసిపోయి జన్మించిన ఏకరూప కవలలు. ఈ అరుదైన జన్మము సుమారు 49,000 నుండి 1,89,000 మందిలో ఒకరికి సంభవించే అవకాశం ఉంది. ఈ సంఘటనలు అధికంగా ఆగ్నేయాసియా, ఆఫ్రికా, బ్రెజిల్లో ఎక్కువగా సంభవిస్తుంటాయి. సుమారు జన్మించిన వారిలో సగం మంది జివించి ఉండి జంటలుగానే ఉండి తమ జీవితాలను కొనసాగిస్తుంటారు. ఈ పరిస్థితి ఆడపిల్లలకు తరచుగా వచ్చే అవకాశం ఉంది. ఈ సంఘటనలు జరిగే నిష్పత్తి బాలికలలు 3:1 లో ఉంటుంది.\\nఈ అవిభక్త కవలల గూర్చి వివరించడానికి రెండు విరుద్ధ సిద్ధాంత మూలాలున్నాయి. పాత సిద్ధాంతం ప్రకారం ఫలదీకరణ చెందిన అండం పాక్షికంగా విడిపోయి విచ్ఛిన్నం చెందుట వలన ఈ విధమైన సంఘటనలు జరుగుతాయని తెలుపుతుంది. రెండవ సిద్ధాంతం సంలీన సిద్ధాంతం ఇది అందరిచే అమోదించబడింది. దీని ప్రకారం ఫలదీకరణం చెందిన అండం పూర్తిగా విడిపోతుంది కానీ మూల కణాలు అదే విధమైన మూల కణాలను రెండవ కవల నుండి కనుగొన్నప్పుడు ఆ కవలలు అతుక్కుపోతారు. ఈ కవలలకు ఉమ్మడిగా పరాయువు, మావి, అమ్నియోటిక్ శాక్ ఉంటాయి.\\nఅతి ప్రముఖమైన అవిభక్త కవలలు థాయిలాండ్ కు చెందిన చాంగ్, ఎంగ్ బంకర్. వీరు థాయిలాండ్ లోని సిలాంలో జన్మించారు. వారు \\"పి.టి.బర్నమ్\\" సర్కస్ లో పనిచేస్తూండేవారు. అనేక సంవత్సరాలు ఆ సర్కస్ తో పాటు కొనసాగారు. వారు \\"సియామీస్ ట్విన్స్\\"గా సుపరిచితులైనారు. వారు మొండెం, మాంసం, మృదులాస్థి, కాలేయాలు కలసి జన్మించారు."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA%D0%BE%D0%B2%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%D0%92%D0%B5%D1%87%D0%B5%D1%80%D0%BD%D0%B5%D0%B5_%D1%84%D0%BE%D1%82%D0%BE_%D0%B1%D1%83%D0%B4%D0%B4%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%85%D1%80%D0%B0%D0%BC%D0%B0_%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0.jpg","page_title":"Городовиковск","context_page_description":"Городовико́вск — город в составе Калмыкии в России.\\nАдминистративный центр Городовиковского района. Образует Городовиковское городское муниципальное образование как единственный в нём населённый пункт.\\nРасположен на крайнем западе Калмыкии, в 234 км к западу от столицы республики, Элисты.\\nНаселение — 8798 чел.\\nОснован как село Башанта в 1871 году, в 1971 году получил статус города."},{"page_url":"https://ceb.wikipedia.org/wiki/Hoogkerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/20120526_Suikerfabriek_Suiker_Unie_Hoogkerk_Groningen_NL_%282%29.jpg","page_title":"Hoogkerk","context_page_description":"Lungsod ang Hoogkerk sa Olandres. Nahimutang ni sa munisipyo sa Gemeente Groningen ug lalawigan sa Provincie Groningen, sa amihanan-sidlakang bahin sa nasod, 140 km sa amihanan-sidlakan sa Amsterdam ang ulohan sa nasod. Adunay 8,997 ka molupyo.\\nAng yuta palibot sa Hoogkerk kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 11 ka metro ug 2.4 km sa sidlakan sa Hoogkerk. Dunay mga 530 ka tawo kada kilometro kwadrado sa palibot sa Hoogkerk nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Groningen, 4.4 km sa sidlakan sa Hoogkerk. Hapit nalukop sa kasagbotan ang palibot sa Hoogkerk. Sa rehiyon palibot sa Hoogkerk, mga kanal, mga kamadan, ug mga lasang talagsaon komon.\\nAng klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Pebrero, sa 0 °C."},{"page_url":"https://et.wikipedia.org/wiki/B%C3%BCtsantsi_ajalugu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/B%C3%BCtsants1263.PNG","page_title":"Bütsantsi ajalugu","context_page_description":"Bütsantsi ajalugu ulatub 4. sajandist kuni 1453. aastani.\\nRooma keisririigi idapoolne osa Ida-Rooma keisririik pidas end Rooma riigiks. Kuigi Ida-Rooma oli sügavalt helleniseerunud, kasutati sõna \\"hellenid\\" ainult kristluse-eelsete muinaskreeklaste kohta. Sõna \\"roomlased\\""},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_kulturminner_i_Lillestr%C3%B8m","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Gudleiv_Asaks_kirke15.jpg","page_title":"Liste over kulturminner i Lillestrøm","context_page_description":"Liste over kulturminner i Lillestrøm er en oversikt over fredede og/eller bevaringsverdige bygninger og elementer i Lillestrøm kommune. Data er hentet fra Riksantikvarens liste over kulturminner.\\nID-nummer består av et lenket tall som går direkte til det aktuelle kulturminnet i Kulturminnesøk."},{"page_url":"https://it.wikipedia.org/wiki/Scelte_del_primo_giro_nel_draft_dei_Seattle_Seahawks","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Bruce_Irvin_in_2013.jpg","page_title":"Scelte del primo giro nel draft dei Seattle Seahawks","context_page_description":"I Seattle Seahawks si unirono alla National Football League nel 1976 insieme ai Tampa Bay Buccaneers. Nel primo draft a cui parteciparono, il Draft NFL 1976, scelsero il defensive tackle Steve Niehaus dall'Università di Notre Dame. La scelta del primo giro più recente è stata nel 2019 quando fu selezionato L.J. Collier, un defensive end dalla Texas Christian University.\\nI Seahawks non hanno mai detenuto la prima scelta assoluta in nessun draft, anche se hanno avuto la seconda scelta assoluta due volte, la terza scelta tre volte e la quarta due volte. Con tre giocatori, l'Università di Notre Dame è quella che ha fornito più giocatori nel primo giro alla squadra."},{"page_url":"https://en.wikipedia.org/wiki/Tapan_Singhel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Tapan-singhel.jpg","page_title":"Tapan Singhel","context_page_description":"Tapan Singhel has been the Managing Director and Chief Executive Officer of Bajaj Allianz General Insurance since April 2012."},{"page_url":"https://en.wikipedia.org/wiki/P%C3%A9terv%C3%A1s%C3%A1ra_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/B%C3%BCkksz%C3%A9k2.jpg","page_title":"Pétervására District","context_page_description":"Pétervására is a district in north-western part of Heves County. Pétervására is also the name of the town where the district seat is found. The district is located in the Northern Hungary Statistical Region."},{"page_url":"https://eo.wikipedia.org/wiki/B%C3%A2rle%C8%99ti_(Mogo%C8%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/RO_AB_Barlesti_85.jpg","page_title":"Bârlești (Mogoș)","context_page_description":"Bârlești [birleŝtj] estas vilaĝo en Rumanio administre apartenanta al Mogoș.\\nEn la vilaĝo estas ligna preĝejo de 1844, konsekrita al la imperiestroj Konstantino kaj Helena. La internaj pentraĵoj estas de 1846,"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%83%E6%A0%BC%E6%99%AE%E6%8B%89%E8%8C%A8%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Buergplaz_Huldang.jpg","page_title":"布格普拉茨山","context_page_description":"布格普拉茨山是卢森堡北部市镇特鲁瓦维耶日的一座小山。 559米的山峰坐落厄斯灵地区的50.1615°N 6.0281°E。\\n人们常常误认为它是卢森堡的最高点。实际上，它是仅次于克内夫山560米的第二高山。"},{"page_url":"https://nl.wikipedia.org/wiki/Mitromorpha_haycocki","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Mitromorpha_haycocki_001.jpg","page_title":"Mitromorpha haycocki","context_page_description":"Mitromorpha haycocki is een slakkensoort uit de familie van de Mitromorphidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1911 door Dall & Bartsch."},{"page_url":"https://fr.wikipedia.org/wiki/Puits_art%C3%A9siens_de_Paris","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Artesisk_brunn%2C_Nordisk_familjebok.png","page_title":"Puits artésiens de Paris","context_page_description":"La réalisation de puits artésiens à Paris a été rendue possible par la présence de la nappe aquifère de l'Albien et les progrès des techniques de forage à partir des années 1830. La volonté de produire une eau saine à bon marché fit apparaître des puits artésiens tout au long du XIXᵉ siècle et au début du XXᵉ siècle.\\nLa seconde moitié du XXᵉ siècle vit l'expansion d'une nouvelle génération de puits artésiens, à des fins de chauffage géothermique."},{"page_url":"https://no.wikipedia.org/wiki/Jakt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Hunting_dogs_with_catch.jpg","page_title":"Jakt","context_page_description":"Jakt eller veiding er å spore opp og fange eller felle ville dyr og fugler, som kan brukes til matauk eller klær, eller på annen måte ha nytteverdi for jegeren. Jakt kan også tjene til å regulere en viltbestand, for eksempel for å begrense eller unngå skade på beitemark. I den industrialiserte delen av verden er det ikke lenger behov for å jakte for matauk og klær, så der er jakt en mer eller mindre kontroversiell hobby med stor økonomisk betydning for mange."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%A8%DB%8C_%D8%A6%DB%8E%D9%85_%D8%AF%DB%95%D8%A8%D9%84%DB%8C%D9%88%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Black_BMW_M3_E30_fr.jpg","page_title":"بی ئێم دەبلیوو","context_page_description":"بی ئێم دەبلیوو یان بی ئێم ڤێ، کۆمپانیایەکی گەورەی ئەڵمانیە بۆ دروستکردنی ئۆتۆمبێل و مۆتۆرسایکل.\\nئەم کۆمپانیایە لە ساڵی ١٩١٦ لە شاری میونشن لە باڤاریا دامەزراوە. بی ئێم دەبلیو لە ئەڵمانیا، بەڕازیل، چین، ھیندستان، ئەفریقای باشوور وە ئەمریکا ئۆتۆمبێل بەرھەمدەھێنێت، لە ساڵی ٢٠١٥ بی ئێم دەبلیوو دوانزەھەمین کۆمپانیای بەرھەمھێنانی ئۆتۆمبێل بوو لە جیھاندا کە زیاتر لە ٢ میلیۆن ئۆتۆمبێلیان بەرھەمھێنا.\\nبەرھەمەکانیان لە ژێر ناوەی بی ئێم دەبلیوو، بی ئێم دەبلیوو ئێم، بی ئێم دەبلیوو ئای بەرھەمدەھێنن. ھەروەھا ھەریەک لە مینی و ڕۆڵز-ڕۆیس یش سەر بە کۆمپانیای بی ئێم دەبلیوون."},{"page_url":"https://sv.wikipedia.org/wiki/Euphorbia_classenii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Euphorbia_classenii_ies.jpg","page_title":"Euphorbia classenii","context_page_description":"Euphorbia classenii är en törelväxtart som beskrevs av Peter René Oscar Bally och Susan Carter. Euphorbia classenii ingår i släktet törlar, och familjen törelväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://id.wikipedia.org/wiki/Armia_Krajowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Flaga_PPP.svg","page_title":"Armia Krajowa","context_page_description":"Armia Krajowa adalah gerakan pemberontakan Polandia pada Perang Dunia II dominant di wilayah Polandia yang diduduki Jerman. Gerakan tersebut dibentuk pada Februari 1942 dari Związek Walki Zbrojnej. Selama lebih dari dua tahun berikutnya, gerakan tersebut diikuti sebagian besar pasukan bawah tanah Polandia lainnya. Persekutuannya adalah dengan Pemerintahan dalam Pengasingan Polandia, dan gerakan tersebut dijadikan sayap bersenjata dari apa yang menjadi dikenal dengan sebutan \\"Negara Bawah Tanah Polandia\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E6%BC%AB%E7%95%AB%E6%98%9F%E5%85%89%E5%A4%A7%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/HK_Kln_Park_Lee_Chi_Ching_Guo_Jing_Condor_Heroes_Legend_Oct-2012.JPG","page_title":"香港漫畫星光大道","context_page_description":"香港漫畫星光大道位於香港九龍油尖旺區尖沙咀九龍公園功夫閣和藝趣坊之間，長約百米，為世界上首條以漫畫為主題的星光大道。香港漫畫星光大道上香港漫畫家的手印，星光大道兩旁有24座巨型的香港漫畫經典角色的彩繪雕塑。此外，設立有漫畫歷史及發展廊及漫畫教育廊，展示香港漫畫發展歷史、漫畫製作過程、工具、漫畫家工作室情景及漫畫原稿等等。香港漫畫星光大道於2012年9月27日開幕，初步的營業運作時期為3年，目標為以營造香港社會上的創意氣氛，向香港及海外推廣香港漫畫，並且擴大香港漫畫的市場的規模。\\n主辦單位──香港動漫畫聯會，每年都會在香港漫畫星光大道舉辦大型活動，並且定期推出特別為到學生和遊客而設立的導賞團及工作坊。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%D9%84%D8%B9%D9%87_%DA%AF%D9%84%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Glehni_palmimaja_8.jpg","page_title":"قلعه گلن","context_page_description":"قلعه گلن یک قلعه در شهر تالین، استونی است.\\nاین قلعه که بر روی تپه‌ای در ناحیه نومه قرار دارد در سال ۱۸۸۶ میلادی توسط نیکولای فن گلن ساخته شده است. قلعه پس از مهاجرت مالک در سال ۱۹۱۸ به آلمان مورد حمله و غارت قرار گرفت و رو به نابودی رفت، اما در دهه ۱۹۶۰ مرمت آن آغاز و در ۲۴ مارس ۱۹۷۷ افتتاح شد."},{"page_url":"https://ro.wikipedia.org/wiki/Bunetice","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bunetice_18_Slovakia2.jpg","page_title":"Bunetice","context_page_description":"Bunetice este o comună slovacă, aflată în districtul Košice-okolie din regiunea Košice. Localitatea se află la altitudinea de 412 m deasupra n.m., se întinde pe o suprafață de 8,35 km² și în 2017 număra 91 de locuitori."},{"page_url":"https://sv.wikipedia.org/wiki/Osaka","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Skyline_in_Osaka.JPG","page_title":"Osaka","context_page_description":"Ōsaka, är Japans tredje största stad efter Tokyo och Yokohama, belägen på ön Honshus södra kust vid Osakabukten av Stilla havet, och är residensstad i Ōsaka prefektur. Den är byggd vid floderna Yodogawa och Yamatogawas utflöden i havet. Ōsaka bildar tillsammans med bl.a. de intilliggande städerna Kobe och Kyoto ett sammanhängande storstadsområde, Keihanshin, med över 19 miljoner invånare, vilket utgör Japans näst viktigaste industri- och handelscentrum."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%99%D7%A1%D7%98%D7%95%D7%A8%D7%99%D7%94_%D7%A9%D7%9C_%D7%90%D7%A4%D7%92%D7%A0%D7%99%D7%A1%D7%98%D7%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/SHAH-MAHMUD-HOTAK.jpg","page_title":"היסטוריה של אפגניסטן","context_page_description":"אפגניסטן הייתה ארץ חשובה מבחינה אסטרטגית לאורך ההיסטוריה. הארץ שימשה כשער להודו, וניצבה על דרך המשי העתיקה דרכה התקיים מסחר בין ארצות הים התיכון לסין. היא שוכנת באזור בו עברו דרכי מסחר ומסלולי הגירה רבים, וזכתה לכינוי \\"הכיכר של מרכז אסיה\\". אפגניסטן היא מקום מפגש בין דרכים מהמזרח התיכון, מעמק האינדוס דרך המעברים של הינדו-כוש, ממזרח אסיה דרך אגן טארים, ומהערבה האירואסייתית.\\nציוויליזציה אורבנית התקיימה באפגניסטן כבר מ-2000 או 3000 לפנה\\"ס. הכתבים הראשונים שנמצאו באזור אפגניסטן נכתבו בסביבות שנת 500 לפנה\\"ס, בתקופה של האימפריה האחמנית. אלכסנדר הגדול והצבא המקדוני בהנהגתו הגיעו לאזור שנקרא היום אפגניסטן בשנת 330 לפנה\\"ס בעקבות קרב גאוגמלה. שושלות וממלכות חזקות רבות הקימו את ערי הבירה שלהן באזור אפגניסטן, ביניהן ניתן למנות את האימפריה המאורית, אימפריית קושאן, השושלת הצפארית, השושלת הסאמאנית, השושלת הע'זנווית, שושלת ע'וריד, השושלת הטימורית, האימפריה המוגולית ועוד.\\nנהוג לחשוב שהעמים האפגנים הם במקור ארים ממרכז אסיה, שהגיעו לאפגניסטן בתקופה הפרה-היסטורית, בסביבות 20 אלף לפנה\\"ס, והשפות שהם דברו שרדו בצורה של פשטו ודארי, השפות המדוברות באפגניסטן כיום."},{"page_url":"https://sv.wikipedia.org/wiki/Yoshimar_Yot%C3%BAn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Yoshimar_Yot%C3%BAn_%282015%29.jpg","page_title":"Yoshimar Yotún","context_page_description":"Victor Yoshimar Yotún Flores, född 7 april 1990 i Callao, Peru, är en peruansk fotbollsspelare som spelar för Cruz Azul och Perus landslag. Han spelar främst som vänsterback men kan även spela som vänstermittfältare."},{"page_url":"https://en.wikipedia.org/wiki/Louisiana_Political_Museum_and_Hall_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Former_depot_in_Winnfield%2C_LA_MVI_2719.jpg","page_title":"Louisiana Political Museum and Hall of Fame","context_page_description":"The Louisiana Political Museum and Hall of Fame is a museum and hall of fame located in Winnfield, Louisiana. Created by a 1987 act of the Louisiana State Legislature, it honors the best-known politicians and political journalists in the state."},{"page_url":"https://fi.wikipedia.org/wiki/Landskronan_kunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Landskrona_Municipality_in_Scania_County.png","page_title":"Landskronan kunta","context_page_description":"Landskronan kunta on Skånen läänissä sijaitseva Ruotsin kunta. Maakuntajaossa se kuuluu Skåneen. Kunnan keskustaajama on Landskrona.\\nKunnan maapinta-ala on 140,26 neliökilometriä ja asukasluku 43 961 henkeä.\\nVuonna 2007 kunnassa oli 96,10 km² peltoa, joten saman ajankohdan maapinta-alaan vertaamalla saadaan peltojen osuudeksi 68,1 prosenttia kunnan maapinta-alasta.\\nJuutinraumassa sijaitseva Venin saari kuuluu kuntaan."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%8A%D9%88%D8%B1%D8%AC%D9%88%D8%B3_%D8%AE%D8%A7%D9%84%D9%83%D9%8A%D8%AF%D9%8A%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Georgios_Chalkidis_01.jpg","page_title":"جيورجوس خالكيديس","context_page_description":"جيورجوس خالكيديس لاعب كوره يد من اليونان."},{"page_url":"https://vi.wikipedia.org/wiki/Alor_Gajah","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Alor_Gajah_Town.JPG","page_title":"Alor Gajah","context_page_description":"Huyện Alor Gajah là một huyện thuộc bang Melaka của Malaysia. Huyện Alor Gajah có dân số thời điểm năm 2010 ước tính khoảng 173553 người."},{"page_url":"https://war.wikipedia.org/wiki/Homoneura","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Homoneura_hirayamae.JPG","page_title":"Homoneura","context_page_description":"An Homoneura in uska genus han Diptera. An Homoneura in nahilalakip ha familia nga Lauxaniidae."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AE%B0%E0%AE%AA%E0%AE%BE%E0%AE%B0%E0%AF%8D%E0%AE%A8%E0%AF%8D%E0%AE%A4_%E0%AE%B5%E0%AE%BF%E0%AE%9A%E0%AF%88%E0%AE%AF%E0%AE%BF%E0%AE%AF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Ruwenpflanzen.jpg","page_title":"மரபார்ந்த விசையியல்","context_page_description":"மரபார்ந்த விசையியல், எறிபொருட்கள், இயந்திர உறுப்புக்கள் போன்றனவும்; விண்கலங்கள், கோள்கள், விண்மீன்கள், விண்மீன் கூட்டங்கள் போன்ற வானியல் பொருட்கள் போன்றனவுமான கண்ணுக்குத் தெரியக்கூடிய பொருட்களின் இயக்கங்களை விளக்குவதற்குப் பயன்படும் ஒரு துறை. மேற்குறிப்பிட்ட பெரிய பொருட்களின் இயக்கங்கள் தொடர்பில் துல்லியமான முடிவுகளை வழங்கக்கூடிய மரபார்ந்த விசையியல் துறை; அறிவியல், பொறியியல், தொழில்நுட்பம் ஆகிய துறைகளில் மிகப் பழையதும், மிகப் பெரியதுமான ஒரு பகுதியும் ஆகும்.\\nஇவை தவிர இதில், வளிமங்கள், நீர்மங்கள், திண்மங்கள் ஆகியவை தொடர்பிலான சிறப்புப் பகுதிகளும் உண்டு. இயற்பியலில், பொருட்களினதும், பொருட் தொகுதிகளினதும் இயக்கங்களைக் கட்டுப்படுத்துவனவும், கணிதவியல் அடிப்படையில் விளக்குவனவுமான இயற்பியல் விதிகளோடு தொடர்புள்ள, விசையியல் தொடர்பான இரண்டு துணைப் பிரிவுகளில் மரபார்ந்த விசையியல் ஒன்றாகும். மற்றது குவாண்டம் விசையியல். இது நியூட்டோனியன் விசையியல் என்றும் அறியப்படுகிறது. இருப்பினும் நூலாசிரியர்கள் பெரும்பாலும் நியூட்டோனியன் விசையியலை, லெக்ராஞ்சியன் விசையியல் மற்றும் ஆமில்டோனியன் விசையியலுடன் ஒன்றாக, மரபார்ந்த விசையியலின் முறைப்படுத்தல்களாகக் காண்கின்றனர்."},{"page_url":"https://fr.wikipedia.org/wiki/Africa_Rising_Cycling_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Africa_Rising_Cycling_Center_02.jpg","page_title":"Africa Rising Cycling Center","context_page_description":"L'Africa Rising Cycling Center est un centre de formation de cyclisme, basé au Rwanda. Il est inauguré le 15 juin 2014.\\nLe projet est créé en coopération avec le Team Rwanda Cycling, la Fédération rwandaise de cyclisme et le Ministère des Sports et de la Culture du Rwanda. Il est soutenu par l'Union Cycliste Internationale. L'initiateur du centre est Jonathan Boyer, ancien cycliste professionnel américain et manager du Team Rwanda Cycling et l'entraîneur national de la sélection rwandaise.\\nLe centre est situé dans un quartier du nord du Rwanda, Musanze, à une altitude de 2000 mètres. Il se compose de 16 bâtiments, un département de service, un parcours de BMX, un centre de formation, un jardin biologique et d'autres installations. Il est destiné à servir non seulement à l'éducation et la formation des cyclistes africains, mais aussi des équipes d'autres pays, qui peut y mener un entraînement spécifique en altitude. En outre, des cours pour les entraîneurs africains, les commissaires et les mécaniciens sont proposés.\\nCertaines parties de la formation incluent du yoga, des cours d'anglais et de « vie en société »."},{"page_url":"https://de.wikipedia.org/wiki/Cendrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mairie_de_Cendrey.jpg","page_title":"Cendrey","context_page_description":"Cendrey ist eine französische Gemeinde mit 191 Einwohnern im Département Doubs in der Region Bourgogne-Franche-Comté."},{"page_url":"https://en.wikipedia.org/wiki/Georgetown_Cupcake","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Georgetown_cupcake_mstreet.jpg","page_title":"Georgetown Cupcake","context_page_description":"Georgetown Cupcake is a cupcakery based in the Georgetown neighborhood of Washington, D.C. that has now expanded to 6 other locations nationwide. Sisters Katherine Berman and Sophie LaMontagne opened the shop in February 2008."},{"page_url":"https://ca.wikipedia.org/wiki/Villers-sur-Saulnot","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Map_commune_FR_insee_code_70567.png","page_title":"Villers-sur-Saulnot","context_page_description":"Villers-sur-Saulnot és un municipi francès, situat al departament de l'Alt Saona i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 157 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Funicular_dos_Guindais","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Oporto_-_Funicular_dos_Guindais_-_20110425_132242.jpg","page_title":"Funicular dos Guindais","context_page_description":"The Guindais Funicular is a funicular railway in the civil parish of Cedofeita, Santo Ildefonso, Sé, Miragaia, São Nicolau e Vitória, Portuguese municipality of Porto."},{"page_url":"https://en.wikipedia.org/wiki/Washington_Gateway_Main_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Washington_gateway_main_street_logo.jpg","page_title":"Washington Gateway Main Street","context_page_description":"Washington Gateway Main Street is a 501 business development and neighborhood improvement organization. WGMS's mission is to develop and sustain the economic vitality of the commercial and residential neighborhoods along Washington Street in the South End and Lower Roxbury."},{"page_url":"https://en.wikipedia.org/wiki/Manimuthar_River_(tributary_of_Thamirabarani)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Manimuthar_Dam.JPG","page_title":"Manimuthar River (tributary of Thamirabarani)","context_page_description":"Manimuthar River originates on the eastern slopes of Western Ghats in Tirunelveli District of the state of Tamil Nadu in southern India. It is a major tributary of the Thamirabarani River.\\nThe river begins in the dense forest on a mountain peak 1,300 metres above sea level in Ex-Singampatti Zamindari, Ambasamudram taluk and flows 9 kilometres though small cataracts until it reaches the Tambaraparani River near Kallidaikurichi.\\nThe tributaries of the Manimuthar are the Keezha River and the Varattar River. As a tributary, the Manimuther River adds a considerable amount of water to the Tamiraparani River as it seasonally is always in full.\\nIn 1957, Manimuthar anicut was built across the river 3 kilometres before its juncture with the Tamiraparani."},{"page_url":"https://it.wikipedia.org/wiki/Thurn_und_Taxis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Albert_TT_2011.jpg","page_title":"Thurn und Taxis","context_page_description":"I Thurn und Taxis sono una nobile e importante famiglia tedesca. Erano un tempo principi soggetti al Sacro Romano Impero e acquistarono un importante ruolo politico ed economico, in particolare ebbero a partire dal Quattrocento un ruolo fondamentale nella diffusione del sistema postale in Europa, attività che continuarono fino al 1866. La famiglia è di origine italiana, in quanto discende dai Tasso, originari di Cornello in Val Brembana.\\nI Thurn und Taxis furono sovrani di un piccolo principato, tra i tanti staterelli in cui era frammentato il Sacro Romano Impero; il principato esistette fino alla abolizione dell'Impero, nel 1806, e faceva parte del Circolo del Reno Elettorale. La famiglia, tuttavia, non risiedeva nel principato: fino al 1701 risiedettero a Bruxelles, poi a Francoforte sul Meno; infine, nel 1748, si trasferirono a Ratisbona e risiedevano nel castello di questa città, tuttora di loro proprietà. I Thurn und Taxis hanno le proprie tombe gentilizie nella chiesa di Notre-Dame du Sablon, in Belgio, e nell'abbazia di Sant'Emmerano, a Ratisbona."},{"page_url":"https://fr.wikipedia.org/wiki/Tobias_Angerer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Tobias_Angerer_bei_der_Olympia-Einkleidung_Erding_2014_%28Martin_Rulsch%29_03.jpg","page_title":"Tobias Angerer","context_page_description":"Tobias Angerer, né le 12 avril 1977 à Traunstein, est un fondeur allemand. Il est quatre fois médaillés aux Jeux olympiques d'hiver, deux médailles d'argent, avec le relais quatre fois dix kilomètres en 2006 et lors de la poursuite en 2010, et deux de bronze, le relais en 2002 et le quinze kilomètres classique en 2006. Il remporte sept mdailles en Championnats du monde, quatre dargent et trois de bronze. Il remporte quatre globes de cristal, deux attribués au vainqueur de la Coupe du monde, lors des saisons 2005-2006 et 2006-2007, saisons où il remporte également le classement des courses longues distances."},{"page_url":"https://fr.wikipedia.org/wiki/Eko_Yuli_Irawan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Eko_Yuli_Irawan_%282016%29.jpg","page_title":"Eko Yuli Irawan","context_page_description":"Eko Yuli Irawan est un haltérophile indonésien né le 24 juillet 1989 dans la kota de Metro."},{"page_url":"https://war.wikipedia.org/wiki/Samolus_repens","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Samolus_repens.jpg","page_title":"Samolus repens","context_page_description":"An Samolus repens in uska species han Magnoliopsida nga syahan ginhulagway ni J. R. ngan Amp; G. Forst., ngan ginhatag han pagkayana nga asya nga ngaran ni Christiaan Hendrik Persoon. An Samolus repens in nahilalakip ha genus nga Samolus, ngan familia nga Primulaceae."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8D%A1%E7%BD%97%E7%90%B3%E5%A8%9C%C2%B7%E7%A7%91%E6%96%AF%E7%89%B9%E5%86%85%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/2013_World_Championships_Ladies_Podium.jpg","page_title":"卡罗琳娜·科斯特内尔","context_page_description":"卡罗琳娜·科斯特内尔，意大利花样滑冰运动员。她是2014年冬季奥运会女子单人滑铜牌得主、2012年世界锦标赛冠军 、五届欧州锦标赛冠军，以及2011年花样滑冰大奖赛冠军。她曾在五届世锦赛、四届欧锦赛、三届大奖赛得牌，于2003年青少年世界锦标赛得到季军，还曾七度卫冕意大利锦标赛冠军。"},{"page_url":"https://nn.wikipedia.org/wiki/R%C3%B8dberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/R%C3%B8dberg_Nore.jpg","page_title":"Rødberg","context_page_description":"Rødberg er kommunesenteret i Nore og Uvdal kommune i Buskerud i Viken fylke. Tettstaden har 498 innbyggjarar per 1. januar 2017 og ligg ved Rødbergdammen i Numedalslågen.\\nRødberg var endestasjon på den no nedlagde Numedalsbanen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%BA%D0%B0_%D0%B8_%D0%B3%D1%80%D0%BE%D0%B1%D0%BD%D0%B8%D1%86%D0%B0_%D0%93%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Br%C3%A1na_%C5%99%C3%ADmsk%C3%A9ho_vojev%C5%AFdce_Galeria_v_Soluni.jpg","page_title":"Арка и гробница Галерия","context_page_description":"Арка и гробница Галерия — сохранившиеся в городе Салоники части погребального комплекса римского императора Галерия, построенного в конце III — начале IV веков. Гробница в начале V века стала христианской церковью, посвящённой Георгию Победоносцу, и получила своё второе название — Ротонда святого Георгия. С 1590 года гробница использовалась как мечеть, а после возвращения здания церкви в 1912 году в нём был открыт музей христианского искусства, и богослужения совершаются только по великим праздникам.\\nВ 1988 году арка и ротонда в составе раннехристианских и византийских памятников Салоник были включены в перечень объектов Всемирного наследия."},{"page_url":"https://nl.wikipedia.org/wiki/Internationaal_wegennetwerk_van_de_Arabische_Mashreq","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Mashreq_Road_Network.png","page_title":"Internationaal wegennetwerk van de Arabische Mashreq","context_page_description":"Het Internationale wegennetwerk van de Arabische Mashreq is een samenhangend netwerk van wegen in de Arabische Mashreq. Het is vergelijkbaar met het E-routenetwerk in Europa en het Asian Highway Project in Azië. Het netwerk is in 2001 ingevoerd vanuit de Verenigde Naties.\\nDe wegen zijn genummerd in een schaakbordpatroon. Het systeem is vergelijkbaar met het E-routenetwerk in Europa en de Interstate Highways in de Verenigde Staten. De oneven nummers lopen van noord naar zuid en de even van oost naar west. De nummering loopt op vanaf het noordoosten naar het zuidwesten. Nummers eindigend op een 5 of 0 zijn hoofdroutes.\\nDe wegen lopen door de volgende landen:\\nBahrein\\nEgypte\\nIrak\\nJemen\\nJordanië\\nKoeweit\\nLibanon\\nOman\\nPalestina\\nQatar\\nSyrië\\nSaoedi-Arabië\\nVerenigde Arabische Emiraten"},{"page_url":"https://eu.wikipedia.org/wiki/Smyer_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Smyer_Texas_Water_Tower_2011.JPG","page_title":"Smyer (Texas)","context_page_description":"Smyer Texasko herri bat da. Hockley konderrian kokatua dago. 2010ean 474 biztanle zituen, 2,06 kilometro koadrotan banatuta."},{"page_url":"https://es.wikipedia.org/wiki/Phelsuma_madagascariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Phelsuma_madagascariensis_distribution.png","page_title":"Phelsuma madagascariensis","context_page_description":"El geco diurno de Madagascar es una especie de saurópsido escamado de la familia Gekkonidae.​ Es una especie endémica de Madagascar, que vive en lugares con una temperatura de entre 28 °C y 31 °C. Fue descrita por primera vez en 1831 por el británico John Edward Gray.\\nSe reconocen actualmente dos subespecies:​\\nPhelsuma madagascariensis boehmei.\\nPhelsuma madagascariensis madagascariensis."},{"page_url":"https://en.wikipedia.org/wiki/Occult_fracture","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Subtle_tibia_fracture_-_T1_MRI.jpg","page_title":"Occult fracture","context_page_description":"An occult fracture is a fracture that is not readily visible, generally in regard to projectional radiography. Radiographically, occult and subtle fractures are a diagnostic challenge. They may be divided into \\"high energy trauma fracture,\\" \\"fatigue fracture\\" from cyclical and sustained mechanical stress, and \\"insufficiency fracture\\" occurring in weakened bone. Independently of the cause, the initial radiographic examination can be negative either because the findings seem normal or are too subtle. Advanced imaging tools such as computed tomography, magnetic resonance imaging, and scintigraphy are highly valuable in the early detection of these fractures.\\nFractures represent up to 80% of the missed diagnoses in the emergency department. Failure to recognize the subtle signs of osseous injury is one of the reasons behind this major diagnostic challenge. While occult fractures present no radiographic findings, radiographically subtle fractures are easily overlooked on initial radiographs."},{"page_url":"https://en.wikipedia.org/wiki/California_Historical_Landmarks_in_Los_Angeles_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Tongva_Sacred_Springs_-_Serra_Springs_-_Kuruvungna_Springs_2.JPG","page_title":"California Historical Landmarks in Los Angeles County","context_page_description":"List table of the properties and districts — listed on the California Historical Landmarks in Los Angeles County, Southern California.\\nNote: Click the \\"Map of all coordinates\\" link to the right to view a Google map of all properties and districts with latitude and longitude coordinates in the table below."},{"page_url":"https://es.wikipedia.org/wiki/Modernismo_en_N%C3%A1poles","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Villa_Avena_2.jpg","page_title":"Modernismo en Nápoles","context_page_description":"Con liberty napoletano se designa una corriente arquitectónica del estilo Liberty desarrollada en Nápoles, Italia en las primeras dos décadas del siglo XX, principalmente en los barrios de Vomero, Posillipo y Chiaia."},{"page_url":"https://en.wikipedia.org/wiki/Elena_Fatalibekova","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Jelena_Abramowna_Fatalibekowa_1982.jpg","page_title":"Elena Fatalibekova","context_page_description":"Elena Abramovna Fatalibekova is a Russian chess player holding the title of Woman Grandmaster since 1977.\\nShe is the daughter of fourth Women's World Chess Champion Olga Rubtsova. Her first great success was the shared victory of the Soviet Junior Girls' Chess Championship in 1963.\\nIn 1970 Fatalibekova placed second in a women's international tournament at Tbilisi and the next year won international tournament in Chelyabinsk. She was awarded the title of Woman International Master in 1970. In 1974 Fatalibekova won the Women's Soviet Chess Championship.\\nFatalibekova successfully played in the Women's World Chess Championship 1978. In 1976 she won the Tbilisi Women's Interzonal. In 1977 in the first round of the knock-out series of matches Fatalibekova won against Valentina Kozlovskaya in Sochi - 6: 2 but in the semifinals lost to Alla Kushnir in West Berlin - 3½: 6½. Fatalibekova was awarded the title of Woman Grandmaster in 1977.\\nShe was not able to replicate this success in later Women's World Chess Championships. Fatalibekova placed 6th in the 1979 Women's Interzonal in Alicante and 8th in the 1982 Women's Interzonal in Bad Kissingen."},{"page_url":"https://fr.wikipedia.org/wiki/Ketupat","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Kulit_ketupat.JPG","page_title":"Ketupat","context_page_description":"Le ketupat, kupat ou tipat est un type de boulette à base de riz emballé dans un petit panier de feuilles de palme cuites. On les trouve communément en Indonésie, Malaisie, Brunei, Singapour, et aux Philippines. Ce plat de riz emballé est similaire au lontong et au bakchang.\\nLe ketupat est ouvert, le riz contenu est enlevé du panier et coupé en morceaux, et sert d'accompagnement. Il est consommé avec du rendang, de l'opor ayam, du sayur labu, du sambal goreng ati ou sert d'accompagnement de sate ou de gado-gado. Le ketupat est également un ingrédient central de certains plats tels que le ketupat sayur et le kupat tahu.\\nL'utilisation de jeunes feuilles de palmes cuites dans la cuisine est très répandue dans le monde malais, de l'Indonésie à la Malaisie en passant par les Philippines. Le ketupat est à base de riz enveloppé dans un panier de feuilles de palmes et bouilli. Durant la cuisson, le riz grossit et occupe tout le volume du cube, se retrouvant ainsi compressé, ce qui lui donne sa forme et texture singulière."},{"page_url":"https://es.wikipedia.org/wiki/Denkendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/A_9_AS_Denkendorf_%282009%29.jpg","page_title":"Denkendorf","context_page_description":"Denkendorf es un municipio situado en el distrito de Eichstätt, en el estado federado de Baviera, con una población a finales de 2016 de unos 4839 habitantes.​\\nSe encuentra ubicado en el centro del estado, en la región de Alta Baviera, cerca de la orilla norte del río Danubio."},{"page_url":"https://hu.wikipedia.org/wiki/Condofuri","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Condofuri144.jpg","page_title":"Condofuri","context_page_description":"Condofuri község Calabria régiójában, Reggio Calabria megyében."},{"page_url":"https://lt.wikipedia.org/wiki/Centrinio_kanalo_%C5%A1liuzai","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/01_Houdeng-Goegnies_050323_%282%29.JPG","page_title":"Centrinio kanalo šliuzai","context_page_description":"Centrinio kanalo šliuzai − keturių šliuzų grupė šalia La Luvjero miesto Belgijoje. Visi šliuzai yra 21 km ilgio Centriniame kanale. Kanalai 1998 m. įtraukti į UNESCO Pasaulio paveldo sąrašą.\\nCentrinis kanalas jungia Maso ir Šeldė upes, o vandens lygio skirtumas siekia 66 m. Sėkmingam laivų ir valčių perkėlimui 1888 m. buvo atidarytas 15,4 m aukščio pirmasis Houdeng-Goegnies šliuzas. Kiti trys buvo atidaryti 1917 m.\\nNuo 2002 m. šie šliuzai naudojami tik kaip eksponatai, o laivai naudojasi naujai atidarytu 73 m aukščio Strépy-Thieu keltuvu. Iki 2016 m. jis buvo aukščiausias pasaulyje."},{"page_url":"https://vi.wikipedia.org/wiki/Agrotis_trifurca","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Euxoa_trifurca.png","page_title":"Agrotis trifurca","context_page_description":"Agrotis trifurca là một loài bướm đêm trong họ Noctuidae."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%94%E1%83%A0%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%99%E1%83%90%E1%83%9C%E1%83%A2%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Karte_Lage_Kanton_Bern_2015.png","page_title":"ბერნის კანტონი","context_page_description":"ბერნი — შვეიცარიის მეორე უმსხვილესი კანტონი, როგორც მოსახლეობის, ისე ფართობის თვალსაზრისით. მდებარეობს ქვეყნის დასავლეთ-ცენტრალურ ნაწილში. ჩრდილოეთით ესაზღვრება იურისა და ზოლოთურნის კანტონები, დასავლეთით — ნევშატელისა და ფრიბურის კანტონები, სამხრეთით — ვალეს კანტონი, აღმოსავლეთით კი ურის, ნიდვალდენის, ობვალდენის, ლუცერნისა და აარგაუს კანტონები.\\nბერნის კანტონი ორენოვანია და 2010 წლის მონაცემებით მისი მოსახლეობა 979 802 ადამიანს შეადგენს, რომელთაგან 119 930 უცხოელია. კანტონის და ასევე მთლიანად შვეიცარიის ფედერალური დედაქალაქია ბერნი.\\nშვეიცარიის კონფედერაციას ბერნი 1353 წელს შეუერთდა და 1803—1814 წლებში ნაპოლეონის შვეიცარიის კონფედერაციის ერთ-ერთი კანტონი იყო ექვსიდან.\\nკანტონს ძირითადად მდინარე აარე და მისი შენაკადები რწყავს. დაყოფილია ექვს რეგიონად. მთლიანი ფართობი 5 959 კმ²-ს შეადგენს.\\nადმინისტრაციულად, ბერნი 10 რაიონად იყოფა.\\nშემოსავლის ძირითადი წყაროა ტურიზმი. სხვა მნიშვნელოვანი სექტორებს შორისაა სოფლის მეურნეობა, ყველის წარმოება და ჰიდროენერგიის გამომუშავება."},{"page_url":"https://it.wikipedia.org/wiki/Faraone_(Sant%27Egidio_alla_Vibrata)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Faraone_%28TE%29_-_Palazzo_baronale.jpg","page_title":"Faraone (Sant'Egidio alla Vibrata)","context_page_description":"Faraone, noto anche con le denominazioni di Faraone Vecchio e Faraone Antico, è una frazione del comune di Sant'Egidio alla Vibrata in provincia di Teramo nella regione Abruzzo.\\nFu possedimento di varie nobili famiglie, ma la più importante e ricca fu quella dei baroni Ranalli che governarono il territorio fino al 1950, anno del terremoto. I discendenti di questa nobile famiglia, nonostante il grave danno arrecato dal terremoto, possiedono gran parte dei territori di Faraone Nuovo e il proprio titolo baronale.\\nIl paese rappresenta il nucleo originario più antico dal quale si sono trasferiti gli abitanti che hanno dato vita al paese di Faraone Nuovo, costruito nei pressi della chiesa paleocristiana di San Vito, quando con il Decreto del Presidente della Repubblica 23 febbraio 1952, n. 424, Luigi Einaudi stabilì il dislocamento in nuova sede urbana.\\nLo spostamento dei residenti si rese necessario sia a causa dell'evento sismico che nel settembre del 1950 aveva colpito il paese e sia per l'accentuarsi del movimento franoso che coinvolgeva l'area dell'abitato, rendendo insicure e inagibili le dimore di Faraone."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_reformat%C4%83_din_Lopadea_Nou%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/RO_AB_Biserica_reformata_din_Lopadea_Noua_%2887%29.JPG","page_title":"Biserica reformată din Lopadea Nouă","context_page_description":"Biserica reformată din Lopadea Nouă este un monument istoric aflat pe teritoriul satului Lopadea Nouă; comuna Lopadea Nouă."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%93%E1%83%A3%E1%83%93%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Head_MRI%2C_enlarged_inferior_sagittal_sinus.png","page_title":"დუდი","context_page_description":"დუდი — ადამიერიშ ვარდა ჩხოლარიშ ნორთი, ნამუსჷთ იდვალუაფუ ტვინი, ორწყებელი, რჩქილაშ დო შუროღალი ორგანოეფი. გაგაჩამეფს დო ჭანდეფს ზოხო დუდეფი ხოლო უღუნა.\\nადამიერიშ დუდიშ წჷმი ნორთის სახე ჯოხო, ჩხოლარიშის - ნიჩვი ვარდა ჯონჯო. დუდი რსხულს მითმიარსხუ კინჩხით. კინჩხი ადამიერს დუდიშ მიკორთაშ დო ოფირჩას გორკვიაფილი პოზიციაშ დაკებაშ საშუალებას არზენს."},{"page_url":"https://de.wikipedia.org/wiki/Esquilin-Schatz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Kardinal_Giulio_Maria_della_Somaglia.jpg","page_title":"Esquilin-Schatz","context_page_description":"Der Esquilin-Schatz ist ein antiker römischer Silberschatz, der 1793 bei Grabungsarbeiten in Rom gefunden wurde. Der Fund gilt als ein bedeutendes Zeugnis für spätantike Silberarbeiten."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%83%B3%E3%83%BB%E3%83%88%E3%83%BC%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/FNY-04_Cimicifuga_racemosa.png","page_title":"ジョン・トーリー","context_page_description":"ジョン・トーリーは、アメリカ合衆国の植物学者である。"},{"page_url":"https://en.wikipedia.org/wiki/Liliuokalani_Park_and_Gardens","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/QLPHilo.JPG","page_title":"Liliuokalani Park and Gardens","context_page_description":"Liliʻuokalani Park and Gardens is a 24.14-acre park with Japanese gardens, located on Banyan Drive in Hilo on the island of Hawaiʻi.\\nThe park's site was donated by Queen Liliʻuokalani, and lies southeast of downtown Hilo, on the Waiakea Peninsula in Hilo Bay. Much of the park now consists of Edo-style Japanese gardens, built 1917-1919, and said to be the largest such gardens outside Japan. The gardens contain Waihonu Pond as well as bridges, ponds, pagodas, statues, torii, and a Japanese teahouse.\\nIncluded in the park is the small island called Moku ola, connected to the park by a footbridge. It is a good place for a picnic, and some limited swimming. The name Moku ola literally means \\"island of life\\" in the Hawaiian language, since it was the site of an ancient temple dedicated to healing.\\nThere is a stone tower on the east side of the island which is the remnant of the old footbridge which was destroyed by a tsunami.\\nFrom Coconut Island one has a great view of Hilo Bayfront, Downtown Hilo, and the rest of Hilo Bay. To the east, you can see the massive breakwater protecting Hilo Bay. It is located at coordinates 19°43′36″N 155°4′6″W."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B2%D0%B5%D0%BD%D0%B8%D0%B4%D0%B0_(%D1%82%D0%B5%D0%B0%D1%82%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Buenos_Aires_-_Avenida_de_Mayo_-_Teatro_Avenida.jpg","page_title":"Авенида (театр)","context_page_description":"Театр Авенида. Основан в 1908 году. Является традиционным местом где исполняются испанские комедии, оперетта. Расположен на проспекте Авенида-де-Майо под номером 1222 в районе Монсеррат."},{"page_url":"https://uk.wikipedia.org/wiki/CRYBB1","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Protein_CRYBB1_PDB_1oki.png","page_title":"CRYBB1","context_page_description":"CRYBB1 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 22-ї хромосоми. Довжина поліпептидного ланцюга білка становить 252 амінокислот, а молекулярна маса — 28 023.\\nЗадіяний у такому біологічному процесі, як ацетилювання."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D1%80%D0%BD%D1%81%D1%82_%D0%9B%D1%83%D0%B4%D0%B2%D0%B8%D0%B3_%D1%84%D0%BE%D0%BD_%D0%9C%D0%B0%D0%BD%D1%81%D1%84%D0%B5%D0%BB%D0%B4-%D0%A5%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%BE%D1%80%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Mansfeld-St-Wappen.png","page_title":"Ернст Лудвиг фон Мансфелд-Хинтерорт","context_page_description":"Ернст Лудвиг фон Мансфелд-Хинтерорт е граф на Мансфелд-Хинтерорт-Хелдрунген. е граф на Мансфелд-Хинтерорт-Хелдрунген.\\nТой е големият син на граф Фридрих Кристоф фон Мансфелд-Хинтерорт и съпругата му графиня Агнес фон Еверщайн–Масов, дъщеря на граф Волфганг II фон Еверщайн–Масов и графиня Анна фон Липе.\\nБрат е на Кристиан Фридрих, граф и господар на Мансфелд, Йохан Албрехт и на Мария Сибила, омъжена за фрайхер Йохан Хайнрих фон Шьонбург-Ремзе.\\nЕрнст Лудвиг фон Мансфелд-Хинтерорт умира на 9 април 1632 г. на 26 години в Айзлебен, Саксония-Анхалт, и е погребан там в църквата „Св. Анна“."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB_%D0%B0%D1%80%D0%B0%D1%81%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/kk/e/e6/Ap%D1%96s_mell%D1%96fera.jpg","page_title":"Бал арасы","context_page_description":"Ара, үй арасы, бал арасы – жарғаққанаттылар отрядының өкілі. Қазақстанның барлық облыстарында кездеседі."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%86%D8%A7%D8%A9_%D8%A7%D9%84%D8%B3%D9%88%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Baku_pipelines-ar.svg","page_title":"قناة السويس","context_page_description":"قناة السويس هي ممر مائي اصطناعي ازدواجي المرور في مصر، يبلغ طولها 193 كم وتصل بين البحرين الأبيض المتوسط والأحمر، وتنقسم طولياً إلى قسمين شمال وجنوب البحيرات المرّة، وعرضياً إلى ممرين في أغلب أجزائها لتسمح بعبور السفن في اتجاهين في نفس الوقت بين كل من أوروبا وآسيا، وتعتبر أسرع ممر بحري بين القارتين وتوفر نحو 15 يوماً في المتوسط من وقت الرحلة عبر طريق رأس الرجاء الصالح.\\nبدأت فكرة إنشاء القناة عام 1798 مع قدوم الحملة الفرنسية على مصر، ففكر نابليون في شق القناة إلا أن تلك الخطوة لم تكلل بالنجاح، وفي عام 1854 استطاع دي لسبس إقناع محمد سعيد باشا بالمشروع وحصل على موافقة الباب العالي، فقام بموجبه بمنح الشركة الفرنسية برئاسة دي لسبس امتياز حفر وتشغيل القناة لمدة 99 عام. استغرق بناء القناة 10 سنوات، وساهم في عملية الحفر ما يقرب من مليون عامل مصري، مات منهم أكثر من 120 ألف أثناء عملية الحفر نتيجة الجوع والعطش والأوبئة والمعاملة السيئة. وتم افتتاح القناة عام 1869 في حفل مهيب وبميزانية ضخمة. وفي عام 1905 حاولت الشركة الفرنسية تمديد حق الامتياز 50 عاماً إضافية إلا أن تلك المحاولة لم تنجح مساعيها. وفي يوليو عام 1956 قام الرئيس عبد الناصر بتأميم قناة السويس، والذي تسبب في إعلان بريطانيا وفرنسا بمشاركة إسرائيل الحرب على مصر ضمن العدوان الثلاثي والذي انتهى بانسحابهم تحت ضغوط دولية ومقاومة شعبية."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A7%91%E6%9E%97%E5%BE%B7%E7%9B%AE%E9%8C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/NGC956_-_SDSS_DR14.jpg","page_title":"科林德目錄","context_page_description":"科林德目錄是瑞典天文學家佩爾·科林德收錄471個疏散星團的目錄。這本目錄於1931年出版，是科林德論文《疏散星團的結構特性及其在空間的分布》中的附錄。目錄中的物件用\\"Collinder\\"標示，例如\\"Collinder 399\\"。數值序號的前置碼包括Col + 目錄序號，或Cr +目錄序號，例如\\"Cr 399\\"。"},{"page_url":"https://de.wikipedia.org/wiki/St._Jakobus_(Brochenzell)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Brochenzell_St_Jakobus_Hauptschiff_Jakob.jpg","page_title":"St. Jakobus (Brochenzell)","context_page_description":"Die katholische Pfarrkirche St. Jakobus der Ältere in Meckenbeuren-Brochenzell wurde im Jahr 1275 erbaut und stellt damit das älteste Kirchengebäude in der Gemeinde Meckenbeuren dar. Außerdem ist sie eine Station am Jakobsweg."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_kabupaten_dan_kota_di_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Lambang_Kabupaten_Pesawaran.png","page_title":"Daftar kabupaten dan kota di Indonesia","context_page_description":"Berikut merupakan artikel tentang Daftar Kabupaten dan Kota di Indonesia. Halaman ini berisi daftar kabupaten, kabupaten administrasi, kota, dan kota administrasi dalam 34 provinsi di Indonesia. Kabupaten administrasi dan kota administrasi bukanlah daerah otonom, tetapi merupakan kabupaten/kota tanpa DPRD dan hanya terdapat di Provinsi Daerah Khusus Ibukota Jakarta."},{"page_url":"https://sv.wikipedia.org/wiki/Muricy_Ramalho","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Muricy_Ramalho_Brasileiro_2006.jpg","page_title":"Muricy Ramalho","context_page_description":"Muricy Ramalho, född 30 november 1955 i São Paulo i Brasilien, var en brasiliansk fotbollsspelare och är nu tränare för brasilianska storklubben Fluminense FC."},{"page_url":"https://sv.wikipedia.org/wiki/Makoto_Onodera","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Falkenhorst_onodera_morath_fjell_festning_1943_triple_28_cm_triple_naval_gun_gneisenau.jpg","page_title":"Makoto Onodera","context_page_description":"Makoto Onodera, född 1897, död 1987, var en japansk underrättelseofficer.\\nMakoto Onodera var Japans militärattaché i Riga i Lettland 1936-38. Mellan 1938 och 1940 hade han uppdrag i Kina bland annat för förhandlingar med Chiang Kai-shek. Han utsågs i oktober 1940 till japansk militärattaché med generalmajors rang i Stockholm, som vid denna tid var en betydelsefull spioncentral. Han talade både tyska och ryska flytande. Han arbetade i Stockholm under Japans minister i Stockholm Suemasa Okamoto från januari 1941 till efter krigsslutet i augusti 1945. Japan upprätthöll en kraftfull underrättelseverksamhet i Stockholm under hela kriget, och allt att döma var han framemot krigsslutet ansvarig för Japans underrättelsetjänst för hela Europa, och en av tre kanaler som användes för de trevare mellan USA och Japan, som föregick den amerikanska bombningen av två japanska städer med atombomber i augusti 1945.\\nEfter andra världskrigets slut arresterades han av USA, som var angeläget att efterforska hur japanerna i september 1944 delvis lyckats knäcka amerikanska koder."},{"page_url":"https://en.wikipedia.org/wiki/ESO_269-57","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Galaxy.ap19.2003.750pix.jpg","page_title":"ESO 269-57","context_page_description":"ESO 269-57 is a large spiral galaxy located about 150 million light-years away in the constellation Centaurus. ESO 269-57 has a diameter of about 200,000 light-years. It is part of group of galaxies known as LGG 342."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BA%D0%B2%D0%B8%D0%BE_%D0%A2%D0%B0%D0%BD%D0%B0%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Lequio_tanaro_inverno.jpg","page_title":"Леквио Танаро","context_page_description":"Леквио Танаро је насеље у Италији у округу Кунео, региону Пијемонт.\\nПрема процени из 2011. у насељу је живело 418 становника. Насеље се налази на надморској висини од 329 м."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BC%8A%E9%82%A3%E5%85%AB%E5%B9%A1%E9%A7%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Ina-yawataeki.JPG","page_title":"伊那八幡駅","context_page_description":"伊那八幡駅は、長野県飯田市八幡町にある、東海旅客鉄道飯田線の駅である。\\nかつて、急行列車が運行されていた時代は急行停車駅であった。"},{"page_url":"https://nl.wikipedia.org/wiki/Gehofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Gehofen_in_KYF.png","page_title":"Gehofen","context_page_description":"Gehofen is een gemeente in de Duitse deelstaat Thüringen, en maakt deel uit van de Kyffhäuserkreis. Gehofen telt 659 inwoners."},{"page_url":"https://eu.wikipedia.org/wiki/Ammospermophilus_harrisii","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Antelope-squirrel-phoenix-arizona.jpg","page_title":"Ammospermophilus harrisii","context_page_description":"Ammospermophilus harrisii Ammospermophilus generoko animalia da. Karraskarien barruko Xerinae azpifamilia eta Sciuridae familian sailkatuta dago."},{"page_url":"https://ceb.wikipedia.org/wiki/Tracheophyta_sa_Bosniya_ug_Ersogobina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Pradera5.jpg","page_title":"Tracheophyta sa Bosniya ug Ersogobina","context_page_description":"Ang lista sa mga tanum nga sa Tracheophyta sa Bosniya ug Ersogobina, kauban ang gipaila nga mga species ug endemic species sa Bosnia ug Herzegovina, usa ka dili kompleto nga pagtan-aw sa mga vascular mosses, ferns ug angiospermous species species nga gikutlo sa magamit nga literatura sa Bosnian Croatian, Serbian ug Serbo-Croatian. Wala giapil sa kultura ug usahay gipaila.\\nMubo nga sulat\\nTungod sa sublisubli nga mga pagbag-o sa rolohikal nga pag-uuri ug /o ranggo sa taxonomic ug mga ngalan sa taxa nga gilakip, ang pipila niini nagpakita sa kaduha sa gilakip nga lista. Tinuod kini labi sa mga ngalan nga binomial nga ngalan nga gigamit gihapon karon."},{"page_url":"https://it.wikipedia.org/wiki/Lummus_Park_Historic_District","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Miami_FL_Lummus_Park_HD_park01.jpg","page_title":"Lummus Park Historic District","context_page_description":"Lummus Park Historic District è un quartiere di Miami, nella Contea di Miami-Dade con una popolazione nel 2010 di 3.027 abitanti.\\nIl 25 ottobre 2006 è stato inserito nel National Register of Historic Places degli Stati Uniti in quanto ospita alcune delle strutture più antiche di Miami, ancora in ottimo stato di conservazione."},{"page_url":"https://fr.wikipedia.org/wiki/Tirana_(rivi%C3%A8re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Zall_Dajti.jpg","page_title":"Tirana (rivière)","context_page_description":"La Tirana est une rivière d'Albanie d'une longueur de 18 km. Elle est un affluent du Gjole."},{"page_url":"https://tr.wikipedia.org/wiki/Na_Hye-sok","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%EB%82%98%ED%98%9C%EC%84%9D-Na_Hye-seok.jpg","page_title":"Na Hye-sok","context_page_description":"Na Hye-sok Koreli aktivist, ressam, gazeteci, şair, feminist yazar. Yazılarında Jeongwol mahlasını kullanmıştır."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%B0%E5%B7%9E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Lanzhou_Montage.jpg","page_title":"兰州市","context_page_description":"兰州市，简称兰，别称金城，是中华人民共和国甘肃省省会，国务院批复确定的中国西北地区重要的工业基地和综合交通枢纽，西部地区重要的中心城市之一，位于甘肃省中部。市境西北界武威市，东北接白银市，南邻定西市、临夏州，西毗青海省海东市。地处黄土高原、青藏高原与内蒙古高原交汇处，南北两侧为祁连山余脉。黄河在市境西南与湟水汇合，向东横贯市区，兰州城位于河谷盆地之中。全市总面积13,192平方公里，人口370.55万，市人民政府驻城关区。兰州是中国陆域版图的几何中心，中国人民解放军西部战区陆军机关驻地，一带一路重要节点城市，中国重要的铁路枢纽，包兰、兰新、兰青、陇海、兰渝、成兰等铁路交汇于此。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%B7%D1%8C%D0%BC%D1%96%D0%BD%D0%B0_%D0%90%D0%BD%D0%B0%D1%81%D1%82%D0%B0%D1%81%D1%96%D1%8F_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D1%96%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Kuzmina-2015.jpg","page_title":"Кузьміна Анастасія Володимирівна","context_page_description":"Анастасі́я Володи́мирівна Кузьміна́ — словацька біатлоністка російського походження, триразова олімпійська чемпіонка, чемпіонка світу, неодноразова переможниця континентальних першостей і чемпіонатів світу серед юніорів, майстер спорту міжнародного класу. Срібна призерка чемпіонату світу 2009 року в мас-старті, дворазова чемпіонка Європи 2009 року.\\nКузьміна визнавалася найкращою спортсменкою Словаччини 2010, 2014 і 2018 років. 2019 року вона завершила спортивну кар'єру."},{"page_url":"https://pt.wikipedia.org/wiki/Polo_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Map_of_the_Arctic_region_showing_the_Northeast_Passage%2C_the_Northern_Sea_Route_and_Northwest_Passage%2C_and_bathymetry.png","page_title":"Polo Norte","context_page_description":"Polo Norte, ou Polo Norte Geográfico, é o ponto de intersecção do eixo de rotação da Terra com sua superfície no Hemisfério Norte, sendo a região que se localiza mais ao norte do planeta. Está situado no Oceano Glacial Ártico, onde o mar está coberto por uma camada de gelo. Ao todo, se distinguem quatro polos: o magnético, o geográfico, o geomagnético e o histórico.\\nO Polo Norte é diametralmente oposto ao Polo Sul. As coordenadas geográficas do Polo Norte são: 90° 00′ 00″ de latitude norte, não possuindo longitude, pois é o ponto de convergência de todos os meridianos. No Polo Norte também não se aplica a nenhum fuso horário. Dia e a noite polar duram 6 meses cada. A profundidade do Oceano Ártico nesse ponto é 4 261. A temperatura média do ar no inverno é de cerca de -40° C e no verão é cerca de 0° C. O perímetro de terras emersas mais próximo é Ilha Kaffeklubben, e o assentamento mais próximo é na Ilha Ellesmere, a 817 quilômetros do Polo Norte.\\nMatthew Henson foi o primeiro humano a pisar no Polo Norte, em 6 de abril de 1909, junto com seu assistente Robert Edwin Peary e quatro esquimós."},{"page_url":"https://nl.wikipedia.org/wiki/Albert_Lebourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Lebourg_CanalIinRotterdam.jpg","page_title":"Albert Lebourg","context_page_description":"Albert-Charles Lebourg was een Frans kunstschilder. Hij wordt gerekend tot het impressionisme."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B7%D0%B0%D1%80_(%D0%BA%D1%96%D0%BD%D0%BE%D0%BF%D1%80%D0%B5%D0%BC%D1%96%D1%8F,_1985)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sabine_Az%C3%A9ma_C%C3%A9sars.jpg","page_title":"Сезар (кінопремія, 1985)","context_page_description":"10-та церемонія вручення нагород премії «Сезар» Академії мистецтв та технологій кінематографа за заслуги у царині французького кінематографу за 1984 рік відбулася 3 лютого 1985 року в Théâtre de l'Empire.\\nЦеремонія проходила під головуванням Симони Синьоре, розпорядником та ведучим виступив П'єр Чернія. Найкращим фільмом визнано стрічку Відчиніть, поліція! режисера Клода Зіді."},{"page_url":"https://de.wikipedia.org/wiki/Kolbenturnierhelm","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/R%C3%BCxner-Kolbenturnier.jpg","page_title":"Kolbenturnierhelm","context_page_description":"Als Kolbenturnierhelm, in der Heraldik auch Bügel- oder Spangenhelm genannt, wird ein im 15. und frühen 16. Jahrhundert gebräuchlicher Turnierhelm mit großer, kugelförmiger Glocke und vergittertem Gesichtsfeld bezeichnet. In einer späteren Entwicklung ist die Helmglocke aus Gewichtsersparnisgründen aus gepresstem Leder. Bekannt ist auch der Escuffa der als Helmverstärkung eingesetzt wurde.\\nDieser zu den Varianten der Beckenhaube zählende Helmtypus kam als spezieller Kopfschutz für das beim Adel beliebte Kolbenturnier auf. Hierbei musste dem Gegner mit einem hölzernen Streitkolben die Helmzier abgeschlagen werden. Unter Friedrich III. wurde der Kolbenturnierhelm zum Wappensymbol erhoben, dessen Verwendung in Abgrenzung zum bürgerlichen Stechhelm ursprünglich dem Adel vorbehalten bleiben sollte. Um die Wende zum 16. Jahrhundert verlor das Kolbenturnier seine Bedeutung, so dass der hierzu getragene Helm nur noch eine heraldische Funktion als Wappensymbol und Funeralhelm erfüllte."},{"page_url":"https://en.wikipedia.org/wiki/Lensworld%E2%80%93Kuota","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Quaregnon_-_Le_Samyn%2C_4_mars_2015%2C_d%C3%A9part_%28B64%29.JPG","page_title":"Lensworld–Kuota","context_page_description":"Lensworld–Kuota is a former professional cycling team based in Belgium, which competed in elite road bicycle racing events such as the UCI Women's Road World Cup.\\nIn October 2017, the team announced they would fold before the start of the 2018 season. Lensworld had been recently taken over by peer - LensOnline - who decided not to renew the title sponsorship of the team."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%AB%E3%83%99%E3%83%BC%E3%83%AB%E3%83%BB%E3%83%A2%E3%83%86%E3%82%A3%E3%82%A8%E3%83%BB%E3%83%89%E3%83%BB%E3%83%A9%E3%83%95%E3%82%A1%E3%82%A4%E3%82%A8%E3%83%83%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Blason_fam_fr_Motier_de_La_Fayette.svg","page_title":"ジルベール・モティエ・ド・ラファイエット","context_page_description":"ジルベール・モティエ・ド・ラファイエットは、ラファイエットおよびポンジボー、エイエ、ネブーザック、サン＝ロマン、モンテル＝ド＝ジュラの領主、百年戦争中のフランス元帥。ラファイエット侯爵ジルベール・デュ・モティエの先祖である。"},{"page_url":"https://de.wikipedia.org/wiki/Arrondissement_Digne-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Locator_map_of_Arrondissement_Digne-les-Bains_2019.png","page_title":"Arrondissement Digne-les-Bains","context_page_description":"Das Arrondissement Digne-les-Bains ist eine Verwaltungseinheit des Départements Alpes-de-Haute-Provence innerhalb der französischen Region Provence-Alpes-Côte d’Azur. Präfektur ist Digne-les-Bains.\\nEs besteht aus acht Kantonen und 46 Gemeinden."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D0%B5%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/%D0%92%D0%B0%D0%BB%D0%B5%D1%82%D1%82%D0%B0.jpg","page_title":"Валета","context_page_description":"Валета или Ла Валета је главни град Малте и налази се на истоименом острву. Валета чини и једну од 11 градских општина Малте.\\nПо величини Валета није највеће насеље ни град у држави, већ је то Биркиркара. Међутим, и поред тога, она је историјско, културно и управно средиште острвља вековима.\\nЗбог свог историјског и културног значаја и очуваности старог изгледа у великим зидинама Ла Валета је стављена на списак светске баштине УНЕСКО-а."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%A7%D9%85%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Hami_mcp.png","page_title":"هامی","context_page_description":"استان قومول یا قامل یکی از ولایات منطقه خودمختار سین‌کیانگ می‌باشد."},{"page_url":"https://de.wikipedia.org/wiki/Adolph_Saurer_AG","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Saurer_Gottwald_-_Schweizer_Armee_-_Steel_Parade_2006.jpg","page_title":"Adolph Saurer AG","context_page_description":"Die Adolph Saurer AG in Arbon am Bodensee war der bedeutendste Schweizer Hersteller von mittleren und schweren Lastwagen und zeitweise auch von Autobussen und Trolleybussen sowie Militärfahrzeugen.\\nDie heutige Saurer AG ist einer der grössten Textilmaschinenhersteller der Welt mit einem Umsatz von 1,6 Milliarden Euro und fast 9.000 Beschäftigten. Ein Drittel davon sind im zweiten Geschäftszweig Fahrzeuggetriebe-Bau tätig.\\nDie Saurer AG war ab Anfang 2007 eine Tochtergesellschaft der OC Oerlikon Corporation AG in Pfäffikon und gehört seit 2013 mit den Geschäftseinheiten Naturfasern und Textilkomponenten der chinesischen Jinsheng-Gruppe."},{"page_url":"https://en.wikipedia.org/wiki/Saad_Khan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Saad_oct_2014_resize.jpg","page_title":"Saad Khan","context_page_description":"Saad Khan is an Indian film director, screenwriter and acting teacher. He is the founder and creative head of FirstAction and A for Acting where he mentors nurturing talents. Khan is known for his Kannada feature film Humble Politician Nograj, which is the first Kannada film to achieve world-wide digital audience presence on Amazon Prime.\\nKhan worked in Bollywood as an Associate Director to Oscar nominated filmmaker Ashutosh Gowariker. Khan was the director of the 2014 film Station, that was the first Hindi feature film in Bangalore. In 2008, Khan's short film Another Kind of Black was screened at the Cannes Film Festival. In 2016, Khan filmed his first Hollywood feature film titled Love and She in Louisiana. In 2018, his home-grown critically acclaimed film Humble Politician Nograj released. The film became the first Kannada-English film to become a box office hit in India and achieve the biggest overseas release across USA, UK, Europe, Australia, Germany, among other countries."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BF%83%E7%94%B5%E5%9B%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Contiguous_leads.svg","page_title":"心电图","context_page_description":"心電圖是一種經胸腔的以時間為單位記錄心臟的電生理活動，並通過皮膚上的電極捕捉並記錄下來的診療技術。這是一種無創性的記錄方式。Electrocardiography的詞源來自於三個希臘單詞：「electro」，因為和電生理活動有關，「cardio」，希臘語「心臟」，還有「graph」，一個希臘語的詞根，意思為：「描記」。\\n心電圖的工作原理：在每次心跳心肌細胞去極化的時候會在皮膚表面引起很小的電學改變，這個小變化被心電圖記錄裝置捕捉並放大即可描繪心電圖。在心肌細胞處於靜息狀態時，心肌細胞膜兩側存在由正負離子濃度差形成的電勢差，去極化即是心肌細胞電勢差迅速向0變化，並引起心肌細胞收縮的過程。在健康心臟的一個心動周期中，由竇房結細胞產生的去極化波有序的依次在心臟中傳播，先傳播到整個心房，經過「內在傳導通路」傳播至心室。如果在心臟的任意兩面放置2個電極，那麼在這個過程中就可以記錄到兩個電極間微小的電壓變化，並可以在心電圖紙或者監視器上顯示出來。心電圖可以反應整個心臟跳動的節律，以及心肌薄弱的部分。\\n通常在肢體上可以放置2個以上的電極，他們兩兩組成一對進行測量。每個電極對的輸出信號稱為一組導程。導程簡單的說就是從不同的角度去看心臟電流的變化。心電圖的種類可以以導程來區分，如3導程心電圖，5導程心電圖與12導程心電圖，等等。12導程心電圖是臨床最常見的一種，可以同時記錄體表12組導程的電位變化，並在心電圖紙上描繪出12組導程信號，常用於一次性的心電圖診斷。\\n3導程及5導程心電圖多用於需要通過監視器連續檢測心電活動的情況，如手術過程中或在救護車轉運病人時的監護中。根據儀器的不同，這種連續監測的結果有時可能不會被完整地記錄下來。\\n心電圖是測量和診斷異常心臟節律的最好方法，用以診斷心電傳導組織受損時心臟的節律異常，以及由於電解質平衡失調引起的心臟節律的改變。在心肌梗塞的診斷中，它可以特異性的分辨出心肌梗塞的區域。 心電圖並不能全面地評估心臟的泵血能力，這通常由心臟超音波或者核醫學手段來完成。某些情況下，正常ECG圖像的病人卻可能會出現心臟停搏。"},{"page_url":"https://ro.wikipedia.org/wiki/Montana,_Bulgaria","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Panoramic_view_from_Montana_%28Bulgaria%29.jpg","page_title":"Montana, Bulgaria","context_page_description":"Montana este un oraș în Obștina Montana, Regiunea Montana, Bulgaria."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Wuppertaler_Wohnquartier_Nordstadt_(L%E2%80%93M)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Wuppertal_Marienstra%C3%9Fe_2014_222.jpg","page_title":"Liste der Baudenkmäler im Wuppertaler Wohnquartier Nordstadt (L–M)","context_page_description":"Die Liste der Baudenkmäler im Wuppertaler Wohnquartier Nordstadt (L–M) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Wuppertal-Nordstadt in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Wuppertal eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://it.wikipedia.org/wiki/Lady_Gaga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Carnegie_Hall1.jpg","page_title":"Lady Gaga","context_page_description":"Lady Gaga, pseudonimo di Stefani Joanne Angelina Germanotta, è una cantautrice, attrice e attivista statunitense.\\nArtista camaleontica, conosciuta per i modi eccentrici, trae il proprio nome d'arte dal brano Radio Ga Ga dei Queen. Lady Gaga si è imposta da subito nel panorama musicale tanto per il suo essere provocatoria quanto per le qualità delle sue performance live; in molti, infatti, l'hanno definita una delle migliori interpreti pop del XXI secolo.\\nL'artista è sotto contratto con la Interscope Records e ha debuttato nel 2008 con l'album The Fame, incluso dalla rivista Rolling Stone tra i 100 migliori album di debutto della storia; da esso sono stati estratti vari singoli, tra cui Just Dance e Poker Face, di grande successo mondiale. A The Fame ha fatto seguito nel 2009 l'EP The Fame Monster, dal quale sono stati estratti i singoli Bad Romance, Telephone e Alejandro. Il secondo album in studio della cantante, Born This Way, pubblicato nel 2011, ha raggiunto il primo posto negli Stati Uniti d'America e in altri venti stati; il singolo omonimo fu inoltre il più veloce della storia nelle vendite su iTunes con oltre un milione di copie vendute in cinque giorni."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%AA%E5%B9%B3%E6%B4%8B%E3%83%97%E3%83%AC%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Earth_seafloor_crust_age_1996_-_2.png","page_title":"太平洋プレート","context_page_description":"太平洋プレートは、太平洋の海底の地殻及びマントル上方のリソスフェアを形成する海洋プレートである。"},{"page_url":"https://en.wikipedia.org/wiki/Trench_railways","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Narrow_gauge_construction.jpg","page_title":"Trench railways","context_page_description":"Trench railways represented military adaptation of early 20th century railway technology to the problem of keeping soldiers supplied during the static trench warfare phase of World War I. The large concentrations of soldiers and artillery at the front lines required delivery of enormous quantities of food, ammunition and fortification construction materials where transport facilities had been destroyed. Reconstruction of conventional roads and railways was too slow, and fixed facilities were attractive targets for enemy artillery. Trench railways linked the front with standard gauge railway facilities beyond the range of enemy artillery. Empty cars often carried litters returning wounded from the front."},{"page_url":"https://en.wikipedia.org/wiki/Fishponds","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Station_Road_Fishponds.jpg","page_title":"Fishponds","context_page_description":"Fishponds is a large outer suburb in the north-east of the English city of Bristol, about 3 miles from the city centre. It has two large Victorian-era parks: Eastville Park and Vassall's Park. The River Frome runs through both parks, with the Frome Valley Walkway alongside it. A restored mill can be found at Snuff Mills near the Vassall's Park end of the river. It has retained its original waterwheel, which can still be seen and heard turning. Eastville Park has its own large boating lake, with central wildlife reserves.\\nFishponds is mainly residential through which two main bus routes pass. Housing is typically of the terraced Victorian variety. The high street has many shops, such a butchers, charity shops and takeaways as well as Lidl, Aldi and Morrisons supermarkets. There is a small student population due to the presence of the Glenside campus of the University of the West of England.\\nThe name of this area of Bristol derives from when it was, like nearby Soundwell, a quarry district. The empty quarries were then filled and there were many large fishponds in the area which have since been filled in."},{"page_url":"https://sv.wikipedia.org/wiki/Hemaris_affinis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Hemaris_affinis_BMNHE274265_male_up.jpg","page_title":"Hemaris affinis","context_page_description":"Hemaris affinis är en fjärilsart som beskrevs av Bremer 1861. Hemaris affinis ingår i släktet Hemaris och familjen svärmare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D9%88%D9%81%D9%8A%D8%B3_%D8%A7%D9%84%D8%A3%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Battle_of_Tolbiac.jpg","page_title":"كلوفيس الأول","context_page_description":"كلوفيس الأول كان أول ملك للفرنكيين يوحد جميع القبائل تحت حاكم واحد.\\nخلف كلوفيس الأول والده شيلديريك الأول في 481 ملكا قبائل السليان الفرنكيين، واحدة من قبائل الفرنكيين الذين احتلوا المنطقة الواقعة إلى الغرب من نهر الراين السفلي، بما لديهم من مركز على طول الحدود بين فرنسا وبلجيكا.غزا كلوفيس القبائل الفرنكية المجاورة وأعلن نفسه بأنه الملك الوحيد قبل وفاته. ويعتبر كلوفيس الأول مؤسس كلا من فرنسا وحكم سلاله الميروفنجيين التي حكمت الفرنكيين لقرنين."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8F%8A%E8%8A%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Purple_Chrysanthemum.JPG","page_title":"菊花","context_page_description":"菊花是菊科菊屬多年生草本植物。別名黃花、黃華、秋菊、陶菊、壽客等。在中國古典文學中及文化中，菊花有著重要的地位，其與梅、蘭、竹合稱四君子。"},{"page_url":"https://fr.wikipedia.org/wiki/Gaston_Heuet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Gaston_Heuet_1920.jpg","page_title":"Gaston Heuet","context_page_description":"Gaston Heuet est un athlète français spécialiste des courses de fond.\\nLicencié au Métropolitain Club de Colombes, il participe aux Jeux olympiques de 1912 où il est éliminé dès les séries du 5 000 mètres. En 1920, aux Jeux olympiques d'Anvers, Gaston Heuet se classe huitième en individuel et cinquième par équipes de l'épreuve de cross-country. Il termine par ailleurs quatrième du 3 000 m par équipes, et dispute la finale du 10 000 m. Le Français participe quatre ans plus tard aux Jeux olympiques de 1924 se déroulant à Paris. Il y remporte la médaille de bronze du cross-country par équipes aux côtés de Henri Lauvaux et Maurice Norland, et se classe par ailleurs 12ᵉ du 10 000 mètres.\\nIl remporte les titres de champions de France du 5 000 m en 1922 et du 10 000 m en 1920 et 1924."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B0_%D1%81%D0%B0%D1%83%D0%B4%D0%B0%D1%81%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Alaska_Purchase_%28hi-res%29.jpg","page_title":"Аляска саудасы","context_page_description":"Алясканың саудасы — АҚШ мемлекеттік хатшысы Уиллиам Сюардтың ұсынысымен Америка Құрама Штаттарының Аляска аймағын 1867 жылы Ресей империясынан сатып алу оқиғасы. Сатып алынған аймақтың ауданы 1 518 800 км² тең болып, қазіргі Аляска штатының жерін құрайды."},{"page_url":"https://ht.wikipedia.org/wiki/Castilleja_del_Campo_(Seville)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Castilleja_del_Campo.PNG","page_title":"Castilleja del Campo (Seville)","context_page_description":"Castilleja del Campo (Seville) se yon komin nan pwovens Seville, nan kominote otonòm Andalouzi, nan peyi Espay.\\nLi genyen 614 moun, nan lane 2005, li vini genyen 638 moun. Sipèfisi l se\\n16,22 km^2."},{"page_url":"https://de.wikipedia.org/wiki/M59_APC","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/M59-APC.jpg","page_title":"M59 APC","context_page_description":"Der M59 war ein gepanzertes Mannschaftstransportfahrzeug der US Army, das von der FMC Corp. produziert wurde, von 1954 bis Ende 1989 im Dienst.\\nNachdem sich der M75 als Nachfolger des M3-Halbkettenfahrzeuges als völlig untauglich und viel zu teuer erwiesen hatte, begannen bereits noch während dessen Einführungsphase die Entwicklungsarbeiten an einem Folgemodell."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%BE%D1%98%D0%BD%D0%B0_%D0%BD%D0%B0_%D1%80%D0%BE%D0%B7%D0%B8%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Coat_of_arms_of_Sir_John_de_Vere%2C_13th_Earl_of_Oxford.png","page_title":"Војна на розите","context_page_description":"Војната на розите — граѓанска војна која се водела за англискиот престол помеѓу Династија Јорк и Династија Ланкастер. Овие династии биле директни потомци на Династија Плантагенет, на чие чело стоел кралот Едвард III од Англија. Самиот назив на војната, односно војна на розите, во тоа време не бил користен. Името било создадено неколку години подоцна за да се претстават двете спротиставени страни. Династија Јорк била припадник на т.н. бела роза а династијата Ланкастер на црвената роза. Називот во употреба влегол во текот на 16 век, по создавањето на Шекспировата драма насловена под името ‘’Хенри VI’’, каде претставниците на двете страни избираат две различни по боја рози."},{"page_url":"https://it.wikipedia.org/wiki/BMW_VI","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/BMW_VI.jpg","page_title":"BMW VI","context_page_description":"Il BMW VI era un motore aeronautico a 12 cilindri a V di 60° raffreddato ad acqua realizzato dalla tedesca BMW Flugmotorenbau GmbH negli anni venti. Fu il primo motore aeronautico a V costruito dalla casa tedesca e uno dei più importanti propulsori utilizzati in Germania nel periodo tra la prima e la seconda guerra mondiale."},{"page_url":"https://fy.wikipedia.org/wiki/Auschwitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Map_of_Auschwitz_and_environs%2C_1944.jpg","page_title":"Auschwitz","context_page_description":"Auschwitz wie it grutste ferneatigingskamp fan Nazi-Dútslân. It lei yn Poalen, ûnder it stedsje Auschwitz, en is in symboal foar de Holocaust en foar de misdieden tsjin de minske. Op de Wannseekonferinsje, hâlden begjin 1942, waard troch de Dútskers besletten alle Joaden fan Jeropa te ferneatigjen en keazen om dat dwaan te litten yn de omkriten fan Auschwitz. De reden omdat dêr te dwaan wie in suver ekonomyske. De measte Joaden wennen yn it Easten en by Auschwitz lei in knooppunt fan spoarwegen. Fierders spile mei dat oan de Joaden fertsjinne wurde koe yn de tiid dat sy noch in libben wienen. Hja moasten arbeidzje yn de protte fabriken dy't yn de omkriten fan Auschwitz stienen."},{"page_url":"https://en.wikipedia.org/wiki/Flensburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Dampfer_Alexandra_mit_St._J%C3%BCrgen-Kirche_%28Flensburg%29_im_Hintergrund.JPG","page_title":"Flensburg","context_page_description":"Flensburg is an independent town in the north of the German state of Schleswig-Holstein. Flensburg is the centre of the region of Southern Schleswig. After Kiel and Lübeck, it is the third largest town in Schleswig-Holstein.\\nIn May 1945, Flensburg was the seat of the last government of Nazi Germany, the so-called Flensburg government led by Karl Dönitz, which was in power from 1 May, the announcement of Hitler's death, for one week, until German armies surrendered and the town was occupied by Allied troops. The regime was officially dissolved on 23 May.\\nThe nearest larger towns are Kiel and Odense in Denmark.\\nFlensburg's city centre lies about 7 km from the Danish border.\\nIn Germany, Flensburg is known for\\nthe Kraftfahrt-Bundesamt with its Verkehrssünderkartei, where details are stored of traffic offences\\nits beer Flensburger Pilsener, also called \\"Flens\\"\\nthe centre of the Danish national minority in Germany\\nthe greeting Moin Moin\\nthe large erotic mail-order companies Beate Uhse and Orion\\nits handball team SG Flensburg-Handewitt\\nthe Naval Academy at Mürwik with its sail training ship Gorch Fock"},{"page_url":"https://ca.wikipedia.org/wiki/Pierre-Suzanne_Lucas_de_La_Championni%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Portrait_de_Pierre-Suzanne_Lucas_de_La_Championni%C3%A8re.jpg","page_title":"Pierre-Suzanne Lucas de La Championnière","context_page_description":"Pierre-Suzanne Lucas de La Championnière fou un cap vendeà de l'exèrcit de Charette durant les batalles de la Revolta de La Vendée i diputat de Loira Atlàntic."},{"page_url":"https://ms.wikipedia.org/wiki/Mod%C3%A8le_1951_helmet","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Mod%C3%A8le_1951_helmet_6331.jpg","page_title":"Modèle 1951 helmet","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_Japans","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/JomonStatue.JPG","page_title":"Geschichte Japans","context_page_description":"Die Geschichte Japans ist geprägt durch ein Wechselspiel aus Isolation und äußeren Einflüssen. Einerseits führten sowohl die geographische Abgeschiedenheit als auch die selbstgewählte Abschottung gegenüber der Außenwelt zu einer räumlich begrenzten und in sich geschlossenen Entwicklung auf den japanischen Inseln; so ist die Geschichte Japans nach Auffassung mancher Historiker ein Modell für die Entwicklung von der Urzivilisation zur Moderne. Andererseits prägte vor allem China durch die Ausbreitung des Buddhismus und die Lehren des Konfuzianismus die Kultur und Sprache Japans mit. Auch im Westen nahm man Einfluss auf Japans Geschichte: Gewaltsam wurde 1854 nach über zweihundertjähriger Isolation die Öffnung und Modernisierung des Landes erzwungen. Das Japanische Kaiserreich wurde in der Folge nicht nur die erste asiatische Industrienation, sondern strebte alsbald eine Ausdehnung seiner Einflusssphäre im Pazifikraum an. Die Expansion endete mit der Niederlage im Zweiten Weltkrieg und mit der Besetzung durch Truppen der Vereinigten Staaten. Heute gilt Japan als technikbegeisterter und vor allem global agierender Industriestaat."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D1%88%D1%96_%D0%9C%D0%BE%D0%BD%D0%B4%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/James_II_Maundy_1687_73001271.jpg","page_title":"Гроші Монді","context_page_description":"Гроші Монді, Монді сет — монети Великої Британії, що випускаються спеціально для роздачі монархом на релігійній церемонії у Великий четвер."},{"page_url":"https://de.wikipedia.org/wiki/Erdferkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Erdvarkgat%2C_Dingaanstat.jpg","page_title":"Erdferkel","context_page_description":"Das Erdferkel ist eine Säugetierart und stellt den alleinigen rezenten Vertreter der Gattung Orycteropus in der Familie der Orycteropodidae und der Ordnung der Tubulidentata dar. Innerhalb der Systematik der heutigen Höheren Säugetiere sind die Röhrenzähner somit die einzige Ordnung, die nur eine Art beinhaltet.\\nÄußerlich markant sind der kräftige Körper des Erdferkels mit aufgewölbtem Rücken und muskulösen Beinen sowie die röhrenförmig verlängerte Schnauze und der fleischige Schwanz. Das Verbreitungsgebiet der Art umfasst das gesamte subsaharische Afrika. Die Tiere bewohnen offene und geschlossene Landschaften. Sie leben einzelgängerisch, sind nachtaktiv und graben im Erdreich, was insgesamt die Beobachtung erschwert. Die Lebensweise des Erdferkels ist daher nur ungenügend untersucht. Seine Nahrung besteht aus staatenbildenden Insekten, was eine hochspezialisierte Anpassung darstellt. Das ausgeprägte Verhalten führt dazu, dass lockere Böden und eine ausreichende Menge an Ameisen und Termiten Grundvoraussetzungen für die Anwesenheit des Erdferkels in einer bestimmten Region sind."},{"page_url":"https://it.wikipedia.org/wiki/Marouane_Fellaini","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Fellaini%2C_Everton_FC.jpg","page_title":"Marouane Fellaini","context_page_description":"Marouane Fellaini-Bakkaoui è un calciatore belga con passaporto marocchino, centrocampista dello Shandong Luneng."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%BC%D0%B0%D0%BD%D1%83%D0%B5%D0%BB_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Immanuel_Velikovsky.jpg","page_title":"Имануел Великовски","context_page_description":"Имануел Великовски је био амерички псеудоисторичар, најпознатији као аутор бројних контроверзних књига које реинтерпретирају догађаје из древној историји, међу којима је бестселер у САД „Светови у судару“, објављена 1950. године. Претходно је имао значајну улогу у оснивању Хебрејског универзитета у Јерусалиму, и био је угледни психијатар и психоаналитичар.\\nЊегове књиге користе компаративну митологију и античке књижевне извора да докажу да је Земља доживела катастрофални блиски контакт другим планетама у древним временима. Великовски тврди да су елекотрмагнетске појаве имале значајну улогу у небеској механици. Такође заступа ревидирану хронологију старог Египта, Грчке, Израела и других култура древног Блиског истока. Циљ ревидиране хронологије је да објасни мрачно доба источног Средоземља и помири библијску историју са прихваћеном археологијом и египатском хронологијом.\\nАкадемске заједнице су теорије Великовског одбацивали или су их игнорисане. Ипак, његове књиге се често добро продају и добијају одушевљену подршку у лаичким круговима, често праћене тврдњама о непоштеном третману признатих академија према Великовском."},{"page_url":"https://de.wikipedia.org/wiki/El_Hassan_Lahssini","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Lahssini.jpg","page_title":"El Hassan Lahssini","context_page_description":"El Hassan Lahssini ist ein französischer Langstreckenläufer marokkanischer Herkunft."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_chr%C3%A1n%C4%9Bn%C3%BDch_%C3%BAzem%C3%AD_v_okrese_Ru%C5%BEomberok","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Cierny_kamen.jpg","page_title":"Seznam chráněných území v okrese Ružomberok","context_page_description":"Toto je seznam chráněných území v okrese Ružomberok aktuální k roku 2017, ve kterém jsou uvedena chráněná území v oblasti okresu Ružomberok."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D1%8E%D0%BD%D0%B8%D0%BD,_%D0%90%D1%80%D1%82%D1%91%D0%BC_%D0%9E%D0%BB%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Artjom_Vaszjunyin_111009_1.jpg","page_title":"Васюнин, Артём Олегович","context_page_description":"Артём Олегович Васюнин — венгерский хоккеист украинского происхождения, нападающий венгерского клуба «Дебрецен». Сын известного советского хоккеиста Олега Васюнина, выступавшего за киевский «Сокол», завоевавшего бронзовые медали чемпионата СССР 1985 года и завершившего свою карьеру в Венгрии."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%B0%D1%84%D0%B5%D0%B4%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Vyborg_Cathedral.jpg","page_title":"Список кафедральных соборов России","context_page_description":"Список кафедральных соборов России включает храмовые здания, находящиеся на территории Российской Федерации и принадлежащие христианским конфессиям. Комментарии по каждой конфессии находятся в соответствующем разделе.\\nРяд крупных храмов известны как «соборы» — из-за их размеров или исторической значимости, но если там никогда не было кафедры епископа, они будут включены в отдельный список."},{"page_url":"https://en.wikipedia.org/wiki/Geography_of_Houston","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Uptown_Houston.jpg","page_title":"Geography of Houston","context_page_description":"Houston, the most populous city in the Southern United States, is located along the upper Texas Gulf Coast, approximately 50 miles northwest of the Gulf of Mexico at Galveston. The city, which is the ninth-largest in the United States by area, covers 601.7 square miles, of which 579.4 square miles, or 96.3%, is land and 22.3 square miles, or 3.7%, is water.\\nHouston is located in the Gulf Coastal Plain biome, and its vegetation is classified as temperate grassland. Much of the city was built on marshes, forested land, swamp, or prairie, all of which can still be seen in surrounding areas.\\nThe city's topography is very flat, making flooding a recurring problem for its residents. The city stands about 50 feet above sea level—the highest area within city limits being 90 feet. However, subsidence, caused by extensive groundwater pumping and resource extraction, has caused the elevation to drop 10 feet or more in certain areas. As a result, the city turned to surface water sources for its municipal supply, creating reservoirs such as Lake Houston and Lake Conroe."},{"page_url":"https://hu.wikipedia.org/wiki/N%C3%A1vr%C5%A1%C3%AD_(Tu%C5%99any)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/N%C3%A1vr%C5%A1%C3%AD_%28Tu%C5%99any%29_2009-10-23.jpg","page_title":"Návrší (Tuřany)","context_page_description":"Návrší korábban önálló település, jelenleg Tuřany község településrésze Csehországban a Karlovy Vary-i kerület Chebi járásában."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%9D%BC%EC%9D%B4%EB%B2%A0%EB%A6%AC%EC%95%84%EC%9D%98_%EA%B5%AD%EA%B8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Flag_of_Liberia.svg","page_title":"라이베리아의 국기","context_page_description":"라이베리아의 국기는 1847년 8월 24일에 독립과 함께 제정되었다. 라이베리아의 독립이 미국의 해방 노예 출신 인사들을 주축으로 이루어졌기 때문에 라이베리아의 국기도 미국의 국기를 본떠서 디자인하였다.\\n11개의 가로 줄무늬는 라이베리아 독립 선언서에 서명했던 11명을, 빨강색과 하양색은 용기와 미덕을, 파랑색은 아프리카 본토를, 하양색 별은 라이베리아가 독립 당시에 아프리카 유일의 흑인 독립국이었음을 의미한다."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%86%D8%AA%D8%AE%D8%A7%D8%A8%D8%A7%D8%AA_%D9%BE%D8%A7%D8%B1%D9%84%D9%85%D8%A7%D9%86%DB%8C_%D8%A7%DB%8C%D8%B3%D9%84%D9%86%D8%AF_(%DB%B2%DB%B0%DB%B1%DB%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Katrin_Jakobsdottir%2C_undervisnings-_forsknings-_og_kulturminister_i_Island%2C_samt_samarbejdsminister_i_Nordisk_Ministerrad.jpg","page_title":"انتخابات پارلمانی ایسلند (۲۰۱۶)","context_page_description":"انتخابات پارلمانی ایسلند در ۲۹ اکتبر ۲۰۱۶ انجام شد. این انتخابات قرار بود در ۲۷ آوریل ۲۰۱۷ برگزار شود اما ائتلاف حاکم ایسلند در پی تظاهرات مردمی ۲۰۱۶ علیه دولت اعلام کرد که انتخابات زودهنگام برگزار خواهد کرد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%91%D0%BE%D0%B3%D0%BE%D1%8F%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B2_%D0%93%D0%BE%D0%BD%D1%87%D0%B0%D1%80%D0%B0%D1%85_(%D0%9A%D0%BE%D0%BB%D0%BE%D0%BC%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%91%D0%BE%D0%B3%D0%BE%D1%8F%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B2_%D0%93%D0%BE%D0%BD%D1%87%D0%B0%D1%80%D0%B0%D1%85_%28%D0%9A%D0%BE%D0%BB%D0%BE%D0%BC%D0%BD%D0%B0%29.jpg","page_title":"Церковь Богоявления в Гончарах (Коломна)","context_page_description":"Церковь Богоявления в Гончарах — православный храм в Коломне. Единственная в городе, не закрывавшаяся для богослужения в советское время и, следовательно, выполнявшая в 1940-х — 1980-х годах роль кафедрального храма митрополитов Крутицких и Коломенских.\\nОснована в XVI веке. Находится недалеко от железнодорожной платформы Коломна Московской железной дороги.\\nДо 1680 храм назывался Спаса Нерукотворного.\\nРодословные корни святителя Филарета уходят в наследственный приход храма Богоявления в Гончарах. Самое древнее упоминание о родственниках святителя Филарета в Коломне относится к 1751 г. в городских документах упоминается Афанасий Филиппов, священник церкви Богоявления в Гончарах, прадед Митрополита Филарета. В его семье родился дедушка святителя, Никита Афанасьевич. Он также стал священником Богоявленского храма.\\nЧетверик церкви, увенчанный небольшим пятиглавием, был перестроен в 1800—1804. Тогда же в стиле классицизма выстроены трапезная с Введенским и Харалампиевским приделами и колокольня."},{"page_url":"https://lt.wikipedia.org/wiki/Steponkaimis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Steponkaimis%2C_%C5%BEenklas.JPG","page_title":"Steponkaimis","context_page_description":"Steponkaimis – kaimas Raseinių rajone, 4 km į šiaurės vakarus nuo Ilgižių, prie kelio 3520 Ilgižiai–Kupsčiai."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B4%D5%A5%D6%80%D5%AB%D5%AF%D5%B5%D5%A1%D5%B6_%D5%A3%D5%B8%D5%A9%D5%AB%D5%AF%D5%A1_(%D5%B6%D5%AF%D5%A1%D6%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Grant_DeVolson_Wood_-_American_Gothic.jpg","page_title":"Ամերիկյան գոթիկա (նկար)","context_page_description":"«Ամերիկյան գոթիկա», ամերիկացի նկարիչ Գրանտ Վուդի կողմից ստեղծված նկարներից: Այս ստեղծագործությունը Վուդը վրձնել է 1931 թվականին: Նկարը համարվում է 20-րդ դարի ԱՄՆ-ի արվեստի ամենահայտնի ստեղծագործությունը: Այսօր «Ամերիկյան գոթիկա» նկարը պահպանվում և ցուցադրվում է Չիկագոյի արվեստի ինստիտուտում:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B0_%D0%9C%D0%BE%D1%80%D0%B5%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Carl_Linnaeus.jpg","page_title":"Сара Мореа","context_page_description":"Сара Елізабет Мореа — дружина Карла Ліннея, мати Карла Ліннея молодшого."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%BE%D1%80%D0%B0%D0%BD%D0%B4%D0%B8%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Lorandite-Orpiment-sea81b.jpg","page_title":"Лорандит","context_page_description":"Лорандит је један од најважнијих талијумових минерала. Он је талијумов арсеничан сулфат са хемијском формулом TlAsS₂. Откривен је у руднику Алшар у Македонији у близини Кавадарца 1894. године. Име је добио по мађарском физичару са Будимпештеанског универзитета Е. Лоранду."},{"page_url":"https://ca.wikipedia.org/wiki/Scleropogon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Scleropogon_brevifolius_HC-1950.jpg","page_title":"Scleropogon","context_page_description":"Scleropogon és un gènere de plantes de la subfamília de les cloridòidies, família de les poàcies, ordre de les poals, subclasse de les commelínides, classe de les liliòpsides, divisió dels magnoliofitins."},{"page_url":"https://it.wikipedia.org/wiki/Ros%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Parco_delle_Rose_%28Ros%C3%A0%29_%282%29.jpg","page_title":"Rosà","context_page_description":"Rosà è un comune italiano di 14 650 abitanti della provincia di Vicenza in Veneto.\\nIl comune ha 4 frazioni e confina con Bassano del Grappa, Cartigliano, Cassola, Rossano Veneto e Tezze sul Brenta. Il municipio si trova a 96 m sul livello del mare, nel cuore della pianura Veneta.\\nUn parco rurale di rilevanza comunitaria insiste sul territorio comunale, il Parco Civiltà delle Rogge, creato per preservare il nucleo delle numerose rogge che dal parco rurale si diramano, rogge alle quali il comune è molto legato fin dal loro scavo tra il 1360 e il 1370 e che hanno profondamente influenzato la crescita e lo sviluppo dell'agro rosatese."},{"page_url":"https://de.wikipedia.org/wiki/Ey%C3%A2let_Silistra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Castle_ruins_Silistra.jpg","page_title":"Eyâlet Silistra","context_page_description":"Das Eyâlet Silistrien war eine Provinz des Osmanischen Reiches.\\nSie umfasste ein Vierteljahrtausend lang nicht nur den Norden und Osten des heutigen Bulgarien, sondern auch Gebiete vier weiterer Staaten: die rumänische Dobrudscha sowie die ukrainischen Regionen Budschak und Jedisan, d. h. fast die gesamte von osmanischen Türken beherrschte Schwarzmeerküste zwischen Istanbul und dem Krim-Khanat, einschließlich aller Küstenstädte zwischen Warna und Otschakiw.\\nVerwaltungszentrum war Silistra, die wichtigste osmanische Festung an der Donau und eine unter den Osmanen blühende Stadt. Die bulgarischen Städte Silistra, Rustschuk, Schumen und Warna bildeten ein machtvolles Festungsviereck."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D0%BA%D0%BB%D1%8E%D0%B2%D1%8B%D0%B9_%D0%B2%D0%BE%D1%80%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Macrocorax_woodfordi.jpg","page_title":"Белоклювый ворон","context_page_description":"Белоклювый ворон — вид птиц из рода во́ронов, распространённый на Соломоновых островах."},{"page_url":"https://hu.wikipedia.org/wiki/V%C3%A1rosh%C3%A1z_t%C3%A9r_(Miskolc)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/MiskolcMiddleAge.jpg","page_title":"Városház tér (Miskolc)","context_page_description":"A miskolci Városház tér a város közigazgatási központja, itt áll a Városháza és a Megyeháza. A hagyományos értelmezés szerint alig nevezhető igazi térnek, a hajdani Piac utca nyugat felé tölcsérszerűen kiöblösödő, illetve a régi Mészár utca észak felé szűkülő része alkotja. Keletről a Széchenyi utca, nyugatról a Hunyadi utca, délről a Szent István tér, északról a Kis-Hunyad/Palóczy István utca határolja. A tér a második világháború előtt Horthy Miklós nevét viselte, a tanácsi rendszer idején pedig Tanácsház tér volt a neve.\\nMiskolc város történelmi magja a Sötétkapu és a Városház tér között alakult ki, de erről korabeli írásos adatok nem ismertek. Ezért fontosak a régészeti feltárások, amikre azonban a szoros beépítettség miatt alig van lehetőség. 1955-ben a második világháborús sérülései miatt lebontották a cím szerint Rákóczi utca 1. szám alatti, de a Széchenyi utcára néző házat. A telek újbóli beépítése előtt eredményes ásatásokat végeztek a területen: több 11. századból származó ház maradványait tárták fel. Az első, településszerkezettel kapcsolatos írásos emlékek a 14. századtól jelentek meg."},{"page_url":"https://sv.wikipedia.org/wiki/Myrsine_guianensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Flickr_-_Jo%C3%A3o_de_Deus_Medeiros_-_Myrsine_guianensis.jpg","page_title":"Myrsine guianensis","context_page_description":"Myrsine guianensis är en viveväxtart som först beskrevs av Jean Baptiste Christophe Fusée Aublet, och fick sitt nu gällande namn av Carl Ernst Otto Kuntze. Myrsine guianensis ingår i släktet Myrsine och familjen viveväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%B3%D0%B5%D0%BB%D0%BB%D0%BE%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Polonia_Warszawa_vs_Jagiellonia_Bia%C5%82ystok_05-2011_1.jpg","page_title":"Ягеллония","context_page_description":"«Ягеллония» — польский профессиональный футбольный клуб из города Белосток. Основан в 1920 году. Домашние матчи проводит на «Городском стадионе» общей вместимостью 22 386 зрителей. Действующий участник Экстракласса, высшей лиги чемпионата Польши по футболу.\\nКлуб назван в честь легендарного князя Литовского и короля Польши Владислава II Ягайло, основателя династии Ягеллонов."},{"page_url":"https://en.wikipedia.org/wiki/Dave_Sharman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Dave_Sharman_Gig.jpg","page_title":"Dave Sharman","context_page_description":"Dave Sharman is an English guitarist, singer-songwriter, whose primary genre is rock and metal. He is also a multi-instrumentalist and record producer."},{"page_url":"https://la.wikipedia.org/wiki/S%C3%B8r-Varanger","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/NO_2030_S%C3%B8r-Varanger.svg","page_title":"Sør-Varanger","context_page_description":"Sør-Varanger est Norvegiae commune 9925 incolarum in provincia Finnmark. Commune a vicis Kirkenes, Bjørnevatn, Storskog, Grense Jakobselv, Pasviktal, Bugøynes et Neiden constitutum est."},{"page_url":"https://en.wikipedia.org/wiki/Weston,_Toronto","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/L%27arriv%C3%A9e_du_prince_Arthur_%C3%A0_la_c%C3%A9r%C3%A9monie_d%27ouverture_des_travaux_de_construction_du_chemin_de_fer_Toronto%2C_Grey_%26_Bruce%2C_%C3%A0_Weston.jpg","page_title":"Weston, Toronto","context_page_description":"Weston is a neighbourhood and former village in Toronto, Ontario, Canada. The neighbourhood is situated in the northwest of the city, south of Highway 401, east of the Humber River, north of Eglinton Avenue, and west of Jane Street. Weston Road just north of Lawrence Avenue is the commercial core of Weston, with many small businesses and services. Weston was incorporated as a village in the 19th century and was absorbed into the Borough of York in the late 1960s. York itself was amalgamated into Toronto in 1998."},{"page_url":"https://es.wikipedia.org/wiki/Lardero","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Lardero_03.jpg","page_title":"Lardero","context_page_description":"Lardero es un municipio de La Rioja que limita con la capital, Logroño. Ha experimentado un gran crecimiento desde el inicio del siglo xxi al haberse convertido en una ciudad residencial cercana a Logroño y junto a otros municipios compone el Área metropolitana de Logroño. De acuerdo a las cifras oficiales del INE en 2018 superó los diez mil habitantes.\\nHistóricamente, la actividad principal de Lardero ha sido la agricultura No obstante el crecimiento demográfico ha sido muy importante en los últimos diez años, habiendo quedado prácticamente unido a Logroño ya que los autobuses municipales de esta ciudad entran en Lardero."},{"page_url":"https://fr.wikipedia.org/wiki/%C5%92uvres_de_Georges_Braque","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Industrial_Gallery_BMAG.jpg","page_title":"Œuvres de Georges Braque","context_page_description":"Cette liste, forcément incomplète puisqu'il n'existe pas de catalogue raisonné des œuvres de Braque, recense en priorité, parmi les pièces les plus importantes de l'artiste, celles qui sont exposées dans des musées. Ou bien, dans le cas de collections particulières, celles qui sont le plus souvent prêtées et qui apparaissent dans les rétrospectives. Les œuvres de Georges Braque se composent principalement de tableaux, catégorie dans laquelle se trouvent les papiers collés, qui sont des compositions, à ne pas à confondre avec des collages. L'artiste a aussi réalisé des livres d'artistes, des lithographies, des eaux-fortes, des sculptures, des tapisseries et des bijoux.\\nCependant, Braque a été longtemps « mis à l'écart » des historiens d'art qui ont produit peu d'ouvrages sur son œuvre. Comme le fait remarquer Alex Danchev en 2005 :\\n« Les ouvrages de référence sur Braque sont rares ou minces, les articles se réduisent à un point presque comique, notamment celui de l’Oxford Companion to Art, qui tient en quinze lignes."},{"page_url":"https://en.wikipedia.org/wiki/Takatori,_Nara","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Takatori_in_Nara_Prefecture_Ja.svg","page_title":"Takatori, Nara","context_page_description":"Takatori is a town located in Takaichi District, Nara Prefecture, Japan.\\nAs of March 31, 2017, the town has an estimated population of 6,964. The total area is 25.77 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_navires_de_l%27US_Navy_impliqu%C3%A9s_dans_la_bataille_de_Guadalcanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/BagleyDD386.jpg","page_title":"Liste des navires de l'US Navy impliqués dans la bataille de Guadalcanal","context_page_description":"Le plan d'invasion de l'île de Guadalcanal prévoyait pour l'essentiel trois groupes navals majeurs. Deux d'entre eux étaient placés sous le commandement suprême du vice-amiral Frank J. Fletcher. Le premier de ces deux groupes navals, la Task Force NEGAT, commandé par le rear admiral Leigh Noyes était destiné à fournir l'appui aérien pour l'attaque. Cette Task Force se divisait en trois groupes aéronavals, organisés chacun autour d'un porte-avion différent.\\nLe second groupe naval, la Task Force TARE, sous le commandement du rear admiral Richmond K. Turner constituait la force d'assaut amphibie. Cette Task Force se divisait en deux groupes de transport et un groupe d'appui feu chargés de mener l'attaque principale, en transportant et en débarquant la force d'occupation des Marines, et en protégeant les convois de navires de transport de troupe des attaques de surface.\\nLe troisième groupe naval, la Task Force MIKE, sous le commandement du rear admiral John S. McCain était avant tout composé d'unités aériennes basées sur les îles environnantes."},{"page_url":"https://br.wikipedia.org/wiki/Strizh-mor_Palk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Tamil_Nadu_topo_deutsch_mit_Gebirgen.png","page_title":"Strizh-mor Palk","context_page_description":"Strizh-mor Palk zo ur strizh-mor etre Tamil Nadu, en India ha beg hanternoz enez Sri Lanka. Rannañ a ra Pleg-mor Bengal er reter diouzh Bae Palk er mervent, hag a zo dispartiet e-unan diouzh pleg-mor Mannar gant Pont Adam.\\nAnvet eo strizh-mor ha bae Palk evel-se e koun Robert Palk, gouarnour saoz proviñs Madras en XVIIIᵛᵉᵗ kantved."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B0%D8%B1_%D8%B9%D9%84%DB%8C%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Rostov-KS18_%282%29_%28cropped%29.jpg","page_title":"آذر علیف","context_page_description":"آذر علیف بازیکن فوتبال اهل روسیه است.\\nاز باشگاه‌هایی که در آن بازی کرده‌است می‌توان به باشگاه فوتبال ینی‌سئی کراسنویارسک اشاره کرد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AE%D1%8D%D0%BB%D0%BB,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Gaines_Mill%2C_Boatswain_Creek.jpg","page_title":"Юэлл, Ричард","context_page_description":"Ричард Стоддерт Юэлл — кадровый офицер армии США и генерал армии Конфедерации в годы Гражданской войны. Юэлл, бывший выпускником Вест-Пойнта, участвовал в Мексиканской войне, служил в Нью-Мексико и Аризоне, после начала Гражданской войны стал командиром бригады, затем дивизии и прославился во время кампании в долине Шенандоа, где служил под командованием Джексона Каменная Стена. Был ранен в первый день второго сражения при Булл-Ран и вернулся в строй только в мае 1863 года, когда принял командование Вторым корпусом вместо погибшего Джексона. Он сумел разгромить федеральную дивизию при Винчестере, завоевав славу «нового Джексона», но его действия в ходе сражения при Геттисберге вызывали противоречивые оценки; некоторые историки считают нерешительность Юэлла одной из причин неудачи сражения. Юэлл командовал корпусом в неудачных кампаниях осени 1863 года, что снова нанесло урон его репутации. Его успехи в сражении в Глуши остались незамеченными, и после сражения при Спотсильвейни генерал Ли отстранил Юэлла от командования корпусом; Юэлл стал командовать гарнизоном Ричмонда."},{"page_url":"https://cs.wikipedia.org/wiki/Obce_(Ochoz_u_Brna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ochoz_u_Brna%2C_Obce%2C_sokolovna_%282017-04-10%3B_01%29.jpg","page_title":"Obce (Ochoz u Brna)","context_page_description":"Obce jsou vesnice, dnes součást obce Ochoz u Brna. Jádro vsi s návsí se nachází kolmo na silnici II/373 z Brna do Jedovnic."},{"page_url":"https://vi.wikipedia.org/wiki/Cyclopyge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Olafia_roscius.png","page_title":"Cyclopyge","context_page_description":"Cyclopyge là một chi bướm ngày thuộc họ Bướm nâu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BB%D0%B0%D0%BD-%D0%91%D0%B0%D1%82%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%BE%D0%BE%D0%BF%D0%B0%D1%80%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Buddha_in_Ulan_Bator_3.JPG","page_title":"Улан-Баторский зоопарк","context_page_description":"Улан-Баторский зоопарк — зоопарк, в различное время существовавший в Улан-Баторе, столице Монголии. Ныне под этим названием может подразумеваться Улан-Баторский мини-зоопарк, действующий с 2010 года. Зоопарк расположен на территории Международного парка Будды, имеет площадь ~ 200 м², в нём живёт примерно 100 животных 30 видов. Принадлежит компании «Талын Жононгууд». Единственный зоопарк, действующий на территории Монголии."},{"page_url":"https://es.wikipedia.org/wiki/Katerini","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Katerinitownhall.JPG","page_title":"Katerini","context_page_description":"Katerini es una ciudad griega de la periferia de Macedonia Central, es la capital de la unidad periférica de Piería. La ciudad se encuentra en la llanura Piérica y une el Monte Olimpo con el golfo Termaico, a una altitud de 14 m.s.n.m. El municipio es uno de los más recientes de Grecia y cuenta con una población de 83,764 habitantes según el censo de 2001. Se conecta con Salónica y Atenas a través de la Ruta europea E75 y la Vía Egnatia con el norte griego. Varios trayectos de las líneas de tren Intercity la conectan con el resto del país, además de poseer un extenso sistema regional de buses."},{"page_url":"https://sv.wikipedia.org/wiki/Sarawak","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Flag_of_Sarawak.svg","page_title":"Sarawak","context_page_description":"Sarawak är den ena av de två malaysiska delstaterna på ön Borneo. Huvudstaden heter Kuching, och andra stora städer är Miri, Sibu och Bintulu. Befolkningen uppgick till 2 452 800 invånare år 2008, på en yta av 124 450 kvadratkilometer.\\nMellan åren 1841 och 1946 styrdes Kungariket Sarawak av de vita rajorna från Brookefamiljen. Sedan 1981 är Abdul Taib Mahmud Chief Minister på Sarawak."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%DB%8C%D8%B3%DB%8C%D8%B3%DB%8C%D9%BE%DB%8C_%D8%A8%DB%8C%D9%84%DB%8C%D9%85%E2%80%8C%DB%8C%D9%88%D8%B1%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/U.S._Government_Medical_Marijuana_crop._University_of_Mississippi._Oxford.jpg","page_title":"میسیسیپی بیلیم‌یوردو","context_page_description":"| logo =OleMissLogo.svg\\n| logo_size =\\n| logo_alt =\\n}}\\nمیسیسیپی بیلیم‌یوردو آمریکانین آکسفورد، میسیسیپی شهرینده یئرلشن بیر عالی تحصیل موسّسه‌سی. میسیسیپی بیلیم‌یوردو ۱۸۴۸ -جی میلادی ایلده قۇرولوب. عۆمومی و دؤولتی‌ اؤیره‌تیم قۇرومودیر و بودجه‌‌سینی دؤولت و بؤیوک شیرکت‌لر و خالقدان آلدیغی اعانه‌لرله تامین ائدیر."},{"page_url":"https://sw.wikipedia.org/wiki/Maduka_ya_Army_%26_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Westfield%2C_House_of_Fraser.JPG","page_title":"Maduka ya Army & Navy","context_page_description":"Maduka ya Army & Navy ni kundi la maduka ya nguo nchini Uingereza. Duka lao maarufu kabisa lilikuwa katika barabara ya Victoria Street jijini London, Uingereza.\\nHouse of Fraser ilinunua kundi hilo katika mwaka wa 1976. Duka hilo la Victoria Street liliuza bidhaa zake chini ya jina la Army & Navy, hadi mwaka wa 2005, lilipoitwa House of Fraser Victoria. Kila moja ya magorofa manne lina bidhaa mbalimbali kama nguo, mapambo, vipodozi, samani na vyombo vya kutumia umeme. 'Dunia ya Chakula', ukumbi mpya wa chakula katika maduka ya House of Fraser{ulioanzishwa jijini Birmingham katika mwaka wa 2003) ulifunguliwa katika gorofa la chini kabisa.Siku iyo hiyo walibadilisha jina la maduka haya kuwa 'House of Fraser'. Duka hilo linapatikana ndani ya Mji wa Wastminster, kusini mwa St. James' Park, hili ndilo duka la aina lake pekee katikamtaa huo.\\nKampuni ya Iceland, Baugur, ilinunua House of Fraser mwishoni mwa mwaka wa 2006."},{"page_url":"https://eu.wikipedia.org/wiki/Amenia_(Ipar_Dakota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Amenia%2C_North_Dakota.jpg","page_title":"Amenia (Ipar Dakota)","context_page_description":"Amenia Ipar Dakotako hiri bat da. Cass konderrian kokatua dago. 2010ean 94 biztanle zituen, 3,70 kilometro koadrotan banatuta."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%DA%A9%D8%A7%D8%B1%D9%88%D9%84%DB%8C%D9%86%D8%A7%DB%8C_%D8%B4%D9%85%D8%A7%D9%84%DB%8C_(%DB%B1%DB%B8%DB%B2%DB%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/1820USS_NorthCarolina.jpg","page_title":"یواس‌اس کارولینای شمالی (۱۸۲۰)","context_page_description":"یواس‌اس کارولینای شمالی (۱۸۲۰) یک کشتی بود که طول آن ۱۹۶ فوت بود. این کشتی در سال ۱۸۲۰ ساخته شد."},{"page_url":"https://fi.wikipedia.org/wiki/Anarkismi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Anarchy-symbol.svg","page_title":"Anarkismi","context_page_description":"Anarkismi on taloudellisista, yhteiskunnallisista ja sosiaalisista valtahierarkioista vapaata yhteiskuntaa tavoitteleva poliittinen ideologia, joka korostaa yksilönvapautta. Anarkismin klassisen määritelmän mukaan se on ajattelutapa, jossa vastustetaan valtiota, siihen sisältyvän pakkovallan, poliittisen auktoriteetin sekä valtakoneiston muodollis-oikeudellisuuden ja byrokraattisuuden vuoksi. Anarkismi sekoitetaan tai yhdistetään usein virheellisesti anarkiaan.\\nSana ”anarkismi” tulee muinaiskreikan johtajattomuutta tai esivallan puutetta tarkoittavasta sanasta, joka keskiajalla käännettiin latinaksi muodossa anarchia. Joskus anarkismi suomennetaan hallituksettomuudeksi. Poliittisesta filosofiasta puhuttaessa anarkismi ei tarkoita yhteiskunnallista kaaosta, vaikka käsitteellä anarkia on arkikielessä sellainen sisältö. John Zerzan on määritellyt anarkismin autoritarismin vastaisuudeksi.\\nAnarkismi on keskeisesti antistatistinen ideologia, mutta valtiovastaisuuden lisäksi anarkismiin kuuluu hierarkkisesti organisoidun teollisuustuotannon kritiikkiä. Sekä anarkismi että sosialismi kehittyivät teollisen vallankumouksen seurauksena ja vastasivat sen ajan yhteiskunnan ongelmiin."},{"page_url":"https://fr.wikipedia.org/wiki/Grotte_Duruthy","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Lame_MHNT_PRE_2009.0.211.2.fond.jpg","page_title":"Grotte Duruthy","context_page_description":"La grotte Duruthy est un gisement préhistorique situé dans la commune de Sorde-l'Abbaye, dans le département français des Landes. Le gisement fait l’objet d’un classement au titre des monuments historiques depuis le 13 avril 1962."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%B3%E3%82%B2%E3%83%B3%E3%83%86%E3%83%B3%E3%83%88%E3%82%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Spined_soldier_bug.jpg","page_title":"インゲンテントウ","context_page_description":"インゲンテントウは、コウチュウ目テントウムシ科に分類される昆虫の一種。日本にはもともと分布していない外来種。"},{"page_url":"https://it.wikipedia.org/wiki/Storia_degli_ebrei_in_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Recensement_des_Juifs.JPG","page_title":"Storia degli ebrei in Francia","context_page_description":"La storia degli ebrei in Francia - corrispondente al territorio attualmente occupato - sembra risalire al I secolo dell'era volgare, per poi proseguire fino ai giorni nostri, facendo in tal modo della presenza comunitaria ebraica francese una delle più antiche nell'intera Europa occidentale.\\nGiunti nel territorio della Gallia, poco dopo la Conquista della Gallia ad opera degli eserciti di Giulio Cesare, gli ebrei vi rimasero sotto la dinastia dei Merovingi prima e dei Carolingi poi, conoscendo un periodo di relativa prosperità. Nel corso dell'XI secolo la Francia medievale divenne un centro fiorente di apprendimento della cultura ebraica: era abitata a settentrione dalle comunità degli Aschenaziti - ove fiorì nella Champagne la scuola di Rashi e dei suoi continuatori Tosafisti - mentre in meridione trovò un notevole sviluppo la storia degli ebrei in Provenza e Linguadoca.\\nLa situazione cominciò a deteriorarsi fortemente con l'avvio della Prima crociata, per poi proseguire con i processi pubblici intentati contro il Talmud e le espulsioni, inizialmente temporanee ed in seguito definitive."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%83%91%E6%B4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Zheng-jie.jpg","page_title":"郑洁","context_page_description":"鄭潔，出生於四川成都，祖籍浙江寧波，中國女子職業網球運動員。2004年初出茅廬的鄭潔在當年的法國網球公開賽進入女子單打十六強，成為第一位進入網球大滿貫賽事第四輪的中國選手。2006年在澳洲網球公開賽和溫布爾頓網球公開賽中與搭檔晏紫合作拿下兩項賽事的雙打冠軍，並進入WTA年終總決賽女子雙打四強，刷新中國網球歷史，2008年手持外卡參加溫布爾頓女子單打比賽的鄭潔，一路爆冷，擊敗了包括時為世界第一伊凡諾維琪，首次進入大滿貫女子單打四強。北京奧林匹克運動會上協同晏紫奪得女子雙打季軍。2010年澳洲網球公開賽，與李娜聯手再度進入女子單打四強，創造了中國網球輝煌。2015年，已經年過三十的鄭潔再度打進澳洲網球公開賽女子雙打決賽，以三十二歲的網壇高齡捧得大滿貫亞軍。在職業生涯中，鄭潔拿下了四座WTA女子單打冠軍以及十五座WTA女子雙打冠軍，包括兩座大滿貫雙打冠軍及一座大滿貫雙打亞軍。職業生涯中二十九次打入WTA女子雙打賽事決賽，兩次打入大滿貫賽事女單四強，三次打入大滿貫女雙決賽，單打最高排名十五位，雙打最高排名第三位。在中國大陸的網球愛好者及網友中，鄭潔素有「網球天后」之稱。"},{"page_url":"https://lt.wikipedia.org/wiki/Riobamba","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Catedral_Riobamba.jpg","page_title":"Riobamba","context_page_description":"Riobamba – miestas centriniame Ekvadore, Čambo upės slėnyje, ~200 km į pietus nuo Kito, 2700 m aukštyje virš jūros lygio. Čimboraso provincijos centras. Žemdirbystės regiono centras. Maisto, tekstilės, keramikos, statybinių medžiagų pramonė. Yra Čimboraso nacionalinis universitetas."},{"page_url":"https://af.wikipedia.org/wiki/Nazi-Duitsland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Greater_Germanic_Reich.png","page_title":"Nazi-Duitsland","context_page_description":"Nazi-Duitsland of die Derde Ryk verwys gewoonlik na Duitsland in die jare tussen 1933 en 1945, toe dit onder die beheer was van Adolf Hitler se diktatorskap en die ideologie van Nasionaalsosialisme.\\nDie term Nazi is 'n kort vorm van die Duitse Nationalsozialismus; die ideologie was ingestel in die NSDAP, die Nasionaal-Sosialistiese Duitse Arbeidersparty, of Nazi-party in kort.\\nDie Derde Ryk is 'n verafrikaansing van die Duitse uitdrukking \\"Drittes Reich\\", en word gebruik as 'n sinoniem vir Nazi-Duitsland. Die term is in gebruik geneem deur Nazi-propaganda, wat die Heilige Romeinse Ryk as die eerste Reich beskou het, 1871 se Duitse Keiserryk as die tweede, en hulle eie bewind as die derde. Dit is gedoen met die doel om 'n terugkeer te suggereer na die voormalige Duitse glorie na die beweerde mislukking van die 1919 Republiek van Weimar.\\nDie Derde Ryk is soms ook die \\"Duisendjarige Ryk\\" genoem, soos beplan deur sy stigter, Adolf Hitler, om te bestaan vir 'n duisend jaar."},{"page_url":"https://vi.wikipedia.org/wiki/Actias_sinensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Actias_sinensis_adult_male_sjh.jpg","page_title":"Actias sinensis","context_page_description":"Actias sinensis là một loài bướm đêm trong chi Actias thuộc họ Saturniidae. Loài bướm đêm này sinh sống ở Trung Quốc, Đài Loan, Việt Nam, Myanmar, Ấn Độ và Thái Lan."},{"page_url":"https://en.wikipedia.org/wiki/2010%E2%80%932013_Southern_United_States_and_Mexico_drought","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Usdm-early-2012.png","page_title":"2010–2013 Southern United States and Mexico drought","context_page_description":"The 2010–2013 Southern United States and Mexico drought was a severe to extreme drought that plagued the Southern United States, including parts of Texas, Louisiana, Arkansas, Mississippi, Alabama, Georgia, South Carolina, North Carolina, and Oklahoma; the Southwestern States, including Kansas, Colorado, New Mexico, and Arizona; as well as large parts of Mexico, in a three-year pattern from 2010 to 2013.\\nThe worst effects were in Texas, which experienced the brunt of the drought and its driest August–July period on record from 2010-11. The dry spell in May 2011 was also said to be the worst period of drought in Texas since 1895. The U.S. Drought Monitor reported that Lubbock, Texas has experienced the nation's worst average level of drought since the beginning of 2011. McAllen, Harlingen, Brownsville and Corpus Christi also ranked among the nine U.S. cities most affected by extreme drought. The drought in Texas caused an estimated $7.62 billion in crop and livestock losses, surpassing the previous record loss of $4.1 billion set in 2006."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B7%D0%B8%D0%BB%D1%8C,_%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Bazille%2C_Fr%C3%A9d%C3%A9ric%2C_album_Manet%2C_BNF_Gallica.jpg","page_title":"Базиль, Фредерик","context_page_description":"Жан Фредерик Базиль, более известный как Фредерик Базиль — французский живописец, один из основателей импрессионизма."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A1%94%E7%88%BE%E5%B0%BC%E8%8C%A8%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Tarnitzverlauf.jpg","page_title":"塔爾尼茨河","context_page_description":"塔尔尼茨河，是德国的河流，位于该国东北部，由梅克伦堡-前波美拉尼亚州负责管辖，属于勒克尼茨河的支流，河口处在卡尔施塔特附近。"},{"page_url":"https://eu.wikipedia.org/wiki/Santiago_de_Compostelako_geltokia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/318008_RENFE_1808_-_ACAF_Santiago_de_Compostela_-_2012-02-12_-_Contando_Estrelas.jpg","page_title":"Santiago de Compostelako geltokia","context_page_description":"Santiago de Compostela Santiago de Compostela hirian kokatzen den tren geltoki nagusia da. 1873ko irailaren 15an inauguratu zen, eta Adif enpresa publikoaren jabetzakoa da, Renfe Operadora eragileak ustiatzen duelarik. 2011n distantzia erdiko 1.761.067 bidaiari jaso zituen geltokiak, Galiziako bidaiari trafiko handiena duen geltokia bilaku zelarik."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A8%D1%82%D1%80%D0%B0%D1%98%D0%BA_%D1%80%D1%83%D0%B4%D0%B0%D1%80%D0%B0_%D0%BA%D0%BE%D1%98%D0%B8_%D1%81%D1%83_%D1%80%D0%B0%D0%B4%D0%B8%D0%BB%D0%B8_%D1%83_%D1%80%D1%83%D0%B4%D0%BD%D0%B8%D1%86%D0%B8%D0%BC%D0%B0_%D1%83%D0%B3%D1%99%D0%B0_(1902._%D0%B3%D0%BE%D0%B4%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Coal_strike_a_historic_moment_Harpers_Weekly_Anthracite_Strike_1902_Roosevelt_and_Morgan_making_deal.jpg","page_title":"Штрајк рудара који су радили у рудницима угља (1902. година)","context_page_description":"Штрајк рудара који су радили у рудницима угља је био штрајк Сједињених Америчких рудара на антрацитним пољима угља источне Пенсилваније. Рудари су се борили за веће плате, краће радне дане и признање свог синдиката. Њихов штрајк је претио прекидом снабдевања угљом зими у већим америчким градовима. У то време, резиденције су обично грејане антрацитом или „тврдим“ угљом, који производи већу вредност топлоте и мање дима од „меког“ или каменог угља.\\nРудари су примили повећање плата од 10% и смањили радне дане са десет на девет сати; власници су добили вишу цену угља и нису препознали синдикат рудара као преговарачки агент. То је први радни спор у који је америчка савезна влада интервенисала као неутралан арбитар."},{"page_url":"https://en.wikipedia.org/wiki/Braystones","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Braystones_-_geograph.org.uk_-_55346.jpg","page_title":"Braystones","context_page_description":"Braystones is a village in Cumbria, England, historically within Cumberland. It is located on the Irish Sea coast, on edge of the Lake District National Park, around 38.6 miles north of Barrow-in-Furness, 9.9 miles south of Whitehaven and 50.8 miles south west of Carlisle.\\nTraditionally a scattered community based on agriculture, it has grown considerably during the 20th century by firstly, the construction of holiday cabins on the beach, and latterly by the creation of large caravan parks. It has long been a popular holiday area."},{"page_url":"https://pt.wikipedia.org/wiki/Criacionismo_da_Terra_Jovem","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Magnetosphere_rendition.jpg","page_title":"Criacionismo da Terra Jovem","context_page_description":"Criacionismo ou Teoria da Terra Jovem é a crença religiosa de que o Universo, a Terra e toda a vida terrestre foram criados por atos diretos do Deus Abraâmico durante um período relativamente curto de tempo, em algum momento entre 5.700 e 10.000 anos atrás, mas não um consenso, pois há também os teóricos intervencionistas. Seus adeptos principais são cristãos e judeus que acreditam que Deus criou a Terra em seis dias de 24 horas, utilizando-se de uma interpretação literal da narrativa da criação baseada no livro do Gênesis.\\nO consenso científico, apoiado por uma declaração de 2006 feita por 68 academias científicas nacionais e internacionais, é o de que o universo existe há cerca de 13,8 bilhões de anos e de que a Terra foi formada cerca de 4,5 bilhões de anos atrás, com a primeira aparição de vida há cerca de 2,5 bilhões de anos, conforme evidências derivadas de observações e experiências de várias disciplinas científicas."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D0%B3%D0%BE%D0%B4%D0%BE%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Dragodol_-_op%C5%A1tina_Ose%C4%8Dina_-_zapadna_Srbija_-_panorama_14.jpg","page_title":"Драгодол","context_page_description":"Драгодол је насеље у Србији у општини Осечина у Колубарском округу. Према попису из 2011. било је 503 становника."},{"page_url":"https://fi.wikipedia.org/wiki/CT2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Rabbit_CT2_Phone_PICT7368a.jpg","page_title":"CT2","context_page_description":"CT2 on langattomien puhelimien standardi, joka oli käytössä 1990-luvun alkuvuosina. Suomessa järjestelmää markkinoitiin nimellä Pointer. Verkon asiakkailla oli CT2-standardin mukainen taskupuhelin, joilla pystyi ottamaan puheluita järjestelmän tukiasemien läheisyydessä.\\nCT2 oli käytössä useissa maissa kuten Britanniassa, Ranskassa ja Suomessa. Britanniassa avattiin Ferranti Phonezone -järjestelmä vuonna 1989. Huomattavasti laajempi Rabbit-verkko oli käytössä vuosina 1992–1993. Ranskassa ollut Bipop-verkko oli käytössä vuosina 1991–1995. Euroopan ulkopuolella järjestelmä oli laajasti käytössä Hongkongissa kolmen operaattorin verkossa kunnes niiden toimilupa päättyi vuonna 1996.\\nJärjestelmän etuina oli muita matkapuhelinverkkoja edullisemmat puheluhinnat ja mahdollisuus käyttää samaa puhelinta kotona langattomasti. Toisaalta sillä pystyi ainoastaan soittamaan, ei vastaanottamaan puheluita. Lankapuhelinliittymään liitetyn kotitukiaseman kautta myös puhelujen vastaanotto oli mahdollista, tämän käyttökelpoisuutta rajoitti kuitenkin 100 metrin toimintasäde."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_visits_to_the_United_States:_Asia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Chun_Doo-hwan_and_Lee_SoonJa.jpg","page_title":"List of diplomatic visits to the United States: Asia","context_page_description":"International trips made by the heads of state and heads of government to the United States have become a valuable part of American diplomacy and international relations since such trips were first made in the mid-19th century. They are complicated undertakings that often require months of planning along with a great deal of coordination and communication.\\nThe first international visit to the United States was made by King Kalakaua of Hawaii in 1874, which was the first visit by a foreign chief of state or head of government.\\nThe first Asian head of state to visit the United States was King Prajadhipok of Siam in 1931."},{"page_url":"https://pl.wikipedia.org/wiki/Karty","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Dziesi%C4%85tka_Pik_z_Wzoru_Berli%C5%84skiego.png","page_title":"Karty","context_page_description":"Karty do gry – papierowe lub plastikowe przybory do gier karcianych.\\nPrawdopodobnie były już znane w Chinach przed X wiekiem. Powstały na skutek przeniesienia na papier notacji używanej w czasie gry w kości;\\nniektóre karty wywodzą się także z chińskich papierowych pieniędzy – uważa się, że w najstarszych grach używano prawdziwych banknotów.\\nDo Europy karty trafiły około XIV w. i zostały spopularyzowane po rozpowszechnieniu się druku wynalezionego przez Johannesa Gutenberga. Już w 1329 roku, za papieża Jana XXII, synod w Würzburgu wydał zakaz uprawiania hazardu, w tym gry w karty, w kości, szachy i w kule.\\nWykonuje się je z kilku warstw papieru, od trzydziestu lat powlekanego cienką warstwą plastiku. Wykonuje się także karty o mniejszych wymiarach, wygodne przy stawianiu pasjansów, oraz większe, lepiej widoczne na scenie w czasie pokazów. Dziś standardowe wymiary karty wynoszą 88 × 57 mm."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A1%83%E5%B1%B1%E4%B8%98%E9%99%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Fushimi_momoyaja_jyou_13.jpg","page_title":"桃山丘陵","context_page_description":"桃山丘陵は、京都市伏見区の中央、宇治川の北側に位置する標高約100mの丘陵。"},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nig-Friedrich-August-Turm","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/L%C3%B6bberg1.jpg","page_title":"König-Friedrich-August-Turm","context_page_description":"Der König-Friedrich-August-Turm auf dem Löbauer Berg im sächsischen Löbau, benannt nach Friedrich August dem Zweiten, ist der einzige noch erhaltene gusseiserne Aussichtsturm in Europa und wahrscheinlich der älteste gusseiserne Turm überhaupt.\\nEr wurde 1854 aus Gusseisen auf einem steinernen Sockel errichtet, weist eine Höhe von 28 Metern und einen Durchmesser von vier Metern auf, hat eine achteckige Form und enthält drei außenliegende Galerien in 12, 18 und 24 Meter Höhe. Die innenliegende Wendeltreppe hat 120 Stufen. Auf der obersten Galerie beziehungsweise Aussichtsplattform befindet man sich insgesamt in einer Höhe von etwa 25 Metern über dem umgebenden Terrain. Vom Turm aus kann man bis zum Zittauer Gebirge und über weite Teile der Landschaft der Oberlausitz blicken.\\nDer nach dem sächsischen König Friedrich August II. benannte Turm steht mittlerweile als technisches Denkmal unter Denkmalschutz und ist ein beliebtes, weithin bekanntes Ausflugsziel."},{"page_url":"https://en.wikipedia.org/wiki/Audi_A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/DTM_Audi_A4_Scheider09_amk.jpg","page_title":"Audi A4","context_page_description":"The Audi A4 is a line of compact executive cars produced since 1994 by the German car manufacturer Audi, a subsidiary of the Volkswagen Group.\\nThe A4 has been built in five generations and is based on the Volkswagen Group B platform. The first generation A4 succeeded the Audi 80. The automaker's internal numbering treats the A4 as a continuation of the Audi 80 lineage, with the initial A4 designated as the B5-series, followed by the B6, B7, B8, and the B9. The B8 and B9 versions of the A4 are built on the Volkswagen Group MLB platform shared with many other Audi models and potentially one Porsche model within Volkswagen Group.\\nThe Audi A4 automobile layout consists of a front-engine design, with transaxle-type transmissions mounted at the rear of the engine. The cars are front-wheel drive, or on some models, \\"quattro\\" all-wheel drive.\\nThe A4 is available as a sedan and station wagon. The second and third generations of the A4 also had a convertible version, but the B8 version of the convertible became a variant of the Audi A5 instead of as Audi got back into the compact executive coupé segment."},{"page_url":"https://cs.wikipedia.org/wiki/Kaple_Matky_Bo%C5%BE%C3%AD_(Mikul%C3%A1%C5%A1ovice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Kaple_Matky_Bo%C5%BE%C3%AD_Mikul%C3%A1%C5%A1ovice_%282015%29.jpg","page_title":"Kaple Matky Boží (Mikulášovice)","context_page_description":"Kaple Matky Boží stojí v horním cípu Mikulášovic poblíž pramene Mikulášovického potoka. První dřevěná kaple z roku 1803 byla později nahrazena zděnou. Ta zanikla v 2. polovině 20. století a znovu vystavěna byla roku 2015."},{"page_url":"https://ca.wikipedia.org/wiki/Albo%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Nuremberg_chronicles_f_147v_1.jpg","page_title":"Alboí","context_page_description":"Alboí va ser rei dels longobards des del 563, aproximadament, fins al 572, succeint al seu pare Alduí.\\nEncara príncep havia destacat en una victòria contra els gèpides del rei Torisind, matant en combat singular a cavall el príncep Torismod, successor designat del rei Torisind. Després d'entrar al servei de l'Imperi Romà d'Orient, es va aliar amb els àvars del kaghan Bayan per anar contra els gèpides que vencé el 567 i amb aquesta derrota va acabar amb el domini gèpida sobre el Danubi. Així mateix va matar el seu vell rei Cunimon i es va casar per la força amb la filla d'aquest, la princesa Rosamunda. Alboí s'havia casat anteriorment amb Clotsinda, una princesa merovíngia, filla de Clotari I, rei dels francs, amb la que tenia una filla de nom Albsuinda.\\nA començament de l'any 568, potser perquè desconfiava dels àvars, potser perquè sabia de la debilitat del domini romà d'Orient a Itàlia després de la guerra amb els gots, va decidir dirigir el seu poble cap al nord d'Itàlia, acompanyat d'altres tribus, entre les quals hi havia els gèpides, saxons i àvars. Va signar un acord amb el kaghan àvar Bayan pel qual li cedia la Pannònia i Nòrica però amb dret a retornar durant dos segles."},{"page_url":"https://it.wikipedia.org/wiki/Tecnam_P92","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Tecnam_p92_2_-_2.jpg","page_title":"Tecnam P92","context_page_description":"Il Tecnam P92 Echo Super è un aereo biposto di fabbricazione italiana, prodotto dalla Tecnam di Capua e commercializzato in numerosi paesi del mondo. Si tratta di un aereo monomotore con ala alta a pianta rettangolare, con carrello fisso triciclo e ruotino anteriore sterzante. In Italia rientra nella categoria degli ultraleggeri."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D0%BD%D0%B0_%D1%84%D0%BE%D0%BD_%D0%91%D1%80%D0%B0%D0%BD%D0%B4%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3_(1487%E2%80%931514)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Bordesholm_Klosterkirche_01.jpg","page_title":"Анна фон Бранденбург (1487–1514)","context_page_description":"Анна фон Бранденбург от род Хоенцолерн е принцеса от Бранденбург и чрез женитба от 1502 до 1514 г. херцогиня на Шлезвиг и Холщайн.\\nТя е най-възрастната дъщеря на курфюрст Йохан Цицерон от Бранденбург и съпругата му Маргарета Саксонска, дъщеря на херцог Вилхелм III от Саксония и Анна Австрийска.\\nАнна се омъжва на 10 април 1502 г. в Щендал за шестнадесет години по-големия Фридрих I фон Шлезвиг-Холщай, херцог на Шлезвиг и Холщайн, от 1523 г. крал на Дания и Норвегия. Той е четвъртият син на крал Кристиан I и Доротея фон Бранденбур. Тя е първата му съпруга. На същия ден нейният брат Йоахим I се жени за Елизабет Датска, дъщеря на крал Йохан Датски.\\nТе резидират в дворец Готторп, където той започва връзка с дъщеря на селянин. Анна го придружава при пътуванията му и е обичана в страната. Тя се разболява на 22 години от туберкулоза и умира, бременна в 28-а седмица, на 26 години на 3 май 1514 г. и е погребана в манастирската църква Бордесхолм."},{"page_url":"https://de.wikipedia.org/wiki/8,4-cm-Feldgesch%C3%BCtz_Ord_1879","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/ForteAirolo06.JPG","page_title":"8,4-cm-Feldgeschütz Ord 1879","context_page_description":"Das 8,4-cm-Feldgeschütz Ord 1879 ersetzte das 8,4-cm-Feldgeschütz Ord 1871/74. Während dieses noch ein Bronzerohr hatte, war das Rohr aus Stahl. Das Rohr wurde in Deutschland von der Krupp-Gussstahlfabrik in Essen hergestellt. Die Lafette wurde bei der Eidg. Konstruktionswerkstätte in Thun gefertigt.\\nDie Waffe war die letzte in der Schweizer Armee verwendete Feldkanone ohne Rohrrücklauf. Abgelöst wurde sie von der auch von Krupp gefertigten 7,5-cm-Kanone 1903 L 30. Die Rohre der Waffe wurden noch bis gegen Ende des Zweiten Weltkrieges in Festungen eingesetzt."},{"page_url":"https://eu.wikipedia.org/wiki/Lichtenau_(Bavaria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Lichtenau_%28Mfr%29_Dreieinigkeitskirche_2.jpg","page_title":"Lichtenau (Bavaria)","context_page_description":"Lichtenau Alemaniako udalerria da. Bavariako estatuan kokatuta dago, Ansbach barrutian. 2014an 3.732 biztanle zituen 41,36 kilometro koadrotan banatuta."},{"page_url":"https://vi.wikipedia.org/wiki/Robertsdale,_Alabama","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Rdale_welcomesign2.jpg","page_title":"Robertsdale, Alabama","context_page_description":"Robertsdale là một thành phố thuộc quận Baldwin, tiểu bang Alabama, Hoa Kỳ. Dân số năm 2009 là 5120 người, mật độ đạt 363 người/km²."},{"page_url":"https://en.wikipedia.org/wiki/Arginine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Arginine_biosynthesis_pathway.png","page_title":"Arginine","context_page_description":"Arginine, also known as l-arginine, is an α-amino acid that is used in the biosynthesis of proteins. It contains an α-amino group, an α-carboxylic acid group, and a side chain consisting of a 3-carbon aliphatic straight chain ending in a guanidino group. At physiological pH, the carboxylic acid is deprotonated, the amino group is protonated, and the guanidino group is also protonated to give the guanidinium form, making arginine a charged, aliphatic amino acid. It is the precursor for the biosynthesis of nitric oxide. It is encoded by the codons CGU, CGC, CGA, CGG, AGA, and AGG.\\nArginine is classified as a semiessential or conditionally essential amino acid, depending on the developmental stage and health status of the individual. Preterm infants are unable to synthesize or create arginine internally, making the amino acid nutritionally essential for them. Most healthy people do not need to supplement with arginine because it is a component of all protein-containing foods and can be synthesized in the body from glutamine via citrulline."},{"page_url":"https://no.wikipedia.org/wiki/Willy_Fritsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Willy_Fritsch.jpg","page_title":"Willy Fritsch","context_page_description":"Willy Fritsch var en tysk skuespiller. Han medvirket i over 120 filmer."},{"page_url":"https://no.wikipedia.org/wiki/Mokka","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Mocha1692.jpg","page_title":"Mokka","context_page_description":"Mokka er en havneby på rødehavskysten til Jemen. Inntil det 1800-tallet var den hovedhavnen til Sana som er den politiske hovedstaden i Jemen. På 1800-tallet overtok byene Aden og Hodeida som havnebyer på Mokkas bekostning.\\nDet er sannsynlig at Mokka er identisk med antikkens havn Muza, kjent for sin røkelseshandel.\\nMokka er berømt for at byen var hovedmarkedsplass for kaffe fra 1400-tallet til 1600-tallet, skjønt eksporten av kaffe startet lenge før, fra tiden da handelstrafikken fra røkelseveien ebbet ut. Ifølge den portugisiske jesuittpresten Jeronimo Lobo, som reiste langs Rødehavet i 1625, fikk byen sin sentrale betydning etter at området kom inn under tyrkernes herrevelde. Lobo forteller at tyrkerne krevde at alle skip på vei inn i Rødehavet måtte ta inn til Mokka for å betale toll på sine varer der.\\nDet skal ha vært en annen jesuitt, spanjolen Pedro Páez, som i 1595 var den første til å smake på og beskrive den kaffen som kunne kjøpes i Mokka."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EC%BF%A0%EC%95%84%ED%94%8C%EB%9D%BC%EB%84%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Yeosu_aqua_planet_inner.jpg","page_title":"아쿠아플라넷","context_page_description":"아쿠아플라넷은 한화그룹 산하 한화호텔앤드리조트에서 운영하는 대한민국의 수족관이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%AA%E3%83%94%E3%83%A3%E3%83%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Chornobyl_DSC_0226_05.JPG","page_title":"プリピャチ","context_page_description":"プリピャチは、ウクライナの北部にある市である。1986年に起きたチェルノブイリ原子力発電所事故によって住民が避難したため現在は無人となっている。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Cugy_FR","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Saint-Martin_Cugy_May_2011.jpg","page_title":"Liste der Kulturgüter in Cugy FR","context_page_description":"Die Liste der Kulturgüter in Cugy FR enthält alle Objekte in der Gemeinde Cugy im Kanton Freiburg, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://en.wikipedia.org/wiki/Capitoline_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Campidoglio_%28Palacio_Senatorio%29_September_2015-1.jpg","page_title":"Capitoline Hill","context_page_description":"The Capitolium or Capitoline Hill, between the Forum and the Campus Martius, is one of the Seven Hills of Rome.\\nThe hill was earlier known as Mons Saturnius, dedicated to the god Saturn. The word Capitolium first meant the temple of Jupiter Optimus Maximus later built here, and afterwards it was used for the whole hill, thus Mons Capitolinus. In an etiological myth, ancient sources connect the name to caput and the tale was that, when laying the foundations for the temple, the head of a man was found, some sources even saying it was the head of some Tolus or Olus. The Capitolium was regarded by the Romans as indestructible, and was adopted as a symbol of eternity.\\nBy the 16th century, Capitolinus had become Capitolino in Italian, and Capitolium Campidoglio. The Capitoline Hill contains few ancient ground-level ruins, as they are almost entirely covered up by Medieval and Renaissance palazzi that surround a piazza, a significant urban plan designed by Michelangelo.\\nThe word Capitolium still lives in the English word capitol, and Capitol Hill in Washington, D.C. is widely assumed to be named after the Capitoline Hill."},{"page_url":"https://sl.wikipedia.org/wiki/Bo%C5%BEi%C4%8Dek","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/St_Nicholas_Icon_Sinai_13th_century.jpg","page_title":"Božiček","context_page_description":"Božiček je novodobna mitološka osebnost, ki obdaruje otroke na sveti večer ali pa na božično jutro.\\nModerni božiček je sicer nastal Združenih državah Amerike na katerega so kot skupek različnih kultur in tradicij na njegovo podobo in lik odločilno vplivali: Nikolaj iz Mire, zgodnje krščanski škof iz antične Grčije ali današnje Turčije, britanski lik Father Christmas iz 17. stoletja in nizozemska figura Sinterklaas s podobo iz knjige Jana Schenkmana \\"Sv. Nikolaj in njegov služabnik\\", ki prav tako izvira iz sv. Nikolaja."},{"page_url":"https://de.wikipedia.org/wiki/Vasabron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Vasabron_September_2006.jpg","page_title":"Vasabron","context_page_description":"Vasabron ist eine Brücke über den Norrström im Zentrum von Stockholm, Schweden. Sie verbindet Norrmalm mit der Altstadt von Stockholm. Die Brücke wurde nach König Gustav Vasa benannt."},{"page_url":"https://cs.wikipedia.org/wiki/Sofiane_Hanni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Rostov-Anderleht_%288%29_%E2%80%94_%D0%BA%D0%BE%D0%BF%D0%B8%D1%8F.jpg","page_title":"Sofiane Hanni","context_page_description":"Sofiane Hanni je francouzsko-alžírský fotbalový záložník a reprezentant Alžírska, který působí od roku 2016 v klubu RSC Anderlecht.\\nNa klubové úrovni působil ve Francii, Turecku a Belgii."},{"page_url":"https://de.wikipedia.org/wiki/Kreis_Bergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Kreis_Bergen.PNG","page_title":"Kreis Bergen","context_page_description":"Der Kreis Bergen war von 1952 bis 1955 ein Landkreis auf der Insel Rügen im Bezirk Rostock der DDR."},{"page_url":"https://en.wikipedia.org/wiki/Trigonidium_obtusum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Trigonidium_obtusum_-_Edwards_vol_23_pl_1923_%281837%29.jpg","page_title":"Trigonidium obtusum","context_page_description":"Trigonidium obtusum, the blue-leaved trigonidium, is an orchid found in Brazil that flowers in the summer."},{"page_url":"https://hu.wikipedia.org/wiki/Becklespinax","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Becklespinax.jpg","page_title":"Becklespinax","context_page_description":"A Becklespinax a nagy méretű theropoda dinoszauruszok egyik neme, amely három, magas tövisnyúlványú csigolya alapján ismert, amiket Samuel H. Beckles fedezett fel 1884-ben, az angliai Sussexben. A kormeghatározás szerint a fosszíliák a kora kréta időszakból származnak. A Becklespinax hossza 8 méter, a tömege pedig 1,5 tonna lehetett."},{"page_url":"https://sv.wikipedia.org/wiki/Johann_Leusden","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Johannes_Leusden_-_Philologus_Hebreus.jpg","page_title":"Johann Leusden","context_page_description":"Johann Leusden, född 26 april 1624 i Utrecht, död där 30 september 1699, var en nederländsk orientalist och teolog.\\nLeusden blev 1651 ordinarie professor vid universitetet i Utrecht och kom att utöva stort inflytande på sin samtids vetenskapliga forskning, ej minst på den svenska; bland de många svenskar, som kom i kontakt med Leusden, kan nämnas Samuel Pontin, son till biskop Magnus Johannis Pontin och professorn, sedermera biskopen Laurentius Norrmannus, vidare Erik Benzelius den yngre och Casten Rönnows son Magnus. Leusdens förnämsta arbete är Biblia hebraica."},{"page_url":"https://es.wikipedia.org/wiki/Mario_Silva_Ossa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Lautaro%2C_joven_libertador_de_Arauco.jpg","page_title":"Mario Silva Ossa","context_page_description":"Mario Silva Ossa, más conocido por el seudónimo Coré, fue un dibujante e ilustrador chileno."},{"page_url":"https://es.wikipedia.org/wiki/Banderas_brit%C3%A1nicas_de_las_Invasiones_Inglesas_conservadas_por_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Royal_Marines_Battalion_Colours.svg","page_title":"Banderas británicas de las Invasiones Inglesas conservadas por Argentina","context_page_description":"Durante las frustradas Invasiones Inglesas al Virreinato del Río de la Plata los españoles capturaron seis banderas y un guion o banderín a los británicos, los que se continúan en poder de Argentina hasta la actualidad.\\nEl 27 de junio de 1806, durante la Primera Invasión Inglesa, las tropas del Reino Unido al mando del general William Beresford atacaron y conquistaron Buenos Aires, la capital virreinal. El capitán de navío Santiago de Liniers al frente de tropas alistadas en Montevideo y voluntarios locales recuperó la ciudad para la monarquía española el 12 de agosto de 1806. Ese día los soldados del virreinato capturaron cuatro banderas de las tropas británicas y un guion o banderín. Mantenidos en carácter de trofeos de guerra hasta la actualidad, las cuatro banderas se conservan en el Convento de Santo Domingo​ y el guion en el Museo Nacional del Cabildo y la Revolución de Mayo, ambos en Buenos Aires."},{"page_url":"https://fr.wikipedia.org/wiki/Belette_%C3%A0_ventre_jaune","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Yellow-bellied_Weasel_area.png","page_title":"Belette à ventre jaune","context_page_description":"La Belette à ventre jaune, Mustela kathiah, est une espèce de belettes vivant en Asie. Elle fait partie de la famille des Mustelidae. Cette belette fait partie des dix-sept espèces de belettes formant le genre Mustela. Elle est classée LC sur la liste rouge de l'UICN."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AA%D9%8A%D9%81%D8%A7%D9%86_%D8%B4%D9%83%D8%B3%D8%A8%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Stephan_Shakespeare.jpg","page_title":"ستيفان شكسبير","context_page_description":"ستيفان شكسبير ‏ هو سياسي ألماني، ولد في 9 أبريل 1957 في مونشنغلادباخ في ألمانيا. حزبياً، نشط في حزب المحافظين."},{"page_url":"https://de.wikipedia.org/wiki/Sprachen_Osttimors","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Makalero.png","page_title":"Sprachen Osttimors","context_page_description":"Obwohl das Land nur eine Million Einwohner hat, gibt es eine Vielzahl von Sprachen in Osttimor. Neben alteingesessenen Malayo-polynesischen und Papuasprachen verbreiteten sich auch einige andere Sprachen durch Einwanderungen und Eroberung in den letzten 500 Jahren."},{"page_url":"https://nn.wikipedia.org/wiki/Morten_Stordalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Morten_Stordalen_%288468206244%29.jpg","page_title":"Morten Stordalen","context_page_description":"Morten Stordalen er ein norsk politikar for Frp som vart representant for Vestfold på Stortinget i 2013. I perioden 2013-2017 var han medlem av Familie- og kulturkomitéen. I 2005-2009 var Stordalen fjerde vararepresentant. I neste periode rykka han opp til første varamann og fekk dermed ein del ansiennitet på Stortinget.\\nStordalen har vore varaordførar i heimkommunen Re sidan kommunen blei skipa i 2002 og til kommunevalet 2011."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D9%85%DA%A9%E2%80%8C%DA%AF%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Mcgill_Building1.jpg","page_title":"دانشگاه مک‌گیل","context_page_description":"دانشگاه مک‌گیل دانشگاهی در شهر مونترآل از استان کِبک در کانادا است. این دانشگاه در سال ۱۸۲۱ تأسیس شده‌است.مک‌گیل یکی از قدیمی‌ترین دانشگاه‌های کاناداست که در دورهٔ استعمار بریتانیا و ۴۶ سال قبل از تأسیس کشور کانادا افتتاح شد."},{"page_url":"https://eu.wikipedia.org/wiki/Erdi_Aroa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Frankish_Empire_481_to_814-eu.svg","page_title":"Erdi Aroa","context_page_description":"Erdi Aroa Europako historiako aro bat da, Antzinaroaren ondorengoa eta Aro Modernoaren aurrekoa. Gutxi gorabehera V. mendetik XV. menderainoko tartea hartzen du, zehazkiago abiapuntutzat 476 urtea hartu ohi da, Mendebaldeko Erromatar Inperioaren desagerpenarekin, eta amaieratzat Konstantinoplaren erorialdia eta Ehun Urteko Gerraren amaiera 1453an edota Kolon Ameriketara iristea 1492 urtean. Erdi Aroaren baitan historialariek beste azpiaro batzuk —Goi Erdi Aroa, Tarteko Erdi Aroa eta Behe Erdi Aroa— bereizi dituzte. Erdi Aroan, aldaketa ugari gertatu ziren politika, kultura eta ekonomia arloetan. Egungo Europako hainbat estatuk oinarriak aro honetan dauzkate, muga politikoak garai gatazkatsu honetako leinu eta armaden garaipenen ondorioa baitziren."},{"page_url":"https://pt.wikipedia.org/wiki/The_Eagle%27s_Eye","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/The_Eagle%27s_Eye_%281918%29_-_3.jpg","page_title":"The Eagle's Eye","context_page_description":"The Eagle’s Eye é um seriado estadunidense de 1918, dirigido por George Lessey, Wellington A. Playter, Leopold Wharton e Theodore Wharton, em 20 capítulos, estrelado por King Baggot e Marguerite Snow. O seriado, produzido pelo Whartons Studio, veiculou nos cinemas dos Estados Unidos entre 27 de março e 7 de agosto de 1918.\\nEste seriado é considerado perdido."},{"page_url":"https://en.wikipedia.org/wiki/Leni_Riefenstahl","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Bundesarchiv_Bild_146-2004-0021%2C_Polen%2C_Truppenbesuch_von_Leni_Riefenstahl.jpg","page_title":"Leni Riefenstahl","context_page_description":"Helene Bertha Amalie \\"Leni\\" Riefenstahl was a German film director, actress, photographer and Nazi sympathizer.\\nA talented swimmer and an artist, she also became interested in dancing during her childhood, taking dancing lessons and performing across Europe. After seeing a promotional poster for the 1924 film Mountain of Destiny, Riefenstahl was inspired to move into acting. Between 1925 and 1929, she starred in five successful motion pictures. Riefenstahl became one of the few women in Germany to direct a film during the Weimar Period when, in 1932, she decided to try directing with her own film, Das Blaue Licht.\\nIn the 1930s, she directed the Nazi propaganda films Triumph des Willens and Olympia, resulting in worldwide attention and acclaim. The movies are widely considered two of the most effective, and technically innovative, propaganda films ever made. Her involvement in Triumph des Willens, however, significantly damaged her career and reputation after the war. Adolf Hitler was in close collaboration with Riefenstahl during the production of at least three important Nazi films, and they formed a friendly relationship."},{"page_url":"https://ro.wikipedia.org/wiki/Microscop","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Huygens.JPG","page_title":"Microscop","context_page_description":"Microscopul este un instrument optic care transmite o imagine mărită a unui obiect observat printr-un sistem de lentile. Cel mai răspândit tip de microscop este microscopul cu lumină artificială, inventat prin anii 1600.În anul 1679, unul din pionerii microscopului, Antoni Van Leeuwenhoek, a comunicat Societății Regale din Londra că numărul de \\"animale mici\\" pe care le-a detectat în lapții unui cod —150 de miliarde — era cu mult mai mare decât numărul total de oameni pe care planeta l-ar putea suporta. La două secole distanță, în secolul al XIX-lea, puterile de mărire și de rezoluție a microscoapelor au crescut, lentilele nemaiavând distorsiuni cromatice și sferice."},{"page_url":"https://fr.wikipedia.org/wiki/LTE_International_Airways","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Ec-kid_%282044520643%29.jpg","page_title":"LTE International Airways","context_page_description":"LTE International Airways est une compagnie aérienne espagnole, créée en 1987. Cette compagnie effectue des vols charters Brest-Palma de Majorque\\nLa compagnie a fait faillite en septembre 2008."},{"page_url":"https://sk.wikipedia.org/wiki/Joachim_Barrande","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Barrandepic.jpg","page_title":"Joachim Barrande","context_page_description":"Joachim Barrande bol francúzsky inžinier a paleontológ, ktorý sa preslávil prieskumom geologických podmienok v stredných Čechách. Oblasť neskôr bola po ňom pomenovaná Barrandien."},{"page_url":"https://es.wikipedia.org/wiki/Guatemala","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Flickr_-_ggallice_-_Pescador%2C_Lago_de_Atitl%C3%A1n_%281%29.jpg","page_title":"Guatemala","context_page_description":"Guatemala, ​ oficialmente la República de Guatemala, es un Estado situado en América Central en su extremo noroccidental, en los países angloparlantes y otros lo sitúan en América del Norte.​ Su cultura latinoamericana es variada, su amplia cultura autóctona es producto de la cultura maya y la cultura castellana durante la época virreinal española; es el país más poblado de América Central, con 16,301,286 de habitantes según censo realizado en el año 2018.​\\nAsimismo, el Área metropolitana de Guatemala cuenta con una población de 5.103.685, su extensión territorial es de 2.253 km², siendo el Área metropolitana más extensa y poblada de América Central, teniendo un índice alto de competitividad.\\nA pesar de su pequeña extensión territorial, Guatemala tiene una gran variedad climática, producto de su relieve montañoso que va desde el nivel del mar hasta los 4220 metros sobre ese nivel.​ Esto propicia que en el país existan ecosistemas tan variados que van desde los manglares de los humedales del Pacífico hasta los bosques nublados de alta montaña."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_moulins_%C3%A0_vent_de_Brabant-Septentrional","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Roosendaal_-_De_twee_gebroeders.jpg","page_title":"Liste des moulins à vent de Brabant-Septentrional","context_page_description":"Cet article recense les moulins à vent de la province de Brabant-Septentrional, aux Pays-Bas."},{"page_url":"https://de.wikipedia.org/wiki/Bassersdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Altes_Primarschulhaus_BasiI.jpg","page_title":"Bassersdorf","context_page_description":"Bassersdorf ist eine politische Gemeinde im Bezirk Bülach des Kantons Zürich in der Schweiz."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Caldes_de_Malavella","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Castell_de_Caldes_de_Malavella.jpg","page_title":"Llista de monuments de Caldes de Malavella","context_page_description":"Llista de monuments de Caldes de Malavella inclosos en l'Inventari del Patrimoni Arquitectònic de Catalunya per al municipi de Caldes de Malavella. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monument històric, els béns culturals d'interès local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1938","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Fuad_Masum_2014.jpg","page_title":"Lijst van personen geboren in 1938","context_page_description":"Dit is een lijst van personen die geboren zijn in 1938.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Miranda_(moon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Miranda_-_January_24_1986_%2830906319004%29.jpg","page_title":"Miranda (moon)","context_page_description":"Miranda, also designated Uranus V, is the smallest and innermost of Uranus's five round satellites. It was discovered by Gerard Kuiper on 16 February 1948 at McDonald Observatory in Texas, and named after Miranda from William Shakespeare's play The Tempest. Like the other large moons of Uranus, Miranda orbits close to its planet's equatorial plane. Because Uranus orbits the Sun on its side, Miranda's orbit is perpendicular to the ecliptic and shares Uranus' extreme seasonal cycle.\\nAt just 470 km in diameter, Miranda is one of the smallest closely observed objects in the Solar System that might be in hydrostatic equilibrium. The only close-up images of Miranda are from the Voyager 2 probe, which made observations of Miranda during its Uranus flyby in January 1986. During the flyby, Miranda's southern hemisphere pointed towards the Sun, so only that part was studied.\\nMiranda probably formed from an accretion disc that surrounded the planet shortly after its formation, and, like other large moons, it is likely differentiated, with an inner core of rock surrounded by a mantle of ice."},{"page_url":"https://nl.wikipedia.org/wiki/Achgarve","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Achgarve.jpg","page_title":"Achgarve","context_page_description":"Achgarve is een gehucht aan de westkust van de Schotse Hooglanden."},{"page_url":"https://da.wikipedia.org/wiki/STS-30","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Sts-28-patch.png","page_title":"STS-30","context_page_description":"STS-30 var Atlantis fjerde rumfærge-mission.\\nOpsendt 4. maj 1989 og vendte tilbage den 8. maj 1989. Om bord var rumsonden Magellan der skulle sendes til planeten Venus."},{"page_url":"https://ceb.wikipedia.org/wiki/Shiojiri-shi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Nakasendo_Narai-juku_banner.jpg","page_title":"Shiojiri-shi","context_page_description":"Distrito ang Shiojiri-shi sa Hapon. Nahimutang ni sa prepektura sa Nagano-ken, sa sentro nga bahin sa nasod, 160 km sa kasadpan sa Tokyo ang ulohan sa nasod. Adunay 67,487 ka molupyo. Naglangkob kin og 290 ka kilometro kwadrado.\\nAng yuta sa Shiojiri-shi kay lain-lain.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 18 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 1,822 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 227 milimetro nga ulan, ug ang kinaugahan Enero, sa 96 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%83%D0%B2,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Albany_v_Philly_%282286865622%29.jpg","page_title":"Гоув, Дэвид","context_page_description":"Дэ́вид То́мас Го́ув — американский хоккеист, центральный и крайний нападающий. Выступал на профессиональном уровне в период 2000—2009 годов, играл в пяти профессиональных лигах за 11 разных клубов, в том числе представлял клуб НХЛ «Каролина Харрикейнз» — в его составе в 2006 году стал обладателем Кубка Стэнли.\\nТакже известен как хоккейный тренер, занимал должность главного тренера команды «Уилинг Нэйлерз»."},{"page_url":"https://it.wikipedia.org/wiki/Douglas_F4D_Skyray","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/XF4D-1_NAN10-52.jpg","page_title":"Douglas F4D Skyray","context_page_description":"Il Douglas F4D Skyray era un monomotore a getto da caccia imbarcato ad ala a delta prodotto dall'azienda statunitense Douglas Aircraft Company negli anni cinquanta.\\nÈ stato l'ultimo dei caccia di costruzione Douglas, che si fuse insieme alla McDonnell nella nuova casa costruttrice McDonnell Douglas.\\nLo Skyray, detto Ford, aveva un'avanzata ala a forma di delta composito, ma non riusciva ad essere un velivolo nettamente supersonico, pur superando leggermente la velocità di Mach 1. Agile, armato con razzi, cannoni e missili Sidewinder di prima generazione, aveva un notevole potenziale di fuoco per la difesa della flotta, ma venne tolto dalle unità di prima linea giusto alla vigilia della guerra del Vietnam, a partire dal 1962.\\nDopo l'introduzione delle nuove designazioni per velivoli, venne chiamato F-6A."},{"page_url":"https://en.wikipedia.org/wiki/Salvatierra_de_los_Barros","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Salvatierra_de_los_Barros_15.JPG","page_title":"Salvatierra de los Barros","context_page_description":"Salvatierra de los Barros is a municipality in the province of Badajoz, Extremadura, Spain. It has a population of 1,721 and an area of 75 km²."},{"page_url":"https://it.wikipedia.org/wiki/Carrozza_UIC-X","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/FS_Bc_50_83_59-78_123-6_Venezia_SL_101211_EXP1931.jpg","page_title":"Carrozza UIC-X","context_page_description":"Le carrozze tipo UIC-X sono carrozze ferroviarie destinate in prevalenza al trasporto passeggeri su treni a media e lunga percorrenza. Realizzate a partire dal 1963, sono il risultato di un progetto europeo che prevedeva la realizzazione di carrozze standard, uguali per tutta l'Europa. In Italia, verso la fine degli anni novanta, alcune sono state modificate e inserite nella categoria di trasporto regionale, con la realizzazione di vetture semipilota."},{"page_url":"https://de.wikipedia.org/wiki/Buenavista_(Quind%C3%ADo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Buenavista_Ene_2016_%2857%29.JPG","page_title":"Buenavista (Quindío)","context_page_description":"Buenavista ist eine Gemeinde im Departamento Quindío in der kolumbianischen Kaffeeanbauregion. Buenavista ist die kleinste Gemeinde Quindíos."},{"page_url":"https://vi.wikipedia.org/wiki/N%C3%A9m_bom_Damascus_v%C3%A0_Homs_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/U._S._Defense_Departement_News_Briefing_Slide_April_14%2C_2018.JPG","page_title":"Ném bom Damascus và Homs 2018","context_page_description":"Vào ngày 14 tháng 4 năm 2018, bắt đầu lúc 04:00 giờ địa phương, Hoa Kỳ, Pháp và Anh đã tiến hành một loạt các cuộc không kích vào 3 cơ sở chính phủ nghiên cứu và trang bị vũ khí hoá học ở Syria. Ba cường quốc phương Tây tiến hành các cuộc không kích nhằm phản ứng vụ tấn công hóa học Douma 2018 ở miền Đông Ghouta vào ngày 7 tháng 4, mà họ cáo buộc là do chính phủ Syria thực hiện. Chính phủ Syria đã phủ nhận đã thực hiện vụ tấn công Douma và cho rằng vụ ném bom là vi phạm luật pháp quốc tế."},{"page_url":"https://en.wikipedia.org/wiki/James_A._Baldwin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/James_Baldwin_-_Duke.jpg","page_title":"James A. Baldwin","context_page_description":"James A. Baldwin was an American football player, track athlete, coach of football, basketball, and baseball, and college athletics administrator. He served as the head football coach at Rhode Island State College—now the University of Rhode Island, the University of Maine, Trinity College in Durham, North Carolina—now Duke University, Lehigh University, and Wake Forest University, compiling a career college football record of 41–32–14. Baldwin was also the head basketball coach at the same five schools, amassing a career college basketball mark of 85–66. In addition he served as the head baseball coach at Rhode Island State and at Lehigh, tallying a career college baseball record of 32–25–1. From 1916 to 1919, Baldwin was the athletic director at Rhode Island while he coached three sports."},{"page_url":"https://es.wikipedia.org/wiki/Alfred_Church_Lane","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/PSM_V70_D189_Alfred_C_Lane.jpg","page_title":"Alfred Church Lane","context_page_description":"Alfred Church Lane fue un geólogo y profesor estadounidense."},{"page_url":"https://cs.wikipedia.org/wiki/Jind%C5%99ich_II._Francouzsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Heinrich_II._Frankreich.jpg","page_title":"Jindřich II. Francouzský","context_page_description":"Jindřich II. Francouzský z dynastie Valois byl francouzský král od 31. července 1547 do své smrti."},{"page_url":"https://pt.wikipedia.org/wiki/Pampilhosa_da_Serra_(freguesia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Pampilhosa_da_Serra_24.PNG","page_title":"Pampilhosa da Serra (freguesia)","context_page_description":"Pampilhosa da Serra é uma freguesia portuguesa do concelho de Pampilhosa da Serra, com 100,23 km² de área e 1 389 habitantes. A sua densidade populacional é de 13,9 hab/km²."},{"page_url":"https://vi.wikipedia.org/wiki/Muri_bei_Bern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/G%C3%BCmligen_Kirche.JPG","page_title":"Muri bei Bern","context_page_description":"Muri bei Bern là một đô thị trong huyện Bern-Mittelland, bang Bern, Thụy Sĩ. Đô thị này có diện tích 7,7 km2, dân số thời điểm tháng 12 năm 2009 là 12.786 người."},{"page_url":"https://en.wikipedia.org/wiki/Stingray_Swamp_Flora_Reserve","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/SWFR_Threats.png","page_title":"Stingray Swamp Flora Reserve","context_page_description":"Stingray Swamp Flora Reserve is located immediately north of Penrose township in the south-western region of Wingecarribee Shire. The reserve is primarily surrounded by the Penrose State Forest, which is a commercially active plantation forest administered by the Forest Corporation NSW. Pine species dominate the state forest with a mix of native vegetation types in isolated pockets and adjacent areas. Stingray Swamp Flora Reserve belongs to a larger wetland complex known as the Paddy’s River Wetland Complex. These wetlands also form part of the Paddy’s River sub-catchment, which belong to the larger Hawkesbury-Nepean catchment. Historic use of this area has mainly been that of pine plantation, agriculture and mining activities. The forest is publicly accessible and therefore is a site of mixed recreational activities."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D0%B5%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Celle_Partnerstadt_Haemeenlinna.jpg","page_title":"Целе","context_page_description":"Целе — град и административно седиште на истоимениот округ, во сојузната покраина Долна Саксонија, Германија.\\nГрадот важи како јужна порта на Линебуршкото Поле и поседува стар град со повеќе од 400 куќи во фахверк, како и замок во ренесанса и барок. Изграден е на бреговите на реката Алер, притока на Везер.\\nОд 1378 до 1705 година бил официјална резиденција на Линебуршката гранка на војводите на Брауншвајг-Линебург, кои биле протерани од нивното првично седиште од тамошните жители."},{"page_url":"https://tr.wikipedia.org/wiki/2016-17_%C3%87empionat_Rossii_po_futbolu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Opera_2017-08-22_09-27-07.png","page_title":"2016-17 Çempionat Rossii po futbolu","context_page_description":"2016-17 Çempionat Rossii po futbolu Rusya'da Sovyetler Birliği'nin dağılmasından bu yana var olan ligin 25. sezonudur, bu adla ise 14. sezonudur. CSKA Moscow 2015-16 sezonunun şampiyonuydu. 2016-17 sezonunun fikstürü 20 Haziran 2016 tarihinde belirlendi."},{"page_url":"https://es.wikipedia.org/wiki/Fools_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Fools_Garden_blacksheep_2016_2000.jpg","page_title":"Fools Garden","context_page_description":"Fools Garden es una banda de rock alternativo oriunda de Pforzheim, Alemania. Fue creada en 1991 por Peter Freudenthaler y Volker Hinkel bajo el nombre Fool’s Garden. La formación se completaba con Thomas Mangold en el bajo, Roland Röhl en teclados y Ralf Wochele en batería.\\nEn 1995 lanzaron Dish of the Day, logrando éxito masivo en Europa y Asia con el sencillo \\"Lemon Tree\\".\\nEn 1997 sale el disco Go and ask Peggy for the principal thing, el cual contiene nuevamente un cover de The Beatles, esta vez del tema “Martha my dear”. En el año 2000 sale a la luz el disco For Sale, seguido en 2003 por 25 Miles to Kissimmee, que sería el último álbum editado con todos los miembros originales de la banda.\\nLuego del lanzamiento, Thomas Mangold, Roland Röhl y Ralf Wochele abandonan el grupo y son reemplazados por Dirk Blümlein, Claus Müller y Gabriel Holz. A partir de estos cambios la banda abandona el apóstrofo del nombre y pasa a llamarse simplemente Fools Garden.\\nEl primer disco de la nueva formación se llamó Ready for the real life y fue editado en 2005. Para muchos críticos y fanáticos es considerado como el mejor álbum de la banda."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AE%E3%83%8B%E3%82%A2%E3%83%BB%E3%83%95%E3%83%A9%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/GNF5000.jpg","page_title":"ギニア・フラン","context_page_description":"ギニア・フラン は、ギニア共和国の通貨であり、ギニア共和国中央銀行が発行している。50フラン硬貨、100フラン紙幣、500フラン紙幣、1000フラン紙幣、5000フラン紙幣、10000フラン紙幣があるが、50フラン硬貨および100フラン紙幣はほとんど流通していない。\\n1959年から1971年まで流通した旧ギニア・フランと1985年以降、現在にいたるまで流通している新ギニア・フランとがある。\\n旧ギニア・フランは1959年にCFAフランと等価として導入された。\\n1971年には1シリ=10フランとしてシリが、ギニア共和国の通貨として入された。\\n新ギニア・フランは1985年にシリと等価として再導入された。\\n2011年11月現在の実勢レートは10000ギニア・フラン＝約1ユーロ。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%89%E6%9D%B1%E5%AF%A7%C2%B7%E5%A7%86%E7%88%BE%E7%A7%91%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Dr._Anton%C3%ADn_Mrkos_0001_01.jpg","page_title":"安東寧·姆爾科斯","context_page_description":"安東寧·姆爾科斯，捷克天文學家，是許多彗星和小行星的發現者，生於 Střemchoví。"},{"page_url":"https://pl.wikipedia.org/wiki/Antoni_Edward_Fraenkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/POL_COA_Frenkel.svg","page_title":"Antoni Edward Fraenkel","context_page_description":"Antoni Edward Fraenkel – polski kupiec i bankier żydowskiego pochodzenia."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%85%D8%B1%D8%AA%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/PreservedFood1.jpg","page_title":"مرتبان","context_page_description":"مرتبان اِک سلنڈر دی شکل دا یعنی گول برتݨ ہُندا وا۔ مرتبان مِٹی، چینی، دھات یا پلاسٹک دے ہُندے نیں۔ عام طور تے مرتبان کھاݨ پِیݨ والیاں چیزاں رکھݨ لئی ورتے جاندے نیں۔ مٹی، چِینی تے پلاسٹک دے مرتباناں وِچ زیادہ تر اچار پایا جاندا وا۔"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Zwaag","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Bangert_15%2C_Zwaag.JPG","page_title":"Lijst van gemeentelijke monumenten in Zwaag","context_page_description":"De plaats Zwaag, onderdeel van de gemeente Hoorn, telt 42 gemeentelijke monumenten, hieronder een overzicht:"},{"page_url":"https://af.wikipedia.org/wiki/Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Downtown_Dallas_at_dusk.jpg","page_title":"Texas","context_page_description":"Texas is 'n deelstaat in die sentrale suide van die Verenigde State van Amerika met 'n oppervlakte van 696 241 vierkante kilometer en 'n bevolking van 26,9 miljoen.\\nDie administratiewe hoofstad is Austin, die grootste stad is Houston en die grootste metropolitaanse gebied is Dallas/Fort Worth/Arlington. Texas is sowel ten opsigte van sy oppervlakte asook sy bevolking die tweede grootste Amerikaanse deelstaat – slegs Alaska het 'n groter oppervlakte, en net Kalifornië se inwonertal oorskry dié van Texas. In administratiewe opsig het geen ander deelstaat meer counties of administratiewe distrikte as Texas.\\nDie bynaam van Texas, Lone Star State, verwys na die historiese feit dat Texas reeds voor sy toetrede tot die Unie as 'n onafhanklike republiek bestaan het. In geskiedkundige en kulturele opsig het Texas, onder meer vanweë die geskiedenis van sy kolonisasie en sy lidmaatskap in die Konfederasie, nou bande met die Amerikaanse Suide. As 'n voormalige Spaanse en Meksikaanse besitting behoort die deelstaat egter ook by die Amerikaanse Suidweste."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Talcy","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Chateau_de_Talcy_Colombier_01.JPG","page_title":"Schloss Talcy","context_page_description":"Das Schloss Talcy steht im gleichnamigen französischen Ort Talcy im Département Loir-et-Cher, Region Centre-Val de Loire. Etwa 20 Kilometer nordöstlich von Blois und damit am äußeren Rand des Loiretals in der fruchtbaren Beauce gelegen, gehört es zu den Schlössern der Loire.\\nDas äußerlich schlicht und sehr streng wirkende Schloss wurde im August 1908 als Monument historique unter Denkmalschutz gestellt und ist weniger wegen seiner Architektur als vielmehr wegen seiner Bewohnerinnen bekannt. Zwei hübsche Töchter der Besitzerfamilie Salviati gingen als Musen der Schriftsteller Pierre de Ronsard und Théodore Agrippa d’Aubigné in die Literaturgeschichte ein: Cassandre Salviati und ihre Nichte Diane.\\nDie fast vollständig erhaltene Innenausstattung des Schlosses mit Möbeln aus dem 17. und 18. Jahrhundert sowie sein restaurierter Barockgarten können entgeltlich besichtigt werden."},{"page_url":"https://sv.wikipedia.org/wiki/Arrenurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/LestesDryas%2BMites2.jpg","page_title":"Arrenurus","context_page_description":"Arrenurus är ett släkte av kvalster. Arrenurus ingår i familjen Arrenuridae."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%88%E5%85%8B%E5%B0%94%C2%B7%E5%87%AF%E7%89%B9%E5%88%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/KightlyWolves07.png","page_title":"迈克尔·凯特利","context_page_description":"米高·約翰·禮利出生於英格蘭埃塞克斯郡的巴西爾登，是一名職業足球員，司職邊鋒。\\n禮利於學童時期在熱刺受訓，惟未獲晉升機會而加盟家鄉球隊巴西爾登聯，不久後獲紹森德接納而首嘗聯賽滋味，但僅效力兩年便遭放棄。禮利轉投非聯賽隊伍格雷斯後開始展露光芒，最終獲伍爾弗漢普頓流浪的賞識而平步青雲。"},{"page_url":"https://cs.wikipedia.org/wiki/Polsk%C3%A1_kuchyn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/07425_Jahrmarkt_in_Sanok_am_17_Juli_2011.jpg","page_title":"Polská kuchyně","context_page_description":"Polská kuchyně je rozmanitá a souvisí především s kuchyní východních sousedů Polska, ale také má některé podobnosti k středoevropským a skandinávským kuchyním. Dále je ovlivněna židovskou, francouzskou, tureckou a italskou kuchyní.\\nMezi tradiční jídla patří bigos, pirohy, různé klobásy a nakládačky. Jídla jsou vydatná, oblíbenými surovinami jsou maso, brambory, kysané zelí, lesní houby, mléčné výrobky a sladkovodní i mořské ryby."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Cherval","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Cherval_eg2.JPG","page_title":"Cherval","context_page_description":"Cherval sī ūi-tī Hoat-kok Aquitaine tōa-khu Dordogne séng ê chi̍t-ê commune."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B5%D0%BB%D0%BA%D0%BB%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/V%C3%B6lklingen_in_SB.svg","page_title":"Фелклинген","context_page_description":"Фелклинген град је у њемачкој савезној држави Сарланд. Посједује регионалну шифру 10041519."},{"page_url":"https://en.wikipedia.org/wiki/South_Ostrobothnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Yli-Laurosela_museum_Ilmajoki.jpg","page_title":"South Ostrobothnia","context_page_description":"South Ostrobothnia is one of the 19 regions of Finland. It borders the regions of Ostrobothnia, Central Ostrobothnia, Central Finland, Pirkanmaa, and Satakunta.\\nSeinäjoki is the regional centre and by far the largest city in the area."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%A6%99%E6%B8%AF%E7%A4%A6%E6%A5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/KWC_1920s.jpg","page_title":"香港礦業","context_page_description":"香港矿业是香港境内开采天然资源的产业，虽然香港地方细小，但因为香港境内在古代曾发生活跃的地壳活动，使香港地形复杂，不但多山多岛，矿物和石材资源也比人口、大小及经济水平与香港相近的城市丰富。在香港开埠之前，境内已有小规模的矿业生产，在二十世纪初进一步发现可供商业开采的矿物，包括在马鞍山的铁矿；针山的钨矿；大磨刀的石墨矿，但随着城市的扩展及经济转型，开采金属矿物的矿场都已于1970年代中期停产。自1982年后，香港再没有发出商业性勘探矿产及开采矿物的经营牌照。\\n除金属矿物之外，香港也有颇多石材资源，在1980年代以前，香港所需的石材原料都是来自本地的石矿场，但到2000年代，大部分采石场都已经关闭，也没有新设的采石场，现在大部分所需的石材都来自邻近的地区。截至2020年，香港目前只有屯门蓝地石矿场仍在运作中。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%85%B0%E5%BC%80%E6%96%AF%E7%89%B9_(%E6%96%B0%E7%BD%95%E5%B8%83%E4%BB%80%E5%B0%94%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Coos-Lancaster-NH.png","page_title":"兰开斯特 (新罕布什尔州)","context_page_description":"蘭開斯特位於美國新罕布夏州北部，是庫斯縣的縣治所在，面積132.8平方公里。根據2000年美國人口普查，共有3,280人，其中白人占98.08%。這個數字於2010年上升至3,507人，是該縣人口第二多城市"},{"page_url":"https://lv.wikipedia.org/wiki/Gai%C5%A1zil%C4%81_z%C4%ABl%C4%ABte","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Yellow-breasted_Tit%2C_Uzbekistan_1.jpg","page_title":"Gaišzilā zīlīte","context_page_description":"Gaišzilā zīlīte ir neliels zīlīšu dzimtaa dziedātājputns, kas ligzdo Austrumeiropas austrumos un Āzijā. Izdala 8 pasugas.\\nNesenā pagātnē gaišzilā zīlīte tika sistematizēta zīlīšu ģintī, tomēr pēdējo gadu DNS pētījumi zīlīšu dzimtas sistemātikā ir ieviesuši izmaiņas."},{"page_url":"https://en.wikipedia.org/wiki/Sadiola_Gold_Mine","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Sadiola_mining.jpg","page_title":"Sadiola Gold Mine","context_page_description":"The Sadiola Gold Mine is an open-pit gold mine situated near Sadiola, in the Kayes Region of Mali. The operation is jointly owned by AngloGold Ashanti and Iamgold, who each have an effective holding of 41%, while the Government of Mali owns the remaining 18%. The International Finance Corporation originally held 6% of the mine put sold this share equally to Anglo and Iamgold in December 2009.\\nApart from Sadiola and the nearby Yatela Mine, AngloGold Ashanti's also operates the Morila Gold Mine in Mali. The production of its mines in Mali contributed 8 percent to the company's overall production in 2008."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%8B%D0%BD%D0%BE%D1%87%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%83%D0%BB%D0%BE%D0%BA_(%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BA%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%D0%A0%D1%8B%D0%BD%D0%BE%D1%87%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%83%D0%BB%D0%BE%D0%BA%2C_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BA%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7.jpg","page_title":"Рыночный переулок (Владикавказ)","context_page_description":"Рыночный переулок — переулок во Владикавказе, Северная Осетия, Россия. Переулок располагается в Затеречном муниципальном округе Владикавказа между улицами Леваневского и Левченко. Начинается от улицы Леваневского.\\nПереулок сформировался в первой половине XX века. 18 мая 1954 года Орджоникидзевский горсовет присвоил переулку, проходящему в районе кварталов 495 и 495-а между улицами Лагерной и Подгорной, наименование «Рыночный переулок»."},{"page_url":"https://tt.wikipedia.org/wiki/22_%D1%81%D0%B5%D0%BD%D1%82%D1%8F%D0%B1%D1%80%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Earth_flag_PD.jpg","page_title":"22 сентябрь","context_page_description":"22 сентябрь — Милади тәкъвимендә тугызынчы айның егерме икенче көне. Ел ахырына кадәр 100 көн кала.\\nДөнья тарихында бу көн:"},{"page_url":"https://hu.wikipedia.org/wiki/Ben%C3%A1rd_%C3%81gost","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Signature_de_la_Paix_avec_la_Hongrie%2C_en_t%C3%AAte_Ben%C3%A1rd_%C3%81gost_hongrois_%28passant_devant_un_piquet_d%27honneur_%C3%A0_Versailles%29_V3.jpg","page_title":"Benárd Ágost","context_page_description":"Vitéz dr Benárd Ágost orvos, keresztényszocialista politikus, a trianoni békeszerződés egyik aláírója az első világháborúban vesztes Magyar Királyság képviselőjeként."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Herford","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/F%C3%BCrstenau_12.jpg","page_title":"Liste der Baudenkmäler in Herford","context_page_description":"Die Liste der Baudenkmäler in Herford enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Herford im Kreis Herford in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Herford eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://en.wikipedia.org/wiki/Boston_Terrier","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/BostonTerrier001.JPG","page_title":"Boston Terrier","context_page_description":"The Boston Terrier is a breed of dog originating in the United States of America. This \\"American Gentleman\\" was accepted in 1893 by the American Kennel Club as a non-sporting breed. Color and markings are important when distinguishing this breed from the AKC standard. They should be either black, brindle or seal with white markings. Boston Terriers are small and compact with a short tail and erect ears. The AKC says they are highly intelligent and very easily trained. They are friendly and can be stubborn at times. The average life span of a Boston Terrier is around 11 to 13 years, though some can live up to around 18 years. They have a short nose, which can often cause breathing problems later in life, which is what leads to a low life expectancy.\\nThe American Kennel Club ranked the Boston Terrier as the 21st most popular breed in 2019."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BE%D5%A1%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Tsar005.JPG","page_title":"Ծար","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Ծար\\nԾար՝ գյուղ և պատմական բերդավան Արցախի Շահումյանի շրջանում, պատմականոմ Վայկունիքում։ Գտնվում է Տրտու գետի ակունքի մոտ, ընդարձակ լեռնահովտում, ծովի մակերեսից 2100 մ բարձրության վրա։ Քարվաճառից՝ 20 կմ հարավ-արևելք է, Ջերմաջուր առողջարանային ավանից\` 5 կմ հյուսիս։ Չորս կողմից շրջապատված է բարձր ձյունապատ լեռներով և վիմահերձ ժայռերով։ Ջրառատ է, ունի բերրի վարելահողեր և արոտավայրեր։\\nԳյուղի միջնակարգ դպրոցը կոչված է Մատթեոս Ծարեցու անվամբ։ Էլեկտրիֆիկացված չէ։ Վերաբնակեցվել է 1993 թ ազատագրումից հետո։ 2005 թ․ ուներ 52 բնակիչ։"},{"page_url":"https://en.wikipedia.org/wiki/Mount_Zion_(Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Mount_Zion_-_west_slope%2C_Olympic_National_Forest.jpg","page_title":"Mount Zion (Washington)","context_page_description":"Mount Zion is a 4,278-foot peak in the Olympic National Forest. The peak is located 9.5 miles northwest of Quilcene, and near Lords Lake and Bon Jon Pass. Billed as one of the easier hikes in the Olympics, Zion offers a 1,340-foot elevation gain in just under 2 miles."},{"page_url":"https://no.wikipedia.org/wiki/Pavel_Akselrod","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Pavel_Axelrod.jpg","page_title":"Pavel Akselrod","context_page_description":"Pavel Borisovitsj Akselrod var en russisk sosialist og politiker."},{"page_url":"https://ga.wikipedia.org/wiki/Gaoda_Bheinn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Goatfell_from_Brodick_Harbour.jpg","page_title":"Gaoda Bheinn","context_page_description":"Is sliabh in Albain í Gaoda Bheinn, atá suite ar an Oileán Arainn, Comhairle Shiorrachd Áir a Tuath."},{"page_url":"https://sv.wikipedia.org/wiki/Glendora,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Hillman_Davies_1756.jpg","page_title":"Glendora, New Jersey","context_page_description":"Glendora är en så kallad census-designated place i Camden County i New Jersey. Vid 2010 års folkräkning hade Glendora 4 750 invånare."},{"page_url":"https://pl.wikipedia.org/wiki/Skala_Ferrimana-Gallweya","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Modified_Ferriman-Gallwey-score.png","page_title":"Skala Ferrimana-Gallweya","context_page_description":"Skala Ferrimana-Gallweya – skala oceny owłosienia ciała u kobiet przed przekwitaniem stosowana w diagnostyce hirsutyzmu.\\nSkala została opracowana przez angielskich lekarzy Davida Ferrimana i Johna Gallweya w 1961 roku i obejmowała analizę 11 okolic ciała, w 1965 roku na podstawie dalszych badań wpływu androgenów na owłosienie skala została zmodyfikowana. W zmodyfikowanej skali zrezygnowano z oceny przedramion i podudzi. Zgodnie z wytycznymi Endocrine Society zmodyfikowana skala Ferrimana-Gallweya jest złotym standardem w rozpoznawaniu hirsutyzmu."},{"page_url":"https://es.wikipedia.org/wiki/Andr%C3%A9s_Allamand","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Gabinetejulio2020-04.jpg","page_title":"Andrés Allamand","context_page_description":"Andrés Allamand Zavala es un abogado y político chileno de derecha, uno de los fundadores del Movimiento de Unión Nacional y de Renovación Nacional, de los que ha sido presidente. Desde el 28 de julio de 2020 se desempeña como ministro de Relaciones Exteriores, bajo el segundo gobierno de Sebastián Piñera.\\nEntre 1994 y 1998 fue diputado por el distrito 23, y posteriormente senador por la Región de Los Lagos, desde 2006 y hasta 2011, cuando fue nombrado como ministro de Defensa, durante el primer gobierno de Sebastián Piñera. Se desempeñó en el gabinete hasta noviembre de 2012, cuando renunció para participar como candidato presidencial de RN en las primarias de la Alianza en junio de 2013, donde resultó derrotado por Pablo Longueira. Ese mismo año volvió a ser electo como Senador, esta vez por Santiago Poniente, ​ asumiendo en 2014 y dejando el escaño en 2020."},{"page_url":"https://pl.wikipedia.org/wiki/Mikroprocesor","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/MC6809EP.jpg","page_title":"Mikroprocesor","context_page_description":"Mikroprocesor – układ cyfrowy wykonany jako pojedynczy układ scalony o wielkim stopniu integracji zdolny do wykonywania operacji cyfrowych według dostarczonego ciągu instrukcji.\\nMikroprocesor łączy funkcje centralnej jednostki obliczeniowej w pojedynczym półprzewodnikowym układzie scalonym. Pierwszy mikroprocesor działał w oparciu o słowa 4-bitowe.\\nMikroprocesor umożliwił rozwój mikrokomputerów w połowie lat 70. XX w. Przed tym okresem, elektroniczne CPU były konstruowane z zajmujących wiele miejsca układów scalonych małej skali integracji. Poprzez zintegrowanie procesora w jeden lub kilka układów scalonych o coraz wyższej skali integracji, stosunek możliwości do ceny procesora znacząco wzrósł. Od połowy lat siedemdziesiątych, dzięki intensywnemu rozwojowi układów scalonych, mikroprocesor stał się najbardziej rozpowszechnioną formą CPU, prawie całkowicie zastępując wszystkie inne.\\nEwolucję mikroprocesora dobrze opisuje prawo Moore’a mówiące o wzroście wydajności na przestrzeni lat. Mówi ono, że złożoność układów scalonych, przy zachowaniu minimalnego kosztu składników, będzie się podwajać co 18 miesięcy. Stwierdzenie to zachowuje prawdziwość od czasu wczesnych lat 70."},{"page_url":"https://lt.wikipedia.org/wiki/Jotainiai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Jotainiai%2C_kry%C5%BEius.JPG","page_title":"Jotainiai","context_page_description":"Jotainiai – gyvenvietė Panevėžio rajono savivaldybės teritorijoje, prie kelių 3017 Velžys–Jotainiai–Pagiriai–Šėta, Ėriškiai–Raguva ir 8 km į šiaurės rytus nuo Ramygalos, į vakarus nuo Raguvos. Seniūnaitijos centras.\\nYra paštas."},{"page_url":"https://cs.wikipedia.org/wiki/Flat_Assembler","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/FASM.PNG","page_title":"Flat Assembler","context_page_description":"Flat Assembler je volný a otevřený víceprůchodový assembler, vytvořený Tomaszem Grysztarem. Fasm je napsán na principu stejný zdroj, stejný výstup, disponuje nevelkými rozměry a velmi vysokou rychlostí kompilace. Má bohatou a výstižnou makro–syntaxi dovolující automatizovat množství rutinních úkolů. Jsou podporovány jak objektové formáty, tak i formáty spustitelných souborů. To ve většině případů dovoluje se obejít bez linkeru. V ostatních případech je třeba pomocné linkery, protože tyto nejsou rozšiřovány spolu s fasm.\\nKromě základního souboru instrukcí procesoru a koprocesoru fasm podporuje soubory instrukcí MMX, SSE, SSE2, SSE3, SSSE3, SSE4.1, SSE4.2, SSE4a, AVX a 3DNow!, a také EM64T a AMD64.\\nKompilace programu v fasm se skládá ze dvou stadií: předzpracování a sestavování."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E7%BE%85%C2%B7%E6%96%AF%E5%8D%A1%E5%B8%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Scala_sfalsata_-_carlo_scarpa_in_castelvecchio.jpg","page_title":"卡羅·斯卡帕","context_page_description":"卡羅·阿爾貝托·斯卡帕，義大利著名建築師、玻璃工藝與家具設計師。"},{"page_url":"https://en.wikipedia.org/wiki/Harris-Merrick_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Harris-Merrick_House%2C_Worcester_MA.jpg","page_title":"Harris-Merrick House","context_page_description":"The Harris-Merrick House is an historic house at located 41 Fruit Street in Worcester, Massachusetts. Built sometime between 1832 and 1844, it is a good example of Greek Revival architecture, and a rare surviving element of the early residential development west of downtown Worcester. The house was listed on the National Register of Historic Places on March 5, 1980."},{"page_url":"https://ceb.wikipedia.org/wiki/Powell_Knoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Relief_Map_of_Caribbean.png","page_title":"Powell Knoll","context_page_description":"Gamay nga bungtod sa dagat ang Powell Knoll sa Jamayka. Nahimutang ni sa habagatang bahin sa nasod, 170 km sa habagatan-kasadpan sa Kingston ang ulohan sa nasod."},{"page_url":"https://sv.wikipedia.org/wiki/Romblonella","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Romblonella_opaca_casent0178525_profile_1.jpg","page_title":"Romblonella","context_page_description":"Romblonella är ett släkte av myror. Romblonella ingår i familjen myror.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://es.wikipedia.org/wiki/Ej%C3%A9rcito_de_los_Estados_Unidos","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/USA_-_Army_Finance_Corps.png","page_title":"Ejército de los Estados Unidos","context_page_description":"El Ejército de los Estados Unidos​ es la mayor de las ramas de las Fuerzas Armadas de los Estados Unidos y su principal responsabilidad son las operaciones militares terrestres. Es uno de los ocho servicios uniformados de Estados Unidos y el más antiguo de todas las fuerzas armadas estadounidenses, pues el moderno ejército tiene sus raíces en el Ejército Continental que se formó el 14 de junio de 1775 para luchar en la Guerra de Independencia de los Estados Unidos, antes de la creación de Estados Unidos como nación independiente.​ Después de esta guerra, el Congreso de la Confederación creó el Ejército de los Estados Unidos el 3 de junio de 1784 para sustituir al desmovilizado Ejército Continental.​​ El ejército estadounidense se considera a sí mismo descendiente del Continental y fecha su origen institucional en aquella fuerza armada nacida en 1775.​\\nComo servicio militar uniformado, es parte del Departamento del Ejército, que es uno de los tres que dependen del Departamento de Defensa. Este ejército está dirigido por un funcionario civil, el Secretario del Ejército, y por un oficial militar, el Jefe del Estado Mayor, que también es miembro del Estado Mayor Conjunto."},{"page_url":"https://es.wikipedia.org/wiki/Braathens_Regional","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/GoldenAirSaab340.jpg","page_title":"Braathens Regional","context_page_description":"Braathens Regional es una aerolínea regional con base en Trollhättan, Suecia. Opera con servicios regulares a destinos situados en Noruega y Suecia, así como servicios de vuelos chárter. Su base principal se encuentra en el aeropuerto de Trollhättan-Vänersborg, con centros de conexión en los aeropuertos de Estocolmo-Bromma y Ängelholm-Helsingborg.​"},{"page_url":"https://en.wikipedia.org/wiki/Brodmann_area_43","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Brodmann_area_43.png","page_title":"Brodmann area 43","context_page_description":"Brodmann area 43, the subcentral area, is a structurally distinct area of the cerebral cortex defined on the basis of cytoarchitecture. Along with Brodmann Area 1, 2, and 3, Brodmann area 43 is a subdivision of the postcentral region of the brain, suggesting a somatosensory function. The histological structure of Area 43 was initially described by Korbinian Brodmann, but it was not labeled on his map of cortical areas."},{"page_url":"https://nn.wikipedia.org/wiki/Ten_Man_Mop,_or_Mr._Reservoir_Butler_Rides_Again","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Sippers_and_Topers_c1900_Stone.jpg","page_title":"Ten Man Mop, or Mr. Reservoir Butler Rides Again","context_page_description":"Ten Man Mop or Mr. Reservoir Butler Rides Again er det tredje studioalbumet av Steeleye Span, spelt inn i september 1971. Det kom ut på det kortvarige selskapet Pegasus, og sidan på ny på Mooncrest same året. Det vart først gjeven ut i USA då Chrysalis Records kjøpte rettane til dei tre første albuma deira i 1975 og gav albuma ut på ny i både Storbritannia og USA.\\nSongar som «Four Nights Drunk», «Marrowbones» og «Wee Weaver» er i røynda rein folkemusikk. Det var det siste albumet med det opphavlege medlemmet Ashley Hutchings. Han slutta i bandet i november 1971, like etter albumet var ferdig innspelt, dels fordi han meinte albumet gjekk for langt mot irsk musikk og bort frå engelsk musikk. Bandet vurderte òg å turnere i Amerika, noko Hutchings var motvillig til.\\nAlbumet byrjar med ei tilpassing av julesongen «Gower Wassail». «When I was on Horseback» er ein av dei få folkevisene som har eit alternativt liv som ein bluessong, stundom kjend som «Six White Horses». Det finst òg ein irsk variant av ein melodi inspirert av «Streets of Laredo» og «St. James Infirmary Blues». Den siste songen, «Skewball», har eit effektivt kontrapunkt mellom ein banjo og ein elektrisk gitar."},{"page_url":"https://cs.wikipedia.org/wiki/Barrandovsk%C3%BD_most","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Pohled_na_Barrandovsk%C3%BD_Most_%282011%29.jpg","page_title":"Barrandovský most","context_page_description":"Barrandovský most je pražský silniční most přes řeku Vltavu, vybudovaný v letech 1978–1988 jako most Antonína Zápotockého. Je významným dopravním uzlem jižní části hlavního města a nejrozáhlejším mostním dílem v Praze. Spojuje čtvrť Braník na pravém břehu a Hlubočepy na levém břehu a je pojmenován podle Barrandova, protože navazuje také na sem vedoucí komunikaci. Má čtyři pruhy v každém směru, je přístupný i chodcům a cyklistům. Je součástí Městského okruhu, objíždějící užší centrum Prahy.\\nJde o nejvytíženější komunikaci v České republice. Denně přes něj podle statistiky v roce 2017 projelo 142 000 vozidel."},{"page_url":"https://ms.wikipedia.org/wiki/Fettuccine_Alfredo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Shrimp_Fettucini_Alfredo.jpg","page_title":"Fettuccine Alfredo","context_page_description":"Fettuccine Alfredo adalah sejenis hidangan pasta yang diperbuat daripada fettuccine digaul dengan keju Parmesan dan mentega. Apabila keju cair, ia mengemulsi cecairannya untuk membentuk lapisan halus dan pekat menyaluti pasta. Istilah ini adalah sinonim untuk pasta dengan mentega dan keju Parmesan, salah satu cara paling lama dan paling mudah untuk menyediakan pasta. Hidangan ini dinamakan oleh Alfredo Di Lelio I, seorang pengusaha restoran yang membuka dan mengendalikan restoran di Rom, Itali, sepanjang awal hingga pertengahan abad ke-20."},{"page_url":"https://en.wikipedia.org/wiki/1908_United_States_presidential_election_in_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Colorado_Presidential_Election_Results_1908.svg","page_title":"1908 United States presidential election in Colorado","context_page_description":"The 1908 United States presidential election in Colorado took place on November 3, 1908, as part of the 1908 United States presidential election. Voters chose five representatives, or electors, to the Electoral College, who voted for president and vice president."},{"page_url":"https://sv.wikipedia.org/wiki/Philip_Glenister","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Philip_Glenister_%28cropped%29.jpg","page_title":"Philip Glenister","context_page_description":"Philip Heywood Glenister, född 10 februari 1963 i London, England, är en brittisk skådespelare.\\nGlenister är son till regissören John Glenister, och utbildad skådespelare vid Londons Central School of Speech and Drama. Han har genom åren medverkat i många kända engelska produktioner, bland annat tv-serierna Hornblower, Den tredje makten och Sharpe, filmen Kalenderflickorna och miniserien Cranford. I England blev Philip Glenister kultförklarad för sin succéroll som den hårde 70-talssnuten Gene Hunt i den populära tv-serien Life on Mars.\\nGlenister är lillebror till skådespelaren Robert Glenister, känd från bland annat tv-serien Svindlarna och I mördarens spår - Ett barn försvinner.\\nPhilip Glenister är sedan 2006 gift med skådespelaren Beth Goddard."},{"page_url":"https://es.wikipedia.org/wiki/Figuralismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Marenzio_solo_e_pensoso_chromatic.png","page_title":"Figuralismo","context_page_description":"El figuralismo es una técnica de composición musical aplicada a la música vocal, que estuvo activa entre los siglos XVI y XVIII, en consonancia con los presupuestos estéticos del Renacimiento y del Barroco. Consistía en subordinar la música al texto creando para la música una serie de figuras de todo tipo que subrayaban el sentido profundo del texto musicalmente, con el sonido.\\nEsta técnica en lengua inglesa recibe la gráfica denominación de «word painting», que literalmente quiere decir \\"pintar las palabras\\". Por ejemplo las melodías ascendentes acompañan a textos que hablan de subir o ir hacia arriba, mientras que una música grave y oscura acompaña a un texto sobre la muerte."},{"page_url":"https://es.wikipedia.org/wiki/Nico_Minardos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Nina_van_Pallandt_and_Nico_Minardos.jpg","page_title":"Nico Minardos","context_page_description":"Nico Minardos fue un actor cinematográfico y televisivo grecoestadounidense."},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Gin%C3%A8is_de_la_Chalm","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Col_de_la_Faye.JPG","page_title":"Sant Ginèis de la Chalm","context_page_description":"Saint-Genest-Lachamp és un municipi francès, situat al departament de l'Ardecha i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 101 habitants."},{"page_url":"https://bs.wikipedia.org/wiki/Abdullah_bin_Abdulaziz_al-Saud","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Abdullah_of_Saudi_Arabia.jpg","page_title":"Abdullah bin Abdulaziz al-Saud","context_page_description":"Abdullah bin Abdulaziz al-Saud, bio je kralj Saudijske Arabije. Na prijestolju je 1. augusta 2005. naslijedio polubrata Fahda.\\nPrethodno, je, kao Krunski princ, vladao Saudijskom Arabijom kao namjesnik od 1998. do 2005. Bio je Komandant Nacionalne garde Saudijske Arabije, od 1962., do novembra 2010.\\nBio je apsolutni monarh i jedan od najmoćnijih ljudi svijeta. Njegovo bogatstvo iznosilo je 23 milijarde američkih dolara.\\nPreminuo je 23. januara 2015. godine.Naslijedio ga je Salman bin Abdulaziz Al Saud."},{"page_url":"https://en.wikipedia.org/wiki/Rubik%27s_Cube","image_url":"https://upload.wikimedia.org/wikipedia/en/b/b2/4-cube_2%5E4_highlighted.png","page_title":"Rubik's Cube","context_page_description":"The Rubik's Cube is a 3-D combination puzzle invented in 1974 by Hungarian sculptor and professor of architecture Ernő Rubik. Originally called the Magic Cube, the puzzle was licensed by Rubik to be sold by Ideal Toy Corp. in 1980 via businessman Tibor Laczi and Seven Towns founder Tom Kremer. Rubik's Cube won the 1980 German Game of the Year special award for Best Puzzle. As of January 2009, 350 million cubes had been sold worldwide, making it the world's top-selling puzzle game. It is widely considered to be the world's best-selling toy.\\nOn the original classic Rubik's Cube, each of the six faces was covered by nine stickers, each of one of six solid colours: white, red, blue, orange, green, and yellow. Some later versions of the cube have been updated to use coloured plastic panels instead, which prevents peeling and fading. In currently sold models, white is opposite yellow, blue is opposite green, and orange is opposite red, and the red, white, and blue are arranged in that order in a clockwise arrangement. On early cubes, the position of the colours varied from cube to cube. An internal pivot mechanism enables each face to turn independently, thus mixing up the colours."},{"page_url":"https://es.wikipedia.org/wiki/Tensi%C3%B3n_circunferencial","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/P_vessel.svg","page_title":"Tensión circunferencial","context_page_description":"La tensión circunferencial es un tipo de esfuerzo mecánico de elementos de forma cilíndrica o esférica, como resultado de una presión interna o externa.\\nUn ejemplo clásico de la tensión circunferencial es la tensión aplicada a las bandas de hierro, o los aros de madera, de un barril. En una recta, cerrada tubería, cualquier fuerza aplicada a la pared del tubo cilíndrico por una presión diferencial en última instancia, dar lugar a tensiones de aro. De manera similar, si la tubería tiene tapones planos finales, cualquier fuerza aplicada a ellos por la presión estática inducirá una perpendicular tensión axial en la pared del tubo mismo. Las secciones finas tienen a menudo insignificantemente pequeña tensión radial, pero modelos precisos de paredes más gruesas, cáscaras cilíndricas, deben tenerse en cuenta tales tensiones."},{"page_url":"https://de.wikipedia.org/wiki/Lunenburg_(Nova_Scotia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Lunenburg_-_NS_-_Lunenburg_Academy_edit.jpg","page_title":"Lunenburg (Nova Scotia)","context_page_description":"Lunenburg ist eine kleine Hafenstadt in Lunenburg County, ca. 90 km von Halifax, der Hauptstadt von Nova Scotia, entfernt. Lunenburg ist Kanadas älteste deutsche Siedlung mit einer langen Fischerei- und Schiffbautradition. Der Stadtkern von Lunenburg mit seiner markanten Holzarchitektur – bunten idyllischen Häusern sowie alten Kapitänsvillen – gehört seit 1995 zum UNESCO-Weltkulturerbe."},{"page_url":"https://tr.wikipedia.org/wiki/Kazak_C%C3%BCzleri","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/%D0%96%D1%83%D0%B7.svg","page_title":"Kazak Cüzleri","context_page_description":"Cüz üç ana Kazak topluluklarının, Kıpçak Obasında kontrol ettikleri alanlara denir. Bu alanların büyük kısmı bugünkü Kazakistan sınırlarını kapsar.\\nBüyük Cüz ya Uysun ordası Güney ve Güneydoğu Kazakistan, kuzeybatı Çin ve Özbekistan'ın bazı bölümlerini kapsar.\\nOrta Cüz veya Argın ordası Orta ve Doğu Kazakistan'ı kapsayan 6 kabileden oluşur.\\nKüçük Cüz veya Alşın ordasıBatı Kazakistan'ı kapsayan 3 kabileden oluşur."},{"page_url":"https://ar.wikipedia.org/wiki/NUPL1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/PBB_GE_NUPL1_204435_at_fs.png","page_title":"NUPL1","context_page_description":"NUPL1‏ هوَ بروتين يُشَفر بواسطة جين NUPL1 في الإنسان."},{"page_url":"https://de.wikipedia.org/wiki/Limnanthaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Limnanthes_douglasii1.jpg","page_title":"Limnanthaceae","context_page_description":"Die Limnanthaceae sind eine Pflanzenfamilie in der Ordnung der Kreuzblütlerartigen."},{"page_url":"https://ast.wikipedia.org/wiki/Phasmatodea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/LeafInsect.jpg","page_title":"Phasmatodea","context_page_description":"Los fásmidos son un orde d'inseutos neópteros, conocíos comúnmente como inseuto palu ya inseutu hoja, mata caballu, palote, mariapalito, por cuenta del so aspeutu corporal; tamién son llamaos Mula del Diañu. Hai descrites casi 3000 especies. Son un grupu especializáu nel camuflaje con colores, formes y comportamientos estraordinarios que los confunden cola vexetación sobre la qu'habiten y de la que s'alimenten.\\nEnte los fásmidos alcuéntrese los inseutos más pesaos y los más grandes. Son hemimetábolos y exopterigotos."},{"page_url":"https://fi.wikipedia.org/wiki/Heart_and_Soul_(elokuva)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Heart_and_Soul.jpg","page_title":"Heart and Soul (elokuva)","context_page_description":"Heart and Soul on vuonna 1917 ensi-iltansa saanut J. Gordon Edwardsin ohjaama yhdysvaltalainen mykkä romanttinen draamaelokuva, jonka pääosissa ovat Theda Bara ja Claire Whitney.\\nAdrian Johnson laati elokuvan käsikirjoituksen H. Rider Haggardin romaanin Jess pohjalta. Heart and Soul kuvattiin sen tuotanto- ja jakeluyhtiön Fox Film Corporationin studioilla New Jerseyn Fort Leessä. Elokuvaa kuvattiin myös Floridan St. Augustinessa. Heart and Soul sai Yhdysvaltain ensi-iltansa 21. toukokuuta vuonna 1917. Elokuva ei ollut yleisö- tai arvostelumenestys, koska elokuvaa pidettiin hyvin epätavanomaisena Bara-elokuvana. Elokuvan oletetaan olevan kadonnut elokuva."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%BD%D0%B0_%D0%93%D1%80%D0%B8%D0%BC%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Christina_Grimmie_11-08-2014_-1_%2815567582930%29.jpg","page_title":"Кристина Грими","context_page_description":"Кристина Виктория Грими е американска певица, известна с участието си в шоуто „The Voice“ по NBC, както и със своите кавъри на известни поп изпълнители в YouTube."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%99%D7%9F_%D7%91%D7%9E%D7%A9%D7%97%D7%A7%D7%99%D7%9D_%D7%94%D7%90%D7%95%D7%9C%D7%99%D7%9E%D7%A4%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Yang_Wei.JPG","page_title":"סין במשחקים האולימפיים","context_page_description":"הרפובליקה העממית של סין השתתפה לראשונה במשחקים האולימפיים באולימפיאדת הלסינקי. לאותה אולימפיאדה, הראשונה מאז סיומה של מלחמת האזרחים הסינית, הוזמנו שתי המדינות שנוצרו בעקבותיה - הרפובליקה העממית של סין והרפובליקה הסינית, והאחרונה העדיפה להחרים אותה. בהמשך, החרימה הרפובליקה העממית את המשחקים, כמחאה על כך שהוועד האולימפי הבינלאומי התיר לרפובליקה הסינית להשתמש בשם הכולל את המילה \\"סין\\". ב-1979 החליט הוועד האולימפי הבינלאומי כי משלחת הרפובליקה הסינית תכונה \\"טאיפיי הסינית\\". החלטה זו גררה חרם בן מספר שנים מצדה של הרפובליקה הסינית, אך סללה את דרכה של הרפובליקה העממית חזרה למשחקים. עם זאת, ב-1980 נטלה חלק רק באולימפיאדת החורף בלייק פלאסיד. את משחקי הקיץ החרימה, הפעם כמחאה על הפלישה הסובייטית לאפגניסטן. מאז אולימפיאדת לוס אנג'לס משתתפת הרפובליקה העממית של סין במשחקים באופן סדיר.\\nמאז שבה סין להשתתף במשחקים, היא הגיע להישגים ספורטיביים גבוהים, ובכל חמש האולימפיאדות שנערכו במאה ה-21 הייתה בין שלוש המדינות המובילות בטבלאות המדליות. בסך הכל, צברה סין במשחקים 546 מדליות, מהן 224 מדליות זהב, והיא מדורגת במקום הרביעי בטבלת המדליות של כל הזמנים, אחרי ארצות הברית, ברית המועצות ובריטניה.\\nבשלושה ענפים מוליכה סין את טבלאות המדליות: טניס שולחן, בדמינטון וטרמפולינה."},{"page_url":"https://de.wikipedia.org/wiki/1937","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Deutsches_Reichsgesetzblatt_37T1_011_0091.jpg","page_title":"1937","context_page_description":"Im Jahr 1937 tobt in Spanien weiterhin der Bürgerkrieg, in den mittlerweile zahlreiche ausländische Mächte direkt oder indirekt eingreifen. Die deutsche Luftwaffe probt mit mehreren kriegsverbrecherischen Luftangriffen wie dem Luftangriff auf Gernika den Einsatz für den von Adolf Hitler bereits geplanten Großen Krieg.\\nIn der Sowjetunion erreicht der Große Terror unter Josef Stalin einen Höhepunkt: In mehreren geheimen Prozessen werden hohe Offiziere verurteilt und hingerichtet. Die „Enthauptung“ der Roten Armee wird sich in den nächsten Jahren für das Land als beinahe fatal herausstellen.\\nIn Asien löst der Zwischenfall an der Marco-Polo-Brücke den Zweiten Japanisch-Chinesischen Krieg aus. Die kaiserliche japanische Armee hat mit den zerstrittenen chinesischen Truppen wenig Schwierigkeiten und besetzt in kurzer Zeit große Teile Chinas, wobei es auch hier zu Kriegsverbrechen wie dem Massaker von Nanking kommt."},{"page_url":"https://en.wikipedia.org/wiki/Cambridgeport,_Cambridge,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Cambridge-3deckers.jpg","page_title":"Cambridgeport, Cambridge, Massachusetts","context_page_description":"Cambridgeport is one of the neighborhoods of Cambridge, Massachusetts. It is bounded by Massachusetts Avenue, the Charles River, the Grand Junction Railroad, and River Street. The neighborhood contains predominantly residential homes, many of the triple decker style common in New England. Central Square, at the northernmost part of Cambridgeport, is an active commercial district and transportation hub, and University Park is a collection of renovated or recently constructed office and apartment buildings. The neighborhood also includes Fort Washington Park, several MIT buildings, and Magazine Beach.\\nThe neighborhood is Area 5 of Cambridge."},{"page_url":"https://fr.wikipedia.org/wiki/Henry_Clarence_Whaite","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/The_Awakening_of_Christian.jpeg","page_title":"Henry Clarence Whaite","context_page_description":"Henry Clarence Whaite est un artiste peintre anglais né en 1828 à Manchester et mort en 1912 au pays de Galles. Il est surtout connu pour ses aquarelles de paysages gallois."},{"page_url":"https://lt.wikipedia.org/wiki/Meryl_Streep","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/ABBA_2008_Av_Daniel_%C3%85hs.jpg","page_title":"Meryl Streep","context_page_description":"Meryl Streep – amerikiečių aktorė. Daugelio kino kritikų laikoma geriausia šių laikų aktore. Vieni žinomesnių jos vaidmenų filmuose „Kramer prieš Kramerį“, „Ir velnias dėvi Prada“, „Mamma Mia!“, „Sofijos pasirinkimas“, „Adaptacija.“, „Medisono grafystės tiltai“. Yra laimėjusi 3 Oskarus. Vieną kaip geriausia antro plano aktorė filme „Kramer prieš Kramerį“, kitus du kaip geriausia aktorė filmuose „Sofijos pasirinkimas“ ir „Geležinė ledi“. Taip pat buvo nominuota 17 Oskaro nominacijų, 26 Auksiniams gaubliams, iš kurių laimėjo 8."},{"page_url":"https://sh.wikipedia.org/wiki/Hark%C3%A1ny","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Hark%C3%A1ny1.jpg","page_title":"Harkány","context_page_description":"Harkány je gradić na jugu Mađarske od 4,219 stanovnika, koji administrativno podpada pod Baranjsku županiju"},{"page_url":"https://ms.wikipedia.org/wiki/Henk_Timmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Henk_Timmer.jpg","page_title":"Henk Timmer","context_page_description":"Hendrik \\"Henk\\" Timmer ialah bekas pemain bola sepak Belanda yang bermain sebagai penjaga gol."},{"page_url":"https://es.wikipedia.org/wiki/Oakwood_(condado_de_Cuyahoga,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Alonzo_Drake_House.jpg","page_title":"Oakwood (condado de Cuyahoga, Ohio)","context_page_description":"Oakwood es una villa ubicada en el condado de Cuyahoga en el estado estadounidense de Ohio. En el Censo de 2010 tenía una población de 3667 habitantes y una densidad poblacional de 411,1 personas por km².​"},{"page_url":"https://ca.wikipedia.org/wiki/Stephen_Bloomer","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Bloomer.JPG","page_title":"Stephen Bloomer","context_page_description":"Stephen Bloomer, més conegut com a Steve Bloomer, fou un futbolista i entrenador de futbol anglès dels anys 1890 i 1900."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Virginia%E2%80%93Highland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/1911_Highland_View.jpg","page_title":"History of Virginia–Highland","context_page_description":"The History of Virginia–Highland, the Intown Atlanta neighborhood, dates back to 1812, when William Zachary bought and built a farm on 202.5 acres of land there. At some point between 1888 and 1890 the Nine-Mile Circle streetcar arrived, making a loop of what are now Ponce de Leon Avenue, North Highland Avenue, Virginia Avenue, and Monroe Drive. Atlantans at first used the line to visit what was then countryside, including Ponce de Leon Springs, but the line also enabled later development in the area. Residential development began as early as 1893 on St. Charles and Greenwood Avenues, must most development took place from 1909 through 1926 — solidly upper-middle class neighborhoods, kept all-white by covenant.\\nVirginia–Highland, like most intown Atlanta neighborhoods, suffered decline starting in the 1960s as residents moved to the suburbs. Less-affluent residents moved in, some single-family houses were turned into apartments, and crime increased. What could have been the death knell for the neighborhood sounded in the mid-1960s, when the Georgia Department of Transportation proposed building Interstate 485 through the area."},{"page_url":"https://es.wikipedia.org/wiki/Jicamarca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/EscudoProvinciaHuarochir%C3%AD.png","page_title":"Jicamarca","context_page_description":"Jilcamarca es una localidad peruana ubicada en el distrito de San Antonio de Chaclla en la provincia de Huarochiri en la región Lima a aproximadamente 3500 metros de altura.\\nLa comunidad campesina comprende 100000 hectáreas y esta dividida entre el Pueblo Matriz y 24 anexos. Hay una confusión, muy generalizada, por la cual se llama a los diversos anexos de esta comunidad como \\"Jicamarca\\"., ubicados dentro de la jurisdicción de diferente distritos. Ejemplo. Anexo 22, Anexo 8\\nEl pueblo Matriz de Jicamarca fue declarado monumento histórico del Perú el 3 de junio de 1991 mediante el R.J.N.º 782-91-INC/T.​\\nDesde tiempos inmemoriales los habitantes de Jicamarca se han dedicado al pastoreo, en la época anterior al período español se dedicaban a la cría de camélidos y desde la época del virreinato peruano se dedicaron a pastorear ganado caprino. Para ello disponen de pastos naturales estacionales en dos sectores complementarios de su vasto ámbito geográfico: Alturas y lomas."},{"page_url":"https://cy.wikipedia.org/wiki/Barbed_brith","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Tricholaema_leucomelas.jpg","page_title":"Barbed brith","context_page_description":"Aderyn a rhywogaeth o adar yw Barbed brith a adnabyddir hefyd gyda'i enw gwyddonol Tricholaema leucomelas; yr enw Saesneg arno yw Pied barbet. Mae'n perthyn i deulu'r Barbedau sydd yn urdd y Piciformes.\\nTalfyrir yr enw Lladin yn aml yn T. leucomelas, sef enw'r rhywogaeth."},{"page_url":"https://simple.wikipedia.org/wiki/Gabe_Newell","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Gabe_Newell_GDC_2010.jpg","page_title":"Gabe Newell","context_page_description":"Gabe Logan Newell is an American businessman. He is the co-founder and managing director of video game development and online distribution company Valve Corporation. He co-founded Valve with fellow Microsoft employee Mike Harrington. He is also known for founding online video gaming distributor Steam.\\nNewell was born in Colorado. He is married to Lisa Newell and has two children. He is a financial supporter of the Democratic Party. He suffered from Fuchs' dystrophy, a congenital disease which affects the cornea, but was cured by two cornea transplants in 2006 and 2007.\\nNewell disliked Windows 8, calling it a \\"catastrophe\\" and a \\"threat to PC gaming\\".\\nNewell's networth is $5.5 billion United States dollars.\\nNewell attended Harvard University in 1980, but dropped out 3 years later to work at Microsoft."},{"page_url":"https://de.wikipedia.org/wiki/Walter_Lehnertz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Krekel_Antik_Walter_Lehnertz.jpg","page_title":"Walter Lehnertz","context_page_description":"Walter Heinrich Lehnertz, Spitzname Waldi, ist ein deutscher Kunst- und Antiquitätenhändler."},{"page_url":"https://ro.wikipedia.org/wiki/Comitatul_Houghton,_Michigan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Copper-24624.jpg","page_title":"Comitatul Houghton, Michigan","context_page_description":"Comitatul Houghton, conform originalului din engleză Hillsdale County, este unul din cele 72 de comitate din statul Michigan, Statele Unite ale Americii.\\nFondat în 1843, organizat în 1846 și reorganizat în 1848, comitatul a fost numit după geologul Douglass Houghton. Comitatul este situat în nordul statului, pe peninsula superioară, la limita cu Lacul Michigan. Sediul comitatului este localitatea omonimă, Houghton.\\nConform datelor furnizate de United States Census Bureau, în urma recensământului din anul 2000, populația fusese 36.628 de locuitori. Comitatul Houghton este parte a zonei micropolitane omonime, Houghton, care include și comitatul vecin, Keweenaw. O parte a comitatului este adesea supranumită Copper Island."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D9%88%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Napata_english2.jpg","page_title":"مروي","context_page_description":"مروي مدينة سودانية تقع في الولاية الشمالية، وهي تختلف عن مدينة مروي القديمة التي توجد بها أهرامات البجراوية. واشتهرت المدينة عندما قررت الحكومة تشييد خزان مروي الضخم هناك في الألفية الجديدة."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%8A%D8%AF%D8%A7%D9%84%D9%8A%D8%A9_%D8%A8%D9%88%D9%83%D8%A7%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Stephen_%28Steve%29_Jackson_-_26837860422.jpg","page_title":"ميدالية بوكانان","context_page_description":"ميدالية بوكانان أو ميدالية بتشانان ‏ هي ميدالية تمنحُها الجمعية الملكية تقديرًا للمساهمة المُتميزة في العلوم الطبية عمومًا. أنشأت الجمعية الملكية هذه الجائزة في عام 1897 تخليدًا لذكرى طبيب لندن وعالم الوبائيات السير جورج بوكانان.\\nكان من المُقرر أن تُمنح الجائزة مرة واحدة كلَ خمسةِ أعوام، ولكن منذُ 1990 مُنحت الميدالية كل عامين، ومنذُ عام 2017 أصبحت تُمنحُ كل عام. كانت الجائزة سابقًا عبارة عن ميدالية فضية مُذهبة، مُرفقٌ معها 1000 جنيه إسترليني بريطاني، وأصبحت الآن ميدالية فضية مُذهبة مُرفقٌ معها 2000 جنيه إسترليني بريطاني.\\nمنذُ إنشائها مُنحت هذه الميدالية 34 مرة، ولم تُمنح للفرد نفسه أكثر من مرة، وذلك خلافًا لميداليات الجمعية الملكية الأخرى مثل القلادة الملكية. مُعظم الفائزين بهذه الميدالية من فئةِ الأطباء أو من المهنيين الطبيين؛ وذلك بسبب معايير الميدالية الخاصة، ويُستثنى من هذا المُهندس فريدريك وارنر والذي فازَ بالميدالية عام 1985 لدورهِ المهم في الحدِ من تلوثِ نهر التمز ولمساهماته الأخرى في تقييم المَخاطر."},{"page_url":"https://sq.wikipedia.org/wiki/%C3%96sterbybruk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/%C3%96sterbybruk_2012_18.JPG","page_title":"Österbybruk","context_page_description":"Österbybruk është qytet në Suedi. Österbybruk ka pasur 2,272 banorë në fund të vitit 2010."},{"page_url":"https://cs.wikipedia.org/wiki/Marie_Hru%C5%A1kov%C3%A1-Rozsypalov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Marie_Hru%C5%A1kov%C3%A1-Rozsypalov%C3%A1%2C_politi%C4%8Dka.png","page_title":"Marie Hrušková-Rozsypalová","context_page_description":"Marie Hrušková-Rozsypalová, byla česká a československá politička Komunistické strany Československa a poúnorová poslankyně Národního shromáždění ČSR."},{"page_url":"https://de.wikipedia.org/wiki/Nueva_Valencia","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Ph_locator_guimaras_nueva_valencia.png","page_title":"Nueva Valencia","context_page_description":"Nueva Valencia ist eine philippinische Stadtgemeinde in der Provinz Guimaras. Sie hat 37.852 Einwohner. In den Gewässern der Gemeinde, im Golf von Panay, liegt der Taklong Island National Marine Reserve, er wurde 1990 gegründet.\\nIm August 2006 kam es zu einer Ölpest, nachdem das Schiff MT Solar 1 ein paar Kilometer vor der Küste sank."},{"page_url":"https://en.wikipedia.org/wiki/Reedley_Hallows","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Magistrate_Courts%2C_Reedley_-_geograph.org.uk_-_230925.jpg","page_title":"Reedley Hallows","context_page_description":"Reedley Hallows or Reedley is a civil parish in the Borough of Pendle in Lancashire, England. It is a suburb of Burnley, and has a population of 1,994, reducing to 1,960 at the 2011 Census.\\nIt is on the Leeds and Liverpool Canal, and the construction of a marina started in January 2008 and is expected to be completed in September. The local railway station, Reedley Hallows Halt on the East Lancashire Line, closed in 1956. The marina, and the site of the railway station, are both outside the current boundary of the parish, and are in an unparished area, which is part of the town of Burnley."},{"page_url":"https://en.wikipedia.org/wiki/Turin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Juventus_v_Real_Madrid%2C_Champions_League%2C_Stadium%2C_Turin%2C_2013.jpg","page_title":"Turin","context_page_description":"Turin is a city and an important business and cultural centre in northern Italy. It is the capital city of Piedmont and of the Metropolitan City of Turin, and was the first Italian capital from 1861 to 1865. The city is located mainly on the western bank of the Po River, in front of Susa Valley, and is surrounded by the western Alpine arch and Superga Hill. The population of the city proper is 875,698 while the population of the urban area is estimated by Eurostat to be 1.7 million inhabitants. The Turin metropolitan area is estimated by the OECD to have a population of 2.2 million.\\nThe city used to be a major European political centre. From 1563, it was the capital of the Duchy of Savoy, then of the Kingdom of Sardinia ruled by the House of Savoy, and the first capital of the Kingdom of Italy from 1861 to 1865. Turin is sometimes called \\"the cradle of Italian liberty\\" for having been the birthplace and home of notable individuals who contributed to the Risorgimento, such as Cavour."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D8%B1%D8%A7%D8%B1%D8%AF_%D8%A3%D9%84%D9%8A%D8%B3%D8%A7%D9%86%D8%AF%D8%B1%D9%8A%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Gerard_Alessandrini.jpg","page_title":"جيرارد أليساندريني","context_page_description":"جيرارد أليساندريني ‏ هو ملحن وكاتب أغاني ومخرج وشاعر أمريكي، ولد في 27 نوفمبر 1953 في بوسطن في الولايات المتحدة."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%84%D0%B5%D1%81_(%D0%BF%D0%B8%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Efes_stout.jpg","page_title":"Эфес (пиво)","context_page_description":"Efes — торговая марка турецкого пива. Принадлежит пивоваренной корпорации Anadolu Efes — лидеру турецкого рынка пива, доля которого в объёмах продаж пива в Турции составляет 89 %. Соответственно, популярнейший сорт пива торговой марки — пильзнер Efes Pilsen является самым продаваемым пивом Турции.\\nПиво торговой марки Efes экспортируется на 60 внешних национальных рынков. Кроме того, пиво Efes производится в ряде зарубежных стран, в которых корпорация Anadolu Efes имеет собственные производственные предприятия, в частности в России, Казахстане, Грузии, Молдавии."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%BE%E0%A6%AC%E0%A6%BE%E0%A6%A8%E0%A7%87%E0%A6%B0_%E0%A6%AC%E0%A7%81%E0%A6%A6%E0%A6%AC%E0%A7%81%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Making_giant_soap_bublles_in_Barcelona_March_2015_%2810%29.JPG","page_title":"সাবানের বুদবুদ","context_page_description":"সাবানের বুদবুদ হল সাবান পানির অত্যন্ত পাতলা আবরন যা বাতাসপূর্ণ চিত্রাভ পৃষ্ঠের ফাঁপা গোলক তৈরি করে। সাবান বুদবুদ, হয় নিজে থেকে বা অন্য বস্তুর সংস্পর্শে ফেটে যাওয়ার আগে সাধারণত কয়েক সেকেন্ড টিকে। এগুলো প্রায়ই ব্যবহার করা হয় শিশুদের জন্য আনন্দ দেয়ার জন্য কিন্তু শিল্পসম্মত ক্রিয়াকাণ্ড এও ব্যবহৃত হয়। কতগুলো বুদবুদ মিলে ফেনা তৈরি করে।\\nযখন বুদবুদে আলো প্রতিফলিত হয়, এতে রঙের পরিবর্তন প্রদর্শিত হয়। বৈশিষ্ট্যমূলক প্রতিসরণের কারণে সামনের ও পিছনের সাবানের পাতলা আবরনে আলোর ব্যতিচারের জন্য অনেকটা রংধনুর মত দেখায়।আবরনের বেধের উপর বিভিন্ন রঙের গঠনমূলক ও ধ্বংসাত্মক ব্যতিচার নির্ভর করে।\\nসাবানের বুদবুদ হল, নূন্যতম তলে জটিল গাণিতিক সমস্যার গাঠনিক উদাহরণ। এগুলোতে দেয়া আয়তনে নূন্যতম পৃষ্ঠতলের ক্ষেত্রফলের আকার ধারন করে। সাবানের আবরন দিয়ে শূন্য গড় বক্রতার একটি প্রকৃত নূন্যতম তল সম্পূর্ণ ভাবে তৈরি করা যায়, যার ভিতরে আর বাইরে সমান চাপ বজায় থাকে। সাবানের বুদবুদ হল বদ্ধ সাবানের আবরণ।এর ভিতরের ও বাইরের চাপের পার্থক্যের জন্য তলের গড় বক্রতা ধ্রুবক।\\n১৮৮৪ সাল থেকে এটা পরিচিত যে একটি গোলাকৃতির সাবানের বুদবুদ"},{"page_url":"https://en.wikipedia.org/wiki/Jim_Towey","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Jim_Towey.jpg","page_title":"Jim Towey","context_page_description":"Harry James Towey II is an American former government official and academic administrator. Towey was appointed secretary of the Florida Department of Health and Rehabilitative Services by Governor Lawton Chiles in 1993, and ousted by the Florida Senate in 1995. He founded Aging with Dignity, a nonprofit advocacy organization for senior citizens, in 1996 and coauthored the end-of-life planning document Five Wishes. He was Director of the White House Office of Faith-Based and Community Initiatives from February 2002 to May 2006. Towey was President of Saint Vincent College from 2006 to 2010 and President and CEO of Ave Maria University from 2011 to 2019."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_tekstiilikuoseista","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Seersucker01.jpg","page_title":"Luettelo tekstiilikuoseista","context_page_description":"Luettelossa kuosi ymmärretään kankaan tai neuleen yleisenä ulkonäkönä ja tuntumana, joka voi johtua yhtä hyvin sidostyypistä, valmistustavasta, materiaalista, väreistä tai kuvioinnista jne. Luetteloon ei ole syytä sisällyttää erilaisia painokangaskuoseja muuta kuin siltä osin kun ne ilmentävät jotakin klassista, nimeltä tunnettua aihetta tai yleistä valmistustekniikkaa."},{"page_url":"https://et.wikipedia.org/wiki/M%C3%B5rdama_raba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/M%C3%B5rdama_raba01.jpg","page_title":"Mõrdama raba","context_page_description":"Mõrdama raba on raba Pärnu maakonnas Põhja-Pärnumaa vallas.\\nRaba territoorium jääb 2007. aastal loodud Mõrdama hoiuala piiridesse.\\nMõrdama raba pindala on umbes 900 hektarit.\\nMõrdama raba paikneb jääjärvede uhutud moreenitasandikul. Raba turbalasundi paksus ulatub kuni 7,5 meetrini.\\nRabas asub rohkelt laukaid ja kaks laugasjärve – põhjapoolne Viluvere järv ja lõunapoolne Mõrdama järv. Veekogude kogupindala on 7,6 ha.\\n19. sajandil kaevati läbi raba kraav, millega ühendati Sauga jõgi ja Hirve peakraav. Kraavi kasutati arvatavalt palkide parvetamiseks.\\nRaba haudelinnustikku pole põhjalikult uuritud, üksikvaatluste tulemusena on teada kahe punaselg-õgija paari pesitsemine 2012. aastal.\\nKaitsealustest taimeliikidest kasvab Mõrdama rabas ainulehine soovalk, Wulfi turbasammal, kuradi-sõrmkäpp, vööthuul-sõrmkäpp, kahelehine käokeel, harilik ungrukold."},{"page_url":"https://id.wikipedia.org/wiki/Menteri_Keuangan_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Steven_Mnuchin_official_portrait.jpg","page_title":"Menteri Keuangan Amerika Serikat","context_page_description":"Daftar Menteri Keuangan Amerika Serikat sebagai berikut:"},{"page_url":"https://nl.wikipedia.org/wiki/Theo_Verlangen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Theo_Verlangen_%281968%29.jpg","page_title":"Theo Verlangen","context_page_description":"Theo Verlangen is een voormalig Nederlands voetballer en voetbalcoach.\\nVerlangen speelde voor ADO Den Haag en Holland Sport. Hij begon als assistent trainer bij Feyenoord. Toen Theo Verlangen in 1977 van Rotterdam naar Groningen kwam als trainer, nam hij onder andere voetballer Peter Houtman mee van Feyenoord. Een van de hoogtepunten die Theo Verlangen behaalde met FC Groningen was het kampioenschap van de Eerste Divisie en de daaraan gekoppelde promotie naar de Eredivisie in 1980. In 1983 werd Theo Verlangen opgevolgd door Han Berger. In totaal zat Theo Verlangen 236 wedstrijden op de bank als coach van FC Groningen.\\nHij woont in Kropswolde."},{"page_url":"https://bs.wikipedia.org/wiki/Brela","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Brela%27s_small_harbour.jpeg","page_title":"Brela","context_page_description":"Brela su naseljeno mjesto i općina u Hrvatskoj, u Splitsko-dalmatinskoj županiji."},{"page_url":"https://de.wikipedia.org/wiki/Ussac","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Corr%C3%A8ze_Ussac_pont_D69_amont.JPG","page_title":"Ussac","context_page_description":"Ussac ist eine französische Gemeinde mit 4169 Einwohnern im Département Corrèze in der Region Nouvelle-Aquitaine. Sie gehört zum Arrondissement Brive-la-Gaillarde sowie zum Kanton Malemort-sur-Corrèze. Ussac ist Mitglied des Gemeindeverbandes Communauté d’agglomération du Bassin de Brive."},{"page_url":"https://en.wikipedia.org/wiki/Tillie_Olsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Tillie_Lerner_in_the_late_1920%27s.jpg","page_title":"Tillie Olsen","context_page_description":"Tillie Lerner Olsen was an American writer associated with the political turmoil of the 1930s and the first generation of American feminists."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%93%D7%91%D7%A8_%D7%94%D7%A6%D7%91%D7%95%D7%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/PtdDesert.jpg","page_title":"המדבר הצבוע","context_page_description":"המדבר הצבוע הוא אזור מדברי בעל נוף בתרונות, המתפרס על שטח של 380 קילומטרים רבועים בצפון אריזונה שבארצות הברית. מדבר אריזונה משתרע מהפארק הלאומי גרנד קניון לכיוון דרום-מזרח ואל עבר הפארק הלאומי פטריפייד פורסט. המדבר הצבוע ממוקם בחלקו הדרומי, צפונית למפגש נהרות פוארקו והקולורדו הקטן. רובו של השטח מוגן ומוגדר כאזור טבע בראשיתי השייך לפארק הלאומי פטריפייד פורסט. שטח מוגן נוסף הוא המדבר הצבוע הקטן שנמצא צפונית לוינסלו. שטח נרחב מהמדבר הצבוע ממוקם בתוך שמורת הנאוואחו. הנאוואחו והעם ההופי חיו באזור לפחות 500 שנים ו-1,000 שנים, בהתאמה.\\nמקור שמו של המדבר ככל הנראה במתיישבים הספרדיים שנהגו לכנותו El Desierto Pintado בשל נופיו הצבעוניים."},{"page_url":"https://et.wikipedia.org/wiki/Aida_t%C3%A4nav_(Tartu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Endine_Thalia_videokino_Tartus_Karlovas_Aleksandri_ja_Aida_t%C3%A4nava_nurgal%2C_vaade_Aida_t%C3%A4nava_poolsele_k%C3%BCljele%2C_22._juuni_2015.jpg","page_title":"Aida tänav (Tartu)","context_page_description":"Aida tänav on tänav Tartus Kesklinna ja Karlova linnaosa piiril.\\nTänav algab Kalevi tänavalt, kulgeb kirdesse, ristub Aleksandri tänavaga ja lõpeb Turu tänaval. Teisel pool Turu tänavat algab Aida tänava vastast Väike-Turu tänav.\\nAida tänava pikkus on 260 meetrit."},{"page_url":"https://en.wikipedia.org/wiki/Karl_Ludwig_Freiherr_von_und_zu_Guttenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/White_Papers%3B_Journals_on_History%2C_Tradition_and_State.jpg","page_title":"Karl Ludwig Freiherr von und zu Guttenberg","context_page_description":"Karl Ludwig Freiherr von und zu Guttenberg was a member of the German anti-Nazi resistance. He was executed in the aftermath of the failure of the 20 July plot to assassinate Adolf Hitler.\\nThe von Guttenberg family originates back to 1149 in Franconia in the southern part of Germany. Karl Ludwig Freiherr von und zu Guttenberg studied law and history in Munich and graduated in 1929. In that year he married Therese, Princess Schwarzenberg. They had two daughters and one son.\\nKarl Ludwig von Guttenberg was a Catholic monarchist who started publishing the White Papers; Journals on History, Tradition and State in 1934. Amongst its authors were Reinhold Schneider, Jochen Klepper, Ulrich von Hassell and Werner Bergengruen. The White Papers soon became an important organ and also a meeting place, through their publishers many various contacts, for the conservative opposition against the Nazi regime under Hitler. Karl Ludwig Freiherr von und zu Guttenberg first introduced Carl Goerdeler and Ulrich von Hassell to each other in 1939.\\nIn 1941, von Guttenberg was ordered to work in counterintelligence at the Foreign Affairs Office in Berlin through the help of Ludwig Beck."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Trostberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Trostberg%2C_Schedling%2C_Pflegerweg_2%2C_1.jpeg","page_title":"Liste der Baudenkmäler in Trostberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Stadt Trostberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://vi.wikipedia.org/wiki/K%C5%99i%C5%BEany","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/K%C5%99i%C5%BEany%2C_kostel_%282%29.jpg","page_title":"Křižany","context_page_description":"Křižany là một làng thuộc huyện Liberec, vùng Liberecký, Cộng hòa Séc."},{"page_url":"https://sv.wikipedia.org/wiki/Groddag%C3%A5rden","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Groddag%C3%A5ren_02.JPG","page_title":"Groddagården","context_page_description":"Groddagården är en gård i Fleringe socken på Gotland.\\nGroddagården ligger på en hed i omedelbar närhet till Fleringe kyrka. Den var tidigare gästgivargård och beboddes under 1800-talet av en spelmanssläkt. Under 1900-talet har gården stått öde under en längre tid, men är numera ett hembygdsmuseum, som drivs av Groddagårdens Förening.\\nGården består av ett trevånings välbevarat bostadshus av kalksten, troligen från första hälften av 1700-talet, samt en flygel i sten en våning från 1800-talet. Bostadshuset är i två våningar med loft. Enligt ett syneinstrument hade ett hus på Grodda 1715 en våning och ett loft, men det är osäkert om syneinstrumentet avser den nuvarande huvudbyggnaden. I bostadshusets nedre plan finns förstuga, kök, sal och ytterligare ett litet rum. I det övre planet en stor sal och tre mindre rum, varav ett kallades Brudkammaren.\\nÅr 1781 övertogs Groddagården av Lars Olofsson, som var den första av ett antal spelmän som satte sin prägel på gästgivargården. Efter honom tog sonen Olof Larson, kallad Grodd-Ole och ansedd som duktig vevliraspelare, över som gästgivare. Yngste sonen Jacob Godman tog över faderns lira, som nu finns på Gotlands länsmuseum."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%9C%D7%92%D7%9C_(%D7%90%D7%95%D7%A4%D7%A0%D7%99%D7%99%D7%9D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Bicycle_wheel_01.jpg","page_title":"גלגל (אופניים)","context_page_description":"באופניים קבועים, בדרך כלל, שני גלגלים בעלי רדיוס זהה. קוטר הגלגל הנהוג באופני מבוגרים הוא \\"26, או \\"29. נשים רוכבות לפעמים עם גלגלים של \\"24. \\"20, או פחות, משמש נוער וילדים. הגלגל האחורי מונע בעזרת תמסורת, במרבית המקרים גלגלי שיניים ושרשרת, אשר הרוכב מסובב בכוח הרגליים, בעזרת דוושות. הגלגל הקדמי מונע בגלל הדחף שיוצר הגלגל האחורי. על הגלגל מורכב צמיג, אשר ייתכן שיהיה עם, או בלי, אבוב."},{"page_url":"https://pt.wikipedia.org/wiki/31_de_mar%C3%A7o","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Sergej_Diaghilev_%281872-1929%29_ritratto_da_Valentin_Aleksandrovich_Serov.jpg","page_title":"31 de março","context_page_description":"31 de março é o 90.º dia do ano no calendário gregoriano. Faltam 275 para acabar o ano."},{"page_url":"https://eu.wikipedia.org/wiki/Anggun","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Anggun%2C_Paris%2C_2015_%28cropped%29.jpg","page_title":"Anggun","context_page_description":"Anggun Cipta Sasmi abeslaria da. 1986ko udan Dunia Aku Punya izeneko abestia kaleratu zuen."},{"page_url":"https://pl.wikipedia.org/wiki/Muzeum_Uniwersytetu_Warszawskiego","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Pa%C5%82ac_Tyszkiewicz%C3%B3w-Potockich_w_Warszawie_2019a.jpg","page_title":"Muzeum Uniwersytetu Warszawskiego","context_page_description":"Muzeum Uniwersytetu Warszawskiego – muzeum uczelniane w Warszawie, którego celem jest gromadzenie, opracowywanie i udostępnianie obiektów związanych z dziejami Uniwersytetu Warszawskiego oraz popularyzowanie wiedzy o jego dokonaniach, wykładowcach i absolwentach. Ma siedzibę w pałacu Tyszkiewiczów przy ul. Krakowskie Przedmieście 32."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_der_Stadt_Salzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Stolperstein_f%C3%BCr_Berta_Schmidberger_%28Salzburg%29.jpg","page_title":"Liste der Stolpersteine in der Stadt Salzburg","context_page_description":"Die Liste der Stolpersteine in der Stadt Salzburg enthält die Namen nationalsozialistischer Opfer, an die ein Stolperstein in der Stadt Salzburg erinnert. Die Liste ist nach Stadtteil gruppiert und jeweils alphabetisch nach Familienname geordnet. Die Adresse gibt die Lage der Stolpersteine an. Die Verlegungen werden vom Personenkomitee Stolpersteine Salzburg organisiert."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EC%9D%B8%ED%8A%B8%EB%A3%A8%EC%8B%9C%EC%95%84%EC%9D%98_%EA%B5%AD%EC%9E%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Coat_of_arms_of_Saint_Lucia.svg","page_title":"세인트루시아의 국장","context_page_description":"세인트루시아의 국장은 1979년에 제정되었다.\\n국장 가운데에 그려져 있는 파란색 방패 가운데에는 십자 모양으로 놓여 있는 사탕수수로 만든 두 개의 막대기가 그려져 있다.\\n방패 왼쪽 상단과 오른쪽 하단에는 튜더 왕가의 장미 문양이 장식되어 있으며, 방패 오른쪽 상단과 왼쪽 하단에는 금색 백합 문양이 장식되어 있다.\\n방패 위쪽에는 투구와 발판, 횃불이 그려져 있으며, 방패 양쪽에는 세인트루시아의 국조인 두 마리의 세인트루시아 앵무새가 그려져 있다.\\n장미 문양은 영국의 상징이며, 백합 문양은 프랑스의 상징이다. 발판은 아프리카를, 횃불은 진보를 향한 작은 길을 밝히는 봉화를 의미한다.\\n국장 아래쪽에 있는 리본에는 세인트루시아의 나라 표어인 \\"국토, 국민, 빛\\" 이라는 문구가 영어로 쓰여 있다."},{"page_url":"https://ca.wikipedia.org/wiki/Ha%C4%8Dava","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Coat_of_arms_of_Ha%C4%8Dava.png","page_title":"Hačava","context_page_description":"Hačava és un poble d'Eslovàquia. Es troba a la regió de Košice."},{"page_url":"https://eo.wikipedia.org/wiki/Hindia_kormorano","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Indian_Cormorant_%28Br.%29_I_IMG_8092.jpg","page_title":"Hindia kormorano","context_page_description":"La Brunkola kormorano, Hindia kormorano aŭ Hindia tufkormorano estas birdospecio membro de la familio de kormoranoj. Ĝi troviĝas ĉefe ĉe la internaj akvoj de la Hindia Subkontinento sed etende okcidenten al Sind kaj orienten al Tajlando kaj Kamboĝo. Ĝi estas gregema specio kiu povas esti facile distingata el la similgranda Eta kormorano pro siaj bluaj irisoj, malgranda kapo kun dekliva frunto kaj longa mallarĝa beko kiu finas per hokoforma pinto."},{"page_url":"https://fr.wikipedia.org/wiki/Jinotega_(Nicaragua)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Apanaslake.jpg","page_title":"Jinotega (Nicaragua)","context_page_description":"Jinotega, capitale du département de Jinotega, est une ville du Nicaragua située sur la route panaméricaine à 142 km au nord de Managua la capitale du pays.\\nLa municipalité de Jinotega a une population de 136 342 habitants en 2017 et une superficie de 880,34 km², soit une densité de 154,9. Elle est divisée en 6 districts dans la zone urbaine avec 59 quartiers et 6 districts dans la zone rurale avec 112 communautés.\\nLa ville de Jinotega, surnommée \\"Las Brumas\\" à cause de sa situation dans une cuvette montagneuse, est la capitale du département avec une population urbaine de 53 265 habitants en 2017. Elle est située dans une vallée à une altitude moyenne de 1 004 m, au climat frais, avec une température moyenne de 25°C.\\nLa fondation de la ville remonte au XVIIᵉ siècle. Sa cathédrale baroque fut construite en 1952 et compte une importante collection d'œuvres d'art religieuses.\\nDurant la période de guerre civile contre les contras, les montagnes environnantes furent l'objet de combats intenses."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AB%E0%A6%BF%E0%A6%B2%E0%A6%BF%E0%A6%AA_%E0%A6%B2%E0%A7%87%E0%A6%A8%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Phillipp_Lenard_in_1900.jpg","page_title":"ফিলিপ লেনার্ড","context_page_description":"ফিলিপ এডুয়ার্ড আন্টন ফন লেনার্ড বিখ্যাত হাঙ্গেরীয়-জার্মান পদার্থবিজ্ঞানী। তিনি ১৯০৫ সালে ক্যাথোড রশ্মির উপর বিশেষ গবেষণা এবং এদের অনেকগুলো বৈশিষ্ট্য আবিষ্কার করার জন্য পদার্থবিজ্ঞানে নোবেল পুরস্কার লাভ করেন।"},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BD%CE%B4%CF%81%CF%8C%CE%BD%CE%B9%CE%BA%CE%BF%CF%82_%CE%93%CE%84_%CE%A0%CE%B1%CE%BB%CE%B1%CE%B9%CE%BF%CE%BB%CF%8C%CE%B3%CE%BF%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Meister_der_Schriften_des_Johannes_VI._Cantacuzemos_001.jpg","page_title":"Ανδρόνικος Γ΄ Παλαιολόγος","context_page_description":"Ο Ανδρόνικος Γ΄ Παλαιολόγος ήταν Βυζαντινός αυτοκράτορας από το 1328 έως το 1341. Γεννημένος ως Ἀνδρόνικος Δούκας Ἄγγελος Κομνηνός Παλαιολόγος, ήταν γιος του Μιχαήλ Θ' του Παλαιολόγου και της Ρίτας της Αρμενίας."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D9%8A%D8%B7_%D8%A7%D9%84%D9%86%D8%B5%D8%A7%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Province_De_Damiette.jpg","page_title":"غيط النصارى","context_page_description":"شط غيط النصارى ويقال له غيط النصارى أصله من توابع ناحية شطوط دمياط وفي سنة 1872 فصل عنها من الوجهة الإدارية وفي سنة 1936 صدر قرار بفصله عنها من الوجهة المالية وبذلك أصبح شط غيط النصارى ناحية قائمة بذاتها."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%A4%EC%A7%80%EB%A6%AC_%EC%97%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/JR_Tajiri_sta_001.jpg","page_title":"다지리 역","context_page_description":"다지리 역은 일본 미야기현 오사키시에 있는 동일본 여객철도 도호쿠 본선의 역이다. 단선 2면 2선의 구조를 지닌 지상역이다."},{"page_url":"https://en.wikipedia.org/wiki/11th_Division_(Spain)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/GCE_frente_en_feb_1939.svg","page_title":"11th Division (Spain)","context_page_description":"The 11th Division was a division of the Spanish Republican Army in the Spanish Civil War. It was formed in January 1937 in Madrid beginning with the 1st Mixed Brigade which in turn had originated in the Fifth Regiment.\\nNicknamed División Líster, it would become one of the elite divisions, as well as one of the most battle-hardened formations, of the Spanish Republican Armed Forces."},{"page_url":"https://no.wikipedia.org/wiki/Volkswagen_Jetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/2019_Volkswagen_Jetta_1.4L_rear_3.22.19.jpg","page_title":"Volkswagen Jetta","context_page_description":"Volkswagen Jetta er en kompaktbil av tyske Volkswagen lansert i 1979.\\nBilen viste seg å passe godt for det amerikanske markedet og der har den hett Jetta hele tiden."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BB%D1%83%D0%BA%D0%BA%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Flag_of_South_Moluccas.svg","page_title":"Молуккские острова","context_page_description":"Молу́ккские острова́, также известные как Острова́ пря́ностей — индонезийская группа островов между Сулавеси и Новой Гвинеей, к северу от острова Тимор. Находятся на плите Хальмахера и в зоне столкновения с плитой Молуккского моря. Территория островов — 74 505 км², население — 2,5 миллиона жителей.\\nИсторически острова получили название Острова пряностей от китайцев и европейцев, однако главным образом это название относится к небольшим вулканическим островам архипелага Банда, где выращивается мускатный орех. Кроме того, такое же название получил остров Гренада. Помимо этого, то же название используют и для других островов, на которых выращивают пряности, в частности, для архипелага Занзибар у берегов Восточной Африки.\\nЭтимология названия региона Молуккские острова восходит к арабскому Джазират аль-Мулук, как называли его купцы с Ближнего Востока."},{"page_url":"https://sl.wikipedia.org/wiki/Obdobje_Asuka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Dragon_head_Pitcher_former_Horyuji.JPG","page_title":"Obdobje Asuka","context_page_description":"Obdobje Asuka je obdobje v japonski zgodovini med leti 538 in 710, čeprav se začetek obdobja lahko prekriva s predhodnim Obdobjem Kofun. Vladavina Jamato se je v obdobju zelo razvila. Imenuje se po območju Asuka, 25 kilometrov južno od sodobnega mesta Nara.\\nZa obdobje je značilna pomembna umetniška, družbena in politična preobrazba z izvorom v koncu Obdobja Kofun, na katero vpliva predvsem prihod budizma s Kitajske, ki pomeni veliko spremembo v japonski družbi. Ime države se spremeni iz Va v Nihon."},{"page_url":"https://en.wikipedia.org/wiki/Architecture_of_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Hospital_de_Maudes_%28Madrid%29_02.jpg","page_title":"Architecture of Madrid","context_page_description":"The architecture of Madrid has preserved the look and feel of many of its historic neighbourhoods and streets, even though Madrid possesses a modern infrastructure. Its landmarks include the Royal Palace of Madrid, the Royal Theatre with its restored 1850 Opera House, the Buen Retiro Park, the 19th-century National Library building containing some of Spain's historical archives, a large number of national museums, and the Golden Triangle of Art located along the Paseo del Prado and comprising three art museums: Prado Museum, the Reina Sofía Museum, and the Thyssen-Bornemisza Museum, which completes the shortcomings of the other two museums. Cibeles Palace and Fountain have become the monument symbol of the city.\\nThe architecture of Madrid reflects a number of styles from various historical periods."},{"page_url":"https://de.wikipedia.org/wiki/1897","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Petit_Journal_Ranavalona_III_in_exile_in_Algiers.jpg","page_title":"1897","context_page_description":"1. Januar: Adolf Deucher wird zum zweiten Mal Schweizer Bundespräsident.\\n28. Januar: In Österreich-Ungarn wird das Patentgesetz erlassen. Es löst die Regelungen in Kaiserlichen Patenten ab, welche bisher Schutzrechte für Erfindungen gewährten.\\nApril bis November: Die Badeni-Krise in der Habsburger-Monarchie offenbart die Schwierigkeiten des österreichisch-tschechischen Ausgleichs:\\n5. April: In der Sprachenverordnung für Böhmen und Mähren wird die doppelsprachige Amtsführung festgelegt. Der Protest dagegen gilt als Beginn der deutschnationalen Los-von-Rom-Bewegung.\\n28. November: Nach Krawallen in Prag und Wien kommt es zum Sturz des Ministerpräsidenten Kasimir Felix Badeni.\\n7. April: Die von der Megali Idea beeinflusste Weigerung Griechenlands, einem Ultimatum des Osmanischen Reichs auf Rückzug seiner am 15. Februar auf der Insel Kreta gelandeten Truppen nachzugeben, bewirkt den Türkisch-Griechischen Krieg.\\n4. Dezember: Durch einen Friedensvertrag endet der Türkisch-Griechische Krieg. Kreta erhält weitgehende Autonomie."},{"page_url":"https://fr.wikipedia.org/wiki/Abbaye_Notre-Dame_de_Boscodon","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/AbbayeBoscodon.JPG","page_title":"Abbaye Notre-Dame de Boscodon","context_page_description":"L'abbaye Notre-Dame de Boscodon est une abbaye du XIIᵉ siècle, devenue bénédictine au XVᵉ siècle, et abritant au XXIᵉ siècle la communauté Saint-Dominique. Située dans les Hautes-Alpes, à 1150 m d'altitude, elle est monument historique."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/HK_Victoria_Barracks-1971.jpg","page_title":"Гонконгский парк","context_page_description":"Гонконгский парк — крупный общественный парк, расположенный в Центральном районе Гонконга. Назван по имени острова Гонконг, к которому территориально относится. Площадь — восемь гектаров, открыт для посещения в мае 1991 года, находится под управлением Гонконгского департамента досуга и культуры. Стоимость создания Гонконгского парка составила почти 400 млн долларов. Он гармонично объединяет в себе современный дизайн и объекты, вписанные в природный ландшафт.\\nПарк открыт круглогодично с 6:00 до 23:00, авиарий — с 9:00 до 17:00, вход в парк бесплатный. Парк спроектировала гонконгская архитектурная фирма Wong Tung & Partners, среди других проектов которой — отели MGM Macau и One Central в Макао, жилой район Тхайкусин в Гонконге и деловой комплекс The China World Trade Center в Пекине. Проект парка включал в себя дизайн различных инновационных объектов, построенных на склоне холма, а также сохранение существовавшей растительности и некоторых колониальных строений.\\nНаряду с Коулунским парком и парком Виктория Гонконгский парк входит в тройку самых популярных общественных парков Гонконга среди горожан и туристов."},{"page_url":"https://da.wikipedia.org/wiki/John_Smith%27s_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Huddersfield_002.jpg","page_title":"John Smith's Stadium","context_page_description":"John Smith's Stadium er et fodboldstadion i Huddersfield i England, der er hjemmebane for Premier league-klubben Huddersfield Town. Stadionet har plads til 24.500 tilskuere, og alle pladser er siddepladser. Det blev indviet i 1994 under navnet Alfred McAlpine Stadium, men af sponsorhensyn blev der skiftet til det nuværende navn i 2004."},{"page_url":"https://en.wikipedia.org/wiki/Cutting_Boulevard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Cuttingbl.jpg","page_title":"Cutting Boulevard","context_page_description":"Cutting Boulevard is a major east-west arterial trunk road in the city of Richmond, California."},{"page_url":"https://hr.wikipedia.org/wiki/G%C3%B6teborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/GoteborgsOperan.jpg","page_title":"Göteborg","context_page_description":"Göteborg je drugi po veličini grad u Švedskoj. Nalazi se na zapadnoj obali, u županiji Västra Götaland. Broj stanovnika iznosi oko 485 000 u samome gradu, te oko 879 000 u metropolitanskom području. S gotovo 50 000 studenta, Göteborg je najveći sveučilišni grad u Skandinaviji.\\nGradom protječe rijeka Göta Älv koja se u samome gradu ulijeva u Kattegat. Göta älv dijeli grad na dva dijela; južni, koji se nalazi na kopnu, te sjeverni, smješten na otoku Hisingen. Ušće rijeke pogodno je za luku koja je danas jedna od najvećih u nordijskim zemljama."},{"page_url":"https://fr.wikipedia.org/wiki/Jardins_Butchart","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Fountain_in_Butchart_Gardens%2C_Victoria.JPG","page_title":"Jardins Butchart","context_page_description":"Les Jardins Butchart sont un groupement de jardins d'exposition florale situés à Brentwood Bay, en Colombie-Britannique, sur l'île de Vancouver au Canada. C'est une attraction touristique internationalement connue qui reçoit plus d'un million de visiteurs chaque année. Un service de cuisine de haute qualité et des animations complètent les jardins sculptés."},{"page_url":"https://en.wikipedia.org/wiki/Cooking_apple","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/006grav.ylo.jpg","page_title":"Cooking apple","context_page_description":"A cooking apple, culinary apple, or apple is an apple that is used primarily for cooking, as opposed to a dessert apple, which is eaten raw. Cooking apples are generally larger, and can be tarter than dessert varieties. Some varieties have a firm flesh that does not break down much when cooked. Culinary varieties with a high acid content produce froth when cooked, which is desirable for some recipes. Britain grows a large range of apples specifically for cooking. Worldwide, dual-purpose varieties are more widely grown.\\nApples can be cooked down into sauce, apple butter, or fruit preserves. They can be baked in an oven and served with custard, and made into pies or apple crumble. In the UK roast pork is commonly served with cold apple sauce made from boiled and mashed apples. Bramley apple is by far the most popular cooking apple in the United Kingdom, while Granny Smith may be the most popular in the United States and Australia.\\nA baked apple is baked in an oven until it has become soft. The core is usually removed and the resulting cavity stuffed with fruits, brown sugar, raisins, or cinnamon, and sometimes a liquor such as brandy. An apple dumpling adds a pastry crust."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%8E%E0%AE%B0%E0%AF%8D%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%BE_%E0%AE%AE%E0%AF%81%E0%AE%B2%E0%AF%8D%E0%AE%B2%E0%AE%B0%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Herta_Muller.jpg","page_title":"எர்ட்டா முல்லர்","context_page_description":"எர்ட்டா முல்லர் என்பவர் ருமேனியாவில் பிறந்த செருமனிய புதின எழுத்தாளர், கவிஞர், கட்டுரையாளர். இவர் ருமேனியாவின் கம்யூனிச அரசாட்சியைப் பற்றியும் அக்காலத்தில் மக்களின் வாழ்க்கை நிலை பற்றியும் எழுதியமைக்காக அறியப்படுகிறார். இவருக்கு 2009 ஆம் ஆண்டுக்கான இலக்கியத்துக்கான நோபல் பரிசு கிடைத்தது."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E6%9D%BE%E5%B3%B6%E5%B8%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Katuuragawakomatusima.jpg","page_title":"小松島市","context_page_description":"小松島市は、徳島県のおよそ東部中央、紀伊水道沿岸に位置する市である。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D1%81%D0%BA%D0%BB%D0%B0%D0%B4_%D0%BD%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%BD%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ukraine_ethnic_1897.png","page_title":"Національний склад населення України","context_page_description":"Характерною особливістю етнічної історії України є формування багатоетнічного складу її населення. Воно на всіх етапах історичного розвитку вбирало іншоетнічні субстрати, однак механізм цього процесу у різні часові періоди був різним. Можна виділити три основних етапи формування національного складу. Перший із них, що стосується періоду існування археологічних культур, відтворює процес етнокультурної взаємодії, нерідко об'єднуючи полярні культури, скажімо, землеробську, скотарську, культуру осілих і культуру кочових племен.\\nДругий етап пов'язаний з Великим переселенням народів IV—IX ст. — гунів, готів, аварів, «аспарухових болгар» на Балкани і Закарпаття, угрів-мадярів у Дунайську низовину, норвезьких вікінгів-русів у Середню Наддніпрянщину. Велике переміщення народів, що проходило через територію України, залишило відмітини на її етнічному ґрунті. Вони виявилися або в мовних компонентах, у запозиченні деяких елементів матеріальної та духовної культури, або у поповненні слов'янсько-українського населення іншоетнічними субстратами. Ці субстрати стали складовими саме слов'янської етнічності, розчинившись у її системі, відносно рельєфніше відтінивши слов'янську спільність."},{"page_url":"https://sl.wikipedia.org/wiki/Alzacija","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Strasbourg_Communaut%C3%A9.png","page_title":"Alzacija","context_page_description":"Alzacija je bila do leta 2015severovzhodna francoska regija ob meji z Nemčijo in Švico. Njeno glavno in hkrati največje mesto je Strasbourg.\\nPokrajinsko Alzacijo običajno opisujejo kot območje med Vogezi in Renom. Politične meje, ki določajo Alzacijo, so se v vsej zgodovini večkrat menjale. Zgodovinski pomen imajo predvsem vojvodstvo Alzacija, dve deželni grofiji v Alzaciji v Svetem rimskem cesarstvu nemške narodnosti in prva francoska pokrajina Alzacija. Sedanje meje departmajev Bas-Rhin in Haut-Rhin temeljijo na mejah iz obdobja francoske revolucije in frankfurtskega miru 1871.\\nOd 17. stoletja dalje je Alzacija večkrat spremenila politično pripadnost, podajali sta si jo Francija in Nemčija oziroma njuni predhodniki.\\nZ 8280 km² je Alzacija najmanjša regija po površini na francoskem ozemlju in je 1. januarja 2013 imela 1,868.183 prebivalcev."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8D%97%E4%BA%AC%E5%BE%A9%E8%88%88%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/%E8%87%BA%E5%8C%97%E6%8D%B7%E9%81%8B%E5%8D%97%E4%BA%AC%E5%BE%A9%E8%88%88%E7%AB%99%E5%87%BA%E5%8F%A31.jpg","page_title":"南京復興站","context_page_description":"南京复兴站位于中华民国台北市中山区朱厝仑、松山区中仑交界处，为台北捷运文湖线与松山新店线交会的捷运车站。"},{"page_url":"https://ro.wikipedia.org/wiki/Garchizy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/054_Garchizy_%28_58600_%29.JPG","page_title":"Garchizy","context_page_description":"Garchizy este o comună în departamentul Nièvre din centrul Franței. În 2009 avea o populație de 3.698 de locuitori."},{"page_url":"https://jv.wikipedia.org/wiki/Rahwana","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/COLLECTIE_TROPENMUSEUM_Wajangfiguur_van_perkament_voorstellende_Dasamuka_TMnr_21-3.jpg","page_title":"Rahwana","context_page_description":"Rahwana iku salah sijiné paraga ing wiracarita Ramayana. Prabu DasamukaDasamuka iya Rahwana iku putrané mbarep Resi Wisrawa lan Dèwi Sukesi, putriné Prabu Sumali, nata ing AlengkaAlengka."},{"page_url":"https://fi.wikipedia.org/wiki/Jimmie_Rodgers","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Jimmie_Rodgers.jpg","page_title":"Jimmie Rodgers","context_page_description":"James Charles ”Jimmie” Rodgers oli yhdysvaltalainen countrymusiikin alalla vaikuttanut laulaja-lauluntekijä, joka saavutti mainetta 1900-luvun alkupuolella rytmikkäällä jodlaamisellaan. Rodgersista kehittyi eräs kantrimusiikin supertähdistä ja edelläkävijöistä, joka tunnettin myös nimillä ”The Singing Brakeman”, ”The Blue Yodeler” ja ”The Father of Country Music”."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B0%D1%82-%D0%BA%D1%83%D0%BB%D0%B0_(%D0%A1%D0%B2%D0%B5%D1%82%D0%B8_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%E2%80%9C_%D0%BE%D0%B4_%D0%A1%D0%B2%D0%B5%D1%82%D0%B8_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B5_%2817%29.JPG","page_title":"Саат-кула (Свети Николе)","context_page_description":"Саат-кулата во Свети Николе — времемерно здание во градот Свети Николе.\\nСветиниколската саат-кула е сместена во најважниот дел на градот, веднаш до црквата „Св. Никола“. Не е познато кога е изградена, но се претпоставува дека е изградена во првата половина на XIX век, кога била изградена и самата црква."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%B8%D1%82%D0%B5%D0%BB%D0%B5%D0%B9%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Triteleia_grandiflora_%283625584917%29.jpg","page_title":"Трителейя","context_page_description":"Трителейя — род многолетних травянистых клубнелуковичных растений подсемейства Brodiaeoideae семейства Спаржевые. Иногда этот род помещается в семейства Луковые, Лилейные и Themidaceae.\\nРяд видов трителейи выращивают как декоративные садовые растения."},{"page_url":"https://ca.wikipedia.org/wiki/Sent_Jurv%C3%A8va","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Sainte_Genevi%C3%A8ve_sur_Argence%2C_Aveyron%2C_France.jpg","page_title":"Sent Jurvèva","context_page_description":"Sant Jurvèva és un municipi francès, situat al departament de l'Avairon i a la regió d'Occitània."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A5%A5%E5%B0%94%E7%99%BB%E5%A0%A1%E5%A4%A7%E5%85%AC%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/German_Empire_-_Oldenburg_%281871%29.svg","page_title":"奥尔登堡大公国","context_page_description":"奥尔登堡大公国是十九世纪时德意志邦联、北德意志邦联和德意志帝国的州国之一，其领土由三个独立的部分组成— 包括奥尔登堡、奥伊廷和比尔肯费尔德。大公国的领土大小在德意志诸国中排名第十，在德国联邦参议院中有一票，而在德意志帝国议会中则有三名代表。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%A8%D8%A7%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Spice_in_Brooklyn%2C_2016.jpg","page_title":"سبايس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nسبايس مغنيه من جاميكا."},{"page_url":"https://en.wikipedia.org/wiki/Lealholm","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Lealholm_station2.jpg","page_title":"Lealholm","context_page_description":"Lealholm is a small village in the Glaisdale civil parish of the Borough of Scarborough, in North Yorkshire, England. It is sited at a crossing point of the River Esk, in Eskdale which is within the North York Moors National Park. It is 9.5 miles by road from the nearest town of Whitby, and approximately 27 miles from both Middlesbrough and Scarborough. The village is typical of those found all across the North York Moors which straddle the main through-routes along the valley bottoms. It is mostly built of local stone with pantiled or slate roofs.\\nSettlement around modern-day Lealholm can be traced back to the Domesday Book of 1086, with entries concerning the Manor of Crumbeclive and \\"Lelum\\" at the site of Lealholm Hall, Lealholmside. Lealholmside is a hamlet by Lealholm, and was a popular location with the photographer Francis Meadow Sutcliffe.\\nA honeypot during the summer months, Lealholm is located midway along the Esk valley between the villages of Glaisdale, to the east and Danby to the west. Lealholm is on the route of the Esk valley railway line, which runs from Whitby to Middlesbrough, and is served by Lealholm railway station."},{"page_url":"https://fr.wikipedia.org/wiki/Henry_Lascelles_(4e_comte_de_Harewood)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/4thEarlOfHarewood.jpg","page_title":"Henry Lascelles (4e comte de Harewood)","context_page_description":"Henry Thynne Lascelles, 4ᵉ comte de Harewood, est un pair Britannique et le fils de Henry Lascelles."},{"page_url":"https://de.wikipedia.org/wiki/Phyllodoce_empetriformis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Phyllodoce_empetriformis_9246.JPG","page_title":"Phyllodoce empetriformis","context_page_description":"Phyllodoce empetriformis ist eine Pflanzenart aus der Gattung Moosheiden innerhalb der Familie der Heidekrautgewächse. Sie ist im westlichen Nordamerika verbreitet und wird dort englisch pink mountain-heather oder pink mountain-heath genannt."},{"page_url":"https://hu.wikipedia.org/wiki/Takeminakata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Tateshina03.JPG","page_title":"Takeminakata","context_page_description":"Takeminakata-no-Kami vagy Takeminakata-no-Mikoto sintó istenség, de ismerik még Minakatatomi-no-Kami vagy Takeminakatatomi-no-Mikoto néven is, akinek a neve megjelenik a Kojikiben és származtatott forrásokban. Ezek Izumo tartomány istenének és Asira no Nakacukuni urának, Ókuninusinak egyik fiaként írják le. Miután Takemikazucsi, a mennyei kami által küldött követ legyőzte őt, a Sinano tartománybeli Szuva régióba vonult vissza száműzetésében.\\nIzumoi Takeminakatát általában a Szuvai Nagy Szentély főistenségével azonosítják és leggyakrabban a Szuva mjódzsin jelzővel illetik. A szél, víz és a földművelés istene, valamint a vadászat és a hadviselés pártfogója, mely mivoltában különösen mély vallási tiszteletnek örvendett a középkor alatt számos szamurájcsalád, mint például a Hódzsó vagy a Takeda család részéről. Szuva Mjódzsinról bizonyos értelemben úgy is tartják, hogy ő az őse egyes családoknak, amelyek hajdan papokként szolgáltak a szentélyben, közölük is a Szuva család volt a legelső."},{"page_url":"https://de.wikipedia.org/wiki/Bea_(Teruel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Bea309.JPG","page_title":"Bea (Teruel)","context_page_description":"Bea ist ein Ort und eine Gemeinde mit nur noch 31 Einwohnern im äußersten Norden der Provinz Teruel in der autonomen Region Aragonien im östlichen Zentrum von Spanien. Die Gemeinde gehört zur bevölkerungsarmen Serranía Celtibérica."},{"page_url":"https://en.wikipedia.org/wiki/918th_Aircraft_Control_and_Warning_Squadron","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/918th_Aircraft_Control_and_Warning_Squadron_-_Emblem.png","page_title":"918th Aircraft Control and Warning Squadron","context_page_description":"The 918th Aircraft Control and Warning Squadron is an inactive United States Air Force unit. It was last assigned to the Seattle Air Defense Sector, Air Defense Command, stationed at Baldy Hughes Air Station, British Columbia, Canada. It was inactivated on 1 March 1963.\\nThe unit was a General Surveillance Radar squadron providing for the air defense of North America."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A3%81%E5%88%A4%E5%AE%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Lyman_Poore_Duff.jpg","page_title":"裁判官","context_page_description":"裁判官是指在各種政府體系和司法體系中執行法律的文職人員。在古羅馬，政務官是最高級別的官員之一，可執行司法和行政權力。到現代，在某些司法管轄區，裁判官是在下級法院審理案件的司法人員，通常處理較輕微的案件。在英格蘭和威爾斯，裁判官是指沒有受過正式法律培訓的志願人員，在處理輕微事項方面發揮司法作用。"},{"page_url":"https://it.wikipedia.org/wiki/Parnassius_phoebus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Saxifraga_aizoides_%2813435781513%29.jpg","page_title":"Parnassius phoebus","context_page_description":"La farfalla febo è un lepidottero diurno appartenente alla famiglia Papilionidae, diffuso in Eurasia e Nordamerica.\\nÈ una delle tre specie appartenenti al genere Parnassius presenti in Italia."},{"page_url":"https://fr.wikipedia.org/wiki/Prieur%C3%A9_de_Serrabona","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Prieur%C3%A9_de_Serrabona-_Tribune_-1.jpg","page_title":"Prieuré de Serrabona","context_page_description":"Le prieuré Sainte-Marie de Serrabona, fondé au début du XIᵉ siècle, est situé sur la commune de Boule-d'Amont dans le département français des Pyrénées-Orientales en région Occitanie, à une trentaine de kilomètres de Perpignan, dans le massif des Aspres sur les contreforts orientaux du massif du Canigou.\\nIl est situé à proximité des gorges du Boulès, et demeure encore aujourd'hui d'accès difficile.\\nSon portail Nord, les chapiteaux de son cloître et une très rare tribune en marbre, datée du XIIᵉ siècle forment le plus bel ensemble de sculpture romane du Roussillon."},{"page_url":"https://de.wikipedia.org/wiki/Renette","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Malus_Berlepsch_4521.jpg","page_title":"Renette","context_page_description":"Als Renette oder Reinette bezeichnet man eine Gruppe von Apfelsorten. Diese zeichnen sich durch dichtes, später markiges Fleisch aus, mit meistens kennzeichnendem Geschmack.\\nDie Bezeichnung Renette stammt ursprünglich aus dem Französischen, wobei zunächst die Schreibweisen Rainette und Reinette verwendet wurden. Die ursprüngliche Bedeutung des Wortes ist unklar. Zum einen wird diskutiert, dass sich der Name vom Diminutiv des französischen Wortes reine ableitet und sich auf den Geschmack der Reinetten bezieht, die früher als besonders edle Tafelobstsorten galten. Zum anderen wird auch eine Herleitung vom lateinischen Wort rana vermutet, wobei ein Bezug zu der Schale der Renetten hergestellt wird, die oft durch auffällige Lentizellen gepunktet erscheint.\\nIn der historischen Literatur sind folgende Einteilungen vorgenommen worden:\\nRambourrenetten\\nEinfarbige oder Wachsrenetten\\nBorsdorferrenetten\\nRote Renetten\\nGraue Renetten\\nGoldrenetten\\nDiese Einteilung besitzt heute keine oder nur noch eingeschränkte Gültigkeit. Durch Züchtungsarbeit ab Mitte des 19. Jahrhunderts wurden viele andere Apfelsorten eingekreuzt, so dass dieses System in dieser Form nicht mehr aufrechterhalten werden kann."},{"page_url":"https://nl.wikipedia.org/wiki/Z%C3%A1mrsky","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Z%C3%A1mrsky_vlajka.jpg","page_title":"Zámrsky","context_page_description":"Zámrsky is een Tsjechische gemeente in de regio Olomouc, en maakt deel uit van het district Přerov.\\nZámrsky telt 198 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27Ain","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/%C3%89glise_St_Jean_Baptiste_St_Jean_Reyssouze_26.jpg","page_title":"Liste des monuments historiques de l'Ain","context_page_description":"Cet article recense les monuments historiques de l'Ain, en France.\\nPour les monuments historiques de la commune de Belley, voir la Liste des monuments historiques de Belley\\nPour les monuments historiques de la commune de Bourg-en-Bresse, voir la liste des monuments historiques de Bourg-en-Bresse\\nPour les monuments historiques de la commune de Pérouges, voir la liste des monuments historiques de Pérouges\\nPour les monuments historiques de la commune de Trévoux, voir la liste des monuments historiques de Trévoux"},{"page_url":"https://et.wikipedia.org/wiki/M%C3%B6biuse_leht","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/M%C3%B6bius_strip.jpg","page_title":"Möbiuse leht","context_page_description":"Möbiuse leht on pind, millel on ainult üks külg ja üks serv. Selle avastasid sõltumatult August Ferdinand Möbius ja Johann Benedict Listing 1858. aastal.\\nMöbiuse lehte on kerge luua, võttes pabeririba, käänates ühe otsa 180° ümber ja liimides otsad kokku.\\nKui Möbiuse leht piki keskjoont kaheks lõigata, saame ühe tavalise võru, millel on kaks 180° pööret. Selle uuesti kaheks lõigates saame kaks võru, mis on üksteisega seotud.\\nMöbiuse lehe Euleri karakteristik on null."},{"page_url":"https://cs.wikipedia.org/wiki/Alfa_Romeo_Giulietta_Sprint_Speciale","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/SprintSpecial.jpg","page_title":"Alfa Romeo Giulietta Sprint Speciale","context_page_description":"Alfa Romeo Giulietta Sprint Speciale a Alfa Romeo Giulia Sprint Speciale jsou malé sportovní vozy vyráběné italskou automobilkou Alfa Romeo v letech 1959 až 1966, známé též pod zkráceným označením Alfa Romeo Giulietta SS a Alfa Romeo Giulia SS."},{"page_url":"https://pt.wikipedia.org/wiki/Piotr_Wi%C4%99cek","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Piotr_Wi%C4%99cek.jpg","page_title":"Piotr Więcek","context_page_description":"Piotr Więcek - piloto de drifting polonês, atualmente na corrida de Worthouse Drift Team."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%B5%E3%82%AB_(%E3%83%8B%E3%83%A5%E3%83%BC%E3%83%A8%E3%83%BC%E3%82%AF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Ithaca_Falls001.jpg","page_title":"イサカ (ニューヨーク州)","context_page_description":"イサカは、アメリカ合衆国ニューヨーク州中部トンプキンス郡にある都市。人口は29,287人。都市圏では100,135人を数える。同市にはアイビー・リーグの1つに名を連ねるコーネル大学をはじめ、イサカ大学、ニューヨーク州立大学コートランド校などがキャンパスを構える学術都市として知られている。また、市内や周辺には公園や遊歩道、森林など自然景観の美しい場所も多い。\\nイサカはフィンガー・レイクス地方と呼ばれる、ニューヨーク州の中では田舎とされる地域に位置している。ニューヨーク市からは約400km離れている。最も近くにある州の主要都市はシラキュース市で、車で約1時間ほどである。\\nなお、「イサカ」という地名はイサカ都市圏の中心となるイサカ市とその周囲を取り囲むイサカ町の両方を指す。この項目においては、主にイサカ市について述べる。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D0%B5%D0%B1%D1%96%D0%B3%D0%B4_(%D0%BA%D0%B0%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/T%C3%B6llsj%C3%B6-solviken.jpg","page_title":"Болебігд (камуна)","context_page_description":"Камуна Болебігд — адміністрацыйна-тэрытарыяльная адзінка мясцовага самакіравання, якая знаходзіцца ў лене Вестра-Гёталанд у паўднёва-заходняй Швецыі.\\nБолебігд 239-ая па памеры тэрыторыі камуна Швецыі. Адміністрацыйны цэнтр камуны — горад Болебігд."},{"page_url":"https://de.wikipedia.org/wiki/Dolina_Kasprowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Zawrat_Kasprowy_T73.jpg","page_title":"Dolina Kasprowa","context_page_description":"Die eiszeitlich durch Gletscher geformte Dolina Kasprowa ist ein Tal in der polnischen Westtatra in der Woiwodschaft Kleinpolen. Es befindet sich auf dem Gemeindegebiet von Zakopane im Powiat Tatrzański."},{"page_url":"https://fr.wikipedia.org/wiki/Cha%C3%AEne_haute-fid%C3%A9lit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Wieza_technics_2007-01.JPG","page_title":"Chaîne haute-fidélité","context_page_description":"Une chaîne haute-fidélité est un ensemble d'éléments électroniques et acoustiques destinés à la restitution de sources sonores de qualité conforme aux normes Hi-Fi."},{"page_url":"https://de.wikipedia.org/wiki/Kerry_Woollen_Mills","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Kerry_Woollen_Mills_16.jpg","page_title":"Kerry Woollen Mills","context_page_description":"Die Kerry Woollen Mills sind eine historische Woll-Spinnerei und Weberei am Ring of Kerry in Irland."},{"page_url":"https://en.wikipedia.org/wiki/Erlangen-H%C3%B6chstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/M%C3%B6hrendorf_Wasserr%C3%A4der_Schmiedsrad.jpg","page_title":"Erlangen-Höchstadt","context_page_description":"Erlangen-Höchstadt is a Landkreis in Bavaria, Germany. It is bounded by the districts of Fürth, Neustadt-Bad Windsheim, Bamberg, Forchheim and Nürnberger Land, and by the cities of Nuremberg and Erlangen. The city of Erlangen is not part of the district, but nonetheless its administrative seat."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%9A%E1%83%9D%E1%83%9C%E1%83%93%E1%83%9D%E1%83%9C%E1%83%98%E1%83%A8_%E1%83%B0%E1%83%98%E1%83%97%E1%83%A0%E1%83%9D%E1%83%A3%E1%83%A8_%E1%83%90%E1%83%94%E1%83%A0%E1%83%9D%E1%83%9E%E1%83%9D%E1%83%A0%E1%83%A2%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/LHR_Destinations.svg","page_title":"ლონდონიშ ჰითროუშ აეროპორტი","context_page_description":"ლონდონიშ ჰითროუშ აეროპორტი, ჰითროუ — ლონდონიშ უდიდაში ოერეფოშქაშე აეროპორტი. იდვალუაფუ ლონდონიშ ბჟადალშე 24 კმ-იშ გოძვენას. იკოროცხუ მაჟირა გინოხარგელი ომაშარალე აეროპორტო მოსოფელს, დო მაართათ - ევროპას. აეროპორტი იკათუანს 5 ომაშარალე ტერმინალს დო ართი საორზოლოს. ეკონია, 5-ა ტერმინალი, 2008 წანაშ 14 მელახის დიაფალი ელისაბედ II-აქ გონწყჷ."},{"page_url":"https://de.wikipedia.org/wiki/Willem-Alexander","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/King_Willem-Alexander_and_Queen_Maxima_on_the_inauguration_2013.jpg","page_title":"Willem-Alexander","context_page_description":"Willem-Alexander, Prinz von Oranien-Nassau, Jonkheer van Amsberg, ist seit dem 30. April 2013 König der Niederlande. Er übernahm das Amt von seiner Mutter Beatrix, die an diesem Tag vom Thron abdankte."},{"page_url":"https://it.wikipedia.org/wiki/James_Marion_Sims","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/JMSims.jpg","page_title":"James Marion Sims","context_page_description":"James Marion Sims è stato un chirurgo statunitense, è considerato il padre della ginecologia statunitense.\\nInfatti è proprio grazie a lui che la moderna chirurgia ginecologica ha avuto inizio, nonostante alcuni metodi da lui adottati furono duramente criticati e tuttora messi in discussione dagli storici moderni. Sims ha usato schiave afroamericane, senza anestesia, come soggetti sperimentali nello sviluppo di innovative tecniche chirurgiche. È stato descritto come \\"un primo esempio di progresso nella professione medica fatta a spese di una popolazione vulnerabile.\\""},{"page_url":"https://de.wikipedia.org/wiki/Statistische_Regionen_in_Slowenien","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Slovenia%2C_Regions_with_Nmbrs_colored_%282015%29.svg","page_title":"Statistische Regionen in Slowenien","context_page_description":"Die statistischen Regionen in Slowenien, slowenisch Statistične regije wurden im Mai 2005 eingeführt. Sie werden bislang nur für statistische Zwecke verwendet. Insgesamt gibt es 12 statistische NUTS-3-Regionen in Slowenien. Sie stellen wohl die zukünftige administrative Gliederung der ersten Ebene dar, die die fünf/sieben historischen Regionen ersetzen soll."},{"page_url":"https://fi.wikipedia.org/wiki/Skyfos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Antikensammlung_Kiel_335.JPG","page_title":"Skyfos","context_page_description":"Skyfos on antiikin aikainen keraaminen juoma-astia. Se tunnetaan vaasien muotona erityisesti kreikkalaisesta keramiikasta."},{"page_url":"https://fi.wikipedia.org/wiki/Kelpo_Gr%C3%B6ndahl","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Kelponpuisto_%2801%29.jpg","page_title":"Kelpo Gröndahl","context_page_description":"Kelpo Olavi Gröndahl oli suomalainen painin olympiavoittaja ja poliitikko. Gröndahl voitti kreikkalais-roomalaisen painin olympiakultaa 87 kg:n sarjassa vuonna 1952 Helsingin kesäolympialaisissa. Urheilu-uransa jälkeen hän toimi SKDL:n kansanedustajana vuosina 1962–1970. Gröndahl asui koko ikänsä Porin Reposaaressa työskennellen satamatyömiehenä, kalastajana ja satamavalvojana. Reposaaren Kuntoa edustanut Gröndahl on Tapio Rautavaaran ja Marjut Roligin ohella kolmas Työväen Urheiluliiton olympiavoittaja."},{"page_url":"https://fr.wikipedia.org/wiki/Salles-de-Villefagnan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Sallesvf_sf.JPG","page_title":"Salles-de-Villefagnan","context_page_description":"Salles-de-Villefagnan est une commune du Sud-Ouest de la France, située dans le département de la Charente."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_V%C3%A4stra_G%C3%B6taland_County","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Kavl%C3%A5s_herrg%C3%A5rd.jpg","page_title":"Listed buildings in Västra Götaland County","context_page_description":"There are 241 listed buildings in Västra Götaland County."},{"page_url":"https://ast.wikipedia.org/wiki/Delroy_Lindo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Delroy_Lindo_cropped.jpg","page_title":"Delroy Lindo","context_page_description":"Delroy Lindo ye un actor d'Estaos Xuníos d'orixe británicu. Foi nomáu al premiu Tony y a los Premios del Sindicatu d'Actores y ganó un Satellite Award. Ye conocíu polos sos papeles como'l Sr. Rose en The Cider House Rules y como Catlett en Get Shorty."},{"page_url":"https://hu.wikipedia.org/wiki/Momoiro_Clover_Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Shrimp_Jump.jpg","page_title":"Momoiro Clover Z","context_page_description":"A Momoiro Clover Z egy japán lányegyüttes, melyet 2008-ban hozott létre az Stardust Promotion. A Momoiro Clover Z öt taggal rendelkezik.\\nAz együttest szokás még Momoclo-nak nevezni."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_teuersten_Gem%C3%A4lde","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Edvard_Munch_-_Pikene_p%C3%A5_broen.jpg","page_title":"Liste der teuersten Gemälde","context_page_description":"Diese Liste der teuersten Gemälde enthält die höchsten Preise, zu denen Werke der Malerei verkauft wurden. Sie weist derzeit Gemälde aus, über die ein Kaufvertrag für mehr als 50 Millionen US-Dollar öffentlich bekannt wurde.\\nDer früheste Verkauf in der Liste ist von 1987. Damals wurde die Rekordsumme 53,9 Millionen US-Dollar für ein Blumen-Bild van Goghs gezahlt. In der zweiten Hälfte der 1980er Jahre erreichten Kunstwerke, speziell Gemälde, immer wieder aufsehenerregend hohe Preise. Waren es bis dahin hauptsächlich die sogenannten Alten Meister, für deren Werke Spitzenbeträge gezahlt worden waren, standen nun vor allem die französischen Impressionisten und die moderne Kunst des frühen 20. Jahrhunderts besonders hoch im Kurs. Diese Hochphase gipfelte im Mai 1990, als der japanische Sammler Saitō Ryōei in New York binnen zweier Tage bei Sotheby’s für über 78 Millionen Dollar Renoirs Tanz im Moulin de la Galette und bei Christie’s für über 82 Millionen Dollar van Goghs Porträt des Dr. Gachet ersteigerte. Danach gingen die Preise wieder zurück. Die allgemeine Rezession Anfang der 1990er Jahre betraf auch den Kunsthandel, und Rekordpreise blieben für einige Jahre aus."},{"page_url":"https://ro.wikipedia.org/wiki/Departamentul_Rocha","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Coat_of_arms_of_Rocha_Department.png","page_title":"Departamentul Rocha","context_page_description":"Departamentul Rocha este un departament din Uruguay aflat în regiunea de est a țării. Se învecinează cu departamentul Maldonado la vest, cu departamentul Lavalleja la nord-vest, cu departamentul Treinta y Tres la nord, în timp ce la nord-est Laguna Merín face parte din granița sa cu Brazilia, iar la capătul sudic al lacului se învecinează și cu extremitatea cea mai sudică a Braziliei, cu orașul Chuy „împărțit” între ambele țări, granița trecând prin principalul său bulevard comercial.\\nRocha are frumuseți naturale precum Cabo Polonio, Valizas, Parcul Național Santa Teresa. Este bine cunoscut pentru stațiunile sale de plajă, precum Punta del Diablo sau La Esmeralda, care se pline de vizitatori în timpul vacanțelor de vară."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Permanent_Representatives_of_Germany_to_NATO","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Edmund_Duckwitz_thumb.jpg","page_title":"List of Permanent Representatives of Germany to NATO","context_page_description":"This List of Permanent Representatives of Germany to NATO includes all permanent representatives of the Federal Republic of Germany to NATO since 1955."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89talement_urbain","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Lotissement_Maule02.jpg","page_title":"Étalement urbain","context_page_description":"L’étalement urbain correspond à la progression des surfaces urbanisées à la périphérie des villes. Cela concerne l'habitat, en grande partie des maisons individuelles, mais aussi de nombreuses entreprises qui nécessitent de grandes surfaces et parmi elles des centres commerciaux. Dans tous ces espaces desservis par la voiture individuelle, une part importante de l'espace utilisé est attribuée aux voies et aux parkings asphaltés, dont les nuisances ont été relevées. Mais surtout, cette grande dépendance à l'égard de la voiture participe à l'augmentation les émissions de gaz à effet de serre.\\nCet étalement urbains pose de nombreuses contraintes aux usagers qui ont fait le choix d'y habiter ou qui sont contraints d'y travailler. Ils dépendent des fluctuations des prix des carburants pour souvent deux véhicules par couple, des longues distances à parcourir jusqu'à leurs différentes activités et des encombrements des voies aux heures de pointe, générant du stress. Mais la démarche des habitants vers ce type de résidence est déterminée par de multiples motivations dont l'étude révèle toute la complexité.\\nEnfin ce type d'habitat effectue une forte pression sur l'environnement."},{"page_url":"https://sv.wikipedia.org/wiki/Avesnelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Avesnelles_%28Nord%2C_Fr%29_mairie.jpg","page_title":"Avesnelles","context_page_description":"Avesnelles är en kommun i departementet Nord i regionen Hauts-de-France i norra Frankrike. Kommunen ligger i kantonen Avesnes-sur-Helpe-Sud som tillhör arrondissementet Avesnes-sur-Helpe. År 2009 hade Avesnelles 2 530 invånare."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%AD%D0%B4%D0%B8%D1%80%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Edirne_Tunca_Bridge_2.JPG","page_title":"Эдирне","context_page_description":"Эдирне бол Туркийн баруун хойд нутгийн хот юм."},{"page_url":"https://nl.wikipedia.org/wiki/Veenwoudsterwal","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Veenwoudsterwal_-_hoofdstraat_%281%29.jpg","page_title":"Veenwoudsterwal","context_page_description":"Veenwoudsterwal is een dorp in de Nederlandse provincie Friesland, gelegen tussen Leeuwarden en Groningen. Het valt gedeeltelijk onder de gemeente Dantumadeel en gedeeltelijk onder de gemeente Tietjerksteradeel.\\nHet dorp wordt ook wel kortweg De Wâl genoemd en vroeger geduid als Diepswal. In 2011 kreeg het de dorpsstatus en kent zo'n 400 inwoners. Omdat het aan beide zijden van de gemeentegrens minder dan 100 adressen telt heeft het geen recht op een eigen postcode, waardoor het nog steeds onder de dorpen Veenwouden en Hardegarijp valt.\\nHet dorp was oorspronkelijk een veenkolonie, mogelijk van doopsgezinden uit Giethoorn. Er was tot 1865 daarom niet alleen sprake van een kleine doopgezinde kerk, maar ook van een sfeer die doet denken aan Giethoorn. Er zijn vele bruggen en bruggetjes die voor vele woningen de enige verbinding vormen met de doorgaande weg. In het dorp bevindt zich onder andere een café en een scheepswerfje."},{"page_url":"https://en.wikipedia.org/wiki/Austrian_walled_towns","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Freistadt_-_Linzertor.JPG","page_title":"Austrian walled towns","context_page_description":"Walled towns in Austria started to appear in the 11th century. Their establishment was closely connected with the development of Austria as a march of the Holy Roman Empire and in particular by the Stauffenberg Emperors and their Marcher Lords, the Babenbergs. In present-day Austria, there are 106 towns or cities that were walled. The walls of Radstadt, Freiburg, Hainburg and Drosendorf survive almost intact, and Austria has some of the most impressive walled towns in Europe.\\nOther cities or towns such as Vienna, Salzburg and St Pölten have had their defences almost completely obliterated. In Austria, the procedure for granting civic status or creating a Stadt was relatively simple. Initially, a local lord or official ministerialis could petition for market rights or Marktrect. At that point, the town would be laid out by a surveyor and it would have been surrounded by an earthen-banked enclosure surmounted with a vertical wooden palisade. Often a stone gatehouse or Tor would be built for the collection of custom dues from traders coming to the market."},{"page_url":"https://en.wikipedia.org/wiki/Key_%26_Peele","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Barack_Obama_and_Keegan-Michael_Key_at_White_House_Correspondents%27_Association_Dinner_2015.jpg","page_title":"Key & Peele","context_page_description":"Key & Peele is an American sketch comedy television series created by Keegan-Michael Key and Jordan Peele that aired on Comedy Central. Both Key and Peele previously worked on Mad TV.\\nEach episode of the show consists mainly of several pre-taped skits starring the two actors. The sketches cover a variety of societal topics, often with a focus on American popular culture, ethnic stereotypes, social awkwardness and race relations. Key & Peele premiered on January 31, 2012 and ended on September 9, 2015, with a total of 53 episodes, over the course of five seasons. A special titled \\"Key & Peele's Super Bowl Special\\" aired on January 30, 2015.\\nKey & Peele won a Peabody Award and two Primetime Emmy Awards and has been nominated for various other awards, including Writers Guild Award, NAACP Image Award and 16 additional Primetime Emmy Awards in various categories."},{"page_url":"https://lt.wikipedia.org/wiki/%C4%8Cuhujivas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Flag_of_Chuhuiv.png","page_title":"Čuhujivas","context_page_description":"Čuhujivas – miestas Charkovo srityje, Ukrainoje. Čuhujivo rajono administracinis centras. 2012 m. duomenimis, mieste gyveno 32 338 gyventojai. Piečiau nuo miesto praeina Charkovo - Balašovo geležinkelio linija."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BA%D1%83%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Steinmarder_%28cropped%29.jpg","page_title":"Каменная куница","context_page_description":"Каменная куница, или белодушка, или куница-белодушка, или горская куница, — хищное млекопитающее из семейства куньих. Является наиболее распространённой куницей в Европе и единственным видом куниц, не боящимся обитать рядом с человеком."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%88%D9%87%D8%A7%D9%86_%D8%AA%D8%B4%D9%88%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Johann_Tschopp.JPG","page_title":"يوهان تشوب","context_page_description":"يوهان تشوب ‏ ولد بتاريخ 1 يوليو 1982 في ساير، هو دراج سويسري."},{"page_url":"https://sl.wikipedia.org/wiki/Milan_Hnili%C4%8Dka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Milan_Hnili%C4%8Dka_Liberec.jpg","page_title":"Milan Hnilička","context_page_description":"Milan Hnilička, češki hokejist, * 25. junij 1973, Litoměřice, Češka.\\nHnilička je kariero začel pri klubu HC Kladno v češkoslovaški ligi. Leta 1991 je bil kot 70. izbran na NHL naboru s strani kluba New York Islanders, v ligi NHL pa je branil za klube New York Rangers, Atlanta Thrashers in Los Angeles Kings. Ob tem je branil še za klube Sparta Praga, HC Liberec in Slavija Praga v češki ligi ter Salavat Julajev Ufa v ruski ligi, ki jo je s klubom osvojil v sezoni 2007/08.\\nZa češkoslovaško reprezentanco je nastopil na Olimpijskih igrah 1992 in Svetovnem prvenstvu 1992, kjer je obakrat osvojil bronasto medaljo, za češko reprezentanco pa na dveh olimpijskih igrah, kjer je osvojil zlato in bronasto medaljo, in sedmih svetovnih prvenstvih, kjer je osvojil tri zlate, eno srebrno in dve bronasti medalji."},{"page_url":"https://fr.wikipedia.org/wiki/Grue_%C3%A0_vapeur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Steam_Cranes_-_geograph.org.uk_-_445452.jpg","page_title":"Grue à vapeur","context_page_description":"Une grue à vapeur est une grue propulsée par une machine à vapeur. Elle peut être fixe ou mobile et, si mobile, elle peut circuler sur voie ferrée, chenille, roues, ou être montée sur une barge. Elle a généralement une chaudière verticale placée à l'arrière de sorte que le poids de la chaudière contrebalance le poids de la flèche et de la charge.\\nElles étaient très communes comme grues ferroviaires de dépannage et plusieurs ont été conservées sur l'heritage railways au Royaume-Uni. Les grues à vapeur ont servi à la construction de la Tour Eiffel."},{"page_url":"https://cs.wikipedia.org/wiki/Nancy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Nancy_Cathedral_BW_2015-07-18_16-31-28.jpg","page_title":"Nancy","context_page_description":"Nancy [nãsi:] je město na východě Francie v departementu Meurthe-et-Moselle a regionu Grand Est. Žije zde přibližně 104 tisíc obyvatel, po Metách je druhým největším městem Lotrinska. Nancy je také pátým největším univerzitním městem Francie. Jeho tři náměstí jsou zapsána na Seznamu světového dědictví UNESCO."},{"page_url":"https://ia.wikipedia.org/wiki/Castor_fiber","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Biber_in_Europa_2003.jpg","page_title":"Castor fiber","context_page_description":"Castor fiber, le castor eurasian, es un specie de castor.\\nPecietta\\nIste articulo es ancora in stato embryonic: illo es un pecietta. Nos te invita cordialmente a completar lo pro meliorar Wikipedia in interlingua."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%D8%A7_%D8%B3%D8%A7%D8%B1%DA%AF%D8%B3%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Nelson_Stepanyan_Yerevan_%2816%29.JPG","page_title":"آرا سارگسیان","context_page_description":"آرا سارگسیان مجسمه‌ساز اهل ارمنستان بود."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%B1%D0%BE%D1%82%D0%B0%D0%BD%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/National_Botanic_Gardens_In_Glasnevin_%28Dublin%29_-_panoramio_%286%29.jpg","page_title":"Ірландський національний ботанічний сад","context_page_description":"Ірландський національний ботанічний сад — ботанічний сад у районі Гласневін міста Дублін. Розташований на березі річки Талька за 5 км від центру Дубліна. Площа саду 19,5 га, загальна площа оранжерей 4 000 м². Ботанічний сад є членом Міжнародної ради ботанічних садів з охорони рослин і має код DBN. Сад був заснований 1795 року Дублінським товариством, за більш ніж 200 років існування саду значно виріс, тут росте 8 290 таксонів рослин, а в гербарії зберігається 660 000 висушених рослин.\\nДиректор ботанічного саду — Метью Джебб, куратор — Пауль Магер."},{"page_url":"https://de.wikipedia.org/wiki/Europ%C3%A4isches_Diplom_f%C3%BCr_gesch%C3%BCtzte_Gebiete","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/%22%D0%9C%D0%B0%D1%80%D0%BC%D1%83%D1%80%D0%BE%D0%B2%D1%96%22_%D0%9C%D0%B0%D1%80%D0%BC%D0%B0%D1%80%D0%BE%D1%81%D0%B8.jpg","page_title":"Europäisches Diplom für geschützte Gebiete","context_page_description":"Das Europäische Diplom für geschützte Gebiete ist eine vom Europarat vergebene Auszeichnung. Der Europarat, der am 5. Mai 1949 gegründet worden ist, beschäftigt sich seit über 40 Jahren mit den Aufgabengebieten des Natur- und Umweltschutzes. Er ist damit eine internationale Organisation, die grenzüberschreitend in den genannten Gebieten arbeitet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D1%81%D0%BB%D0%BE_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8F_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Coronation_Chair_and_Stone_of_Scone.jpg","page_title":"Кресло короля Эдуарда","context_page_description":"Кресло короля Эдуарда, также известное как кресло святого Эдуарда и кресло коронации, — трон, на котором британский монарх восседает во время коронации. Оно стало использоваться в 1296 году королём Эдуардом I, включившим в процесс коронации Шотландский камень — более известный как Скунский камень, — который он захватил у шотландцев, хранивших его в аббатстве Скуне. Названо же кресло было в честь короля Эдуарда Исповедника и находилось в его раке в часовне святого Эдуарда в Вестминстерском аббатстве.\\nС 1308 года все помазанные монархи Англии и Британии сидели в этом кресле в момент их коронации, за исключением королевы Марии I и Марии II. Последний раз кресло использовалось на коронации Елизаветы II в 1953 году.\\nВыполненное в готическом стиле с высокой спинкой, кресло было вырезано в 1297 году из дуба плотником, известным как мастер Уолтер, который получил значительную сумму за свою работу — 100 шиллингов. Четыре позолоченных фигурки львов выполняют функцию ножек кресла; это сравнительно недавно реконструированный элемент, обновлённый в 1727 году. Фигурки заменили аналогичных львов, которые были добавлены к креслу в XVI веке."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B7%D1%83%D0%BC%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9E%D1%81%D0%B8%D0%BF%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/e/ea/%D0%A0%D0%B0%D0%B7%D1%83%D0%BC%D0%BE%D0%B2_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9E%D1%81%D0%B8%D0%BF%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Разумов, Михаил Осипович","context_page_description":"Михаи́л О́сипович Ра́зумов — советский партийный и государственный деятель."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%90%D1%80%D1%83%D0%BD%D0%B0_%D0%98%D1%80%D0%B0%D0%BD%D3%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Aruna_Irani_at_57th_Filmfare_Awards.jpg","page_title":"Аруна Иранӣ","context_page_description":"Аруна Иранӣ — ҳунарпеша ва коргардони ҳинд. Аруна тақрибан дар 500 филми ҳиндӣ, маротҳӣ, кананда ва гуҷаратӣ ҳунарнамоӣ намудааст. Ӯ бисёртар нақшҳои дуюмдараҷаро иҷро мекунад. Ду маротиба ҷоизаи Filmfare Awards - ро дар номинатсияи беҳтарин ҳунарпешаи нақши дуюмдараҷа бурд намудааст."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%86%D1%96_%D0%B2_%D0%86%D0%B7%D1%80%D0%B0%D1%97%D0%BB%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/AgnonCover.jpg","page_title":"Українці в Ізраїлі","context_page_description":"Українська діаспора Ізраїлю — одна з громад на території Ізраїлю, яка сформувалася переважно в новітній час: починаючи від утворення держави Ізраїль і досягаючи свого піку в кінці ХХ століття. Українська діаспора в Ізраїлі в основному складається з єврейських репатріантів із Закарпаття, Одеської, Київської, Дніпропетровської та інших регіонів України, а також етнічних українців, громадян України, які тимчасово перебувають в цій країні унаслідок роботи, навчання і по особистих справах. За даними посольства в Ізраїлі налічується близько 500 тис. вихідців з України єврейського походження, в тому числі кілька десятків тисяч етнічних українців."},{"page_url":"https://tl.wikipedia.org/wiki/Talaan_ng_mga_fossil_na_transisyonal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Birkenia_elegans.jpg","page_title":"Talaan ng mga fossil na transisyonal","context_page_description":"Ito ay isang probisyonal na listahan ng palampas fossils. Ang fossils ay nakalista sa serye, na ipinapakita ang paglipat mula sa isang pangkat sa isa pang, na kumakatawan sa makabuluhang mga hakbang sa paglaki ng mga pangunahing tampok sa iba't-ibang linya. Madalas kumakatawan sa mga pagbabagong ito ang mga pangunahing pagbabago sa anatomya, na may kaugnayan sa paraan ng buhay, tulad ng pagbili ng mga feathered wings para sa isang panghimpapawid na lifestyle sa ibon, o binti sa isda / tetrapod transition. Tulad ng nabanggit na sa pamamagitan ng Darwin, ang fossil record ay hindi kumpleto.\\nMay perpektong, listahang ito dapat lamang recursively fossil na transisyunal na kumakatawan sa mga supling na mga specie mula sa kung saan na grupo na lumaki sa ibang pagkakataon, ngunit pinaka-kung hindi lahat, ng mga fossils na ipinapakita dito ay kumakatawan sa mga sanga, higit pa o mas mababa malapit na nauugnay sa ang totoo nitong mga ninuno."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%AF%D8%B1_%D9%86%D8%A7%D9%88%D8%A6%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Heather_Nauert_official_photo.jpg","page_title":"هدر ناوئرت","context_page_description":"هدر ناوْئِرت کفیل معاونت وزارت خارجه در امور عمومی و دیپلماسی عمومی و سخنگوی وزارت خارجه آمریکا در زمان ریاست جمهوری دونالد ترامپ است. او پیش‌تر گوینده خبر برنامه فاکس اند فرندز فاکس نیوز بوده‌است. وی در ۷ دسامبر ۲۰۱۸ با حکم رئیس جمهور ترامپ، به عنوان نامزد سفیر ایالات متحده در سازمان ملل متحد و جانشین نیکی هیلی شد.\\nبا وجودی که ترامپ انتخاب او را اعلام نمود، اما ناوئرت هرگز به طور رسمی نامزد این سمت نشد. ناوئرت با توجه به ملاحظات خانوادگی اظهار داشت می خواهم با انصراف از پذیرش این سمت این بار را از دوش خانواده ام بردارم،وی به این ترتیب از نامزدی خود در تاریخ ۱۶فوریه ۲۰۱۹ صرف نظر کرد، هرچند در پروسه ارزیابی او مشخص شد که وی دارای یک پرستار بچه قانونی در کشور است که ویزای کار قانونی نداشته."},{"page_url":"https://en.wikipedia.org/wiki/Flexure_bearing","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Flexure_pivot.png","page_title":"Flexure bearing","context_page_description":"A flexure bearing is a category of flexure which is engineered to be compliant in one or more angular degrees of freedom. Flexure bearings are often part of compliant mechanisms. Flexure bearings serve much of the same function as conventional bearings or hinges in applications which require angular compliance. However, flexures require no lubrication and exhibit very low or no friction.\\nMany flexure bearings are made of a single part: two rigid structures joined by a thin \\"hinge\\" area. A hinged door can be created by implementing a flexible element between a door and the door frame, such that the flexible element bends allowing the door to pivot open.\\nFlexure bearings have the advantage over most other bearings that they are simple and thus inexpensive. They are also often compact, lightweight, have very low friction, and are easier to repair without specialized equipment. Flexure bearings have the disadvantages that the range of motion is limited, and often very limited for bearings that support high loads.\\nA flexure bearing relies on the bearing element being made of a material which can be repeatedly flexed without disintegrating."},{"page_url":"https://en.wikipedia.org/wiki/Cabinet_Erdo%C4%9Fan_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Mehmetersoy.jpg","page_title":"Cabinet Erdoğan IV","context_page_description":"The Fourth Erdoğan Cabinet is the 66th government of the Republic of Turkey, which was declared on 9 July 2018. It is the first cabinet after Turkey's transition into presidential republic. It was also the first cabinet that did not require parliamentary approval to be formed."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC56%E8%BB%8D_(%E6%97%A5%E6%9C%AC%E8%BB%8D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Map-IJA_Army%2C_56th.jpg","page_title":"第56軍 (日本軍)","context_page_description":"第56軍は、大日本帝国陸軍の軍の一つ。"},{"page_url":"https://de.wikipedia.org/wiki/Trampolino_Sulzenhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Tramponi_da_sci_a_Dobbiaco.jpg","page_title":"Trampolino Sulzenhof","context_page_description":"Die Trampolino Sulzenhof in Toblach bestehen aus mehreren Skisprungschanzen. Zur Anlage gehören zwei kleine Schanzen der Kategorie K 22, K 37 und eine mittlere Schanze der Kategorie K 67. Die Schanzen sind nicht mit Matten belegt."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%B2%E0%A6%BF_%E0%A6%97%E0%A6%B2%E0%A6%BF_%E0%A6%86%E0%A6%97%E0%A6%BE_%E0%A6%AE%E0%A6%B8%E0%A6%9C%E0%A6%BF%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Masjed_ali_gholi.jpg","page_title":"আলি গলি আগা মসজিদ","context_page_description":"আলি গলি আগা মসজিদ ইরানের এসফাহানে একটি মসজিদ যা আলি গলি আগা খান নির্মান করেন, তিনি আলি গলি আগা হাম্মামা ও নির্মাণ করেছিলেন।"},{"page_url":"https://en.wikipedia.org/wiki/Easter_egger","image_url":"https://upload.wikimedia.org/wikipedia/en/d/d8/Virginia_Dare%2C_a_chicken.jpg","page_title":"Easter egger","context_page_description":"In current American usage, an Easter egger or Easter-egger is any chicken that possesses the \\"blue egg\\" gene, but doesn't fully meet any breed standard defined in the American Poultry Association's standards, or in the case of Easter Egger bantams, the American Bantam Association's standards. The name derives from the resemblance of their colorful eggs to Easter eggs and for many years most hatcheries mistakenly labeled their Easter eggers as Ameraucanas or Araucanas. The Araucana, Ameraucana, and Easter eggers are descended from the same foundation stock that spread around the world from Chile and the Falklands. Because of the many breeds that go into them, Easter eggers come in many colors and patterns. The pigment oocyanin deposited on the surface of the shell accounts for the blue-green color. Easter eggers are hardy and excellent layers."},{"page_url":"https://cs.wikipedia.org/wiki/Kaktusov%C3%A9_vl%C3%A1kno","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Agave.americana%2801%29.jpg","page_title":"Kaktusové vlákno","context_page_description":"Označení kaktusové vlákno je termín převzatý z doslovného překladu zejména anglických a německých textů. Jedná se o textilní vlákno získané nikoliv z rostlin z čeledi kaktusovitých, ale z listů různých druhů rostlin zejména z čeledi agávovitých, Agáve sisalová - sisal, Agave americana, Agave lechuguilla, ale i dalších druhů např. Aechmea magdalenae aj."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%B9%CE%BF%CF%85-%CE%A3%CE%B1%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Laonung_River.jpg","page_title":"Γιου-Σαν","context_page_description":"Το Γιου-Σαν, γνωστό και μεταφρασμένο ως «Όρος του Ίασπη» ή όρος Γιου, είναι το υψηλότερο βουνό της Ταϊβάν, με υψηλότερη κορυφή 3.952 m πάνω από το επίπεδο της θάλασσας, δίνοντας στην Ταϊβάν το τέταρτο μεγαλύτερο υψόμετρο μεταξύ όλων των νησιών της Γης. Παλαιότερα ήταν γνωστό στους Δυτικούς και ως Όρος Μόρισον, ονομασία που πιστεύεται ότι δόθηκε προς τιμή του Βρετανού σημαίνοντος πρεσβυτεριανού ιεραποστόλου του 19ου αιώνα Ρόμπερτ Μόρισον.\\nΤον χειμώνα το Γιου-Σαν είναι συχνά καλυμμένο με παχύ στρώμα χιονιού και τότε όλη η κορυφή αστράφτει σαν πολύτιμο πετράδι από το οποίο πήρε και το όνομά του.\\nΤο Γιου-Σαν και τα κοντινά του βουνά συναποτελούν την Οροσειρά Γιου-Σαν, μέρος του Εθνικού Πάρκου Γιου-Σαν, του μεγαλύτερου σε έκταση από τα εννέα της χώρας και με το μεγαλύτερο μέσο υψόμετρο. Τα παρθένα δάση του φιλοξενούν πολλά ενδημικά είδη ζώων.\\nΗ υψηλότερη κορυφή του βουνού και της οροσειράς είναι και η υψηλότερη σε ολόκληρη την περιοχή του δυτικού Ειρηνικού εκτός της Χερσονήσου Καμτσάτκα. Το βουνό δημιουργήθηκε κάτω από τη θάλασσα και υψώθηκε μέχρι το σημερινό του ύψος επειδή η Ευρασιατική τεκτονική πλάκα ανέρχεται καθώς η ωκεάνια Τεκτονική πλάκα των Φιλιππίνων γλιστρά από κάτω της."},{"page_url":"https://sv.wikipedia.org/wiki/Taigan%C3%A4bbmus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Sorex_isodon_range_map.png","page_title":"Taiganäbbmus","context_page_description":"Taiganäbbmus är en art i familjen näbbmöss som förekommer i norra Eurasien. Den påminner om vanlig näbbmus men är något större."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Pornichet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Gare-Pornichet-2014_06.JPG","page_title":"Gare de Pornichet","context_page_description":"La gare de Pornichet est une gare ferroviaire française de la ligne de Saint-Nazaire au Croisic, située sur le territoire de la commune de Pornichet, dans le département de la Loire-Atlantique en région Pays de la Loire, ses emprises bordant au nord les limites de la commune de La Baule-Escoublac.\\nConstruite par la Compagnie du chemin de fer de Saint-Nazaire au Croisic, la station est mise en service en 1879 par l'Administration des chemins de fer de l'État et intègre le réseau de la Compagnie du chemin de fer de Paris à Orléans, lorsqu'elle reprend la ligne en 1884.\\nC'est une gare voyageurs de la Société nationale des chemins de fer français, desservie par le TGV Atlantique, c'est également une gare du réseau TER Pays de la Loire desservie par des trains express régionaux, dont l'Interloire."},{"page_url":"https://tr.wikipedia.org/wiki/Ye%C5%9Fil_Burun_Adalar%C4%B1%27n%C4%B1n_vize_politikas%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Visa_policy_of_Cape_Verde.png","page_title":"Yeşil Burun Adaları'nın vize politikası","context_page_description":"Vizeden muaf ülkelerden birinden gelinmediği sürece Yeşil Burun Adaları ziyaretçileri Cape Verde'nin diplomatik temsilciliklerinden vize almaları gerekmektedir."},{"page_url":"https://fr.wikipedia.org/wiki/Croix_directionnelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Famicom_controllers.jpg","page_title":"Croix directionnelle","context_page_description":"La croix directionnelle, parfois appelée manette + ou D-pad – abréviation de directional pad, est un contrôleur multidirectionnel en forme de signe plus « + », que l'on retrouve sur toutes les manettes de jeu modernes, avec un bouton sous chacune des quatre directions. Comme les premiers joysticks, la grande majorité des D-pads est numérique ; en d'autres termes, seules les directions fournies sur les boutons du D-pad peuvent être employées, sans valeurs intermédiaires. Cependant, les combinaisons de deux directions – haut et gauche par exemple, fournissent des diagonales.\\nBien que les D-pads numériques offrent moins de nuances et de flexibilités que les joysticks analogiques, ils peuvent facilement être manœuvrés – exigeant seulement un petit mouvement du pouce, avec une très grande précision. Ces dernières années, des D-pads gérant différents niveaux de pression ont été développés, leur donnant un léger contrôle analogique."},{"page_url":"https://de.wikipedia.org/wiki/Zulfikar_Ali_Bhutto","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/NixonBhutto1973.jpg","page_title":"Zulfikar Ali Bhutto","context_page_description":"Zulfikar Ali Bhutto war von 1971 bis 1973 Staatspräsident und anschließend bis 5. Juli 1977 Premierminister von Pakistan."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%BCchenabluft","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Beigel_Bake_kitchen.jpg","page_title":"Küchenabluft","context_page_description":"Unter Küchenabluft ist ganz allgemein die aus einer Küche frei oder gezwungen abströmende Luft zu verstehen. Diese belastete Küchenabluft, der sogenannte Wrasen, entsteht bei Kochvorgängen und besteht zumeist aus Wasserdampf, Essensgerüchen und Fett.\\nRechtlich und technisch unterscheidet man zwischen der privaten und der gewerblichen Küchenabluft."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Franciszka_a_Ripa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Interior_San_Francesco_a_Ripa_06.jpg","page_title":"Kościół św. Franciszka a Ripa","context_page_description":"Kościół św. Franciszka a Ripa – rzymskokatolicki kościół w Rzymie na Zatybrzu, od 1960 tytularny kościół kardynalski, ustanowiony przez papieża Jana XXIII.\\nŚwiątynia ta jest kościołem parafialnym oraz kościołem tytularnym."},{"page_url":"https://en.wikipedia.org/wiki/Bidston","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Bidston%2C_Birkenhead_-_DSC03537.JPG","page_title":"Bidston","context_page_description":"Bidston is a village, a parish and a suburb of Birkenhead, on the Wirral Peninsula, in the modern county of Merseyside. The area is a mixture of the well-preserved Bidston Village, Bidston Hill, a modern housing estate, and the Bidston Moss nature reserve, industrial estate and retail park.\\nAdministratively, it is also a ward of the Metropolitan Borough of Wirral. Before local government reorganisation on 1 April 1974, it was part of the County Borough of Birkenhead, within the geographical county of Cheshire. At the 2001 Census, the population of Bidston was 10,446, consisting of 4,725 males and 5,721 females. By the time of the 2011 Census the electoral ward was called Bidston and St. James. This ward includes Beechwood to the south of Bidston and extends into much of Birkenhead to the east, including all of the south side of the Great Float. The total population of this ward at this Census was 15,216 of which 7,117 were males and 8,099 were female."},{"page_url":"https://en.wikipedia.org/wiki/List_of_basilicas_in_Germany","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/St._Ursula_K%C3%B6ln_%285020-22%29.jpg","page_title":"List of basilicas in Germany","context_page_description":"This is an incomplete list of basilicas of the Roman Catholic Church in Germany. A basilica is a church with certain privileges conferred on it by the Pope. Currently there are some 76 basilicas in Germany."},{"page_url":"https://es.wikipedia.org/wiki/Iruraiz-Gauna","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Alaitzako_elizaren_hegoaldeko_fatxada.jpg","page_title":"Iruraiz-Gauna","context_page_description":"Iruraiz-Gauna es un municipio español situado en la parte suroccidental de la Cuadrilla de Salvatierra, en la provincia de Álava, comunidad autónoma del País Vasco."},{"page_url":"https://en.wikipedia.org/wiki/Gnaraloo_Feral_Animal_Control_Program","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Gnaraloo_Bay_Rookery.jpg","page_title":"Gnaraloo Feral Animal Control Program","context_page_description":"The Gnaraloo Feral Animal Control Program operates in conjunction with the Gnaraloo Turtle Conservation Program, a non-governmental organization whose aim is to monitor and protect sea turtle nesting beaches along the coast of Gnaraloo. Since its implementation in 2009, the GFACP has worked to reduce the impact of feral predators on sea turtle nests within these rookeries.\\nGnaraloo is located at the southern end of the Ningaloo Coast, a World Heritage Site. The Ningaloo Reef and surrounding coastline are home to important wildlife, including vulnerable and endangered sea turtle populations."},{"page_url":"https://it.wikipedia.org/wiki/Campo_di_battaglia_di_Maratona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Ac.marathon.jpg","page_title":"Campo di battaglia di Maratona","context_page_description":"La ricostruzione del campo di battaglia di Maratona del 490 a.C. è tuttora oggetto di un dibattito molto acceso tra gli storici, dato che l'identificazione di molti luoghi chiave, basata sul resoconto dato da Pausania il Periegeta nel II secolo d.C. e soprattutto sugli scavi archeologici degli ultimi due secoli, è assai complessa per via della scarsità dei dati disponibili e dei mutamenti subiti dalla piana di Maratona negli ultimi due millenni e mezzo."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_la_cit%C3%A9_scolaire_Augustin-Thierry","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Nicolas_G%C3%A9doyn_-_Versailles_MV_2966.jpg","page_title":"Histoire de la cité scolaire Augustin-Thierry","context_page_description":"L’histoire de la cité scolaire Augustin-Thierry commence avec la création, par lettre patente, d'un collège royal à Blois par Henri III en 1581 et continue jusqu'à nos jours, malgré plusieurs interruptions et changements de locaux.\\nOuvert le 1ᵉʳ avril 1587, le premier collège de Blois est d'abord implanté dans une maison du quartier du Bourg-Neuf, situé en dehors des murailles de la ville. L'établissement est ensuite déplacé, en 1601, dans la rue Bretonnerie, sur le site de la poste centrale actuelle. Tenu par des séculiers jusqu'en 1622, le collège royal est alors confié à la Compagnie de Jésus, qui en perd la direction lorsqu'elle est expulsée de France en 1764.\\nFermé en 1793 par les révolutionnaires, le collège n'est recréé qu'en 1804, sous la forme d'une école communale secondaire, promue au rang de collège en 1808. Désormais implanté dans l'ancien couvent du Bourg-Moyen, l'établissement accueille une bonne partie de la bourgeoisie blésoise. Son nom actuel lui est attribué le 30 septembre 1872 pour rendre hommage à l'un de ses plus célèbres élèves, l'historien blésois Augustin Thierry."},{"page_url":"https://pt.wikipedia.org/wiki/Neurazy","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Panorama_view_of_Neurazy.JPG","page_title":"Neurazy","context_page_description":"Neurazy é uma comuna checa localizada na região de Plzeň, distrito de Plzeň-jih."},{"page_url":"https://tr.wikipedia.org/wiki/Roxette","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Roxette-Roxette_at_Bospop_festival_The_Netherlands_2011.jpg","page_title":"Roxette","context_page_description":"Roxette, Marie Fredriksson ve Per Gessle’dan oluşan, zaman zaman rock’tan etkilenmiş Halmstad kentinde kurulan bir İsveçli pop grubu."},{"page_url":"https://de.wikipedia.org/wiki/Milliarium_Aureum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Milliarium_Aureum_op_het_Forum_Romanum_te_Rome_Columna_Miliaria_in_Foro_Romano_%28titel_op_object%29_Antieke_monumenten_%28serietitel%29_Antiquae_Urbis_Splendor_%28serietitel%29%2C_RP-P-2016-345-28-1.jpg","page_title":"Milliarium Aureum","context_page_description":"Das Milliarium Aureum war eine vergoldete Säule aus Bronze. Sie wurde auf Befehl des Augustus 20 v. Chr. an der östlichen Ecke der Rostra auf dem Forum Romanum in Rom angelegt.\\nUrsprünglich standen auf der Säule die Namen der Hauptstädte der Provinzen des römischen Reichs und ihre jeweiligen Entfernungen von Rom. Diese Säule sollte die Menschen an die Größe des Reiches erinnern und die zentrale Natur des Forums. Es galt als ideelles Zentrum des Reiches, von dem die wichtigsten Römerstraßen abgingen. Lediglich Reste des Sockels sind erhalten geblieben. Die Entfernungen zusammengerechnet ergaben 76.000 km. Der Kaiser hatte auch den Straßenbau als Aufgabe, er war der curator viarum. Aufgrund dieser Säule entstand das Sprichwort „Alle Wege führen nach Rom“.\\nEine ähnliche Funktion erfüllte das Milion in Konstantinopel für das Oströmische Reich."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A9%D7%99%D7%90_%D7%A7%D7%A4%D7%A8%D7%99%D7%A1%D7%99%D7%9F_%D7%94%D7%A6%D7%A4%D7%95%D7%A0%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Mustafa_Ak%C4%B1nc%C4%B1_%28cropped%29.jpg","page_title":"נשיא קפריסין הצפונית","context_page_description":"נשיא הרפובליקה הטורקית של צפון קפריסין הוא ראש המדינה של צפון קפריסין.\\nמשרת הנשיא קיימת במדינה מאז הקמתה, ב־15 בנובמבר 1983. הבחירות לנשיאות נערכות אחת לחמש שנים. כדי להיבחר נדרש המועמד להיות מעל גיל שלושים ולהשיג בבחירות מחצית מהקולות, אחרת נערך סיבוב בחירות שני. קפריסין הצפונית היא דמוקרטיה נשיאותית למחצה, ולצד הנשיא מכהן במדינה ראש ממשלה."},{"page_url":"https://no.wikipedia.org/wiki/Judas_Makkabeus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Juda-Maccabaeus.jpg","page_title":"Judas Makkabeus","context_page_description":"Judas makkabeeren var tredje sønn av den jødiske presten Mattatias. Han ledet makkabeernes opprør mot Selevkidriket.\\nI 175 f.Kr. ble Antiokos IV Epifanes keiser for Selevkidriket, og begynte en kampanje for å få jødene i Palestina assimilert. I et forsøk på å forene de greske elementer innen sitt rike tok Antiokos sikte på å knuse den jødiske religion og hellenisere jødefolket. Det var denne brutale undertrykkelsen makkabeerne kjempet imot. Historien om ham og opprøret er fortalt i Makkabeerbøkene.\\nJudas var kohen, jødisk prest, som sin far, og han overtok ledelsen av opprøret etter farens død. Han beseiret motstanderne og sørget for at dyrkelsen av den jødiske religion ble gjenopptatt. Han er rost som en av de største krigerne i jødiske historie ved siden av Josva, Gideon, og David. Tilnavnet makkabeeren kommer fra det syriske ordet maqqaba, og ble gitt ham som anerkjennelse for hans styrke i kamp. Den jødiske festen Hanukka, som betyr «innvielse», feirer gjeninnføringen av jødisk dyrkelse ved tempelet i Jerusalem i 165 f.Kr. etter at Judas makkabeeren fjernet en hedensk statue."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Goddert","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Goddert_Old_Houses_Westerwald_Germany.jpg","page_title":"Liste der Kulturdenkmäler in Goddert","context_page_description":"In der Liste der Kulturdenkmäler in Goddert sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Goddert aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://eu.wikipedia.org/wiki/Penpoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/St_Veep_-_Penpoll_Mill_-_geograph.org.uk_-_48030.jpg","page_title":"Penpoll","context_page_description":"Penpoll, Ingalaterrako Kornualles konderriko herrixka bat da, Quethiock parrokia zibilean."},{"page_url":"https://lb.wikipedia.org/wiki/Landrecourt-Lempire","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Lempire-aux-Bois_%28Meuse%29_mairie.JPG","page_title":"Landrecourt-Lempire","context_page_description":"Landrecourt-Lempire ass eng franséisch Gemeng am Departement Meuse an der Regioun Grand Est.\\nD'Gemeng ass den 1. September 1972 bei der Fusioun vun de Gemenge Landrecourt a Lempire-aux-Bois entstanen."},{"page_url":"https://no.wikipedia.org/wiki/K%C3%B6niggr%C3%A4tzer_Marsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Johann_Gottfried_Piefke.jpg","page_title":"Königgrätzer Marsch","context_page_description":"Königgrätzer Marsch er en av de mest kjente tyske militær-marsjene. Den ble komponert i 1866 av Johann Gottfried Piefke til minne om slaget ved Königgrätz, det avgjørende slaget i den østerriksk-prøyssiske krig, hvor kongeriket Preussen slo keiserriket Østerrike. I Piefke sitt mest suksessrike arrangement av marsjen, er Der Hohenfriedberger, brukt som en trio. Den mest kjente versjonen ble brukt som infanterimarsj, mens en alternativ versjon ble brukt som en kavalerigalopp. Piefke laget også en annen versjon kalt Königgrätzer mit anderem Trio, men denne versjonen er langt mindre kjent."},{"page_url":"https://en.wikipedia.org/wiki/Tuareg_languages","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/2D62.png","page_title":"Tuareg languages","context_page_description":"The Tuareg languages constitute a group of closely related Berber languages and dialects. They are spoken by the Tuareg Berbers in large parts of Mali, Niger, Algeria, Libya and Burkina Faso, with a few speakers, the Kinnin, in Chad."},{"page_url":"https://ast.wikipedia.org/wiki/Arroz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Oryza_sativa_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-232.jpg","page_title":"Arroz","context_page_description":"El arroz ye la grana de la planta Oryza sativa. Trátase d'un cebera consideráu alimentu básico en munches cultures culinaries, según en delles partes d'América Llatina. L'arroz ye la segunda cebera más producíu nel mundu, tres el maíz. Por cuenta de que el maíz ye producíu con otros munchos propósitos estreme del consumu humanu, puede dicise que l'arroz ye la cebera más importante na alimentación humano y que contribúi de forma bien efectiva al apurra calóricu de la dieta humana actual; ye fonte d'una quinta parte de les caloríes consumíes nel mundu. Dende 2008, realizóse un racionamientu en dellos países por cuenta de la carestía d'arroz. En países como Bangladex y Camboya puede llegar a representar cuasi los trés cuartes partes de l'alimentación de la población.\\nDedíquense munches hectárees al cultivu del arroz nel mundu. Sábese qu'el 95 % d'esti cultivu estender ente los paralelos 53º, latitud norte, y 35º, latitud sur. El so orixe ye oxetu de discutiniu ente'l investigadores; alderícase si foi en China o n'India."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8E%9B%E4%B8%BD%E4%BA%9A%C2%B7%E8%B4%B9%E5%B0%94%E5%8D%97%E8%BE%BE%C2%B7%E5%9F%83%E6%96%AF%E7%9A%AE%E8%AF%BA%E8%90%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Entrevista_de_Canciller_Mar%C3%ADa_Fernanda_Espinosa_%2836388035054%29_%28cropped%29.jpg","page_title":"玛丽亚·费尔南达·埃斯皮诺萨","context_page_description":"玛丽亚·费尔南达·埃斯皮诺萨·加塞斯是一位厄瓜多尔的政治人物和外交官。她曾任第73届联合国大会主席。她从2012年11月28日至2014年9月23日担任厄瓜多尔国防部长。此前，她于2017年5月至2018年6月担任总统利宁·莫雷诺政府的外交部长。她之前还担任过其他几个部长级职位。她于2008年至2009年和2014年10月至2017年5月担任厄瓜多尔常驻联合国日内瓦代表。她还是诗人和散文家。"},{"page_url":"https://pl.wikipedia.org/wiki/Obr%C4%85czkowiec_europejski","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Iberian_worm_lizard.jpg","page_title":"Obrączkowiec europejski","context_page_description":"Obrączkowiec europejski, amfisbena europejska – gatunek amfisbeny z rodziny Blanidae występujący w Afryce Północnej i na Półwyspie Pirenejskim."},{"page_url":"https://en.wikipedia.org/wiki/49th_parallel_north","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Monument_49_Latitude_Presov_Slovakia.JPG","page_title":"49th parallel north","context_page_description":"The 49th parallel north is a circle of latitude that is 49° north of Earth's equator. It crosses Europe, Asia, the Pacific Ocean, North America, and the Atlantic Ocean.\\nThe city of Paris is about 15 km south of the 49th parallel and is the largest city between the 48th and 49th parallels. Its main airport, Charles de Gaulle Airport, lies on the parallel.\\nRoughly 2,030 kilometres of the Canada–United States border was designated to follow the 49th parallel from British Columbia to Manitoba on the Canada side, and from Washington to Minnesota on the U.S. side, more specifically from the Strait of Georgia to the Lake of the Woods. This international border was specified in the Anglo-American Convention of 1818 and the Oregon Treaty of 1846, though survey markers placed in the 19th century cause the border to deviate from the 49th parallel by up to tens of meters.\\nFrom a point on the ground at this latitude, the sun is above the horizon for 16 hours, 12 minutes during the summer solstice and 8 hours, 14 minutes during the winter solstice. This latitude also roughly corresponds to the minimum latitude in which astronomical twilight can last all night near the summer solstice."},{"page_url":"https://hr.wikipedia.org/wiki/Rhizogoniales","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Galerina_hypnorum_%26_Pyrrhobryum_parramattense.jpg","page_title":"Rhizogoniales","context_page_description":"Rhizogoniales, red pravih mahovina opisan 2004. godine. Dio je nadreda Bryanae. Postoje tri porodice."},{"page_url":"https://en.wikipedia.org/wiki/VP-91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/P-3C_VP-91_%2821894515745%29.jpg","page_title":"VP-91","context_page_description":"Patrol Squadron 91 was a patrol squadron of the U.S. Naval Reserve. It was the second squadron to bear the VP-91 designation, the first VP-91 was redesignated VPB-91 on 1 October 1944. The squadron was established on 1 November 1970 and deactivated 29 years later, on 31 March 1999. It flew the Lockheed P-3 Orion, and was based at NAS Moffett Field during its entire life. The squadron's nicknames were the Pink Panthers from 1970-1984, the Stingers from 1984-1991, and the Black Cats from 1991-1999. Units of the squadron made 25 major overseas deployments."},{"page_url":"https://sv.wikipedia.org/wiki/Stockholm_Mean_Machines","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Stockholm_Mean_Machines_2012-04-21a.JPG","page_title":"Stockholm Mean Machines","context_page_description":"Stockholm Mean Machines är en klubb från Stockholm som spelar amerikansk fotboll i Superserien.\\nKlubben bildades 1982 som Danderyds AFF och var då den första klubben i Sverige för denna sport. Senare bytte man namn till Danderyd Mean Machines och blev Stockholm Mean Machines när man flyttade från Danderyd till Stockholm i mitten av 1990-talet.\\nKlubbens nuvarande hemmaplan är Zinkensdamms IP på Södermalm. När klubben hörde hemma i Danderyd, var Stockhagens IP dess hemmaplan."},{"page_url":"https://en.wikipedia.org/wiki/Corliss_Lamont","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Corliss_Lamont_1934.png","page_title":"Corliss Lamont","context_page_description":"Corliss Lamont was an American socialist philosopher and advocate of various left-wing and civil liberties causes. As a part of his political activities he was the Chairman of National Council of American-Soviet Friendship starting from the early 1940s."},{"page_url":"https://de.wikipedia.org/wiki/Itzamkanac","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Itzamkanac2.JPG","page_title":"Itzamkanac","context_page_description":"Itzamkanac, gelegentlich auch nach der nahegelegenen modernen Ansiedlung El Tigre genannt, ist eine bedeutende Ruinenstätte der Maya auf der Halbinsel Yucatán im mexikanischen Bundesstaat Campeche. Die Identifizierung mit Itzamkanac der Hauptstadt der Acalán Maya, einer Untergruppe der Chontal Maya bzw. der Putún Maya, ist wahrscheinlich, aber nicht gesichert."},{"page_url":"https://fr.wikipedia.org/wiki/La_Vierge_dans_une_%C3%A9glise","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Crucifix_Masaccio.jpg","page_title":"La Vierge dans une église","context_page_description":"La Vierge dans une église est un tableau à l'huile sur panneau de bois de chêne de petites dimensions, attribué au peintre primitif flamand Jan van Eyck. Il est conservé à la Gemäldegalerie. Probablement exécuté entre 1438 et 1440, il représente la Vierge Marie tenant dans ses bras l'Enfant Jésus dans la nef d'une église.\\nMarie apparaît comme la Reine des Cieux, portant un Enfant Jésus espiègle dans une pose qui n'est pas sans rappeler la tradition byzantine des icônes Éléousa. Comme dans les représentations byzantines de la Vierge, van Eyck montre également une Marie monumentale, d'une grandeur irréaliste par rapport à l'environnement architectural gothique. Les flots de lumière tombant des fenêtres de l'église, figurés avec une très grande minutie, illuminent l'espace intérieur pour évoquer symboliquement la conception virginale de Jésus et la présence immatérielle de Dieu.\\nLa plupart des historiens d'art considère le panneau comme étant l'aile gauche d'un diptyque démantelé. Selon toute vraisemblance, l'aile opposée, dont on ignore tout, représentait le portrait du donateur."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%93%E3%83%AD%E3%83%BC%E3%83%89%E3%82%AD%E3%83%B3%E3%82%AF%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Melanitta_fusca.jpg","page_title":"ビロードキンクロ","context_page_description":"ビロードキンクロは、カモ目カモ科クロガモ属に分類される鳥類。"},{"page_url":"https://ce.wikipedia.org/wiki/NGC_5469","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/NGC5469_-_SDSS_DR14.jpg","page_title":"NGC 5469","context_page_description":"NGC 5469 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D1%80%D0%B0%D1%82%D0%BE%D0%BD-%D0%B4%D0%B5-%D0%A5%D1%83%D0%B0%D1%80%D1%80%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Cerrat%C3%B3n-de-Juarros-bandera.png","page_title":"Серратон-де-Хуаррос","context_page_description":"Серратон-де-Хуаррос — муниципалитет в Испании, входит в провинцию Бургос, в составе автономного сообщества Кастилия и Леон. Занимает площадь 16,37 км². Население — 57 человек."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D1%80%D0%B5%D1%81%D1%82_%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B8_(%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/King_Haakon_VII_Freedom_Cross.png","page_title":"Хрест Свободи (Норвегія)","context_page_description":"Хрест Свободи короля Гокона VII – державна нагорода Королівства Норвегія."},{"page_url":"https://sv.wikipedia.org/wiki/A-135","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Anti-MissileExercise2018-05.jpg","page_title":"A-135","context_page_description":"A-135 är beteckningen på det ryska antirobotsystem som omger den ryska huvudstaden Moskva. Systemet togs i drift 1995 och består av kraftiga radarstationer med tillhörande kort- och långdistans-luftvärnsrobotar. Föregångaren kallades A-35, och det uppfördes under det tidiga 1970-talet i det dåvarande Sovjetunionen. Systemet är i dagsläget i drift, men vissa delar är inaktiverade av ekonomiska skäl."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Vlissingen_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Vlissingen-Koudekerkseweg_102-dak-ro113948.jpg","page_title":"Lijst van rijksmonumenten in Vlissingen (plaats)","context_page_description":"De stad en gemeente Vlissingen telt 283 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%B8%D1%82%D0%BE%D0%B2%D0%BA%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Mykytivka_Don_Lenin.jpg","page_title":"Никитовка (станция)","context_page_description":"Ники́товка — станция Донецкой железной дороги, главная станция города Горловка Донецкой области."},{"page_url":"https://vec.wikipedia.org/wiki/Morla%C3%A0s","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Mairie_de_Morla%C3%A0s.jpg","page_title":"Morlaàs","context_page_description":"Morlaàs el xé on comun de 4 282 abitanti del departemento de Pyrénées-Atlantiques che el fa parte del rejon Nova Acuitania in Fransa."},{"page_url":"https://sk.wikipedia.org/wiki/Majstrovstv%C3%A1_sveta_v_krasokor%C4%8Du%C4%BEovan%C3%AD_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/2014_World_Championships_Pairs_Podium.jpg","page_title":"Majstrovstvá sveta v krasokorčuľovaní 2014","context_page_description":"Majstrovstvá sveta v krasokorčuľovaní 2014 bola medzinárodná súťaž krasokorčuliarov organizovaná Medzinárodnou korčuliarskou úniou.\\nSúťaž sa konala od 24. marca do 30. marca 2014 v japonskom meste Saitama na štadióne „Saitama Šintošin “. Majstrovstvá prebiehali v štyroch kategóriách - muži, ženy, športové dvojice a tanečné páry.\\nNa základe výsledkov súťaže získali krajiny počty miesteniek pre svojich reprezentantov na nasledujúce majstrovstvá sveta."},{"page_url":"https://en.wikipedia.org/wiki/Nagasaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Nagasaki_Shianbashi_bar_street_night_view.jpg","page_title":"Nagasaki","context_page_description":"Nagasaki is the capital and the largest city of Nagasaki Prefecture on the island of Kyushu in Japan.\\nIt became the sole port used for trade with the Portuguese and Dutch during the 16th through 19th centuries and the Hidden Christian Sites in the Nagasaki Region have been recognized and included in the UNESCO World Heritage List. Part of Nagasaki was home to a major Imperial Japanese Navy base during the First Sino-Japanese War and Russo-Japanese War. At the end of World War II, the American atomic bombings of Hiroshima and Nagasaki made Nagasaki the second and, to date, last city in the world to experience a nuclear attack.\\nAs of 1 June 2020, the city has an estimated population of 407,624 and a population density of 1,004 people per km². The total area is 405.86 km²."},{"page_url":"https://en.wikipedia.org/wiki/Head_of_government","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Indira_and_Nixon.JPG","page_title":"Head of government","context_page_description":"The head of government is either the highest or second highest official in the executive branch of a sovereign state, a federated state, or a self-governing colony, autonomous region, or other government who often presides over a cabinet, a group of ministers or secretaries who lead executive departments. \\"Head of government\\" is often differentiated from \\"head of state\\", as they may be separate positions, individuals, or roles depending on the country.\\nThe authority of a head of government, such as a president, chancellor, or prime minister and the relationship between that position and other state institutions, such as the relation between the head of state and of the legislature, varies greatly among sovereign states, depending largely on the particular system of the government that has been chosen, won, or evolved over time.\\nIn most parliamentary systems, including constitutional monarchies, the head of government is the de facto political leader of the government, and is answerable to at least one chamber of the legislature."},{"page_url":"https://az.wikipedia.org/wiki/%C3%96zb%C9%99kl%C9%99r","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Shah_Jahan_on_The_Peacock_Throne.jpg","page_title":"Özbəklər","context_page_description":"Özbəklər – Türk xalqlarından biri. Özbəklər Özbəkistanda əhalinin 80%-dən çoxunu təşkil edir, həmçinin kompakt halda Əfqanıstanda, Tacikistanda, Qazaxıstanda, Qırğızıstanda, Türkmənistanda və Pakistanın Kəraçi şəhərində, dağınıq halda isə dünyanın bir çox ölkəsində yaşayırlar. Özbəklər türk xalqlarının uyğur qrupuna aiddir."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Wiesbaden-Rheingauviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Siegmund_Hirsch.jpg","page_title":"Liste der Stolpersteine in Wiesbaden-Rheingauviertel","context_page_description":"Info: Angaben zu Eigenschaften, welche alle Teillisten für Wiesbaden gemeinsam haben, sind unter Liste der Stolpersteine in Wiesbaden zu finden."},{"page_url":"https://en.wikipedia.org/wiki/Clarke_County,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Seal_of_Clarke_County%2C_Virginia.png","page_title":"Clarke County, Virginia","context_page_description":"Clarke County is a county in the Commonwealth of Virginia. As of the 2010 census, the population was 14,034. Its county seat is Berryville. Clarke County is included in the Washington-Arlington-Alexandria, DC-VA-MD-WV Metropolitan Statistical Area."},{"page_url":"https://es.wikipedia.org/wiki/Pampa_del_Tamarugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Pampa-del-tamarugal.jpg","page_title":"Pampa del Tamarugal","context_page_description":"La pampa del Tamarugal es una llanura, y una cuenca hidrográfica endorreica, ubicada en la Región de Tarapacá de Chile."},{"page_url":"https://eu.wikipedia.org/wiki/Geruza_anitzeko_kommutadore","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/VLAN_arrunta.png","page_title":"Geruza anitzeko kommutadore","context_page_description":"Geruza anitzeko kommutadorea edo 2/3 kommutadorea 2. eta 3. mailetan lan egiten duen kommutadore bat da; hau da, sarbide mailan eta IP mailan egiten du lan.\\nGeruza anitzeko kommutadoreek bideratzaile moduan joka dezakete eta VLAN desberdinen arteko konexioa eskaini. Kasu horietan ez dago sarbide mailako kommutadoreen beharrik. Kontzeptu hau irudian ikus daiteke. Pentsatu bideratzaile bat jartzen dugula 2/3 kmmutagailuaren ordez, switch batekin edo gehiagorekin batera. Honek lana kenduko lioke kommutadoreari, lan zama banatuko litzatekelako, kommutadore normalak ez lukeelako VLAN arteko lana egin beharko.\\nIrudian ikusten da nola funtzionatzen duen geruza anitzeko kommutadore batek. Hau bakarrik erabiliz, bideratzailea ordeztu daiteke baita ere. A eta B konputagailuak IP azpisare batekoak izango dira, eta C eta D konputagailuak ordea, beste IP azpisare batekoak. geruza anitzeko kommutadoreak kommutadore arrunt batek bezala ere jokatzen duenez, A eta B-ren artean trafikoa garraiatzen du, eta baita C eta D-ren artean. Baina pentsa dezagun A konputagailua C konputagailuarekin komunikatu nahi dela."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%B1%D0%B0%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%D0%A0%D0%B0%D0%B7%D1%80%D1%83%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B1%D0%B5%D1%80%D0%B5%D0%B3%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BB%D0%B8%D0%BD%D0%B8%D0%B8_%D0%B2_%D0%B7%D0%BE%D0%BD%D0%B5_%D1%80%D0%B0%D1%81%D0%BA%D0%BE%D0%BF%D0%BE%D0%B2_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%89%D0%B0_%D0%93%D0%B5%D1%80%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%81%D0%B0-%D0%A2%D0%BC%D1%83%D1%82%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D0%BD%D1%8C..JPG","page_title":"Кубань","context_page_description":"Кубань — історичний регіон на Північному Кавказі, в долині річки Кубань та її приток. З кінця XIX століття заселена українцями, зокрема запорізькими козаками. З 1860 року під назвою Кубанська область адміністративно-територіальна одиниця Російської імперії, земля Кубанського козацького війська. Історичним центром Кубані є місто Краснодар.\\nСьогодні це територія Краснодарського, Ставропольського країв, Адигеї, Ростовської області і Карачаєво-Черкесії Російської Федерації."},{"page_url":"https://en.wikipedia.org/wiki/Lothar_Bolz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Bundesarchiv_Bild_183-64094-006-Teil_2%2C_Genf%2C_Aussenministerkonferenz%2C_Ankunf_Dr._Bolz_%28cropped%29.jpg","page_title":"Lothar Bolz","context_page_description":"Lothar Bolz was an East German politician. From 1953 to 1965 he served as Minister of Foreign Affairs of East Germany."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%83%D8%B3%D9%88%D9%81%D8%A7%D8%AA_%D8%A7%D9%84%D8%B4%D9%85%D8%B3_%D9%81%D9%8A_%D8%A7%D9%84%D9%82%D8%B1%D9%86_%D8%A7%D9%84%D8%B9%D8%B4%D8%B1%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/SE1982Jan25P.png","page_title":"قائمة كسوفات الشمس في القرن العشرين","context_page_description":"هذه القائمة تحتوي علي كسوفات الشمس التي حدثت في القرن العشرين الميلادي، ففي خلال الفترة بين عامي 1901 و2000 كان هنالك 228 كسوفًا للشمس وكان منهم 78 كسوفًا جزئيًا و 73 كسوفًا حلقيًا، و 71 كسوفًا كليًا، وكان هناك 6 كسوفات هجينة.\\nو كسوف الشمس هي ظاهرة فلكية تحدث عندما تكون الأرض والقمر والشمس على استقامة واحدة تقريبًا ويكون القمر في المنتصف أي في وقت ولادة القمر الجديد عندما يكون في طور المحاق مطلع الشهر القمري بحيث يلقي القمر ظله على الأرض وفي هذه الحالة إذا كنا في مكان ملائم لمشاهدة الكسوف سنرى قرص القمر المظلم يعبر قرص الشمس المضئ.\\nو بالرغم من أن القمر يتواجد مرة كل مطلع شهر قمري بين الشمس والأرض، وبالتالي يمكن للقمر أن يكون في طور المحاق ولكنه أبعد من أن يصل ظله إلى الأرض، فلا يحدث الكسوف حينها، وكذلك قد يكون القمر في طور البدر وبعيدًا في مداره عن الأرض بحيث لا يحدث الخسوف، ويعود هذا إلى المدار الإهليلجي للقمر حول الأرض وميل مدار القمر حول الأرض على المستوى الكسوفي بزاوية 5 درجات بحيث لا تتواجد الأجرام الثلاثة على مستقيم واحد بالضرورة مطلع ومنتصف كل شهر.\\nكان أكثر عدد من الكسوف في السنة الواحدة هو 5 كسوفات شمسية حدثت في العام 1935، وأكثر عدد في شهر واحد كان شهر يوليو لعام 2000 حيث حدث كسوفين للشمس."},{"page_url":"https://pl.wikipedia.org/wiki/Zwinnik_Costello","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Hemigrammus_hyanuary_thomnight_001.jpg","page_title":"Zwinnik Costello","context_page_description":"Zwinnik Costello, zwinnik zielony, neon zielony – gatunek słodkowodnej ryby z rodziny kąsaczowatych. Hodowana w akwariach."},{"page_url":"https://de.wikipedia.org/wiki/Hollich","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Hollich_Windm%C3%BChle.JPG","page_title":"Hollich","context_page_description":"Hollich ist eine Bauerschaft im Ortsteil Burgsteinfurt der Stadt Steinfurt in Nordrhein-Westfalen. Die Bauerschaft liegt inmitten der münsterländischen Parklandschaft, umgeben vom Buchenberg, der Steinfurter Aa, sowie dem Emsdettener Venn und dem Borghorster Venn. Die Bauerschaft hat seit 1490 eine eigene Schützengesellschaft."},{"page_url":"https://pt.wikipedia.org/wiki/Teucrium_canadense","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/American_Germander_%282981720555%29.jpg","page_title":"Teucrium canadense","context_page_description":"Teucrium canadense, comummente conhecido como germander do Canadá, é uma erva perene da família Lamiaceae. É nativa da América do Norte, onde é encontrada em todos os estados contíguos dos Estados Unidos e em boa parte do Canadá."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%98%D9%88%D9%84_%D9%88%D8%B1%D9%86_(%D9%81%D8%B6%D8%A7%D9%BE%DB%8C%D9%85%D8%A7%DB%8C_%D8%AA%D8%B1%D8%A7%D8%A8%D8%B1%DB%8C_%D8%AE%D9%88%D8%AF%DA%A9%D8%A7%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Jules_Verne_Automated_Transfer_Vehicle_re-enters_Earth%27s_atmosphere.jpg","page_title":"ژول ورن (فضاپیمای ترابری خودکار)","context_page_description":"فضاپیمای ترابری خودکار «ژول ورن» یا فضاپیمای ترابری خودکار ۰۰۱ نام نخستین نمونهٔ فضاپیمای ترابری خودکار اروپایی بود که در روز ۱۹ اسفند ۱۳۸۶ به فضا پرتاب شد. این فضاپیما به افتخار ژول ورن، نویسنده فرانسوی داستان‌های علمی-تخیلی، نامگذاری شده بود.\\nاز آنجاییکه فضاپیمای ژول ورن نخستین نمونه عملیاتی از فضاپیماهای ترابری خودکار بود، پس از پرتاب به مدت سه هفته در مدار زمین مورد آزمایش قرار گرفت تا از درستی کارکرد دستگاه‌ها و ابزارهای ناوبری آن اطمینان حاصل گردد. پس از پایان موفقیت‌آمیز آزمایش‌ها، ژول ورن در ۱۵ فروردین ۱۳۸۷ بر ایستگاه فضایی بین‌المللی پهلو گرفت تا فضانوردان بار سفینه را که شامل سوخت، آب آشامیدنی، هوا و لوازم یدکی و ابزار پژوهشی بود، به ایستگاه فضایی منتقل کنند.\\nچند هفته پس از پهلوگیری، در روز ۶ اردیبهشت ۱۳۸۷ فضاپیمای ژول ورن در حالیکه به ایستگاه فضایی بین‌المللی متصل بود، با روشن کردن موتورهایش مدار ایستگاه را اصلاح و آن را به مدار بالاتری انتقال داد. علاوه بر انتقال بخشی از اقلام مورد نیاز فضانوردان و اصلاح مدار ایستگاه فضایی، ژول ورن انباری برای زباله‌ها و پسماندهای ایستگاه بود و فضانوردان در طول چند ماه اقلام دورریختنی را در آن جاسازی کردند."},{"page_url":"https://de.wikipedia.org/wiki/DR_137_149_%E2%80%A6_232","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/SVT_137_Bauart_Hamburg.jpg","page_title":"DR 137 149 … 232","context_page_description":"Die Schnelltriebwagen 137 149 bis 152, 137 224 bis 232 sind eine Triebwagenbaureihe, die ursprünglich im FDt-Netz der Deutschen Reichsbahn als „Bauart Hamburg“ eingesetzt wurden."},{"page_url":"https://tl.wikipedia.org/wiki/Bagyong_Ramon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Kalmaegi_2019-11-19_0240Z.jpg","page_title":"Bagyong Ramon","context_page_description":"Ang Bagyong Ramon; ay isang tropikal at naging Bagyo sa taong Nobyembre 2019 sa karagatang pasipiko ito ay namataan sa 1,000 kilometro silangan ng Catanduanes. ito ay na-muo sa bahagi ng Guam sa karagatang Pasipiko; Binabantaan nito ang mga probinsya ng Aurora, Batanes, Cagayan, Isabela, Bicol at Silangang Visayas sa kalagitnaan buwan ng Nobyembre 2019, Magdadala si Ramon ng malalakas na ulan at malimit na hangin sa silangan dagat ng Pilipinas. Si Ramon ay pumasok sa Philippine Area of Responsibility o PAR noong ika Nobyembre 12, Ito ay lumapag ng ika Nobyembre 19 sa pagitan ng Batanes at Apayao pababa sa Rehiyon ng Ilocos at inaasahang lalabas sa araw ng Nobyembre 21, 2019 sa pagitan ng Dagat ng Timog Tsina at Kanlurang Dagat ng Pilipinas,\\n.\\nMatapos, salan-tain ni Bagyong Quiel ang Cagayan at Isabela dahil sa pag hatak ng Amihan sa hilagang silangan mula sa Japan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Curzon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Pont_%C3%A0_deux_arches_du_Port-la-Claye_%28vue_1%2C_%C3%89duarel%2C_2_juillet_2013%29.png","page_title":"Liste der Monuments historiques in Curzon","context_page_description":"Die Liste der Monuments historiques in Curzon führt die Monuments historiques in der französischen Gemeinde Curzon auf."},{"page_url":"https://sv.wikipedia.org/wiki/Elin_av_Sk%C3%B6vde","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Sankta_Elin_fr_Skallmeja_kyrka_0881.jpg","page_title":"Elin av Skövde","context_page_description":"Elin av Skövde eller Helena av Skövde, även Sankta Elin och Sankta Helena, en högättad kvinna som levde på 1100-talet, betraktas som Västergötlands och Skövdes skyddshelgon. Hon pryder Skövde kommunvapen."},{"page_url":"https://en.wikipedia.org/wiki/Arandas,_Jalisco","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Arandas.png","page_title":"Arandas, Jalisco","context_page_description":"Arandas is a municipality of the Altos Sur region of the state of Jalisco in Mexico. Arandas is also the name of the municipality's main township and the center of the municipal government. It is approximately 2 hours east of Guadalajara.\\nThe population of the town of Arandas was 46,099 as of the census of 2005. The town's main plaza is named Plaza Hidalgo after Miguel Hidalgo y Costilla, known as the father of Mexico's war of independence. The municipality's population as of the census of 2005 was 80,193 and its area was 1,238.02 km²; however, both of these figures have been significantly reduced since 2007 with the creation of the municipality of San Ignacio Cerro Gordo from the western part of what was formerly part of the Arandas municipality. San Ignacio Cerro Gordo was the second-largest community in the municipality before the split, with a population of 9,485 inhabitants, but the largest remaining community besides the city of Arandas is Santa María del Valle, with a population of 3,902 inhabitants."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%BA%D8%B0%D8%A7%D9%87%D8%A7%DB%8C_%DB%8C%D9%87%D9%88%D8%AF%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Matzah_breit.JPG","page_title":"فهرست غذاهای یهودی","context_page_description":"فهرست غذاهای یهودی"},{"page_url":"https://de.wikipedia.org/wiki/Breidenassel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Breidenassel_%282%29.jpg","page_title":"Breidenassel","context_page_description":"Breidenassel ist ein Ortsteil von Marialinden in der Stadt Overath im Rheinisch-Bergischen Kreis in Nordrhein-Westfalen, Deutschland."},{"page_url":"https://es.wikipedia.org/wiki/S%C4%B1rr%C4%B1_S%C3%BCreyya_%C3%96nder","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/S%C4%B1rr%C4%B1_S%C3%BCreyya_%C3%96nder.jpg","page_title":"Sırrı Süreyya Önder","context_page_description":"Sırrı Süreyya Önder es un director de cine, actor, guionista, columnista y político turco con ascendencia turcomana.​ Elegido para el parlamento en 2011 como un independiente respaldado por el Partido Paz y Democracia, al que más tarde se unió.​​​ Él compitió en las elecciones municipales 2014 como candidato a la alcaldía de Estambul, por Pueblos Partido Demócrata, partido hermano del BDP, quedando tercero con 412,875 votos.​ En las elecciones generales del 7 de junio de 2015 fue elegido como diputado por el 1er distrito electoral de la Provincia de Ankara.​"},{"page_url":"https://hu.wikipedia.org/wiki/Mus%C3%A9e_de_Pr%C3%A9histoire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Outil_en_quartz%2C_amas_charbonneux%2C_dated_BC_4400-4300%2C_Mus%C3%A9e_de_Pr%C3%A9histoire%2C_Carnac%2C_2019-09-05.jpg","page_title":"Musée de Préhistoire","context_page_description":"A carnaci őstörténeti múzeum, a Musée de Préhistoire a franciaországi Bretagne félszigetének területén és különösen Carnac környékén fellelhető újkőkorszaki leletek bemutatására koncentrál. A múzeum Európa egyik legjelentősebb, 350 000 feletti darabból álló őstörténeti gyűjteményét őrzi, amelyek 200, köztük 120 megalitikus lelőhelyről származnak. A múzeum elnyerte a „Történelmi emlékhely” és a „Franciaország múzeuma” címeket a francia államtól."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%9A%E5%8E%86%E5%B1%B1%E5%A4%A7%C2%B7%E7%93%A6%E8%A5%BF%E9%87%8C%E8%80%B6%E7%BB%B4%E5%A5%87%C2%B7%E5%BD%BC%E5%BE%97%E9%B2%81%E8%88%8D%E5%A4%AB%E6%96%AF%E5%9F%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/%D0%9F%D0%B5%D1%82%D1%80%D1%83%D1%88%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9.jpg","page_title":"亚历山大·瓦西里耶维奇·彼得鲁舍夫斯基","context_page_description":"亚历山大·瓦西里耶维奇·彼得鲁舍夫斯基苏联军事指挥官，上将军衔，苏联英雄。彼得鲁舍夫斯基曾参与俄国内战和第二次世界大战苏德战争。1953年至1957年，彼得鲁舍夫斯基担任了中国人民解放军总军事顾问和苏联驻华武官。1957年至1959年，彼得鲁舍夫斯基担任了苏联陆军军事学院校长。"},{"page_url":"https://it.wikipedia.org/wiki/Morani_(famiglia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Francesco_Morani.jpg","page_title":"Morani (famiglia)","context_page_description":"I Morani o Morano furono una famiglia polistenese di pittori e scultori attivi tra il XVIII e il XX secolo."},{"page_url":"https://de.wikipedia.org/wiki/VfB_Stuttgart/Namen_und_Zahlen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Antwerpes-Magath.jpg","page_title":"VfB Stuttgart/Namen und Zahlen","context_page_description":"Wichtige Namen und Zahlen, welche die Fußballabteilung des VfB Stuttgart betreffen und die nur in Listenform dargestellt werden können, können neben dem Text mit der momentanen Software in der Wikipedia nur unzureichend dargestellt werden. Daher wird diese Seite genutzt, um im Hauptartikel auf diese Daten hinführen zu können, ohne dass der Artikel selbst dadurch überladen und eine anschauliche Formatierung unmöglich wird."},{"page_url":"https://de.wikipedia.org/wiki/Gebiet_Naryn","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Kyrgyzstan_Ak-Talaa_Raion.png","page_title":"Gebiet Naryn","context_page_description":"Das Gebiet Naryn ist eines von sieben Gebieten der Republik Kirgisistan in Zentralasien.\\nEs liegt im Zentrum des Landes und wird von den Gebieten Tschüi, Yssykköl, Osch und Dschalalabat sowie von China begrenzt. Das Gebiet hat eine Fläche von 45.200 km² und etwa 270.000 Einwohner. Es wurde zu Zeiten der Kirgisischen Sowjetrepublik 1939 als Oblast Tjan-Schan gegründet und führt seinen heutigen Namen seit 1990. Die Bevölkerungsdichte des größten kirgisischen Gebietes ist mit 6 Einwohnern pro km² die niedrigste des Landes. Naryn hat zudem die höchste Geburtenrate in Kirgisistan, 25,2 Geburten auf 1000 Einwohner im Jahr 2005. Der Name leitet sich vom Fluss Naryn und der gleichnamigen Stadt Naryn ab.\\nDas Verwaltungszentrum des Gebietes ist die Stadt Naryn."},{"page_url":"https://es.wikipedia.org/wiki/Dardanelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Estrecho_de_Dardanelos-es.png","page_title":"Dardanelos","context_page_description":"Los Dardanelos o estrecho de los Dardanelos es un estrecho ubicado entre Europa y Asia. Es el antiguo Helesponto de la Grecia clásica. Comunica el mar Egeo con el mar interior de Mármara y su archipiélago. Mide 61 km de longitud, entre 1600 y 6500 m de anchura y tiene una profundidad media de unos 50 m.\\nDel mismo modo que el estrecho del Bósforo divide la ciudad de Estambul entre los continentes asiático y europeo, el estrecho de los Dardanelos separa Europa y Asia. La principal ciudad que limita con el estrecho es Çanakkale, la cual toma su nombre de sus famosos castillos. El nombre de Helesponto con el que era conocido en la Grecia clásica significaba \\"Mar de Hele\\", por ser este el lugar en el que, según la mitología griega, Hele cayó mientras huía junto a su hermano Frixo a lomos del carnero del vellocino de oro. El nombre de Dardanelos deriva de Dardania, una antigua ciudad frigia enclavada en la orilla asiática del estrecho.\\nEl estrecho de los Dardanelos es un antiguo valle fluvial hundido durante el cuaternario. Sus costas son poco accidentadas y en él abunda la pesca."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D1%9A%D0%B8_%D0%9C%D0%B8%D1%85%D0%BE%D1%99%D0%B0%D1%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/DM-Dvorac.jpg","page_title":"Доњи Михољац","context_page_description":"Доњи Михољац је град у Републици Хрватској који административно припада Осјечко-барањској жупанији. Према резултатима пописа из 2011. у граду је живело 9.491 становника, а у самом насељу је живело 6.240 становника. Блаженопочивши патријарх српски господин Павле је рођен у доњомихољачком селу Кућанци."},{"page_url":"https://en.wikipedia.org/wiki/Destruction_in_Okayama_(2015)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Kenny_Omega_IWGP_Junior_Heavyweight_Champion.JPG","page_title":"Destruction in Okayama (2015)","context_page_description":"Destruction in Okayama (2015) was a professional wrestling event promoted by New Japan Pro-Wrestling. The event took place on September 23, 2015, in Okayama, Okayama at the Momotaro Arena. The event featured nine matches, four of which were contested for championships. It was the tenth event under the Destruction name."},{"page_url":"https://en.wikipedia.org/wiki/E_Ola_Ke_Ali%CA%BBi_Ke_Akua","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Prince_Lunalilo_%28PP-98-15-015%29.jpg","page_title":"E Ola Ke Aliʻi Ke Akua","context_page_description":"\\"E Ola Ke Aliʻi Ke Akua\\", translated as God Save the King, was one of Hawaii's four national anthems. It was composed in 1860 by Prince William Charles Lunalilo, who later became King Lunalilo. Prior to 1860, the Kingdom of Hawaiʻi lacked its own national anthem and had used the British royal anthem God Save The King. A contest was sponsored in 1860 by Kamehameha IV, who wanted a song with Hawaiian lyrics set to the tune of the British anthem. The winning entry was written by the 25-year-old Lunalilo and was reputed to have been written in 20 minutes. Lunalilo was awarded 10 dollars which he later donated to the Queen's Hospital. His composition became Hawaiʻi's first national anthem. It remained Hawaiʻi's national anthem until 1866, when it was replaced by Queen Liliʻuokalani's composition He Mele Lāhui Hawaiʻi."},{"page_url":"https://eu.wikipedia.org/wiki/Plestiodon_callicephalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Plestiodon_callicephalus_distribution.png","page_title":"Plestiodon callicephalus","context_page_description":"Plestiodon callicephalus Plestiodon generoko animalia da. Narrastien barruko Scincidae familian sailkatuta dago."},{"page_url":"https://zh.wikipedia.org/zh-cn/1922%E5%B9%B49%E6%9C%8821%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/SE1921Apr08A.png","page_title":"1922年9月21日日食","context_page_description":"1922年9月21日日食是一次日全食，发生于1922年9月21日。新月当天，地球上观测到月球和太阳的角距离极小，此时月球如果恰好在月球交点附近，穿过太阳和地球之间，与地球、太阳接近一直线，则会出现日食。月球本影接触地表而使该区域完全得不到阳光，就会形成日全食，同时在本影两侧数千公里的半影范围内遮挡部分阳光，形成日偏食。此次日全食经过了埃塞俄比亚、意属索马里兰、英属马尔代夫、海峡殖民地圣诞岛、澳大利亚，日偏食则覆盖了非洲东部、亚洲南部、澳大利亚及周边部分地区。"},{"page_url":"https://nl.wikipedia.org/wiki/Toddington_(Bedfordshire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Toddington_%2C_Parish_Church_of_St._George_of_England_-_geograph.org.uk_-_579992.jpg","page_title":"Toddington (Bedfordshire)","context_page_description":"Toddington is een civil parish in het Engelse graafschap Bedfordshire. De plaats ligt enkele kilometers ten noordwesten van Luton, in het district Central Bedfordshire en telt 4585 inwoners."},{"page_url":"https://nv.wikipedia.org/wiki/%C3%81s%C3%A1%C3%AD_Dine%CA%BC%C3%A9_Bik%C3%A9yahd%C4%99%CC%81%C4%99%CC%81%CA%BC_s%C3%A9%C3%ADtah_naalnood%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Acanthodactylus_blanfordii_Omid.jpg","page_title":"Ásáí Dineʼé Bikéyahdę́ę́ʼ séítah naalnoodí","context_page_description":"Ásáí Dineʼé Bikéyahdę́ę́ʼ séítah naalnoodí éí naʼashǫ́ʼii dah yikahjí atah daasdzoh, áádóó éí Ásáí Dineʼé Bikéyahdi dóó Naakaii Łibáhí Bikéyahdi dóó Tsiikʼi Déíbaalí Bikéyahdi dóó Naakaii Dootłʼizhii Bikédaayahdi dahólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Acanthodactylus\\" deiłníigo deiyózhí. Ásáí Dineʼé Bikéyahdę́ę́ʼ séítah naalnoodí éí 40 ałʼąą ádaatʼé.\\nÁsáí Dineʼé Bikéyahdę́ę́ʼ séítah naalnoodí éí chʼosh yázhí dóó naʼashjéʼii deildeeł."},{"page_url":"https://hu.wikipedia.org/wiki/Esztramosi_Fels%C5%91-t%C3%A1r%C3%B3_2._sz._%C3%BCrege","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Esztramosi_Fels%C5%91-t%C3%A1r%C3%B3_2._sz._%C3%BCrege_k%C3%A9pz%C5%91dm%C3%A9ny4.jpg","page_title":"Esztramosi Felső-táró 2. sz. ürege","context_page_description":"Az Esztramosi Felső-táró 2. sz. ürege fokozottan védett barlang. Az Aggteleki Nemzeti Park területén található. Az Aggteleki-karszt és a Szlovák-karszt többi barlangjával együtt 1995 óta a Világörökség része. Az Esztramos-hegy hat fokozottan védett barlangja közül az egyik, a másik öt az Esztramosi Földvári Aladár-barlang, a Rákóczi 1. sz. barlang, a Rákóczi 2. sz. barlang, a Rákóczi 3. sz. barlang és a Rákóczi-oldaltáró barlangja."},{"page_url":"https://en.wikipedia.org/wiki/Lyons-la-For%C3%AAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Vestiges_de_l%27enceinte_fortifi%C3%A9e.JPG","page_title":"Lyons-la-Forêt","context_page_description":"Lyons-la-Forêt is a commune of the Eure department, Haute Normandie in Northwest France.\\nLyons-la-Floret is well known within the region due to its architecture, which has been maintained since its founding in the 17th century. It is also a recognized distinct geophysical and geocultural entity that is the end of Vexin normand, and the forest of Lyons. The area around the town and the border with Pays de Bray is known for its traditional bocage landscape of woods, orchards, and cattle pasture."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A0%83%E6%9C%A8%E7%9C%8C%E3%81%AE%E5%B8%82%E7%94%BA%E6%9D%91%E6%97%97%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Flag_of_Kamikawachi_Tochigi.JPG","page_title":"栃木県の市町村旗一覧","context_page_description":"栃木県の市町村旗一覧は、栃木県内の市町村に制定されている、あるいは制定されていた市町村旗の一覧である。なお、一覧の順序は全国地方公共団体コード順による。廃止された市町村旗は廃止日から順に掲載している。"},{"page_url":"https://sv.wikipedia.org/wiki/Spjutvial","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Lathyrus_aphaca_var._aphaca1LEST.jpg","page_title":"Spjutvial","context_page_description":"Spjutvial är en ört i familjen ärtväxter. Förekommer i Europa till centrala och sydvästra Asien, Pakistan, Indien och Nordafrika. Påträffas också i södra Sverige. Ofta odlad.\\nEttårig, klättrande eller klängande, kal ört. Stjälk kantig, men saknar vingkanter. Bladen är tillbakabildade till ett klänge. Stipler bladlika, 5–30 mm långa, brett äggrunda, spjutlika. Blomställning med 1-2 blommor i klase, i bladvecken. Krona ca 1 cm lång, blekt till klart gul. Frukten är en balja, 18–35 cm lång, 4–6 mm bred, kal, med 4-6 frön. Blommar i juli till september.\\nArtepitetet aphaca är ett gammalt grekiskt växtnamn. Det är dock osäkert om det rörde sig om just spjutvial."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%86%D8%B5%DB%8C%D8%B1_%D8%A7%D9%84%D8%AF%DB%8C%D9%86_%D9%85%D8%AD%D9%85%D9%88%D8%AF_%DA%86%D8%B1%D8%A7%D8%BA_%D8%AF%DB%81%D9%84%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Chiraghdehlidargah.jpg","page_title":"نصیر الدین محمود چراغ دہلوی","context_page_description":"خواجہ نصیر الدین محمود چراغ یا چراغ دہلوی سلسلہ عالیہ چشتیہ کے ممتاز صوفی بزرگ ہیں جنہیں چراغِ سلسلۂ چشت کہا جاتا ہے۔آپ نویں امام حضرت محمد تقی علیہ السلام کی نسل سے تعلق رکھتے ہیں۔"},{"page_url":"https://en.wikipedia.org/wiki/Alise-Sainte-Reine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Canthare_argent_MAN_St_Germain.jpg","page_title":"Alise-Sainte-Reine","context_page_description":"Alise-Sainte-Reine is a commune in the Côte-d'Or department in the Bourgogne-Franche-Comté region of eastern France.\\nThe inhabitants of the commune are known as Alisiens and Alisiennes."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%9F%AC%EB%AA%A8%EB%82%98_%EB%A7%88%EC%BC%80%EC%A6%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Outnumbered_kids.jpg","page_title":"러모나 마케즈","context_page_description":"러모나 마케즈는 잉글랜드의 배우이다."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BB%D1%8F%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9B%D0%B5%D0%B0%D0%BD%D1%96%D0%B4%D0%B0%D0%B2%D1%96%D1%87_%D0%92%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B0%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/%D0%A1%D0%B0%D1%88%D0%B0_%D0%92%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%BE%D0%B2_-_%D0%A4%D0%B8%D0%BD%D0%B0%D0%BB_%D0%BA%D0%BE%D0%BD%D0%BA%D1%83%D1%80%D1%81%D0%B0_%D0%A1%D1%83%D0%BF%D0%B5%D1%80%D0%BC%D0%BE%D0%B4%D0%B5%D0%BB%D1%8C_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D0%B8-1997_-_%D0%9C%D0%B8%D0%BD%D1%81%D0%BA_%D0%BC%D0%B0%D1%80%D1%82_1997_%D0%B3_-_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%BC%D1%83%D0%B7%D0%BA%D0%BE%D0%BC%D0%B5%D0%B4%D0%B8%D0%B8.jpg","page_title":"Аляксандр Леанідавіч Варламаў","context_page_description":"Аляксандр Леанідавіч Варламаў ці часцей Саша Варламаў — беларускі мастак-мадэльер, дызайнер, харэограф, рэжысёр, мастацтвазнаўца, педагог, пісьменнік, паэт.\\nНапісаў звыш 70 навуковых артыкулаў для акадэмічнай энцыклапедыі «Этнаграфія Беларусі».\\nУ 1985—1991 гг. быў рэжысёрам, пастаноўшчыкам і харэографам Мінскага тэатра моды. У 1992 г. заснаваў уласнае прыватнае прадпрыемства «Рэкламнае Агенцтва Сашы Варламава», якое стала прадаўжальнікам традыцый Мінскага тэатра моды і праіснавала да 2013 г. З 1992 па 2001 г. — сааўтар, рэжысёр-пастаноўшчык і харэограф тэатра моды «Modetheater Berlin». У 1997 г. і 2001 г. стаў суарганізатарам і саўдзельнікам самага буйнога сусветнага форума моды «Der große Q» у Берліне — форум 2001 г. занесены ў «Кнігу рэкордаў Гінеса» за самы вялікі подыум у свеце даўжынёй 1111 метраў.\\nАўтар калекцый адзення, а таксама аўтар і пастаноўшчык у 1992—2011 гг. шэрагу праектаў, звязаных з сінтэзам моды, харэаграфіі, музыкі, літаратуры і іншых відаў мастацтва, у тым ліку конкурсу «Супермадэль Беларусі» і фестывалю-конкурсу моды і фота «Млын моды» у Беларусі. Арганізатар паказаў беларускай моды ў краінах Еўропы."},{"page_url":"https://cs.wikipedia.org/wiki/Wac%C5%82aw_Stachiewicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Wac%C5%82aw_Stachiewicz.PNG","page_title":"Wacław Stachiewicz","context_page_description":"Wacław Stachiewicz byl polský generál za druhé světové války.\\nNarodil se v roce 1894 ve Lvově. V roce 1914 vstoupil do Polských legií. Zúčastnil se polsko-sovětské války. Poté byl poslán studovat do Francie na Vysokou válečnou školu. Po návratu se stal profesorem taktiky ve Varšavě. Roku 1928 se stal velitelem 27. pěšího pluku a následující rok byl jmenován velitelem divizní pěchoty v 1. pěší divizi legií ve Vilně. V prosinci 1933 se stal velitelem 7. pěší divize. V roce 1935 byl povýšen na brigádního generála. V červnu 1935 se stal náčelníkem hlavního štábu. Po německé invazi do Polska přešel 18. září 1939 hranice do Rumunska, kde byl internován. Uprchl přes Jugoslávii do Alžíru. Po válce odešel do Kanady."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%82%D1%82%D0%B5%D0%BD%D0%B0%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Kirche_Bicken.jpg","page_title":"Міттенаар","context_page_description":"Міттенаар — громада в Німеччині, знаходиться в землі Гессен. Підпорядковується адміністративному округу Гіссен. Входить до складу району Лан-Дилль.\\nПлоща — 35,17 км². Населення становить 4833 ос."},{"page_url":"https://gl.wikipedia.org/wiki/Punto_triplo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Phase-diag_es.svg","page_title":"Punto triplo","context_page_description":"En física, o punto triplo é a temperatura e presión na que coexisten en equilibrio termodinámico o estado sólido, gasoso e líquido nunha substancia. Defínese cunha temperatura e unha presión de vapor.\\nO punto triplo da auga, por exemplo, está a 273,16 K e a unha presión de 611,73 Pa ITS90. Esta temperatura, debido a que é un valor constante, serve para calibrar as escalas Kelvin e Celsius dos termómetros de gran precisión."},{"page_url":"https://fr.wikipedia.org/wiki/Sant%C3%A9_et_s%C3%A9curit%C3%A9_au_travail","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Children_and_Sugar_beets_Nebraska_1940.jpg","page_title":"Santé et sécurité au travail","context_page_description":"La santé et sécurité au travail désigne diverses disciplines visant à supprimer ou à limiter certains effets nuisibles du travail sur l'être humain.\\nCes notions, apparues relativement récemment dans le champ du droit du travail — au XIXᵉ siècle avec le développement industriel autour duquel s'est progressivement construit le droit du travail —, ont été mises en œuvre avec des premières mesures de protection au bénéfice des travailleurs les plus vulnérables : les femmes et les enfants. L’appellation « santé et sécurité au travail » désigne ce qu'on appelait autrefois « hygiène, sécurité et conditions de travail »."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BC%D0%B8%D1%81%D1%82%D1%8F%D0%B3%D0%B0_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%A4%D0%B5%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/uk/8/8d/Lugwiki-museum_DSC05647-semystjaga-ed.jpg","page_title":"Семистяга Володимир Федорович","context_page_description":"Володи́мир Фе́дорович Семистя́га — український історик і громадський діяч. Старший викладач кафедри історії України Луганського державного університету; член правління Луганської обласної організації Національної спілки краєзнавців України. Голова Луганського обласного об'єднання ВУТ «Просвіта» ім. Тараса Шевченка, головний редактор журналу «Бахмутський шлях». Заслужений працівник освіти України.\\nЛауреат Всеукраїнської премії імені Івана Огієнка."},{"page_url":"https://es.wikipedia.org/wiki/Lucy-le-Bocage","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Lucy-Le-Bocage_Panoramique.jpg","page_title":"Lucy-le-Bocage","context_page_description":"Lucy-le-Bocage es una comuna francesa situada en el departamento de Aisne, de la región de Alta Francia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9C%80%E9%AB%98%E4%BA%BA%E6%B0%91%E4%BC%9A%E8%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Kim_Yong-nam_2015.jpg","page_title":"最高人民会议","context_page_description":"最高人民會議，是朝鮮民主主義人民共和國憲法規定的最高權力機關。\\n最高人民會議代表經朝鮮全國選民直接普選產生，任期五年，現任的第十二屆最高人民會議共由687名代表組成。最高人民會議擁有立法權，並負責選舉朝鮮國務委員會、最高人民會議常任委員會和政府內閣。最高人民會議還負責審查內閣關於國民經濟發展問題和國家財政預算和決算的報告。\\n由於朝鮮是一個一黨執政的國家，最高人民會議的所有代表候選人均由執政黨朝鮮勞動黨挑選。最高人民會議每年召開一次會議，休會期間其職權由常任委員會代行。"},{"page_url":"https://de.wikipedia.org/wiki/William_Friedrich_von_Hammerstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Wilhelm_von_Hammerstein_Litho.JPG","page_title":"William Friedrich von Hammerstein","context_page_description":"William Friedrich von Hammerstein aus dem Hause Equord war ein österreichischer General der Kavallerie. William war der Bruder von Hans Georg von Hammerstein-Equord. Aus der Familie der Freiherren von Hammerstein entstammten schon zuvor hohe Generäle und Regimentsinhaber in preußischen und kurhannoverschen Diensten."},{"page_url":"https://pl.wikipedia.org/wiki/Louroux-de-Beaune","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Eglise_de_Louroux-de-Beaune.jpg","page_title":"Louroux-de-Beaune","context_page_description":"Louroux-de-Beaune – miejscowość i gmina we Francji, w regionie Owernia-Rodan-Alpy, w departamencie Allier."},{"page_url":"https://id.wikipedia.org/wiki/Alahan_Panjang,_Lembah_Gumanti,_Solok","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/COLLECTIE_TROPENMUSEUM_Danau_di_Atas_TMnr_60011329.jpg","page_title":"Alahan Panjang, Lembah Gumanti, Solok","context_page_description":"Alahan Panjang adalah salah satu nagari di Kecamatan Lembah Gumanti, Kabupaten Solok, Sumatra Barat, Indonesia. Nagari yang berjarak sekitar 65 km dari Kota Padang ini berada di atas Bukit Barisan tepatnya di lereng bagian timur kawasan Taman Nasional Kerinci Seblat pada ketinggian 1.400–1.600 mdpl. Nagari terdekat yakni Air Dingin Barat, Salimpat, dan Sungai Nanam."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Mille_et_Une_Nuits_(film,_1974)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Fioremilleeunanotte-Citti.png","page_title":"Les Mille et Une Nuits (film, 1974)","context_page_description":"Les Mille et Une Nuits est un film italien réalisé par Pier Paolo Pasolini, sorti en 1974.\\nCe film est une adaptation de l'ancienne anthologie Les Mille et Une Nuits. C'est le dernier volet de la Trilogie de la Vie, après Le Décaméron et Les Contes de Canterbury. Le personnage principal est joué par le jeune Franco Merli qui a été découvert à cette occasion par Pasolini.\\nLe film contient beaucoup de nudité, de sexe et de comique visuel. Il préserve l'érotisme et l'emboîtement des récits des Mille et Une Nuits. L'écrivain Robert Irwin le décrit comme « sans doute la meilleure et la plus intelligente adaptation des Mille et Une Nuits au cinéma. »"},{"page_url":"https://da.wikipedia.org/wiki/1970","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ed_Begley_1958.jpg","page_title":"1970","context_page_description":"Konge i Danmark: Frederik 9. 1947-1972\\nSe også 1970"},{"page_url":"https://en.wikipedia.org/wiki/Rian_Lindell","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Rian_Lindell_2012_training_camp.jpg","page_title":"Rian Lindell","context_page_description":"Rian David Lindell is a former American football placekicker in the National Football League for the Seattle Seahawks, Buffalo Bills and Tampa Bay Buccaneers. He played college football at Washington State."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A4%E1%83%A0%E1%83%94%E1%83%92%E1%83%90%E1%83%A2%E1%83%98_(%E1%83%99%E1%83%A3%E1%83%9C%E1%83%AB%E1%83%A3%E1%83%9A%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Geografia_de_seychelles_ES.jpg","page_title":"ფრეგატი (კუნძული)","context_page_description":"ფრეგატი — სეიშელის შიდა კუნძულების ერთ-ერთი კუნძული. მდებარეობს ინდოეთის ოკეანეში, ეკუთვნის სეიშელის კუნძულების სახელმწიფოს. მდებარეობს 55 კმ-ით აღმოსავლეთით კუნძულ მაედან. ფართობი — 2,19 კმ². ცნობილია როგორც განმარტოვებული კერძო კურორტი. ჟურნალმა «Times»-მა ფრეგატის პლაჟები მიიჩნია მსოფლიოში ყველაზე საუკეთესოებად."},{"page_url":"https://tr.wikipedia.org/wiki/Do%C4%9Fu_Asya_Zirvesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Rodrigo_Duterte_and_Laotian_President_Bounnhang_Vorachith_%28cropped%29.jpg","page_title":"Doğu Asya Zirvesi","context_page_description":"Doğu Asya Zirvesi, Doğu Asya, Güneydoğu Asya ve Güney Asya'nın 16 ülkesinin liderleri tarafından her yıl düzenlenen bir forumdur. 2011'de ABD ve Rusya'nın da zirveye ortak olmalarıyla üye sayısı 18'e çıkmıştır. EAS toplantıları, yıllık ASEAN liderlerinin toplantılarından sonra yapılmaktadır. İlk zirve 14 Aralık 2005 tarihinde Malezya'nın Kuala Lumpur kentinde gerçekleştirildi."},{"page_url":"https://en.wikipedia.org/wiki/Pelton_wheel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Pelton_wheel_%28patent%29.png","page_title":"Pelton wheel","context_page_description":"A Pelton wheel is an impulse-type water turbine invented by Lester Allan Pelton in the 1870s. The Pelton wheel extracts energy from the impulse of moving water, as opposed to water's dead weight like the traditional overshot water wheel. Many earlier variations of impulse turbines existed, but they were less efficient than Pelton's design. Water leaving those wheels typically still had high speed, carrying away much of the dynamic energy brought to the wheels. Pelton's paddle geometry was designed so that when the rim ran at half the speed of the water jet, the water left the wheel with very little speed; thus his design extracted almost all of the water's impulse energy—which allowed for a very efficient turbine."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%81%D0%B8%D1%85%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F_%D0%B2%D0%BE%D1%81%D0%BF%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Kennet_uniform.jpg","page_title":"Психология воспитания","context_page_description":"«Психология воспитания» — книга французского философа, историка, естествоиспытателя, врача и создателя социальной психологии Гюстава Лебона, автора «Психологии масс». Книга, изданная в 1902, является критическим исследованием французской и мировой системы воспитания и образования, в которой Лебон сформулировал собственные принципы процесса обучения и воспитания, основанные на психологических законах. Переведена на многие языки мира с многочисленными переизданиями. На данный момент русское издание книги не обнаружено, хотя в предисловии к 16 французскому изданию 1920 года Лебон пишет: \\"Sur la première page de la traduction russe on lit: «Cette traduction a été faite par le général Serge Boudaïevsky, sur le désir exprimé par Son Altesse Impériale le grand-duc Constantin Constantinovich, président de l’Académie des Sciences et directeur des Écoles militaires de la Russie.» — \\"На титульном листе русского перевода читаем: «Этот перевод был совершён генералом Сергеем Будаевским, по желанию, выраженном Его Императорским Высочеством великим князем Константином Константиновичем, президентом Академии Наук и директором Военно-учебных заведений России.»"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CF%8C%CF%87%CE%BF%CF%85%CF%83%CE%BB%CE%B1%CE%B2_%CE%A3%CE%BF%CE%BC%CF%80%CF%8C%CF%84%CE%BA%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Tallinn_Digital_Summit._Arrivals_Bohuslav_Sobotka_%2823536638518%29_%28cropped%29.jpg","page_title":"Μπόχουσλαβ Σομπότκα","context_page_description":"Ο Μπόχουσλαβ Σομπότκα είναι Τσέχος πολιτικός, ο οποίος διετέλεσε πρωθυπουργός της χώρας από τις 29 Ιανουαρίου 2014 ως τις 13 Δεκεμβρίου 2017. Είναι, επίσης, ηγέτης του Τσεχικού Σοσιαλδημοκρατικού Κόμματος από τις 29 Μαΐου 2010. Εξελέγη για πρώτη φορά στη Βουλή των Αντιπροσώπων της Τσεχικής Δημοκρατίας το 1996. Από το 2002 μέχρι το 2006 διετέλεσε υπουργός Οικονομικών της Τσεχίας. Διετέλεσε, επίσης, αναπληρωτής πρωθυπουργός τις περιόδους 2003-2004 και 2005-2006.\\nΜετά την παραίτηση του Γίρι Πάρουμπεκ από τη θέση του ηγέτη του Τσεχικού Σοσιαλδημοκρατικού Κόμματος ύστερα από τις εκλογές του 2010, ο Σομπότκα έγινε υπηρεσιακός ηγέτης του κόμματος, θέση στην οποία βρέθηκε και μετά την παραίτηση του Στάνισλαβ Γκρος από τις 26 Απριλίου 2005 μέχρι τις 13 Μαΐου 2006. Στις 18 Μαρτίου 2011 ορίστηκε επισήμως ως πρόεδρος του κόμματος.\\nΣτην κυβέρνησή του συμμετέχουν, εκτός από το Τσεχικό Σοσιαλδημοκρατικό Κόμμα, και τα κόμματα Δράση Δυσαρεστημένων Πολιτών 2011 και Χριστιανική και Δημοκρατική Ένωση-Τσεχοσλοβάκικο Λαϊκό Κόμμα.\\nO Σομπότκα στις 2 Μαΐου 2017 ανακοίνωσε ότι θα παραιτηθεί εξαιτίας της ασυμφωνίας του με τον υπουργό Οικονομικών Αντρέι Μπάμπις."},{"page_url":"https://en.wikipedia.org/wiki/Furlo_Pass","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Furlo_Gorge.jpg","page_title":"Furlo Pass","context_page_description":"The Furlo Pass is a gorge on the ancient Roman road Via Flaminia in the Marche region of central Italy, where it passes near the Candigliano river, a tributary of the Metauro.\\nThe gorge was formed between the Pietralata and Paganuccio mountains by the river Candigliano, which whooshed in full spate through the district until it was dammed in 1922. Since 2001 it has been included in a State Natural Reserve of the same name. It is often marketed to tourists in the region as the \\"Grand Canyon of Italy.\\"\\nThe Roman emperor Vespasian had a tunnel built here to facilitate passage on the Via Flaminia at the narrowest point of the gorge. Next to it is a similar but smaller tunnel dating from Etruscan times. The tunnel has a length of 38.30 meters and a height of 5.95 meters. During the Gothic Wars, the Ostrogoth King Totila had the pass fortified, but his troops were ousted by the Roman general Belisarius. The Lombards conquered the pass between 570 and 578, and destroyed the fortifications.\\nIn the following centuries Via Flaminia was nearly abandoned. In 1502 Lucrezia Borgia used it on a journey to Ferrara and in 1506 Julius II took the road on his way to Bologna."},{"page_url":"https://fr.wikipedia.org/wiki/Grande_exposition_industrielle_de_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Berlin%2C_Treptow%2C_Gewerbeausstellung_1896%2C_Wasserturm.jpg","page_title":"Grande exposition industrielle de Berlin","context_page_description":"La grande exposition industrielle de Berlin est une exposition non reconnue par le Bureau International des Expositions qui se tient dans le parc de Treptow de Berlin, en 1896."},{"page_url":"https://en.wikipedia.org/wiki/InSight","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/PIA22745-Mars-InSightLander-ArtistConcept-20181030.jpg","page_title":"InSight","context_page_description":"The Interior Exploration using Seismic Investigations, Geodesy and Heat Transport mission is a robotic lander designed to study the deep interior of the planet Mars. It was manufactured by Lockheed Martin Space Systems, is managed by NASA's Jet Propulsion Laboratory, and most of its scientific instruments were built by European agencies. The mission launched on 5 May 2018 at 11:05 UTC aboard an Atlas V-401 rocket and successfully landed at Elysium Planitia on Mars on 26 November 2018 at 19:52:59 UTC. InSight traveled 483 million km during its journey.\\nInSight's objectives are to place a seismometer, called SEIS, on the surface of Mars to measure seismic activity and provide accurate 3D models of the planet's interior; and measure internal heat flow using a heat probe called HP³ to study Mars' early geological evolution. This could bring a new understanding of how the Solar System's terrestrial planets – Mercury, Venus, Earth, Mars – and Earth's Moon form and evolve.\\nThe lander was originally planned for launch in March 2016. An instrument problem delayed the launch beyond the 2016 launch window."},{"page_url":"https://lv.wikipedia.org/wiki/Klodzko_apri%C5%86%C4%B7is","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Lewin_K%C5%82odzki%2C_Poland%2C_2-14167.jpg","page_title":"Klodzko apriņķis","context_page_description":"Klodzko apriņķis ir apriņķis Polijā, Lejassilēzijas vojevodistē. Robežojas ar Lejassilēzijas vojevodistes Valbžihas, Dzeržoņovas un Zombkovices apriņķiem, kā arī Čehiju."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A7%E3%83%AB%E3%83%8A%E3%83%B3%E3%83%89%E3%83%BB%E3%83%88%E3%83%BC%E3%83%AC%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Torres_running_at_goal_-_CdR_-_RM_v_ATL_%28cropped%29.jpg","page_title":"フェルナンド・トーレス","context_page_description":"フェルナンド・ホセ・トーレス・サンスは、スペイン・マドリード州フエンラブラダ出身の元サッカー選手。元スペイン代表。現役時代のポジションはフォワード。\\nリヴァプールFCに所属していた2007-08シーズンにリーグ戦1シーズン24得点をあげるなどプレミアリーグを代表する選手とみなされていた。スペイン代表としてはUEFA EURO 2004、2006 FIFAワールドカップ、UEFA EURO 2008、2010 FIFAワールドカップ、UEFA EURO 2012、2014 FIFAワールドカップの6つの主要大会に出場し、UEFA EURO 2008では決勝のドイツ戦で決勝ゴールをあげ、チームの優勝に貢献した。またUEFA EURO 2012ではベンチスタートが多く約190分という長くはない出場時間ながら3得点1アシストを決め大会得点王に輝いた。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%B0-%D0%A2%D1%80%D0%BE%D1%96%D1%86%D0%BA%D0%B0%D1%8F_%D1%86%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_(%D0%92%D0%BE%D0%B9%D1%81%D0%BA%D0%B0%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/%D0%92%D0%BE%D0%B9%D1%81%D0%BA%D0%B0%D1%8F._%D0%A6%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_2.jpg","page_title":"Свята-Троіцкая царква (Войская)","context_page_description":"Свята-Троіцкая царква — праваслаўны храм у гонар Святой Троіцы ў агр. Войская Камянецкага раёна Брэсцкай вобласці.\\nПабудавана ў паўднёва-ўсходняй частцы вёскі ў 1751—1775 гг. з дрэва як уніяцкая."},{"page_url":"https://it.wikipedia.org/wiki/Giovanni_di_Martino_da_Fiesole","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Palazzo_Ducale_%28Venice%29.jpg","page_title":"Giovanni di Martino da Fiesole","context_page_description":"Giovanni di Martino da Fiesole è stato uno scultore italiano attivo soprattutto in Toscana che realizzò opere anche a Venezia."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%B9%CE%B3%CF%85%CF%80%CF%84%CE%B9%CE%B1%CE%BA%CE%AE_%CF%87%CE%AE%CE%BD%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Egyptian-Goose.jpg","page_title":"Αιγυπτιακή χήνα","context_page_description":"Η Αιγυπτιακή χήνα είναι υδρόβιο νηκτικό πτηνό της οικογενείας των Νησσιδών. Η επιστημονική ονομασία του είδους είναι Alopochen aegyptiaca και δεν περιλαμβάνει υποείδη.\\nΠαρόλο που πρόκειται για αφρικανικό είδος, λόγω του εντυπωσιακού της παρουσιαστικού, η αιγυπτιακή χήνα έχει εισαχθεί σε πολλές ευρωπαϊκές χώρες, ακόμη και στην Ασία και την Αμερική, ενώ σε πολλές άλλες αποτελεί έκθεμα των ζωολογικών κήπων."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%97%A0%E8%BD%A8%E7%94%B5%E8%BD%A6%E7%B3%BB%E7%BB%9F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Salzburg_trolleybus.jpg","page_title":"无轨电车系统列表","context_page_description":"无轨电车系统列表，列出世界各城市运营中及已停运的无轨电车系统。"},{"page_url":"https://en.wikipedia.org/wiki/Google_Fonts","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/%E0%B8%9E%E0%B8%A3%E0%B9%89%E0%B8%AD%E0%B8%A1_%E0%B8%81%E0%B8%B9%E0%B9%80%E0%B8%81%E0%B8%B4%E0%B8%A5%E0%B8%9F%E0%B8%AD%E0%B8%99%E0%B8%95%E0%B9%8C_Prompt_a_Tha_font_Sample.jpg","page_title":"Google Fonts","context_page_description":"Google Fonts is a library of 999 free licensed font families, an interactive web directory for browsing the library, and APIs for conveniently using the fonts via CSS and Android."},{"page_url":"https://de.wikipedia.org/wiki/Alt_St._Mauritius_(K%C3%B6ln-Buchheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Alt_St._Mauritius_%28K%C3%B6ln-Buchheim%29_%282%29.JPG","page_title":"Alt St. Mauritius (Köln-Buchheim)","context_page_description":"Die romanische Friedhofskapelle Alt St. Mauritius ist der erhaltene Teil der früheren Pfarrkirche von Buchheim, das 1914 nach Köln eingemeindet wurde. Sie befindet sich auf dem Friedhof Sonderburger Straße."},{"page_url":"https://ta.wikipedia.org/wiki/100_%E0%AE%AA%E0%AF%8A%E0%AE%B0%E0%AF%81%E0%AE%9F%E0%AF%8D%E0%AE%95%E0%AE%B3%E0%AE%BF%E0%AE%B2%E0%AF%8D_%E0%AE%89%E0%AE%B2%E0%AE%95_%E0%AE%B5%E0%AE%B0%E0%AE%B2%E0%AE%BE%E0%AE%B1%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/British_Museum_otter_pipe.jpg","page_title":"100 பொருட்களில் உலக வரலாறு","context_page_description":"100 பொருள்களில் உலக வரலாறு என்பது, பிபிசி ரேடியோ 4, பிரித்தானிய அருங்காட்சியகம் ஆகியவை இணைந்து செயற்படுத்திய ஒரு திட்டம். இத்திட்டத்தில் பிரித்தானிய அருங்காட்சியகத்தின் பணிப்பாளர் நீல் மக்கிரெகர் எழுதி வழங்கிய 100 பகுதிகளைக் கொண்ட ஒரு வானொலித் தொடர் நிகழ்ச்சியும் அடங்கும். ரேடியோ 4ல் ஒலிபரப்பான இந்த 15 நிமிட தொடர் நிகழ்ச்சியில், உலக வரலாற்றை விளக்குவதற்காக பிரித்தானிய அருங்காட்சியகத்தில் உள்ள கலை, தொழிற்துறை, தொழில்நுட்பம், படைக்கலங்கள் போன்றவை அடங்கிய 100 பொருட்களைப் பயன்படுத்தினர். நான்கு ஆண்டுகள் எடுத்துக்கொண்ட இத்திட்டம், முதலாவது நிகழ்ச்சியை 18 சனவரி 2010ல் தொடங்கி 20 வாரங்கள் ஒலிபரப்பியது. \\"100 பொருள்களில் உலக வரலாறு\\""},{"page_url":"https://eu.wikipedia.org/wiki/Siriako_arrosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Garden_Hibiscus.JPG","page_title":"Siriako arrosa","context_page_description":"Siriako arrosa edo Siriako hibiskoa hibisko mota bat da, ezaguna bere lore ederrarengatik. Munduko parte askotan lantzen da apaingarri-lore moduan. Landare hostogalkorra da."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Finlands_statsministre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Prime_Minister_of_Finland_Sanna_Marin_2019_%28cropped%29.jpg","page_title":"Liste over Finlands statsministre","context_page_description":"Liste over Finlands statsministre og Finlands regjeringer fra og med selvstendigheten i 1917, gir en oversikt over navn, datoer og sammensetningen av koalisjonsregjeringer."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%82%A3%E8%8B%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%E9%82%A3%E8%8B%B1_Na_Ying.jpg","page_title":"那英","context_page_description":"那 英は、中国遼寧省瀋陽市出身の女性歌手。"},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Perdana_Menteri_Iran","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Samsam_Saltaneh.jpg","page_title":"Daftar Perdana Menteri Iran","context_page_description":"Ini adalah daftar Perdana Menteri Iran dari pembuatan jabatan tersebut pada 1906 saat Revolusi Konstitusional Iran, sampai 1989 ketika jabatan tersebut ditiadakan setelah referendum konstitusional. Perdana Menteri adalah Kepala Pemerintahan Iran.\\nMirza Nasrullah Khan adalah Perdana Menteri Iran pertama dan Mir-Hossein Mousavi adalah Perdana Menteri Iran terakhir, setelah revolusi konstitusional 1906. Sebelum revolusi konstitusional tersebut, Shah Iran juga memiliki Viziers yang merupakan gelar dalam bahasa Persia yang setara dengan Perdana Menteri, seperti Bozorgmehr, Nizam al-Mulk, dan Amir Kabir."},{"page_url":"https://tr.wikipedia.org/wiki/Maggie_MacNeal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Maggie_MacNeal_2015_1235.jpg","page_title":"Maggie MacNeal","context_page_description":"Maggie MacNeal Hollandalı şarkıcı. 1980 Eurovision Şarkı Yarışması'nda ülkesi Hollanda'yı temsil etmesiyle bilinir."},{"page_url":"https://en.wikipedia.org/wiki/Torreyanic_acid","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Bio-retrosynthesis_of_torreyanic_acid.png","page_title":"Torreyanic acid","context_page_description":"Torreyanic acid is a dimeric quinone first isolated and by Lee et al. in 1996 from an endophyte, Pestalotiopsis microspora. This endophyte is likely the cause of the decline of Florida torreya, an endangered species that is related to the taxol-producing Taxus brevifolia. The natural product was found to be cytotoxic against 25 different human cancer cell lines with an average IC50 value of 9.4 µg/mL, ranging from 3.5 to 45 µg/mL. Torreyanic acid was found to be 5-10 times more potent in cell lines sensitive to protein kinase C agonists, 12-o-tetradecanoyl phorbol-13-acetate, and was shown to cause cell death via apoptosis. Torreyanic acid also promoted G1 arrest of G0 cynchronized cells at 1-5 µg/mL levels, depending on the cell line. It has been proposed that the eukaryotic translation initiation factor EIF-4a is a potential biochemical target for the natural compound."},{"page_url":"https://sv.wikipedia.org/wiki/St%C3%B6rre_barbett","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Great_Himalayan_Barbet.JPG","page_title":"Större barbett","context_page_description":"Större barbett är en fågel i familjen asiatiska barbetter inom ordningen hackspettartade fåglar."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%88%D8%B4%D9%88%DB%8C%D9%85%DA%86%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Main_Lagerstrasse_-_panoramio.jpg","page_title":"اوشویمچین","context_page_description":"اوشویمچین یک شهر در لهستان است که در Gmina Oświęcim واقع شده‌است."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC_%D0%BA%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B5_%E2%80%9E%D0%92%D1%83%D0%BA_%D0%9A%D0%B0%D1%80%D0%B0%D1%9F%D0%B8%D1%9B%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Dom_kulture%2C_Loznica_006.jpg","page_title":"Дом културе „Вук Караџић“","context_page_description":"Дом културе „Вук Караџић“ у Лозници је завршен 7. новембра 1937. године. Тог дана Дом је освећен и предат на управљање просветном друштву Караџић. Зграда дома је споменик културе."},{"page_url":"https://sv.wikipedia.org/wiki/Xanthia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Xanthia_togata_FvL.jpg","page_title":"Xanthia","context_page_description":"Xanthia är ett släkte av fjärilar som beskrevs av Ferdinand Ochsenheimer 1816. Xanthia ingår i familjen nattflyn."},{"page_url":"https://es.wikipedia.org/wiki/Ciclov%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Cafayate_4.jpg","page_title":"Ciclovía","context_page_description":"Ciclovía, carril bici, bicisenda, ciclorruta, vía ciclista, o ciclopista​ es el nombre genérico dado a parte de la infraestructura pública u otras áreas destinadas de forma exclusiva para la circulación de bicicletas. La ciclovía puede ser cualquier carril de una vía pública que ha sido señalizado apropiadamente para este propósito o una vía creada independiente donde sólo se permite el tránsito de bicicletas."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%B7%E3%82%89%E3%81%A3%E3%81%A8%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Himawari_Taxi_PurattoBus_81.jpg","page_title":"ぷらっとバス","context_page_description":"ぷらっとバスは、宮崎県日向市が総合政策部総合政策課を所管として運行するコミュニティバスである。\\n日向市では、コミュニティバスとして、主に中心市街地および中心部に近い地域を運行するぷらっとバス、中心市街地と市南部の地域を結んで運行する南部ぷらっとバス、市南部地域で運行する乗合バスなんぶ、旧東郷町域で運行する乗合バスとうごうがある。本記事では日向市の運営するすべてのコミュニティバスについて記述する。いずれも自家用自動車による有償運送である。"},{"page_url":"https://en.wikipedia.org/wiki/Orthodox_Judaism","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Chofetzreal.jpg","page_title":"Orthodox Judaism","context_page_description":"Orthodox Judaism is the traditionalist branches of contemporary Rabbinic Judaism. Theologically, it is chiefly defined by regarding the Torah, both Written and Oral, as literally revealed by God on Mount Sinai and faithfully transmitted ever since.\\nOrthodox Judaism therefore advocates a strict observance of Jewish Law, or halakha, which is to be interpreted and determined only according to traditional methods and in adherence to the continuum of received precedent through the ages. It regards the entire halakhic system as ultimately grounded in immutable revelation, essentially beyond external and historical influence. More than any theoretical issue, obeying the dietary, purity, ethical, and other laws of halakha is the hallmark of Orthodoxy. Other key doctrines include belief in a future bodily resurrection of the dead, divine reward and punishment for the righteous and the sinners, the Election of Israel as a people bound by a covenant with God, and an eventual Messianic Age ruled by a salvific Messiah-King who will restore the Temple in Jerusalem.\\nOrthodox Judaism is not a centralized denomination."},{"page_url":"https://sv.wikipedia.org/wiki/Cylinderdubbelfotingar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Tachypodoiulus_niger_1.jpg","page_title":"Cylinderdubbelfotingar","context_page_description":"Cylinderdubbelfotingar är en ordning av mångfotingar. Cylinderdubbelfotingar ingår i klassen dubbelfotingar, fylumet leddjur och riket djur. Enligt Catalogue of Life omfattar ordningen Julida 1086 arter.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%AD_%EC%A0%9C%EB%B0%A7_%EC%8A%A4%ED%83%80%EB%94%94%EC%9B%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Hang_Jebat_Stadium_-_Interior.JPG","page_title":"항 제밧 스타디움","context_page_description":"항 제밧 스타디움은 말라카 술탄의 이름을 따서 말레이시아 믈라카 크루 봉 파야 러풋에 있는 다목적 경기장이다. 40,000명을 수용할 수 있으며, 말라카 유나이티드가 홈구장으로 사용하고 있다. 현재 주로 축구 경기에 사용되고 있다."},{"page_url":"https://pl.wikipedia.org/wiki/Ventabren","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Aqueduc_de_Roquefavour.JPG","page_title":"Ventabren","context_page_description":"Ventabren – miejscowość i gmina we Francji, w regionie Prowansja-Alpy-Lazurowe Wybrzeże, w departamencie Delta Rodanu, nad rzeką Arc.\\nWedług danych na rok 1990 gminę zamieszkiwały 3742 osoby, a gęstość zaludnienia wynosiła 142 osoby/km²."},{"page_url":"https://en.wikipedia.org/wiki/Zicca","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Biologia_Centrali-Americana_-_Zicca_taeniola.jpg","page_title":"Zicca","context_page_description":"Zicca is a genus of leaf-footed bugs in the family Coreidae. There are about 19 described species in Zicca."},{"page_url":"https://en.wikipedia.org/wiki/The_Creative_Circus","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Creativecircus.jpeg","page_title":"The Creative Circus","context_page_description":"The Creative Circus is a private, for-profit college in Atlanta, Georgia. It was founded in 1995 and focuses on Creative Advertising, Interactive Development, Design, and Photography. The college requires students to develop a portfolio of professional quality work."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A7%91%EC%A0%81_%ED%9A%8C%EB%A1%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Diopsis.jpg","page_title":"집적 회로","context_page_description":"집적 회로 또는 모놀리식 집적회로, 칩, 마이크로칩, IC는 반도체에 만든 전자회로의 집합을 말한다. 집적회로는 여러 독립된 요소를 집적해서 하나의 칩으로 만든 것인데, 각각의 트랜지스터 칩을 이용해서 회로로 만들 때 보다 훨씬 작게 만들 수 있다. 집적회로는 손톱수준의 크기에 수십억 개의 트랜지스터나 다른 전자부품이 들어갈 수 있을 정도로 조밀하게 만들 수 있다. 기술이 발전할수록 회로선폭은 점점 더 세밀해진다. 2008년에는 100나노미터 미만으로 떨어졌고, 지금은 수십 나노미터이다.\\n반도체 소자가 진공관처럼 증폭기 및 스위치 역할을 할 수 있다는 것이 밝혀 지고, 반도체 제작 기술이 발달하면서, 집적회로를 만들 수 있게 되었다. 매우 많은 수의 작은 트랜지스터를 작은 칩에 합치는 것은 전자 부품을 이용하여 손으로 회로를 조립하는 것을 넘어서는 굉장한 발전이었다. 집적회로의 대량생산 능력, 신뢰성, 회로 설계에 대한 빌딩블록 방식 접근은 이산 트랜지스터를 이용하던 산업이 빠르게 집적회로를 적용할 수 있도록 하였다.\\n집적회로는 이산회로에 비교해서, 비용과 성능이라는 두 가지 주요한 장점이 있다. 한 번에 하나의 트랜지스터를 조립하는 방식과는 달리 사진석판술을 이용하여 모든 부품을 한꺼번에 찍어내기 때문에 비용이 낮아 진다. 또한, 크기가 작고 부품들이 조밀하게 설계되어, 동작 속도가 빨라지고, 전력 소모는 줄어들게 된다. 2012년, 전형적인 집적회로의 크기는 수 제곱 밀리미터에서 약 450제곱 밀리미터였고, 제곱 밀리미터당 약 9백만 개의 트랜지스터가 들어있었다.\\n집적회로는 전자공학에 혁명을 일으켰고 오늘날 거의 모든 전자장비에 사용된다. 현대사회에서 필수불가결한 컴퓨터, 휴대폰 그리고 다른 모든 가전기기들은 싼 가격의 집적회로 덕분에 가능한 것들이다."},{"page_url":"https://es.wikipedia.org/wiki/Hyla_versicolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/2GreyTreeFrogs.JPG","page_title":"Hyla versicolor","context_page_description":"La rana arbórea gris es una especie de anfibios de la familia Hylidae. Habita en el este de los Estados Unidos y el sureste de Canadá.​"},{"page_url":"https://cs.wikipedia.org/wiki/Dexter_(plemeno_skotu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Brambledel_Frodo.JPG","page_title":"Dexter (plemeno skotu)","context_page_description":"Dexter je nejmenší evropské plemeno skotu. Je to trpasličí verze irského plemene kerry, výška krav v kříži je pouze 96–104 cm a hmotnost okolo 300 kg. Je to skot s dvoustrannou užitkovostí, dlouhověký a nenáročný, populární zvláště v malých domácích chovech."},{"page_url":"https://en.wikipedia.org/wiki/Ferrari_250_GT_Lusso","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Ferrari_250_GT_Lusso_4.jpg","page_title":"Ferrari 250 GT Lusso","context_page_description":"The Ferrari 250 GT Berlinetta Lusso is a GT car which was manufactured by Italian automaker Ferrari from 1962 to 1964. Sometimes known as the GTL, GT/L or just Lusso, it is larger and more luxurious than the 250 GT Berlinetta. The 250 GT Lusso, which was not intended to compete in sports car racing, is considered to be one of the most elegant Ferraris.\\nKeeping in line with the Ferrari \\"tradition\\" of that time, the 250 GT Lusso was designed by the Turinese coachbuilder Pininfarina, and bodied by Carrozzeria Scaglietti. Although the interior was more spacious than that of the 250 GT, the 250 GT Lusso remained a two-seat GT coupe, unlike the 250 GTE. The car was manufactured for only eighteen months, from 1962 to mid 1964, and was the last model of Ferrari 250 GT generation.\\nAuto shows often provide an opportunity for manufacturers to introduce new designs publicly. Ferrari did so at the 1962 Paris Motor Show to unveil, as a prototype, the 250 GT Lusso. The prototype was almost identical to the production version, and only minor details changed thereafter."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D0%B4%D0%B6%D1%83%D0%BE%D1%82%D1%8A%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Edgewater.jpg","page_title":"Еджуотър","context_page_description":"Еджуотър е град в окръг Джеферсън, щата Колорадо, САЩ. Еджуотър е с население от 5159 жители и обща площ от 1,8 km². Намира се на 1640 m надморска височина. ЗИП кодът му е 80214, а телефонният му код е 303, 720."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Neirone","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Neirone-panorama.jpg","page_title":"Neirone","context_page_description":"Neirone sī Italia Liguria toā-khu Genova Séng ê chi̍t ê comune."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%9C%D0%B0%D0%BB%D1%8B%D1%88%D0%B5%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Flag_of_Malysheva_%28Sverdlovsk_oblast%29.png","page_title":"Флаг Малышева","context_page_description":"Флаг Малышевского городского округа — официальный символ муниципального образования «Малышевский городской округ» Свердловской области Российской Федерации.\\nФлаг утверждён 24 января 2008 года и внесён в Государственный геральдический регистр Российской Федерации с присвоением регистрационного номера 3769."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_the_London_Borough_of_Camden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/St_George%27s%2C_Queen_Square_-_geograph.org.uk_-_1657419.jpg","page_title":"Grade II* listed buildings in the London Borough of Camden","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the London Borough of Camden."},{"page_url":"https://fr.wikipedia.org/wiki/Nijni_Novgorod","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Appeal_of_Minin.jpg","page_title":"Nijni Novgorod","context_page_description":"Nijni Novgorod ou Nijni-Novgorod est une des principales villes de Russie. Elle est située dans la partie centrale de la Russie européenne au confluent de la Volga et de l'Oka, à 402 km à l'est-nord-est de la capitale du pays Moscou. Sa population s'élève à 1 266 871 habitants en 2016, ce qui en fait la cinquième agglomération de Russie. La ville est la capitale de l'oblast de Nijni Novgorod, du district fédéral de la Volga et le centre économique de la région économique de Volga-Viatka.\\nNijni Novgorod est fondée en 1221 par le prince Iouri II de Vladimir. En 1612, Kouzma Minine et le prince Dmitri Pojarski organisent une grande armée pour libérer Moscou des Polonais. En 1817, Nijni Novgorod est le plus grand centre commercial de l'Empire russe. En 1896 s'y déroule l'exposition russe de l'industrie et du commerce. Durant la période soviétique, la ville devient un important centre industriel. Elle est rebaptisée Gorki. On y construit l'usine d'automobiles de Gorki. Au cours de la Seconde Guerre mondiale, Gorki devient le plus grand fournisseur d'équipements militaires pour le front. Pour cette raison, la Luftwaffe bombarde constamment la ville."},{"page_url":"https://sco.wikipedia.org/wiki/Prince_August_Leopold_o_Saxe-Coburg_an_Gotha","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Augusto_Leopoldo_de_Saxe-Coburgo_e_Bragan%C3%A7a.jpg","page_title":"Prince August Leopold o Saxe-Coburg an Gotha","context_page_description":"Prince August Leopold o Saxe-Coburg an Gotha, kent in Brazil as Dom Augusto Leopoldo, wis a prince o the Empire o Brazil an o the Hoose o Saxe-Coburg an Gotha-Koháry. He wis the seicont o fower sons born tae German Prince Ludwig August o Saxe-Coburg an Gotha an Princess Leopoldina o Brazil.\\nThe seicont grandson o the Emperor Pedro II, the prince wis, for some years atween the presumptive heirs tae the Imperial Croun o Brazil. Thair descendants wud form the Saxe-Coburg an Gotha branch o the Imperial Hoose o Brazil."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Independence_(Nueva_Jersey)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Independence_twp_nj.png","page_title":"Municipio de Independence (Nueva Jersey)","context_page_description":"El municipio de Independence es un municipio ubicado en el condado de Warren en el estado estadounidense de Nueva Jersey. En el año 2006 tenía una población de 5,603 habitantes y una densidad poblacional de 109 personas por km².​"},{"page_url":"https://en.wikipedia.org/wiki/President_of_the_German_Bundesrat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Bundesarchiv_B_145_Bild-F011950-0010%2C_Hans_Ehard.jpg","page_title":"President of the German Bundesrat","context_page_description":"In Germany, the President of the Bundesrat or President of the Federal Council is the chairperson or speaker of the Bundesrat. He or she is elected by the Bundesrat for a term of one year. Traditionally, the Presidency of the Bundesrat rotates among the leaders of the sixteen state governments. This is however only an established praxis, theoretically the Bundesrat is free to elect any member it chooses, and a President could also be re-elected. As well as acting as a chairperson the President of the Bundesrat is ex officio deputy of the President of Germany.\\nThe President of the Bundesrat convenes and chairs plenary sessions of the body and is formally responsible for representing the Federal Republic in the Bundesrat. He or she is aided by two vice-presidents who play an advisory role and deputise in the president's absence. The three together constitute the Präsidium of the Bundesrat.\\nThe 74th and current President of the Bundesrat is Dietmar Woidke, the Minister President of Brandenburg, whose one-year term started on 1 November 2019."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A3%BD%E5%92%8C%E8%84%82%E8%82%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Myristic_acid.png","page_title":"飽和脂肪","context_page_description":"饱和脂肪是由饱和脂肪酸和甘油形成的脂肪，饱和脂肪酸即是指脂肪酸分子中不含有不饱和键。因饱和脂肪酸中与碳原子结合的氢原子达到最大值而称为“饱和”脂肪酸。饱和脂肪由于烷基结构规整，分子间作用力强，与同样碳数不饱和脂肪酸相比熔点较高，长链的饱和脂肪酸在室温下易呈固态。\\n天然食用油脂中存在各种脂肪酸，研究显示他们对健康的影响有所不同，一般认为不饱和脂肪是必须摄取的，饱和脂肪并非必须的。一般认为饮食中比例较高的饱和脂肪酸会增加心血管疾病和中风的风险，但也有研究指出饱和脂肪酸与心血管疾病的风险两者间并无明显的关系，因此这个说法受到了某些专家的挑战。甚至近年来有越来越多研究显示，饱和脂肪酸有降低体脂和心血管疾病发病率的作用。"},{"page_url":"https://it.wikipedia.org/wiki/Basilica_di_Notre-Dame_(Cl%C3%A9ry-Saint-Andr%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/ClerySaintAndre02.jpg","page_title":"Basilica di Notre-Dame (Cléry-Saint-André)","context_page_description":"La basilica di Notre-Dame è una chiesa cattolica di Cléry-Saint-André, nel dipartimento del Loiret."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB_%D0%94%D0%B5%D0%B9%D0%B2%D0%B8%D0%B4_%D0%90%D0%BD%D0%B4%D0%B5%D1%80%D1%81%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Carl_anderson.1937.jpg","page_title":"Карл Дейвид Андерсон","context_page_description":"Карл Дейвид Андерсон — американ физигі-экспериментатор. Позитронды ашқанымен аты шыққан, осы жетістігі үшін 1936 жылы Физикадан Нобель сыйлығын алған.\\nНью-Йоркта швед иммигрант отбасында туған.\\n1927 жылы Калифорния технологиялық институтының физика факультетін бітіріп, бакалавр дәрежесін алып, сол жерде сабақ береді. 1930 жылы доктор дәрежесін алған.\\n1932 жылы тәжірибе жүзінде ғарыштық сәулелер арасынан электронның антибөлшегін бірінші рет байқап “Позитрон” деп атады. Электронның антибөлшегі бар екенін 1931 ж. ағылшын физигі Поль Дирак теория жүзінде ашып, бірақ дәлелдей алмаған. Осы жұмыс үшін 1936 ж. Андерсон Физикадан Нобель сыйлығымен марапатталды.\\nОсы 1936 жылы Андерсон өзінің шәкірт студенті - Сид Недермейермен бірге зарядталған элементар бөлшек - мюонды ашты."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B3%D9%88%D9%86_%D9%83%D9%88%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Tiaris_canorus_-Canberra_Walk_In_Aviary%2C_Australia-8a.jpg","page_title":"حسون كوبي","context_page_description":"حسون كوبي ‏، هو طائر ينتمي إلى."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%95%D7%9B%D7%A0%D7%99%D7%AA_%D7%A1%D7%A8%D7%95%D7%95%D7%99%D7%95%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Apollo12ConradSurveyor.jpg","page_title":"תוכנית סרוויור","context_page_description":"תוכנית סרוויור הייתה תוכנית של נאס\\"א, חלק מתוכנית החלל האמריקאית, לחקר הירח. משנת 1966 עד 1968 נשלחו 7 גשושיות רובוטיות שנחתו על הירח. מטרת התוכנית העיקרית הייתה בחינת אפשרויות לנחיתה רכה על פני הירח, כהכנה לתוכנית אפולו המאוישת. הגשושיות שוגרו למסלול התנגשות עם הירח, מסלול שארך כ־65 שעות שלאחריהן הופעלו מנועי הגשושית למשך שלוש דקות והגשושית ביצעה נחיתה רכה על פני הירח. את התוכנית הפעילה JPL, המעבדה להנעה סילונית של נאס\\"א, ועלותה נאמדה בכ־469 מיליון דולרים.\\n5 גשושיות סרוויור נחתו בהצלחה על הירח. סרוויור 2 התרסקה בגלל בעיית ניווט ועם סרוויור 4 אבד הקשר 2.5 דקות לפני הנחיתה.\\nכל שבע הגשושיות עדיין נמצאות על הירח. מספר חלקים מסרוויור 3 הוחזרו לכדור הארץ על ידי צוות אפולו 12 שנחת בסמוך לה ב־1969, והם מוצגים במוזיאון האוויר והחלל הלאומי בוושינגטון."},{"page_url":"https://id.wikipedia.org/wiki/Bondol_tunggir-putih","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Areale_L._striata.JPG","page_title":"Bondol tunggir-putih","context_page_description":"Bondol Tunggir-putih terkadang disebut Finch-lurik dalam avikultur, ia adalah burung pengicau dari famila paruh-lilin \\"finch\\". Spesies ini berhubungan dekat dengan finch sejati dan Burung-gereja sejati.\\nIa berasal dari benua Asia tropis dan beberapa pulau yang berdekatan dengannya, dan telah dinaturalisasi di beberapa bagian Jepang. Keturunan domestisi hibridanya, finch jepang atau finch bengal, ditemukan di seluruh dunia sebagai hewan timangan dan organisme model biologi."},{"page_url":"https://ur.wikipedia.org/wiki/%DB%8C%D8%A7%D9%88%D9%86%D9%BE%D9%84%D8%B3_%D8%A8%D9%84%D8%AF%DB%8C%DB%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Jaunpils_novads_Flag.png","page_title":"یاونپلس بلدیہ","context_page_description":"یاونپلس بلدیہ لٹویا کا ایک municipality of Latvia جو لٹویا میں واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Hercules_Seghers","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/B056_Rembrandt.jpg","page_title":"Hercules Seghers","context_page_description":"Hercules Pieterszoon Seghers or Segers was a Dutch painter and printmaker of the Dutch Golden Age. He has been called \\"the most inspired, experimental and original landscapist\\" of his period and an even more innovative printmaker."},{"page_url":"https://af.wikipedia.org/wiki/Naura_Hayden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Naura_Hayden_1959_promo.jpg","page_title":"Naura Hayden","context_page_description":"Naura Hayden was 'n Amerikaanse aktrise, skryfster, en komponis. Sy was bekend vir haar rolle in die rolprente Alaska Passage, The Angry Red Planet, en The Perils of P.K., en in die televisiereeks The Thin Man."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%80%B1%E6%9C%9F%E7%B4%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Cyclin_Expression.svg","page_title":"週期素","context_page_description":"週期素是一個藉由週期素依賴性激酶調節細胞週期的蛋白質家族。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D8%A7_%D9%8A%D9%88%D8%B4%D9%8A%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Maya_Yoshida.jpg","page_title":"مايا يوشيدا","context_page_description":"مايا يوشيدا، من مواليد 24 أغسطس 1988 في هيروشيما في اليابان، لاعب كرة قدم ياباني. بدأ مسيرته الكروية مع نادي ناغويا غرامبوس في عام 2007، وهو يلعب حاليا مع نادي ساوثهامبتون في الدوري الإنجليزي الممتاز. و قد بدأ باللعب مع منتخب اليابان لكرة القدم في عام 2010."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BB%D0%BE%D1%82%D1%8B%D0%B9_%D0%AD%D0%BC%D0%B8%D1%81%D1%81%D0%B8%D0%BE%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B1%D0%B0%D0%BD%D0%BA%D0%B0_%D0%B2_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/2_z%C5%82ote_1940_awers.jpg","page_title":"Злотый Эмиссионного банка в Польше","context_page_description":"Злотый Эмиссионного банка в Польше — денежная единица Генерал-губернаторства в 1940—1944 годах. Употреблялись разговорные названия «краковский злотый» и «млынарки» по фамилии президента Эмиссионного банка в Польше Феликса Млынарского."},{"page_url":"https://en.wikipedia.org/wiki/Erskine","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Erskine_Hospital.jpeg","page_title":"Erskine","context_page_description":"Erskine is a town in the council area of Renfrewshire, and historic county of the same name, situated in the West Central Lowlands of Scotland. It lies on the southern bank of the River Clyde, providing the lowest crossing to the north bank of the river at the Erskine Bridge, connecting the town to Old Kilpatrick in West Dunbartonshire. Erskine is a commuter town at the western extent of the Greater Glasgow conurbation, bordering Bishopton to the west and Renfrew, Inchinnan, Paisley and Glasgow Airport to the south. Originally a small village settlement, the town has expanded since the 1960s as the site of development as an overspill town, boosting the population to over 15,000. In 2014, it was rated one of the most attractive postcode areas to live in Scotland."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%AF%94%E5%B0%94%C2%B7%E6%8B%89%E5%A1%9E%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Bill_Russell_in_the_Green_Room.jpg","page_title":"比尔·拉塞尔","context_page_description":"威廉·费尔顿·拉塞尔，通称比尔·拉塞尔，是前美国NBA职业篮球运动员，主要位置为中锋。在1956至1969年为波士顿凯尔特人效力13个赛季。跟随凯尔特人创下NBA史上空前的八连霸、共得到11次总冠军。\\n除了张伯伦和在迈克尔·乔丹加入NBA之前，拉塞尔被许多球评广泛认为是NBA历史上最好的球员之一。他身高2.06米，高6英尺9，臂长7英尺4。他的团队防守能力是凯尔特人建立王朝的主要原因。此外他还激励队友提升自己的防守能力。拉塞尔的篮板能力同样显著。曾经四次获得NBA篮板王，有1000以上的篮板十几连续两个赛季，并保持第二的所有时间均总篮板数和场均篮板数。他是能在一场比赛中抢下50个以上篮板的仅有的两名NBA球员之一。尽管从未成为凯尔特人进攻的焦点，但拉塞尔还拿下了14,522个生涯分数。\\n作为凯尔特人队史第一中锋，比尔·拉塞尔于1971年入选NBA25周年纪念队，1980年入选NBA35周年纪念队。6号球衣在1972年3月12日被凯尔特人退役。1974年，拉塞尔入选奈史密斯篮球名人纪念堂。1996年，拉塞尔入选NBA50周年纪念队。在2009年NBA全明星周末，NBA总裁大卫·斯特恩宣布NBA总决赛最有价值球员奖正式更名为“比尔·拉塞尔NBA总决赛最有价值球员奖”，以纪念拉塞尔11次获得NBA总冠军。2017年6月16日，官方宣布拉塞尔荣获首届NBA终身成就奖。"},{"page_url":"https://de.wikipedia.org/wiki/Nazir_Peroz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Nazir_Peroz.jpg","page_title":"Nazir Peroz","context_page_description":"Nazir Peroz ist ein afghanisch-deutscher Informatiker und Hochschullehrer."},{"page_url":"https://it.wikipedia.org/wiki/Visaginas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Visaginas001.JPG","page_title":"Visaginas","context_page_description":"Visaginas è una città dell’omonimo distretto della contea di Utena, nell’est della Lituania.\\nSi sviluppa vicino al lago Visaginas, da cui trae nome il centro urbano. Secondo un censimento del 2011, la popolazione ammonta a 22.361 abitanti.\\nGli annali riportano una prima menzione della città nel 1526. L'insediamento attuale fu fondato nel 1975 con il nome di Sniečkus, per creare un centro abitato destinato ai lavoratori della Centrale nucleare di Ignalina. Fu fondato su un insediamento formato da 4 villaggi, il più grande dei quali portava appunto il nome di Visaginas.\\nLa ferrovia Vilnius–Daugavpils percorre l’area esterna della città, permettendo così collegamenti rapidi tra le varie aree periferiche e non. Le autostrade collegano Visaginas ad altri insediamenti maggiori come la capitale, Anykščiai e Zarasai."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%AB%D5%A5%D5%BC_%D4%BF%D5%B5%D5%B8%D6%82%D6%80%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Signature_de_Pierre_Curie.png","page_title":"Պիեռ Կյուրի","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Կյուրի\\nՊիեռ Կյուրի, ֆրանսիացի ֆիզիկոս, Ֆրանսիայի ԳԱ անդամ ։"},{"page_url":"https://en.wikipedia.org/wiki/ICOCA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%E5%A7%AB%E6%96%B0%E7%B7%9AICOCA%E5%AE%9A%E6%9C%9F.jpg","page_title":"ICOCA","context_page_description":"The ICOCA card is a rechargeable contactless smart card used on the JR West rail network in Japan. The card was launched on November 1, 2003 for usage on the Urban Network, which encompasses the major cities of Osaka, Kyoto and Kobe. It is now usable on many other networks. The ICOCA area has gradually been expanded, and now includes the San'yo region through the Okayama and Hiroshima urban areas, and some lines in northern Shikoku, San'in and Hokuriku regions as of 2020.\\nICOCA stands for IC Operating CArd, but it is also a play on the phrase \\"Iko ka\\", an informal, Kansai dialect invitation meaning \\"Shall we go?\\" in Japanese.\\nThe mascots for the ICOCA program consists of a blue platypus called Ico the Platypus and Icota and Icomi the Platypuses."},{"page_url":"https://de.wikipedia.org/wiki/Linz_International_School_Auhof","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Bundeschulzentrum_Auhof_Linz.jpg","page_title":"Linz International School Auhof","context_page_description":"Die Linz International School Auhof wurde 1992 als bilingualer Zweig des Europagymnasiums Auhof gegründet.\\nEnglisch ist Unterrichtssprache in allen Fächern ab der ersten Klasse. Die Schüler lernen Englisch durch „Immersion“ in ein englischsprachiges Umfeld."},{"page_url":"https://id.wikipedia.org/wiki/Prinsip_Le_Chatelier","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Lechatelier.jpg","page_title":"Prinsip Le Chatelier","context_page_description":"Dalam kimia, prinsip Le Chatelier, atau disebut pula asas Le Chatelier atau \\"Hukum Kesetimbangan\\", dapat digunakan untuk memprediksi efek perubahan di dalam kondisi pada kesetimbangan kimia. Prinsip ini dinamai dari Henry Louis Le Chatelier dan terkadang dari Karl Ferdinand Braun yang menemukan prinsip ini secara mandiri. Prinsip ini dapat dinyatakan sebagai:\\nKetika suatu sistem pada kesetimbangan mengalami perubahan konsentrasi, suhu, volume, atau tekanan, maka sistem menyesuaikan dirinya untuk meniadakan pengaruh perubahan yang diterapkan dan keseimbangan baru tercapai.\\nDengan kata lain, setiap kali sistem dalam kesetimbangan terganggu sistem akan menyesuaikan diri sedemikian rupa sehingga efek dari perubahan tersebut akan dibatalkan.\\nPrinsip ini memiliki berbagai nama, tergantung pada disiplin ilmu yang menggunakannya. Prinsip Le Chatelier juga dijadikan sebagai basis bagi pengamatan yang lebih umum di masyarakat, yang secara kasar menyatakan bahwa:\\nSetiap perubahan dalam status quo akan menghasilkan reaksi berlawanan dari sistem yang bersangkutan."},{"page_url":"https://es.wikipedia.org/wiki/Yermo_(Cartes)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Santa_Maria_Yermo_04.jpg","page_title":"Yermo (Cartes)","context_page_description":"Yermo es una localidad del municipio de Cartes. Está situada a 120 metros de altitud sobre el nivel del mar, frente al trazado de la autovía A-67, oculta parcialmente por la vegetación. Tiene una población de 66 habitantes. Está a 2,8 kilómetros de la capital municipal, y se accede a ella a través de una carretera que serpentea por el monte en uno de cuyos altos se encuentra. Celebra la fiesta de Santa María el 7 de septiembre."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%A8%E0%A8%9C%E0%A8%BC%E0%A8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Blue_eyes.JPG","page_title":"ਨਜ਼ਰ","context_page_description":"ਨਜ਼ਰ ਦੇਖਣ ਦੇ ਓਸ ਲਹਿਜੇ ਨੂੰ ਕਿਹਾ ਜਾਂਦਾ ਹੈ ਜਿਸ ਵਲੋਂ ਵੇਖੇ ਜਾਣ ਵਾਲੇ ਨੂੰ ਨੁਕਸਾਨ ਹੋਵੇ ਜਾਂ ਬਦਕਿੱਸਮਤੀ ਦਾ ਸਾਮਣਾ ਕਰਣਾ ਪਏ। ਬਹੁਤ ਸਾਰੀਆਂ ਸੰਸਕ੍ਰਿਤੀਆਂ ਵਿੱਚ ਇਹ ਮਾਨਤਾ ਹੈ ਕਿ ਜੇਕਰ ਕਿਸੇ ਵਿਅਕਤੀ ਨੂੰ ਕੋਈ ਹੋਰ ਵਿਅਕਤੀ ਈਰਖਾ ਜਾਂ ਨਫਰਤ ਦੀ ਨਜ਼ਰ ਵਲੋਂ ਵੇਖੇ ਤਾਂ ਪਹਿਲਾਂ ਵਿਅਕਤੀ ਉੱਤੇ ਉਸ ਦਾ ਦੁਸ਼ਪ੍ਰਭਾਵ ਪੈ ਸਕਦਾ ਹੈ। ਇਸ ਪਰਿਕ੍ਰੀਆ ਨੂੰ ਨਜ਼ਰ ਲਗਣਾ ਕਹਿੰਦੇ ਹਨ। ਨਜ਼ਰ ਨੂੰ ਟਾਲਣ ਲਈ ਵੱਖ - ਵੱਖ ਸੰਸਕ੍ਰਿਤੀਆਂ ਨੇ ਕਈ ਤਰੀਕੇ ਬਣਾ ਰਖੇ ਹਨ, ਜਿਵੇਂ ਦੀ ਤਵੀਤ, ਨਜ਼ਰ ਬੱਟੂ, ਮੰਤਰੋੱਚਾਰਣ ਅਤੇ ਰਸਮਾਂ, ਇਤਆਦਿ।ਤੁਰਕੀ ਭਾਸ਼ਾ ਵਿੱਚ ਨਜ਼ਰ ਵਲੋਂ ਬਚਣ ਲਈ ਇਸਤੇਮਾਲ ਹੋਣ ਵਾਲੇ ਇੱਕ ਖਾਸ ਚਿਹਨ ਅਤੇ ਤਵੀਤ ਨੂੰ ਹੀ ਨਜ਼ਰ ਕਹਿੰਦੇ ਹਨ। ਇਹ ਇੱਕ ਨੀਲੇ ਅਤੇ ਸਫੇਦ ਰੰਗ ਵਾਲਾ ਗੋਲ ਚਪਟਾ - ਜਿਹਾ ਇੱਕ ਪੱਥਰਨੁਮਾ ਲਾਕੇਟ ਹੁੰਦਾ ਹੈ ਜਿਸ ਵਿੱਚ ਇੱਕ ਅੱਖ ਵਰਗੀ ਆਕ੍ਰਿਤੀ ਬਣੀ ਹੁੰਦੀ ਹੈ ਅਤੇ ਜਿਨੂੰ ਲਮਕਾਇਆ ਜਾਂ ਪਾਇਆ ਜਾ ਸਕਦਾ ਹੈ। ਭਾਰਤ ਵਿੱਚ ਬਚਿਆਂ ਦੇ ਕਾਲ਼ਾ ਤੀਲ ਜਾਂ ਟੀਕਾ ਲਗਾਉਣਾ ਜਾਂ ਕਾਲ਼ਾ ਧਾਗਾ ਬੰਨ੍ਹਣਾ 2 ਕਿਸੇ ਦੇ ਸਰ ਦੇ ਇਰਦ - ਗਿਰਦ ਮਿਰਚ ਘੁਮਾਉਣ 3 ਮਿਰਚੀ ਅਤੇ ਨੀਂਬੁਵਾਂ ਨੂੰ ਲਮਕਾਉਣਾ 4 ਬੁਰੀ ਨਜ਼ਰ ਵਾਲੇ ਤੁਹਾਡਾ ਮੁੰਹ ਕਾਲ਼ਾ ਸੂਤਰਵਾਕਿਅ ਗੱਡੀਆਂ - ਟਰੱਕਾਂ ਅਤੇ ਦੁਕਾਨਾਂ ਉੱਤੇ ਲਿਖੇ ਹੋਏ ਨਜ਼ਰ ਆਉਂਦੇ ਹਨ"},{"page_url":"https://nds.wikipedia.org/wiki/D%C3%BCvelsmoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Huvenhoops_Moor%26See.jpg","page_title":"Düvelsmoor","context_page_description":"Dit Woort hett noch annere Bedüden: kiek dorför ünner Düvelsmoor.\\nDat Düvelsmoor is en Moor, dat in de Landkreise Oosterholt un Rodenborg liggt.\\nDat Moor is so bi 500 km² groot un liggt in en oold Daal ut de Saal-Iestied. Na Süden hen flütt dat Water över de Strööm Hamm un Wörp na de Wümm hen af, in’n Noorden na de Oost hen. Jürgen Christian Findörp hett von 1751 af an mit de Moorkolonisation dat Moor dröögleggen laten un dorbi is ok de Oost-Hamm-Kanaal anleggt worrn, de merrn dör dat Moor löppt un dor för sorgt, dat dat Water wegflütt.\\nDe Siedlers weren vör allen lüttje Lüüd, de keen egen Buursteed harrn. Dat Leven in’t Moor weer hart un mit veel Arbeid verbunnen. En olen Snack geiht „Den Eersten sien Dood, den Tweten sien Nood, den Drüdden sien Brood“. Toeerst hebbt de Siedlers vör allen von’n Törfafbo leevt. De Törf is över Gravens un Kanaals na Bremervöör un Bremen bröcht worrn. Eerst later kunnen se denn ok en beten Bueree bedrieven. De Öörd in’t Moor sünd vör allen Stratendörper, bi de de Hüüs na achtern rut en lang, small Stück Land hebbt.\\nDat Düvelsmoor weer fröher vör allen Hoogmoor, dat na de Strööm hen in Neddermoor övergüng."},{"page_url":"https://fr.wikipedia.org/wiki/Moulin_%C3%A0_vent","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Campo_de_Criptana_Molinos_de_Viento_1.jpg","page_title":"Moulin à vent","context_page_description":"Le moulin à vent est un dispositif qui transforme l’énergie éolienne en mouvement rotatif au moyen d’ailes ajustables. En tant que moulin, il est utilisé le plus souvent pour moudre des céréales, broyer, piler, pulvériser diverses substances, presser des drupes ou écraser des olives pour produire de l'huile; il a pu aussi servir à actionner une pompe, par exemple pour l’irrigation ou pour assécher les polders; ou un groupe de scies."},{"page_url":"https://no.wikipedia.org/wiki/Kaiserfjellene","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Kaisergebirge_von_Aschau_im_Winter_01.JPG","page_title":"Kaiserfjellene","context_page_description":"Kaiserfjellene er en fjellkjede i Tirol som hører til De nordlige Kalk-Alper. Den består av to markerte fjellmassiv: Wilder Kaiser og Zahmer Kaiser. Wilder Kaiser består av ruvende kalksteinsfjell, mens Zahmer Kaiser hovedsakelig ligger under tregrensen. De to gruppene er adskilt gjennom et 1577 meter høyt pass.\\nKaiserfjellene er ikke noen spesielt stor fjellkjede, men den er et ypperlig turområde. Det er verken bilveier eller taubaner i fjellgruppa, og mesteparten av fjellkjeden er et naturvernområde."},{"page_url":"https://pt.wikipedia.org/wiki/Jean-Pierre_Rampal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Klassieke_Edisons_1969_worden_uitgereikt_in_het_Concertgebouw_Amsterdam._20.20a.%2C_Bestanddeelnr_922-8385.jpg","page_title":"Jean-Pierre Rampal","context_page_description":"Jean-Pierre Louis Rampal foi um celebrado flautista francês. A ele foi pessoalmente atribuído o retorno da popularidade da flauta, como instrumento clássico solo, a um nível inédito, desde o século XVIII.\\nAndré Jolivet e Francis Poulenc compuseram trabalhos para ele. A autobiografia de Rampal - Music, My Love - foi publicada em 1989."},{"page_url":"https://en.wikipedia.org/wiki/John_Rankin_(abolitionist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/John_Rankin_abolitionist.jpg","page_title":"John Rankin (abolitionist)","context_page_description":"John Rankin was an American Presbyterian minister, educator and abolitionist. Upon moving to Ripley, Ohio, in 1822, he became known as one of Ohio's first and most active \\"conductors\\" on the Underground Railroad. Prominent pre-Civil War abolitionists William Lloyd Garrison, Theodore Weld, Henry Ward Beecher, and Harriet Beecher Stowe were influenced by Rankin's writings and work in the anti-slavery movement.\\nWhen Henry Ward Beecher was asked after the end of the Civil War, \\"Who abolished slavery?,\\" he answered, \\"Reverend John Rankin and his sons did.\\""},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%AA%D8%B3%D9%86%D8%B3%DA%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Jubcoin_2005_10rub_mcensk_revers.jpg","page_title":"متسنسک","context_page_description":"متسنسک روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و اریول اوبلاستینده یئرلشیب. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا 43222 نفر دیر."},{"page_url":"https://en.wikipedia.org/wiki/Asa_Thurston","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Mokuaikaua_Church_Kona.jpg","page_title":"Asa Thurston","context_page_description":"Asa Thurston was a Protestant missionary from the United States who was part of the first company of American Christian missionaries to the Hawaiian Islands with his wife Lucy Goodale Thurston."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%BC%D1%8F%D1%87%D1%8D%D1%86%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Klecak%2C_Tatarski._%D0%9A%D0%BB%D0%B5%D1%86%D0%B0%D0%BA%2C_%D0%A2%D0%B0%D1%82%D0%B0%D1%80%D1%81%D0%BA%D1%96_%281901-27%29.jpg","page_title":"Клецкая мячэць","context_page_description":"Клецкая мячэць — колішняя мячэць у горадзе Клецку Мінскай вобласці."},{"page_url":"https://it.wikipedia.org/wiki/Nazionale_di_calcio_dell%27Azerbaigian","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Azerbaijan_nationall_football_team.JPG","page_title":"Nazionale di calcio dell'Azerbaigian","context_page_description":"La nazionale di calcio dell'Azerbaigian è la rappresentativa calcistica dell'Azerbaigian ed è controllata dalla Federazione calcistica dell'Azerbaigian. Disputa le partite interne per lo più nello Stadio Olimpico di Baku, inaugurato nel 2015.\\nFondata nel 1992, è affiliata alle federazioni calcistiche internazionali, FIFA e UEFA, dal 1994. Esordì nelle qualificazioni ai grandi tornei in occasione delle eliminatorie per il campionato d'Europa 1996. Disputa le partite in casa allo Stadio olimpico di Baku, inaugurato nel 2015.\\nNella classifica mondiale della FIFA il miglior piazzamento dell'Azerbaigian è il 73º posto del luglio 2014, il peggiore il 170º posto del giugno 1994. Occupa attualmente il 114º posto della graduatoria."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B9%9D%E5%85%AD%E5%BC%8F%E9%99%B8%E4%B8%8A%E6%94%BB%E6%92%83%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Mitsubishi_G3M2.jpg","page_title":"九六式陸上攻撃機","context_page_description":"九六式陸上攻撃機は、大日本帝国海軍の陸上攻撃機。\\n九五式陸上攻撃機の後継機であり、九六式艦上戦闘機と並んで、日本の航空技術が欧米と同等のレベルまで進んだことを示した最初の機体である。当時としては高い航続性能を有し、支那事変から太平洋戦争の初期まで第一線で活躍した。なお海軍の命名法によって急降下爆撃ができない本機は爆撃機ではなく攻撃機とされた。\\n略称は九六陸攻。後継機の一式陸上攻撃機とともに、中型攻撃機として作られたことから通称「中攻」と呼ばれた。連合国軍のコードネームはNell。"},{"page_url":"https://fr.wikipedia.org/wiki/Michel_Nikola%C3%AFevitch_de_Russie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/OlgaFeodorovna.jpg","page_title":"Michel Nikolaïevitch de Russie","context_page_description":"Michel Nicolaïevitch, grand-duc de Russie, ou Mikhaïl Nikolaïevitch Romanov, né le 13 octobre 1832 à Peterhof, décédé le 18 décembre 1909 à Cannes, est un membre de la famille impériale de Russie.\\nIl fut commandant en chef des troupes impériales au Caucase, vice-roi du Caucase de 1862 à 1882, generalfeldmarschall en 1878 de l'armée impériale de Russie, inspecteur de l'artillerie, président du conseil d'Empire jusqu'à son décès.\\nIl connut quatre empereurs qu'il servit avec loyauté."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%88%D8%B1%D9%82%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Borgore_0037.jpg","page_title":"بورقور","context_page_description":"بورقور آلبوم یاپیمجیسی، رپر، شارکی یازیچی، شارکیچی و موسیقیچی - چئشیتلی موسیقی ژانرلاریندا اثرلر یارادیب. بورقور ۲۰ اوْکتوبر ۱۹۸۷ ‏ تاریخینده حیاتا گؤز آچیب."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/The_University_of_Hong_Kong.jpg","page_title":"Гонконгский университет","context_page_description":"Университет Гонконга — старейшее высшее учебное заведение Гонконга, основанное в 1911 году в период зависимости Гонконга от Великобритании. Язык обучения — английский.\\nСогласно рейтингу британского журнала «Times Higher Education», Гонконгский университет занимает 1-е место в Азии и 21-е место в мире.\\nПо данным на 2008—2009 гг., в университете обучается 21 652 человека, включая 11 962 студента, 7 326 аспирантов и 2 364 аспиранта-исследователя."},{"page_url":"https://ca.wikipedia.org/wiki/Martin_Balluch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Martin_Balluch_-_Wien_2019.JPG","page_title":"Martin Balluch","context_page_description":"Martin Balluch és un físic, filòsof, i prominent activista dels drets dels animals. Va ser el cofundador de la Societat Vegana Austríaca el 1999, i va ser president de l'Associació Austríaca contra les Factories d'Animals des de 2002. El filosof Peter Singer va anomenar a Balluch \\"un dels principals portaveus a tot el món del moviment dels drets dels animals per perseguir la via no violenta i democràtica a la reforma.\\" Va ser convidat a participar com a candidat del Partit Verd el setembre de 2008.\\nBalluch és notable pel seu paper en persuadir al Parlament austríac el 2004 per afegir una clàusula a la constitució del país sobre els animals no humans, que ara diu \\"L'Estat protegeix la vida i el benestar dels animals en la seva responsabilitat per a ells com els companys de la humanitat.\\" També va ajudar a establir \\"els advocats d'animals\\" a cada província, que estan facultats per iniciar procediments judicials en nom dels animals i va ser destacat a la campanya per a prohibir les granges de bateries de pollastres, com a resultat de la qual les granges en bateria esdevingueren il·legals a Àustria després de l'1 de gener de 2009."},{"page_url":"https://en.wikipedia.org/wiki/Curtis_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Curtis_High_Sch_SI_jeh.JPG","page_title":"Curtis High School","context_page_description":"Curtis High School, operated by the New York City Department of Education, is one of seven public high schools located in Staten Island, New York City, New York. It was founded on February 9, 1904, the first high school on Staten Island."},{"page_url":"https://en.wikipedia.org/wiki/Hayk_Square","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/%D5%8E%D5%A1%D5%B6%D5%A1%D5%B1%D5%B8%D6%80_1_%2810%29.JPG","page_title":"Hayk Square","context_page_description":"Hayk Square, is the large central town square in Vanadzor, Armenia. It is intersected by the Tigran Mets Avenue from the southeast the northwest, and the Movses Khorenatsi Street from the northeast.\\nThe square was opened during the 1950s, based on the original plan designed by architects Baghdasar Arzoumanian and Hovhannes Margarian. During the Soviet period, the square was known as Kirov Square, named after the Bolshevik leader Sergey Kirov. Kirov's statue was standing at the centre of the square until the independence of Armenia. It is envisaged to erect the statues of Hayk Nahapet and Tigranes the Great at the square."},{"page_url":"https://ru.wikipedia.org/wiki/Upshot-Knothole_Harry","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Upshot-Knothole_Harry_001.jpg","page_title":"Upshot-Knothole Harry","context_page_description":"Upshot-Knothole Harry — девятый испытательный ядерный взрыв, осуществлённый США 19 мая 1953 года на ядерном полигоне в Неваде в рамках операции «Апшот-Нотхол». В ходе операции был испытан ядерный заряд Гамлет, разработанный Тедом Тейлором в Лос-Аламосе, который должен был стать самым эффективным и чистым зарядом с энерговыделением до 100 кт. Однако испытание вызвало огромное радиоактивное заражение на континентальной территории США, из-за чего взрыв был прозван «Грязным Гарри»."},{"page_url":"https://de.wikipedia.org/wiki/Riese_Erla","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Erlakogel_-_Schlafende_Griechin.jpg","page_title":"Riese Erla","context_page_description":"Der Riese Erla ist eine berühmte Figur aus vielen Sagen des Salzkammerguts.\\nZu den bekanntesten gehört „Der Riese Erla und die Nixe vom Laudachsee“, in der er sich in eine Nixe aus dem Laudachsee namens Blondchen verliebt. Die Sage von Erla und Blondchen berichtet unter anderem davon, dass Erla das sagenumwobene Schloss Ort erbaut haben soll.\\nErla war der Sage nach der Herrscher über die Elfen, Zwerge und alle Schätze im Salzkammergut. Noch heute kann man das Antlitz des Riesen erblicken. Vom Ort Traunkirchen am Traunsee aus hat man einen fabelhaften Blick auf das laut einer Sage steinerne Riesenhaupt Erlas im Traunstein. Nach anderen Überlieferungen sollen es die Gesichtszüge der Nixe sein, die Erla nach ihrem Tod zur Erinnerung an sie in den Berg eingemeißelt haben soll.\\nWieder andere wollen in der „Schlafenden Griechin“ auf dem Erlakogel die Nixe erkennen."},{"page_url":"https://ms.wikipedia.org/wiki/Taman_Mini_Indonesia_Indah","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/TMII_Nias_House.JPG","page_title":"Taman Mini Indonesia Indah","context_page_description":"Taman Mini Indonesia Indah atau \\"Taman Miniatur Indah Indonesia\\" adalah kawasan rekreasi berasaskan budaya yang terletak di Jakarta Timur, Indonesia. Ia mempunyai keluasan kira-kira 250 ekar. Taman ini merupakan sinopsis kebudayaan Indonesia, dengan hampir semua aspek kehidupan sehari-hari di wilayah Indonesia 26 diungkapkan dalam pavilion terpisah dengan koleksi rumah adat sebagai contoh seni bina, pakaian, tarian dan tradisi bahasa Indonesia yang semuanya digambarkan tanpa cela. Selain itu, terdapat sebuah tasik dengan sedikit kepulauan di tengah-tengahnya, kereta kabel, muzium, Keong Emas Imax Cinema, teater yang dipanggil Teater Tanah Airku dan kemudahan rekreasi lain yang menjadikan TMII salah satu destinasi pelancongan paling popular di bandar ini.\\nSejak 2007 Taman Mini Indonesia Indah melancarkan logo baru dengan slogan berjenama Pesona Indonesia.\\nPada 31 Disember 2014 Jawatankuasa Keamanan Dunia memutuskan TMII sebagai Taman Tamadun Antarabangsa dan Taman Tema Keamanan Dunia."},{"page_url":"https://de.wikipedia.org/wiki/Wurzel-Diffusionsprozess","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/CIR-Prozess1.png","page_title":"Wurzel-Diffusionsprozess","context_page_description":"Der Wurzel-Diffusionsprozess ist ein stochastischer Prozess, der über eine stochastische Differentialgleichung definiert ist. Seit diese Prozessklasse erstmals 1951 durch den kroatisch-amerikanischen Mathematiker William Feller studiert wurde, hat sie zahlreiche Anwendungsfelder in verschiedenen Bereichen der Finanzmathematik gefunden."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E4%BA%AC%E9%BC%93%E6%A5%BC%E5%8C%BB%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Statue_of_William_E._Macklin_in_Gulou_Hospital_2010-11.jpg","page_title":"南京鼓楼医院","context_page_description":"南京鼓楼医院，又名南京大学医学院附属鼓楼医院、南京市红十字中心医院，位于中国江苏省南京市中山路321号，是一所集医疗、教学、科研为一体的综合性三级甲等医院。现核定床位2500张，在岗职工3863名，其中：卫生专业技术人员3398人，正、副主任医师400余人，正、副教授220余人，博士生导师40余人、硕士生导师180余，40位著名专家享受国务院特殊津贴。2014年医院门急诊病人290余万人次，出院病人8.2万余例。"},{"page_url":"https://ru.wikipedia.org/wiki/Archaeovenator_hamiltonensis","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/ArchaeovenatorDB.jpg","page_title":"Archaeovenator hamiltonensis","context_page_description":"Archaeovenator hamiltonensis — вид синапсид из семейства Varanopidae, известных из отложений верхнего карбона на территории округа Гринвуд штата Канзас. Описан по голотипу KUVP 12483, сохранился почти полный скелет, включая череп, конечности и пояс, несколько отделённый от посткраниального скелета. Останки обнаружены в Гамильтоне в формации сланцев Калхунс, датируемой виргилийским веком либо концом касимовского — началом гжельского века. Родовое название означает «древний охотник». Видовое имя дано в честь карьера, где он был обнаружен. Археовенатор — древнейший известный варанопсеид, это сестринский таксон для всех других представителей этой группы."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_properties_in_Phoenix","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Phoenix-Ong_Yut_Geong_Market_Warehouse-1930.JPG","page_title":"List of historic properties in Phoenix","context_page_description":"This is a list, which includes photographic galleries, of some of the remaining historic structures and monuments, of historic significance, in Phoenix, Arizona, United States. Included are photographs of properties identified by the African, Asian and Hispanic historic property surveys of the City of Phoenix, focusing on the themes of history in Phoenix from 1870 to 1975.\\nThis list however, is not limited to historical structures and monuments. Also listed are historical landmarks, some of which are listed in the National Register of Historic Places such as the Pueblo Grande Ruin and Irrigation Sites and the Deer Valley Rock Art Center. These contain the ruins of structures and artifacts of the Hohokams who lived within the modern Phoenix city area before the arrival of the settlers of non-Native American origin.\\nThe abandoned Joint Head Dam and the early canals built by the early pioneers of European descent played an important role in the irrigation and development of Phoenix and its surrounding areas. Pictured is the ruins of the abandoned Joint Head Dam built in 1884."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%8A%D9%84%D8%A7_%D8%B4%D8%A7%D9%87%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/2016-02-01_172_Sila_Sahin.JPG","page_title":"سيلا شاهين","context_page_description":"سيلا شاهين ‏ هي ممثلة وعارضة أزياء ألمانية من أصل تركي ولدت في يوم 3 ديسمبر 1985 في برلين الغربية في ألمانيا، أشتهرت بعد تمثيلها دور أيلا أوزغول في المسلسل التلفزيوني الألماني غوته زايتن، شليخته زايتن، كما أنها إشتركت في مسابقة Let's Dance في ألمانيا."},{"page_url":"https://hr.wikipedia.org/wiki/Indijanci","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Mohave_Indians.jpg","page_title":"Indijanci","context_page_description":"Indijanci su zajednički naziv za prastanovnike Amerike, raznorazne narode mongoloidnog izgleda raširene od arktičke Kanade i Aljaske do Ognjene zemlje u Čileu i Argentini. Međusobno se razlikuju po jezicima, kulturi i fizičkom izgledu. Većinom su to bila lovačko-sakupljačka društva kao Nambikwara i Ges iz Brazila i Shoshoni iz Kalifornije i Nevade. Neki su bili ribari iz Južne Amerike. U njihove najrazvijenije narode koji su uspjeli podići visokorazvijene civilizacije spadaju narodi Olmeka, Tolteka, Maja i Asteka iz Meksika te Inka iz Perua.\\nDanas su mnogi smješteni po rezervatima, osobito u Kanadi, Sjedinjenim Državama i Brazilu. Prvi se put spominju otkrićem Amerike 1492. godine.\\nSuvremeni Indijanci službeno su kršćani ali se drže i domorodačkih vjerovanja. Govore vlastitim jezicima a uz njih i engleskim, španjolskim, portugalskim, francuskim ili nizozemskim. Najrasprostranjeniji indijanski jezik je kečuanski kojim danas govori oko 10 000 000 ljudi. U SAD-u su pod imenom Native Americans, a u Kanadi pod imenom First Nations zajedno pobrojeni Indijanci i Eskimi. U podacima o Grenlandu misli se na Eskime."},{"page_url":"https://nl.wikipedia.org/wiki/Hymenium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Imenoforo_liscio_fungo.jpg","page_title":"Hymenium","context_page_description":"Het hymenium is de weefsellaag op het hymenofoor van een schimmel vruchtlichaam, waarin de cellen zich ontwikkelen tot basidie of sporenzakjes om sporen te kunnen produceren. In sommige soorten veranderen alle cellen in het hymenium in basidia of asci; in andere soorten verandert een deel van de cellen in steriele cellen zoals cystidia of parafyses. Deze cellen zijn vaak kenmerkend bij de microscopische identificatie.\\nHet subhymenium bestaat uit de dragende schimmeldraad waarvanuit de cellen van het hymenium groeien. Daaronder bevindt zich het hymenofore trama dat het merendeel uitmaakt van het hymenofoor.\\nDe positie van het hymenium is traditioneel het eerste kenmerk dat gebruikt wordt in de classificatie en identificatie van paddenstoelen."},{"page_url":"https://en.wikipedia.org/wiki/Lake_Taka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Katavothra_ponor_Tripoli-Polje_Taka_Plain_Peloponnese_Greece.jpg","page_title":"Lake Taka","context_page_description":"Lake Taka is a temporary lake located in the south of a large basin called “Tripoli-Plateau” in Greece. In the winter, the southern part of the basin often gets flooded, and a lake forms from a large amount of fresh rainwater because of insufficient surface drainage. A wetland biotope quickly develops, and species of water-loving fauna appear. In the hot and dry summer, the lake dries up. Over time, karstification creates several ponors, where water leaves the basin through groundwater."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD%E5%89%AF%E4%B8%BB%E5%B8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Wang_Qishan_in_2016.jpg","page_title":"中华人民共和国副主席","context_page_description":"中華人民共和國副主席，是中華人民共和國國家機構之一「中華人民共和國主席」內部的兩大職位之一，具有很高的榮譽性質，負責禮儀性外交工作，至於擁有實權與否則要取決於擔任者在中國共產黨內的地位和職務。根據現行《中華人民共和國憲法》規定，副主席協助主席工作；受主席的委託，可以代行使主席的部分職權；在主席缺位的時候，由副主席繼任主席的職位；副主席缺位的時候，由全國人民代表大會進行補選。\\n「中華人民共和國副主席」自1954年第一屆全國人民代表大會開始設立，首任副主席是朱德。文化大革命爆發後時任國家主席劉少奇失勢下台，當時兩位副主席宋慶齡和董必武沒有按憲法規定繼任主席，只是名義上代行權力。1975年通過的憲法決定取消「中華人民共和國主席」和「副主席」的職位。1982年通過的《八二憲法》重新恢復。2018年第十三屆全國人民代表大會通過憲法修正案，廢除連任限制，但沒有增加任何權力。\\n根據現行《憲法》，中華人民共和國副主席由全國人民代表大會根據《憲法》選舉產生，任期五年，沒有任期限制。憲法同時規定：和國家主席一樣，副主席的候選人必須是年滿45周歲並有選舉權及被選舉權的中華人民共和國公民。\\n按照1982年制定的《憲法》，中華人民共和國主席職務是象徵性的虛位元首，具有最高的地位並享有國家的最高代表權，但不獨立決定任何國家事務。作為副職的國家副主席儘管地位崇高，但其象徵意義更是遠大於實質。因為不具有實權，歷史上有非中國共產黨黨員擔任過中華人民共和國副主席的職務，例如宋慶齡，而國家副主席也成為非中共黨員能夠出任的最高職務。\\n胡錦濤、曾慶紅、習近平三任國家副主席因兼任中共中央政治局常委、中共中央書記處書記、中共中央黨校校長三職而握有實權。另外，被作為接班人培養的胡錦濤、習近平在其國家副主席任期後半段會通過兼任中央軍事委員會副主席熟悉及協管軍隊事務。"},{"page_url":"https://es.wikipedia.org/wiki/Anita_Garvin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Anita_Garvin_1923.jpg","page_title":"Anita Garvin","context_page_description":"Anita Garvin fue una actriz y comediante de nacionalidad estadounidense, activa tanto en el cine mudo como en el sonoro. Fue sobre todo conocida por sus actuaciones acompañando a los comediantes Stan Laurel y Oliver Hardy, y junto a Charley Chase."},{"page_url":"https://fr.wikipedia.org/wiki/Composition_de_l%27%C3%AAtre_dans_l%27%C3%89gypte_antique","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ka_ankh_libation_1_%282%29.jpg","page_title":"Composition de l'être dans l'Égypte antique","context_page_description":"Selon les Anciens Égyptiens, la composition de l'être humain dépasse la simple dualité entre le corps et l'âme. Chaque individu compte en lui une dizaine de composantes matérielles et immatérielles qui l'intègrent dans la sphère terrestre du sensible et dans la sphère impalpable des dieux et ancêtres. Après la mort, grâce à ses composantes éthérées, l'individu peut espérer une survie posthume dans la tombe et une existence immortelle auprès des puissances surnaturelles qui règlent les phénomènes cosmiques. La conservation du souffle de vie est cependant conditionnée par le respect, la vie durant, des principes de la Maât et par la maîtrise efficace de la magie-Heka. Cette dernière est à la fois une puissance intérieure et un savoir livresque qui permettent aux humains de s'assimiler aux dieux.\\nLes Égyptiens n'ont pas établi de liste canonique des différentes composantes de l'être. De plus, ils n'ont guère disserté à leurs propos pour les définir. Les textes funéraires fourmillent cependant d'allusions à leur sujet et leur analyse minutieuse permet aux égyptologues de les appréhender d'un point de vue scientifique."},{"page_url":"https://es.wikipedia.org/wiki/Nohra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Nohra_in_NDH.png","page_title":"Nohra","context_page_description":"Nohra es un municipio situado en el distrito de Nordhausen, en el estado federado de Turingia, a una altitud de 200 metros. Su población a finales de 2016 era de unos 800 habitantes y su densidad poblacional, 50 hab/km².​​\\nSe encuentra ubicado a poca distancia al sur de la frontera con los estados de Sajonia-Anhalt y Baja Sajonia."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%BC%E3%83%AB%E3%83%BB%E3%83%95%E3%83%AA%E3%83%BC%E3%83%89%E3%83%99%E3%83%AB%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Jacob_Hilsdorf_-_Carl_Friedberg.jpg","page_title":"カール・フリードベルク","context_page_description":"カール・ルドルフ・ヘルマン・フリードベルクは、ドイツのピアニスト、音楽教師。\\nフランクフルト・ホーホ音楽院にてジェームス・クヴァストとクララ・シューマンにピアノを師事する。その後1893年から1904年まで同校の教員を経て、1904年から1914年までケルン音楽院の教壇に立った。1923年から1946年に隠退するまで、ニューヨーク芸術音楽専門学校でピアノ科の首席教授を務める。主要な門人にエリー・ナイやマルコム・フレイジャー、ブルース・ハンガーフォード、ウィリアム・マセロスらがいる。\\nフリードベルクは60年以上にわたって欧米でピアニストとして演奏を続けた。1900年12月2日にグスタフ・マーラーの指揮するウィーン宮廷管弦楽団と共演して公式のデビューを果たした。但し、1893年には全曲ブラームス作品によるリサイタルを本人立ち会いのもとに行い、作曲者から称賛を得た。その後はブラームスのピアノ曲のほとんどについて、作曲者本人の個人指導により特訓を受けている。1920年にはアルトゥル・シュナーベルの後任として、カール・フレッシュとフーゴ・ベッカーが結成したピアノ三重奏団に加入し、1932年に解散するまで室内楽奏者として活動した。アメリカではフリッツ・クライスラーと数多くのリサイタルで共演しており、1937年にはダニエル・カルピロフスキーやフェリックス・サルモンドと自前のピアノ三重奏団を結成している。その後1955年9月9日イタリアに客死した。\\nフリードベルクはレパートリーの幅広い演奏家であったが、一般的にベートーヴェンやシューマン、ブラームスのピアノ曲と結びつけられることが多い。"},{"page_url":"https://sv.wikipedia.org/wiki/Pinguicula_filifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Overview_of_Pingucula_filifolia.jpg","page_title":"Pinguicula filifolia","context_page_description":"Pinguicula filifolia är en tätörtsväxtart som beskrevs av John Wright och August Heinrich Rudolf Grisebach. Pinguicula filifolia ingår i släktet tätörter, och familjen tätörtsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Birac_(Gironda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Birac_33_Mairie.jpg","page_title":"Birac (Gironda)","context_page_description":"Birac es una población y comuna francesa, situada en la región de Aquitania, departamento de Gironda, en el distrito de Langon y cantón de Bazas."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B8%E0%A4%AC%E0%A4%B8%E0%A5%87_%E0%A4%B2%E0%A4%AE%E0%A5%8D%E0%A4%AC%E0%A5%87_%E0%A4%9A%E0%A4%BE%E0%A4%AA_%E0%A4%B8%E0%A5%87%E0%A4%A4%E0%A5%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Rainbow_Bridge%282%29.jpg","page_title":"सबसे लम्बे चाप सेतु","context_page_description":"यहाँ विश्व के कुछ सर्वाधिक लम्बे चाप सेतुओं की सूची दी गयी है। चाप सेतुओं को प्रायः उनके मुख्य विस्तृति की लम्बाई के अनुसार श्रेणीकृत किया जाता है।"},{"page_url":"https://an.wikipedia.org/wiki/Villaluenga_de_la_Sagra","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Villaluenga.PNG","page_title":"Villaluenga de la Sagra","context_page_description":"Villaluenga de la Sagra ye un municipio d'a provincia de Toledo, en a comunidat autonoma de Castiella-La Mancha, Espanya. A suya población ye de 3469 habitants, en una superficie de 27 km² y una densidat de población de 128,48 hab/km²."},{"page_url":"https://ca.wikipedia.org/wiki/Diego_de_Landa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Diego_de_Landa.jpg","page_title":"Diego de Landa","context_page_description":"Diego de Landa va ser un religiós catòlic castellà, arquebisbe de l'Arquidiòcesi de Yucatán entre 1572 i 1579."},{"page_url":"https://tr.wikipedia.org/wiki/Kostroma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Pano-susanin-square-kostroma.jpg","page_title":"Kostroma","context_page_description":"Kostroma, Rusya'nın batı kesiminde bulunan ve Kostroma Oblastı'nın merkezi olan kent. Volga Nehri kıyısında, Moskova'nın 320 km kuzeydoğusunda yer alır."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%86%AB%E7%99%82%E7%B3%BB%E7%B5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Health_spending_vs_beds_oecd_2008.png","page_title":"醫療系統","context_page_description":"医疗系统，是由人员，机构，加上资源构成的组织，提供医疗卫生服务以满足目标人口的卫生保健需求。\\n世界各地有各种各样的医疗系统，它们的历史和组织结构跟国家的数目一样多。隐含地，各国必须根据自己的需求，以及自己拥有的资源，来设计和开发医疗系统，实际上几乎所有医疗系统中的共同要素都是初级卫生保健和公共卫生措施。 在一些国家里面，医疗系统的规划是交给市场相关业者之间承揽的。\\n在另一些国家，政府，工会，慈善组织，宗教组织，或其他的协调机构之间同心协力，针对他们所服务的人群，提供规划出来的卫生保健服务。然而，卫生保健计划被描述为是一种经常是进化式的，而不是革命性的。 与其他社会制度结构一样，卫生系统可能反映的是它们发生演变所在地的历史，文化，加上经济状况。这些特性使国际之间的比较变得困难，复杂，排除有通用的功能标准的可能性。"},{"page_url":"https://en.wikipedia.org/wiki/Quebrada_Larga,_A%C3%B1asco,_Puerto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Quebrada_Larga%2C_A%C3%B1asco%2C_Puerto_Rico_locator_map.png","page_title":"Quebrada Larga, Añasco, Puerto Rico","context_page_description":"Quebrada Larga is a barrio in the municipality of Añasco, Puerto Rico. Its population in 2010 was 1,532."},{"page_url":"https://nl.wikipedia.org/wiki/Ch%C3%A2teauneuf-du-Faou","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Map_commune_FR_insee_code_29027.png","page_title":"Châteauneuf-du-Faou","context_page_description":"Châteauneuf-du-Faou is een gemeente in het Franse departement Finistère, in de regio Bretagne. De plaats maakt deel uit van het arrondissement Châteaulin."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9B%BE%E8%8E%B1%E9%87%8C_(%E5%8A%A0%E5%88%A9%E7%A6%8F%E5%B0%BC%E4%BA%9A%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Tulare_Water_Tower%2C_California.jpg","page_title":"图莱里 (加利福尼亚州)","context_page_description":"圖萊里，是美國加利福尼亞州圖萊里縣下屬的一座城市。建市於1888年4月5日，面積 大約為20.93平方英里 。根據2010年美國人口普查，該市有人口59,278人。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A8%81%E5%85%8B%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Wake_Island_Memorial_Chapel_damaged_by_Hurricane-Typhoon_Ioke_2006.jpg","page_title":"威克島","context_page_description":"威克島是馬紹爾群島中的小島、北太平洋上的環礁，海岸線長19公里，大約自夏威夷至北馬利亞納群島的三分之二航程。因為它在國際換日線之西，所以比美國50州快近一日，使用UTC+12標準時。威克島是美國的無建制領地，面積6.5平方公里，由威克、威爾克斯和皮爾三個小礁島組成，位於太平洋中被海水淹沒的火山島群中，東距夏威夷3200公里，西距關島2060公里，戰略地位重要，被稱為「太平洋的踏腳石」。威克島暫住人口包括美國軍人、文職人員及一些外勞和軍方承包商等數百人，食品和工業品完全依靠進口。\\n威克島郵政和電話編制上屬於夏威夷，統計上屬於「美國本土外小島嶼」之一。"},{"page_url":"https://fr.wikipedia.org/wiki/Mikha%C3%AFl_Possokhine","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Kudrinskaya_Square_Building_in_Moscow.jpg","page_title":"Mikhaïl Possokhine","context_page_description":"Mikhaïl Vassilievitch Possokhine en russe : Михаи́л Васи́льевич Посо́хин, né le 13 décembre 1910 à Tomsk et mort le 22 janvier 1989 à Moscou est un architecte soviétique, membre de l'Académie des Beaux-Arts d'URSS, l'un des grands concepteurs de l'architecture stalinienne notamment à Moscou. Il était également député du 6ᵉ, 7ᵉ et 8ᵉ Soviet suprême de l'Union soviétique."},{"page_url":"https://it.wikipedia.org/wiki/Zante","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Acqua_Zante.JPG","page_title":"Zante","context_page_description":"Zante è un'isola greca con una popolazione di circa 40 000 abitanti. L'isola si trova nel mar Ionio, vicino alle coste del Peloponneso e fa parte dell'arcipelago delle isole Ionie.\\nZante fu al centro delle battaglie spartano-ateniesi; fu poi una delle isole Ionie sotto il dominio veneziano, durante il quale vi nacque il poeta Ugo Foscolo, che vi dedicò il sonetto A Zacinto; più recentemente, nel 1953 fu devastata da un disastroso terremoto.\\nDal punto di vista amministrativo costituisce un'unità periferica nella periferia delle Isole Ionie formata dall'unico comune omonimo.\\nÈ conosciuta anche per la Spiaggia del Relitto, lido accessibile solo via mare, racchiuso tra due alture e con al centro un relitto di mercantile arrugginito portato lì dalle acque. La spiaggia è la più fotografata di tutta la Grecia e forse del Mar Mediterraneo. Al largo di Zante inizia l'estremità settentrionale della fossa ellenica che tocca nell'abisso Calypso il punto più profondo del Mediterraneo."},{"page_url":"https://en.wikipedia.org/wiki/Rahela_Ferari","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Rahela_Ferari_2007_Serbian_stamp.jpg","page_title":"Rahela Ferari","context_page_description":"Bella Rochel Fraynd, known as Rahela Ferari, was a Serbian actress who appeared in more than ninety films from 1951 to 1993. She was of Ashkenazi origin."},{"page_url":"https://pt.wikipedia.org/wiki/Torre_Montelbaan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Amsterdam%2C_8_am.jpg","page_title":"Torre Montelbaan","context_page_description":"ATorre Montelbaan é uma torre-campanário no quarteirão de Nieuwmarktbuurt, no bairro Centro de Amesterdão, Países Baixos. Construída em 1516 e ampliada em 1606 sob projeto de Hendrick de Keyser o Velho.\\nOriginalmente era uma torre defensiva usada para proteção das docas e dos estaleiros. Hoje é sede do Waterkantoor, o escritório municipal que controla o nível de águas e hospeda a bomba utilizada pela polícia do canal.\\nA Montelbaanstoren é um dos objetos preferidos nas águas-fortes de Rembrandt. Próximo a esta torre encontrava-se a marina da Companhia Holandesa das Índias Orientais onde as embarcações atracavam."},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_del_Golestan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Golestan-takht2.jpg","page_title":"Palazzo del Golestan","context_page_description":"Il Palazzo del Golestān è la residenza storica della dinastia reale Qajar, situata a Teheran. Si tratta del più antico monumento della città, parte di un complesso di edifici un tempo racchiusi dalle mura della storica cittadella.\\nIl complesso dell'Arg testimonia dell'arte e dell'architettura del periodo Qajar, il che comprende anche l'introduzione di motivi e di stili europei nell'arte persiana. il palazzo, oltre a essere la residenza dei sovrani, era anche il luogo di residenza della dinastia e centro della produzione artistica nel XIX secolo. Il palazzo testimonia di un importante periodo culturale e artistico della storia dell'Iran durante il XIX secolo, quando la società persiana conobbe un processo di modernizzazione e di influenze europee: i valori e l'esperienza artistica e architettonica dell'antica Persia vennero integrati in una nuova forma d'arte e di architettura che ebbe un lungo e notevole periodo di transizione dove l'influenza occidentale viene acquisita gradualmente dagli artisti iraniani."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A7%82%E0%A6%B2_(%E0%A6%89%E0%A6%A6%E0%A7%8D%E0%A6%AD%E0%A6%BF%E0%A6%A6%E0%A6%AC%E0%A6%BF%E0%A6%A6%E0%A7%8D%E0%A6%AF%E0%A6%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Kiental_entre_Herrsching_y_Andechs%2C_Alemania_2012-05-01%2C_DD_12.JPG","page_title":"মূল (উদ্ভিদবিদ্যা)","context_page_description":"মূল বা শেকড় হচ্ছে একটি বৃক্ষ বা গাছের ভিত্তি। শেকড়ের নানা ধরন, মাটির নিচের শিকড় ছাড়াও মাটির ওপরেও শেকড় দেখা যায়। এ শেকড়গুলো বের হয় উদ্ভিদের পাতা, কাণ্ড বা অন্যসব জায়গা থেকে।\\nগাছের শেকড় মাটির তলায় অনেকখানি নেমে গিয়ে মাটির ওপর গাছকে সোজা করে রাখে। শেকড় কেবল মাত্র গাছটিকে মাটির উপর শক্ত করে শুধু দাড় করিয়েই রাখে না, সঠিক খাদ্য দ্রব্য খনিজ সরবরাহ করে তার পুর্ণ বিকাশের সুযোগ করে দেয়। তাই এই শেকড় গাছের একটি অন্যতম অংশ। এর মধ্যে থাকে প্রধান একটি মূল বা শিকড়। এই মূল থেকে ছোট ছোট অনেক শেকড় বের হয়।"},{"page_url":"https://de.wikipedia.org/wiki/Bro%C3%BBt-Vernet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Fouranges_03.JPG","page_title":"Broût-Vernet","context_page_description":"Broût-Vernet ist eine französische Gemeinde mit 1.182 Einwohnern im Département Allier in der Region Auvergne-Rhône-Alpes. Sie ist dem Kanton Bellerive-sur-Allier und dem Arrondissement Vichy zugeteilt."},{"page_url":"https://ca.wikipedia.org/wiki/Arc_Tudor","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Gloucester_Cathedral_Front.jpg","page_title":"Arc Tudor","context_page_description":"L'arc Tudor, arc de quatre centres o arc deprimit és un tipus d'arc apuntat que es construeix amb quatre seccions de circumferència, és a dir, amb quatre centres interiors, i que es remata amb una clau en angle. Sol fer l'efecte visual d'haver estat aplanat per la pressió del mur.\\nVa ser molt emprat en l'arquitectura anglesa del segle XV, generalment per disposar finestres als murs dels edificis."},{"page_url":"https://tr.wikipedia.org/wiki/Elektroerozyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Wire_erosion.png","page_title":"Elektroerozyon","context_page_description":"Elektroerozyon, iş parçasına istenilen şekli vermek için elektrik boşalmasından faydalanılan üretim yöntemi. Elektrik iletkeni malzemelere uygulananır. Metal aşındırma işlemi takım görevini yapan bir elektrot ile iş parçası arasında meydana gelen kıvılcımların yardımıyla gerçekleştirilir. Kıvılcımlar, ergime ve buharlaşma yoluyla çok küçük malzeme parçacıkları kaldırarak parça yüzeyini erozyona tabi tutar ve parça üzerinde ufak çukurlar oluşturur. EDM sırasında elektrot ile iş parçası arasındaki mesafe 0,0125 mm ile 0,05 mm arasındadır. Bu mesafe takım ve iş parçası arasında elektrik arkı oluşması için yeterlidir. Yer yer sıcaklığın 8000ᵒC - 12000ᵒC aralığına çıktığı proseste soğutma ve ark aralığını tıkayan aşındırılmış parçaların uzaklaştırılmasında dielektrik sıvı kullanılır. Sirkülasyon hızına bağlı olan dielektrik sıvının performansı, sirkülasyon pompası kullanımı veya benzeri metotlarla arttırılabilir.\\nÇoğunlukla, bakır elektrot olan takım katot, çelik iş parçası ise anottur. Fakat çelik elektrotlar, alüminyum elektrotlar, çelik işlemede kullanılan tungsten - bakır elektrotlar ile kaba işlem için kullanılan grafit elektrotlar bu genellemenin dışındadır."},{"page_url":"https://en.wikipedia.org/wiki/Christianity_in_Turkey","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Tekor_Basilica_in_an_1840s_engraving.jpg","page_title":"Christianity in Turkey","context_page_description":"Christianity in Turkey has had a long history dating back to the 1st-century AD. In modern times the percentage of Christians in Turkey has declined from 20–25 percent in 1914 to 3–5.5 percent in 1927, to 0.3–0.4% today roughly translating to 200,000–320,000 devotees.\\nThis was due to events which had a significant impact on the country's demographic structure, such as the First World War, the genocide of Syriacs, Assyrians, Greeks, Armenians, and Chaldeans the population exchange between Greece and Turkey, and the emigration of Christians to foreign countries that actually began in the late 19th century and gained pace in the first quarter of the 20th century, especially during World War I. Today there are more than 200,000–320,000 people of different Christian denominations, representing roughly 0.3–0.4 percent of Turkey's population, including an estimated 80,000 Oriental Orthodox, 35,000 Catholics, 18,000 Antiochian Greeks, 5,000 Greek Orthodox and 8,000 Protestants."},{"page_url":"https://pl.wikipedia.org/wiki/Tranzystor_jednoz%C5%82%C4%85czowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Opbouw_PUT.jpg","page_title":"Tranzystor jednozłączowy","context_page_description":"Tranzystor jednozłączowy, zwany również diodą dwubazową – półprzewodnikowy element przełączający zawierający jedno złącze p-n i 3 elektrody."},{"page_url":"https://sv.wikipedia.org/wiki/Henri_Fayol","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Fonds_henri_fayol.jpg","page_title":"Henri Fayol","context_page_description":"Henri Fayol, född 1841 i Istanbul, död 1925 i Paris, var en fransk gruvingenjör, gruvförvaltare, författare och direktör för gruvor. Han är känd för teorin Fayolism.\\nHan genomgick efter avslutad skolgång gruvingenjörsskolan i Saint-Étienne och kom 1860 som yngste ingenjör till stenkolsgruvan i Commentry. Gruvan tillhörde koncernen Commentry-Fourchambault som Fayol sedan arbetade för hela sitt liv. Efter tolv år som gruvingenjör blev han 1872 direktör för en grupp gruvor och 1888 administrativ direktör för hela koncernen. Den stod då på konkursens brant, men när Fayol drog sig tillbaka som dess chef 1918 var Commentry-Fourchambault både produktivt och lönsamt. Fayol fortsatte emellertid som styrelsemedlem i koncernen fram till sin död. På regeringens uppdrag genomförde han under sina sista år flera studier av den franska statsförvaltningen.\\nFayol var en duktig gruvingenjör och geolog. Hans forskning och teorier om stenkolsfältens struktur samt hans synpunkter på utnyttjandet av kolförekomsterna kom att ge honom ett brett nationellt anseende. Flera av hans arbeten publicerdes."},{"page_url":"https://pl.wikipedia.org/wiki/Barbara_Bogda%C5%84ska-Paw%C5%82owska","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Grunwald_2010.JPG","page_title":"Barbara Bogdańska-Pawłowska","context_page_description":"Barbara Bogdańska-Pawłowska, z d. Marciniak, ps. Druhna Basia – polska ekonomistka, instruktorka Związku Harcerstwa Polskiego, harcmistrzyni, twórczyni i wieloletnia przewodnicząca Ogólnopolskiego Ruchu Programowo-Metodycznego „Wspólnota Drużyn Grunwaldzkich”, członkini Rady Naczelnej ZHP, wiceprzewodnicząca Centralnej Komisji Rewizyjnej ZHP, Honorowy Obywatel Fromborka i Gminy Grunwald."},{"page_url":"https://en.wikipedia.org/wiki/Zhuhai%E2%80%93Zhuhai_Airport_intercity_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Zhuhai_Chimelong_track.jpg","page_title":"Zhuhai–Zhuhai Airport intercity railway","context_page_description":"Zhuhai–Zhuhai Airport intercity railway, also known as the Zhuji intercity railway, is a regional rail in Zhuhai. The Phase 1 runs from Zhuhai railway station to Zhuhai Changlong railway station, while Phase 2 will terminate at Zhuhai Jinwan Airport. It is operated by China Railway Guangzhou Group. The railway is an extension of the Guangzhou–Zhuhai intercity railway.\\nThe construction of the railway will be split into two stages: Phase 1 from Zhuhai to Zhuhai Changlong. Phase 1 started operation on 18 August 2020. Phase 2 from Zhuhai Changlong to Zhuhai Airport will open in 2023."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Rudolstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/SchlossaufgangVI_rudolstadt_brunnen1.JPG","page_title":"Liste der Kulturdenkmale in Rudolstadt","context_page_description":"In der Liste der Kulturdenkmale in Rudolstadt sind alle Kulturdenkmale der thüringischen Stadt Rudolstadt und ihrer Ortsteile aufgelistet."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%B3%E3%82%B8%E3%83%A5%E3%83%BC%E5%B8%9D%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Sceau_de_Philippe_Auguste._-_Archives_Nationales_-_SC-D157.jpg","page_title":"アンジュー帝国","context_page_description":"アンジュー帝国は、プランタジネット家によって統治された領域の通称。アンジュ帝国とも表記する。正式な国号ではないが、12世紀から13世紀にかけてプランタジネット家が統治した、ピレネー山脈からアイルランドに至る広大な領土は後世に帝国と形容された。プランタジネット家は最盛期にはフランス王国の西半分、イングランド王国全土、アイルランド全土に勢力を拡張した。しかし、フランス国王フィリップ2世との抗争に敗れたことにより、アンジュー、ノルマンディー等のヨーロッパ大陸の領土の大半を喪失した。この敗北によって、プランタジネット家が大陸に保有する領土はガスコーニュのみとなり、百年戦争の遠因となった。"},{"page_url":"https://ja.wikipedia.org/wiki/S%E5%9E%8B%E6%BD%9C%E6%B0%B4%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Soviet_S-1_sea_trials_1936.jpg","page_title":"S型潜水艦","context_page_description":"S型潜水艦は、ソ連海軍の潜水艦の艦級。正式艦級名称は第9系列潜水艦スレドニャーヤである。非公式の渾名はスターリネツ級。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%BA%A5%E5%A5%8E%E6%A0%BC%E5%85%88%E7%94%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/PeterRabbit10.jpg","page_title":"麥奎格先生","context_page_description":"麦奎格先生是英国绘本作家碧雅翠丝·波特创造的一个虚构人物，在比得兔的系列绘本故事里登场，也是该系列中的主要反派。他是一个苏格兰老头，极力阻止饥饿的兔子去偷吃他果园的蔬菜，甚至会把兔子抓来作为馅饼吃掉。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%BE%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Game_of_chance_THAAYAM.jpg","page_title":"தாயம்","context_page_description":"தாயம் எனப்படுவது பண்டைய காலத்திலிருந்து இன்று வரை இந்தியா வில் பரவலாக ஆடப்படும் ஒரு விளையாட்டாகும்.இவ்விளையாட்டை இருவர் முதல் நால்வர் வரை தரையிலோ மேடை மீது வைத்தோ விளையாடலாம்."},{"page_url":"https://eu.wikipedia.org/wiki/Ouroborus_cataphractus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Armadillo_girdle-tailed_lizard.jpg","page_title":"Ouroborus cataphractus","context_page_description":"Ouroborus cataphractus bere generoko animalia bakarra da. Narrastien barruko Cordylidae familian sailkatuta dago."},{"page_url":"https://en.wikipedia.org/wiki/Afro-Asians","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Takahashi_michael.jpg","page_title":"Afro-Asians","context_page_description":"Afro-Asians or African-Asians, are persons of mixed Asian and African ancestry. Historically, Afro-Asian populations have been marginalised as a result of human migration and social conflict."},{"page_url":"https://fr.wikipedia.org/wiki/Allan_Holdsworth","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/AH-1975-s.jpg","page_title":"Allan Holdsworth","context_page_description":"Allan Holdsworth, né le 6 août 1946 à Bradford et mort le 15 avril 2017 à Vista, est un musicien britannique, guitariste et compositeur de jazz.\\nHoldsworth a enregistré dans beaucoup de styles de musique différents, du progressif au jazz allant jusqu'à la pop, ainsi qu'une collaboration avec le groupe de funk fusion britannique Level 42."},{"page_url":"https://es.wikipedia.org/wiki/%C3%81ngeles_Caso","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Foto_de_%C3%81ngeles_Caso_presentando_su_libro_%22GRANDES_MAESTRAS%22.jpg","page_title":"Ángeles Caso","context_page_description":"Ángeles Caso es una escritora, traductora, periodista, editora, política y feminista española."},{"page_url":"https://it.wikipedia.org/wiki/Mobilit%C3%A0_di_Marca","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/MAN_Lion%27s_City_n.3589_MOM.jpg","page_title":"Mobilità di Marca","context_page_description":"La Mobilità di Marca S.p.A. è l'azienda unica di trasporto pubblico su gomma della provincia di Treviso, operativa dal 30 dicembre 2011."},{"page_url":"https://pt.wikipedia.org/wiki/385446_Manw%C3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Manwe-thorondor_hst.jpg","page_title":"385446 Manwë","context_page_description":"385446 Manwë é um objeto transnetuniano binário que está localizado no cinturão de Kuiper, uma região do Sistema Solar. Este corpo celeste está em uma ressonância orbital de 4:7 com o planeta Netuno. Ele possui uma magnitude absoluta de 6,5 e tem um diâmetro estimado com cerca de 151 km.\\nO corpo secundário, Thorondor, é estimado para ter cerca de metade do tamanho do primário, 88 km contra 151 km de Manwë. A curva de luz tem uma grande variabilidade fotométrica, com a magnitude relativa dos dois objetos medidos variadamente 0,6-2,1, ao longo de uns poucos anos."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%DB%8C%D9%84%D9%88%D8%B1%D8%AA%D9%88%D9%86%D8%8C_%D8%A7%D9%88%D9%87%D8%A7%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Silverton_Avenue_from_Home_Street.jpg","page_title":"سیلورتون، اوهایو","context_page_description":"سیلورتون، اوهایو آمریکانین اوهایو ایالتیندا یئر آلان بیر شهردیر و ۲٫۸۷ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۴۷۸۸ نفر و اها‌لی سیخلیغی ۱۶۶۵٫۵ اینسان کیلومتر موربّع دیر. بۇ شهر ۲۵۹ متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر."},{"page_url":"https://de.wikipedia.org/wiki/Eisenbahnbr%C3%BCcke_G%C5%82%C4%99bce","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/POL_Wis%C5%82a_Widok_z_wiaduktu_w_G%C5%82%C4%99bcach.jpg","page_title":"Eisenbahnbrücke Głębce","context_page_description":"Die Eisenbahnbrücke Głębce ist eine historische Eisenbahnbrücke der Bahnstrecke Goleszów–Wisła Głębce, die im Stadtteil Głębce von Wisła in den polnischen Schlesischen Beskiden über den Gebirgsbach Łabajów führt.\\nDas Stahlbetonbogenviadukt wurde 1931–1933 von Stanisław Saski und Tadeusz Mejer gebaut. Es besteht aus sieben Bögen, hat einen Radius von 200 m und ein Gefälle von 23 ‰.\\nDas Viadukt befindet sich unmittelbar vor dem Bahnhof Wisła Głębce."},{"page_url":"https://en.wikipedia.org/wiki/Dichomeris_marginata","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Pl.4-fig.35-Dichomeris_marginata_%28Walsingham%2C_1891%29_%28Brachycrossata%29.jpg","page_title":"Dichomeris marginata","context_page_description":"Dichomeris marginata is a moth in the family Gelechiidae. It was described by Walsingham in 1891. It is found in Gambia.\\nThe wingspan is 15–17 mm. The forewings are pale fawn-brown with a discal spot before the middle and a band of even width from the apex to the anal angle, but not reaching the costal margin, greyish fuscous. There is also an obscure outwardly oblique costal streak of the same colour before the apex and a very faint indication of a second spot at the end of the cell. The hindwings are greyish-fuscous."},{"page_url":"https://en.wikipedia.org/wiki/Hillside_Elementary_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Hillside_School_Aerial_from_south.jpg","page_title":"Hillside Elementary School","context_page_description":"Hillside Elementary School is a 50,302 ft² former public elementary school in the hills of Berkeley, California, at 1581 Le Roy Avenue, bordered by Le Roy Avenue, Buena Vista Way, and La Loma Avenue. It is registered as a local historic landmark and is listed on the National Register of Historic Places."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Lion_et_le_Rat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/La_Fontaine_06.jpg","page_title":"Le Lion et le Rat","context_page_description":"Le Lion et le Rat est la onzième fable du livre II de Jean de La Fontaine situé dans le premier recueil des Fables de La Fontaine, édité pour la première fois en 1668. Les conclusions morales de cette fable sont que On a souvent besoin d'un plus petit que soi et Patience et longueur de temps font plus que force ni que rage.\\nLa signification de la fable est: malgré sa royauté, le lion ne peut pas tout faire et le rat peut faire beaucoup plus de choses. Ainsi faut-il se méfier du plus faible ou du plus fort? Et bien il faut mieux douter du plus faible que du plus fort car le plus faible, comme le rat dans cette fable, peut se montrer plus fort. Donc le plus fort, comme le lion dans cette fable, peut cacher son jeu, donc être le plus faible."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BD%D0%BE%D0%B3%D0%BE%D0%BB%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D1%81%D0%B5%D1%80%D0%B8%D0%B8_%D0%BA%D0%BE%D0%BC%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/StampUSSR1950_1552.jpg","page_title":"Многолетние серии коммеморативных марок СССР","context_page_description":"Как известно, почтовые марки одной серии могут иметь разные даты выпуска. Знаки почтовой оплаты с ясными серийными признаками оформления объединяют в единые серии независимо от года выпуска.\\nМноголе́тняя се́рия, или се́рия, выпуска́вшаяся в тече́ние не́скольких лет, — серия почтовых марок, выпуски которой появлялись в течение двух или более лет по датам выпусков. Другими словами, в датах выпусков формально присутствуют по крайней мере два разных года. При этом в каталоге марок имеется соответствующий текст. Многолетние серии обычно больше обычных, однолетних.\\nОсобый интерес представляют отдельные крупные серии, выпуск которых осуществляется на протяжении нескольких лет. Таких серий не так много. Еще более редки очень большие многолетние серии, которые носят специальное название перманентных.\\nМноголетние серии могут быть важной составной частью структуры каталогов почтовых марок, как это имеет место, например, у каталогов японских марок Сакура, JSCA и JSDA. В этих каталогах перманентные серии даже выделены в отдельные разделы, например, 1-я и 2-я перманентные серии национальных парков."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D1%8C%D0%BC%D0%BE%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Mallemort_-_vue_g%C3%A9n%C3%A9rale.JPG","page_title":"Мальмор","context_page_description":"Мальмор или Маллемор — коммуна на юго-востоке Франции в регионе Прованс — Альпы — Лазурный Берег, департамент Буш-дю-Рон, округ Арль, кантон Пелиссан.\\nПлощадь коммуны — 28,16 км², население — 5590 человек с выраженной тенденцией к росту: 6197 человек, плотность населения — 220,1 чел/км²."},{"page_url":"https://nl.wikipedia.org/wiki/Elisedal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Elisedal%2C_Malm%C3%B6.jpg","page_title":"Elisedal","context_page_description":"Elisedal is een wijk in het stadsdeel Husie van de Zweedse stad Malmö. De wijk telt 10 inwoners en heeft een oppervlakte van 1,59 km². In de wijk zijn diverse bedrijven gevestigd. De straatnamen in de wijk zijn gerelateerd aan paarden."},{"page_url":"https://no.wikipedia.org/wiki/Mathias_Fredriksson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/FREDRIKSSON_Mathias_Tour_de_Ski_2010.jpg","page_title":"Mathias Fredriksson","context_page_description":"Mathias Fredriksson er en svensk langrennsløper.\\nHan har vunnet flere medaljer i OL- og VM-sammenheng, og vant verdenscupen sesongen 2002/2003.\\nHan hevdet seg også i orientering som junior, med blant annet seier i Oringen.\\nMathias er bror av langrennsløperen Thobias Fredriksson."},{"page_url":"https://vec.wikipedia.org/wiki/San_Zorzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Raphael_-_Saint_George_and_the_Dragon_-_Google_Art_Project.jpg","page_title":"San Zorzi","context_page_description":"San Zorzi el xe venerà come santo e martire dała Ciesa catolega. El so culto risałe al IV secoło, el xe visuo 'ntel III secoło e el xe morto prima de Costantin, probabilmente a Lydda, secondo alcune fonti 'ntel 303."},{"page_url":"https://sv.wikipedia.org/wiki/Presidentvalet_i_Burundi_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Domitien_Ndayizeye_2004.png","page_title":"Presidentvalet i Burundi 2015","context_page_description":"Presidentvalet i Burundi 2015 var planerat att hållas 26 juni 2015, men på grund av oroligheterna i landet senarelades det först till den 15 juli, och senare till 21 juli. Flera länder och organisationer vädjade om att valet skulle senareläggas, bland annat EU och USA, vilket regeringen först motsatte sig. Den 11 juni meddelade en grupp om sammanlagt 17 partier att de skulle hoppa av både parlamentsvalet och presidentvalet, något liknande det som hände vid det föregående valet, då de misstänkte att de inte skulle gå korrekt till sedan två av fem medlemmar av valkommissionen flytt landet. En av oppositionsledarna, Agathon Rwasa, uttryckte att han inte tänkte delta i dessa fuskval. Samme Rwasa uttryckte redan dagen därpå att han visst tänkte delta i valet, under förutsättning att beväpnade ungdomasgäng avväpnas och oberoende medier återupptas. Det fanns dock de som stödde den sittande presidenten Nkurunziza i sin kandidatur; exempelvis Robert Mugabe deklarerade att han ansåg det demokratiskt om Nkurunziza valdes av folket en gång till. Flera av kandidater från oppositionen drog sig ur valet i slutskedet, men deras namn blev kvar på valsedlarna."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%AC%E0%A5%87%E0%A4%B9%E0%A5%81%E0%A4%B2%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Bride%26Bridegroom_at_HiltonHanoiOpera.PNG","page_title":"बेहुली","context_page_description":"बेहुली भनेको विवाह हुन लागेकि स्त्री वा महिला हो ।"},{"page_url":"https://de.wikipedia.org/wiki/Hess_Swisstrolley","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Breng_5272-III.jpg","page_title":"Hess Swisstrolley","context_page_description":"Unter der Bezeichnung Swisstrolley, manchmal ST abgekürzt, vertreibt das Schweizer Unternehmen Carrosserie Hess seit 1989 niederflurige Gelenk-Trolleybusse. Die Serie löste die bis dahin in der Schweiz traditionell vorherrschende Typenvielfalt aus Kleinserien und Sonderanfertigungen endgültig ab, darunter auch die teilweise vereinheitlichten Vorgängerbaureihen GTr51 aus den 1950er Jahren, APG aus den 1960er Jahren, 91 GTS und 91 GTL aus den 1970er Jahren sowie BGT 5-25 aus den 1980er Jahren. Abgesehen von der Überlandstrecke Vevey–Villeneuve kommt der Swisstrolley heute auf allen aktiven Schweizer Trolleybusnetzen zum Einsatz. Darüber hinaus wurden Fahrzeuge nach Solingen in Deutschland, Arnheim in den Niederlanden und Limoges in Frankreich geliefert. Bisher wurden bereits über 250 Swisstrolleys produziert. Seit 2012 wird die vierte Generation des Fahrzeugtyps gefertigt. Eng mit dem Swisstrolley verwandt sind die Duo-Busse des Typs NGT 204 F. Mit dem bisher noch nicht in Serie gefertigten Eurotrolley, dem Swissdiesel, dem Swisshybrid, der lighTram Trolley und der lighTram Hybrid gehört der Swisstrolley zur aktuellen Produktpalette von Hess."},{"page_url":"https://vi.wikipedia.org/wiki/Odontophorus_speciosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Odontophorus_speciosus_-_1700-1880_-_Print_-_Iconographia_Zoologica_-_Special_Collections_University_of_Amsterdam_-_UBA01_IZ17100191.png","page_title":"Odontophorus speciosus","context_page_description":"Odontophorus speciosus là một loài chim trong họ Odontophoridae."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2012/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Matilde_Camus_-_Infancia.jpg","page_title":"Lijst van personen overleden in 2012/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2012.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://da.wikipedia.org/wiki/Intercity-Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/ICE2_Erste_Klasse.jpg","page_title":"Intercity-Express","context_page_description":"InterCityExpress, eller bare ICE, er et system af højhastighedstog, der primært kører i Tyskland og dets nabolande. Toget, der er Deutsche Bahns flagskib, er også den højeste produktkategori fra DB Fernverkehr. Brand-navnet \\"ICE\\" er blandt de bedst kendte i Tyskland med et kendskab blandt befolkningen tæt på 100% ifølge DB.\\nNavnet \\"ICE\\" bruges også som en betegnelse for materiellet, der kører på systemet. Dette materiel er udviklet siden de tidlige 80'ere og er designet specifikt til systemet. Der kører fem forskellige udgaver af ICE-toget i Tyskland: ICE 1, ICE 2 og ICE 3 samt ICE-T og ICE-TD. De fire førstnævnte togtyper kører på strøm, mens ICE-TD kører på diesel. De forskellige varianter af ICE 3-toget produceres både af Bombardier og Siemens AG.\\nForuden ruterne i selve Tyskland kan togene også ses i nogle nabolande. Der findes for eksempel ICE 1 og ICE 2-linjer til Zürich og Interlaken i Schweiz og Wien i Østrig. ICE 3-togene kører også til Liège og Bruxelles i Belgien og ved lavere hastigheder til Amsterdam i Holland.\\nI 2007 åbnede en ny rute mellem Paris og Frankfurt / Stuttgart, hvor der køres med såvel ICE- som TGV-tog."},{"page_url":"https://de.wikipedia.org/wiki/Point_Hope","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Village_of_point_hope.jpg","page_title":"Point Hope","context_page_description":"Point Hope ist eine Stadt im North Slope Borough im US-amerikanischen Bundesstaat Alaska."},{"page_url":"https://lt.wikipedia.org/wiki/Erotika","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Naiad1.jpg","page_title":"Erotika","context_page_description":"Erotika – tai įvairios meno rūšys, kurių vaizduojami objektai išryškina nuogo žmogaus kūno grožį, žadina lytinį susijaudinimą, bet nėra vulgarūs. Erotikos terminas taip pat vartojamas nusakant žmogaus jausmingumą, geidulingumą ir seksualumą, tačiau ši sąvoka yra platesnė nei seksualumas.\\nErotinių elementų poveikis žmogui gali būti įvairus – jis priklauso nuo išorės aplinkybių ir vidinės nuotaikos bei vertybių."},{"page_url":"https://it.wikipedia.org/wiki/Veroniciinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Synthyris_reniformis_4979.JPG","page_title":"Veroniciinae","context_page_description":"Veroniciinae è una sottotribù di piante spermatofite, dicotiledoni appartenenti alla famiglia delle Plantaginaceae."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%85%D8%A7%D8%B1%D9%88%D8%8C_%D9%81%D8%B1%DB%8C%D9%88%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Amaro%28UD%29Piazza.jpg","page_title":"امارو، فریولی","context_page_description":"امارو، فریولی ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۸۳۰ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۲۹۶ متر یۇکسک‏لیکده یئر آلیب. و فریولی ونتزیا جولیا اوستانیندا دا یئرلشیب."},{"page_url":"https://de.wikipedia.org/wiki/Adlerstra%C3%9Fe","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/KongHarald_%28Hurtigrute%29v.Adlerstr.jpg","page_title":"Adlerstraße","context_page_description":"Die Adlerstraße ist ein touristisch sehr beliebter Straßenabschnitt der Reichsstraße 63. Sie verbindet die Orte Geiranger am Geirangerfjord und Eidsdal am Norddalsfjord."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%A8%E6%97%A5%E3%83%95%E3%82%A3%E3%83%AA%E3%83%94%E3%83%B3%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%E3%83%AA%E3%82%AB%E3%83%AB%E3%83%86%E5%B0%86%E8%BB%8D_%E6%AE%96%E6%B0%91%E7%BE%A9%E5%A1%BE%E7%8E%84%E9%96%A2%E5%89%8D.jpg","page_title":"在日フィリピン人","context_page_description":"在日フィリピン人は、日本に在住するフィリピン共和国の国籍を持つフィリピン人である。日本に帰化したフィリピン人、およびその子孫のことはフィリピン系日本人と言う。"},{"page_url":"https://sv.wikipedia.org/wiki/Nystvinda","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Khotan-fabrica-alfombras-d08.jpg","page_title":"Nystvinda","context_page_description":"Nystvindan är ett redskap som används vid omlindning av garnhärvor till runda nystan. Garnproducenten har dessförinnan lindat härvan med hjälp av en härvel.\\nStällningen kan snurra runt och är som regel lätt att plocka ihop. Principen bygger på att härvan med sitt runda utförande måste anbringas på något som kan spänna ut härvan, varför en uppspännbar nystkrona används.\\nDen som ingen nystvinda har brukar be någon med två lediga händer att tjänstgöra som härvhållare. Detta innebär dock att garnet hasplas av, varvid tvinningen antingen ökas något eller minskas något för varje varv, allt efter den trådriktning garnet dras av. Detta kan i vissa fall ha betydelse för det alster som garnet skall användas till. Om nystvinda används kommer garnet att rullas av, varvid tvinningsgraden blir oförändrad.\\nTvinningsgraden påverkas även olika om man nystar med tråden i höger hand eller vänster hand. Bäst resultat får man om man systematiskt växlar hand under nystningen."},{"page_url":"https://uk.wikipedia.org/wiki/UNIMA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Marionette_Union.jpg","page_title":"UNIMA","context_page_description":"UNIMA або УНІМА — міжнародна асоціація діячів театрів ляльок, що об'єднує лялькарів по всьому світу; це найстаріша та найобсяжніша театральна організація у світі."},{"page_url":"https://fr.wikipedia.org/wiki/Azzaba_(Alg%C3%A9rie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Photo_azzaba_16112015.jpg","page_title":"Azzaba (Algérie)","context_page_description":"Azzaba, anciennement appelée Jemmapes, à l'époque de l'Algérie française, en arabe : عزابة, en tifinagh : ⵉⵄⴻⵣⵓⴱⴻⵏ,\\nest une commune algérienne, située dans la Wilaya de Skikda, en Algérie."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%27%D1%94%D1%80_%D0%94%D0%B0%D0%BD%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Pierre_Danon.jpg","page_title":"П'єр Данон","context_page_description":"П'єр Дано́н — громадянин Франції, голова правління групи компаній «Воля», заступник голови правління компанії «TDC A/S», «не-виконавчий директор» компанії «Standard Life» у Шотландії, голова правління компаній «Ypso Holding» та «Altice B2B Holding», член ради директорів компанії «Ciel Investment Limited».\\nОдружений на Лоранс Данон, яка є директором з банківських справ компанії «La Compagnie Financière Edmond de Rothschild Corporate Finance» у Парижі.\\nМає двох синів — Давида, який є старшим юристом компанії «Bain Capital» у Лондоні, та Фелікса, який вчиться на економіста."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A6%D0%B8%D0%BB%D0%B8%D0%BD%D0%B4%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Cylinder_geometry.svg","page_title":"Цилиндр","context_page_description":"Цилиндр - юнәлдерүчесе йомык булган цилиндрик өслек һәм цилиндрның нигезләре булып торучы ике параллель яссылык белән чикләнгән геометрик җисем."},{"page_url":"https://it.wikipedia.org/wiki/Giraffa_camelopardalis_rothschildi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Rothschilds_giraffe_at_paignton_arp.jpg","page_title":"Giraffa camelopardalis rothschildi","context_page_description":"La giraffa di Rothschild, Giraffa camelopardalis rothschildi, chiamata così in onore del fondatore del museo zoologico di Tring, Lord Walter Rothschild, nota anche come giraffa di Baringo, dal nome dell'area del lago Baringo, o come giraffa ugandese, è la seconda sottospecie di giraffa più minacciata, dal momento che ne rimangono solo poche centinaia di esemplari. Tutti questi esemplari vivono in natura in aree protette del Kenya e dell'Uganda.\\nRecentemente è stato ipotizzato che la giraffa di Rothschild sia una specie separata dalle altre giraffe e non una semplice sottospecie."},{"page_url":"https://de.wikipedia.org/wiki/Subandrio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Subandrio_1964.jpg","page_title":"Subandrio","context_page_description":"Subandrio war indonesischer Außenminister und stellvertretender Premierminister unter Präsident Sukarno. Nach dem angeblichen Putschversuch der G30S 1965 verbrachte er 29 Jahre im Gefängnis."},{"page_url":"https://en.wikipedia.org/wiki/GM_Gamma_platform","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/2006_Vauxhall_Combo_2000_CDTi_16V_1.2_Front_%281%29.jpg","page_title":"GM Gamma platform","context_page_description":"Gamma is General Motors' global subcompact front-wheel drive automobile platform, first used in the 2000 Opel Corsa C."},{"page_url":"https://vec.wikipedia.org/wiki/Stilo","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Stilo_dal_Consolino.JPG","page_title":"Stilo","context_page_description":"Stilo el xe on comun n'te la provincia de Rejo Całabria chel fa parte de la rejon Całabria"},{"page_url":"https://en.wikipedia.org/wiki/Bellevue,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/The_William_Dyas_Barn.jpg","page_title":"Bellevue, Iowa","context_page_description":"Bellevue is a city in eastern Jackson County, Iowa, United States. The city lies along the Mississippi River and next to Bellevue State Park. In 2019 its population was 2,209; up from a count of 2,191 at the 2010 Census, making it the second-largest city in Jackson County.\\nThe city lies in a valley created by two large bluffs, with the Mississippi River serving as the city's eastern border, and with the Mill Creek valley extending to the west. Geographically, it is part of the southernmost region of the Driftless Area, a portion of North America that escaped all three phases of the Wisconsinian Glaciation.\\nIt is one of the few cities in Iowa to be built near large hills and bluffs, which account for much of the city's economic stimulation as a tourist town. The city attributes its name from the French words 'Belle' and 'Vue' meaning 'beautiful view', as well as an early settler, John D. Bell. The unique history and architecture of Bellevue draw visitors year round, mainly from nearby large population centers."},{"page_url":"https://en.wikipedia.org/wiki/Edmondson-Westside_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/1edmondsonhs07.jpg","page_title":"Edmondson-Westside High School","context_page_description":"Edmondson-Westside High School is a public high school located in the southwest area known as Edmondson Village of Baltimore, Maryland, United States. The school is made up of two buildings, the Edmondson Building which is used primarily for Academic Studies, and the Westside Building which is used for Vocational and Technical Studies such as Culinary Arts, Child Care, Automotive, Media Technology, Computer Programming and Nursing. The Edmondson High building opened in September 1955, originally as Edmondson High School, a co-educational neighborhood comprehensive high school. The Westside Building several city blocks away, known originally as the Westside Skills Center, an independent separate school within the BCPS system, opened up in September 1980 to expand the high school, adding the former closed suburban branch of a local department store. At a later date the two schools were merged to form Edmondson-Westside."},{"page_url":"https://de.wikipedia.org/wiki/Hohlandhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Hohlandhaus%2C_Hohlandstrasse_11_in_Winterthur_2011-09-10_14-13-04.jpg","page_title":"Hohlandhaus","context_page_description":"Das Hohlandhaus ist ein ehemals als Herrenhaus genutzter Fachwerkbau im Winterthurer Stadtkreis Oberwinterthur, dessen Ursprünge im 12. Jahrhundert liegen. Es bildet zusammen mit der Kirche St. Arbogast das historische Zentrum von Oberwinterthur. Das historisch wertvolle Gebäude wird vom Bund in der Liste der Kulturgüter von nationaler Bedeutung im Kanton Zürich geführt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E6%B5%B7%E8%BB%8D%E3%81%AE%E3%83%9F%E3%82%B5%E3%82%A4%E3%83%AB%E7%99%BA%E5%B0%84%E8%A3%85%E7%BD%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/US_Navy_031105-N-0000D-003_USS_O%27Brien_launches_a_surface-to-air_NATO_Sea_Sparrow_missile.jpg","page_title":"アメリカ海軍のミサイル発射装置一覧","context_page_description":"アメリカ海軍のミサイル発射装置一覧は、アメリカ海軍が開発したミサイル発射装置の一覧である。"},{"page_url":"https://pt.wikipedia.org/wiki/Dunga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Aecio_Neves_e_Dunga_-_17-06-2008_%288368243127%29_%28cropped%29.jpg","page_title":"Dunga","context_page_description":"Carlos Caetano Bledorn Verri, mais conhecido como Dunga, é um treinador e ex-futebolista brasileiro que atuava como volante. Atualmente está sem clube.\\nComo jogador, sua maior conquista foi a Copa do Mundo de 1994, disputada nos Estados Unidos, sendo o capitão da Seleção Brasileira. Como treinador, teve sua nomeação para ser o técnico do Brasil em 24 de julho de 2006, conquistando a Copa América de 2007 e a Copa das Confederações de 2009. Retornou ao comando da Seleção no dia 22 de julho de 2014, permanecendo até junho de 2016.\\nFoi considerado pela revista Época um dos 100 brasileiros mais influentes do ano de 2009. Dunga tem ascendência alemã e italiana."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D1%96%D0%BA_%D0%91%D0%B0%D1%80%D1%82%D0%BE%D0%BB%D1%8C%D0%B4%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Martin_Schongauer.JPG","page_title":"Фредерік Бартольді","context_page_description":"Фредерік Бартольді — французький скульптор 19 століття, гучна слава якого значно перевищувала його талант. Автор скульптури «Свободи» в гавані міста Нью-Йорк."},{"page_url":"https://vi.wikipedia.org/wiki/Brevard,_B%E1%BA%AFc_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/NCMap-doton-Brevard.PNG","page_title":"Brevard, Bắc Carolina","context_page_description":"Brevard là một đô thị, quận lỵ quận, tiểu bang Bắc Carolina, Hoa Kỳ. Theo kết quả điều tra dân số năm 2000 của Cục điều tra dân số Hoa Kỳ, thành phố này có dân số người.\\nThành phố này có diện tích km², trong đó có km² là diện tích mặt nước."},{"page_url":"https://no.wikipedia.org/wiki/Geum_(elv)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Daecheong_Dam.jpg","page_title":"Geum (elv)","context_page_description":"Geum er en elv i Sør-Korea. Den har sin kilde i provinsen Nord-Jeolla og fortsetter inn i provinsen Nord-Chungcheong, nær forstedene til Daejeon og videre sørvest gjennom provinsen Sør-Chungcheong før den munner ut i Gulehavet nær byen Gunsan.\\nElva er 396 km lang, noe som gjør den til landets tredje lengste elv eller Koreahalvøyas sjette lengste. Elvas nedbørfelt er på 9 810 km². Den øvre delen av elva flyter sakte gjennom deler av Noryeongfjellet, mens den bukter seg over lavlandet mot havet.\\nElver som renner ut i Geum er Gap-cheon, Yugu-cheon, Miho-cheon, Unsan-cheon, Seokseong-cheon og Nonsan-cheon."},{"page_url":"https://cs.wikipedia.org/wiki/P%C5%99edseda_vojensk%C3%A9ho_v%C3%BDboru_NATO","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/General_of_the_Army_Omar_Bradley.jpg","page_title":"Předseda vojenského výboru NATO","context_page_description":"Předseda vojenského výboru NATO je nejvyšší důstojník Severoatlantické aliance a hlavní vojenský poradce generálního tajemníka NATO. Představuje mluvčího vojenského výboru NATO, což z něj také činí nejvyššího mluvčího NATO ve vojenských záležitostech.\\nVolba předsedy probíhá členskými státy NATO z nominovaných náčelníků generálních štábů. Tradičně do úřadu není nominován Američan. Funkční období je tříleté.\\nPředsedou vojenského výboru NATO je od června 2018 vrchní maršál letectva sir Stuart Peach ze Spojeného království, zvolený v září 2017 z pozice náčelníka vrchního štábu britských ozbrojených sil. Ve funkci nahradil armádního generála české armády Petra Pavla."},{"page_url":"https://tl.wikipedia.org/wiki/Lowell,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Lowell_skyline.jpg","page_title":"Lowell, Massachusetts","context_page_description":"Ang Lowell ay ang pang-apat na pinakamataong lungsod ng Massachusetts, Estados Unidos. Matatagpuan ito sa tagpuan ng mga ilog ng Merrimack at Concord sa hilaga-silangang bahagi ng estado. Ang populasyon nito ay 106,519 katao, ayon sa senso noong 2010."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AA%A8%EC%8A%A4%ED%81%AC%EB%B0%94%EC%9D%98_%EB%A7%88%EC%B2%9C%EB%A3%A8_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Izmailovsky.jpg","page_title":"모스크바의 마천루 목록","context_page_description":"모스크바의 마천루 목록에는 높이가 100미터 이상인 건물이 포함되어 있다.\\n건물 아래에 있는 건물은 규칙적인 간격으로 레벨로 나누어진 건물이나 사람들의 체류를 목적으로 하는 건물을 의미한다. 급수탑, 돛대, 굴뚝 및 기타 기술 건물은 구조이므로이 범주에 속하지 않는다). 건물의 이름에 «타워»라는 단어가 있는 경우 비유적 의미로 사용된다."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrali_in_Scozia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/St_Paul%27s_Cathedral%2C_Dundee.jpg","page_title":"Cattedrali in Scozia","context_page_description":"Questa è una lista delle cattedrali della Scozia:"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%A1%E9%83%A8%E4%BF%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Flag_of_Former_Iwata_Shizuoka.JPG","page_title":"渡部修","context_page_description":"渡部 修は、日本の政治家。静岡県磐田市長。"},{"page_url":"https://en.wikipedia.org/wiki/The_Lawn_(Nokesville,_Virginia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/THE_LAWN%2C_PRINCE_WILLIAM_COUNTY.jpg","page_title":"The Lawn (Nokesville, Virginia)","context_page_description":"The Lawn is a historic home and national historic district located near Nokesville, Prince William County, Virginia. The main house was built in 1926 to replace the original Gothic Revival style dwelling that burned in a fire in 1921. It is a two-story, three-bay, Tudor Revival style, stuccoed dwelling. The house features half-timber framing and a complex cross gable roof. Attached to the house is a brick kitchen wing that survived from the original house. Also included in the district are a board-and-batten schoolhouse, barn, smokehouse, overseer's cottage, privy, stone dairy, and stone root cellar.\\nIt was added to the National Register of Historic Places in 1989."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%DA%86%D9%88%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Coat_of_Arms_of_Pechora_%28Komia%29_%281983%29.png","page_title":"پچورا","context_page_description":"پچورا روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و کومی جومهوریتینده یئرلشیب. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا 43105 نفر دیر."},{"page_url":"https://en.wikipedia.org/wiki/Cahors_wine","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Cahors_Chateau.jpg","page_title":"Cahors wine","context_page_description":"Cahors is a red wine from grapes grown in or around the town of Cahors, France. Cahors is an Appellation d'origine contrôlée which forms part of the South West France wine region. The dominant grape variety in AOC Cahors wines is Malbec, which must make up a minimum of 70% of the wine, and which is known locally as \\"Auxerrois” or \\"Côt\\". It is supplemented by up to 30% Merlot and Tannat.\\nThere are 4,200 hectares of Cahors vineyards, with a planting density of at least 4000 vines per ha. The designation AOC Cahors may only be used for red wines. There is also some white and rosé wine produced in the same area, and it is sold under the designation Vin de Pays du Lot instead.\\nToday's wine growing area lies mainly west of the town of Cahors. The most important places are Mercuès, Parnac, Luzech, Prayssac, Grézels, Puy-l'Éveque and Vire sur Lot. They are all located in the valley of the Lot."},{"page_url":"https://sv.wikipedia.org/wiki/R%C3%B6rhj%C3%A4rtan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Branchiostoma_lanceolatum.jpg","page_title":"Rörhjärtan","context_page_description":"Rörhjärtan är kontraktila blodkärl som fungerar som ett hjärta hos vissa enklare djur och också namnet på en grupp av djur med sådana, Leptocardii. Den mest kända arten av dessa är lansettfiskarna, en understam av ryggsträngsdjur."}]`),T={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],H={key:0},R={key:1};function N(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",L,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),D(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",G,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",R,"Loading...")):(t(),n("span",H,"See more"))],8,I)):p("",!0)])}const K=g(T,[["render",N],["__scopeId","data-v-5f1d7ab6"]]),V=JSON.parse('{"title":"","description":"","frontmatter":{"page":true},"headers":[],"relativePath":"quotes/24.md","filePath":"quotes/24.md"}'),q={name:"quotes/24.md"},W=Object.assign(q,{setup(a){return(e,s)=>(t(),n("div",null,[f(K)]))}});export{V as __pageData,W as default};
